INSERT INTO `bitacora` VALUES (857,32,'Inicio del proyecto','Relevación y análisis del proyecto en cuestión para poder realizarlo de la mejor manera posible','2019-02-13'),(858,32,'Proyecto Restaurante','En el día de hoy realicé el diagrama de Gantt donde se indican todas las tareas a realizar','2019-02-14'),(859,32,'Desarrollo aplicación web','Comencé a desarrollar las funcionalidades que tiene la aplicación web','2019-02-15'),(860,32,'Funcionalidades','Me habia olvidado de cargar la bitacora del dia 16, pero basicamente lo que hice fue programar una funcion llamada reservas que permite al usuario reservar mesas para x dia','2019-02-17'),(861,32,'Funcionalidades app','Hoy continue con las funcionalidades de la aplicación web, desarrollando otras 4 mas, llamadas Productos, categorías, mesas y aún me falta por finalizar la ultima, llamada Ventas. donde queda un registro de lo que se vendió hoy.','2019-02-18'),(862,32,'Pruebas unitarias del proyecto','Se está probando la aplicación web para ver si hay fallos','2019-02-19'),(863,32,'Proyecto','Pruebas integrales de la aplicacion web','2019-02-20'),(864,32,'Proyecto restaurante','documentación e implementación del proyecto.','2019-02-22'),(865,42,'Introducción y cv','Escuche los objetivos de la materia y cree un cv desde 0. ','2019-03-21'),(866,47,'Desarrollo de CV','Hoy el profesor nos explico de que va la materia, me registre a esta página (encuentro tecnologico) y hice el cv. ','2019-03-21'),(867,36,'desarrollo de cv','hoy me registre a esta pagina, me saque foto de mi cara para enviarselo al profe, me hice un curriculum para mandarlo tmb y termine. ','2019-03-21'),(868,51,'Introduccion y CV','hoy tuvimos la introducción a la materia, que es lo que vamos a realizar durante el año, como nos vamos a organizar, hablamos de la posibilidad de hacer practicas afuera del cole y nos dimos a la tarea de crear un Curriculum Vitae','2019-03-21'),(869,43,'Presentación de la materia y creación del CV','Hoy estuvimos en clase aprendiendo de lo que íbamos a hacer en el año, también creamos el CV y lo enviamos.','2019-03-21'),(870,44,'Desarrollo de CV e introduccion a la materia.','El profesor Olaso nos explico como nos vamos a manejar en la materia y nos separaron por grupos.También hice mi CV y me registre a esta pagina.','2019-03-21'),(871,48,'Presentación de la materia, registro en la pag de la materia y hacer cv','Escuchamos de que se trataba esta materia, nos registramos en la pag web de la materia y realizamos nuestro cv ','2019-03-21'),(872,41,'Presentación de la materia y creación del cv','En el día del 21/03 los profesores se presentaron y explicaron de que se va a tratar la materia  y nos pidieron que creemos nuestro Curriculum vitae.','2019-03-21'),(873,55,'Presentación de la materia y creación del curriculum ','Hoy no presentaron la metería y nos explicaron las pautas y objetivos de esta misma, también creamos un curriculum.','2019-03-21'),(874,50,'Introducción a la materia','El profesor nos presento la metodología de trabajo de las practicas profesionalizantes seguido de registrarnos en la pagina de &quot;encuentrotecnologico&quot;. Por ultimo, creamos un curriculum para cada uno y se lo enviamos al profesor.','2019-03-21'),(875,39,'Introduccion a la materia','El profesor nos presentaron la metodologia de trabajo de las practicas profesionalizantes seguido de registrarnos en la pagina de &quot;encuentro tecnologico&quot;. Por ultimo, creamos un curriculum para cada estudiante y se lo enviamos al profesor.','2019-03-21'),(876,53,'Introducción de la materia','El profesor hablo sobre la materia y como la cursaríamos, escribió un mail al que se tenia que enviar un curriculum, si ya lo tenias armado no hacia falta armarlo y el que no bueno, tenia que hacerlo. Al terminar eso escuche la radio.   ','2019-03-21'),(877,46,'Introduccion de la materia','Hoy el profesor nos hablo de como sera el trabajo en la materia, respondio nuestras dudas y terminamos armando el curriculum vitae ','2019-03-21'),(878,56,'','Se hizo la presentación de la materia &quot;Practicas Profecionalizantes&quot;, se realizo un registro de usuarios en el dominio &quot;www.encuentrotecnologico.com/pp&quot; y se finalizo la jornada con una realización y entrega de curriculums vitae','2019-03-21'),(879,37,'Presentación + CV','Los profesores Damian Olaso y Gonzalo Consorti nos explicaron de qué trata la materia, las diferentes opciones de estudio que tenemos durante el año (Ya sea dentro del colegio o yendo afuera a la empresa que se nos sea designada), las formas de calificación, los requisitos para aprobar la materia, los horarios mínimos que debemos cumplir a lo largo del año, y la web mediante la que nos manejaremos(Ésta misma).\nTambién tuvimos la tarea de crear un Curriculum Vitae y enviarlo mediante un e-mail, para brindar a los profesores.','2019-03-21'),(880,45,'Introducción de la materia','olaso nos introdujo a la materia practicas profecionalizante despejo dudas cada uno se matriculo en encuentro tecnológico e \nhicimos nuestro propio curriculum','2019-03-21'),(881,36,'preguntas y git','escribimos en un papel entre todos las preguntas para el programa de preceptores y respondi las preguntas de git','2019-03-22'),(882,43,'Preguntas y Git','Hoy nos tuvimos que sentar todos en una mesa para pensar preguntas para hacérselas al preceptor y que las responda. Luego, tuvimos que responder dos preguntas acerca del Git que se trataban de que se trataba y cuales eran los comandos, también una tarea para casa sobre hacer un proyecto.','2019-03-22'),(883,48,'Realizamos preguntas, y buscamos informacion sobre git','Nos reunimos en el medio del aula conversando para realizar una serie de preguntas que usaremos para programar una aplicacion que tiene que ver con la preceptoria del colegio, Luego buscamos en internet informacion de que se trataba el GIT y buscar cuales eran sus comandos mas usados.','2019-03-22'),(884,51,'Sistema para preceptoria y &quot;GIT&quot;','hoy estuvimos pensando en preguntas que se le pueden hacer a un preceptor/a para hacer a futuro una app donde digitalice todo sus tareas y averiguamos sobre el termino &quot;GIT&quot;. buscamos cual es su función y describimos la función de sus comandos mas utilizados','2019-03-22'),(885,42,'Introducción a GIT','El profesor nos presento un nuevo tipo de sistema o comando, del cual tuvimos que investigar los conceptos básicos, también tuvimos que formularnos unas preguntas para un futuro proyecto en el cual tendremos que entrevistar a los preceptores para hacer un tipo de aplicación o pagina web para simplificar sus tareas.\n','2019-03-22'),(886,47,'Preguntas y investigacion sobre GIT','Escribimos preguntas para hacerle a los preceptores sobre la gestión de preceptoria y investigue y respondí preguntas sobre GIT.','2019-03-22'),(887,37,'Proyecto preceptoria + .GIT','En el día de hoy tuvimos la tarea de escribir preguntas para realizar en un futuro a preceptoria, con el fin de crear una aplicación que facilite su trabajo con las respuestas a éstas preguntas. Luego de esto, averiguamos sobre .GIT, sus funciones, sus comandos y los más utilizados. Deberemos usar .GIT a lo largo de todo el año para todos nuestros proyectos.','2019-03-22'),(888,54,'sistema de gestión para preceptoria','En el día de la fecha nos encargamos de realizar un cuestionario para luego resolver dudas cuestionando le las mismas a los preceptores del colegio para confeccionar el sistema de gestión para preceptora ','2019-03-22'),(889,39,'Introduccion a git','Hoy vimos un tipo de comando llamado Gitlab y Github, realizamos un trabajo en el cual describimos su funcion y codigo. Sumado a una actividad grupal en al que desarrollamos preguntas para una aplicacion sobre preceptoria.','2019-03-22'),(890,50,'Introducción a GIT','El profesor nos presento el concepto básico del sistema &quot;GIT&quot;, el cual utilizaremos para el desarrollo del proyecto final. Seguido de esto, de manera grupal sugerimos distintas preguntas para llevar a cabo una entrevista con los preceptores y otras entidades de la escuela.','2019-03-22'),(891,44,'Preguntas para prefceptoria y GIT','Desarrollamos varias preguntas para hacercelas a los preceptores y así realizar una aplicacion para ayudarlos en su trabajo. Una vez terminadas las preguntas buscamos informacion sobre GIT (GIT HUB Y GIT LAB). ','2019-03-22'),(892,57,'Preguntas y Git','Realizamos preguntas para para preceptoría para completar los datos en una aplicación para así facilitarles el trabajo y respondimos algunas preguntas sobre lo que significaba el Git.','2019-03-22'),(893,55,'Realización de preguntas y Git','Nos sentamos en el centro del aula y estuvimos haciendo preguntas al preceptor, luego tuvimos que responder dos preguntas relacionadas con el GIT. ','2019-03-22'),(894,38,'Proyecto preceptoria y .GIT','En el día de hoy tuvimos la tarea de escribir preguntas para hacerles  a preceptoria, con el fin de tomar esas preguntas como referencia para, nosotros,  crear una aplicación que facilite su trabajo. Luego de esto, averiguamos sobre .GIT, sus funciones, sus comandos y los más utilizados. ','2019-03-22'),(895,52,'Introducción a GIT','en este dia aprendimos sobre git para futuros proyectos de fin de año','2019-03-22'),(896,53,'Introducción sobre el proyecto','Empezamos la clase con una charla de que se tendría que crear un proyecto para ayudar o veneficiar el trabajo a los preceptores, el profesor nos dijo que tengamos que armar preguntas para así luego los preceptores tengan que responder( o eso pienso hoy), buscar información sobre GIT y sus comandos.','2019-03-22'),(897,40,'Sistema para preceptoria y &quot;GIT&quot;','Hoy realizamos una serie de preguntas junto con todo el curso sobre las tareas que hace la preceptoria, para luego desarrollar una aplicacion que facilite sus tareas, luego investigamos sobre una aplicacion llamada GIT como funciona y los comandos mas utilizados.','2019-03-22'),(898,41,'Reunión entre todos y buscamos información sobre git','En el día de 22/03 nos juntamos todos los alumnos a hacer preguntas para realizar una aplicación de sistemas de gestión de preceptoria, después buscamos información sobre cuáles son las funciones del git. ','2019-03-22'),(899,58,'realizar preguntas y buscar informacion sobre el git','hoy nos juntamos en la mesa todos e hicimos preguntas para desarrollar una aplicacion sobre como mejorar preceptoria y despues de hacer la preguntas. Busque informacion sobre el git que es? cuales su funcion? los comandos mas utilizados del git.','2019-03-22'),(900,45,'sistema de gestión para preceptoria','hoy hicimos un cuestionario de gestión de preceptoria y vimos algunas cuestiones con el git','2019-03-22'),(901,60,'Introduccion a GIT','El dia de hoy tuvimos que organizarnos con todo el curso para comenzar hacer una aplicación que ayudaría a la preceptoria.\nLuego tuvimos que investigar la función y los comandos mas utilizados en GiT.\nComo ultimo punto tenemos que hacer un mini proyecto para poder aprender a utilizar esos comandos.','2019-03-22'),(902,56,'Introducción a GIT','se empezó con una explicación sobre el tema, entre todos pensamos un cuestionario para posteriormente comenzar un proyecto para un sistema de gestión para preceptoria.','2019-03-22'),(903,47,'Preguntas para preceptoria en grupo','En grupo hicimos preguntas para preguntar a los preceptores, mi grupo era de observar comportamiento de alumnos.','2019-03-28'),(904,51,'Preguntas de Preceptoria','Formamos grupos de 4 y anotamos preguntas que les tenemos que hacer a los preceptores, nuestro tema era &quot;Pasar Notas&quot;','2019-03-28'),(905,42,'Trabajo en grupo','Comenzamos con una breve charla del profesor, luego hicimos una lluvia de ideas entre todo el curso y para finalizar el día de trabajo formamos grupos e hicimos preguntas para las encuestas que se van a hacer a los preceptores en base al programa que vamos a desarrollar a lo largo del año. ','2019-03-28'),(906,44,'Preguntas para la preceptoria.','Desarrollamos varias preguntas dirigidas para los preceptores de la sección &quot;Cumincados a alumnos&quot; .','2019-03-28'),(907,48,'Realizamos Preguntas sobre el software que desarrolaremos en lo largo del año','Comenzamos la clase sobre un resumen, luego comenzamos a realizar preguntas entre todos relacionado al software.\nMas tarde nos separamos en diferentes grupos para realizar preguntas basado al tema que le toco a cada grupo','2019-03-28'),(908,38,'Brainstorm y Desarrollo de preguntas sobre el tema de solicitud de certificados','En el dia de hoy el profesor nos dividió en grupos de aproximadamente 4 personas por equipo en el cual los equipos tenian que desarrollar diferentes tipos de preguntas sobre algun tema en especifico, esos temas fueron elegidos por los profesores y los alumnos mediante una brainstorm(lluvia de ideas) . El tema que nos toco fue solicitud de certificados','2019-03-28'),(909,53,'Seguimientos de las preguntas ','Este dia 27/03/2019 Al iniciar la clase charlamos un rato para armar las preguntas, luego nos dividieron en grupos para los mismo pero ahora cada uno se dedicaba a diferentes temas para armar las preguntas.','2019-03-28'),(910,36,'preguntas de preceptor para un programa','escribimos enuna hoja las preguntas a realizar a los preceptores en grupo ','2019-03-28'),(911,56,'Preparación de cuestionario en grupos','Se dialogo de forma grupal distintas tareas que realizan los preceptores día a día en su trabajo. Nos dividimos en subgrupos y formamos un cuestionario, según cada tarea hablada anteriormente.','2019-03-28'),(912,43,'Que pasaba si reprobabamos la materia y preguntas al preceptor','Primero el profesor nos dijo que pasaba si reprobábamos su materia y que tendríamos que hacer. También, tuvimos que hacer grupos y hacer preguntas que le haríamos al preceptor de cierto tema. ','2019-03-28'),(913,40,'Desarrollo de Preguntas','hoy hicimos una lluvia de ideas sobre como realizan las tareas los preceptores entre todo el curso, luego nos dividimos en grupos encargándonos de realizar preguntas sobre cada tarea.','2019-03-28'),(914,58,'cuestionario para los preceptores','comenzamos con una charla sobre la materia de que pasaria si no aprobamos la materia ,luego hicimos unas preguntas para los preceptores de como es su materia','2019-03-28'),(915,37,'Brainstorm y preguntas para el software.','Hoy hicimos una Brainstorm entre todo el curso, para definir sobre qué temas se van a basar las preguntas que hagamos en un futuro para el desarrollo del software. Luego de ésto, fuimos separados en grupos para realizar éstas preguntas. Cada grupo tenia un tema en particular.','2019-03-28'),(916,57,'Preguntas de Preceptoria','Realizamos preguntas para agilizar el trabajo de los preceptores y para contestar algunas de nuestras dudas, todo esto para introducirlo en un programa a futuro. Nos dividimos las diferentes tipos de preguntas que podríamos hacerle a los preceptores.','2019-03-28'),(917,49,'preguntas sobre el tema de solicitudes de certificados ','Hoy hicimos la lluvia de ideas para poder implemetar los temas,  el profesor nos dividio en grupos de a 4 para hacer preguntas sobre el tema de solicitudes de certificados y tambien entregamos el curriculum vitae.\n\n','2019-03-28'),(918,52,'Trabajo en grupo','el dia de la fecha realizamos una serie de preguntas para el desarrollo de una aplicación web, luego fuimos divididos en grupos para realizar distintas tareas con esta aplicación con preguntas realizadas para tener mas preguntas con conceptos distintos.','2019-03-28'),(919,41,'preguntas sobre el sistema de gestion de preceptoria','en el día 28/03 nos reunimos entre todos a hacer preguntas sobre la aplicación y después nos juntamos de a grupos mas chicos a centrarnos en algunas preguntas especificas sobre el software ','2019-03-28'),(920,46,'Preparación de cuestionario en grupos','en la clase de hoy dimos un brebe repaso de la introduccion y como es el metodo para aprobar la materia los que se la llavan a diciembre.\narmanos 6 grupos de cuatro personas para trabajar con la tarea asignada que concta en el metodo que trabaja la escuela, a mi grupo le toco la comunicacion con los padres.\n','2019-03-28'),(921,60,'Software de Preceptoria','El día de hoy se profundizo con el tema de crear un programa para informatizar la preceptoria del colegio, hicimos 2 actividades.\n\nUna fue una lluvia de idea que se hizo &quot;entre&quot; todos los alumnos del curso con la ayuda del profesor\nluego de eso nos dividimos en grupos y nos dieron distintas preguntas a cada grupo y sobre esa pregunta de tuvo que profundizar.','2019-03-28'),(922,54,'Preguntas para el software','En el día de hoy realizamos un brainstorming (lluvia de ideas) luego nos dividimos en grupos con el fin de realizar preguntar preguntas sobre las tareas que realiza un preceptor','2019-03-28'),(923,50,'Preparación de la entrevista','Entre todo el curso planteamos distintos tópicos a tratar en la entrevista a realizarse próximamente. seguido de esto, nos dividimos en distintos grupos, y cada uno de estos se encargo de desarrollar preguntas para cada tópico. ','2019-03-28'),(924,61,'Preguntas para el proyecto','En el dia de hoy 28/03/19 escribimos preguntas para poder desarrollar el proyecto','2019-03-28'),(925,45,'cuestionario para los preceptores parte 2','al principio el profe volvió a dar una breve explicación de la materia y luego dimos una lluvia de ideas entre todos pero no rendía y nos separamos en grupos cada uno dando ideas diferentes de diferentes temas.','2019-03-28'),(926,45,'introduccion a los diagramas gantt','hoy estuvimos viendo e investigando sobre los diagramas gantt y empezamos ordenando las preguntas de la clase pasada','2019-03-29'),(927,49,'investigar ','En el dia de hoy ordenamos las preguntas sobre la solicitud de certificado e investigamos sobre el diagrama de gantt.','2019-03-29'),(928,37,'Diagrama de Gantt y preguntas para el software','Continuamos puliendo nuestras preguntas para los preceptores que habíamos empezado la clase pasada, y comenzamos a hacer un Diagrama de Gantt sobre la aplicación','2019-03-29'),(929,39,'Preguntas/diagrama de gantt','Terminamos de hacer las preguntas grupales y comenzamos a hacer una diagrama de gantt sobre un software y como se crea de principio a fin.','2019-03-29'),(930,40,'Preguntas y diagrama de gantt','hoy estuvimos terminando las preguntas que vamos a realizar para el desarrollo de la aplicacion y comenzamos a realizar el diagrama de Gantt para el software ','2019-03-29'),(931,41,'Realizar diagrama de Gantt sobre algún software','En el día de 29/03 nos reunimos para seguir haciendo y ordenar las preguntas sobre la aplicación, después nos dividimos para hacer un diagrama de Gantt sobre un software que se va a estar relacionado a bancos','2019-03-29'),(932,43,'Ordenamos las preguntas y hicimos en hoja el diagrama de gantt','Tuvimos que ordenar las preguntas del 28/3 y fueron a preguntarle al preceptor para responderlas, pero no estaba por lo que hicimos ese diagrama en hoja, para luego pasarlo a la app\n','2019-03-29'),(933,54,'Preguntas y diagrama de gantt','En el día de la fecha nos encargamos de terminar con el desarrollo de las preguntas de la clase pasada y empezamos a realizar un diagrama de Gantt del software','2019-03-29'),(934,38,'Desarrollo final de las preguntas y Diagrama de Gantt','En el dia de hoy los que no terminaron las preguntas sobre el tema de cada grupo tuvimos un rato para terminar de desarrollarlas, al terminar la tarea los profesores nos pidieron que vayamos a realizar las preguntas al area correspondiente que en este caso era preceptoria. A mitad de clase los profesores nos pidieron que realicemos un diagrama de Gantt en el cual teníamos que explicar el desarrollo de una aplicacion.','2019-03-29'),(935,61,'Diagrama de grand','Hoy hicimos un diagrama de grand de un software sobre un banco y tambien organizamos las preguntas del dia de ayer','2019-03-29'),(936,58,'Ordenamos el cuestionario que hicimos para los preceptores','hoy ordenamos las preguntas de ayer y fuimos a preguntarle a los preceptores e hicimos el diagrama de gantt en grupo ','2019-03-29'),(937,42,'Organización de objetivos y armado de diagramas','Organizamos los grupos de mejor manera, armamos cuestionarios con orden numérico en base a la importancia de las preguntas, se hicieron las debidas encuestas para recaudar información para el proyecto y se armaron los diagramas necesarios.','2019-03-29'),(938,57,'Entrega de preguntas de los preceptores y diagrama de gantt','Entregamos las preguntas y realizamos el diagrama en grupo para crear un software','2019-03-29'),(939,51,'Empezamos a usar el Proyect','hoy el profe nos dió la tarea de hacer un proyecto en el Proyect en el que consistia en un software y nosotros nos basamos en el software de un banco','2019-03-29'),(940,47,'Entrega de preguntas de los preceptores y diagrama de gantt','Entregamos las preguntas y realizamos un diagrama de gantt en grupo para crear un software','2019-03-29'),(941,55,'Termina de ordenamos las preguntas y hicimos en hoja un diagrama de gantt','Tuvimos que ordenar las preguntas de ayer y fuimos a preguntarle al preceptor para responderlas luego de eso hicimos un diagrama de Gantt en hoja, para luego pasarlo a la app.\n','2019-03-29'),(942,36,'entrega de preguntas y diagrama de gantt','entregamos las preguntas para preceptores y realizamos el diagrama de gantt para el desarrollo de software','2019-03-29'),(943,53,'Organización de objetivos y armado de diagramas','Al iniciar la clase reorganizamos las preguntas luego nos dijeron que ar amaramos un diagrama de gantt para un software por el momento tenemos lo básico de ese diagrama ','2019-03-29'),(944,52,'ordenado de proyectos y armado de diagrama','realizamos una reorganización de las preguntas por orden de prioridad, luego realizamos diagramas de gant para organizar el periodo de tiempo de organización de cada tipo de materia realizada y lo que vamos a realizar hasta el final del proyecto.','2019-03-29'),(945,60,'Continuacion del proyecto sobre el software de preceptoria','El dia de hoy se continuo con el proyecto, el profesor elejio una persona de cada grupo para que lleve las preguntas y puedan ser respondidas por una autoridad de la preceptoria.\n\nAparte de esto, también nos dividió en 3 grupos a los cuales se nos fue asignado distintos objetivos ','2019-03-29'),(946,50,'Entrega de preguntas y diagrama de gantt','El profesor dio su veredicto en cuanto a las preguntas que se generaron para la entrevista, luego, a cada grupo se le asigno una sección a realizar del primer trabajo practico de la materia. Mi grupo se encargara de la realización de los diagramas correspondientes al software a desarrollar, entre otros.  ','2019-03-29'),(947,52,'cambio de turno y vista de nuevos proyectos','cambiamos de turno con la mitad del curso de la noche y la otra de la mañana, también repasamos como en el inicio de clases de programación orientada a objetos, rehicimos el CV y empezamos con la carpeta de campos.\ny con respecto al nuevo proyecto por el momento individualmente tenemos que hacernos un brainstorming para oficina de alumnos.','2019-04-09'),(948,54,'Formulario','Hoy realizamos una encuesta personal','2019-04-09'),(949,49,'Formulario','Hoy realizamos el formulario.','2019-04-09'),(950,43,'CV y Evaluación Personal','Hoy tuvimos que hacer nuevamente el CV para enviárselo al profesor por gmail y luego hacer un formulario de personal, donde te daban preguntas y respondías con un número del 1 al 10, siendo en total 9 páginas.','2019-04-09'),(951,47,'CV y evaluación personal','Hice el CV y una evaluacion personal','2019-04-09'),(952,41,'Presentación de la materia ','En el día 09/04 el profesor Nahuel nos presento la materia y nos mezclaron con algunos alumnos del ib, volvimos a crear nuestros CV y el formulario de evaluación personal.','2019-04-09'),(953,57,'Currículum y evaluación personal','Completamos nuestro currículum y se lo entregamos al docente, luego, realizamos una evaluación personal para decir cómo somos en algunos aspectos.','2019-04-09'),(954,40,'Formulario','hoy tuvimos una introduccion de las practicas, realizamos el formulario y empezamos a pensar preguntas de problematicas de oficina de alumnos.','2019-04-09'),(955,38,'Entrega de CV y Formulario','Hoy hicimos la entrega nuevamente del curriculum vitae y a continuacion realizamos un formulario con preguntas que teniamos que responder con numeros del 1 al 10 como por ejemplo, empatia del 1-10, compañerismo, etc, al finalizar la clase empezamos a pensar en un proyecto con el fin de ayudar a la oficina de alumno','2019-04-09'),(956,36,'cv y formulario','mande el curriculum y complete la evaluacion personal','2019-04-09'),(957,67,'CV y Presentacion de Practicas Profecionalizantes','Hoy hice mi CV y nos presentaron la materia Practicas Profecionalizantes.','2019-04-09'),(958,73,'CV y Presentacion de Practicas Profecionalizantes','Fue la primera clase de Practicas Profesionalizante en la cual hicimos un cv y nos presentaron la materia.','2019-04-09'),(959,64,'Conceptos Basicos de la Materia','En el dia de la fecha hice el CV.\nMe Registre en encuentro tecnológico.\nY me enseñaron sobre la materia.\n','2019-04-09'),(960,65,'CV','CV incompleto','2019-04-09'),(961,66,'Primer clase','Hoy se dio una presentación a lo que es practica profesionalizante, y tambien hice un curriculum vitae','2019-04-09'),(962,71,'Primer clase','Introduccion de Practias \nCv pendiente','2019-04-09'),(963,68,'Formulación del CV','CV incompleto.','2019-04-09'),(964,63,'Primera clase','Hicimos una presentación de la materia en la que se centro mas que nada en los requerimientos para la aprobación de la misma, posteriormente iniciamos la realización de nuestro cv ','2019-04-09'),(965,43,'Preguntas para la oficina de alumnos, Git y áreas de trabajo','Nos dividieron en grupos y cada uno tuvo que hacer preguntas para la oficina de alumnos. En este caso, uno hizo preguntas y el otro funcionalidades. Luego, vimos vídeos de Git de un youtuber llamado: &quot;CodigosFacilitos&quot;. También, tuvimos que decir que sector preferíamos estar, ya sea Desarrollador, Diseñador, Servidores y Base de Datos. Cada uno eligió el que quería y una alternativa.','2019-04-10'),(966,47,'Preguntas para oficina de alumnos y investigacion sobre el uso de GIT','Hicimos preguntas para preguntarle a la oficina de alumnos para hacer una aplicacion donde se puedan manejar mejor. Tambien investigamos como empezar a usar GIT.','2019-04-10'),(967,57,'Preguntas a oficina de alumnos e investigación sobre el uso de git','Realizamos en grupos varias preguntas y funcionalidades para agilizar el trabajo que maneja oficina de alumnos mediante una aplicación y luego investigamos cómo se usa GIT.','2019-04-10'),(968,41,'Preguntas sobre oficina de alumnos y investigación sobre git ','En el día de hoy nos separamos en 3 grupos y empezamos a hacer preguntas sobre oficina de alumnos. Después nos preguntaron a cada uno que área de trabajo preferíamos o nos sintiéramos más comodos las áreas son: desarrollo,diseño,servidores y base de datos, también investigamos cada uno que es git y algunos códigos básicos y   empezamos a usar la aplicación git.','2019-04-10'),(969,36,'preguntaas para oficina de alumnos y investigacion de git','nos separamos en 3 grupos y realizamos preguntas para hacer un software. vimos video sobre el uso del git','2019-04-10'),(970,40,'Preguntas y git','hoy nos dividimos en grupos para para hacer un brainstorming sobre las preguntas de necesidades en oficina de alumnos, y luego aprendimos a usar el git ','2019-04-10'),(971,38,'Preguntas y git','En el dia de hoy nos separamos en grupos para poder pensar y anotar diferentes tipos de preguntas que a futuro le vamos a hacer a oficina de alumnos, ademas de eso aprendimos a usar el git mediante tutoriales de youtube y explicaciones de los profesores','2019-04-10'),(972,54,'funcionalidades de la aplicación y GIT','En el día de hoy pensamos funcionalidades de la aplicación para facilitar el trabajo de oficina de alumnos. Posteriormente aprendimos las bases de GIT con la ayuda de un curso sacado de Youtube','2019-04-10'),(973,67,'Proyecto Oficina de Alumnos y Git','Hicimos una lluvia de ideas para el proyecto de Oficina de Alumnos y aprendimos a usar Git','2019-04-10'),(974,49,'Preguntas y git','en el dia de hoy los profesores nos separaron en grupo para hacer preguntas sobre como trabaja la oficina de alumnos y ademas aprendimos a como usar git mediante tutoriales de youtube ','2019-04-10'),(975,63,'Segunda clase','Lo primero que hicimos fue dividirnos en grupos para realizar una lluvia de ideas en las cuales se debia realizar preguntas o posibles funcionalidades para una pagina o aplicacion para la oficina de alumnos. \nPosteriormente se nos pregunto sobre el ambito en el que queriamos estar mientras seguiamos una guia sobre git (base de datos)','2019-04-10'),(976,66,'Segunda clase','Hoy tuvimos una lluvia de ideas para poder obtener preguntas las cuales podríamos usar para conocer con mas detalles las problemáticas que puede llegar a tener la oficina de alumnos, ya que nos explicaron que tenemos que hacer un proyecto para ayudar  a la oficina, ademas estuvimos viendo una guía de GIT ya que es una herramienta bastante útil a la hora de trabajar en proyectos. También nos preguntaron sobre las preferencias que tenemos respecto a los puestos de trabajo para el proyecto','2019-04-10'),(977,64,'Aprendiendo a usar Git','En el dia de la fecha aprendimos a usar la herramienta de git, que sirve para organizar las distintas versiones de tu proecto que en este caso es el que me asignaron hoy, termine mi CV, y entre todos (pero dividiso en grupo hicimos una lluvia de ideas sobre de como vamos a abarcar el proecto, que preguntas vamos a hacerle a nuestro cliente.','2019-04-10'),(978,69,'proyecto aplicación','09/04\nIntroducción a la materia prácticas profesionalizantes, crear cv.\n10/04\nTerminar el cv, lluvia de ideas para el proyecto, armamos grupos para empezar con el proyecto de la aplicación para oficinas de alumnos, videos de como funciona Git.\n','2019-04-10'),(979,65,'git','Aprendimos a usar git viendo videos','2019-04-10'),(980,68,'Finalización del CV, formulación de entrevista, división de tareas','Finalicé el CV y lo envié. Hicimos una lluvia de ideas para la entrevista con respecto al proyecto para la oficina de alumnos. Elegimos tareas y posiciones opcionales para nuestra pseudo-empresa. Empezamos a aprender a usar Git.','2019-04-10'),(981,71,'proyecto aplicación para oficina de alumnos','entregar  y terminar el cv,grupos para las lluvia de ideas para el proyecto y elegir en q area trabajar','2019-04-10'),(982,39,'Tema nuevo: Git','Hoy descargamos git en las maquinas y vimos videos para practicar, sumado a las preguntas para la aplicacion de oficina de alumnos.','2019-04-10'),(983,48,'Probamos el git ','Buscamos informacion sobre como usar el gitbash y estuvimos probando sus codigos intetnando realizar un proyecto','2019-04-11'),(984,44,'Busque informacion sobre git, y frameigniter.','Indague en internet para encontrar información sobre como funcionan git y frameigniter y posteriormente usar ambos, también estuvo la formación de grupos en base a las cualidades de cada uno y la eleccion de lideres. \n','2019-04-11'),(985,60,'Division de los grupos','El dia de hoy los grupos fueron divididos entre los 2 6tos.\nLuego nos dividos en areas de trabajos (como diseño, estructura, BD y desarrollo) y fueron elejidos los jefe de areas.','2019-04-11'),(986,75,'Introducción a la materia','El profesor Damian Olaso dio una breve explicación de la materia, nos dividió en grupo para el proyecto final y a las personas pertenecientes a 6º1 nos dijo que hiciéramos el CV (curriculum vitae). Por ende realice mi CV para dicha materia. ','2019-04-11'),(987,82,'curriculum ','hoy hice mi curriculum y me dijeron que trabajaría en la parte de diseño también me dijeron los integrantes de mi equipo y el líder ','2019-04-11'),(988,58,'Probamos el programa git ','Estuvimos viendo videos sobre el git, buscando informacion sobre como el git ','2019-04-11'),(989,76,'Introducción a la materia','El profesor Damian Olaso nos introdujo con una breve explicación a la materia, se nos dividió en los grupos de trabajo que conformaremos para realizar a cabo uno de los proyectos y comenzamos haciendo el CV (Curriculum Vitae).','2019-04-11'),(990,53,'Nuevos integrantes y secciones de grupo','El profesor explico a lo nuevos alumnos como iba a hacer las clases, proyectos, grupos y también explico que hicimos anteriores clases e como se aprobaba. Buscar información de GIT, y probarlo al mismo tiempo que se iba viendo. ','2019-04-11'),(991,45,'introducción  a GIT','hoy empezamos a ver los fundamentos de GIT básicamente sus funciones como usarlo y también se definieron los grupos de trabajo y sus sectores correspondientes con sus lideres respectivos','2019-04-11'),(992,83,'hacer cv','hoy hice mi cv y me pusieron en el grupo  de infraestructura compuesto por 4 integrantes. nos explicaron como se maneja esta materia ','2019-04-11'),(993,42,'Formación de grupos e investigación sobre GIT','Investigamos acerca de GIT más profundamente, tuvimos la formación de grupos en base a las cualidades individuales de cada uno y se eligieron los lideres de los grupos respectivamente. ','2019-04-11'),(994,46,'Division de los grupos','el dia de hoy nos juntamos con los de 6 del turno mañana, luego nos dividimos en grupos para el trabajo que consta en: diseño, bd, desarrollo e infraestructura y posteriormente nos explicaron la modalidad del trabajo','2019-04-11'),(995,51,'Nuevos Integrantes y division de grupos','vinieron nuevos compañeros que son del turno mañana y los profesores separaron  a todo el curso en 4 grupos, a mi me toca el grupo de Base de Datos y también nombraron a los lideres de cada sección','2019-04-11'),(996,55,'Probamos el programa GIT','Estuvimos buscando información sobre el programa GIT, luego de eso procedimos a probar los códigos que encontramos.  ','2019-04-11'),(997,81,'Introducción','Hoy nos dieron una introducción a la materia, dada que es la primera vez que la tenemos. Nos explicaron cómo funciona, cuáles son las tareas y el proyecto que vamos a realizar. Luego nos separamos en secciones donde cada una se encarga de una parte del proyecto: desarrollo, diseño, infraestructura y base de datos. Los profesores nos dijeron con quién nos tocó en cada grupo y que yo iba a ser la lider de este.\nParalelamente a esto, armé mi curriculum vitae.','2019-04-11'),(998,50,'GIT y division de areas','Tuvimos un vistazo individual del funcionamiento de GIT como herramienta de trabajo grupal. Seguido de esto nos dividimos en distintas áreas de trabajo, siendo estas: desarrollo, diseño, infraestructura y bases de datos. ','2019-04-11'),(999,78,'CV','Trabajamos en la busqueda de plantillas para armar un cv. Vimos que información debe tener, sobre las experiencias, aptitudes, formación, etc.\nDescargamos también la plantilla para poder empezar a armar el cv. \nAdemás hablamos de los requisitos para aprobar la materia (cumplir las horas reloj, tener buenas prácticas).','2019-04-11'),(1000,79,'Introducción','Hoy fue nuestro primer día, nos presentaron la materia, lo que se haría aproximadamente, los proyectos y los requisitos para aprobar la materia (216hs, entrega de proyectos, buenas practicas, presentismo, llegar a horario). Ademas de todo eso se nos asigno una sección (en mi caso infraestructura) según nuestras capacidades, la de los demás y las secciones que cada uno prefiera. Ademas de eso empece mi curriculum vitae para presentar en caso de que sea necesario en un futuro.  ','2019-04-11'),(1001,80,'Primer dia ','11/04\nEl día de hoy estuvimos dedicando nuestras horas de prácticas profecionalisantes en desarrollar un currículum vitae. Busque planillas, ejemplos de cvs, imágenes, etc. También completamos una evaluación personal que se trató sobre describirme puntuándome del 1 al 10. Me pareció una evaluación interesante e inusual.\n','2019-04-11'),(1002,56,'GIT y division de areas','Nos organizamos y dividivos en areas de trabajo (Desarrollo, Diseño, Infraestructura y Base de datos), se designaron los lideres de cada area e hicimos investigacion sobre las herramientas que nos brindan GIT','2019-04-11'),(1003,84,'división de áreas','primer de las practicas, nos explicaron las áreas y cada uno desidío que tipo de áreas le gustarían hacer, en mi caso diseño,y base de datos junto con sus lideres, que por acto de suerte me toco ser el lider de infraestructura, una divertida y simpática primer clase. ','2019-04-11'),(1004,72,'Tercera clase','09/04/19\nEl día de hoy fue la primera clase de prácticas, lo que me dejo bastante emocionado.\nFue la primera vez que hago un cv con tanta velocidad y además fue una experiencia bastante interesante.\nAdemás volví a escribir una bitácora después de tanto tiempo.\nSe me olvido subir.\n16/04/19\nVamos a comenzar un proyecto de diseño de páginas web. La web será de utilidad para la oficina de alumnos.\nMe parece que estoy aprendiendo un poco más de que va la materia y todas sus funciones. Aparte de eso, estoy pensando en mi nuevo grupo, el cual, comienza la semana que viene y se trata de la parte de desarrollo de la página web que vamos a implementar.\nDespués de esto, hoy estuve viendo vídeos de un programa llamado git, por el que estoy aprendiendo a usar.\nAdemás empecé con la parte borrador de la página, pudiendo escribir diferentes utilidades para la misma.\n','2019-04-16'),(1005,63,'Tercera clase.','Hoy nos asignaron los grupos de trabajo en los que vamos a estar (mi grupo es el de diseño). También finalizamos la lluvia de ideas de la clase anterior.\nPor último estuvimos continuando con el curso de git.','2019-04-16'),(1006,71,'tercera clase','Terminamos el formulario de preguntas para la entrevista con oficina de alumnos, division de grupos para distintas areas y descargamos de git','2019-04-16'),(1007,66,'Tercera clase','Hoy se volvió a hacer una lluvia de ideas para ver si podemos agregar mas preguntas para poder hacerle a la oficina de alumnos, luego se nos asigno a que grupo debemos ir, en mi caso temporalmente estoy en diseño hasta que me lo confirmen mañana, tambien seguimos viendo guias de git.','2019-04-16'),(1008,65,'GIT','comencé a programar en git con algunos códigos simples\n','2019-04-16'),(1009,69,'tercera clase','terminar de formular preguntas, seguimos viendo videos de como hacer códigos en GIT, descargar el programa GIT , división de áreas.','2019-04-16'),(1010,68,'Aprendizaje de Git','Dimos nuestros primeros pasos en Git, creando un usuario y mostrándolo por pantalla','2019-04-16'),(1011,72,'Cuarta clase, primer día del grupo.','Creo que hoy fue una de las clases que mas cosas realice y aprendí.\n\nPuede que el día de hoy, las cosas se hayan complicado pero tengo grandes expectativas sobre la materia. ademas pude aprender lo básico del Codeigniter, y pude enseñarle a mi grupo como es que este framework funcionaba.\n\nMi grupo ya es capas de escribir los códigos y usar las funcionalidades básicas del programa. El programa me parece bastante interesante aun que, aún no le agarro la mano para utilizarlo con libertad. ','2019-04-17'),(1012,41,'Git y codeigniter','En el día de hoy nos separaron en diferentes áreas de trabajo que eran base de datos, servidores,diseño y desarrollo a mí me tocó diseño estuvimos investigando sobre el git descargamos la aplicación y empezamos a ver algunos códigos también espezamos a ver sobre codeigniter','2019-04-17'),(1013,43,'Nos separamos en sectores y probamos el Git','Todos nos tuvimos que ir con el sector que nos eligieron y luego de eso, empezamos a ver vídeos de Git mientras íbamos probando los códigos en su respectiva aplicación. También vimos el CodeIgniter.','2019-04-17'),(1014,36,'tutorial','me asignaron al sector desarrollo. vi tutrial de git y codeignite y lo probamos.','2019-04-17'),(1015,47,'Aprendiendo CodeIgniter','Nos dividieron en sectores y me toco en desarrollo. Empezamos a aprender como usar codeigniter','2019-04-17'),(1016,66,'Cuarta clase','Hoy me asignaron al equipo de desarrollo y eligieron a los lideres, tambien seguimos viendo un poco de git pero dado que hay un error en las maquinas no podemos avanzar mucho. Nos dijeron que investiguemos un framework, CodeIgniter, estuve viendo unos tutoriales en youtube sobre el tema, tal parece que nos ayudara a la hora de darle seguridad al proyecto. ','2019-04-17'),(1017,64,'Aprendimos a usar CodeIgniter y otras cosas','Aprendimos a utilizar el programa ya mencionado en el titulo, a como configurarlo, y aprender sus funciones ya que lo vamos a implementar en nuestro futuro proyecto. También nos asignaron al área de Infraestructura por alrededor de dos meses','2019-04-17'),(1018,39,'Aprendimos a usar CodeIgniter y otras cosas','Aprendimos a utilizar el programa ya mencionado en el titulo, a como configurarlo, y aprender sus funciones ya que lo vamos a implementar en nuestro futuro proyecto. También nos asignaron al área de Infraestructura por alrededor de dos meses','2019-04-17'),(1019,54,'Aprender bit y Codeigniter','Hoy aprendimos lo básico de Git y Codeigniter mediante tutoriales en Internet  y practicamos probando algunos códigos básicos ','2019-04-17'),(1020,40,'GIT y Codeigniter','hoy vimos los tutoriales de git, practicamos los diferentes codigos y empezamos a probar codeigniter','2019-04-17'),(1021,71,'Git y CodeIgniter','Descargamos  y creamos un usuario en Git. Descargamos y trabajamos con CodeIgniter','2019-04-17'),(1022,52,'agrupacion y estudio','me pusieron en el grupo de desarrollo con siete personas mas para empezar el proyecto y estudiamos git dandole un repaso y estudiando codeignite  ','2019-04-17'),(1023,63,'Cuarta clase','Hoy terminamos de ver el contenido de git y empezamos a ver codeigniter. Anteriormente se aclaro el ámbito en el que va a estar cada uno; ayer me dijeron diseño pero resulta que estoy en desarrollo.\nEn cuanto a codeigniter vimos que es un framework que va a ser utilizado para brindarle seguridad al proyecto que estaremos realizando en breve.','2019-04-17'),(1024,57,'Avanzando con GIT e introducción a Codeigniter','Avanzamos con los códigos de GIT separados en grupos de trabajo en el cual quedé en &quot;desarrollo&quot; y nos introducimos a Codeigniter.','2019-04-17'),(1025,65,'GIT y CodeIgniter','Terminamos con GIT y empezamos con CodeIgniter\n','2019-04-17'),(1026,49,'GIT y Codeigniter','hoy terminamos con GIT y empezamos con Codeigniter.','2019-04-17'),(1027,61,'GIT y  CodeIgniter','en el dia de hoy vimos tutoriales de como usar GIT y codeigniter tambien probamos algunos codigos que vimos en el dia ','2019-04-17'),(1028,38,'GIT y Codeigniter','Hoy finalizamos con los tutoriales de git, pusimos en funcion algunos codigos como practicar,  ademas de eso hoy comenzamos con codeigniter','2019-04-17'),(1029,68,'Aprendizaje de CodeIgniter','Con ayuda de un canal de YouTube, comenzamos a aprender CodeIgniter','2019-04-17'),(1030,43,'Vimos un poco de videos de Git','Estuvimos viendo lo que nos quedaba por ver de videos de Git y hablamos un poco del Diagrama de Gantt, cosa que haremos y entregaremos la próxima clase.','2019-04-23'),(1031,47,'Segui con la guia de CodeIgniter','Segui con la guia de CodeIgniter','2019-04-23'),(1032,36,'git','seuimos on la guia de git en youtube. se corto la luz','2019-04-23'),(1033,64,'Problemas Tecnicos','En el día de la fecha en el establecimiento se cortó lo luz y no pudo trabajar de la forma más adecuada, por ese caso en esta ocasión no se pudo adelantar tanto en el proyecto, lo que si llegamos a hacer es que el profesor presente no paso un ejemplo de los diagramas de  Gantt de los alumnos de la cursada del año anterior.','2019-04-23'),(1034,41,'Codeigniter','En el día de hoy estuvimos viendo la guía de vídeos de codigofacilito sobre codeigniter. ','2019-04-23'),(1035,63,'Quinta clase','Hoy continué viendo el contenido de CodeIgniter, estaba en la mitad de la parte 6 hasta que se corto la luz, pero llegue a ver sobre controladores y estructuras de archivos.\nPor ultimo nos agrupamos en nuestros ámbitos de trabajo para la realización del diagrama de Gantt que adjuntara las actividades que trabajaremos próximamente cuando tengamos toda la información necesaria.','2019-04-23'),(1036,54,'Guia Codeigniter y diagrama de gantt','En el día de la fecha continuamos viendo la guía de codeigniter, luego vimos un diagrama de Gantt para poder realizar uno para el área de trabajo que nos corresponde','2019-04-23'),(1037,52,'repaso','hoy fue un día de repaso sobre el git quien no lo vio y también un repaso de codeigniter.\ntambién se propuso Empezar y terminar el diagrama de gantt por area','2019-04-23'),(1038,69,'23/04','Seguimos con los tutoriales de CodeIgniter y empezamos a ver el diagrama de Gantt por area. ','2019-04-23'),(1039,57,'Seguimos con la guia de CodeIgniter y vimos Gantt','Nos seguimos capacitando sobre Codeigniter mediante videos y empezamos a realizar el diagrama de Gantt','2019-04-23'),(1040,66,'Quinta clase','Hoy continué viendo guías de Codeigniter hasta que se corto la luz, por lo cual no pude profundizar demasiado. Ademas de eso nos pidieron que realizamos un diagrama de gantt y nos mostraron uno realizado por los anteriores chicos de sexto año para tomarlo como guía.','2019-04-23'),(1041,71,'23/04','Continuamos viendo la Guia de CodeIgniter y empezamos a ver el diagrama de Gantt para entregar por area','2019-04-23'),(1042,38,'GANTT','Hoy nos introduccimos en lo que es GANTT mediante un excell que nos envió el profesor, en el cual tendremos que implementar lo aprendido para realizar nuestro diagrama','2019-04-23'),(1043,49,'GANTT','hoy el profesor nos paso la introducciones de lo que seria gantt','2019-04-23'),(1044,65,'CodeIgniter Y Gantt','Finalizamos con codeigniter y introducimos Gantt','2019-04-23'),(1045,68,'Aprendizaje de CodeIgniter','El poco tiempo que tuvimos disponible fue dedicado a continuar con dicho framework y ver ejemplos de diagramas de Gantt.','2019-04-23'),(1046,67,'Diagrama de Gantt y CodeIgniter','El dia de hoy hicimos una parte del diagrama de Gantt y después aprendimos un poco de codeigniter viendo codigofacilito','2019-04-24'),(1047,67,'Diagrama de Gantt y CodeIgniter','El dia de hoy hicimos una parte del diagrama de Gantt y después aprendimos un poco de codeigniter viendo codigofacilito','2019-04-24'),(1048,72,'Clase seis, Codeigniter','24/04\nAprendí y termine de hacer el diagrama de Gantt. También puedo decir que fue una clase bastante tranquila pero igual trabaje  porque si no me aburría.\nEstuvimos viendo cómo se realizaba la montura de Codeigniter en Git e intentamos hacer funcionar la página.\nPor otro lado hoy mezcle todo lo que aprendí de css, html, y base de datos con git y Codeigniter. Lo que fue bastante interesante ver como todo se juntaba para hacer algo de un nivel más avanzado.\n','2019-04-24'),(1049,63,'Sexta clase','En esta clase empezamos haciendo el diagrama de Gantt, pero no pusimos cosas como las fechas ya que no sabemos cuando vamos a empezar. Posteriormente seguimos viendo contenido de CodeIgniter y realizamos un trabajo sencillo con html y css para ver la ejecución del mismo mediante CodeIgniter.','2019-04-24'),(1050,68,'Práctica con CodeIgniter','Hicimos una página básica de html con css y php para probar el uso de CodeIgniter, lo que resultó en un error de acceso denegado (error 403) por razones relacionadas a los controladores.','2019-04-24'),(1051,71,'24-04-19','Hicimos el diagrama de Gantt, una pagina web para montarlo en CodeIgniter, y volvimos a ver CodeIgniter en codigofacilito','2019-04-24'),(1052,66,'Sexta Clase','Hoy con el grupo de desarrollo trabajamos con el diagrama de Gantt, y ademas de eso continue viendo un par de guias de Codeigniter y ademas para implementar lo visto cree una pagina con html y css.','2019-04-24'),(1053,73,'Diagrama de gantt y codeigniter','Hoy hicimos un diagrama de gantt para el proyecto de diseño y aprendimos a usar el codeigniter ','2019-04-24'),(1054,69,'CodeIgniter','Terminamos el diagrama de Gantt y lo enviamos.\nSeguimos con los tutoriales del codeigniter, lo descargamos y lo probamos.\nHicimos una pagina web en atom para después monstarlo al CodeIgniter.','2019-04-24'),(1055,64,'Realización de Cosas Importantes','En el dia de la fecha hicimos el gantt respectivo del grupo, vi como montar un servidor en Linux y empeze con mi grupo a probar el CodeIgnater.','2019-04-24'),(1056,65,'GANTT y Codeigniter','Finalizamos el diagrama de gantt para la seccion de diseño con proyect y comenzamos a programar con codeigniter.','2019-04-24'),(1057,48,'Realizamos preguntas y utilizamos el project','Nos reunimos a realizar un par de preguntas que se le realizarian a los preceptores con el fin de poder desarrolar el programa en el que estamos trabajando.\nLuego realizamos el diagrama de gantt con el microsoft project ','2019-04-25'),(1058,60,'Investigacion y preguntas.','El dia de hoy se investigo sobre GiT y CI.\nAdemas de terminar las preguntas, los lideres de cada grupo tomaron las preguntas y fueron hablar con el jefe de preceptores.\nTan empezamos a hacer un prototipo de GANTT de cada grupo para luego hacer una reunión y completarlo juntos.','2019-04-25'),(1059,51,'Diagrama de Gant','hoy nos reunimos todos para hacer preguntas acerca de &quot;inasistencias&quot; para el proyecto y luego nos separamos en los grupos que ya teníamos estipulados e hicimos un diagrama de gantt acerca de nuestra area que en este caso es el de Base de Datos','2019-04-25'),(1060,75,'Etapa investigación y aprendizaje','En esta clase empece a trabajar ya en el sector que me corresponde (Desarrollo). Investigue del uso de CodeIgniter y se me delego aprender el Materialize (CSS). ','2019-04-25'),(1061,44,'Aprendi a usar github con alguno comnados y busque informacion sobre CodeIgniter y como usarlo','En el primer modulo aprendi a como instalar y agrega a las carpetas de sublime text 3 el frame work &quot;CodeIgniter&quot;. Aprendi para que sirven algunas de sus carpetas y como hacer los controllers. Busque informacion de github y como usar los codigos; crear un perfil y agregar archivos.','2019-04-25'),(1062,37,'Investigación sobre GIT y GITHub.','Hoy ví un conjunto de videos explicativos sobre qué es GIT, para qué sirve, y cómo utilizarlo. En éstos videos aprendí algunos de los comandos esenciales de GIT. También aprendí qué es la plataforma GITHub y para qué se utiliza, cómo se utiliza y cuál es su fin.\nPor último, junto con todo el curso, dimos por finalizado el tema de las preguntas sobre presentismo para preceptoria. Nos juntamos y escribimos todas las preguntas sobre presentismo que se nos ocurrieron, y un grupo fue a preceptoría a solventar nuestras dudas','2019-04-25'),(1063,53,'Variedad de tareas','Tareas que se realizaron:\n-Armar mas preguntas con todos los grupos.\n-Buscar informacion sobre codeigniter y probarlo\n-4 personas fueron a preguntar al preceptor sobre las preguntas que se hicieron.\n','2019-04-25'),(1064,83,'organizacion','hoy nos juntamos y empezamos a trabajar con el diagrama gantt, nos guiamos con unos ejemplos, nos consultamos entre todos y sacamos conclusiones, luego nos dividiremos las tareas para trabajar. \nTambién  se empezó la carpeta de campo que con  el tiempo se ira estableciendo a su modo final.','2019-04-25'),(1065,78,'Proyecto y CodeIgniter','Ya con los grupos asignados, definimos el proyecto que vamos a trabajar, el cual es el de oficina de alumnos. Se requiere informatizar las faltas, ingresos posteriores y retiros anticipados.\nPara este proyecto se pensaron preguntas entre todos para hacerles a los clientes. Son preguntas como: ¿Cómo se computan las faltas? ¿Cómo funciona las reincorporaciones? ¿falta con presencia? ¿Cuándo el alumno llegue al límite de faltas que se procede? Etc.\nTambién designamos el rol que tenemos cada miembro del grupo de desarrollo. Uno se ocupa del framework Materialize, otro de Git, otros del diagrama de Gantt y yo de CodeIgniter.\nAntes de aprenderlo me informo sobre el lenguaje, ventajas y desventajas y a partir de ahí empiezo a aprenderlo, viendo una introducción y sobre su estructura de archivos.\n','2019-04-25'),(1066,45,'introducción al campo de diseño','hoy desarrollamos un diagrama de gantt usando una guia que paso el profe vía pendrive y lo usamos para adaptarlo particularmente a nuestra sección, en mitad de la clase hicimos una reunión en medio del salón para hacer otro cuestionario esta vez del presentismo de los alumnos con respecto a los preceptores los lideres de los grupos luego de eso fueron a hacer las preguntas personalmente.','2019-04-25'),(1067,80,'Clase 2','El día de hoy investigue sobre git, codeline, un framework PHP para el desarrollo rápido de aplicaciones web. viendo algunos videos en youtube sobre como hacer uso de el. También trabajamos en el Gantter para así organizar los tiempos del proyecto.','2019-04-25'),(1068,42,'entrevista y GANTT','Empezamos haciendo el diagrama de Gantt que utilizaremos a futuro, formulamos de nuevo las preguntas para la entrevista al jefe de preceptores y luego fuimos a hacerle la entrevista para poder recolectar mas datos, tambien grabamos un poco en grabadora de voz. ','2019-04-25'),(1069,46,'organizacion','hoy nos juntamos en grupos para empesar el proyecto de infraestructura, luego con la ayuda del lider armamos el diagrama de gantter en el cual se planteo del plan de trabajo de los siguientes dias. Tambien se empezo la carpeta de campo ','2019-04-25'),(1070,82,'comienzo de diseño','hicimos preguntas sobre el presentismo de los  alumnos, empezamos a hacer el diagrama de gantt, los lideres de cada sección fueron a hacer en persona las preguntas del cuestionario de presentismo a los preceptores y comienzo de carpeta de campo.','2019-04-25'),(1071,85,'Investigacion y preguntas.','Como lider del el grupo organize las tareas de investigacion de los integrantes del grupo, tambien estuve investigando sobre el framework CodeIgniter y empeze a realizar el diagrama GANTT, tambien junto a los lideres de los demas grupos hicimosuna pequeña encuesta al subjefe de preceptores sobre el funcionamiento de la preceptoria','2019-04-25'),(1072,50,'Investigacion y GANTT','Realizamos en la aplicacion Gantter el diagrama de GANTT de cada departamento, seguido de finalizar en grupo las preguntas para la entrevista. Por ultimo, llevamos a cabo la fase inicial de dicha entrevista.','2019-04-25'),(1073,55,'Realizamos nuevamente preguntas y utilizamos el project','Hicimos nuevas preguntas que posteriormente se las dijimos al preceptor el cual las respondio, ademas de eso estuvimos realizando el diagrama de gantt.','2019-04-25'),(1074,56,'inicio de diseño','Investigacion sobre Codeigniter\nRevision de preguntas para la gestion en preceptoria\nDiagramacion de Gantt, describiendo las etapas y tiempos de avance de nuestra area (DISEÑO)\n','2019-04-25'),(1075,74,'Diagrama de Gant','como líder del grupo  de infraestructura, empecé creando lazos hablando con los integrantes y hacer que entre ellos establezcan conexión asi no se sienten incómodos y tratar de trabajar lo más bien posible a pesar de que me cuesta hablar con extraños pude hacer que se establezcan lazos y trabajamos de lo mas bien. Nos organizamos las tareas  que vamos a hacer en un futuro con un programa llamada gantt, vamos en camino a realizaras, nos pasamos datos personales como numero de teléfono, correo, redes sociales, etc. para pasarnos información y colaborar lo mas posible con el trabajo de forma mas unida si bien por lo vi, no somos el grupo más listo, pero con el esfuerzo de todos los integrantes  vamos a poder lograr algo grande. mañana ya vamos a empezar realizar dichas tareas que tenemos organizadas.  ','2019-04-25'),(1076,42,'Finalización de diagrama de Gantt','Terminamos de armar el diagrama y di una charla acerca de como vamos a manejarnos el tema de la información que debe repartirse por los grupos para tener una mejor coordinación. ','2019-04-26'),(1077,51,'Diagrama de Gantt2','me junte con mi jefa y nos pusimos a hacer en papel como haríamos el diagrama de gantt en la computadora','2019-04-26'),(1078,83,'investigacion','hoy a mi me toco investigar git, hosting y servidores al igual que a mi los otros tambien tenian trabajo por hacer.Por el momento solo e hecho la investigacion de git pero me falta terminar','2019-04-26'),(1079,75,'Aprendiendo Materialize CSS','En esta clase he visto vídeos de aprendizaje y de como funciona &quot;Materialize&quot;, para más adelante poder usarlo en el desarrollo del proyecto final. ','2019-04-26'),(1080,53,'Proyecto galicia ','Introductorio de como poder realizar la app web para ayudar a los que están en situación de calle, el resto de la clase siguiendo lo de codeigniter','2019-04-26'),(1081,81,'Diagrama de Gantt','Hoy estuve trabajando con mi equipo sobre el diagrama de Gantt sobre la base de datos. También empezamos a analizar cómo sería posiblemente la base de datos porque todavía no nos pasaron la entrevista con Miguel. Escribimos las cosas básicas que supusimos y empezamos un primer boceto de entidad-relación.','2019-04-26'),(1082,76,'Diagrama Entidad Relación','Basándome en la necesidad básica del propio proyecto, estuve trabajando en la creación del diagrama entidad relación de lo que en un futuro sera la base de datos que contendrá toda la información. Trabaje en base a una maqueta que me dio la líder del grupo, lo comencé a pasarlo al programa Draw.io, para tenerlo digitalizado.','2019-04-26'),(1083,37,'GIT, GITHub y Proyecto Solidario','Hoy continué viendo los videos sobre Git/GITHub, hice algunas pruebas para experimentar cómo funciona GIT por mi cuenta, y el profesor Olaso nos comentó de qué trata la aplicación que debemos realizar para el Banco Galicia, una aplicación solidaria. Nos dio las pautas y los requisitos para dar por finalizada la misma. También pensamos el diseño y toda la parte visual de ésta.','2019-04-26'),(1084,50,'Actualizacion y finalizacion de diagrama de GANTT','Reformulamos y actualizamos el diagrama de GANTT con el que guiaremos al equipo de trabajo para realizar de forma ordenada las actividades.','2019-04-26'),(1085,46,'investigacion del proyecto','hoy investigamos sobre los servidores, git y otros para tener una guía mas adelante sobre como funciona, definición y características','2019-04-26'),(1086,44,'Estudie github','Me estuve interiorizando en git y practicando con un poco de codigo y lineas de comando de git.','2019-04-26'),(1087,82,'continuación ','el lider intento hacer las preguntas al preceptor Miguel pero no pudo así que no pudimos continuar y finalizanciòn del diagrama de gantter.','2019-04-26'),(1088,85,'Fui ingresado en un proyecto nuevo','fui ingresadoa unproyecto de un simulador de desfribilidador con los chicos de mecanica','2019-04-26'),(1089,45,'finalizacion y actualizacion de gantt','los lideres de los grupos intentaron entregar el cuestionario de preceptores, y terminamos y finalizamos el diagrama de gantt.','2019-04-26'),(1090,58,'finalizacion y actualizacion de gantt','los lideres de los grupos intentaron entregar el cuestionario de preceptores, y terminamos y finalizamos el diagrama de gantt.','2019-04-26'),(1091,58,'finalizacion y actualizacion de gantt','los lideres de los grupos intentaron entregar el cuestionario de preceptores, y terminamos y finalizamos el diagrama de gantt.','2019-04-26'),(1092,74,'comenzando la investigación ','el día de hoy  repartimos y empezamos las tareas ya que tardamos mucho para pensar exactamente lo que íbamos a hacer en el futuro, así que pusimos manos a la obra, uno hacia la carpeta de campo, y los demás investigación para poder hacer el proyecto  para al finalizar la clase juntar todo, avanzamos bastante y desellamos los siguientes temas: servidores web, git, hosting, fps, dns, etc. con estos temas en mente nos vamos guiando para realizar los objetivos que son: diseñar redes, crear servidores, crear un método de acceso privado para la seguridad, etc. \nuna vez juntado todos los datos recolectados charlamos organizarnos en estos días para avanzar lo mas posible. ','2019-04-26'),(1093,79,'Segundo día','No asistí a la clase pasada por tener que ir al medico, por ende este es mi segundo día. Hoy mis compañeros me pusieron al día con lo entregado y hecho en nuestro grupo. El profesor resolvió las dudas que tenia con respecto a como íbamos a empezar a trabajar con el proyecto. Ademas de eso nos asignaron a mi y aun compañero a un grupo donde haremos un proyecto paralelo que consiste en diseñar un desfibrilador simulador pedagógico (mi deber puntualmente sera diseñar todo lo relacionado al circuito electrónico) . Por consiguiente me voy a dedicar al proyecto de sistema de preceptoria los jueves y al de desfibrilador los viernes. De momento con respecto al proyecto de preceptoria estamos haciendo un diagrama de gantt. En el proyecto de desfibrilador nos estamos coordinando con el grupo, pero ya podemos empezar a hace cosas funcionales. ','2019-04-26'),(1094,75,'Aprendiendo Materialize','Seguí con el aprendizaje de materialize, aprendi el uso de los colores, grillas y tipografías. ','2019-05-02'),(1095,83,'hoy hosting ','hoy continuo con mi labor y hoy trabaje buscando sobre hosting.\ninvestigue sobre para que  es o que es y sus caracteristicas.','2019-05-02'),(1096,76,'Diagrama Entidad Relacion 2','Seguí con el diagrama entidad relación mencionado en el anterior, pero no pude concluirlo por cuestiones de falta de información acerca del propio proyecto, por falta de los audios grabados que contenían los detalles que el usuario espera en el mismo.','2019-05-02'),(1097,82,'preguntas','se pudo hacer la entrevista a los preceptores ','2019-05-02'),(1098,85,'Investigacion parte 2','estuvimos practicando la implementacion de codeigniter y materialize, como lider de grupo estuve al tanto del trabajo de mis compañeros','2019-05-02'),(1099,79,'Investigacion sobre nuestra tarea mas proxima','Primero que todo trabaje con el profesor en verificar las aplicaciones (tanto que esten instaladas como que funcionen) de la computadora base de la cual despues vamos a clonar a las demas computadoras para que todos tengamos los programas necesarios para trabajar. Despues de hacer todo eso hable con el profesor sobre la tarea mas proxima que debe hacer el grupo, que es basicamente establecer un servidor linux (ubuntu servidor) donde va estar establecido un serviodor git-hub y un lamp (linux, apache, mysql, lamp) aunque posiblemente instalaremos todo aparte. Tambien vi un poco de el diagrama de Gantt generico que tiene todo el proyecto, para pensar un poco a futoro como tiene que seguir nuestras tareas. ','2019-05-02'),(1100,44,'Sigo explorando la utilidad de git y su funcionalidad.','Seguí buscando información sobre como funciona git y para que sirve; también busque mas comandos programa.','2019-05-03'),(1101,60,'Conclucion de investigacion ','El dia de la fecha se finalizo las investigaciones sobre GiT, CI y FODA, tambien se concluyo con el trabajo de crear un archivo GANTT.\nLos sectores de diseño empezaron a crear un prototipo para la clases siguientes.','2019-05-03'),(1102,76,'Audio y FODA','Comencé por investigar como realizar el FODA y luego escuche el audio que contenía la charla del subjefe de preceptores con los alumnos y en un Word escribí resumidamente todo lo que puede ser útil para llevar a cabo la maquetación básica de la página. No lo finalice por cuestiones de tiempo.','2019-05-03'),(1103,51,'Audio y Prototipo','ya me pasaron el audio que le habian grabado al preceptor y de ahi se empezó a hacer el FODA y tambien se arrancó a hacer el prototipo de la app de preceptoria','2019-05-03'),(1104,53,'Inicio con el prototipo ','El dio de hoy fue sobre un poco de búsqueda de información aunque no se concentro tanto en eso, el trabajo a realizarse era un prototipo de la pagina web','2019-05-03'),(1105,80,'Tercer clase','El día de hoy realizamos un poco de investigación sobre el diagrama de FODA para así poder realizar un diagrama con respecto de el proyecto de preceptoria.\n','2019-05-03'),(1106,82,'foda','comenzamos con foda y prototipado','2019-05-03'),(1107,82,'foda','comenzamos con foda y prototipado','2019-05-03'),(1108,83,'investigacion de servidores y foda','hoy busque sobre los servidores y un poco de foda ademas en  grupo  nos reunimos para volver a pensar las cosas y ver como avanzamos  ','2019-05-03'),(1109,56,'comienzo de FODA','-INvestigacion de FODA\n-Comienzo de realizacion de FODA para proyecto de preceptoria\n-Revision de diagrama de GANTT','2019-05-03'),(1110,37,'CodeIgniter y Audios.','Comencé a ver el tutorial sobre codeigniter en youtube, escuche los 5 audios que grabaron dos compañeros la clase pasada en preceptoria con las respuestas que nos brindaron a las preguntas que habíamos formulado anteriormente. Con éstos audios debemos realizar las posibles vistas prototipo que va a tener nuestro software.','2019-05-03'),(1111,85,'Investigacion para proyecto DEA','estuve investigando con mi compañero Alvaro el funcionamiento y las cualidades de un DEA, al mismo tiempo que elegimos componentes y comparamos precios de estos mismos. También tomamos medidas de los componentes para proveerlas a los chicos de mecánica encargados en la estructura. Por ultimo estuvimos viendo el codigo necesario para hacer funcionar un modulo de Audio','2019-05-03'),(1112,45,'introduccion a foda','investigamos sobre foda y pronto comenzaremos con el prototipado','2019-05-03'),(1113,46,'investigacion de servidores y foda','hoy investigamos sobre los servidores y el foda, tambien hablamos nuevamente sobre el diagrama de gantt y al final armamos un grupo de whatsapp para mentenernos en contacto','2019-05-03'),(1114,75,'Materialize - CSS y Componentes','En esta clase termine de ver el CSS en materialize y empece a ver los diferentes componentes entre ellos los diversos botones que cuenta este programa.  ','2019-05-03'),(1115,79,'Diagrama de Gantt y listando componoentes para el DEA','En primer lugar me dedique hoy a buscar con mi amgio los componetes necesarios para armar el proyecto del DEA, en total contamos: una pantalla lcd 16x2, un Arduino UNO R3, unos botones, unos leds (y sus respectivas resistencias), una bateria  (al menos de 5v, lo necesario para alimentar el arduino), un modulo DFPlayer (o similiar) para reproducir audio. \nDespues me dedique a trabajar en el diagrama de Gantt de mi seccion (infraestructura)  y determinan cuanto nos tomarian las tareas (ya que empezamos despues de lo previsto, estamos atrasados con los tareas).','2019-05-03'),(1116,48,'Busqueda de informacion','Realizamos busqueda sobre el Foda','2019-05-03'),(1117,58,'busqueda sobre foda','realizamos una busqueda sobre foda y revisamos archivos','2019-05-03'),(1118,74,'Audio y FODA','investigamos FODA y nos planteamos para hacer un prototipo,terminamos con gantt, reunimos información de servidores. +\n','2019-05-03'),(1119,55,'introduccion a FODA','Realizamos una búsqueda de informacion sobre el FODA.','2019-05-03'),(1120,67,'Tablas de Base de Datos para Oficina de Alumnos','El dia de hoy nos juntamos con el grupo de Base de Datos y hicimos unas tablas para la futura Base de Datos ','2019-05-07'),(1121,47,'Entrevistas y prototipo de estructura de la pagina','Cada integrante de nuestra sección empezó a  hacer prototipos de la estructura de la aplicación para oficina de alumnos. También hicimos las entrevistas y concluimos que hay que usar una base de datos.','2019-05-07'),(1122,41,'Codeigniter  y diseño','En el día de hoy estuvimos viendo la guía de vídeos de codigofacilito sobre codeigniter y también empezamos a centrarnos en nuestra área que es diseño, realizando la aplicación de oficina de alumnos haciendo la barra de menú con codeigniter.','2019-05-07'),(1123,40,'Diseño','En el dia de hoy se realizo la entrevista a oficina de alumno y empezamos a repartir las tareas en el grupo de diseño para diseñar la pagina web','2019-05-07'),(1124,54,'Empezar con la base de datos','El día de hoy empezamos a realizar una estructura de base de datos a modo de borrador','2019-05-07'),(1125,43,'Ver vídeos de CodigoFacilito y poner códigos','Hoy estuvimos viendo más vídeos de CodeIgniter y abrimos su respectiva app, para ya empezar a hacer nuestro trabajo que sería un menú. También, estuvimos probando algunos comandos para ver como iba la cosa.','2019-05-07'),(1126,64,'Dia de la Primera entrevista','En el día de la fecha con el líder de Diseño y la líder de Desarrollo y yo líder de Infraestructura nos seleccionaron para ir a hacer la primera entrevista a ofician de alumnos sobre el proyecto que vamos a llevar acabo en el futro de esta materia, así aclaramos bien lo que necesitan los que están a cargo del lugar,  y así también saber cómo llevar acabo el dichoso proyecto','2019-05-07'),(1127,69,'07/05','Hicimos un borrador con los registros para la base de datos','2019-05-07'),(1128,63,'Septima clase','El día de hoy se realizaron las entrevistas en oficina de alumnos y nos dividimos en nuestras respectivas áreas (en mi caso desarrollo) para hacer trabajos que involucren la utilización del CodeIgniter. Además de eso seguimos viendo las guías del CodeIgniter. \nSe estima que vamos a empezar a trabajar a partir de la próxima clase, es decir, mañana.','2019-05-07'),(1129,71,'07/05','Hicimos un borrador con los registros para la base de datos','2019-05-07'),(1130,49,'diseño','hoy se realizo la entrevista a oficina de alumnos y empezamos a separa el trabajo por partes. ','2019-05-07'),(1131,66,'Septima clase','Hoy fue la entrevista con la oficina de alumnos para poder obtener respuestas de las preguntas que previamente hicimos, también nos dijeron que el equipo de desarrollo trabaja en paralelo al equipo de diseño así que aun debemos esperar un poco para poder saber que hacer, por mi parte también continué con las guías de codeigniter para poder trabajar sin problemas','2019-05-07'),(1132,38,'Inicio al diseño de la pagina','Hoy algunos integrantes del grupo fueron a realizar las preguntas anteriormente establecidas a oficina de alumnos, despues de eso dividimos em diferentes grupos las tareas del diseño que va a tener la pagina web.','2019-05-07'),(1133,73,'CodeIgniter y diseño de la pagina','En el dia de hoy con el grupo de diseño realizamos un diseño para la pagina de oficina de alumnos ','2019-05-07'),(1134,52,'clase 1 ayada a oficina de alumnos','hoy recién vamos a empezar con los proyectos de oficina de alumnos\n','2019-05-07'),(1135,72,'Clase 7','El día de hoy investigue mucho mas que otros días, pase por vídeos de CodeIgniter y vídeos de como montar servidores en linux. Por otro lado puedo decir que hoy fue un día productivo para todos los proyectos que tenemos que hacer.\n','2019-05-07'),(1136,65,'Jefes de Diseño, Desarrollo y Servidores realizan entrevista','Hoy los jefes de Desarrollo, Servidores y yo (jefe de Diseño) realizamos una entrevista a uno de participantes de oficina de alumnos para orientar nuestra idea del proyecto','2019-05-07'),(1137,86,'Clase 7 (07-05-19)','Asignación de tareas de area, investigación, organización entre compañeros de clase. ','2019-05-07'),(1138,68,'Entrevista a uno de los clientes.','Tres de los jefes de áreas fuimos a entrevistar a uno de los futuros usuarios de nuestra solución informática, con base en las preguntas hechas por miembros de todos los grupos en conjunto. La entrevista resultó fructífera, dando como resultado numerosas ideas con las que empezar a trabajar. Los datos detallados se encuentran en la carpeta de campo del día.','2019-05-07'),(1139,68,'Transmisión de los datos de la primera entrevista','Los datos y objetivos principales y secundarios fueron presentados oralmente, y luego se envió un archivo itemizado de los mismos a todos los integrantes de los grupos.','2019-05-08'),(1140,71,'08/05','Realizamos la base de datos y el diagrama de entidad relacion','2019-05-08'),(1141,47,'Presentación y práctica','Nos presentaron los datos para hacer la aplicación para oficina de alumnos y practiqué cómo conectar una base de datos en CodeIgniter.','2019-05-08'),(1142,87,'Diagrama de entidad-relación','Hoy estuvimos hablando sobre la entrevista con Hernan. Después con mi grupo hablamos de cómo va a ser la base de datos teniendo encuenta lo que necesita oficina de alumnos. Su principal problema es la inscripción de estos. Asi que modificamos el boceto que ya teníamo, sacandole algunas tablas y agregando campos en cada una. Después de acordar en esto, nos dividimos en dos grupos donde uno se encarga de crear la base de datos e ingresar algunos datos para probarla, y el otro, donde estoy yo, a hacer el diagrama de relación entidad. \nUna vez terminado me puse a leer cómo relacionar tablas.','2019-05-08'),(1143,54,'Base de datos, diagrama de entidad relación ','En el dia de la fecha realizamos una base de datos básica e hicimos un diagrama de entidad relacion','2019-05-08'),(1144,64,'Uso de Ubuntu y VMWare para montar un servidor','En el día de la fecha mi grupo y yo empezamos a averiguar cómo montar un Servidor.\nYa sabido eso empezamos por descargar Ubuntu que ofrece un sistema operativo predominantemente enfocado a ordenadores de escritorio aunque también proporciona soporte para servidores, para montar este sistema utilizamos el programa VMWare Workstation que sirve para este tipo de cosas.\n','2019-05-08'),(1145,72,'Clase 8, VMware, Ubuntu y Monto de servidores.','En esta clase monte servidores con VMware, que lo utilizo para simular el sistema operativo de Linux. Por lo que esta clase aprendí a montar servidores y manejar páginas web con un servidor lo que me parece muy útil para un futuro trabajo.\nPor otro lado, creo que al fin estoy entendiendo que todo lo que estamos haciendo sirve y es útil para un trabajo en el exterior. \n','2019-05-08'),(1146,52,'clase 2 de oficina de alumnos','el dia de la fecha los alumnos que fueron a hablar nos comunicaron de las preguntas que les dijieron a los de oficina de alumnos para empezar el proyecto','2019-05-08'),(1147,38,'Bootstrap, Adobe xd','En el dia de hoy vimos tutoriales e intentamos descargar programas como boostrap u adobe xd en los cuales podiamos facilitar el trabajo al desarrollo de las paginas web antes que elaborar codigo html y css desde atom.','2019-05-08'),(1148,63,'Octava clase','El día de hoy nos confirmaron que si íbamos a trabajar; en un principio nos explicaron sobre la entrevista que se realizó ayer:\n- Lo fundamental es trabajar en las inscripciones.\n- No podemos hacer nada respecto a las previas.\n- Además de trabajar en las inscripciones, podemos enfocarnos en los cambios de turno.\nA partir de ahí cada grupo trabajo su parte correspondiente; por mi lado realice una base de datos vinculada con CodeIgniter para ir viendo bien como funciona cada cosa. Creo que la situación va a seguir así hasta que más o menos haya una parte definida en cuanto al área de diseño.','2019-05-08'),(1149,67,'Creacion de la Base de Datos y Diagrama de entidad-relación','El dia de hoy los chicos del area de infraestructura nos hablaron sobre la entrevista con Hernan sobre los problemas para Oficina de Alumnos. Despues con el grupo de Base de Datos hicimos la creacion de esta y el Diagrama de entidad-relacion. ','2019-05-08'),(1150,69,'08/05','Empezamos a desarrollar la base de datos de la aplicación para la oficina de alumnos.También realizamos el diagrama de entidad de relación.','2019-05-08'),(1151,49,'Bootstrap, Adobe xd','En el dia de hoy intentamos descargar bootstrap y abobe xd para facilitar el codigo de la pagina web.','2019-05-08'),(1152,40,'bootstrap','hoy descargamos el bootstrap, investigamos como funciona y avanzamos con el desarrollo de la pagina web','2019-05-08'),(1153,66,'Octava Clase','Hoy ya nos dijeron las problemáticas que tiene oficina de alumnos por lo cual los equipos de diseño y desarrollo empezamos a trabajar, por mi parte aun sigo viendo vídeos tutoriales de Codeigniter para el manejo de bases de datos desde este mismo.','2019-05-08'),(1154,65,'Presentacion ,distribucion de tareas y comienzo del proyecto','Presentamos los jefes de las secciones de diseño, sistema y desarrollo explicaron la conclucion de la entrevista. Repartimos las primeras tareas entre las secciones y comenzamos a trabajarlas.','2019-05-08'),(1155,86,'Practica del servidor','En la clase de hoy hicimos todo lo relacionado con el montaje del servidor y las descarga de sus elementos. Ya está el servidor disponible pero está en blanco sin pagina de inicio. ','2019-05-08'),(1156,75,'Materialize - Componentes Card','Hoy aprendí el manejo de las diferentes cards. Card con imagenes, íconos, horizontales, interactivas o con diferentes secciones. ','2019-05-10'),(1157,85,'Proyecto DEA, consultas y diagrama GANTT','Nos quitamos dudas sobre el proyecto con el profesor puma, también empezamos a trabajar el diagrama GANTT y accedimos a la carpeta de campo de los chicos de mecánica. También nos planteamos nuevas tareas de investigación sobre el DEA su funcionamiento y su forma de uso.','2019-05-10'),(1158,83,'carpeta de campo','hoy hice la carpeta de campo, también me fije sobre si me faltaba algo a mi trabajo. fue muy tranquilo hoy y pude terminar con mis labores.  ','2019-05-10'),(1159,74,'carpeta de campo ','hoy por excursión al cmd (Centro Metropolitano de Diseño) la falta es justificada así que algunos de mis compañeros no vinieron sin embargo nos pusimos a avanzaren las cosas que vamos atrazados como la carpeta de campo. Nos distanciamos cada uno hizo lo que tenia que hacer, de todas maneras compartimos lo que avanzamos porque nadie se puede acordar de cada clase con detalles, ese fue mi pensamiento como líder, le pedi a cada uno que suba su parte con su nombre así no hay plagio con el único fin de guiarse.   ','2019-05-10'),(1160,79,'Proyecto DEA','Hoy nos enfocamos principalemente en el proyecto DEA. Primero revise mis bitacoras para revisar que cosas estuve o no haciendo. A las 16:00 fuimos a hablar con Puma (el profesor encargado de supervisar el proyecto del DEA) para sacarnos dudas con respecto al diseño del DEA, especificamente sobre el uso de una pantalla lcd. Ademas de eso hablamos sobre una cuestiones de falta de sincronia que teniamos con la otra parte del grupo del DEA y el profesor tambien nos pidio que para dentro de dos semanas maximo tengamos una lista de componetes bien hecha, despues fuimos a revisar la carpeta de campo ya hecha que se tenia sobre el proyecto. Cuando terminamos con ello fui a trabajar con mi compañero el diagrama Gantt, uno basico para al menos entregar todo en tiempo y forma.    ','2019-05-10'),(1161,64,'Misma Tarea , Conceptos Nuevos','En el día de la fecha se realizó la misma tarea de la clase anterior, aplicando lo aprendido,  a eso se le sumo que mientras se realizaban las instalaciones predeterminadas, investigue sobre algunos conceptos de temas vistos años anteriores para refrescar la memoria como por ejemplo FTP, y algunas cosas de Servidores Web, según me dijeron ya mañana 15/05/2019 vamos a empezar a trabajar con los servidores físicos que se encentran en el establecimiento, si esto llegara a suceder no facilitaría las cosas, ya que no tendríamos que instalar ciertos programas para trabajar.','2019-05-14'),(1162,72,'Clase 9. Montaje de servidores en Ubuntu y repaso de los mismos.','Hoy fue un día bueno, no tan productivo como quería pero dentro de todo pude hacer y seguir las consigna que me otorgo el líder del grupo. Por otro lado me gustaría poder comenzar a utilizar Linux sin necesidad de un simulador, por lo que le podría sacar el máximo rendimiento para mi estudios.','2019-05-14'),(1163,40,'Bootstrap','hoy continuamos diseñando las vistas de registro con bootstrap','2019-05-14'),(1164,66,'Novena clase','Ya nos entregaron la base de datos con la que tenemos que trabajar con lo cual ahora podemos realizar la conexión a esa misma usando codeigniter y luego probaremos en poder hacer las funciones básicas.','2019-05-14'),(1165,63,'Novena clase','Hoy nos entregaron el archivo .sql de la sección de base de datos por lo que en mi grupo nos pusimos a trabajar con el fin de tratar de relacionarnos con la base de datos mediante el CodeIgniter.','2019-05-14'),(1166,52,'clase 3 de oficina de alumnos','empezamos con el desarrollo de la App con la base de datos que nos brindaron, ahora nos encargaremos del desarrollo de la misma hasta que nos  brinden los diseños.','2019-05-14'),(1167,43,'Diseño y Boomtrap','Hoy estuvimos haciendo el diseño de la página a través de Boomtrap v4. Estuvimos jugando un poco con las cosas para probar como era la aplicación.','2019-05-14'),(1168,57,'Conexión','Conectamos la base de datos ya terminada mediante codeigniter','2019-05-14'),(1169,47,'Conexión y mostrar la base de datos en la aplicación','Hoy el sector de base de datos terminó de hacer la base de datos y nos lo pasaron para que vayamos haciendo la conexión. También mostramos los datos de la bdd en la aplicación.','2019-05-14'),(1170,49,'bootstrap','hoy seguimos con el diseño de la vista de registro','2019-05-14'),(1171,54,'Modificar Gantt y Relación de tablas','En el día de la fecha empezamos a relacionar las tablas de la base de datos y a modificar el diagrama de Gantt que debíamos corregirle algunos errores','2019-05-14'),(1172,38,'Bootstrap','Hoy continuamos con el diseño del registro en bootstrap','2019-05-14'),(1173,41,'Desarrollo de vistas','En el día de hoy estuvimos viendo cómo usar un programa llamado bootstrap que se hace más fácil a la hora de desarrollar una página web y comenzamos a dividirnos las tareas en el grupo de diseño y algunos se dedicaron a desarrollar la vista de registros,inicio y nosotros empezamos con la vista de contacto','2019-05-14'),(1174,69,'base de datos','En el dia de hoy empezamos a relacionar las tablas de la base de datos, y tambien tuvimos que modificar el diagrama de gantt.','2019-05-14'),(1175,68,'Devolución de los gráficos de Gantt y formulación de la conexión con la base de datos.','Los jefes de área obtuvimos una reseña de nuestros diagramas, y comenzamos a corregirlos de forma acorde. Recibimos la base de datos y realizamos la conexion con CodeIgniter.','2019-05-14'),(1176,86,'Manual de usuario','Saqué screenshots de los procedimientos y marcar los botones u opciones que se deben hacer en orden numerico','2019-05-14'),(1177,65,'bootstrap y GANTT','Seguimos practicando con bootstrap y arreglamos errores en el diagrama de GANTT','2019-05-14'),(1178,86,'Manual de usuario','Ajunté todas las imagenes en un sólo word, y agregué las explicaciones y aclaraciones en los distintos puntos de las imagenes, ahora el Manual de usuario es apto para bobos. Es muy claro y deductivo.','2019-05-15'),(1179,69,'base de datos y UML','En el dia de hoy realizamos la relaciones entre tablas de la base de datos, agregamos mas tablas y agregamos registros. Además hicimos el diagrama UML, También modificamos el diagrama de Gantt.','2019-05-15'),(1180,87,'Correcciones y Gant','Hoy los profesores nos dijieron que había dos tablas nuevas que iban a ser necesarias, luego hicimos el diagrama uml y lo programamos. Finalizado esto, estuve terminando y corrigiendo el diagrama de Gantt que se había hecho antes de que me cambien de grupo. ','2019-05-15'),(1181,43,'Diseño de la página y cómo aprobar el trimestre.','Hoy estuvimos agregando más cosas para el diseño de la página, vease: Botones, Cambiar el nombre de esos botones, agregar el logo, etc. También, los profesores, nos dijeron lo necesario para aprobar el primer trimestre, como puede ser: Hacer 14 vistas(En el area de diseño) y tener un total de 50 horas. ','2019-05-15'),(1182,72,'Clase 10, Ubuntu, Aprender FTP y montar un servidor FTP','Esta clase me dedique a aprender sobre un programa que se llama FTP, el cual,  es desconocido para mí. Mi grupo se adapto mas rapido ante esta nueva tarea y nos dividimos para cubrir mas temas en menos tiempo y esfuerzo.\n\nCreo que ver todo lo que es la configuración del FTP, es una cosa que será de ayuda e importancia más adelante en el trabajo. Puesto que recién instalamos el server es interesante saber cómo podemos personalizar el server.\n\nEsta clase fue muy productiva, ya que, pude montar el server de FTP y probé alguna de sus funciones como pasar archivos.\n','2019-05-15'),(1183,40,'Diseño de vistas','hoy terminamos la vista de registro y continuamos con las vistas de agregar y buscador de alumnos de becas','2019-05-15'),(1184,47,'Prototipo para agregar, editar o borrar alumnos en la base de datos. ','Realicé un prototipo para la aplicación para agregar, editar o borrar alumnos en la base de datos. ','2019-05-15'),(1185,73,'Diseño de las paginas','En el dia de hoy estuvimos trabajando con los diseños para la pagina','2019-05-15'),(1186,52,'clase 4 de oficina de alumnos','el día de la fecha estuve adquiriendo información de vídeos y preguntando sobre como va a ser el futuro desarrollo de la APP','2019-05-15'),(1187,41,'Diseño de vista de inscripción','En el día de hoy empezé hacer la vista de inscripción y arreglando algunas cosas del diseño de la vista de la clase pasada como agregar botones sus colores de fondo las fuente del texto también los profesores nos explicaron que para aprobar se necesitan hacer 14 vistas y acumular un total de 50 horas.','2019-05-15'),(1188,57,'Investigación','Estuve investigando y viendo tutoriales sobre cómo usar el framework de CodeIgniter y Bootstrap para realizar los trabajos correspondientes a mi área de trabajo','2019-05-15'),(1189,66,'Decima clase','Hoy nos dijeron sobre todo lo que debemos hacer para el proyecto, mi equipo el de desarrollo, se encarga de varias tareas relacionadas a dar funcionalidad a lo que el los de diseño hagan, ademas debemos manejar las consultas sql para poner en función las bases de datos. ','2019-05-15'),(1190,63,'Decima clase','En este día nos explicaron todo lo que teníamos que realizar para la aprobación del trimestre y, con un compañero de mi misma área, fuimos con los profesores a averiguar lo que nos correspondía de forma mas detallada y yo me encargue de tomar nota de todo lo que considere importante.\nPosteriormente seguí trabajando con CodeIgniter y base de datos.','2019-05-15'),(1191,54,'Finalizar Diagrama de Gantt ','En el día de hoy termine de modificar el diagrama de Gantt','2019-05-15'),(1192,49,'Diseño de vistas','hoy terminamos la vista de registro y comenzamos la vista de becas donde se encuentra las opciones de buscar y agregar alumno.','2019-05-15'),(1193,71,'base de datos y UML','Terminamos el diagrama de Gantt. hicimos el uml de la base de datos, relacionamos las tablas, agregamos registros y tablas, modificamos tambien algunas cosas','2019-05-15'),(1194,67,'Manual de Usuario, Diagrama de Gantt y UML','El día de hoy con el grupo de base de datos nos dividimos las tareas, un grupo se encargo de hacer el Diagrama de Gantt, otro de hacer el UML, y yo de hacer el Manual de Usuario ','2019-05-15'),(1195,38,'Diseño de vistas','Hoy finalizamos el diseño de la vista de registro en la aplicacion bootstrap, tambien le dimos comienzo al diseño de la vista de becas en donde se encuentraran las opciones de buscar y agregar alumnos','2019-05-15'),(1196,64,'Mas Trabajo','En el día de la fecha se realizó la misma tarea de ayer y la semana anterior pero hoy se le agrego que al instalar el servidor Ubuntu en VMWare, le sigo instalar un servidor web en el propio Ubuntu, ya que en el Ubuntu hay que instalar un Servidor DB, Servidor Web, Servidor FTP, Servidor Git. Para realizar la instalación del servidor busque un par de videos o páginas para ver cómo se hacía, y luego se lo aplique en  mi servidor.','2019-05-15'),(1197,65,'Vistas proyecto','5 vistas en bootstrap, inico, login, bcas, registro y previas','2019-05-15'),(1198,37,'Investigación Leaflet y prueba','El día de hoy estuve investigando sobre qué es Leaflet y cómo se utiliza. Vi varios videos en youtube e incluso comencé a leer los tutoriales iniciales que se encuentran en la página oficial de Leaflet con el fin de aprender de éstos, para luego realizar la aplicación solidaria que tengo como proyecto. ','2019-05-16'),(1199,53,'maquetacion o prototipado de la app web','Dibujar e diseñar un prototipo de como podira llegar a hacer el diseño de la web y viendo que campos y tablas de ingresaran en la base de datos. ','2019-05-16'),(1200,51,'Gantt y Foda','hoy, con mi equipo hicimos el diagrama de Gantt para tener un control del tiempo y de cada tarea que tenemos y que nos toca hacer a cada uno y para terminar, nos pusimos a ver para hacer el FODA y depaso le mostré al grupo de Diseño mi prototipo de la aplicacion','2019-05-16'),(1201,85,'Investigacion Y finalizacion GANTT','Hoy nos centramos en terminar definitivamente el diagrama gannt y nos pusimos a investigar los componentes a usar (consultamos tambien con los profesores) y investigamos precios para hacer un lista de los componentes con sus respectivos precios','2019-05-16'),(1202,83,'diagrama terminado','se trabajo con el diagrama de gantt y cuando estaba &quot;finalizado&quot; ocurrió un apagón por lo que se perdió lo que teníamos trabajado hasta el momento. \nSe tuvo que volver a empezar con el diagrama gantt una vez vuelto la luz, luego de finalizar ocurrió una reunión que solo los lideres participaron. \nFinalizando eso, se termino el diagrama y se envió por e-mail al profesor.  ','2019-05-16'),(1203,60,'Comienzo de prototipado','EL dia de la fecha, la seccion de diseño, BdD y infraestructura, comenzaron con los prototipos, mientras que la seccion de  Desarrollo comenzo a utilizar CodeIgniter para hacer un prototipo y comenzar a usar sus respectivas bibliotecas.','2019-05-16'),(1204,36,'codeigniter','Programamos y diseñamos un poco en codeigniter','2019-05-16'),(1205,82,'continuación de proyecto ','Desarrollo y Finalización del prototipado 1, actualización del diagrama de Gantt y entrega del mismo y Desarrollo de la carpeta decampo','2019-05-16'),(1206,74,'FODA','El día de hoy terminamos gantt pero en el momento dela entrega hubo un apagón que termino con todo lo que avanzamos perdimos un gran tiempo, fue un gran atraso pero aun así logramos terminar, una vez terminados el profe nos dijo que nos agrepemos con los chicos de los días martes y miércoles ellos por días que nosotros no tuvimos practicas están más avanzados sin embargo me encargue de ese tema, busque a mis compañeros, les pedí todo lo que investigaron, como usaron los programas, consejos, etc.\nEn el grupo somos pocos pero como líder me voy a encargar de estar a la altura de mis compañeros,pienso que ya esto no solo hace un cambio en mi nota trimestral, siento un peso en mi hombro, ese peso es hacer que mi grupo apruebe yo.\nTambién entre los lideres nos juntamos a debatir el FODA del proyecto.  ','2019-05-16'),(1207,42,'Comienzo del prototipado y finalizacion de encuesta. ','Comenzamos con el prototipado, asi los del grupo de desarrollo pueden empezar a trabajar con el proyecto. Tambien hicimos el FODA para sacar las conclusiones de como vamos a trabajar. ','2019-05-16'),(1208,44,'Codeigniter','Programamos los controllers, views y models de Codeigniter.','2019-05-16'),(1209,45,'actualizacion','actualizacion del diagrama de gantt y prototipado 1 y finalizacion y entrega de ambas','2019-05-16'),(1210,76,'Gantt, FODA y Diagrama ER','Luego de que la líder de nuestro grupo se cambio de turno, se me asigno este rol a mi. Se comenzó finalizando un modelo básico de de un diagrama de Gantt para ya tener buena base de trabajo, el diagrama se ira cambiando según como se proceda con el proyecto. Luego con los otros Lideres de grupos hicimos el FODA en papel, para luego digitalizarlo y presentarlo. Finalice rehaciendo y agregando datos al diagrama entidad relación que no había tenido en cuenta anteriormente.','2019-05-16'),(1211,80,'foda - vistas ','El día de hoy nos dedicamos al desarrollo de la primera versión de las vistas para cada parte de la interfaz web. iniciando con un login en el cual el/la preceptor/a se registrara.\n\nLuego analizamos las Fortalezas, Oportunidades, Debilidades y Amenazas del proyecto, las escribimos en papel, para luego digital-izarlas.','2019-05-16'),(1212,75,'Aprendizaje final de Materialize','Ya en esta clase termine de ver lo que faltaba de materialize, entre ellos:\n\n- Los diferentes &quot;nav&quot;, con link, dropdown, sus distintas alineaciones (centrado-izquierdo-derecho) y sus posiciones (fixed).\n- Los botones flotantes, sus diferentes opciones (alineación, hover y toolbarEnabled) y estilos.\n- Los Carouseles y sus diferentes opciones (duración, con o sin indicadores, tamaño, etc).\n- Los Slider, que son como carouseles pero interactivos y más dinámicos.\n- Y los material box, que son el zoom a las fotos. \n','2019-05-16'),(1213,78,'Base de datos(16/05/19)','Me encargue de seguir la carpeta de campo con las nuevas cosas que aprendí de CodeIgniter, trabaje modularmente las vistas llamándolas desde el controlador, vi un poco de ‘helpers’ y ya me dieron una tarea para practicar con el framework. La tarea es un login, una base de datos que guarde usuarios, sus datos e intentar hacer un CRUD puramente con CodeIgniter, que trae funciones y hechas que facilitan el manejo de base de datos. Ya cuando se tenga el prototipo de esta tarea, se puede empezar a hacer el código del proyecto.\n','2019-05-16'),(1214,50,'Finalizado de la entrevista y desarrollo del prototipado 1','Durante el primer tercio de la clase, se entrevisto al subjefe de preceptores para tener una idea de las necesidades laborales del equipo de preceptores. seguido de esto, se empezaron a desarrollar diversas crokies para la interfaz del proyecto.  ','2019-05-16'),(1215,48,'Terminamos el diagrama de gantt','Entregamos el diagrama de gantt y se paso a limpio el prototipado en word','2019-05-16'),(1216,79,'Proyecto DEA GANT y presupuesto','El día hoy trabajamos en el diagrama de GANT del proyecto DEA, en la búsqueda de componentes y en los precios de estos. Ademas discutimos sobre pics, baterías/pilas (componentes) y como debería de ser el GANT, que ya terminamos, queda presentárselo al grupo de mecanica y al profesor Puma a ver que opinan.','2019-05-16'),(1217,58,'Terminamos el diagrama de gantt','Finalizamoseldiagrama degant y empece el protopipado en word','2019-05-16'),(1218,76,'Maqueta (Diagrama Entidad Relación)','Con lo hecho en las clases anteriores, y con toda la información necesaria, seguimos haciendo el diagrama Entidad Relación. Para esto, me contacte con el líder del grupo de base de datos que trabaja los martes y miércoles, ya que ambos proyectos están conectados, y compartimos lo que ambos teníamos hecho, y en base a esto, nos acoplamos a su trabajo para un mejor rendimiento y corrección de este. Luego por una interrupción inoportuna dejamos el trabajo no terminado.','2019-05-17'),(1219,36,'codeigniter ','completando partes que faltan del codigo php y diseño prototipado','2019-05-17'),(1220,74,'sin avances ','no se avanzo en nada por causa de que una profesora necesitaba el aula, lo cual nos quito prácticamente un día entero de trabajo aunque solo fueron un par  de horas. \n','2019-05-17'),(1221,51,'Maqueta (diagrama entidad relacion)','hoy con mis compañeros complementamos el diagrama entidad relación de nuestros compañeros del turno de martes y miércoles','2019-05-17'),(1222,44,'codeigniter ','haciendo codigos php en codeigniter','2019-05-17'),(1223,85,'Consultas DEA','Debido con un contratiempo debido a la disponibilidad del Aula, nos concetramos unicamente en mostar el proceso que  teniamos a nuestro profesor para conseguir su visto bueno y resolvimos algunas dudas con el','2019-05-17'),(1224,37,'Continuación de la investigación sobre Leaflet.','Hoy continué investigando y realizando pruebas sobre Leaflet. Logre crear popups, círculos y polígonos. También me adentré en la creación de funciones que alerten al usuario en ciertos eventos, aunque no llegué a crear ninguna aún.','2019-05-17'),(1225,50,'Inicio del desarrollo en código de la interfaz','Con el uso de los crokies realizados anteriormente, se inicio la fase del desarrollo del prototipo en código HTML.  ','2019-05-17'),(1226,58,'Finalice el prototipado','Pase a limpio una de las hojas del prototipado que realice ayer ','2019-05-17'),(1227,55,'Complementación del diagrama entidad relación','Hoy junto a mis compañeros estuvimos complementando el diagrama entidad relación de que habían echo anteriormente nuestros compañeros que asisten al turno de los martes y miércoles.  ','2019-05-17'),(1228,48,'Repase html para comenzar a programar en html','Estuve mirando tutoriales en html y jugando con codigos para recordar el lenguaje para la clase que viene ya empezar a pasar el prototipado a html','2019-05-17'),(1229,53,'Practicando sobre materialize','La clase se trato mas sobre practicar sobre la libreria de materialize asi por diseñar bien la pagina','2019-05-17'),(1230,79,'Consultas DEA','Hoy lo primero que hice fue consultar al profesor Puma las dudas que tenia relacionas al proyecto (pics, lcd, DEA modular, diagrama Gantt, DSEA o DEA, presupuestos). En consecuencia encontré nuevos temas de los cuales investigar (DEA subte, DEA y DESA, empresas que fabriquen plaquetas al por mayor). Al profesor le gusto el diagrama de Gantt, solo le encontre un problema, algunas fechas fueron un poco irrealistas (en cuanto a tiempo) por lo tanto deberiamos arreglaro. Despues de hablar con Puma quize dedicarme a trabajar en le proyecto del modulo de preseptoria, pero por una cuestion de que se necesito el aula para algo mas, no pudimos trabajar.  ','2019-05-17'),(1231,45,'inicio con html','hoy empezamos viendo el cuestionario de preceptores en lenguaje html aunque nuestra practica fue interrumpida por una charla segundo año seguiremos la semana que viene','2019-05-17'),(1232,82,'comienzo de html','hoy empezamos a pasar el prototipado a  lenguaje html aunque nuestra practica fue interrumpida por una charla de segundo año ','2019-05-17'),(1233,46,'','hoy llegue tarde a clase y cuando quise investigar los de 2 año vinieron por una charla &gt;:v (no pude hacer nada)','2019-05-17'),(1234,38,'Diseño','Hoy continuamos con el diseño de otra mas de las vistas asignadas, a continuación enviaremos algunas de las vistas terminadas a la sección de desarrollo para que puedan continuar con su trabajo','2019-05-21'),(1235,47,'Hacer que funcionen las inscripciones','Me dieron la tarea de hacer las inscripciones, como ya lo había hecho, ya está.','2019-05-21'),(1236,72,'Clase 11, Ubuntu con Git y FTP.','La clase de hoy, no logre hacer grandes cambios pero en principio avance con la investigación del Git y FTP. Puesto que nos tenemos que apurar a realizar el montaje de servidores ya que no hay clases el 29, me puse listo y a disposición de aprender a utilizar las nuevas funciones de Git + Ubuntu. \nPrácticamente, comencé a practicar y repasar los que aprendí hoy, ademas, conocí un nuevo tipo de uso para Git(Git + Ubuntu). Esto me ayudo a expandir un poco mas sobre todo lo que estoy estudiando, desde que empezó practicas.\n','2019-05-21'),(1237,66,'Decimo primera clase','Hoy se me asigno la tarea de realizar el login para la pagina web, e investigue como hacerlo y empeze a hacerlo, por hoy no logre terminarlo.\nTambien se hizo un repaso sobre que tiene que hacer cada area.','2019-05-21'),(1238,49,'Diseño','hoy seguimos en proceso de terminar las vistas.','2019-05-21'),(1239,43,'Más vistas','Hoy estuvimos agregando más vistas en la parte de Diseño. Agregamos las de: Recuperar cuenta y poner una nueva contraseña. Sin contar que también estuvimos corrijiendo el trabajo de un compañero.','2019-05-21'),(1240,40,'Vistas','Hoy casi terminamos con las vistas de becas y las subimos a drive','2019-05-21'),(1241,63,'Onceava clase','En esta clase nos dividimos con mi área de trabajo, por mi parte; yo me tengo que encargar del buscador y de la parte de becas. Por el momento me puse a trabajar en lo que respecta al buscador.','2019-05-21'),(1242,71,'21-05','Diagrama de Gantt y manual de usuario','2019-05-21'),(1243,41,'Creación de vistas','En el día de hoy termine de desarrollar las vistas de recuperación de contraseña y a arreglar la vista previas de mi compañero.','2019-05-21'),(1244,54,'Manual de usuario, Gantt','Hoy me encargue de revisar e ultimar detalles del diagrama de Gantt y enviárselo al profesor, también junto a mis compañeros continuamos con el manual de usuario','2019-05-21'),(1245,64,'Investigación','En el día de la fecha le pase la investigación a mi compañero de grupo para que la agregara al Manual de Usuario de la asignatura Estructura de Datos, que consistió en  la instalación de un Servidor web en Ubuntu,  y en lo quedo de la clase investigue en internet como montar un servidor de Base de Datos.','2019-05-21'),(1246,69,'Manual de usuarios, Diagrama de Gantt','Terminamos el diagrama de gantt, y seguimos haciendo el manual de usuario.','2019-05-21'),(1247,52,'clase 5 de oficina de alumnos','el dia de hoy estuve ayudando a mis compañeros con el desarrollo de la app y viendo los fallos que tenia ','2019-05-21'),(1248,87,'Manual de usuario y diagrama de Gantt','Hoy estuve con unos compañeros con el manual de usuarios y ayudé a otro a agregar las últimas cosas que faltaban en el diagrama de Gannt. \n','2019-05-21'),(1249,65,'Vistas registro, recuperacion de contraseña y exportacion de archivo','Se siguio trabajando en las vistas del proyecto y se comenzo a exportar','2019-05-21'),(1250,86,'Manual de usuario (servidores)','En la clase de hoy, hice el manual de usuario del servidor web (idex.html) con la información y imágenes que Guido me dio.','2019-05-21'),(1251,72,'Clase 12, Manual de usuario y FTP pasando archivos','La clase de hoy, me la pase completando el manual de usuario ya que termine de montar el server FTP, ademas comence a aprender a pasar datos por el programa FTP.\nPor otro la do todo lo que hice hasta ahora me ayudo a comprender un pcoc mas de como sirben los servidores.\n','2019-05-22'),(1252,43,'Ver vídeos y arreglar LO QUE ESTABA MAL','Hoy descubrimos que todas las vistas que estabamos haciendo estaban mal :) TODO EL TIEMPO QUE ESTUVIMOS ELABORANDO LAS VENTANAS ESTABAN MAL. Ahora, sólo tenemos que agregar columnas porque no sabíamos que se tenía que hacer eso, aunque ya no nos da casi tiempo para terminar. Estuvimos viendo vídeos para ver cómo se hacía lo de las columnas.\n','2019-05-22'),(1253,47,'Vista de Previas','Intenté hacer la vista de previas, pero necesito un buscador para que busque a los alumnos.','2019-05-22'),(1254,54,'Diagrama de entidad relación ','En el día de hoy realizamos un segundo diagrama entidad relación ','2019-05-22'),(1255,69,'diagrama de entidad de relación','el dia de hoy Hicimos el diagrama de entidad de relación, y seguimos con el manual.','2019-05-22'),(1256,67,'Diagramas de entidad relación y Seguridad en la base de datos ','Hoy con el grupo de base de datos nos separamos en grupos y uno se encargo de terminar los diagramas de entidad relación y con el grupo en el que yo estaba investigamos sobre seguridad en la base de datos y también de usuarios y permisos. ','2019-05-22'),(1257,49,'vistas','hoy seguimos haciendo las vistas con bootstrap','2019-05-22'),(1258,38,'Continuacion del diseño','El dia de hoy seguimos avanzando con el diseño de las vistas que nos corresponde a cada sector, obtuvimos algunas fallas que gracias a ello nos sirvio a su vez para mejorar y aprender a usar nuevas herramientas.','2019-05-22'),(1259,73,'todo de nuevo','hoy estuvimos viendo el trabajo que realizamos en las clases anteriores y nos dimos cuenta que estaban mal\ntenemos que hacer todo de nuevo','2019-05-22'),(1260,64,'Trabajo Duro','En el día de la fecha estuve completando la configuración del servidor web, haciéndolo de nuevo en el mismo disco que en el que trabajo mi compañero de grupo, que se encargó de de hacer el server FTP, y también agregue información al manual de usuario.','2019-05-22'),(1261,71,'diagrama de entidad de relación','realizamos el uml de entidad relacion e investigamos sobre usuario de administrados y usuario normal','2019-05-22'),(1262,40,'Posicionamiento de las vistas','Hoy tuvimos un problema con el posicionamiento de las vistas y tuvimos que reorganizarlas ','2019-05-22'),(1263,68,'Puesta en común con la sección de Diseño','Revisamos los avances de la sección de Diseño para poder darles una reseña de qué cosas deberían modificarse para permitir y/o agilizar, dependiendo del caso especifico, la programación del grupo de Desarrollo con respecto a las vistas y su conexión entre sí y con la base de datos.','2019-05-22'),(1264,57,'Vista de Previas','Todavía el sector de diseño no nos dio las vistas, así que no puedo seguir en esa área. Intenté hacer la vista de previas, pero necesito un buscador para que busque a los alumnos.','2019-05-22'),(1265,86,'Carpetas de campo','Finalizado el Manual de usuario de Ubuntu\nAyudé a Acosta con su manual y con problemas que tuvo (Servidor BD)\nSeguimos con la elaboración del manual de usuario de Servidor Web. \n','2019-05-22'),(1266,41,'Las vistas ','En el día de hoy las vistas que teníamos hecho no estaban del todo bien y vamos a tener que rehacer las vistas y empezamos a ver tutoriales de cómo usarlo con columnas.','2019-05-22'),(1267,39,'Manual de Usuario, Base de datos','En la clase de hoy mostré paso a paso como instalar Mysql en Ubuntu para luego hacer una Base de Datos. Realice captura pero tuve un inconveniente con la compitadora, por lo cual no cuento con screenshots de lo hecho en clase.','2019-05-22'),(1268,63,'Doceava clase','En esta clase segui trabajando con el buscador de alumnos, esta vez puedo decir que tuve mejores resultados que ayer y que espero poder terminarlo para la proxima semana','2019-05-22'),(1269,65,'Vistas','Progreso negativo, las 7 vistas que teniamos hasta la fecha se tienen que rehacer. se va a continuar en casa, para llegar a la fecha','2019-05-22'),(1270,87,'Seguridad','Hoy estuve la clase leyendo información sobre cómo debería ser la seguridad en la base de datos y sobre qué tipos de usuarios, y privilegios existen.','2019-05-22'),(1271,66,'Decimo segunda clase','Hoy casi termine con el login simplemente me queda ajustar unos pequeños detalles.\nAdemas de que tengo un error que debo resolver.','2019-05-22'),(1272,52,'clase 6 de oficina de alumnos','hoy segui ayudando a los compañeros de mi area de desarrollo','2019-05-22'),(1273,75,'Simulación del login','En esta clase, ya empezamos a prototipar. Empezamos por el login, para ello trabajamos en equipo. Una parte se encargo de desarrollar el código en PHP del login. Mientras que otra persona se encargaba de aplicarle los CSS al login. ','2019-05-23'),(1274,51,'Complemento','recibimos la base de datos del otro grupo y le complementamos con lo que pensamos que era lo que le faltaba, desgraciadamente no se guardò a la primera y tuvimos que volverla a hacer','2019-05-23'),(1275,78,'Login preceptores y superiores (23/05/19)','Trabaje hoy con la comprobación de si el usuario que se logea es preceptor o un superior y según cual sea se le da ciertos privilegios.\nMe di una idea básica de como sería la metodología para determinar los privilegios del usuario. Se me había ocurrido hacer SELECT en dos tablas, una que guarda usuarios de preceptores y otra que guarda usuarios de superiores. Comprobar cuantas filas contenía cada resultado (Si la tabla de preceptores tiene 1 fila y la de superiores 0, se da privilegios de preceptor). Pero no es muy eficaz. Lo correcto es usar una librería de CodeIgniter la cual es Session, que sirve para manejar sesiones.\n','2019-05-23'),(1276,42,'Organización y terminación de prototipado ','Se creo una carpeta con los integrantes del grupo de diseño, para poder estar todos en contacto y no perder tiempo pidiendo material si nos falta en algun momento, terminamos los prototipos en word y photoshop  y avanzamos en html con las vistas del Listado y Notas. ','2019-05-23'),(1277,45,'organización de sector  y terminación de prototipado','nos organizamos una carpeta compartida en el google drive para todo el trabajo en el sector y luego hicimos la finalizacion del prototipo para comenzar con la pagina web','2019-05-23'),(1278,76,'Codificación','Comenzamos finalizando la maquetacion del diagrama Entidad Relacion, entrelazando nuestra parte con la que se hizo en el otro grupo de practicas. Luego de haber finalizado esta, comenzamos codificando la propia maqueta, la cual llegamos a finalizar, pero no a hacer las pruebas suficientes par aconfirmar su funcioamiento.Finalice realizando la documentacion de nuestro grupo, para tener escrito todos los procedimientos que se llevan a cabo en el grupo.  ','2019-05-23'),(1279,50,'Finalizacion de documentacion','Se terminaron los últimos archivos de los primeros crokies del prototipado. Se creo una carpeta compartida para el grupo y se inicio con la etapa de desarrollo en código.','2019-05-23'),(1280,36,'codeigniter controller','ya hice controladores y model de mostrar,agreagar,editar,eliminar y buscar','2019-05-23'),(1281,55,'Complementación de la base se datos','Estuvimos complementando la base de datos que había  realizado el grupo de los martes y miércoles agregando tablas. En el proceso hubo una complicación ya que al no guardarse correctamente se borraron 4 de estas que tuvieron que volver a hacerse.','2019-05-23'),(1282,83,'ultima investigación ','hoy se hizo una nueva información en la cual a mi se me repartió un par de cosas por hacer al igual que a mi compañera. \n¿como ponerla lamp en el server?,¿como poner un servidor git- hub? y ¿como poner un servidor de correo electronico?.\nEsto se logro terminarlo  ','2019-05-23'),(1283,60,'Seguimiento del proyecto','El dia de hoy se continuo con dicho proyecto.\nEn el sector de desarrollo nos reunimos para discutir que hacer mientras esperamos las vistas que nos deben el sector de diseño.\nSe logro empezar con los controladores.','2019-05-23'),(1284,46,'servidores linux,voip y ftp','el día de hoy dividimos los temas para investigar con mi compañera, a cada una nos toco 3 temas de servidores ','2019-05-23'),(1285,44,'Terminamos la conexion con la bd y los controladores de codeigneter','Terminamos la conexion con la bd y los controladores de codeigneter y estamos esperando a que nos den las vistas y la base de datos para terminar nuestra parte del trabajo','2019-05-23'),(1286,56,'Desarrollo de pestañas','-Diseño de la pestaña &quot;sanciones&quot;\n-Desarrollo del maquetado y estilo de la pestaña\n','2019-05-23'),(1287,74,'desarrollo','empece a aprender a usar códigos básicos  de linux, ','2019-05-23'),(1288,79,'Atraso en proyecto de preseptoria','Hoy me coordine con mi grupo del proyecto de preceptoria y me di cuenta que estamos bastante atrasados y a destiempo con el otro grupo, asi que voy a enforacarme en trabajar en el proyecto de preceptoria. Nos falta trabajar en investrigacion y en el GANTT pero ya tenemos una idea de que es lo que tenemos que hacer asi que vamos a trabajar en eso para no atrasar al resto del proyecto.','2019-05-23'),(1289,37,'Leaflet','Continué investigando y probando Leaflet con los tutoriales de la página oficial, y las distintas herramientas que encontré en la web.','2019-05-24'),(1290,44,'Empezamos a hacer los controladores y el modelo de &quot;asistencias.php&quot;','Empezamos a hacer los controladores para las asistencias y avanzamos con el modelo.','2019-05-24'),(1291,85,'Presupuesto DEA','Hoy nos dedicamos a hacer una pequeña lista de precios de todos los componentes a utilizar para la parte electrónica del proyecto.','2019-05-24'),(1292,36,'Empezamos a hacer los controladores y el modelo de &quot;asistencias.php&quot;','solucione problemas de la vista de asistencia y pude avanzar con los controladores y modelos','2019-05-24'),(1293,51,'Mantenimiento','hoy hicimos mantenimiento en la base de datos, buscamos y corregimos errores y nos adentramos en sql al averiguar como podemos usar el &quot;inner join&quot; en nuestra base de datos :)','2019-05-24'),(1294,83,'instalacion','hoy se conecto al servidor el pendrive con el exi y despues bootamos luego aceptamos las condiciones y elegimos la generic flash disck 3,75gib. ademas seleccionamos el idioma que requeríamos , le pusimos un usuario y una contraseña, se configuro el programa, se espero a que cargara luego apareció un mensaje  que se ha  dicho que se ha  completando la instalación.\n ','2019-05-24'),(1295,78,'Nuevo intento de privilegios (24/05/19)','Había pensado en el algoritmo que se me había ocurrido para detectar si un usuario es preceptor o un superior y me di cuenta que la manera más sencilla es configurando uno de los campos de la tabla de usuarios. La regla que sigue es que si el campo ‘permiso’ tiene un 0, es un preceptor. Si tiene un 1, entonces es un superior. Hoy me propongo a trabajar esa parte, pero sin meterme en el tema de sesiones en CodeIgniter para no tardar hoy con aprender ese tema y para probar.\nVoy probando y me trabo en algunas partes porque, estaba intentando usar funciones y siguiendo las reglas que aprendí de base de datos en CodeIgniter y al parecer tengo que usar un foreach si o si para tratar al registro como un array-objeto (Es decir que me deje acceder de la manera $fila-&gt;nombreCampo).\nAl final funciono el intento que hice de sesiones. Ingreso con un usuario preceptor y me manda al perfil del preceptor. Ingreso un usuario superior y muestra el perfil del superior.\n','2019-05-24'),(1296,75,'Simulacion con base da datos','En esta clase empeze a ver como hacer la simulación para agregar o modificar una nota. Para ello esta el codeigniter que nos ayuda a crear los modelos. Para llevar a cabo mi labor, en primer lugar tuve que ver como funcionaba la base da datos y a raiz de eso se procedera a realizar en primera instancia lo visual para despues trabajar en las consultas (INSERT INTO y SELECT ).','2019-05-24'),(1297,76,'Base de Datos','Importamos la base de datos y comenzamos trabajando en ella. Hicimos un breve testeo y comenzamos con una pequeña busqueda de errores, para la corrección de estos (Tuvimos ayuda de gente externa al grupo para un punto de vista mas amplio). Tambien nos adentramos un poco mas dentro del lenguaje SQL. Realizamos un cambio en una de las tablas de base de datos, la cual optimiza y mejora la misma. ','2019-05-24'),(1298,76,'Base de Datos','Importamos la base de datos y comenzamos trabajando en ella. Hicimos un breve testeo y comenzamos con una pequeña busqueda de errores, para la corrección de estos (Tuvimos ayuda de gente externa al grupo para un punto de vista mas amplio). Tambien nos adentramos un poco mas dentro del lenguaje SQL. Realizamos un cambio en una de las tablas de base de datos, la cual optimiza y mejora la misma. ','2019-05-24'),(1299,79,'Servidor Infraestructura y Prepuesto DEA ','Hoy empece mi día buscando presupuestos de componentes del DEA y anotándolos para ya hacer el primer presupuesto serio. Mi compañero Nacho también estuvo buscando presupuestos, yo busque en la pagina &quot;SYC semiconductores y componentes&quot; y el en la pagina &quot;candy ho electronics&quot;. Tuvo principalmente dos problemas, el primero fue que la pagina no tenia todos los componentes que pensé que tendría y el segundo problema es que teníamos que instalar con el grupo de infraestructura el Exsi en el servidor (a la vez que estaba buscando presupuestos). Asi que estuvo yendo y viniendo intentado hacer las dos cosas. Puede (junto a mis compañeras) instalar el servidor correctamente y hacer la documentación pero no pude hacer el presupuesto como quería.','2019-05-24'),(1300,82,'código','el día de hoy empezamos con el codigo  de login  para lo cual utilizamos html y css y buscamos información en school3, googlefonts  y boostrap','2019-05-24'),(1301,46,'instalacion','el día de hoy se instalo el ex-el  en un servidor, en el cual lo instalamos configurando ciertas cosas incluido el idioma, creando una contraseña y usuario.\nel profesor fue el que nos dio el pendraip, para la instalación, al terminar  cerramos cesión y guardamos todo  ','2019-05-24'),(1302,45,'código html','empezamos con la realización del código del login en el cual usamos css y html.','2019-05-24'),(1303,67,'Usuarios','El día de hoy con Eugenia, la líder del grupo, pensamos crear un usuario nuevo para la base de datos y eliminar el usuario root, pero preferimos cambiar la contraseña y dejarlo asi por las dudas, ya que tuvimos un error y podíamos romper toda la base de datos.','2019-05-28'),(1304,72,'Clase 13, terminar manual de usauario.','La clase de hoy nos dedicamos a terminar todas los manuales de usuario para el siguiente grupo.\n\nAdemas me la pase configurando FTP y resolviendo problemas con PHP del server web de Ubuntu.','2019-05-28'),(1305,71,'Entrega de lo hecho en clase','Hicimos modificaciones al manual de usuario, lo entregamos junto con la base de datos y verificamos que todo este bien hasta ahora','2019-05-28'),(1306,47,'Manual de usuario y presentación de sector','Hice el manual de usuario con el codigo que hice yo. Tambien unimos todas las vistas que tenia cada integrante y presentamos el proyecto al docente.','2019-05-28'),(1307,69,'Entrega de lo hecho en clase','modificamos el manual de usuario y entregamos todo lo hecho hasta ahora','2019-05-28'),(1308,86,'Pasar manuales de Usuario en limipo','Terminar y pasar en limipo los manuales de usuarios de Diseño Web y Ubuntu.','2019-05-28'),(1309,54,'Entrega','Hoy revisamos e hicimos correcciones de todo lo realizado hasta el día de la fecha y posteriormente entregamos al profesor las tareas','2019-05-28'),(1310,39,'Terminamos de pulir algunos detalles a los manuales de usuario.','En la ultima clase realice una búsqueda de pasos para crear un servidor de base de datos para crear el manual de serividores de BD.','2019-05-28'),(1311,87,'Usuarios y entrega','Hoy le agregamos una contraseña al usario root para que sea mas seguro.También verifiqué que todo esté completo para entregarlo y como a algunos archivos le faltaban algunas cosas finales, todo el grupo estuvo terminandolo. Al final, entregamos todo completo.','2019-05-28'),(1312,57,'Manual de usuario y presentación de sector','Completamos el manual de usuario, unimos todas las vistas e intentamos completar el proyecto lo más que pudimos para la evualuación del docente para el primer trimestre','2019-05-28'),(1313,40,'Vistas finalizadas','Hoy terminamos con las vistas, corregimos alguno detalles y exportamos todas a html','2019-05-28'),(1314,43,'Arreglar vistas y entregarlas al otro sector.','Hoy estuvimos arreglando algunas vistas que estaban mal. También pasamos al frente a hablar con el profesor, y ahora sólo debemos pasar las vistas al otro sector.','2019-05-28'),(1315,64,'realización de actividades','En el día de la fecha completamos el gantt, completamos las carpetas de campo respectivas y se las entregamos al profe para que las mire y nos de una devolucion','2019-05-28'),(1316,49,'Vistas finalizadas','En el día de hoy terminamos con todas las vistas pedidas por el profesor.','2019-05-28'),(1317,68,'Formulación del manual de usuario. Entrega del proyecto.','En base a los comentarios del código de HTML y PHP encontrados dentro de la carpeta de proyecto de CodeIgniter, formulamos un archivo de texto .docx de estilo manual de usuario con la información necesaria para poder editar y/o mejorar el proyecto sin necesidad de pasar horas entendiéndolo.\nHicimos entrega al profesor de los archivos de CodeIgniter y dos .docx de manual de usuario a través de pendrives.','2019-05-28'),(1318,73,'Finzalizacion de las vistas y carpeta de  campo','con el grupo hoy terminamos las vistas y la carpeta de campo ','2019-05-28'),(1319,41,'Corrección de vistas','En el día de hoy el profesor reunió a cada una de las áreas para ver como van con el proyecto ya que hoy termina el primer trimestre, arreglamos y terminamos las vistas que el profesor nos dijo que estaban mal y que faltaban, también creamos el manual de usuario y las vistas las exportamos como html.','2019-05-28'),(1320,52,'clase 7 de oficina de alumnos','el dia de la fecha no se pudo terminar de entregar el proyecto completo con sus resultados deseados\npero pude conectar casi todas la vistas del proyecto menos los diseños','2019-05-28'),(1321,78,'Cargar base de datos automáticamente 30/05/19','Hoy me cansé de estar creando una base de datos y cargar todas las tablas manualmente en phpmyadmin. Para solucionar esto pense en un algoritmo que se ejecute \ncuando se llama al index del controlador (Este index era el encargado de cargar la vista de login). Antes de cargar la vista lo que haría es llamar a un método del\nmodelo que tomaría de un archivo sql todos los comandos y las guardaría en un string. Posteriormente, se conecta con la base de datos y la crea. Luego de esto\ncargaría todas las tablas.\nCuando escribía el código me quede con una dificultad y es que no podía leer el archivo sql.\nIntente con la función fopen() concatenando con la función base_url() para establecer una ubicación base. Luego intente con file_get_contents() y tampoco. También se me\nhabía ocurrido revisar la documentación de CodeIgniter sobre los files_helpers, ya que como son helpers de archivos, pensé que me podían ayudar. Había una función que era \nla read_file(), pero la misma documentación recomendaba usar file_get_contents() en lugar de read_file(), ya que este quedó obsoleto. En conclusión, no tuve exito.\nLa última opción (algo bruta) sería pegar todo el SQL en un string, sin leer de archivos ni nada. Es decir que ya exista una variable con todas sentencias. No es algo\nmuy profesional pero sirve como último recurso, o aunquesea, sirve como algo temporal hasta que encuentre una solución. Mientras tanto usaré esta última.','2019-05-30'),(1322,74,'Linux ','este dia estuve viendo como usar Sphere VMware cuyo programa es para es la plataforma de virtualización líder del\nsector para construir infraestructuras de cloud. Permite a los usuarios ejecutar aplicaciones críticas para el negocio con\nconfianza y responder con mayor rapidez a las necesidades empresariales. \nsegui con la investigacion de como usar ubuntu. \n','2019-05-30'),(1323,53,'Realizar la carpeta de campo','completar mas la carpeta de campo del día de hoy mejorando algunos aspectos.','2019-05-30'),(1324,76,'Finalizacion de BD funcional','Comenzamos el dia con una restructuracion de la maquetacion de la base de datos, la cual optimiza y mejora la misma. Luego de comprobar su funcionamiento y acoplamiento con los comandos ingresados, nos pusimos al dia con la documentacion de nuestra seccion. Por mi parte, actualice y mejore el diagrama de Gantt hecho anteriormente.','2019-05-30'),(1325,36,'codeigniter php asistencia','haciendo php de asistencia. esperando que me den la vista y base de datos porque no se como funciona.','2019-05-30'),(1326,51,'ultimando detalles','creamos tablas en la base de datos que ya teníamos y las conectamos con el &quot;foreign key&quot; y de paso editamos el diagrama de gantt y le agregamos mas cosas que ya habíamos echo','2019-05-30'),(1327,44,'Segui con el php de Asistencias','Adelantamos la pagina de asistencias y modificamos algunos controladores.','2019-05-30'),(1328,75,'Prototipo ingresar nota','En esta clase realice un prototipo para agregar nota, implementando Codeigniter. Por otra parte también pude mostrar esos datos por pantalla a través de  una tabla, esto se realizó con materialize. ','2019-05-30'),(1329,56,'Desarrollo de pestañas','-Revisión del código ya realizado\n-Corrección de errores\n-Actualizado de maquetado y seguir el desarrollo','2019-05-30'),(1330,83,'carpeta y investigación','hoy actualice la carpeta y la envie. Ademas  investigamos vmware vsphere  para poder saber como funciona y como trabajarlo despues ','2019-05-30'),(1331,55,'Remplasando las tablas existentes por una mas completas ','Remplasamos las tablas existentes por una mas completas (aun que eran minimos detalles) y utilizamos la misma base de datos para no crear otra, en un momento al estar retrasado con mi carpeta de campo me aparte del grupo pára completarla.','2019-05-30'),(1332,79,'Investigacion de audio-arduino para proyecto DEA','Hoy me dedique practicamente todo el dia a informararme sobre reproduccion de audio en arduino, leyendo el libro &quot;Arduino Curso Practico de Formacion&quot;. Obtuve informacion importante, mas que nada sobre medidias de seguirdad sobre la conexion entre los parlantes y el arduino (divisor de tension, potenciometro como divisor de tension, condensador &quot;by pass&quot;, amplificador). Sin embargo no se hasta que punto pueden ser necesario este conocimiento, ya que si usamos un shield (que no creo posible) o un modulo de audio (bastante mas factible), podria no ser necesario estas medidas de seguridad. Es necesario seguir investigando.  ','2019-05-30'),(1333,45,'Continuación de diseño HTML y calificación grupal','hoy continuamos diseñando en HTML los códigos para una parte de la pagina en el trascurso de la clase realizamos una calificación de nuestro grupo.','2019-05-30'),(1334,46,' corrección de carpeta y investigación','hoy revise mi carpeta de campo, ordenando un poco y añadiendo cosas que me faltaron para que quedara mas prolijo. También investigue con mi compañera sobre el vsphere vmware ','2019-05-30'),(1335,48,'Codificar en html','Hoy evalue a mis compañeros y comence con el codigo de html avanzando un poco, ya tengo hecho el menu y el dropdown me falta codigo aun ','2019-05-30'),(1336,58,'Pasar el prototipado a html','Hoy comence a pasar el protodipado de boletin a html y css y evaluamos a nuestros compañeros por lo que hicimos','2019-05-30'),(1337,85,'Pequeño prototipo en circuits e investigacion de amplificadores','me conecte a una plataforma llama circuito.io para hacer un pequeño modelo de la estructura electronica del DEA y luego lei una pdf sobre el funcionamiento de amplificadores','2019-05-30'),(1338,82,'continuación','el día de hoy continué con el codigo utilizando html ,css  y script y busca que información en school3 ','2019-05-30'),(1339,50,'Desarrollo de vistas en codigo','Se reanudaron los avances de las vistas en codigo HTML y CSS. ','2019-05-30'),(1340,83,'servidor web','hoy me encargue de ver como configurar el servidor en apache. claro que primero vi como instalarlo pasa a paso ademas me queda ver el como usarlo. hace poco me dijeron que tenia que buscar el servidor en php  y el servidor en correo electrónico  lo cual lo haré en otro momento ','2019-05-31'),(1341,76,'Terminación de la Base de Datos','Finalmente terminamos con la base de datos y su testeo. De ahora en adelante lo necesario seria su mantenimiento y backups, en caso de ser necesario. Se siguió mejorando todo lo que concierne a la documentación y se completo lo máximo que se pudo de la carpeta del grupo de Base de Datos. ','2019-05-31'),(1342,53,'Buscar informacion sobre array ','Entrar a dos paginas, solo utilizar una ya que no se logro llegar a la segunda, por estar sentrada en la primera ','2019-05-31'),(1343,51,'detalles finales','me dediqué a terminar la carpeta de campo, ver si no tenia algo mas que hacer y ayudar a un compañero a que termine ','2019-05-31'),(1344,75,'Prototipo actualizar nota','En esta clase realice la función &quot;actualizar nota&quot;. Lo que hace es mostrar al usuario la lista de los alumnos con la opción de cambiar nota. Al precionar esta opción, te lleva a otro sitio donde se veran los datos especificamente de ese alumno y con la opción de cambiarle la nota. Para la realización de esto se utilizó codeigniter y materialize. ','2019-05-31'),(1345,37,'Etapa final investigación Leaflet.','Entré en lo que considero yo, la etapa final de mi investigación sobre Leaflet. Di un vistazo más bien general a casi todos los tutoriales que proporciona la página https://leafletjs.com/index.html, para tener una idea un poco más general, y luego adentrarme más detalladamente en cada uno de éstos. ','2019-05-31'),(1346,55,'Pequeños detalles','Hoy me dedique a complementar la carpeta de campo con las partes que faltaban, mis compañeros realizaron lo mismo.','2019-05-31'),(1347,74,'FTP, servidores web, base de datos, diseño, etc','pude convencer a un compañero del otro turno a que nos de una mano, ya que nos quedamos muy trabados, sin nada que hacer mas que investigar, ahora ya podemos empezar a usar los dichos programas que hay en el titulo para ya terminar este proyecto una vez finalizado el trimestre. ','2019-05-31'),(1348,79,'Proyecto DEA presupuesto y tal vez nuevo proyecto ','Hoy empeze a trabajar un buen rato antes de clase. primero fui a hablar con el grupo de DEA correspondiente a mecanica sobre unas ideas que tenia y que me parecia importante hacereles saber (agregar puerto usb, jack 3.5mm). De paso a eso hable con otro chico de mecanica que necesitaban para el proyecto a alguien que sepa Arduino para el proyecto, cuestion que hablamos (y despues lo hable con Puma) y es posible que entre a otro proyecto. Despues de todo esto fui a trabajar al aula de pp (antes de que comienze la hora) a seguir trabajando en el presupuesto, esta vez busque precios por la pagina emakers y por sus publicaciones de mercado libre. Despues de trabajar un buen rato en eso (y ya siendo hora de pp) fui a hablar con el profesor Puma sobre mis ideas, despues de quedar en que no agregariamos el jack y el usb porque la idea es hacer el DEA lo mas fiel y acotado posible, volvi a hablar con los chicos de mecanica del nuevo proyecto y despues volvi al aula a buscar presupuestos e Emakers.','2019-05-31'),(1349,78,'Selección de alumnos según criterios (31/05/19)','Charlamos las cosas en las que trabajó cada uno, que cosas tenemos terminadas y que falta hacer. Buchi, que se encargó de la vista que muestra los alumnos y sus notas, dejo una parte para que lo programe haga otro. Esa parte es la que voy a hacer yo. La consigna es la siguiente: como ya tenemos la selección de todos los alumnos (SELECT *) y la selección por id (SELECT * alumnos WHERE ID = \'$id\'), habría que hacer otra selección tipo SELECT * FROM alumnos WHERE pero concatenando varias condiciones WHERE con operador AND, es decir, una selección más específica que solo por id. Ya hay una vista de action de tipo option para elegir al alumno según el trimestre, curso y división. Ahora mi tarea es hacer añadir otro input tipo submit para mandar los datos seleccionados, además de hacer esa parte de formulario con el form_helper de CodeIgniter. Veo fácil la cosa, pero como voy a trabajar con los archivos de otro compañero, puede que me tarde.','2019-05-31'),(1350,82,'finalizacion ','hoy finalizamos el proyecto de html con información de paginas webs como boostrap y materialize y subimos todo lo realizado al drive\n','2019-05-31'),(1351,45,'finalizacion del html','hoy finalizamos el proyecto de html con información de paginas webs como boostrap y materialize y subimos todo lo realizado al drive a la carpeta del grupo\n','2019-05-31'),(1352,58,'termine de pasarlo a html','Hoy termine de pasar el protipado de ayer a html.','2019-05-31'),(1353,60,'Finalizacion de Proyecto','El dia de la fecha se tuvo que dar por terminado el proyecto del trimestre, en el cual el equipo de desarrollo tuvo que terminar los controladores.','2019-05-31'),(1354,48,'termine de pasar el html','Hoy investigue los codigos para terminar el html ','2019-05-31'),(1355,47,'Evaluación a nuestros compañeros','El profesor nos pidió que evaluáramos a nuestros compañeros de sección con respecto a lo que hizo cada uno en el proyecto a lo largo del trimestre.','2019-06-04'),(1356,43,'Hablar de las notas y hacer vistas','Hoy el profesor nos llamó uno por uno para decir las notas de los compañeros del área. Luego de eso, seguimos haciendo las vistas que nos faltaban, pasando luego a HTML para los de los otros sectores.','2019-06-04'),(1357,38,'Finalizacion de vistas y diseño','Hoy estuvimos terminando las vistas o por lo menos algunas cosas que nos faltaban para poder entregarlas al sector de desarrollo, despues de eso, nos dedicamos a poder realizar diferentes diseños en las mismas vistas como para darle una mejor apariencia.','2019-06-04'),(1358,63,'Decimocuarta clase','El dia de hoy continuamos trabajando con las vistas.\nAdemás de eso nos llamaron para ponerle una puntuación del 1 al 4 a nuestros compañeros de área.','2019-06-04'),(1359,57,'Evaluación de trimestre','Evaluamos a nuestros compañeros de sección con respecto a lo que hizo cada uno en el proyecto para así poder cerrar la nota del primer trimestre.','2019-06-04'),(1360,49,'vistas','En el dia de hoy seguimos terminando las vistas que nos habian quedado pendientes.','2019-06-04'),(1361,64,'Interfaz Grafica!','En el día de la fecha con el grupo nos dividimos las tares, ya que teníamos algunas, por ejemplo a uno le toco investigar de como montar un servidor para mail, otro se encarga de afinar el php y yo me voy a encargar de montar una interfaz gráfica al servidor así se nos hace más fácil trabajar al grupo. ','2019-06-04'),(1362,41,'Hablamos con el profesor sobre las notas y seguimos con las vistas','En el día de hoy el profesor nos llamó a cada uno para el tema de las notas. Después, seguimos haciendo las vistas que nos faltaban, para proceder a pasarlos a HTML para los compañeros de otras areas.','2019-06-04'),(1363,66,'Décimo cuarta clase ','Hoy nos dieron la opción de poder asignar una nota a los compañeros de equipo, también nos dijeron que debíamos continuar con las tareas habituales con lo cual debíamos combinar nuestro trabajo con el del equipo de diseño. Tras la espera notamos que les faltó hacer la vista del login. ','2019-06-04'),(1364,87,'Usuarios','Hoy estuvimos anotando los privilegios para los usuarios. Al final llegamos al acuerdo de que son 3: administrador (todos los privilegios), oficina de alumnos(escritura) y alumnos (lectura).\nTambièn estuvimos calificando a nuestros compañeros','2019-06-04'),(1365,54,'Usuarios','Hoy junto a mis compañeros debatimos sobre los usuarios de la base de datos','2019-06-04'),(1366,52,'clase 8 de oficina de alumnos','el dia de hoy estuvimos continuando con la union de vistas de diferentes programas de paginas web \ny nos hicieron puntuar a nuestros compañeros de area del 1 a 4','2019-06-04'),(1367,40,'Trimestre finalizado','Hoy terminamos con los detalles que quedaron y  vistas extras','2019-06-04'),(1368,69,'Usuarios','En el día de hoy definimos los usuarios que van administrar la base de datos.','2019-06-04'),(1369,71,'Usuarios','Hoy junto a mis compañeros estuvimos hablando para definir los usuarios de la base de datos, llegamos hasta ahora a tres; administrativo, oficina de alumnos y alumnos.\nTambien calificamos a nuestros compañeros','2019-06-04'),(1370,65,'vistas','Seguimos retocando las vistas, despues de una charla constructiva con el jefe del proyecto','2019-06-04'),(1371,72,'Clase 14 montar servers PHP, Mysql, Apache2','La clase de hoy me enfoque en la tarea de resolver un par de problemas que tuvimos el server de PHP, aparte monte el server de Apache, myql y PHP. Tambien utilice el php para configurarlo, para mañana utilizarlo.','2019-06-04'),(1372,86,'Instalacion y configuracion de Thunderbird','Hoy despues de perder una hora tratando de resolver un problema de sincronizacion de google y thunderbird pude conectarlo despues de una re-instalacion','2019-06-04'),(1373,68,'Puesta en común de archivos con Diseño y puntuación de los integrantes','Comparamos los archivos con el jefe de Diseño para así tener todas las vistas actualizadas.\nPuntué, ante el jefe de proyecto, a los integrantes de mi grupo en valores entre el 1 y el 4, siendo 1 &quot;No trabajó o casi no trabajó&quot;, y 4 &quot;Trabajó todo el tiempo o casi todo el tiempo&quot;.','2019-06-04'),(1374,72,'Clase 15, solución a problemas en FTP','Aparentemente hoy seguí teniendo conflictos con el servidor de FTP, lo que me obligo a configurarlo mejor. Gracias a esta idea arragle el problema ocasionado la clase pasada, y conseguí montarlo para que funcionen todo tipo de transferencia de datos.\nPor otra parte conecte el  server FTP con una pagina html, la cual utilizaremos mas adelante para la implementacion rápida de paginas.\nEsta clase pude concretarme en vatios tema de los servidores ademas de eso, logre adaptarme al cambio de líder y a las diferentes tareas que nos asignaron esta clase.\n','2019-06-05'),(1375,57,'Nuevo lider','Cambiamos de lider en nuestra sección e intentamos hacer algunas de las vistas que faltaban por hacer','2019-06-05'),(1376,47,'Nuevo lider e intentar hacer la vista previas','Cambió el líder de sección y le mostramos todo lo que habíamos hecho hasta ahora. También volví a empezar a tratar de hacer la vista de previas, no me está saliendo…','2019-06-05'),(1377,64,'Cambio de lider, ftp y mas','En el día de la fecha deje de ser el líder y el liderazgo se lo pasaron a otra persona. También instale la interfaz gráfica en la versión final del Ubuntu y luego instale el php 7.3 también en la versión final, luego les pase a mis compañeros que están trabajando con Thunderbird la versión del Ubuntu que ya tiene la interfaz instalada par que ellos trabajen ahí.  ','2019-06-05'),(1378,39,'Mysql y Thunderbird.','En la clase de hoy probamos el servidor de base de datos (Mysql) y tuvimos algunos problemas con el usuario, pero pudimos finalmente lograr que funcione correctamente. Ademas juntamos todos los trabajos en un mismo servidor.','2019-06-05'),(1379,52,'clase 9 de oficina de alumnos','hubo un cambio de jefe y termine de cambiar, modificar y arreglar todas las vistas de la aplicacion \nsolo falta los diseños del area de diseño y las ultimas vistas funcionales para oficina de alumnos','2019-06-05'),(1380,66,'Decimo quinta clase','Hoy se el grupo de desarrollo cambio un integrante y de lider, hasta ahora se hizo una carpeta de drive para poder trabajar mejor accediendo de una manera mas rapida a los archivos, tambien nos dijeron que tenemos que hacer las funciones que estaban planeadas para este trimestre, por mi parte debo encargarme de conectar las funciones que hicimos con las vistas de la gente de sieño, que por cierto aun no estan ya que se gestiono mal la creacion de vistas, habra que esperar.','2019-06-05'),(1381,87,'Nueva sección','Hoy me cambiaron de sección y soy el nuevo lider de desarrollo. Me encontré una mala organización en los códigos y las vistas. Estuve leyendo el manual de usuario y viendo los códigos que habían hasta el momento. ','2019-06-05'),(1382,67,'Inicio de trimestre','El día de hoy empezamos el 2do trimestre y hubo un cambio en el grupo, nuestra lider de grupo fue cambiada a otra sección, por lo demás averigue un poco sobre la seguridad en la base de datos y poco mas.','2019-06-05'),(1383,68,'Cambio de jerarquía y edición de manual de usuario','Al comenzar un nuevo trimestre, tuvimos un cambio de áreas y/o jerarquías. En lo personal, yo quedé en Desarrollo pero ya no soy líder.\nComencé a editar el manual de usuario para que sea de lectura más sencilla y comprensible, al igual que modifiqué cuestiones de formato (tamaño de letra, resaltado, etcétera). La siguiente clase seguiré con esta tarea.','2019-06-05'),(1384,86,'Mysql Thunderbird.','Hoy me dijeron de ser líder de área y resultó relativamente bien.\nTodos habian terminado sus trabajos menos la parte del FTP, que necesitábamos para continuar con PHP, interfaz y Thunderbird. \nCon Marcos hicimos la base de datos con MySQL y preparamos el Thunderbird para cuando tengamos la oportunidad de instalarlo con la nueva interfaz que Guido añadirá.','2019-06-05'),(1385,65,'Vistas','Ajustamos algunas vistas','2019-06-05'),(1386,63,'Decimoquinta clase','En esta clase se cambiaron los líderes, como a su vez algunos miembros; en el caso de nuestra área, se fue Sanginetti y entro Tuffano (actual lider).\nLa idea de hoy era unir el trabajo realizado en Codeigniter con las vistas desarrolladas anteriormente por el área de diseño. El problema es que su trabajo estaba mal gestionado, por lo que en esta clase no se pudo hacer mucho.','2019-06-05'),(1387,76,'Mantenimiento y Correcciones','Hice una revisión de todo lo hecho hasta el momento. Me adentre un poco mas dentro de lo que habían hecho nuestros compañeros de Martes y Jueves, para luego poder acoplar nuestro proyecto al de ellos para mayor facilidad. Luego realice pequeños cambios dentro de la documentación del grupo de BD.','2019-06-06'),(1388,53,'Buscando ong ','Buscando ong\n','2019-06-06'),(1389,50,'Maquetado de vistas en paralelo','Continuamos con el desarrollo de la pagina web logrando una estructura común entre la mayoria de las vistas para lograr homogeneidad durante el desarrollo.  ','2019-06-06'),(1390,42,'Maquetado de vistas en paralelo','Continuamos con el desarrollo de la pagina web logrando avances los cuales nos van a servir para estructurar las diferentes vistas para lograr una homogeneidad en este proceso. ','2019-06-06'),(1391,74,'mitad de trabajo ','hoy todos estuvimos programando para realizar el proyecto, yo use virtual box - ubuntu y me encargue mas de la base de datos y los demas de servidor web y otras cosas en relacion, seguimos avanzando con el proyecto.','2019-06-06'),(1392,85,'Debate sobre componentes','Estuvimos hablando sobre  los componentes a utilizar en el proyecto, por ejemplo si es o no necesario la implementacion de un amplificador, tambien vimos sobre que salidas de sonifo utilizat etc. Tambien estuvimos viendo que simuladores podriamos usar para diagramar el proyecto en arduino. concluimos que pasaresmos directamente a hacer las pruebas fisicamente','2019-06-06'),(1393,83,'ubunto','hoy me encargue de ver unos codigos para el servidor pero no me habaian avisado que habia que descargar ubunto por lo que lo empece a hacer pero eso lleva un tiempo. mi lider me dijo que volviera a investigar cosas que ya habia hecho. de paso tambien fui completando la carpeta.','2019-06-06'),(1394,46,'armado de manual de usuario','hoy investige sobre el servidor ubunto y arme el manual de usuario de el mismo','2019-06-06'),(1395,80,'vistas y html','el día de hoy continuamos con el desarrollo de las vistas en código, ayudándonos con materialize y w3 School.\nconfiguramos la parte de información personal del alumno y el listado.','2019-06-06'),(1396,75,'Adaptación del prototipo a la base de datos','En esta clase, ya realizados los diferentes prototipos, se procede a adaptar a la base de datos. Es decir, adaptar el prototipo para que haga las consultas correspondiente en la tabla correcta. También que muestre en la tabla los datos necesarios de la tabla requerida. ','2019-06-06'),(1397,55,'No hay mucho que hacer','Hoy nuestro grupo al tener nuestra parte del trabajo completada no pudimos hacer mucho mas que esperar a que los demás grupos terminen.','2019-06-06'),(1398,45,'final de trimestre','hoy hicimos modificaciones en el proyecto carpeta de campo etc...\nel trimestre que viene continuaremos si no nos cambian de seccion','2019-06-06'),(1399,60,'Finalizacion de trimestre','El dia de la fecha se cerraron los trimestre y se continuo con el proyecto en el cual no hubo mucho avance, diria que casi se queda estancado.','2019-06-06'),(1400,58,'final de trimestre','Hoy realizamos el final del proyecto de diseño en html y termine de hacer algunos retoques en el proyecto.','2019-06-06'),(1401,78,'Nuevas tareas a futuro (06/06/2019)','No hice mucho. Tuve un problema al traer lo que había hecho en casa (buscar alumno según criterio). Le configure el puerto 8080 al xampp y al CodeIgniter. Hable con mi jefe sobre tareas a futuro, por ejemplo: Que al mostrarse los alumnos, haya botones desplegables. Al elegir un curso se despliega las opciones de turnos. Es tarea del equipo de diseño, pero la funcionalidad nos encargamos los de desarrollo.','2019-06-06'),(1402,79,'Problemas con el servidor y un proyecto de DEA ','Hoy decidi dedicarme a mi tarea de infraestructura, asi que me dedique a investigar sobre github. Cosas como por ejemplo como instalarlo y como funciona. Sin embargo antes de eso (o en medio de eso) revise con Nacho el diagrama que hizo de Arduino. Le marque unos problemas que tenia, que causarian un corto circuito o un algun led quemado. Le dije a Nacho que si podia utilize otro simulador que le permita programar los componentes pero no habia encontrado ninguno, asi que ni bien pueda voy a buscar un simulador a ver si lo encuentro. Despues de eso decidimos mostrarselo a profesor Gonzalo para ver si obviando los errores de corto, habia algo que agregarle (como capacitores o diodos para proteger lso componentes) pero no pudimos porque estaba muy ocupado. Despues de eso, al investigar los suficiente de github como para instalarlo, decidi instalarlo en el servidor pero tuvimos problemas. Primero no tomaba la contraseña, probamos con mayusculas, con miniusculas, incluso con contraseñas modificadas por si nos hubieramos equiivocado al guardarla pero nada. Asi que decidi reinstalar el esxi. Pero tuvimos problemas con el booteo, probamos ejectuarla en modo efi, bootear desde la bios, formatear el pendrive, cambiar el puerto, pero nada. Despues de estar mucho rato intentando retome mi investigacion de github. ','2019-06-06'),(1403,82,'final de trimestre','agre algunos detalles en mi proyecto y ayude a los de mas es sus proyectos\n','2019-06-06'),(1404,51,'Clase de ayuda','hoy miré si podia agregarle/modificar algo de la base de datos y depaso me puse a ayudar a unos compañeros que su proyecto es con la base de datos','2019-06-07'),(1405,79,'Comunicacion con el grupo de mecanica y continuando con infraestructura','Primero me dedique a terminar por completo el presupuesto de DEA, fueron en total cuatro o cinco medios de compra difernetes. De igual forma estoy desconforme con el presupuesto ya que seguramente cuando continuemos un poco con el diagrama del proyecto vamos a tener que agregar mas componentes, ademas de que no puede estudiar vien las especificaciones de los componentes. Despues de terminar con eso fui con Nacho a entregarles eso y las medidas del arduino al grupo de mecanica, tardamos un buen rato porque no sabiamos donde estaban y recorrimos varias aulas. Nos quedamos hablando un poco con la compañera Damila de mecanica sobre lo que estabamos decidiendo todavia (eleccion de pilas y otras cosas) y despues volvimos al aula. Despues de todo eso me dedique a infraestructura, ante lo mas importante que habia leido de github la clase pasada y de mientras decidi intentar otra vez bootear el servidor. Como no puede hacerlo con exito volvi a hablar con los profesores. Gonzalo llego a la conclusion de que no estaba booteando bien asi que decidimos usar otro pendrive, queda por ver si podre instalarlo con exito o no. ','2019-06-07'),(1406,53,'Colocacion de mapa ','Rellenar la carpeta de campo sobre lo realizado el 07/06//2019.\nBuscar un video sobre como crear mapa, buscar alternativa sobre googlemaps.\nutilizar esa alternativa ','2019-06-07'),(1407,50,'Implementacion de Dialog y Collapse','Se continuo con el maquetado de la pagina, implementando nuevos elementos a la interfaz. Tales como la etiqueta &quot;Dialog&quot; y los elementos &quot;Collapse&quot;.','2019-06-07'),(1408,36,'esperando la vista y bd','observe la vista de falta','2019-06-07'),(1409,85,'programacion del arduino y comunicacion con los chicos de mecanica','Hoy me concentre en programar gran parte del código para el funcionamiento del arduino, aun así no pude verificar su funcionamiento y fue mas una tarea de investigación para luego poder hacer una prueba mas especifica con un arduino de verdad físicamente, por otra parte le dimos las medidas exactas del arduino a los chicos de mecanica al mismo tiempo que los presupuestos y la carpeta de campo, también hablamos sobre el tamaño del DEA ya que ellos tenian la idea de achicarlo aun mas y necesitaban nuestra confirmacion y las piezas que utilizaremos.\n','2019-06-07'),(1410,76,'Mantenimiento y Apoyo','Se recorrieron las diferentes áreas que usan la base de datos para ayudarlos a comprender la misma y de paso conocer si alguno discrepa con la manera en al que esta hecha la misma, para poder corregir los errores o mejorar en caso de ser posible. Luego, con el tiempo libre que quedo, comencé aprendiendo y informándome acerca de GIT, ya sea su uso o funcionamiento. Anteriormente no lo había hecho porque los horarios y la carga de trabajo no lo permitía.','2019-06-07'),(1411,42,'Implementacion de Dialog y Collapse','Se siguio trabajando con el maquetado de las vistas de la pagina, implementando nuevos elementos a la interfaz. Tales como la etiqueta &quot;Dialog&quot; y los elementos &quot;Collapse&quot;, para poder tener un mejor aspecto y rendimiento. ','2019-06-07'),(1412,60,'continuacion del desarrollo de proyecto ','El dia de la fecha sigue en proceso el desarrollo del proyecto trimestral, cada vez esta mas cerca de la finalizasacion de tal objetivo.','2019-06-07'),(1413,78,'avance de carpeta de campo (07/06/19)','Como no me asignaron más tareas aproveche a completar mi carpeta de campo, poniendo imágenes del código de la anterior tarea que había hecho, la cual era la de seleccionar alumnos especificando su curso y trimestre de la nota (La última especificación sin hacer)','2019-06-07'),(1414,83,'ubuntu','hoy estaba con el procedimiento de descargar ubuntu, pero tuve un  contratiempo con la descarga por lo cual no se pudo instalar. intente hacerlo mas de una vez pero falle. como no estaba mi lider no podia preguntarle porque el me encargo esta tarea pero bueno.','2019-06-07'),(1415,75,'Adaptación del prototipo a la base de datos (II)','En esta clase segui adaptando el prototipo a la base de datos. Me costo ya que hay que adapta la consula con INNER JOIN con codeigniter. ','2019-06-07'),(1416,55,'Seguimos esperando','Hoy al tener toda nuestra parte terminada seguimos esperando a que los demás grupos terminen sus respectivas partes.','2019-06-07'),(1417,44,'Observamos y pedimos la bd y la vista de faltas.','Estamos a la espera de la vista de la pag de faltas para poder avanzar.','2019-06-07'),(1418,44,'Observamos y pedimos la bd y la vista de faltas.','Estamos a la espera de la vista de la pag de faltas para poder avanzar.','2019-06-07'),(1419,46,'descarga de ubuntu','visitamos varias paginas para descargar ubuntu, al final descargamos 3 versiones diferentes pero no pudimos abrir ninguna ','2019-06-07'),(1420,82,'final del trimestre','cambie y agregue  diseños  a los proyectos del css y utilice la pagina w3school','2019-06-07'),(1421,48,'Busqueda de informacion','Realice busqueda sobre html para ver que poder agregar a la pagina','2019-06-07'),(1422,45,'mejoras de diseño','hoy realizamos mejoras de diseño tales como fondo, cambio de letra(fuente), entre otros detalles con la ayuda de w3school.','2019-06-07'),(1423,58,'Esperando a los demas para terminar el proyecto','Estuve buscando informacion sobre como poder mejorar mi proyecto y agregue un par de cosas ','2019-06-07'),(1424,49,'vistas','En el dia de hoy continuamos retocando las vistas para mejorarlas aun mas.','2019-06-11'),(1425,43,'Mejores diseños de vistas','Hoy estuvimos charlando entre nuestro grupo como sería la mejor vista, cosa que estuvimos de acuerdo cada uno. Luego, estuve creando una carpeta que se trate de los fondos y allí ingresar distintos de ellos, para que todos puedan hacerlo de manera más fácil sin necesidad de buscar. ','2019-06-11'),(1426,41,'Reunión sobre las vistas','En el día de hoy el profesor nos reunió a todos para hablar sobre el temas de las notas también nos comento cosas de la bitácoras y la carpeta de campo que cosas agregar para que queden mejor y nos dio ideas sobre las vistas.','2019-06-11'),(1427,38,'Edicion de las vistas','En el dia de hoy seguimos con la edicion de las vistas, aunque ya tenemos unos diseños, continuamos con la creacion de otras para poder tener diferentes formas de poder visualizarlas.','2019-06-11'),(1428,38,'Edicion de las vistas','En el dia de hoy seguimos con la edicion de las vistas, aunque ya tenemos unos diseños, continuamos con la creacion de otras para poder tener diferentes formas de poder visualizarlas.','2019-06-11'),(1429,66,'Decima sexta clase','Hoy el grupo de desarrollo hablo sobre lo que se hizo y se comentaron las mejores o correciones que debemos hacer respecto a las funciones que ya tenemos hechas, tambien nos repartimos el trabajo de lo que queda por hacer.','2019-06-11'),(1430,64,'Comienzo Segundo Trimestre: Interfaz.','En el día de la fecha nuestro profesor al inicio de la clase nos brindó una charla para aclarar algunas cosas ocurridas en el trimestre anterior. Luego cuando iba a proceder a levantar el servidor apache, me doy cuenta que la interfaz no estaba instalada, tuve que instalarla de vuelta, en lo que tardo unos 20 min en hacerlo, al finalizar instala el paquete de idioma y algunas aplicación para trabajar mas cómodo y en lo que me doy cuenta la clase ya termina, por eso voy a postergar lo de php para el 12/06/2019.','2019-06-11'),(1431,57,'Nos organizamos e hicimos previas','La lider de sección organizó bien cada vista que iba a hacer cada participante de la sección de desarrollo, a mi me tocó modificar completamente la vista de previas','2019-06-11'),(1432,69,'11/06','En el día de hoy investigamos como encriptar  la contraseña de la tabla usuario de la base de datos, y la aplicamos con MD5. Además,  agregamos dos campos a la tabla “previa”, los campos “previa1” y “previa2”.','2019-06-11'),(1433,47,'Seguí trabajando en la vista de previas.','Nuestra lider de sección organizó que vista tenía que hacer cada uno, me toco previas. Seguí trabajando en la vista de previas.','2019-06-11'),(1434,73,'11-06-2019 vista previa de las paginas ','hoy estuvimos viendo las vistas previas para las paginas, los modelos,  vimos como ejemplo navbar css ux, login ux examples y tambien trabajamos con los fondo de pantalla del incio','2019-06-11'),(1435,70,'Carpeta de campo','Usè el tiempo de la clase para extender mi carpeta de campo (Con el permiso del profesor) y unirlas todas (Estaban todos los dìas desparramados, resultado de haber subido dia por dia a encuentrotecnologico). Recibimos una tarea del profesor que era basicamente encontrar vulnerabilidades con la seguridad de la base de datos.','2019-06-11'),(1436,52,'clase 10 de oficina de alumnos','el dia de la fecha se charlo con el jefe del area de practicas profecionalizantes para una organizacion de los equipos.\ny hubo una charla con la lider de area de desarrollo para una mejor forma de ordenar los proyectos a hacer','2019-06-11'),(1437,71,'MD5 y modificaciones el campo previas','Encriptamos la clave en usuario con MD5, y agregamos &quot;previa1&quot; y &quot;previa2&quot; en campo previa','2019-06-11'),(1438,87,'Organización','Hoy nos juntamos y estuvimos probando la página para ver qué faltaba o andaba mal. Hicimos una lista de tareas, nos la repartimos y cada uno empezó a hacerlas.','2019-06-11'),(1439,54,'Investigación y encriptado de password','En el dia de la fecha investigamos vulnerabilidades de la base de datos y también MD5 posteriormente encriptamos la password de usuarios','2019-06-11'),(1440,65,'Investigacion y Carpeta de campos','Segui investigando para mejorar las vistas, pero mas que nada estuve mejorando mi carpeta de campos ya que se encontraba incompleta','2019-06-11'),(1441,68,'Organización y cambio de formato del manual de usuario','Tuvimos una reunión de los integrantes del área para tomar nota de elementos faltantes y defectuosos, al igual que posibles mejoras a la página.\nComencé a modificar el formato del manual de usuario, incluyendo capturas de pantalla para mejorar la legibilidad y estética.','2019-06-11'),(1442,43,'Más vistas ','Hoy estuvimos creando las vistas con un diseño diferente. Por ejemplo, estuvimos creando la vista de: “Recuperar cuenta”, pero con un diseño mejor al que hicimos del trimestre pasado. Igualmente, aún nos quedan más vistas por renovar. ','2019-06-12'),(1443,49,'continuacion de vistas','En el dia de hoy seguimos con la continuacion de mejorar las vistas.','2019-06-12'),(1444,38,'Edicion de vistas','Seguimos con la edicion de las vistas en bootstrap, tuvimos algunas vistas que realizamos con html y css y estamos pasando todo a bootstrap con sus herramientas para poder facilitar su elavoracion y asimismo consiguiendo diferentes aspectos de las paginas.','2019-06-12'),(1445,64,'Clase fallida, DNS, correo, interfaz (de vuelta) etc...','En el día de la fecha cuando se íbamos a trabajar con el Ubuntu, nos dimos cuenta que no funcionaba, por eso tuvimos que trabajar con el backup de la clase del 5 de junio de 2019, ya solucionado el problema con mi compañero Gonzalo instalamos el programa Thunderbird es un cliente de correo electrónico, pero en el medio de la instalación nos dimos cuenta que el programa necesitaba  una interfaz gráfica, que era la que teníamos en la versión más reciente de nuestro proyecto que no anduvo por eso esta vez instalamos de forma distinta la interfaz y tomamos algunos recados así se evitaban futuros problemas. Al final no era necesario instalar el ThunderBird, ya que había na manera más fácil de hacerlo y ya q no pudimos resolver el problema que teníamos con esta aplicación optamos instalar de otra forma el server de correo electrónico. Lo que nos queda pendiente para la clase siguiente es configurar el DNS y el servidor de correo.','2019-06-12'),(1446,52,'clase 11 de oficina de alumnos','estubimos arreglando algunos problemas de la pagina que desarrollamos y creando alugunos codigos de verificacion , agregar y borrar','2019-06-12'),(1447,86,'Fallar repetivamente','En la clase de hoy no hicimos progreso alguno. Perdimos muchisimo tiempo en la instalacion de Ubuntu cuando no era necesario. Buscamos alternativas pero aun tenemos que ver si son válidas y/o funcionales','2019-06-12'),(1448,70,'MD5, Tablas, Stored Procedures','Hoy segui investigando sobre MD5, despuès de eso, ya que no tenia demasiada importancia, fui a ver las vistas proveidas por diseño para agregar mas tablas, despues de unos problemas con Bootstrap terminè por empezar a ver stored procedures y a tratar de aplicarlas a nuestra base de datos.','2019-06-12'),(1449,47,'Buscadores para previas','Hice 2 buscadores para las previas, uno para buscar a los alumnos que querés agregar a la tabla previas y el otro para buscar a los alumnos que querés agregarle las materias previas que tiene.','2019-06-12'),(1450,40,'Edición de vistas','En el día de hoy editamos las vistas de becas para una mejor visualización para el usuario y las adaptamos a los diferentes dispositivos.','2019-06-12'),(1451,72,'Clase 17, Mas problemas y aprendizaje (FTP, PHP)','En la clase de hoy estuve viendo los distintos problemas que se me presentaron durante toda la clase, quede en que no pude iniciar el server PHP, pero para la clase siguiente seguiré intentándolo. Ademas me dedique a investigar la configuración de FTP y progrese en el entendimiento de los servidores. Creo que cada clase me acerca mas a saber como montar distintos servidores web, y de transferencia de datos.','2019-06-12'),(1452,65,'Mejorar vistas','Trabaje en la vista &quot;menú inicio&quot;, la comencé de 0 con un nuevo diseño','2019-06-12'),(1453,41,'Creación de vistas','En el día de hoy, seguí terminando lo que faltaba agregar de la vista de recuperar cuenta terminando de colocar los botones y colores, también le agregue un cuadrado de color blanco transparente en el centro de la vista donde están los campos para completar. Faltaría agregar el logo y retocar algunas cosas para que quede mejor.','2019-06-12'),(1454,69,'12 de junio','En el día de hoy encriptamos el campo “password” de la tabla USUARIO. Y generamos distintas contraseñas/claves.Y el permiso. \nAdemás  modificamos el manual de usuario, agregamos los campos “previa1” y “previa2” a la tabla PREVIAS, y que trabajamos con MD5 para encriptar el campo “password”.','2019-06-12'),(1455,67,'Modificar tablas y encriptamos la tabla password','El día de hoy un grupo del área se dedico a modificar las tablas según las necesidades de el área de Diseño y el otro se dedico a la seguridad de la base de datos como encriptar la tabla password','2019-06-12'),(1456,54,'Manual de usuario,MD5','En el día de hoy volvimos a encriptar las password,modificamos el manual de usuario agregando contenido y consultamos con el area de diseño las tablas que deberíamos agregar a la base de datos','2019-06-12'),(1457,66,'decima septima clase','Hoy solo vinieron 3 integrantes del equipo de desarrollo, pero igual cada uno tenia tareas asignadas con lo cual estuvimos ocupados, por mi parte tuve que corregir ciertos errores que se presentaban, los cuales algunos los pude resolver pero otros se complicaron.','2019-06-12'),(1458,71,'Manual de usuario,MD5','En el dia de hoy encriptamos  ya en nuestra base de datos el campo “password” a la tabla Usuarios, usando en el código MD5. Además consultamos con el área de diseño para poder agregar tablas a la base de datos y modificamos el manual de usuario con todo lo hecho hoy','2019-06-12'),(1459,51,'Clase de mentenimiento y Ayuda','en la clase de hoy me puse a hacer el mantenimiento de la base de datos, depaso tuve q modificar los datos de la tabla PREVIAS, cambiar los nombres y poner &quot;foreing key&quot; y de paso me puse a ayudar a mi compañero a que haga la documentacion de nuestro progreso como grupo','2019-06-13'),(1460,53,'Verificacion y busqueda','Darme cuenta de que hay que buscar otros metodos para colocar el un mapa en la app web que se armo porque el codigo anterior no se funciono, al buscar informacion se encontro otro metodo y se probara ese.','2019-06-13'),(1461,83,'ftp reparacion','hoy cada una se sento una maquina diferente. \ninvestigamos rapido sore el ftp y el ubunto.\nuna vez hecho eso tuvimos una charla con el profesor porque nuestro equipo no tiene lider por el momento, nos diejron que las dos nos juntaramos para reparar un trabajo de ftp que se necesitaba para el correo electronico. lamentablemente  cuando entramos al programa para trabajar el usuario y contraseña era invalidos, consultamos con los profesores y nos comunicamos con el grupo de los martes y miercoles  pero no se pudo porque  los datos no concidian por lo que no podeiamos avanzar.','2019-06-13'),(1462,58,'modificamos las vistas','Hoy tuvimos un nuevo lider y estamos arreglando los errores para  hacer el index para poder juntar todas las vistas de html  de los integrantes del grupo de desarrollo ','2019-06-13'),(1463,77,'Asimilación del Framework','Horas utilizadas para revisar el entorno en el que trabaja el grupo de DESARROLLO, vista general del proyecto hasta el momento e inicio de asimilación del CodeIgniter que se utiliza en la página. ','2019-06-13'),(1464,45,'rediseño de la pestaña','hoy inicie unas modificaciones en la pestaña y hubo cambio de jefe el cual esta aplicando cambios en el grupo','2019-06-13'),(1465,82,'nuevo trimestre','tenemos un nuevo lider y nos estuvimos organizando con el nuevo lider, nos hizo modificar los trabajos anteriores ','2019-06-13'),(1466,78,'CRUD completo de alumnos (13/06/19)','Hoy hicimos una revisión de lo que tenemos y lo que falta. Se dividió todas las tareas en dos grupos, un grupo de alumnos, que tiene lo que falta desarrollar, esto sería la función de agregar un alumno, actualizar los datos del alumno y eliminar un alumno. Leer y mostrar alumno ya estaría hecho. El otro grupo es el de las notas, las taréas correspondientes a este grupo son las agregar nota, trimestre, etc. Yo tengo asignado el grupo de alumnos. \n\n\nLas tareas se pensaron de la siguiente manera:\n\n-Agregar alumno tendría una sola vista: un formulario en el que se ingresan solo los datos importantes (nombre, apellido, curso) excluyendo otros datos como teléfono, dirección, etc. Luego se mandaría un alert() con javascript avisando que se agregó el alumno. Luego se redirige a la vista donde muestra a todos los alumnos, donde se mostraría al final de la tabla, el alumno agregado.\n\n-Actualizar tiene tres vistas: La primera son dos inputs que reciben año y división. Cuando se ingresen esos datos, aparece la segunda vista que muestra todos los alumnos de ese curso ingresado. Al lado de todos los alumnos habrá un botón actualizar, que mandaría a otra vista la cual tiene el mismo formulario del de agregar con todos los inputs llenos, es decir, obtiene los datos del alumno y se autocompletan en los inputs. Se modifica el que quiera el usuario y se vuelve a mandar a la base de datos.\n\n-eliminar tiene dos vistas: la primera con dos inputs que reciben año y división. La segunda vista muestra también la tabla con todos los alumnos de ese curso. Así como la tarea de actualizar tiene un botón al lado de los alumnos, esta tendrá un botón de eliminar.\n\nPara actualizar y eliminar tengo que ver un tema de CodeIgniter, el cual es segmentos.','2019-06-13'),(1467,36,'haciendo vista, modelo y controller de asistencia','no nos dieron vista todavia...','2019-06-13'),(1468,85,'Cambios al diagrama de conexion de la interfaz del DEA','estuve cambiando el diagrama debido a algunos errores y debido a que no pude conseguir un simulador que funcionara de la manera que yo necesitaba decidi hacer el diagrama a mano','2019-06-13'),(1469,46,'reparacion de ftp + intalacion de correo','el dia de hoy el profesor nos pidio que trabajaramos con la maquina virtual y ereglemos el error que tenia el ftp que el otro grupo configuro y de paso intalar el &quot;coso del correo&quot; , para hacer eso me junte con belen en una maquina a falta de computadoras y nos turnamos mutuamente para que una investige y otra configure la maquina virtual.   Al intentar empesar a configurar tubimos un problema con el usuario y contraseña, ya que necesitabamos usar la que el otro grupo uso, el profesor intento comunicarse con el otro grupo pero las contraseñas que nos dieron no funcionaban.\nhaci que nos quedamos en espera hasta que nos den los datos que nesecitamsop ','2019-06-13'),(1470,76,'Correcciones y Mejoras','Desde desarrollo nos llego una sugerencia para una mejora dentro de la base de datos, y luego de analizar esta, se decidio aplicarla dentro de la misma. Lo que se hizo fue cambiar y adaptar mejor dos tablas de la base de datos, las cuales facilitan suuso. Luego de eso se actualizo la documentacion y se hizo un manual de uso para el usuario.','2019-06-13'),(1485,44,'Hicimos el nuevo controler, la vista y el modelo de inasistencias','Estamos desarrollando la ventana de inasistencias.','2019-06-13'),(1486,48,'Comence el segundo trimestre con nuevo lider','Hoy cambiron el lider y lo estuvimos poniendo al dia con las cosas que teniamos, nos organizamos con todo el grupo para ver los trabajos que teniamos realizados y los que nos faltaban ademas me hizo cambiar mi trabajo anterior.','2019-06-13'),(1487,75,'Realización de la función actualizar Nota','En esta clase ya empece a ser lider  del sector de desrrollo. Por ende se nombraron todas las funciones faltantes y se distribuyeron con el equipo. Yo empece a realizar la función actualizar nota ya que había hecho anteriormente la función agregar nota. ','2019-06-13'),(1488,60,'Cambio de personal','En el dia de la fecha, yo me cambien de la seccion de Desarrollo a la seccion de Infraestructura en la cual comenzamos a crear una maquina virtual que fuera el hosting del servidor, tambien dividimos el trabajo en el cual me encargo de crear una maquina virtual para E-mail, DHCP y DNS','2019-06-13'),(1489,79,'Trabajando con el servidor, intentando migrar MV y resolviendo pequeñas dudas de arduino para proyecto DEA','Lo primero que hice en el dia, despues de llegar es hablar con el profesor Gonzalo Consorti sobre el aruduino, especificamente sobre como proteger el arduino de otros componentes y las formas de conexion de un boton y me explico de dos formas, pull-up y pull-down. Despues tuvimos una interrupcion por una simulacro de emergencia en el colegio. Despues de volver fuimos a buscar el servidor fisco al aula de al lado, hice la conexion de las fuentes, a la red y el monitor. Tuve que lidiar luego que con lo que crei que eran problemas de conexion de red, que no fue mas que una confucion. Despues me quize dedicar a como instalar el github, para lo cual tuve que primero esperar a que el profesor Damian Olaso me de el pendrive con el VMWare vSphere para conectarme al servidor y poder crear o emigrar de hay una maquina virutal. Cuestion que tuvimos problemas con el instalador por cuestiones de licencia, desinstalamos, probamos con otro instalador. Llegamos a la conclusion de que el problema era posiblememte las licencias del Esxi, por lo tanto es probable que dentro de 60 dias tengamos que migrar todas las maquinas virtuales de Exsi a una pc y luego volver a guardarlas en el Exsi. Despues de este problema intentamos pasar una maquina virtual del VMWare vSphere al Exsi (exportar quizas sea el termino correcto), cuestion que no pudimos. Probamos varias cosas, conectamos el disco del profe tanto al servidor como a  la computadora con VMware, el profesor Gonzalo creo una maquina virtual e intento varios procedimientos y no lo logro, el profesor Damian tambien estuvo intentando resolver el problema, no hubo forma, no tomaba el disco (el servidor). Procedimos a leer algunas guias por internet y un tutorial por you tube, llegamos a la conclusion de que teniamos que usar un programa llamado VMware vCenter Stand Alone y tenemos que pasar la maquina virtual por red. Vimos la opcion de en vez de usar Exsi usar un open source pero hay que seguir viendo. La proxima vez vamos a usar un ruter para hacer una conexion directa con el servidor y pasar rapidamente la VM. ','2019-06-13'),(1490,56,'Desarrollo de pestañas','-Se cambio el jefe de area\n-Rediseño de pestañas\n-Correcion de errores en el maquetado\n-Nuevo diseño de tablas y pestaña de inicio\n-Corrección con la distribución de botones en la pagina\n','2019-06-13'),(1491,74,'Diseño','el dia de hoy me nombraron jefe de diseño, me cambiaron de especialidad porque vieron que me centro mas en ese ambiente, lo primero fue hablar con los chicos para ver que estaban haciendo y ponerme al dia, tenian un par de errores y estaban desordenados, por suerte logre ponerme al dia y los oriente para avanzar, fue una corrida intensa nisiquiera tuve tiempo para trabajar yo pero hable con integrantes del grupo para que vean como estoy haciendo la pagina que esten lo mas sincronizado posible para poder los datos de los alumnos del todo el colegio. \nalgunos de mis nuevos integrantes no tienen mucha experiencia con los leguajes de programacion pero les di una mano y muchas fuentes de informacion e incluso les di una guia impresa que tenia guardada hace un tiempo que les servio mucho. \n','2019-06-13'),(1492,43,'Vistas ','Hoy estuve haciendo una vista nueva con un diseño un tanto peculiar, se trataba del fondo transparente, con el cuadro de igual forma sólo que un poco azulado. Cree una vista llamada &quot;Registro&quot; que me quedo por ahora bien. Aparte de eso, el profe me dio un par de consejos para mejorarla y ya sé que hacer en la otra clase.','2019-06-18'),(1493,72,'Clase 18, nuevos comienzos','La clase de hoy no fue muy productiva pero, eso nos dio la ventaja de organizarnos y hacer las cosas de una forma mejor. Los problema que se nos presentaron fueron eliminados , ya que vamos a empezar todo, ya sabiendo cosas que antes no era así.','2019-06-18'),(1494,69,'stored procedure','En el dia de hoy investigamos y miramos tutoriales de “stored procedure” para trabajarlo en la base de datos que ya tenemos hecha.','2019-06-18'),(1495,47,'Intentando mejorar al vista previas','Intenté hacer que en la vista de previas muestre la tabla materias (de la base de datos), para cuando quieras agregar una previa te muestre las materias que están disponibles.','2019-06-18'),(1496,71,'stored procedure','Hoy averiguamos, vimos videos y tutoriales acerca de stored procedure, para poder aplicarla en nuestra base de datos hecha','2019-06-18'),(1497,38,'Edicion de vistas','En el dia de hoy utilicé bootstrap para posicionar de diferentes formas algunas cosas del login y del sector de becas, a su vez tambien seguimos modificando diseños como para ir probando distintas apariencias de la pagina ','2019-06-18'),(1498,41,'Modificando las vistas','En el dia de hoy estuvimos hablando con el profesor sobre el tema de las vistas y nos comento sobre que tenemos que cambiar para que quede mejor, y cambie algunas cosas de las vistas de recuperar cuenta y cambiar contraseña cambiando los colores el fondo los botones y agregando el logo de la escuela.','2019-06-18'),(1499,64,'Dia Fatidico!!!','En el día de la fecha tuvimos un inconveniente muy grande, en materia que no avanzamos nada y que tenemos que realizar los servidores correspondientes de nuevo, por ese motivo esta clase fue un dolor de cabeza para mí y mis compañeros al enterarnos de esta fatídica notica.','2019-06-18'),(1500,52,'clase 11 de oficina de alumnos','nos reunimos para discutir como serian las nuevas vistas con respecto al proyecto y seguir haciendo las asignaciones correspondientes','2019-06-18'),(1501,49,'Edicion de vistas','En el dia de hoy seguimos con la edicion de las vistas que quedan por terminar.','2019-06-18'),(1502,57,'Optimización de la vista de previas','Intentamos agregar a la vista de previas la tabla materias, para poder mostrar las materias disponibles en caso de querer agregar una previa a algún alumno.','2019-06-18'),(1503,54,'Store procedures','Hoy investigamos sobre store procedures para luego implementarlo a nuestra base de datos','2019-06-18'),(1504,66,'Decimoctava clase','Se charlo sobre si hacer cambios en las vistas para optimizarlas, pero por diversos motivos se descarto la idea. Y yo continué trabajando solucionando errores los cuales pude resolver.','2019-06-18'),(1505,63,'Decimoctava clase','Hoy nos reunimos para debatir al respecto de posibles cambios para el proyecto final, pero por diversos motivos se descarto la idea.\nA partir de ahí nos fuimos a trabajar en nuestras partes correspondientes, por mi parte, ayude a Chipana en el funcionamiento de la función borrar.','2019-06-18'),(1506,70,'CREATE PROCEDURE ','Estamos trabajando con CREATE PROCEDURE, el tema es que al parecer en esta computadora no funciona bien, estuve probando con distintas formas y al parecer al eliminar los parentesis en &quot;MostrarAlumnos ()&quot; hay un avance, pero solo cuando usamos DROP, mañana vamos a probarlo desde la notebook del profe y si hay suerte, podremos avanzar.','2019-06-18'),(1507,87,'Actualización','En el día de hoy estuve viendo como iba cada uno en su tarea que ya había asignado hace dos clases. Después agarré cada uno de los códigos de mis compañeros e hice uno con todas las nuevas modificaciones. Al terminar esto empecé a hacer la vista de becas.','2019-06-18'),(1508,65,'No muy productivo','Hoy no avance mucho, intente arreglar la vista para que sea responsive y no pude.','2019-06-18'),(1509,68,'Reparto de tareas y re-escritura del manual de usuario','Dividimos las tareas de acuerdo con las funciones faltantes dentro de las vistas.\nVolví a comenzar la reescritura del manual de usuario, reformulando las explicaciones de forma que resultasen de fácil lectura y correctas, y eliminando los fragmentos de código en texto plano para poner, en su lugar, capturas de pantalla de dichos fragmentos en un editor de texto (Sublime), de forma que se mantuviesen los códigos de color del mismo. De esta forma, facilité la lectura y comprensión general, al igual que mejoré la diferenciación entre código (cita) y explicación.','2019-06-18'),(1510,68,'Edición del manual de usuario','Continuando con la tarea de los últimos días, proseguí con la formulación de la tercera versión del manual de usuario. Concluí, al menos por el momento, con la descripción de los controladores en controller.php, y comencé con las funciones de model.php e inscripción.php.','2019-06-19'),(1511,66,'Decima novena clase','Hoy se charlo sobre la falta de funciones que hay, entre ellas agregar datos de padres. Luego continuamos con nuestro trabajo y me salio un error el cual no puedo resolver. Estuve intentando toda la tarde. ','2019-06-19'),(1512,72,'Clase 19, Un gran progreso.','En la clase de hoy me dedique a hacer todo el primer server de nuevo, lo que me llevo gran parte de la clase. Por otro lado logre configurar y preparar los servidores para su total funcionamiento. También logre terminar exitosamente su configuración y transferencia de datos por lo que creo que la siguiente clase ya podre pasarlo al server físico.\n\n\n\n','2019-06-19'),(1513,43,'Arreglo de vista y error.','Hoy estuve arreglando la vista de “Registro”, la cual, por ahora le he agregado más cosas. Por ejemplo: “Usuario”, “Nombre”,“Apellido” y “Repetir contraseña”. Por ahora tiene errores que ni el mismo profe pudo solucionar, véase: No se ve la palabra “Usuario”, “Nombre”, “Apellido”. No sé cuál es el error cuando todo iba bien. ','2019-06-19'),(1514,87,'Problemas y botones','En el día de hoy hablé con la sección de diseño para poder organizarnos bien con el tema de los botones en las vistas.\nCuando me puse a ver el código tuve algunos problemas con el xampp lo que me llevó a reiniciar ola computadora dos veces. Luego agregué un botón para poder agregar los datos del adulto responsable del chico que está inscrito. Pero antes de guardar todo se puso la pantalla azul y tuve que volver a empezar.','2019-06-19'),(1515,70,'STORED PROCEDURE, SOLUCIONADO, AGREGAMOS MAS TAREAS.','Como ayer mencione, tuve problemas con el, stored procedures y phpmyadmin en general, el jefe de proyecto me dijo que busque alguna forma de hacerlo, en el caso de que no encontrase nada (aparte de lo que ya busque ayer), lo hariamos en su computadora. Despues de buscar por un rato, encontrè una forma de hacerlo funcionar en forma de rutina, en vez de con codigo, a continuacion de eso, agreguè un par de rutinas basicas y procedures màs.','2019-06-19'),(1516,54,'Stored procedure','En el día de hoy realicé un stored procedure básico, con lo investigado de ayer y lo investigado de hoy. tuve algunos problemas pero fueron resueltos con ayuda de vídeos e información de Internet.','2019-06-19'),(1517,52,'clase 13 de oficina de alumnos','hoy continuamos trabajando nuestras áreas,y estuve viendo vídeos para orientarme','2019-06-19'),(1518,47,'Avanzando con la vista previas','Continué avanzando con el funcionamiento de la vista previas. Avancé en algunas cosas, pero en otras sigo igual, me tira errores.','2019-06-19'),(1519,65,'Vista inico botones y barra de navegacion','Hice responsive el navbar y estuve tratando de hacer los mismo con botones.\n','2019-06-19'),(1520,86,'Instalación de DNS','No solo intenté instalar el DNS sinó tambien aprendi mucho de la instalación de la nueva maquina virtual y la instalacion del sistema operativo VoIP en los tiempos libres de instalacion de cosas u otros tiempos libres como en los recreos.\nAparte de eso, al principo de la clase vimos como organizarnos con las tareas. Y cada uno trabajo individualmente. (apesar de que estuve con Guido)','2019-06-19'),(1521,49,'vistas finalizadas','En el dia de hoy finalizamos con las vistas de becas.','2019-06-19'),(1522,41,'Cambiando y creando  vistas','En el día de hoy estuve retocando la vista de cambio de cuenta haciendo que el fondo se vea bien y hoy empecé con la vista de cambio de contraseña ','2019-06-19'),(1523,40,'vistas becas','Hoy cambiamos todas las vistas de becas cambiando el fondo y los botones e hicimos que se adapten a todos los dispositivos cambiando los pixeles por porcentajes.  ','2019-06-19'),(1524,64,'Instalacion en el Servidor Fisico','En el día de la fecha empezamos a trabajar con los servidores físicos, para lograr eso podemos decir que arreglamos los problemas fatídicos que tuvimos en clases anteriores con éxito ya que encontramos los servidores extraviados.\nPara llevar a cabo la migración del servidor que hicimos todas las clases pasadas a los servidores fiscos  que posee el establecimiento  utilizamos dos programas importantes el primero es el VMware vCenter Converter Standalone que sirve para migrar la máquina virtual del VMWare al servidor físico (Exsi) y el segundo es el VMware vSphere Client que sirve para manejar la máquinas virtuales en el (Exsi). Luego al final de la clase cree una nueva máquina virtual para  con el nombre VoIP, vacio y le metimos la ISO.\n','2019-06-19'),(1525,63,'Decimonovena clase','Por la falta de computadoras tuve que seguir trabajando en equipo con Chipana; hoy continuamos con cosas pertinentes al apartado de becas y después estuvimos viendo la función eliminar para la parte de usuarios.','2019-06-19'),(1526,38,'Vistas sector de becas','Hoy finalizamos con la edicion de las vistas del sector de becas agregandole nuevos botones, cambiando imagenes de fondo y a su vez cambiando diferentes formatos de vista asi pueden verse bien en diferentes dispotivos como computadoras y tambien moviles','2019-06-19'),(1527,69,'procedimientos almacenados','en el día de hoy trabajamos con el stored procedure, implementamos lo visto ayer en tutoriales y lo que investigamos hoy, hicimos un tabla nueva en nuestra base de datos para practicar con ella.','2019-06-19'),(1528,71,'procedimientos almacenados','Hoy practicamos ya con stored prucedure, viendo tutoriales y siguiendo lo visto el dia de ayer, hicimos una tabla nueva para practicar y agregamos en ella campos','2019-06-19'),(1529,57,'Continuando con la edición de la vista de &quot;previas&quot;','Continuamos mejorando la vista, haciendo cambios significativos para que se entienda y que el individuo no tenga complicaciones para usarla, sin embargo, nos encontramos con algunos errores que todavía debemos solucionar para que todo funcione correctamente.','2019-06-19'),(1530,85,'Arreglando carpeta de campo','debido a falta de tiempo hoy me concentre en arreglar y organizar la carpeta de campo con los criterios y ejemplos que nos dieron los profesores','2019-06-21'),(1531,76,'Backups','Se hizo una breve revisión de que es lo que falta dentro del área, y con el tiempo sobrante se realizaron copias de seguridad y se repartio el material terminado a otras áreas que pueden llegar a necesitarla.','2019-06-21'),(1532,75,'Agregar Materia','En esta clase lo que lleve a cabo fue realizar la función agregar materia. Para que sea agregada en la base de datos. Ya en la próxima clase realizare la función actualizar y eliminar materia. ','2019-06-21'),(1533,58,'termine el proyecto','hoy termine el proyecto del prototipado de boletin , hice algunos retoques mas y lo pude finalizar. ','2019-06-21'),(1534,56,'Desarrollo de pestañas','-se continuo con el nuevo diseño de las pestañas\n','2019-06-21'),(1535,83,'descarga de vmware','hoy descargamos el vmware, luego de eso intentamos levantar el servidor de vmware para hacer todo lo que se nos pidio \npero por X motivo no pudimos lograrlo\n','2019-06-21'),(1536,36,'solucionando problema de que no me carga el id alumno','Error Number: 1048\n\nColumn \'id_alumno\' cannot be null\n\nINSERT INTO `asistencias_inasistencias` (`id_alumno`, `tipo`, `fecha`, `reincorporaciones`) VALUES (NULL, \'on\', \'2019-06-21\', NULL)\n\nFilename: C:/xampp/htdocs/Codeigniter/system/database/DB_driver.php\n\nLine Number: 691\nsolucionando eso xd','2019-06-21'),(1537,51,'mantenimiento','hoy me encargué de modificar la documentación ya que mi compañero faltó y de paso me puse a ver si podía ayudar a algún compañero en su sector con respecto a agregar la base de datos','2019-06-21'),(1538,60,'Creacion de Servidor emails','Hoy se siguió con el servidor de emails. Se creo una maquina virtual en VMware en el cual se agrego Ubuntu server 64bits, No se pudo seguir por falta de tiempo y con problemas en el login .','2019-06-21'),(1539,50,'Finalizacion','Se termino el primer prototipo de la interfaz general de las vistas. Se continuara con el contenido individual de cada vista con lo realizado por parte del equipo de base de datos y desarrollo.','2019-06-21'),(1540,74,'pulimento de vistas ','empecé a ayudar a los chicos que tenían complicaciones con el código al tener más experiencia con html ayude a hacer partes del código de un par de integrantes porque al ser nuevo no tenia definido que iba a hacer, ademas tuvimos un retraso de tiempo, el docente tuve que ir a una reunión por lo tanto nos quito una gran parte de la clase. pero aun asi pude charlar con los lideres de base de datos y desarrollo y tome en cuenta lo que me pedían, empezar a hacer las cosas con &quot;Materialize&quot;. ','2019-06-21'),(1541,77,'Inicio del Proyecto Work Studio','Luego de charlar con los profesores a cargo. Se confirmo el proyecto con la condición de realizar una investigación profunda para la realización de la aplicación. Se encuentra la versión y manuales de Android Studio para el desarrollo del proyecto y comienzo de busqueda de fuentes de informacion ya sea para competencias, usuarios y herramientas necesarias.','2019-06-21'),(1542,46,'razones','el dia de hoy intentamos continuar con la configuracion de ftp en la computadora virtual, nuevamente no tenemos la contraseña para trabajar con la version vieja(porque no se acuardan)y por x motivos no pudimos continual el trabajo','2019-06-21'),(1543,53,'Buscar información de nuevo ','Sobre leaflet','2019-06-21'),(1544,78,'AgregarAlumno y actualizar (21/06/19)','Ya había terminado en mi casa la parte de agregar un alumno y había demostrado en la carpeta de campo su funcionamiento. Hoy no trabaje mucho ya que tuve poco tiempo y tuve problemas con el puerto 8080. Luego con el problema arreglado empiezo a hacer la primera vista de ActualizarAlumno, reciclando el formulario de AgregarAlumno sacando algunos inputs y así. Como no termine toda la parte de actualizar, lo voy a continuar en casa.','2019-06-21'),(1545,44,'Buscamos y tratamos de arreglar algunos problemas del ID del alumno.','Tratamos de solucionar el problema de la carga del ID del alumno.','2019-06-21'),(1546,82,'continuación del proyecto','resolví un problema que tenia con el menú por lo cual investigue  y solucione el problema, ','2019-06-21'),(1547,79,'Dia poco productivo','Hoy llegue un poco mas tarde que de costumbre y decidí dedicárselo al DEA, en vez de al proyecto de preceptoria, ya que hoy no iba alcanzar el tiempo para migrar los servidores, entre que tenemos que bajar el servidor (fisco )y ver como se hace. Así que como dije me quise dedicar a trabajar en DEA pero no pude hacer mucho, tuvimos muchas interrupciones y entre que preparaba  las cosas y investigaba un poco realmente lo único que pude hacer es probar un programa para diseño de circuitos que me recomendó el profesor Damian Olaso cuando le pregunte por alguno, se llamaba Eagle, que fue comprado por autodesk. Otra cosa que estuve viendo fue de conseguir la contraseña de la vieja maquina virtual de ubuntu (hablando con Guido Marzoratti, un compañero de infraestructura del otro curso), pero no pude.','2019-06-21'),(1548,41,'Vista de cambio de contraseña','En el día de hoy estuve retocando algunas cosas de la vista de cambio de contraseña agregando iconos y centrando la vista.','2019-06-25'),(1549,72,'Clase 20, intalaciones.','La clase de hoy, logre hacer funcionar el server de PHP y que se muestre por la consola, Ademas intente descargar el bind9 y el vim pero tuve un par de problemas los cuales estuve intentanto resolver durante la clase. Por otro lado ya vi como tengo que soluciones el problema por lo que la clases que vienen espero que todo este bien.','2019-06-25'),(1550,64,'Instalacion DNS (Incompleto)','En el día de la fecha ayude a mi compañero a instalar/montar el servidor de DNS, avanzamos un poco con el tema, pero lamento decir que está incompleto, por eso para la próxima clase ya vamos a tener listo este servidor como el de correo.','2019-06-25'),(1551,40,'Vistas becas','En el día de hoy modificamos las vistas de becas para que sean más dinámicas a la hora de utilizar la pagina, cambiamos los campos, pusimos un buscador en buscar alumno y agregamos una tabla en donde saldrían los resultados','2019-06-25'),(1552,70,'Aplicando','Aplicamos las stored procedures para hacer la base de datos màs dinamica mediante rutinas (Mostrar cursos, materias, alumnos, ordenados mediante)','2019-06-25'),(1553,67,'Stored Procedure','El día de hoy tuvimos una charla con el ex líder del grupo de Diseño y aparte también empezamos a implementar Stored Procedure en la base de datos automatizando algunas cosas en la base.','2019-06-25'),(1554,43,'Más vistos','Hoy estuve tratando de arreglar la vista de Registro de usuarios pero no pude, lo voy a seguir en mi casa','2019-06-25'),(1555,49,'vistas becas','En el dia de hoy estamos modificando las vistas de becas.','2019-06-25'),(1556,66,'Clase veinte','Hoy seguí tratando de resolver el error que tuve la clase pasada, me ayudo Flor pero no se pudo hacer mucho, comprobamos que el controlador funciona, pero a la hora de pasar como parámetro los datos, no los toma, o por lo menos el id.','2019-06-25'),(1557,54,'Funcionalidad','Hoy aplicamos store procedure a nuestras tablas para darle funcionalidad a la base de datos ','2019-06-25'),(1558,68,'Formulación de funciones relacionadas a la vista de Becas','Se realizaron dos funciones necesarias para mostrar a los alumnos becados.\nSe realizaron correcciones en la vista de Becas.\nSe hizo un pedido a la sección de Base de Datos para añadir el campo Beca en la misma.','2019-06-25'),(1559,69,'stored procedure','seguimos con los procedimientos almacenados pero ahora se lo agregamos a una tabla de nuestra base de datos.','2019-06-25'),(1560,71,'stored procedure','El dia de hoy continuamos con Stored Procedure, vimos mas videos y esta vez la usamos para modificar en nuestra base de datos','2019-06-25'),(1561,65,'Menu inico progreso','Rediseñé el area de los botones.','2019-06-25'),(1562,86,'Instalacion DNS 2','Intentamos nuevamente de instalar el DNS en el servidor, y apesar de que no hicimos mucho por el poco tiempo pudimos hacer un proreso en el proyecyo, y tener una vision mas clara para la clase que viene para poder trabajar tranquilamente. Tambien empezamosa tener problemas de organizacion de los servidores en el pensrive de Ubuntu con las distintas copias de serguridad.','2019-06-25'),(1563,38,'Vistas sector becas','En el dia de hoy diseñamos nuevamente la pagina de una forma mas formal, mas organizada y asi tambien ahorrando la creacion de nuevas vistas como ejemplo en la vista de buscar alumnos que este inscriptos en las becas y dentro de esa vista de buscador de alumnos se agregó una tabla dentro de la misma vista donde podran visualizar aquel alumno que desea buscar','2019-06-25'),(1564,47,'Modificando las previas','Agregue a la vista previa las funciones para agregar, editar y borrar previas. También arregle algunos errores que tenía,  excepto el buscador.','2019-06-25'),(1565,57,'Modificando las previas','Continué avanzando con el funcionamiento de la vista previas. Avancé en algunas cosas, pero en otras sigo igual, me tira errores.','2019-06-25'),(1566,73,'mejoras de la pagina para previas 25-06-19','hoy estuve cambiando las vistas de la pagina para previas, agrengando mas campos en el formulario','2019-06-25'),(1567,87,'Becas','En el día de hoy estuve haciendo el funcionamiento de la vista becas. Para eso hice dos funciones y empecé la parte gráfica que es previsora.','2019-06-25'),(1568,63,'Ventigesima clase','El día de hoy continúe trabajando con Chipana tratando de resolver lo que nos quedo la clase pasada, verificamos que el controlador funciona pero, a la hora de pasar como parámetros los datos, no los reconoce.','2019-06-25'),(1569,83,'problemas','hoy hubo un problema con las maquinas virtuales.\neso llevo a que en el transcurso del día nos detuviéramos a resolverlo.\nasi que eso fue lo que se hizo.','2019-06-27'),(1570,37,'Diagramación de las próximas clases','Diagramamos lo que vamos a continuar haciendo las próximas clases en la materia en el poco tiempo que nos quedó de clase, ya que tuvimos una charla de la UBA sobre orientación laboral que ocupó gran parte del día.','2019-06-27'),(1571,75,'Actualizar y eliminar Materia','En esta clase realice la funciones faltantes,que eran: Actualizar y Eliminar','2019-06-27'),(1572,46,'problemas','el dia de hoy continuamos teniendo problemas con las maquinas virtuales por lo que no pude continuar con el trabajo.\nacordamos empezar una maquina virtual desde 0 para la siguiente clase','2019-06-27'),(1573,36,'CHARLA UBA','vinieron 2 personas de uba a darnos charla sobre nuestra carrera lo que vamos hacer a futuro y como es la universidad','2019-06-27'),(1574,76,'Mas mantenimiento','Por falta de horario debido a una charla relacionado a la universidad (UBA) se perdió mucho tiempo de trabajo. Luego, con el tiempo sobrante, se ordeno todo lo del área de manera que sea cómodo para cualquiera acceder a la información. ','2019-06-27'),(1575,45,'guia vocacional','Hoy vinieron unos psicólogos de la uba a consultar a los cursos sobre el futuro en tanto a carreras universitarias y que tan flexibles son para nosotros resolviendo nuestras dudas.','2019-06-27'),(1576,78,'Terminando el CRUD y comentando (27/06/2019)','Ya había terminado la parte de agregar un alumno, actualizar los datos y eliminar. Sin embargo, la parte de eliminar alumno, por más que funcione, falta que cuando se haya eliminado, vuelva a la primera vista en forma de ciclo. También trabajé con eso de volver a la primera vista con actualizarAlumno. Estuve varias horas programando esa parte e intentando hacer que vuelva a la primera vista, esto fue lo que me llevo más tiempo.\nYa con un 99% terminado, aproveché hoy a revisar el código de actualizar (que es el que más mareo da) y comente las funcionalidades para que otro de mi equipo entienda como funciona.\nSolo me ocupe de comentar ya que tuvimos una charla en la que nos sacaron varias horas.','2019-06-27'),(1577,53,'Charla ostentativa ','Dos personas llegaron al curso para danos una charla, se trato mas en que pensábamos hacer luego de terminar la secundaria.','2019-06-27'),(1578,42,'Labor','En el comienzo del dia adelante las vistas de la pagina web que estamos armando con el grupo de diseño, luego vinieron unos psicologos de orientacion los cuales nos dieron una charla sobre lo que queremos para el futuro y algunas cosas mas, finalizada la charla volvi al trabajo y termine una de las vistas en las que estaba trabajando para poder continuar con mi parte del proyecto.','2019-06-27'),(1579,74,'enlaces ','ya empecé a rellenar los iframes, crear tablar, y que estén conectados, pienso que es un pequeño paso para ir conectando las las vistas,aunque todavía no hay ninguna conectada pero ya estoy cerca.\nhoy nos visitaron psicólogos de la UBA pero usando 4:40 horas de la clase de hoy, hoy en clases normales, tuvimos la misma charlas así que solo yo fui el único que estuvo trabajando cuando nos visitaron porque su charla no me parecía interesante, en ese momento ya empece a rellenar los inframes, con las tablas que luego las mismas van a llenarse con datos de alumnos ingresados esto se encarga desarrollo. utilice materialize porque al charlar con los lideres me dijeron que se les hace mas fácil y les quito tiempo de trabajo. \ntambién ayude a mis compañeros mostrandoles sus errores, cuando veia que se quedaban trabados me ocupaba de solucionar sus errores. \n ','2019-06-27'),(1580,85,'Charla uba','hoy no tuvimos tiempo de trabajar debido a una charla que tuvimos con unos empleados de la uba','2019-06-27'),(1581,79,'Dia con interrumpido ','Hoy tuvimos una importante interrupción en el día, iba a dedicarme al proyecto DEA (casi seguro) y nos avisan que vamos a tener una charla sobre orientación vocacional con psicólogos del DOE de la UBA, por lo tanto tuvimos casi todo el día ocupado con la charla. El poco tiempo que nos quedo estuvimos hablando con los profes sobre las tareas del grupo de infraestructura. Nos reasigno tareas especificas con respecto al grupo de infraestructura del la parte del proyecto de alumnos. De esa manera no hacemos trabajo doble.','2019-06-27'),(1582,44,'Tuvimos una charla con gente de la UBA','Nos estuvieron explicando como podria llegar a ser el ingreso a la uba despues de terminar el secundario y nos explicaron algunas de las carreras.','2019-06-27'),(1583,50,'Charla informativa UBA','Tuvimos una charla con dos psicólogos de la UBA sobre continuar estudiando luego de terminar el secundario, ademas de el mundo laboral.','2019-06-27'),(1584,56,'Desarrollo de pagina','-Hubo una charla de la UBA hasta el segundo recreo\n-configure los botones de los menus de la pagina\n-Entreviste a un preceptor para saber cuales divsiones hay exactamente por cada año para posteriormente editar el contenido de cada año en la página para que no aparezcan divisiones inexistentes en el listado. ','2019-06-27'),(1585,82,'orientación vocacional  ','Hoy vinieron Lautaro y Emmauel psicologos de la UBA  a darnos un taller de orientación vocacional, en la cual me resolvieron algunas dudas que tenía y realizamos algunas actividades en grupos, luego con el poco tiempo que quedo seguí con mi proyecto en el cual tengo algunos de problemas los cuales estoy resolviendo con materialize y ayude a un compañero a resolver unos problemas que tenia.  ','2019-06-27'),(1586,80,'Charla de Orientacion vocacional','El día de hoy vinieron dos psicólogos orientadores de la UBA para charlar con nosotros sobre las posibles carreras a segur luego de la secundaria, sus correspondientes salidas laborales y como lograr decidir cual carrera seguir.','2019-06-27'),(1587,48,'Orientacion vocacional','Hoy tuvimos una charla sobre de lo que ibamos a hacer al terminar el secundario y las opciones de estudio que teniamos al terminar el secundario ademas con el corto tiempo que tuvimos me puse al dia con los trabajos que debia entregar\n','2019-06-27'),(1588,58,'Nos visitaron profesores','Hoy nos visitaron profesores que venían de la UBA para hablar sobre el mundo laboral y dar ideas sobre nuestro primero trabajo o en la universidad','2019-06-27'),(1589,83,'dns( instalacion ubuntoserver)','Hoy se vio el tema del DNS:\nPorque es lo primero que se necesita para que mi compañero pueda trabajar.\nhubo un único problema y es que la maquina es muy lenta.\n Por lo que no pude empezar a configurar. \n Pero se logro la instalación. \n- instalación del ubuntoserver','2019-06-28'),(1590,46,'dns( instalacion ubuntoserver)','el dia de hoy se instalo el ubuntu y a continuación el dns en el que ayude a belén a instalar.\nel proceso de instalación del dns se completo pero a la vez no porque falto que el equipo se reinicie, lo cual no paso porque la maquina es muy lenta.','2019-06-28'),(1591,82,'cambios ','realice algunos cambios en el formulario que el líder dijo que cambiara, para el cual utilice materialize y w3schools  y pude resolver problemas que tenia anteriormente también dijo que hubo cambios en le menu y tendré que cambiar el menu ','2019-06-28'),(1592,78,'Más comentarios y diagrama de flujo (28/06/19)','Hoy me dedique a comentar el método eliminarAlumno. Enrealidad no está terminada la última parte pero por lo menos lo que ya está escrito es necesario comentarlo. Aparte de eso me dedique a hacer un diagrama de flujo del método actualizarAlumno, ya que al ser un método complejo de entender se lo merece.\nAlgo que identifiqué recién y que tengo que arreglar, es que hago muy mala re utilización de código. Copio el mismo código dos veces y no hago uso de funciones. Lo que está claro es que el método funciona a la perfección, pero para facilitar la asimilación del código, es necesario arreglar eso.\nCon el poco tiempo que me quedó después de esto, me dedique a continuar con la carpeta de campo y añadir lo que hice del método actualizarAlumno y el diagrama de flujo. no es nada la verdad, pero es algo.','2019-06-28'),(1593,77,'Investigacion 1','Se comenzó la investigación del proyecto:\n  Aplicaciones para analizar como competencias ya fueron encontradas.\n  Cómo iniciar a utilizar el entorno de desarrollo (Android Studio).\n  Algunos comentarios de usuarios que criticando características que desean en distintas aplicaciones.\nCon esos datos se empieza la base de la construcción y planificación del proyecto\n\n','2019-06-28'),(1594,51,'ayuda y seguridad','hoy, mientras veiamos el partido estuve charlando con compañeros sobre si necesitan ayuda en su sector a la hora de usar la base de datos y depaso me puse a ver sistemas de seguridad para la base de datos','2019-06-28'),(1595,53,'Proyecto','Ver varios proyectos en los cuales basarme para poder seguir con el proyecto que tengo que terminar','2019-06-28'),(1596,48,'revisando codigo','Estuve modificando los codigos del programa, jugando para ver los cambios e intentar mejorar la pagina ','2019-06-28'),(1597,74,'ciclo basico año2 ','el día de hoy me encargue de continuar con las conexiones tuve problemas porque al parecer no me leía la pagina que había creado perdí mucho tiempo con eso y resultaba ser que era porque tenia dos carpetas una en el escritorio y otra en el pendrive y todas mis paginas creadas que estaba utilizando era del pendrive y resulta que mi pagina estaba en la carpeta del escritorio y por eso no me lo leia, una vez arreglado ese error continuo haciendo las conexiones al 2º año del curso básico en adelante me faltaría hacer las conexiones para todos los años y divisiones con sus respectivas especialidades esto mostrara cada alumno del colegio dependiendo lo que el usuario elija. \n','2019-06-28'),(1598,45,'codigo facilito','hoy estuve viendo vídeos en youtube en el canal de código facilito sobre HTML del 1 al 5','2019-06-28'),(1599,79,'Trabajando en DEA','Hoy me dedique al DEA, tengo la intención de hacer una investigación y especialmente una documentación sobre la comparación de usar un modulo sd y un dfplayer para reproducir audio, con el fin de cerciorarme de que sea la mejor opción, ya que vimos que el mp3 dfplayer era la mejor opción, pero no hicimos pruebas ni investigaciones muy profundas. Hice una lista de paginas de un libro sobre arduino que tengo que leer, consulte una pagina sobre modulo sd y audio por Internet, a partir de ahí encontré un programa interesante de diseño de circuitos que era algo que estaba buscando (llamado fritzing). Ademas de eso empece a leer un poco de la información que seleccione. También le pregunte una cosa al Profesor Consorti sobre el consumo de los leds y investigue un poco sobre eso en Internet. También quize empezar a trabajar en el circuito fisco del DEA con arudino pero el profesor Consorti me dijo que no se podía hasta la semana que viene por un problema que hubo con los arduino. ','2019-06-28'),(1600,64,'Problemas, Soluciones, y Transferencia de la Maquina Virtual a la Maquina Física.','También se informó que se dividirían las tareas con los del jueves y viernes, nosotros nos encargamos de ciertos servidores y ellos de otros.\nEn el día de la fecha que hice fue instalar de vuelta el VMWare Converter y convertir la máquina virtual en un solo archivo para que sea transportado a la maquina física. Tuvimos unos inconveniente tras sufrir un corte de luz en el establecimiento en el que estábamos trabajando dado ese motivo se perdió parte de lo que trabajamos. Cuando la luz volvió retomamos el trabajo y pusimos a transferir la máquina virtual convertida al servidor físico. \n','2019-07-03'),(1601,72,'Clase 21, Un problema con final feliz.','En la clase de hoy tuvimos varios cambios en el sistema del orden de las cosas que debíamos hacer en la clase por lo que tuve que adaptarme y me dedique la clase a desintalar servidores, darle los toques finales al servidor para al fin migrarlo e investigar la instalación del server Git, el cual, utilizaremos para que todo los demás equipo puedan guardar sus datos.\nAsí que puedo decir que la mayor actividad fue preparar todo para que el servidor este listo.','2019-07-03'),(1602,87,'Organizacion','Hoy nos dieron los criterios para aprobar la materia así que me senté a anotar qué es lo que tenemos, qué es lo que nos falta y qué es lo que va a hacer cada uno de lo que falta dado que se van a ir dos compañeros de la sección. Arreglé la base de datos porque tiraba error y estuve juntando todas las carpetas para hacer una sola.','2019-07-03'),(1603,65,'Avanzar con las vistas','No progrese en el dia de la fecha, debido a que no me sentia bien','2019-07-03'),(1604,68,'Puesta en perspectiva de tiempo y tareas restantes, y reparación de errores relacionados a la vista de becas','Se nos notificó de los requisitos para la aprobación de este trimestre, los que fueron anotados y comparados con las tareas ya cumplidas.\nReparé errores relacionados a la vista de Becas, como la llamada desde la página principal y la muestra de elementos.','2019-07-03'),(1605,52,'clase 14 de oficina de alumnos','lo que realizamos fue seguir el desarrollo de la pagina para oficina de alumnos corrigiendo errores y viendo las siguientes cosas a desarrollar ya para entregar una parte del proyecto funcional, con un cambio de área de mi parte a diseño.','2019-07-03'),(1606,38,'Vistas Finalizadas y envio del material','Como siempre queda algo que retocar en cada vista, en el día de hoy nos seguimos encargando de editar algunas cosas o de agregar nuevo contenido a las vistas, ya sea atajos o características que las hacen mejor visualmente. Luego de eso, realizamos la entrega del material terminado hasta el momento.','2019-07-03'),(1607,54,'Backup','En el día de hoy tuvimos un taller dado por la defensoría del pueblo,posteriormente cuando volví al aula no había luz por lo cual no pudimos utilizar las computadoras en ese lapso de tiempo. Lo que llegué a empezar a investigar en el día de hoy fue como realizar un Backup de la base de datos.','2019-07-03'),(1608,40,'Vistas esteticas','Estuvimos cambiando las vistas estéticamente para una mejor visualización, agregamos un buscador y compartimos las vistas finalizadas con el grupo de desarrollo','2019-07-03'),(1609,49,'Vistas Finalizadas y envio del material','En el dia de hoy finalizamos con las vistas y  se las pasamos al grupo de desarrollo.','2019-07-03'),(1610,47,'Haciendo el registro de materia por previas','Empecé y terminé de hacer la vista de registro de materia por previas.','2019-07-03'),(1611,71,'03/07','Estuvimos investigando sobre lo que nos falta hacer que es el agregar store procedure a las tablas faltantes,  back-up, agregar tablas a la base de datos y verificar si todo esta en orden .','2019-07-03'),(1612,57,'Registro de materia por previas','Finalizamos con la realización de la vista de registro de materia por previas','2019-07-03'),(1613,70,'UPDATE','En el dia de hoy empecè con delete y update y a investigar sobre la encriptacion, pero se cortò la luz y estuvimos sin poder continuar el trabajo por aproximadamente 30 minutos, cuando volviò, volvimos a trabajar desde cero, ya que obviamente no habia nada guardado. Pude hacer un nuevo procedure con una nueva columna que agreguè, especificamente para esto, cuando un alumno tiene 3 o màs previas (nueva columna) este es eliminado de la tabla.','2019-07-03'),(1614,43,'Vistas HTML','Pasamos algunas vistas a HTML, para así, mandárselos a los de el sector de Desarrollo ','2019-07-03'),(1615,41,'Vistas a html','En el día de hoy el profe nos reunió para ver cómo íbamos con los diseños y nos avisó de algunas cosas que podríamos cambiar para que queden mejor las diferentes vistas después pasamos las vistas finalizadas a html y se lo pasamos al grupo de desarrollo.','2019-07-03'),(1616,66,'Clase veintiuno','Hoy flor y yo seguimos con el mismo error que llevamos durante 2 clases pasadas, pedimos ayuda a gente con mas conocimiento en el tema aun así no se soluciono completamente.','2019-07-03'),(1617,63,'Ventigesima primer clase','El día de hoy continúe trabajando con chipana; acudimos a gente con más conocimiento para resolver el problema que teníamos sobre eliminar permisos pero apenas se pudo resolver en un 50%.','2019-07-03'),(1618,51,'cosas varias','en el dia de la fecha me puse a ayudar a mi compañero a modificar/agregar cosas en la documentación, de paso me puse a ver cosas de seguridad para la base de datos y por ultimo estuve recordando sobre los términos &quot;stored procedures&quot; y &quot;trigger&quot; para poder implementarlos en la base de datos','2019-07-04'),(1619,75,'Coordinación con el equipo de diseño','En esta clase, ya habiendo terminado nuestras funciones modelos de prueba, nos pusimos a implementar nuestras funciones según las vistas que realizó el equipo de diseño. Para ello hablamos con sus integrantes y llegamos a una decisión de mutuo acuerdo para realizar ya las vistas finales.  ','2019-07-04'),(1620,76,'Mas Mantenimiento ','Comencé ayudando al grupo de Desarrollo por la petición que me hicieron, sobre ingresar cierta cantidad de alumnos en cada curso y división que se encuentra dentro de la base de datos. Por un infortunio hubo un doble apagón de luz lo cual retraso mi trabajo, pero logre terminarlo. Luego de eso investigue hasta el final de las clase las funciones Stored Procedure y Trigger de SQL para aplicarlo en un futuro a la base de datos y así facilitar su uso.','2019-07-04'),(1621,36,'arreglando el buscador y el seleccionador de cursos','todo el dia probando codigos para que funcione','2019-07-04'),(1622,44,'Probando distintos codigos para solucionar problemas','Probamos codigo para solucionar el problema del buscador y la seleccion de cursos.','2019-07-04'),(1623,55,'Complementando la documentación y búsqueda de información','En el día de hoy junto a un compañero estuve complementando la Documentación de nuestro grupo, aparte de eso busque información sobre los procedimientos &quot;Stored Procedure&quot; y &quot;Trigger&quot; para implementarlas en nuestra Base de Datos y logre un avance en los apuntes de mi carpeta de campo. ','2019-07-04'),(1624,53,'Terminar de mostrar el mapa ','La información buscada anteriormente no sirvió para mostrar el mapa pero si para adquirir algunos conocimientos, hoy solo fue buscar mas información y al final fue ingresar a la pagina oficial de leaflet, ingresar donde dice tutorial y se pudo mostrar ','2019-07-04'),(1625,77,'Investigación 2','En el día de la fecha se corto la luz en dos ocasiones, perdiendo documentación en una de ellas. Por este motivo se comienza a trabajar desde Google Drive para evitar problemas similares en el futuro. \nLogrado un avance bastante significativo en la investigación de la competencia, al mismo tiempo se utilizaron comentarios para tomar en cuenta las preferencias de los usuarios de algunas de las funciones del proyecto. También se comenzó a desarrollar los puntos fuertes y falencias de cada una de estas aplicaciones de competencia/referencia.\nSe buscó y encontró un par de aplicaciones para realizar el apartado de diseño y bocetos. ','2019-07-04'),(1626,74,'uniendo todo ','el dia de hoy conecte todos los años con sus respectivas divisiones y también ordene todo con carpetas me va a general un monton de errores pero en casa voy a encargarme de eso. también hable con el líder de desarrollo y ver como podemos conectar todo, que ya tenemos una idea concisa, estamos cada vez mas cerca de terminar aunque todavía nos faltan 2 vistas para hacer y mas vistas de los integrantes de mi grupo que hay que conectar, con el index inicial. a las 2:40 pm tuvimos  un inconveniente, se fue la luz borrando todo lo que avanzamos pero a pesar de eso nos pusimos las pilas y logramos avanzar bastante. también hable con el profesor sobre ciertos inconvenientes con mi grupo porque un integrante se quejo del método que tenia y me culpaba de sus actitudes o cosas que no podía realizar pero por suerte ya se arreglo todo y pasamos del tema.\ntambién ayude a mis integrantes, dando consejos, brindando información y ayudando.\n ','2019-07-04'),(1627,42,'Finalizacion de vistas ','Trabaje en la terminacion de las vistas de sanciones y la de boletines, a su vez mire unos tutoriales para poder recordar algunas lineas de codigo las cuales se me complicaban','2019-07-04'),(1628,83,'connfiguracion del dns','primero hoy se empezo con la configuracion del dns pero mientras se estaba haciendo nos pedia tener ya instalado en ubunto el bin9 por lo que se iba hacer eso pero luego  se corto la luz dos veces por lo que se opto hacer lo siguiente y fue que lo uniéramos con el webmin  de esta manera seria mucho mas facil pero estando cerca de tarminar  nos dio error por lo que me canse !!! y bueno al final busque y me di cuenta de que se puede arreglar asi que e eso estoy asi todo lo que haga con el dns lo podre hacer desde la wedmin y sera mucho mas facil instalar el bin9\n','2019-07-04'),(1629,82,'supuesta finalizacion del proyecto ','Llegue y el líder dijo que lo que hice esta bien pero que tenia que cambiar el menú, lo cual me llevo mucho tiempo porque surgieron muchos problemas en el camino también tuvimos una charla con el profesor para ver el progreso del grupo en el cual nos dijo que agregáramos unas cosas y modificáramos otras, y también recibimos ayuda del grupo de desarrollo, luego de la charla pude solucionar los problemas y otros problemas con ayuda del compañero (by facundo). Y el líder me dijo que voy a comenzar con otro proyecto.','2019-07-04'),(1630,85,'Prueba fisica de kit arduino','una vez recibido un diagrama hecho por alvaro me concentre en generar un código de prueba para utilizar en un kit arduino que el mismo trajo, también lo ayude con la conexiones del mismo y una vez conectado hicimos pruebas de los leds y del parlante, pudimos hacer sonar el parlante sin ningun modulo de control de audio y esto nos abre a consideracion el hecho de no utilizar ninguno en el proyecto final, sin contar un potenciometro','2019-07-04'),(1631,50,'Unificacion','Se empezó a trabajar en conjunto con los demás departamentos para la finalizacion del primer prototipo de la aplicación, haciendo las conexiones entre las vistas de la interfaz con la base de datos.','2019-07-04'),(1632,78,'Combinando vistas con controlador (04/07/19)','Primero que nada complete la carpeta de campo con lo que me faltaba, esto era fotos del código y explicación del CRUD de alumnos. También termine al 100% el método eliminar con la funcionalidad de que vuelva al inicio. Además arregle el tema de la reutilización de código en el actualizar, pero hubo un problema y es que nos cortaron la luz dos veces y perdí eso que hice. No lo volví a hacer porque el profe llamó a todo el grupo de desarrollo para hablar la situación actual, como vamos con el proyecto y tal.\nPor último hablamos con el equipo de diseño para que nos pasen sus vistas con el fin de poder volcar lo que hicimos el equipo de desarrollo con lo de ellos y lo mismo hicimos con el equipo de base de datos para que nos pasen la bd con datos de alumnos falsos.\nEmpecé a trabajar con las vistas y tuve problemas con la disposición de los archivos ya que, los estilos y el JS lo tengo que tener en una carpeta dentro de la carpeta \'styles\' (carpeta que está fuera de \'applications\'). También tengo una tarea tediosa y es cambiar la extensión de los archivos, ya que me lo dieron en .html los tengo que cambiar a .php, porque en la mayoría de las vistas uso php para ciertas cosas, como por ejemplo la función base_url() para las direcciones de los archivos.\nYa teniendo todo arreglado me ocupo de mi tarea asignada la cuales agregar botones que llamen a los métodos del CRUD.','2019-07-04'),(1633,48,'Modificacion total del proyecto','Hoy realice los debidos cambios que tenia que hacer para mi vista de la pagina, tuvimos una charla grupal con el profesor para ver el progreso del grupo, y continue con mi trabajo, luego el lider del grupo me dijo que debia hacer otro cambio, asi que borre todo y mañana seguire con los cambios ','2019-07-04'),(1634,58,'Modificacion del proyecto','Hoy el lider del grupo hizo que modifiquemos el proyecto y lo pasemos a materialize para facilitar el trabajo a los demas y el profesor nos llamo para saber que habiamos hecho con el grupo de diseño y nos dijo que ibamos bien .','2019-07-04'),(1635,79,'Mucho trabajo productivo en DEA','Hoy empece trabajando en los diagramas del DEA, primero hice algunos diagramas para guiarme en cuanto al armado del prototipo en protoboard. Después de hacerlos se los presente al profesor Consorti para que verifique que no haya ningún error. No encontró nada que genere corto pero vio que serie preferible utilizar otro sistema de encendido, ya que el actual podría general un problema con el modulo tp4056 o con el arduino, hay que agregarle un transistor conectado al tp4056. Ademas de esa observación había que cambiar el posicionamiento de un capacitor que estaba conectado al parlante. Al terminar los diagramas empece a construir el prototipo de protoboard pero tuve un problema, me faltaron traer algunos materiales, pero principalmente cables para hacer las conexiones. Ademas tuve que ir a soldar unas fichas a unos cables de par trenzado que no servían para conectar los parlantes ya que con los cables del colegio no podía hacerlo porque eran del colegio. Después de eso probamos el circuito con Nacho y no funciono. Entonces el profesor Consorti lo reviso y dijo que los pines que estaba usando (A0, A1, A2, A3) solo eran de input, no de output, por lo tanto los leds jamas se encenderían. Después de corregir eso vimos que seguía sin funcionar, revisamos con el profesor Consorti todo el circuito. Pasamos a revisar los leds para ver si estaban rotos o quemados. Fui a buscar un multimetro y el profe reviso el arduino (que efectivamente mandaba 5v) y después alimento directamente a los leds. Al hacer eso el profesor pensó que la protoboard esta defectuosa o algo así, pero rápidamente se percato de que la protoboard que era de aproximadamente 400 pins estaba dividida a la mitad (las hileras de positivos y negativos) algo insulsa. Después de eso hicimos otra vez el circuito y vimos que el código todo funcionaba bien. En medio de todo esta proceso revisamos el código también. Después de eso fumos probamos los parlantes y funcionaron bien, pero bajos, profe dijo que podríamos subir el volumen o, brindando energía estrena del arduino (ya que el arduino no brindaba suficiente) ya sea con una pila o baterias por medio de un transistor y en caso de querer cambiar el volumen también un potenciometro. Pero también dijo que podemos usar un amplificador, pequeño y que incluso venga con un potenciometro, pero ademas nos sugirió que podríamos usar el que tiene unos parlantes, por lo que buscamos unos parlantes viejos, los desarmamos y los revisamos para utilizar su amplificador, falta desoldarlo y adaptarlo al circuito. ','2019-07-04'),(1636,46,'connfiguracion del dns','el dia de hoy configuramos el dns pero se nos corto la luz 3 veces, se reinicio nuestra maquina y otras cosas que no quiero mencionar.\nmañana continuaremos con la configuracion porque hoy apenas pudimos instalar el webmin en el dns ','2019-07-04'),(1637,75,'Coordinación con el equipo de diseño II','En esta clase, seguimos trabajando con el equipo de diseño para ya compactar nuestros trabajos. Han habido dificultades pero aún seguimos trabajando en ello para dar un resultado para ambas partes.   ','2019-07-05'),(1638,78,'Un problema grande','Hoy cambié el ruteo de las vistas ya que me dieron una carpeta con la nueva organización de los archivos, me explicaron como funcionan los iframse. Esto es un iframe que contiene las divisiones y otro general que es el curso. Hice mucho uso del base_url() para los nuevos ruteos. También tuve un problema con el uso de jquery, ya que me tira un error de que no conoce una función del jquery en el segundo iframe (el de las divisiones). Anda perfecto el index con el primer iframe (curso), pero el de divisiones no. Tengo que trabajar en casa eso.','2019-07-05'),(1639,51,'seguridad','hoy me puse a investigar posibles metodos de seguridad para la base de datos y me adentre acerca de los procedimientos &quot;stard prodecudures&quot; y &quot;triggers&quot;','2019-07-05'),(1640,83,'instalacion del bind9','hoy hubo bastantes problemas con el webmin, no podia instalar la librerias que me faltaban.\n por lo que decedi  instalar el bind9 y luego de eso empece a configurarlo ','2019-07-05'),(1641,50,'Unificacion - Routing','Durante el proceso de unificación se inicio la labor de reorganizar las rutas de los archivos para su correcto funcionamiento. ','2019-07-05'),(1642,56,'Diseño de pestaña de usuario para preceptores','-diseño en html del perfil del usuario para preceptor y uso de materialize para el estilo','2019-07-05'),(1643,45,'materialize','hay que pasar nuestras paginas webs a materialize así que esta clase vi instructivos de como hacerlo aparte hay que hacer otra pagina web con el listado de cada alumno con las notas en sus respectivas materias.','2019-07-05'),(1644,36,'solucionando errores que faltan','error de buscador y seleccionador de curso','2019-07-05'),(1645,80,'Diseño de pestaña de usuario','hoy nos dedicamos al diseño de la visa del usuario , utilizando materialize para organizar la infromacion personal del preceptor.','2019-07-05'),(1646,55,'Charla ','Me puse a ayudar a una compañera de otro sector con respecto a la base de datos y a complementar mi carpeta de campo. ','2019-07-05'),(1647,74,'problemas uniendo back-end y front-end ','En esta clase use muy poco la computadora porque tenia otros que avanzar para que yo pueda seguir con lo mio sin embargo me puse a diseñar como estaría conectado el back-end y el front-end en una hoja para luego tomar ese diseño y a la vez debatiendo sobre con el líder de desarrollo sobre como tienen que quedar, para luego confirmarme si esta bien como lo tenemos planeado, di nuevas tareas como: perfil del preceptor, perfil del alumno, y todas las notas de las materias, algo que es distinto al boletín,  ayude con los enlaces que están teniendo el otro sector con las vistas. ','2019-07-05'),(1648,44,'buscando solucion del buscador y porque no anda el code','no funciona correctamente el codigo del buscador y estamos buscando como solucionarlo','2019-07-05'),(1649,58,'materialize','Hoy continue con la pagina web en materialize y pude terminarlo tuve que ver unos videos instructivos de como hacerlo y por otra parte el lider del grupo me dio otro trabajo que hacer otra pagina web con el listado de cada alumno con las notas en sus respectivas pmaterias\n\n\n','2019-07-05'),(1650,53,'Realizar mejoras para el mapa ','colocar punto en el mapa, ventana emergente, al dar click en el mapa mostrar latitud y longitud ','2019-07-05'),(1651,82,'comienzo de un nuevo trabajo','hoy comencé con el nuevo proyecto para el cual investigue y pregunte en preceptoria, pude averiguar que información contenía la ficha de alumnos  con ayuda de Miguel (jefe de preceptores). Realice un prototipo en papel el cual el líder me pidió que realizara, con ayuda del prototipo comencé a pasarlo a html utilizando materialize. \n','2019-07-05'),(1652,85,'Prueba de potenciometro y modulo de tarjeta microsd con arduino','probamos y logramos hacer funcionar un potenciometro, para poder aumentar el volumen del sonido que sale por los parlantes, de forma exitosa a lo hora de hacer funcionar el modulo sd pudimos hacerlo funcionar pero se escuchaba con una mala calidad de sonido y muy bajo y no pudimos solucionarlo al final ','2019-07-05'),(1653,79,'Trabajando en DEA, integracion del amplificador provisional ','Hoy empezamos a trabajar en la integración de la plaqueta amplificadora provisional que sacamos de un parlante. Empece a armando otra vez el circuito en protoboard, y mi compañero se ocupo del codigo. Ademas de eso le di una netbook que venia con slot para sd y un adaptador de sd a micro sd para que formatear la tarjeta y el le pase un archivo .wav. Mientras armaba el circuito que estaba compuesto por los leds, el modulo de tarjeta micro sd, el amplificador y el arduino vino el profesor Puma y me pidió que vayamos ayudar a nuestros compañeros de mecánica con un tema de las almohadillas del DEA (buscar unas almohadillas). Fui y hable con los chicos y le dije que en vez de buscar una (que me dijeron que eran muy caras) podíamos hacerlas y me dijeron que vaya a hablar eso con el profesor Puma que les pareció bien la idea (cosa que no pude hacer). Después volví  con a trabajar con el circuito. Primero probamos los leds y el amplificador, cosa que no funcionaron, por un problema de conexión que había, nada grave. Después vimos que algunos leds funcionaban pero uno no y el parlante tampoco. Revisamos el código y el circuito y encontramos el problema y funciono el parlante y el led que faltaba pero un de los leds encendía poco porque el amplificador lo conectamos al arduino ya que no teníamos un cable usb extra para conectar a una computadora. Entonces buscamos un usb en la aula de sistemas de control pero no encontramos ninguno. Después de que el profesor Olaso volviera, de casualidad tenia un usb que no le servia, entonces pedimos un alicate y probamos con ese usb. Cuestión que el parlante funciono y con un volumen alto (algo bueno). Después de eso decidimos en vez de probar tons, probar con un archivo .wav desde el modulo micro sd, pero no funcionaba. Estuvimos revisando el circuito y no encontramos problema. Mi compañero reviso su código y busco en unas paginas y vio que para reproducir audio el parlante tenia que estar conectado al pin 9 (cosa que de casualidad estaba) y el modulo tenia que estar conectado en otros pines determinados. Hice esos cambios en el circuito y funciono, lo único malo es que el volumen y la calidad del audio eran malas. Hablamos de eso con los profes y vimos que era por temas de conversión de archivos y la calidad de conversión (que en teoría tenemos que limitar porque sino el arduino no lo puede reproducir) teníamos estos problemas, igual tenemos que probar con otro archivo y con otra calidad de conversión, a ver si por alguna razón funciona. ','2019-07-05'),(1654,39,'Charla con galicia','En el dia de la fecha se realizo una charla sobre las distintas ramas de nuestra especialidad (tecnico computacion).','2019-07-10'),(1655,52,'Charla con galicia,  reunion','El dia de la fecha si hizo sobre el galicia para una ayuda de trabajo o una idea de q clase de cosa queremos realizar mas adelante y organizacion de equipo de desarrollo con los del otro curso','2019-07-10'),(1656,47,'Charla y reunión','Algunos empleados del banco Galicia vinieron a darnos una charla para ayudarnos a elegir lo que queremos hacer en el futuro. Luego como estaban los compañeros del otro turno pusimos en común nuestros progresos en la aplicación.','2019-07-10'),(1657,66,'Clase veintidós ','Hoy hubo una charla del banco Galicia, en la que nos orientaron sobre las posibilidades que tenemos para estudiar, fue bastante útil, note que debo aprender muchas cosas más, demasiadas, luego hubo una charla con el grupo de desarrollo de los jueves y viernes hablamos sobre más cosas que hizo cada grupo y las complicaciones que tenemos.','2019-07-10'),(1658,70,'Charla, organización.','Tenemos una charla proveida por Galicia sobre las distintos caminos que podemos seguir, teniendo en base los distintos sectores que tenemos en PP, sumando unos más (Seguridad, comunicación, infraestructura, desarrollo, base de datos, diseño) y después nos juntamos con los chicos de los Jueves y los Viernes y nos organizamos con los distintos avances y cosas hechas y por hacer de cada grupo.','2019-07-10'),(1659,49,'charla','En el dia de hoy tuvimos una charla con empleados del banco galicia y nos reunimos a hablar en grupo para ver como veniamos con el tema de las vistas.\n','2019-07-10'),(1660,87,'Charla del Galicia','En el día de hoy vino un hombre que trabaja en el área de seguridad Galicia para darnos una charla sobre las salidas laborales que tiene una profesión de informática y lo importante que es tener un título universitario. Luego de esto, nos juntamos con el grupo de desarrollo de jueves y viernes que estuvo presente en la charla para discutir qué cosas tenemos hechas de código y las cosas que faltan. También estuvimos charlando sobre las tecnologías y cómo fuimos programando el programa.','2019-07-10'),(1661,51,'Charla','En el día de la fecha vine para escuchar una charla orientadora de un representante del banco Galicia, pasado eso me puse a charlar ciertos puntos con los chicos del sector de Base de Datos de los dias Martes y Miercoles ','2019-07-10'),(1662,43,'Hablar del futuro y con otro grupo','Hoy vino gente del Banco Galicia, para hablarnos de las grandes cosas que podríamos hacer en el futuro. Pero que primero debíamos de seguir la universidad, para tener un camino más amplio, y también aprender otros idiomas. No sólo eso, nos juntamos con nuestra misma área, pero de otro día, en este caso, los de Martes/Miércoles, con los de Jueves/Viernes. Estuvimos charlando de cómo iban ambas partes, qué tan adelantado iba uno y cuántas mejoras podían hacer.','2019-07-10'),(1663,40,'Charla y reunión por areas','En el día de hoy tuvimos una charla con los empleados del banco Galicia sobre la orientación vocacional, nos explicaron de que trata cada cosa sobre lo que podríamos estudiar o trabajar y las salidas laborales que hay. Al terminar la charla nos juntamos por áreas con el otro turno para compartir los puntos en común y ayudarnos con algunas dudas sobre el diseño o exportación de las vistas.','2019-07-10'),(1664,67,'Charla de Orientación Escolar','El día de hoy nos dieron una charla sobre orientación vocacional dándonos ideas de los futuras salidas laborales que tenemos gracias a cursar en un colegio técnico como es la gloriosa 32. Después un par de horas de charla aprovechamos que estábamos los distintos turnos de practicas y nos juntamos a hablar sobre el área de Base de Datos.','2019-07-10'),(1665,71,'Charla, organización.','Tuvimos una charla proveida por Galicia sobre las distintos caminos que podemos seguir terminando el secundario, teniendo en base los distintos sectores que tenemos en PP, y después nos juntamos con los chicos de los Jueves y los Viernes y nos organizamos  a hablar sobre los distintos avances y cosas hechas y por hacer de cada grupo, teniendo en cuenta que el proyecto es similar al de nosotros','2019-07-10'),(1666,73,'Charla de Orientación Escolar','El día de hoy nos dieron una charla sobre orientación vocacional dándonos ideas de los futuras salidas laborales que tenemos gracias a cursar en un colegio técnico como es la gloriosa 32. Después un par de horas de charla aprovechamos que estábamos los distintos turnos de practicas y nos juntamos a hablar sobre el área de Diseño.','2019-07-10'),(1667,54,'Orientación vocacional','En el día de hoy tuvimos una reunión en la que nos dieron una charla empleados del Banco Galicia. Esta consistió en una orientación vocacional  obviamente en el entorno de la especialidad en la que nos explicaron como seguir a futuro, nos dieron recomendaciones, despejaron dudas entre otras cosas. Posteriormente nos juntamos con el mismo área  (en mi caso base de datos) de los chicos que concurren los jueves y viernes para establecer puntos en común de la materia.','2019-07-10'),(1668,45,'charla vocacional','hoy tuvimos una charla orientadora sobre diferentes vocaciones  sobre el rubro informático y sus fines como por ejemplo comunicaciones infraestructura etc...','2019-07-10'),(1669,41,'Charla sobre orientación vocacional y salida laboral ','En el día de hoy tuvimos una charla con empleados del banco Galicia que nos hablaron sobre orientación vocacional y las diferentes salidas laborales, también nos explicaron sobre los diferentes trabajos con sus características después aprovechamos que estábamos con los otros compañeros de los jueves y viernes y nos juntamos lo de las mismas áreas de diseño para hablar y ayudarnos sobre las vistas.','2019-07-10'),(1670,68,'Exposición de parte de un representante del Banco Galicia','En el día de la fecha las actividades habituales fueron reemplazadas por una exposición, en conjunto con el grupo con horario jueves y viernes, que fue dada por un representante del Banco Galicia. La charla se basó en las diversas subdivisiones de la carrera, y se habló de los distintos programas y elementos utilizados en cada una de las secciones. Luego de la charla tuvimos un espacio para hablar sobre los proyectos con los integrantes de la misma área del horario contrario.','2019-07-10'),(1671,78,'Charla y reunión','Hoy nos dieron una charla los del banco galicia sobre las áreas que hay en la informática. Explicaron que se trabaja en cada una y demás cosas. Nombraron las áreas de desarrollo (programación, paradigmas de lenguajes), seguridad, análisis de datos, bases de datos y hardware.\nTambién nos reunimos con el equipo de desarrollo para ver como íbamos. El equipo de la otra comisión dijeron que tienen login con tema de sesiones y privilegios. También contaron que se están ocupando de las becas.','2019-07-10'),(1672,38,'Charla con trabajador del banco Galicia y charla grupal sobre la materia','En el día de hoy tuvimos una charla dirigida por un trabajador del Banco Galicia donde nos contaba sobre sus estudios, que habia estudiado en una secundaria industrial mas que nada mostrándonos diferentes cosas acerca de la computacion y sus sectores para orientarnos el dia que nosotros decidamos trabajar en alguno de los roles que se mencionaron, como por ejemplo en seguridad, en desarrollo, testing, etc. Al finalizar la charla nos juntamos en grupo con compañeros de diferente turno, que claramente cursamos la misma materia y pusimos puntos en comun acerca de los trabajos que estamos realizando.','2019-07-10'),(1673,57,'Charla para futuro','En el día de la fecha un empleado del banco Galicia especializado en el área seguridad nos vino a dar una charla sobre qué especialidades tenemos la posibilidad de elegir para futuro y nos fue dando detalle de cada una ','2019-07-10'),(1674,64,'Charla y Reunión','En el día de la fecha nos vinieron a dar una charla del Banco Galicia sobre la Informática y como debemos capacitarnos si queremos ser alguien en un futuro, si queremos trabajar de lo que estudiamos y otros temas interesante que profundizo con profesionalidad, ademas nos brindo un servicio de catering que incluía jugos y alfajores.','2019-07-10'),(1675,82,'charla ','el día de hoy tuvimos una charla de orientación vocacional sobre que carreras podemos estudiar la cual me ayudo un poco. luego de la charla me reuní con  diseño de los días martes y jueves, platicamos sobre lo realizado hasta el momento y las dificultades que tuvimos ','2019-07-10'),(1676,46,'reunión de secciones y otros','el día de hoy nos pidieron venir(sin avisar con anticipación)  para un charla con Galicia, en la cual nos hablaron de los distintos tipos de trabajos que  podríamos tener en el futuro cuando nos graduemos que fue muy interesante. Al venir un día miércoles de nos informo que el día viernes no tenemos clases este viernes, aprovechando que tenemos tiempo el profe nos dijo  que nos dividiéramos en grupos para tener una reunión de secciones con los  del turno martes/miércoles y hablar sobre algunas dudas que tengamos.  ','2019-07-10'),(1677,65,'Charla y reunion','Tuvimos una charla constructiva sobre nuestro futuro en el empleo y charlamos con nuestros iguales en areas del otro turno para ayudarnos mutuamente.','2019-07-10'),(1678,74,'Charla y reunion','hoy nos comunicaron que una persona nos iba a dar un charla sobre diversas ramas de computación seguridad, infraestructura,  base de datos, etc. \nfue una charla de una hora y media aproximadamente. Luego me puse en una mesa hablando con los integrantes de diseño de martes y miércoles hablamos sobre los problemas que tenían con bootstrap studio, dicen que todo lo que hacían los borraba así que les recomendé bootstrap que es solo copiar y pegar el link y el contenido que vas a utilizar, a pesar de que fue corto el tiempo fue una clase interesante ya que es la primera vez que vengo a clase un miércoles y poder interactuar con los chicos de diseño.\n ','2019-07-10'),(1679,53,'Probando mas funciones de leaflet ','Se realizaron varias funciones, como por ejemplo que sea toda la pantalla completa el mapa, que te ubique matemáticamente si lo permitís, después otra función se pudo realizar pero era necesario tener varios divs para que funcione con su totalidad y los divs no se pudo terminar. ','2019-07-11'),(1680,45,'pestaña de notas','hoy empece con el diseño de la pagina de notas de preceptores también tuve problemas con la carpeta de campo la cual esta archivada mal y esta incompleta después de las vacaciones terminare el diseño y corregiré la carpeta de campo.','2019-07-11'),(1681,83,'dhcp','hoy continuamos con la configuración del dns pero en el transcurso del procedimiento tuvimos problemas con la ip por lo que se hablo al profesor y nos dijo que lo dejemos y que continuáramos con el dhcp por lo que había que instalar y configurar. Eso tuvo sus complicaciones porque la maquina nos falla un poco pero se hizo hasta que la parte de iniciarlo o detenerlo como que nos dijo un error, lo cual tratare de ver porque puede ser que hallamos hecho algo mal, asi que eso se vera. ','2019-07-11'),(1682,36,'haciendo javascript ','boton de submit con javascript para mandar todo el formulario de una y poner la fecha una vez nomas.','2019-07-11'),(1683,46,'configuración de dhcp','el dia de hoy el profe nos dijo que dejáramos de lado la configuración de dns por un problema de la ip, así que empezamos  con el dhcp\ndel cual nos fue muy bien?  hasta que empezamos a &quot;usarlo&quot; ','2019-07-11'),(1684,50,'Unificacion - Estructura de tablas de datos','Se inicio el desarrollo de las tablas en PHP para la salida ordenada de los datos por pantalla.','2019-07-11'),(1685,58,'Pestaña de pagina web de inicio','Como ya termine la plantilla del boletin me otorgaron otro trabajo en el cual me dijeron que haga un diseño del inicio de una pagina de web para el proyecto de diseño, tuve que ver videos tutoriales porque me se complico un poco, con eso ya pude empezar el diseño de la pagina.','2019-07-11'),(1686,77,'Investigación 3','El día de la fecha se terminaron las investigaciones de la competencia y se inicio la descomposición de fortalezas y debilidades de cada una de estas, para que la app del proyecto pueda tener referencias fijas y no cometer errores que tienen las demás. O al menos tratar de evitarlos.','2019-07-11'),(1687,82,'Terminar la estructura ','En el día de hoy continúe con la ficha del preceptor, al paso del día un compañero me vino a ayudar con el proyecto porque su trabajo fue cancelado por lo cual avanzamos en mi trabajo, tuvimos dificultades: no podíamos poner una imagen en la ficha  y el diseño que el líder dijo que implementáramos no podíamos hacerlo así que  pedimos ayuda y nos dieron algunos consejos de cómo solucionarlo. Pudimos resolver los problemas  mencionados pero no pudimos terminar el diseño pero pudimos terminar la estructura.','2019-07-11'),(1688,48,'Cambio de trabajo','Hoy me acerque al lider para hablar sobre mi trabajo de los proximos cambios que queria que realizara, y me informo que ya no debia seguir con ese trabajo por que iba a seguir teniendo cambios y ya habia un trabajo hecho para remplazar al mio, entonces comence a trabajar con mi compañera en el trabajo que tenia pendiente, y realizamos una ficha de preceptor ','2019-07-11'),(1689,74,'ayudando a otros sectores ','ayude a un chico de otro sector y le dije como tenia que hacerlo a partir de ahora porque si bien estaba bien era muy tedioso a la hora de usarse.\nayude a todos mis integrantes y los ayude a terminar vistas quedando a mi parecer muy bien.  pasamos todos archivos .html a .php y meencargue de ya definitivamente enlazar porque al ordenar los archivos se desenlazo todo. \n','2019-07-11'),(1690,56,'desarrollo de pestañas','-terminar el diseño de la pestaña de perfil de usuario de los preceptores\n-corrección de errores en las hojas de estilo en las pestañas','2019-07-11'),(1691,75,'Boletin','En esta clase, me puse a desarrollar el código para que muestre todas las notas del boletín de un alumno en especifico. Para ello debo aprender a usar php con pdf. ','2019-07-11'),(1692,51,'Ultimos terminos','En el dia de hoy ayude a mi compañero a terminar la documentacion de nuestro sector, actualicé mi carpeta de campo y me puse a buscar info y como aplicar el termino &quot;trigger&quot;  en nuestra base de datos','2019-07-11'),(1693,55,'Documentacion y ayuda','Hoy estuve complementando la documentacion junto con un compañero de mi mismo equipo, tambien estuve buscando mas informacion sobre los stored procedure y tambien ayude a una compañera de otra area con la base de datos','2019-07-11'),(1694,42,'Organizacion y terminacion de vistas','En el dia de hoy, ayude a mis compañeros, los cuales estaban encargados de terminar sus partes del proyecto en el area de diseño, mas que nada con los estilos y partes del codigo de html. Luego de esto junto con mi lider comenzamos a hacer las extenciones, o sea, pasar de &quot;.html&quot; a &quot;.php&quot;. Para que el area de infraestructura y desarrollo puedan comenzar a trabajar con las vistas en sus respectivas tareas','2019-07-11'),(1695,76,'Últimos Cambios','Fue una clase tranquila con poco para hacer. Se siguió investigando acera de los Stored Procedures y Triggers para aplicarlos en la clase siguiente y dar fin en su mayoría al área de BD del proyecto.','2019-07-11'),(1696,51,'trigger','En la clase de hoy me puse a ver unos últimos detalles de &quot;trigger&quot; acompañado de unos cuantos ejemplos, me puse a actualizar la carpeta de campo y me puse a ver &quot;permisos de usuario&quot; para la base de datos','2019-07-12'),(1697,83,'terminado','estaba viendo el pequeño problema que teniamos  en la anterior clases y al final si funciono. me llevo mi tiempo. pero lo logre, asi que ahora tengo el dhcp terminado.\npor ultimo decidi en ver mi carpeta de campo con el tiempo restante\n','2019-07-12'),(1698,76,'Fin de los Procedures','Se termino de crear los procedures y se espera una devolución de parte del equipo de desarrollo para ver que es posible cambiar y mejorar en estos, en caso de haber mejoras y seguir con el mantenimiento y backup de los datos al igual que la documentación.','2019-07-12'),(1699,36,'haciendo que funcione dropdown de curso','use javascript tmb y nose puede. pregunto a olaso y tampoco asi que nose.','2019-07-12'),(1700,55,'Complemento','En el día de la fecha complemente mi carpeta de campo y busque en que puedo complementar la documentación.','2019-07-12'),(1701,78,'Nada','Hoy no hice casi nada. Llegue un poco tarde por una reunión que tuve en una empresa. Cuando entro me pongo a ver lo que tengo que trabajar para combinar las vistas con las funcionalidades. Hable con el jefe de diseño y me facilitó nuevas vistas con la extensión php. Lo único que tengo que trabajar son el tema de las URL. Las direcciones de los archivos están medio mal y hay que adaptar la carpeta raíz con el base_url.','2019-07-12'),(1702,53,'Informacion nueva y objetivo logrado ','Mediante buscar en google leaflet se encontro en github archivos subidos sobre leaflet, sirvieron por que estaban bien explicados y lo el objetivo que se logro fue poder poner una opción para mostrar y ocultar el la ubicación que aparece en el mapa.','2019-07-12'),(1703,77,'Diseño de interfaces','Se tuvieron en cuenta las investigaciones previas para empezar a diseñar las interfaces principales de la aplicación. También se consideran los métodos principales que se utilizarán y que diferenciaría al proyecto a las demás aplicaciones investigadas. Como por Ej las funciones de &quot;tiempo libre&quot; o &quot;descansos medidos&quot;.','2019-07-12'),(1704,48,'Trabaje con mi compañero','Como sigo sin un proyecto comence a trabajar con mi compañero en la pagina, Probamos codigos, usamos estilos, pero aun falta terminar la pagina ya que tiene un error','2019-07-12'),(1705,58,'segui con la pagina ','Bueno hoy seguí con lo de ayer que era terminar el diseño de la pagina web de inicio del proyecto estuve probando codigos dandole estilos a los botones de registro e inicio y tengo un error con los botones que tengo que arreglar la proxima clase .','2019-07-12'),(1706,74,'xampp ','en esta clase me estuve fijando como abrir un php correctamente ya que todos mis archivos se pasaron a ese formato ahora esoty trabajando con el xampp junto con la carpeta htdocs con eso ya tenemos el camino para conectar lo mio con la otra area ahora falta relacionarlos y vincularnos\n','2019-07-12'),(1707,79,'Proyecto DEA','No pude conseguir los componentes de arduino para hoy, así que me puse a trabajar en el re diseño de los planos, ya que los profes me dijeron que estaría bien cambiar algunas cosas. También puse el eagle  a descargar y mientras tanto busque algunos datasheet de componentes (modulo micro sd, dfplayer mp3) porque primero, nos ayudaría a hacer la documentación y segundo tenia una duda relacionada con los problemas de la clase pasada y quería sacármelos (cosa que no pude hacer). Estuve hablando con el profesor Damian Olaso sobre capacitores, resistencias y plaquetas de prototipo, porque pronto tendríamos que hacer una, también hablamos del gantt. Después de hablar con el profe fui a buscar a mis compañeros de mecánica de proyecto para ver unas cosas del arduino con ellos (medidas, etc.), cosa que no pude hacer porque no vinieron. Cuando volví y termino la descargar del eagle, me puse con el profe a ver como funciona, voy a tener que investigar mas a fondo como funciona pero se supone que el eagle tiene todas las herramientas que necesito. Después de eso me puse a aplicar los cambios de diseño del circuito que me dijeron los profes en mis planos escritos a mano.','2019-07-12'),(1708,82,'terminar ficha ','continué con el trabajo, tenia que cambiar el diseño que el líder determino cual seria, mediante lo cambiaba  tuve problemas pero pude solucionarlas también tuve que pasarlo a materialize, pero  busque información para solucionar el problema y  luego de terminar el diseño se lo mostré a kevin y dijo que estaba bien pero que tenia que centrar la imagen y agregar un botón de enviar. no pude centrar la imagen pedí ayuda y tampoco el líder y un compañero pude así que lo dejamos así aunque se pudo terminar. ','2019-07-12'),(1709,64,'Cv, Entrevistas, etc.....','En el día de la fecha usa las horas de PP, para registrarme en la página de una de la compañías que los docentes nos eligió a mí y mis compañeros para realizar prácticas externas, tuve que grabar videos en inglés y en español , completar formularios con mis datos, hacer test, etc.','2019-07-17'),(1710,66,'Clase veintitrés','Hoy trabaje con los la administración de los permisos, y cambiaron integrantes .','2019-07-17'),(1711,49,'retocando vistas','En el dia de hoy estamos terminando con las vistas que nos queadaron pendientes en finalizar y hubo un cambio de compañeros por parte de los profesores.','2019-07-17'),(1712,38,'Nuevo sector','En el dia de hoy me pasaron a el sector de desarrollo en el cual mi compañero Chipana me explico que tareas realizan en este grupo y tambien me mostró detalladamente el funcionamiento de las aplicaciones utilizadas.','2019-07-17'),(1713,72,'Clase 23, Pruebas','La clase de hoy, descubrimos que el servidor migrado no funciona para distribuirlo en otras computadoras por lo que tuvimos que instalar un nuevos servidor en el servidor migrado, para que tenga un placa de red flexible.\n\nPuesto que al instalar todo de nuevo, me puse a instalar todos lo servidores ya antiguamente mencionados para el funcionamiento de la aplicación que queremos hacer.','2019-07-17'),(1714,40,'Cambio de area','En el día de hoy me cambiaron del área de diseño a infraestructura, me informaron de las metas del 2do trimestre y explicaron como estaban trabajando, empecé viendo un tutorial sobre cómo instalar Git en Ubuntu y estuve probando código en la consola.','2019-07-17'),(1715,41,'Creación de nuevas vistas','En el día de hoy estuve creando la vista de login por completo agregando el fondo, logo la barra de navegación y centrándolos  y también estuve arreglando algunas de las otras vistas cambio de contraseña y cambio de cuenta.','2019-07-17'),(1716,54,'Investigación','En el día de la fecha continué con el trabajo de investigación con respecto al backup automatizado de la base de datos ','2019-07-17'),(1717,39,'Cambio de area','En la clase de hoy me designaron al área de diseño, estuvimos corrigiendo algunos detalles de  las vistas para desarrollo. ','2019-07-17'),(1718,52,'cambio de seccion ','hoy me cambiaron de sección al área  de diseño y los proyectos que tengo que realizar son de mejorar las vista y seguir haciendo nuevas vistas hasta completar un total de 13 vistas funcionales terminadas','2019-07-17'),(1719,47,'Arreglando y mejorando código',' Continué arreglando y mejorando algunas cosas que estuve haciendo a lo largo de las clases, como por ejemplo, el buscador que te muestra las materias del alumno que buscas y la función para editar los campos de la vista materias. ','2019-07-17'),(1720,57,'Mejorando el código','Continuamos solucionando algunos errores que nos impedían avanzar con las vistas y mejoramos algunas otras como por ejemplo, el buscador de materias de los alumnos y la función para editar los campos de la vista “materias”.','2019-07-17'),(1721,41,'Ayudando a terminar las vistas','En el día de hoy estuve ayudando a mi compañero de diseño con la vista de registros de usuarios y retocando algunas cosas de mis vistas.','2019-08-06'),(1722,49,'vistas','En el dia de hoy seguimos terminando y dandole los ultimos detalles a las vistas.','2019-08-06'),(1723,43,'última vista','Hoy estuve haciendo la última vista aunque no la llegué a terminar del todo, pues me falta agrandar el recuadro del fondo. Aunque también me ayudó un amigo para hacerlo más fácil, y el objetivo se cumplió\n','2019-08-06'),(1724,57,'Regreso a clases','Como primer día de clases en prácticas profesionalizantes fuimos mejorando algunos aspectos de las vistas que nos quedaron pendientes y también estamos en el proceso de crear un drop menu para seleccionar las materias para la vista de previas.','2019-08-06'),(1725,47,'Mejorando algunas cosas','Seguí tratando de mejorar algunas cosas de algunas vistas, hoy empecé a investigar cómo hacer un dropdown (menú desplegable), para que sea más fácil a la hora de agregar una materia previa a un alumno.','2019-08-06'),(1726,72,'Clase 24, Git y problemas.','La clase de hoy intente instalar el servidor de git, el cual me dio bastantes problemas como: no se dejaba configurar ni utilizar.\nAparte de esto, después de varios intentos de repararlo, intente desintalarlo y instalarlo de nuevo y me dejo utilizarlo con normalidad.','2019-08-06'),(1727,70,'STORED','Nos dieron las tareas que debemos terminar antes de Septiembre, entre ellas estàn terminar las stored procedures, cosa que no hemos podido seguir debido a que las ultimas clases han sido cortas, poco productivas o directamente canceladas debido a los cortes de luz y su posterior arreglo.','2019-08-06'),(1728,65,'Charla y codigo vista inicio','Tuvimos una charla con el jefe de proyecto, y trabaja en el código exportado de la vista inicio.','2019-08-06'),(1729,38,'06/08/19','El día de hoy aproveché para poder completar mi carpeta de campo con información de lo realizado en el sector anterior(diseño). Tambien aproveche el tiempo como para poder iniciar con la carpeta de campo del sector actual en el que me encuentro(desarrollo)  pidiéndoles a mis compañeros información sobre lo anteriormente visto. Así mismo también pude informarme mas sobre las aplicaciones utilizadas en desarrollo y su correcto funcionamiento.','2019-08-06'),(1730,86,'Problemas con el Git y solucion','Tuvimos problemas con la intalacion del git pero se puedo resolver y esta todo disponible para continuar la configuracion mañana','2019-08-06'),(1731,73,'Diseño de la vista para previas','Trabajamos en las vistas agregando un cuadro donde aparece una lista con los datos de los alumnos que tengan previas.','2019-08-06'),(1732,71,'tabla y diagrama de gantt','En el dia de hoy agregamos 5 tablas mas a nuestra base da datos, nos quedo pendiente agregar a todas las tablas el store procedure, y modificamos nuestro diagrama de gantt agregando las modificaciones hechas hasta ahora. ','2019-08-06'),(1733,54,'Diagrama de Gantt','En el día de la fecha me encargué de modificar el diagrama de gantt agregandole actividades. ','2019-08-06'),(1734,69,'6 de agosto','modificamos el diagrama de gantt, también agregamos y tablas a la base de datos.','2019-08-06'),(1735,68,'Charla de actualización y establecimiento de tareas pendientes','Tuvimos, como grupo, una charla con el jefe de proyecto en la cual establecimos las tareas faltantes, las completadas, y comparamos esto con el tiempo restante para la fecha de entrega y los requerimientos de la misma.','2019-08-06'),(1736,40,'Server infraestructura','En el dia de hoy busque tutoriales de como instalar git en ubuntu, inicie el server y compre la version instalada de Git.','2019-08-06'),(1737,66,'clase veinticuatro','Hoy trabajos en errores existentes y descubrimos uno nuevo que ya solucione junto a Florencia. aun hay errores los corregiremos las clases siguientes.','2019-08-06'),(1738,87,'Gantt','En el día de hoy estuvimos viendo qué teniamos hecho para poder seguir y tambien estuve actualizando el duiagrama de Gant','2019-08-06'),(1739,67,'Agregar Tablas','El dia de hoy hablamos con el profe sobre lo que hicimos antes de las vacaciones para refrescar un poco y sobre lo que teniamos que hacer para terminar el trimestre y con respecto al trabajo agregamos 5 tablas nuevas y averiguamos un poco de store procedure','2019-08-06'),(1740,64,'Todo Git','En el día de la fecha realice la tarea de ver como se instala, configura y se crean repositorios en el servidor de git, ya que aún no lo tenemos configurado al 100%\nEn la imagen de se puede ver como se creó un user name y un user email para subir archivos localmente a una carpeta en GIT,  luego se creó un ejemplo, ejemplo1 es la carpeta y adentro se alorarían archivos, en la imagen hay n archivo .git, lo malo fue es que queríamos pasar un archivo de la PC a una maquina virtual y eso no se puede por obvias razones, por eso todo lo que realizamos fue medio en vano ya que no aporta nada a lo que teníamos planeado para hacer.\nAhora igual veré como realizar esto mismo pero con GitHub que tiene una interfaz mucho más amigable y fácil de utilizar eso facilitaría el uso mío y de mi compañeros a la hora de subir archivos al servidor git que creemos.\n','2019-08-07'),(1741,70,'Encriptacion y STORED','Como ayer, seguimos con stored procedures y tengo algunos problemas con el Insert, agreguè dos stored màs y empecè con encriptacion MD5.','2019-08-07'),(1742,49,'vistas y charla con el grupo','En el dia hoy tuvimos una charla con el grupo para poder llegar organizarnos mejor y poder dividirnos las vistas que faltan por terminar hacer.','2019-08-07'),(1743,41,'Finalizando las vistas ','En el día de hoy nos reunimos los del área de diseño para ver que vistas teníamos ya terminadas y ver cuales faltaban para dividirnos las vistas, después exportamos las vistas finalizadas a HTML y empezamos con las vista de inscripciones junto a mi compañero Aymard.','2019-08-07'),(1744,47,'Terminé las vistas de previa y la de materias por carrera','Termine de hacer el menú desplegable para poder agregar las materias previas a un alumno mas fácil. Con esto terminado, la funcionalidad de las vistas de previa y la de materias por carrera están completas, solo faltaría cambiar la estética, pero hasta que el sector de diseño no nos lo pase no puedo seguir.','2019-08-07'),(1745,43,'Vistas exportadas','Hoy finalicé con la vista de ayer, para poder exportar ambas en una carpeta y pasarlas al grupo de gmail, y nos estuvimos organizando para crear todo eso.','2019-08-07'),(1746,87,'Permisos','En el día de hoy estuve hablando y definiendo los permisos de los usuarios que vamos a usar junto con dos compañeros de grupo y el profesor. Y También estuve actualizando el diagrama de Gantt.','2019-08-07'),(1747,66,'clase veinticinco','Hoy continué con el error de borrar y actualizar datos de la vista de personas registradas, revisamos los controladores, vistas, modelos y nada no vemos muchos errores, aunque aun desconozco como es que antes funcionaba hay una variable que no se donde esta o si existe. Es cansino.  ','2019-08-07'),(1748,38,'07/08/19','Como uno de las principales tareas que realicé en el sector de desarrollo con mis compañeros fue encontrar en mi código dentro CodeIgniter, que según mis compañeros es un bug que venia manifestando hace varias clases. Este mismo bug hace referencia a problemas que detectaron a la hora de realizar abm, a veces no se cargaban datos, otras veces no se daba la baja de un dato especifico o otros errores como falta de permisos para realizar dichas acciones.','2019-08-07'),(1749,72,'Clase 25, Dia productivo.','La clase do hoy me pase instalando los servidores de ftp, php, mysql, apache, en el servidor funcional para que el resto de los equipo puedan utilizarlo. Ademas surgieron gran cantidad de problemas, que me hicieron tardar bastante.\n\nlo único que me queda para la clase que viene es preparar la pagina para los chicos de las demás secciones y que ellos puedan subir sus datos al servidor.','2019-08-07'),(1750,68,'Mejora de la vista de Becas','Comencé la tarea de añadir funcionalidad a la vista de becas, en base a la vista y las funciones de previas. Sin embargo, continuar se dificulta sin un correcto manual de usuario, ya que la cantidad de funciones es casi exagerada.','2019-08-07'),(1751,57,'Finalización de la vista de previas y de materias por carrera','Finalizamos la vista de previas y la de materias por carrera, terminando con el dropdown menu para seleccionar la materia previa que le corresponde a cada alumno. Luego, la líder me pidió simplificar todas mis tareas realizadas al principio de este trimestre.','2019-08-07'),(1752,39,'Las vistas','En la clase de hoy tuvimos una charla con los compañeros de diseño sobre las tareas que realizaría cada uno.  Tuve unos problemas con el programa Bootstrap y lo volvi a instalar.','2019-08-07'),(1753,86,'GIT','El objetivo de hoy era crear un servidor con Git y configurarlo. Pero debido a la falta de información, tuve varios problemas por los cuales se me dificulto la realización de dicha tarea. ','2019-08-07'),(1754,71,'8/7','Terminamos los campos para las tablas faltantes para la base de datos, quedo pendiente relacionarlas y ponerle el store procedure en la snuevas tablas. Por falta de internet no pudimos averiguar bien lo de los backup y otras cosas que nos faltaban','2019-08-07'),(1755,65,'Charla de grupo','El dia de la fecha tuvimos una charla en la seccion de diseño, y estuve trabajando en el diagrama de gantt y en el manual de usuario','2019-08-07'),(1756,54,'Creación de nuevas tablas ','Hoy creamos nuevas 5 tablas nuevas e hicimos algunos insert de las mismas','2019-08-07'),(1757,52,'clase 1 en diseño','nos reunimos con todo el grupo de diseño para saber que tipo de proyecto va a realizar cada uno y después nos pusimos a ver todas las vistas pero nos aparecía un error el la aplicación y luego no tuvimos Internet ha si que tuvimos que trabajar con otro compañero','2019-08-07'),(1758,73,'diseño de la pagina para buscar alumnos en previas','trabajamos con la pagina de previas para poder buscar alumnos que estén en previas','2019-08-07'),(1759,67,'Tablas y Store Procedures','El día de hoy con el grupo de base de datos terminamos de finalizar las nuevas tablas y las agregamos a la base de datos que estaba haciendo Gian con los stores procedures.','2019-08-07'),(1760,63,'Vigésima quinta clase','El día de hoy continúe trabajando con Jhonatan sobre la eliminación de permisos, también estuvimos hablando con Eugenia sobre los diferentes tipos de permisos y la función de cada uno. \nSobre el trabajo, tratamos de buscar una solución posible, pero seguimos sin haber encontrado la forma de que no hayan errores.','2019-08-07'),(1761,38,'Manual de usuario','Como ya la mayoría de los trabajos ya  fueron asignados a los integrantes del grupo, estoy encargado de realizar el manual de usuario. Para ello, solicité los diferentes códigos realizados de php y les pedí una breve explicación a mis compañeros para poder entender que es lo que quisieron hacer con ese código así yo poder explicarlo en el manual, a su vez también insertaré diferentes fodos, cuadros para poder dar ejemplos.','2019-08-13'),(1762,43,'Mejorar la vista','Hoy faltó mi compañero así que tuve que mejorar lo que quedaba de la vista de &quot;Inscripción&quot;, pero yo creo que me salió bastante aceptable, pero creo que le faltan un par de datos que agregar, así que lo consultaré con mi compañero la próxima clase que tengamos.','2019-08-13'),(1763,64,'Git...De Vuelta','En el día de la fecha con mi compañero de grupo vamos a averiguar y realizar la instalación y la configuración del servidor Git, y realizar en un Word aparte un Manual de Usuario provisional de como instalar el GitHub en Linux y como uno debe loguearse en la página oficial del Github.','2019-08-13'),(1764,86,'GIT 2','En el dia de hoy con la ayuda de un tutorial todo pareciera poder hacerse, pero aun hay que terminaro lo mañana. \nHoy los chicos trabajaron bien, casi sin parar apesar de que no teníamos ganas. ','2019-08-13'),(1765,72,'Clase 26, Dia de investigación.','La clase hoy, me la pase haciendo investigaciones de Git, y las cosas que logre hoy mañana ya las voy a poder implementar en el servidor. Por ellos el día de mañana va lograr aun mas avances del proyecto de infraestructura.','2019-08-13'),(1766,66,'clase veintiseis','Hoy logre evitar que el error que venia afectando durante muchas clases dejase de aparecer, solo debo darle mas &quot;seguridad&quot;, también recibimos las vistas, las cuales iré viendo y combinando con el código.','2019-08-13'),(1767,49,'vistas','modificamos el menu de cada una de las vistas por otro menu, y seguimos terminando las vistas que faltan por terminar.','2019-08-13'),(1768,70,'Encriptaciòn MD5, Pantalla malfuncionando, 2 PCs sin internet','Todavía hay problemas con las PCs de mis compañeros, estàn sin internet y la unica PC funcionando es esta. Aparte de eso, mi pantalla malfunciona y se apaga si hay un movimiento brusco y cuesta prenderla de vuelta.\nEn el dìa de hoy usè encriptaciòn MD5, practicamos y agreguè password a la base de datos.','2019-08-13'),(1769,87,'Vistas','En el día de hoy el grupo de diseño nos dio las vistas que tienen para poder empezar a incorporar en la página. Todavía no pudimos agregarlas con facilidad por un problema de una carpeta de las vistas que se repite. Luego de eso, estuve hablando con un compañero, que se esta encargando de actualizar el manual de usuario, sobre las cosas que se puede agregar.','2019-08-13'),(1770,71,'13/08','El dia hoy averiguamos mas a fondo lo del backup por consulta  y verificador de datos para nuestra base de datos ','2019-08-13'),(1771,63,'Vigésima sexta clase','Hoy resolvimos el problema que teníamos hace varias clases con los usuarios, y ahora estamos tratando de agregarle una confirmación mediante javascript. También recibimos las vistas que posteriormente vamos a vincular.','2019-08-13'),(1772,54,'Investigación ','El dia de hoy nos fijamos que nos faltaba por realizar y comenzamos a investigar como hacer un backup automatico de nuestra base de datos ','2019-08-13'),(1773,69,'13 de agosto','Investigamos como hacer un backup para la base de datos. ','2019-08-13'),(1774,67,'Backup Automatico y Verificador de Datos','Hoy investigamos un poco sobre como hacer lo del backup automático y hacer lo del verificador de datos pero no encontramos mucho.','2019-08-13'),(1775,73,'Arreglo de vistas busqueda de alumnos con previas','hoy estuvimos trabajando con las vistas, tenia que arreglar algunas cosas de la pagina de buscar alumnos en previas y modificar algunas cosas','2019-08-13'),(1776,47,'Diseño de las vistas y mejora de funcionalidad','Hoy, el sector de diseño nos dio el diseño de las vistas. Continúe mejorando algunas cosas, para que sea más intuitivo a la hora de que usen la aplicación.','2019-08-13'),(1777,65,'Vista inicio y administracion de grupo','Avance con la vista inicio, y administre un poco la sección.','2019-08-13'),(1778,68,'Funciones de la vista Becas','Continuando con la tarea de la clase pasada, continué formulando las funciones relacionadas a la vista becas. Están, en principio, finalizadas, pero aún requieren correcciones.','2019-08-13'),(1779,57,'Entrega de las vistas','El sector de diseño nos entregó las vistas para poder acoplarlas con nuestro código y que quede todo junto.','2019-08-13'),(1780,52,'diseño','hoy estuve modificando las vistas','2019-08-13'),(1781,67,'Backup Automático','Hoy estuve viendo información sobre como hacer lo del backup automático y con todo eso pude hacer un archivo .bat que me hace una copia de seguridad cuando lo ejecuto pero el profe me dijo que lo tengo que hacer mediante secuencias sql entonces tendré que seguir investigando.','2019-08-14'),(1782,64,'Git, GitHub, Gantt, muchas cosas....','En el día de la fecha seguimos con la instalación en el git, pero en esta caso lo vamos a instalar directamente en el servidor, ya que se intentó desde Windows crear una cuenta en GitHub para alojar archivos en el repositorio asignado de prueba, pero eso no había que hacerse en Windows, había que hacerse directamente en la máquina que está alojada en el servidor que hay en la institución. Luego se me asigno la tarea de agregar las cosas que estuvimos haciendo en las dos últimas semanas en el Gantt, ya que no estaba completamente completo para mostrárselos a los docentes.','2019-08-14'),(1783,87,'Gantt II','Hoy seguí actualizando el diagrama de gantt y para eso me ayudé en las bitácoras de un compañero junto a las mías. Aunque no pude terminarlo por varios inconvenientes que tuve con la configuración de los días laborables.','2019-08-14'),(1784,70,'Encriptaciòn, login, problema solucionado.','El problema anteriormente mencionado fue solucionado. En el dìa de la fecha seguimos con encriptaciòn e hice unos login que desafortunadamente no funcionaron, seguirè con estos la proxima clase si se requiere, de lo contrario terminare los stored que faltan y poco màs.','2019-08-14'),(1785,40,'Github','En el día de la fecha buscamos como crear y subir archivos a github, creamos una cuenta de github para probar creando un repositorio y subir un archivo, y estuvimos buscando información y probando sobre como trabajar con github.','2019-08-14'),(1786,69,'Backup Automático','el dia de hoy estuvimos investigando sobre el backup automatico para la base de datos.','2019-08-14'),(1787,38,'Continuacion manual de usuario y video instructivo.','En el día de hoy continué con el manual de usuario explicando algunas funciones como ejemplo controller, construct, idex, etc. Ademas de eso, vi un vídeo con mis compañeros sobre validación de usuarios.','2019-08-14'),(1788,71,'investigacion','Continuamos investigando en este caso sobre el verificador de datos en varias fuentes para evitar duplicar datos, buscamos en código php y consulta sql, probamos con ambos en nuestra base  de datos para practicar pero por ahora no tenemos nada terminado con el verificador ','2019-08-14'),(1789,68,'Unión de versiones del proyecto','Para solucionar un error de una función, uní en una nueva versión del proyecto las funciones que escribieron unos compañeros en controller.php y modelo.php con las que yo había escrito para la vista de Becas en esos mismos archivos.','2019-08-14'),(1790,54,'División e investigación ','Hoy dividimos las tareas para optimizar el tiempo. Junto a una compañera nos encargamso de investigar como evitar duplicar los registros en la base de datos mediante una consulta sql','2019-08-14'),(1791,57,'No hubo avances','No pudimos implementar los archivos en las vistas que nos pasó el sector de diseño, todavía estamos en proceso de investigación para averiguar cómo combinar las vistas con nuestro código para hacerlo funcional.','2019-08-14'),(1792,47,'Intentando e investigando','Continué intentando como implementar los estilos que nos pasó el sector de diseño la clase pasada. Continuo investigando.','2019-08-14'),(1793,66,'Clase Veintisiete','Hoy flor y yo solucionamos el problema de borrar personas registradas y ademas se charlo sobre el tema de que el admin valide a los usuarios que se registren. Mi pendrive se murio :c','2019-08-14'),(1794,86,'Fin del GIT','Finalmente instale e hize funcionar correctamente el git y subir archivos desde la concola.','2019-08-14'),(1795,73,'Ultimas modificaciones ','Ultimas modificaciones de la pagina de busqueda de alumnos que tengan previas','2019-08-14'),(1796,63,'Vigésima séptima clase ','Hoy, con Chipana, logramos solucionar el problema de borrar usuarios mediante un modal y posteriormente nos informamos sobre el tema siguiente: validación de usuarios. ','2019-08-14'),(1797,65,'Vista menu gral. y aprovacion de usuario','termine con la vista menu gral. y empecé con la vista aprovacion de usuario.','2019-08-14'),(1798,72,'Clase 27, Dia de problemas con soluciones difíciles.','La clase de hoy tuve diversos problema que me dificultaron el servidor y todo su mantenimiento por lo que no pude hacer mucho.\n\nPor otro lado tuve que un inconveniente con los servidores al compartirlos atravez des servidor por lo que me impidió mostrar la pagina principal. Por estas razones tuve que instalar de nuevo ciertos servidores, lo cual era una de las soluciones que tenia planteado y al final del día de hoy termine comprendiendo que el problema estaba en un cotafuego de la configuración del myql.','2019-08-14'),(1799,75,'Reportes con PHP','En esta clase investigue sobre los reportes manejados por php. El objetivo es crean un entorno visual para que muestre al usuario una especie de libretas de notas del alumno. ','2019-08-15'),(1800,83,'noticia ','hoy me puse a completar la carpeta de campo, que me faltaba aun terminar,luego de eso lo envié.\nnos informaron que nuestro profesor sufrió un accidente y que estaría ausente dejando a cargo al otro profesor. Por lo que nos sorprendió un poco y es que todo lo que se tenia hecho lo tenia el guardado para mas seguridad, lo que uno no imagino es que le pasara tal accidente así que si bien se había terminado de hacer lo que se tenia que hacer en  su momento ... ahora no se podía avanzar  porque no poseíamos  los trabajos trabajados por eso tratamos de comunicarnos con el profesor para que nos envié el trabajo/trabajos por email, pero no a podido respondernos por el momento, y es que nos han informado hoy que nuestro líder que estaba faltando, lo siguiera haciendo por lo que el trabajo que el tenia nos tocaría resolver pero para eso se necesita los anteriores trabajos.\nOtra cosa que paso es que al final me confirmaron que asistiría a practicas externas en unas dos semanas o en tres ... eso se discute.   ','2019-08-15'),(1801,53,'Organizar','Solo organizar archivos y codigos que estaban desparramados ','2019-08-15'),(1802,58,'El dia de hoy termine la pagina','hoy termine el diseño y estilo de la pagina web que tenia que realizar, tuve algunos problemas pero los pude solucionar se los enseñe al lider y le gusto la pagina, se lo pase al pendrive y lo guardo. Tambien nos enseño a como crear un archico php y abrirlo con el xampp ','2019-08-15'),(1803,36,'termine el post con array','agregue algo que fataba y ya funciona ','2019-08-15'),(1804,82,'final y comienzo ','El día de hoy entre en trabajo de la ficha, como ya termine los trabajos que me tocaba el líder dijo que ayude a un compañero a terminar su trabajo para lo que se utilizó javaScritp para ayudar un compañero, tuvimos problemas pero pudimos resolverlo, terminamos con el trabajo y se lo entregamos al líder y dijo que estaba bien después el líder explico cómo abrir el index en PHP y aparentemente kevin perdió mi trabajo del formulario de alumno. El index parece que está en finalización. ','2019-08-15'),(1805,42,'Optimizacion de vistas','Se mejoraron los aspectos visuales y se implemento el uso de responsive para la adaptacion de la pantalla','2019-08-15'),(1806,44,'acabamos para agregar las asistencias','ya funciona el post con array','2019-08-15'),(1807,45,'tablas en materialize','hoy desarrolle unas tablas de alumno en materialize aprovechando que el líder del sector nos dio una orientación pequeña de materialize','2019-08-15'),(1808,51,'mantenimiento','hoy estuve viendo si la base de datos necesitaba algo y me puse a placticar acerca de posibles cosas que se le puede agregar a la base de datos','2019-08-15'),(1809,74,'limpieza','este día después de hace mucho tiempo pude avanzar, ayudar y solucionar el problema que tengo con los enlaces aun así estuve haciendo las vistas que tienen pequeñas cosas pero que aun así son importantes para el desarrollo del proyecto, también estuve guiando a los integrantes y dando consejos y hice una pequeña clase para que ya aprendan a abrir archivos .php y con el CDN dar estilos con materialize, en un futuro voy a aprender  a abrir los archivos de los integrantes de desarrollo para unir todo. \nya para el final hice una limpieza al ver que tenia los mismo archivos pero des actualizados  y desordenados.\na partir del día de hoy todos los integrantes de diseño tienen el archivo donde se va a poner todo solo si esta 100% bien analizando cada linea de código de esta manera las vistas de ahora y las de un futuro pueden estar conectadas, aun nos faltan mas vistas pero por suerte no son tan complicadas como las que hicimos anteriormente, solo nos llevaría tiempo pero no seria algo complicado de desarrollar por lo que pienso. \n','2019-08-15'),(1810,85,'Otra fase de pruebas para modulo dfplayer','empezamos el dia hablando con mi comañero sobre que modulos de carga de baterias de litio y cuantos  utilizar para el proyecto, una vez obtuvimos el equipo para trabajar probamos un modulo dfplayer con archivos mp3 para poder ingresar cualquier tipo de audio. hubieron algunos problemas como por ejemplo conectamos a 5v de energia y el modulo funciona solamente con 3.3 pero una vez hecha la fase de pruebas pudimos utilizar el modulo correctamente con una buena aclidad de audio y con un buen volumen','2019-08-15'),(1811,78,'Corrigiendo errores','Hoy revise lo que tenía hecho y me puse a corregir unos errores con los iframes. El problema era que no cargaba un iframe dentro de otro. Es decir, una pagina que sea de 1° de ciclo básico que tenga un iframe donde muestre la división seleccionada. Eso ya se arreglo, lo que falta es mostrar en un iframe del index cuando se seleccione un curso de ciclo básico, la lista de divisones del curso, es decir, desde un iframe del index llamar al iframe de la página con las divisiones.','2019-08-15'),(1812,46,'','el dia de hoy actualice ,i carpeta de campo y también empezamos a organizarnos(con belen) para los siguientes trabajos que tenemos q comenzar a hacer','2019-08-15'),(1813,79,'DEA, preguntas y pruebas con el dfplayer','El día hoy empece consultando al profe sobre conversares dc dc, módulos protectores/cargadores de baterías de litio (especificamente sobre modulos de dos celdas), amplificadores. El profe me recomendó que para lo que lo íbamos a usar consigamos los integrados que no son variables que son baratos y chicos, que son adecuados a pesar del ruido. Después empezamos  a trabajar en la conexión del dfplayer, tuvimos varios problemas. Para empezar me olvide el conector usb que utilizamos para alimentar el amplificador, así que tuvimos que conseguir otro. Después empece a armar el circuito del dfplayer. Tuvimos varios problemas de cablerio para empezar (confucion de cables, problemas con los puertos de la computadora, malas guías de como usar el dfplayer). Después tuvimos problemas para que encienda el dfplayer (se me paso el gnd). Después tuvimos problemas con el amplificador (otro problema de cablerio, estaba al revés la alimentación). Después, cuando encendió, tuvimos problemas de audio. Esto fue a causa de que en realidad, la alimentación del arduino no era suficiente, cosa que luego solucionamos, pero resulta después que seguíamos teniendo problemas. El dfplayer funciona aprox a 3.3v, cosa que las guías no especificaban. Pudimos darnos cuenta gracias a la ayuda del profe y después lo confirmamos con el datasheet. Probamos con otros parlantes tambien. ','2019-08-15'),(1814,64,'Git, y otras cosas Vol.2','En el día de la fecha al principio ayude a mi compañero a instalar y/o actualizar el vSphere para que pueda manipular la máquina virtual que tenemos alojada en el servidor que contamos en el aula donde estamos, así él se encarga en instalar el git en el servidor. También  investigue como crear un usuario de git, y estuve buscando en internet como llegar a realizar esta tarea, hasta que llegue a unos videos de YouTube que pude llegar a funcionar y me estuve orientando de cómo hacerlo. Cabe destacar que haya encontrado la manera de hacerlo posible, ya que se nos pasó algo que podría ser la clave de todos nuestros tropiezos. ','2019-08-21'),(1815,41,'Vista de inscripciones','En el día de hoy estuve terminando la vista de inscripciones que mi compañero Aymard no lo pudo terminar agregándole más campos de información y algunos colores ','2019-08-21'),(1816,57,'En investigación','Seguimos investigando como cargar los archivos CSS en las vistas usando CodeIgniter. No hubo solución a este problema por ardua que fue la búsqueda de variados videos y explicaciones en foros.\n\n','2019-08-21'),(1817,87,'Ultimos detalles de Gantt','Hoy terminé el diagrama de Gantt, agregué tareas, pude arreglar los errores y cosas que no me salían de la clase pasada. También estuve viendo como van los demás del grupo y fui a hablar con el líder de diseño sobre algunas cosas que tiene que cambiar porque no estamos pudiendo agregar las vistas al proyecto.','2019-08-21'),(1818,70,'Verificación de datos, monitor roto.','Hoy trabajamos con verificaciòn de datos, tratando de aprender y aplicar las mismas, un ejemplo de esto serìa que cuando un usuario quiera registrarse y quiera tener como username un nombre ya existente, este recibirìa un mensaje para que lo cambie, ademas, el monitor de mi maquina usual està roto, por lo que tuve que compartir PC con un compañero.','2019-08-21'),(1819,52,'diseño','hoy estuve editando las vistas y cambiando los estilos de las mismas también acoplando las vistas','2019-08-21'),(1820,67,'Relaciones de tablas y Backup','Hoy estuvimos trabajando con las relaciones entre tablas de la base de datos y aparte investigue un poco mas sobre el backup ademas de esto tuve que compartir pc con un compañero y el investigo un poco sobre el verificador de datos.','2019-08-21'),(1821,69,'relaciones ','El día de hoy relacionamos todas las tablas de la base de datos, las tablas que ya estaban y las tablas que fuimos agregando después. ','2019-08-21'),(1822,66,'Clase veintisiete','Hoy continuamos con el tema de la autorizacion de usuarios, y aun me queda hacer el tema de los permisos. Y bueno ya quedan solo 6 clases\ny aun debemos terminar todas las funcionalidades.','2019-08-21'),(1823,47,'Continuo intentando agregar los estilos','Seguí investigando como cargar los archivos CSS en las vistas usando CodeIgniter. Vi muchos tutoriales, o gente dejando sus códigos, pero ninguno me funciona, ni siquiera me carga un simple archivo CSS.','2019-08-21'),(1824,65,'Re modele y rehíce ','Estuve re modelando vistas de compañeros para que estén iguales y rehíce la vista de Aprovacion de usuario ya que precisaba algunos cambios.','2019-08-21'),(1825,73,'modificacion de vistas','en el dia de hoy modiciamos las vistas para poder juntar todas las vistas de los demas compañeros','2019-08-21'),(1826,63,'Vigesima octava clase','Hoy estuvimos viendo sobre la autorización de usuarios, hicimos diferentes planteos y ya para la próxima clase vamos a empezar con el que nos parece mejor opción. ','2019-08-21'),(1827,71,'relaciones','Hoy terminamos de relacionar las tablas nueva con las ya hechas anteriormente, para eso creamos un campo en común “IdAlumno”  tambien seguimos buscando el backup','2019-08-21'),(1828,86,'GIT en el servidor y PHP','Implementé en el servidor real Git y subi unos archivos exitosamente, despues de probar subir un archivo desde otra computadora intenté subir uno de PHP pero tuve problemas que por falta de timpo no pudo respolver','2019-08-21'),(1829,68,'Formulación del funcionamiento de la vista becas, y correcciones en la base de datos','El objetivo del día fue poner a punto las funciones de la vista becas. Las que ya se encuentran en funcionamiento son: mostrar becados, agregar beca, y editar.\nLas modificaciones de la base de datos se dieron por problemas al pasar los datos.','2019-08-21'),(1830,45,'finalizacion de tabla','hoy termine el desarrollo de la tabla con la información del alumno sobre sus notas y materias con sus respectivos promedios','2019-08-22'),(1831,83,'voip','hoy se nos dijo que nuestro lider que hoy se presento, se encargaria de elcorreo electronico y que los demas hicieramos \nel voip. Para eso se tenia que volver a descargar el ubunto porque nuestro profesor tenia nuestros trabajos previos incluidos el ubunto\nentonces por el momento debiamos empezar desde cero con el tema del ubunto, asi podiamos hacer el void; ya sea intalacion y configuracion.\npor el momento el ubunto esta en proceso de descarga y una vez que eso finalice, se podra proseguir con el trabajo.  ','2019-08-22'),(1832,36,'solucionando problemas de pagina','solucionando para rellenar foreignkey y creando para llenar cantidad de faltas','2019-08-22'),(1833,53,'realizar el diseño de la pagina  ','Solo utilizar boostrap y css para modificar las vistas de la pagina, todo en codigo.','2019-08-22'),(1834,51,'mantenimiento','En el dia de la fecha me puse a hacer un mantenimiento en la base de datos, me puse a buscar posibles métodos para tener la base de datos mas segura, corregí la documentación de la base de datos y me puse a completar la carpeta de campo','2019-08-22'),(1835,46,'voip','el día de hoy descargamos nuevamente ubuntu para empezar con la descarga de voip y su configuración, para eso vimos unos videos de como configurarlo','2019-08-22'),(1836,78,'nuevos archivos','El jefe de diseño me paso una nueva carpeta con cosas nuevas. Tengo que trabajar otra vez las conexiones de los iframes porque vuelvo a tener los mismos problemas que tuve anteriormente con los iframes viejos.','2019-08-22'),(1837,58,'Termine la planilla de notas ','Hoy termine la planilla de notas que me había asignado el jefe se sector además de algunas modificaciones que me hizo hacer a lo largo del trabajo pero logre terminarlo y le gusto como quedo el diseño ','2019-08-22'),(1838,75,'Modificaciones BD y boletín','En esta clase modifique la tabla &quot;notas&quot;. Es decir en vez de cargar 3 registros para cargar una nota de diferente trimestre; lo minimice en un registro agregando 2 campos más. Esto fue para pasarle una cantidad mínima de parámetros al momento de realizar el pdf del boletín. \nAl cambiar la tabla tuve que cambiar las funciones para que se adapten al nuevo cambio. ','2019-08-22'),(1839,55,'Al dia','Al tener que faltar en algunas clases por temas de salud, en el día de hoy tuve que ponerme al día tanto con mi carpeta de campo como con la base de datos, a la cual le estuve buscando errores para poder corregirlos.','2019-08-22'),(1840,42,'Conexion de vistas con el area de desarrollo','Colabore con mis compañeros de el sector de desarrollo, para hacer la conexion de las vistas. Para luego que el grupo de desarrollo vaya teniendo interaccion con ellas. ','2019-08-22'),(1841,48,'Hoy estuve ayudando a un compañero','Como sigo sin un proyecto a realizar estuve ayudando a terminar la vista de uno de mis compañeros, pudimos terminarlo y al jefe le convencio el trabajo asi que ya lo finalizamos ','2019-08-22'),(1842,50,'Vistas de usuario','Creamos dos vistas adicionales, dedicadas a la creación e ingreso de usuarios de la aplicación. ','2019-08-22'),(1843,80,'22-08','En la clase de hoy realice un formulario que solicita el e-mail y la contraseña del usuario, utilizando materialize y con un poco de ayuda de w3school.','2019-08-22'),(1844,60,'Servidor de E-mail','En el dia de la fecha se continuo con la construccion de un servidor de email, se instalo el Vshare Helpe, pero por problemas no se pudo lograr terminar.','2019-08-22'),(1845,56,'Actualizacion de vistas','actualice el diseño del index pincipal y corregi errores','2019-08-22'),(1846,85,'Estuve escribiendo codigo??','basicamente estuve escribiendo y entendiendo de manera correctael codigo utilizado para hacer las pruebas del la clase pasada, ademas de hacer algunos testeos extra sobre elfuncionamiento del modulo dfplayer\n','2019-08-22'),(1847,79,'DEA, módulos de carga, módulos de balanceo, protección y sobrecarga, posible solución con el tp4056, etc. ','Hoy empece el día investigando módulos de carga ya que los módulos que yo pensé que eran de carga, protección y balanceo (de dos celdas) no lo eran en realidad de carga. La solución es integrar las dos placas (una con carga y la otra con protección, balanceo, etc.). Estuve buscando módulos de carga de baterías de litio y no encontré ninguno para dos celdas. Investigue otras soluciones, conectarlos sin placa, etc. Pero esas opciones eran peligrosas según el profesor. Le consulte al profe sino podríamos hacer nuestra propia placa pero según el profe seria laborioso de diseñar, complicado de armar (ya que seria difícil no conseguir los componentes necesarios que no sean de montaje superficial) y si lo hacemos mal seria peligrosos también y es algo complicado de testear. Por lo tanto esta opción quedo descartada. \nDespués de investigar y pensar pase a hacerle otras preguntas al profe, específicamente que deberíamos usar para cambiar el flujo de alimentación del circuito, si relees o transistores. El profe me dijo que use transistores y que sean mosfets.\nDespués de eso proseguí en buscar una solución para el problema de las baterías de litio. Se me ocurrió usar dos módulos tp4056 y puentearlos de manera tal que este en serie para cuando el DEA no se este cargando y cuando se este cargando estén cada una siendo cargadas por su respectivo modulo y el resto del circuito este alimentado por la corriente que viene del jack. ','2019-08-22'),(1848,74,'desarrollo y diseño','este dia fue corto por el acto pero estuve moviéndome para ver los trabajamos de mis integrantes, y ya esta pasada la primera vista que tiene relación con desarrollo solo nos falta pulir las vistas ya para que el usuario lo vea.\n','2019-08-22'),(1849,79,'DEA, charla con el grupo de mecánica, almohadillas para el DEA, puertas logicas, transistores pnp npn, cambiar flujo de alimentacion','Hoy empece el día charlando con los chicos del grupo de mecánica sobre el espacio que ocuparan los componentes, su enganche en la carcasa que están desarrollando, los fichas que vamos a utilizar y su disposición (de alimentación y el potenciometro), los agujeros para estos. Después de eso me dedique a trabajar un poco en mis croquis y de ahí pasa a hablar con el profe sobre lo que hable con los chicos de mecánica y le explique sobre una idea que tenia con las almohadillas. De ahí trabaje un poco mas en mis croquis y después de dirigí en busca del profesor Mestrovich para hacerle una preguntas sobre electrónica, cosa que no puede hacer ya que no estaba en el colegio. Intente un rato mas solucionar mis dudas en los bosquejos que hacia y después me fui a la biblioteca a investigar sobre &quot;uso del interruptor del jack para conmutar de batería a cargador &quot; (algo que el profe Mestrovich dijo que buscara), cosa que no me sirvió de mucho ya que no me apareció lo que se suponía que tenia que aparecerme. Entonces busque como desviar energía con transistores (tema del que tenia dudas), cosa de ayudarme con el cambio de alimentación que tengo que hacer con las baterías. Lo que encontré de eso me sirvió así que pase a probar lo que aprendí en el emulador &quot;circuits&quot; de autodesk','2019-08-23'),(1850,41,'Cambio de diseño','En el día de hoy el profesor nos reunió para ver como veníamos con las vistas hasta ahora, también  nos comentó sobre las faltas que teníamos, y nos explico algunas cosas sobre el bootstrap. \nDespués le cambiamos un poco el diseño de las vistas para que queden parecidas.','2019-08-27'),(1851,54,'Stored procedure','Hoy empezamos a volver a hacer los stored procedure porque debido a un problema con el pendrive los perdimos','2019-08-27'),(1852,47,'Diagnostico e investigación','El profesor llamó a cada sección para ver cómo iba cada una, nos falta que sea funcional la parte de permiso de usuarios y también falta enlazar lo de sector de diseño con lo nuestro. Seguí investigando e intentando ver como hacerlo visitando distintos páginas y foros.','2019-08-27'),(1853,49,'vitas ','En el dia de hoy seguimos terminando las vistas que nos quedan por hacer y le seguimos dando los ultimos retoques.','2019-08-27'),(1854,63,'Vigésima novena clase ','Hoy tuvimos una charla con el profesor acerca de como iba el grupo, también estuvimos modificando la base de datos para usar solo una tabla en vez de dos (en la parte de usuarios). Pero ahora hay un problema con el cifrado md5 de las contraseñas, de todas formas, se pudo poner la parte del estado.','2019-08-27'),(1855,69,'Stored procedure','El día de hoy vimos tutoriales de stored procedure de nuevo para agregar a las demas tablas nuevas.','2019-08-27'),(1856,66,'clase veintinueve','Hoy se hablo sobre las fechas de entrega y todo eso. También trabajamos con las bases de datos y algunas vistas con el fin de optimizar el manejo de tablas ya que se decidió trabajar con una sola para la parte de registro y login.','2019-08-27'),(1857,64,'Registro de Áreas en la Plataforma GitHub','En el día de la fecha seguimos revisando el Git y también empezamos a registrar en la plataforma de GitHub a todas las áreas involucradas en este proyecto, Base de Datos, Diseño y Desarrollo, así se les facilita subir sus archivos a un lugar seguro y confiable. Le pedimos a cada líder de área que nos pase su email para poder registrarlos, en la siguiente clase se terminara de registrar a las áreas faltantes. ','2019-08-27'),(1858,72,'Clase 29, Dia de organización.','En esta clase me encargue de hacer un paneo general de las actividades de mi sección, ademas, comencé a definir el comienzo de nuevos proyecto de la sección. Gran mayoría de los proyecto, tareas, y actividades están terminadas.\n\nPero esto no es el final, que la mantención de los servidores y la charla de como utilizarlos, por lo que el trabajo no acabo y las próximas clases voy a estar dando los toques finales al servidor migrado.','2019-08-27'),(1859,71,'27/08','El dia de hoy llamaron a toda el área para comentar que tan adelantados estábamos desde la ultima clase. Nos dedicamos hoy investigar el stored procedure para las tablas nuevas que agregamos anteriormente','2019-08-27'),(1860,38,'Informacion de material y reunion de grupos','En el día de hoy me encargué de pedirle distintos tipos de material a mis compañeros de grupo como por ejemplo screenshots de partes de códigos para poder visualizarlos y de paso brindar información al manual de usuario. Ademas, el profesor llamó a todos los sectores para poder charlar acerca de como llevamos el proyecto. ','2019-08-27'),(1861,73,'Exportacion de vistas','En el dia exportamos las vistas para poder juntarlas','2019-08-27'),(1862,68,'Finalización de la vista becas; Reunión con el jefe de proyecto.','La vista becas fue finalizada, con la corrección de las funciones de buscar y eliminar becas.\nSe llevó a cabo una reunión con el jefe de proyecto, con el objetivo de estar al tanto de la fecha de entrega y los requerimientos, información emitida por su parte, y los avances en el proyecto y elementos faltantes, emitida por nuestra parte.','2019-08-27'),(1863,86,'Organizacion y charla.','Hoy no habia practica que se pudiera hacer asi que nos enfocamos con el Gantt con Leandro y una charla para organizarnos sobre los multi-usuarios del GIT','2019-08-27'),(1864,65,'Unificacion de las vistas.','Hoy seguí trabajando en la unificación de las vistas en un solo proyecto, llegue a meter algunas vistas y ver cómo iban quedando. Y tuvimos una charla con el jefe de proyecto sobre el tiempo que nos queda para el final del trimestre','2019-08-27'),(1865,40,'Usuarios en github ','En el dia de hoy continuamos investigando github y comenzamos con la creación de los usuarios por cada área ademas nos estuvimos organizando para terminar con lo que falta en cuanto a manual de usuario.','2019-08-27'),(1866,67,'Store Procedure','El dia de hoy comenzamos con los stores procedures de las tablas que nos faltaban.','2019-08-27'),(1867,87,'Reunion ','En el día de hoy estuvimos hablando con el profesor sobre como vamos en nuestra área, y sobre las clases que nos quedan. Luego estuve juntando los archivos de mis compañeros para dárselo a quien se está encargando del manual de usuario y también para yo poder ir agregando las vistas.','2019-08-27'),(1868,70,'Verificacion de datos','Hoy seguimos con la verificaciòn de datos, insert y stored procedures terminados con todas las tablas.','2019-08-27'),(1869,70,'Verificaciòn con notepad, phpmyadmin, ejemplos','En el dìa de hoy estuve haciendo y probando distintos ejemplos de verificacion de datos, en notepad como los login y despues, a pedido del jefe de proyecto, en phpmyadmin mismo. Al parecer ninguno de esos funciona, ya sea porque la maquina/server està malfuncionando (ya hemos tenido problemas confirmados por el jefe de proyecto) o por mis propios errores, sea cual sea la razòn, espero poder terminar con esto la proxima semana, antes de que llegue la fecha final (una o dos semanas)','2019-08-28'),(1870,66,'Clase treinta','Hoy resolvimos toda la parte del login y registro y nos hablaron de que el equipo de diseño unira las vistas con codeigniter para facilitar luego el agregado de las funciones. Ahora solo me queda por hacer la parte de poder darles permisos a los usuarios.','2019-08-28'),(1871,41,'Exportación de vistas actualizadas a html','En el día de hoy el profesor nos reunió para explicarnos sobre las cosas que deberíamos de tener ya terminadas para pasárselo a la otra área que es desarrollo para que sigan trabajando, después estuve ordenando todas las vistas y cambiándolas ya que había varias de distintos colores y tipografías y volviéndolas a exportar a html, y faltaría juntar las vistas todas en una.','2019-08-28'),(1872,47,'Finalmente encontré la solución','Finalmente con la ayuda de un compañero encontramos la forma para enlazar los estilos con las funcionalidades hechas en nuestro sector. Por lo tanto solo tengo que esperar a que el sector de diseño una todas las carpetas en una.','2019-08-28'),(1873,38,'28/08/19','Hoy con mis compañeros terminamos todo lo que vendria a ser el login, despues nos reunimos con el profesor y un integrante de diseño para explicarnos que van a unir las vistas con codeigniter para despues facilitar las vistas con las funciones. Ademas de eso sigo agregando cosas al manual de usuario para luego brindarlo.','2019-08-28'),(1874,69,'stored procedure','el día de hoy agregamos el stored procedure a casi todas las tablas de la base de datos, nos falto agregarlo en la tabla &quot;pases/equivalencias&quot; por un error que no se pudo solucionar todavía. ','2019-08-28'),(1875,52,'diseño','hoy estuve acomodando las vistas y mandándolas todas a una carpeta para poder abrirlas sin muchas extensiones hasta que se me ocurrio de mandarlas al codeigniter para que sea mas fácil abrirlas y editarlas en código para el área de desarrollo aunque tuve unos problemas con las extensiones de bootstrap para visualizarlo ','2019-08-28'),(1876,57,'Encontramos el error','Encontramos el error que tanto nos impedía avanzar, un compañero nos ayudó con esto, por lo que pudimos enlazar los estilos con las funcionalidades hechas por nuestro sector. ','2019-08-28'),(1877,64,'Dia agitado, php, auditoria, charla, etc','En el día de la fecha seguimos cargando los usuarios correspondientes a GitHub, ya que ayer habíamos empezado este trabajo y no podemos llegar a terminarlo por falta de tiempo, luego con mi compañero se nos asignó buscar como instalar el phpmyadmin ya que hubo que instalar la mayoría de servidores de vuelta en el servidor madre que tenemos físico en el aula donde realizamos nuestras tareas, por eso se nos dijo que busquemos una manera sencilla y que probemos que funcione ya que si no llegar a pasar eso, se tendría que instalar todo de vuelta. Y nadie quiere eso. También se habló de cómo sería la charla que la vamos a dar a las demás áreas acerca de cómo subir archivos a la plataforma web de GitHub y sus respectivas normas de “convivencia” dentro del mismo, ya sé que no se renombren carpetas o que se metan a carpetas ajenas de grupos que no les pertenece.\nPor suerte unos de mi compañeros encontró la solución al problema y se pudo solucionar la problemática que tuvimos por do clases, ahora solo hay que instalar el Git y hacer el usuario madre para así poder invitar a las demás áreas a participar/acceder al repositorio que hicimos para ellos, para que suban cada uno una parte del proyecto y que este concentrado en un mismo lugar.\nPara la próxima clase seguramente estaremos terminando nuestra etapa de instalación, configuración, para empezar con la etapa de mantenimiento de todo lo que logramos hacer.  \nCabe destacar que en el dia de la fecha hubo una auditoria de parte de una de mis compañeras, tendría que haber sido un secreto pero la que lo hacía era Micaela Mascialino.\n','2019-08-28'),(1878,67,'Stores Procedures y un poco de todo.','El día de hoy con el grupo de base de datos avanzamos un poco más con el tema de los store procedures que nos faltaban y aparte averiguamos sobre el tema del verificador de datos y un poco sobre el backup.\n\n\n','2019-08-28'),(1879,54,'Revisión ','En el día de la fecha me encargué de revisar que cosas nos faltan,completar, corrigiendo e investigando cosas que nos faltan','2019-08-28'),(1880,71,'stored procedure','Hoy, agregamos el stored procedure a las tablas nuevas que agregamos con basandonos con otra base de datos que teniamos ya hecha','2019-08-28'),(1881,40,'Usuarios terminados, investiagacion y pruebas','En el día de hoy finalizamos los usuarios de github para las distintas áreas, nos otorgaron la tarea de investigar sobre como instalar phpmyadmin en ubuntu y realizar pruebas en la maquina virtual ya que en se encontraban problemas en el servidor central, un compañero lo pudo resolver e hicimos la prueba de acceder desde otra pc solo que falto modificar los privilegios para todos.','2019-08-28'),(1882,73,'Exportación de vistas finales ','En el día de hoy estuvimos exportando las vistas para poder juntarlas en una misma carpeta para que quede todo en un mismo proyecto así se lo podemos mandar al área de desarrollo, y ellos trabajen con las vistas.','2019-08-28'),(1883,63,'Treintava clase','Hoy arreglamos los problemas que teníamos con el md5, también hicimos el código necesario para que cambie el estado del usuario al ser aceptado y que este salga de la vista de usuarios por aceptar.','2019-08-28'),(1884,72,'Clase 30, Arreglos','La clase de hoy me la pase haciendo distintos arreglar para que el server este terminado de una vez por todas.Puesto que el servidor migrado tuvo problemas, intale los programa de la mejor manera para que todo este en perfectas condiciones.','2019-08-28'),(1885,86,'Creacion del Manual de Usuario de GitHub','Creé un manual de usuario con imágenes, explicaciones y pasos para la creación, configuración de un repositorio. La creación, configuración y subida de archivo.','2019-08-28'),(1886,68,'Auditoría','Durante esta clase, me encargué de auditar la clase y formular un informe sobre el trabajo de cada alumno.\nLa auditoría se dividió en dos etapas; una sin conocimiento de los participantes, y otra con el mismo, para comparar las actitudes.','2019-08-28'),(1887,44,'Terminamos el agregar alumnos.','pudimos solucionar algunos inconvenientes que surgieron en el desarrollo de agregar alumnos.Ya que no cargaba el foreing key porque mandaba un solo id','2019-08-29'),(1888,36,'solucionamos el problema en el insert del formulario con array ','no podia cargar el foreign key porque me mandaba un solo id pero solucionado. Me ayudo el gran profe olaso mis respetos hacia el.','2019-08-29'),(1889,74,'terminando mas vistas, problema complicad0','este dia se estuvo terminando vistas frinde ayuda, hice que mis integrantes tengan tareas para hacer, estuve buscando informacion de como arreglar un problema que nos deja muy trabados al ser una vista muy importante pero no obtuve resultados sin embargo ya vamos haciendo muchas cosas, somo muchos y ya no hay tantas vistas nuevas para hacer asi que como lider simplemente mande a que hagan la carpeta de campo. ','2019-08-29'),(1890,74,'terminando mas vistas, problema complicad0','este dia se estuvo terminando vistas frinde ayuda, hice que mis integrantes tengan tareas para hacer, estuve buscando informacion de como arreglar un problema que nos deja muy trabados al ser una vista muy importante pero no obtuve resultados sin embargo ya vamos haciendo muchas cosas, somo muchos y ya no hay tantas vistas nuevas para hacer asi que como lider simplemente mande a que hagan la carpeta de campo. ','2019-08-29'),(1891,53,'Plugins ','Buscar código para colocar algunos plugins que ayudan a que sea mas rápido a la colocación de algunas opciones que proporciona la pagina, se encontraron métodos pero de la muchas paginas que se buscaron todas daban error ','2019-08-29'),(1892,80,'Login','En la clase del día de hoy termine de configurar el código para la pagina de inicio donde el usuario ingresara su email y contraseña. También avance en el desarrollo de mi carpeta de campo.','2019-08-29'),(1893,51,'cosas varias','En el día de la fecha lo que hice fue ver la base de datos ya que la modificaron, agregué un poco de información a la documentación e implemente cosas en mi carpeta de campo','2019-08-29'),(1894,45,'carpeta de campo','hoy complete carpeta de campo de las clases anteriores debido a que se perdió','2019-08-29'),(1895,82,'modificaciones del proyecto','El día de hoy  pregunte al líder que hacer ya que termine el trabajo que me tocaba dijo que hiciera mi carpeta porque ya terminamos casi todo el proyecto también que por el momento ayude a los de más , si no terminaron pero ya todos habían terminado sus trabajos aparentemente , por lo cual agregue y cambia cosas de mi carpeta de campo hasta que el líder llego tarde y dijo que el grupo de desarrollo tuvo problemas con las vistas, algunas había que rehacer.me dijo que mi vista no funcionaba del todo y que hiciera algunos cambios, después vino el líder de desarrollo, pregunto a cada integrante que estaba haciendo.','2019-08-29'),(1896,48,'Hoy nos dieron nuevos trabajos','Hoy estuve completando mi carpeta de campo, tambien respondiendo un par de 