,'En el dia de la fecha continue con el manual de usuario prosiguiendo con lo mismo que hice en las bitacoras anteriores, es decir continue insertando varias capturas ya que la persona encargada de las vistas de proyecto las hizo y finalmente puedo continuar con el proyecto mucho mejor.\r\nAdemas hoy arregle imperfeciones de los Html.\r\nCon mis compañeros de proyecto nos pusimos de acuerdo en como sera el dia de mañana ya que tenemos que presentar varias cosas!\r\n','2021-07-01'),(3155,171,'Presentación del Proyecto','En el dia de hoy presente el proyecto, y tuve que realizar cambios en el ultimo momento, ya que mañana vendran lo de la DEP, alistar mi carpeta de campo y la word de la presentación del Proyecto con ayuda de mis compañeros','2021-07-01'),(3156,173,'Terminado del ganttt yrevision ','Terminamos de poner el tiempo que tomara cada tarea con su receptivas fechas y demás,  se reviso el código del bot donde se agregaron mas preguntas para que pueda reconocer y ampliar su vocabulario. ','2021-07-02'),(3157,172,'Clase 2/6','En el día de la fecha vamos a recibir a un supervisor de la DET que va a estar comprobando nuestro trabajo en el proyecto grupal hasta ahora. Tuvimos tiempo suficiente de terminar nuestro diagrama de Gantt y el Foda','2021-07-02'),(3158,169,'Maps','Sigue sin funcionar.','2021-07-02'),(3159,179,'Realización en grupo','En el día de la fecha pude resolver mis conflictos que tenia con el diagrama de Gantt, tenia un problema con la tarea sucesiva que me des configuraba todas las fechas de las tareas que hice, es un programa un poco complejo de usar el GanttProject pero le agarras la mano y ya te la sabes toda.\r\nAdemas hoy con mis compañeros terminamos de hacer la presentación inicial del proyecto de &quot;Aprende Conmigo&quot; en el que nos pusimos de acuerdo en las próximas tareas que quedan del proyecto. Cada vez queda menos, supones que ya estará para agosto. El mes que viene tendríamos el proyecto finalizado. Ahora estamos arreglando varias imperfecciones que quedan.\r\nEn mi parte de la presentación tuve que escribir acerca de la plantiamento del problema del proyecto, la problemática seria que los alumnos no entren a las clases.','2021-07-02'),(3160,177,'trabajo de redacción ','el día de hoy e estado trabajando el la redacción del una justificativo para el proyecto grupal, ademas de continuar con la modificatorio del logo para adecuarlo a la nueva paleta de colores en el pagina ','2021-07-02'),(3161,171,'Presentación del proyecto','En el día de hoy armamos en equipo la presentación y empece a crear la tapa y parte de lo que me tocaba escribir, lego aliste las vista y vi que eran un poco colorido, entonces pensé en cambiar los temas de colores un poco mas colores pasteles o oscuros','2021-07-02'),(3162,174,'Dia 02 del 7 de julio','el dia de hoy nos preparamos para para presentar el proyecto al inspector de curso para ver como vamos con el proyecto.\r\nA dia de hoy tenemos el codigo como si fuese un chat de whatsapp ','2021-07-02'),(3163,201,'grupo de parkinson','Continuamos con el grupo de la escuela para poder encargarnos del codigo en plano de nuestra tarea que esta media avanzada para poder publicarlo en google y poder acceder y nos muestre el mapa','2021-07-02'),(3164,202,'02/07/2022','Estuvimos preparando el proyecto en grupo para el checkpoint del bot','2021-07-02'),(3165,189,'8-07','Hoy continuamos con el proyecto, fue un dia bastante productivo, aunque difícil ya que con mi grupo nos costó mucho hacer la página medianamente funcional, y nos tuvo que ayudar el profesor, pero a fin de cuenta logramos nuestro cometido del día de la fecha','2021-07-08'),(3166,190,'8-07','hoy lo que hicimos fue continuar con el proyecto grupal de la pagina para nuestro colegio, logramos avanzar bastante sobre el mismo.','2021-07-08'),(3167,191,'Buscando mas informacion','En el dia de hoy nos acercamos mucho mas en el objetivo, que es especificamente el que al tocar una imagen o un objeto se mueva hacia un lugar en especifico, encontre algunos links, pero ninguno te decia especificamente como hacerlo.','2021-07-08'),(3168,194,'Proyecto','Hoy seguimos trabajando con el proyecto.','2021-07-08'),(3169,198,'','Investigue como se arrastra y suelta un objeto y también investigue como mover un div haciendo clic con el mouse todo con JavaScript','2021-07-08'),(3170,192,'Proyecto en clase','Hoy dia 08/07 seguimos presencialmente con el proyecto de la red social, investigamos mas sobre otras caracteristicas para agregarle y como solucionar problemas en el index, login y iniciar sesion, ','2021-07-08'),(3171,195,'funcionalidad de los ejercicios de la pag','estuvimos trabajando todo el equipo en poner a funcionar ejercicios para la pag, ejemplo: el codigo correcto se dividira en 4 partes desordenadas y al hacer clic se va a un lugar, si te das cuenta que esta mal podes sacarlo, al hacer de nuevo clic y volvera esa parte abajo donde comenzo. ','2021-07-08'),(3172,163,'Checkpoint Julio','Checkpoint julio más gráfico de casos de uso','2021-07-13'),(3173,161,'Clase N°21 13/07/2021','El dia de hoy el profesor nos explico brebemente que es un diagrama de de entidad relacion ademas de decirnos los proximos objetivos para el siguiente chetpoint','2021-07-13'),(3174,166,'Testeos','Hoy ya empecé a testear hosteando la vista con el código javascript en glitch.com y al principio la página se quedaba en &quot;Loading, please Walt...&quot; pero se solucionó actualizando algunos links.','2021-07-13'),(3175,161,'clase 21 14/07/2021','en la clase de hoy actualize la carpeta de campo ademas de buscar algo mas de informacion sobre nodejss y la conexion a moongo','2021-07-14'),(3176,177,'dia de escuela','el dia de hoy trabaje mucho','2021-07-16'),(3177,170,'Vistas','Finalizamos las vistas, mejoramos la presentación del foda y empezamos la programción para la unión entre las base de datos con el programa.','2021-07-16'),(3178,174,'dia 16 de julio','el dia de hoy agregamos mas preguntas al chatbot','2021-07-16'),(3179,179,'Trabajos pendientes y propuestas durante y despues del receso invernal 2021','En el dia de la fecha estuve con mis compañeros de escuela poniendonos de acuerdo con lo que queda y lo que tenemos que seguir haciendo durante el receso invernal 2021 de nuestro proyecto de &quot;Aprende conmigo&quot;.\r\nMi trabajo sera terminar el manual de usuario ya que por fin tengo todas las vistas de la aplicacion web y entonces podre terminar mi manual de usuario para que las persones con poca experiencia en las computadoras y el mundo tecnologico en general puedan acceder sin nungun tipo de problema, el manual o guia de usuario sera muy util para aquellos que tengan dudas del funcionamiento de este. \r\nEl manual estara ya disponible aproximadamente el 2 de agosto, cuando termine el receso invernal.','2021-07-16'),(3180,176,'Cambio de Trabajo Practico a Bolsa de Trabajo','El dia de hoy junto con mis compañeros realizamos el FODA y el prototipado rapido del Nuevo Trabajo Practico Bolsa de Trabajo para el colegio el cual consiste en crear perfiles de usuarios para que las empresas puedan contactarnos al finalizar 6to.','2021-07-16'),(3181,173,'16 de julio','hoy agregamos mas preguntas al chat','2021-07-16'),(3182,171,'Receso Invernal','En el dia de hoy, ayude a mis compañeros a realizar sus trabajos y empezamos a instalar codeigater para su perfecto uso y su configuración exacta, y arreglar el logo de nuestro proyecto','2021-07-16'),(3183,173,'5 de agosto','Revisamos el codigo por si nos faltaba agregar mas cosas para ampliar las respuestas a consultas de las personas','2021-08-05'),(3184,174,'5del8','el dia de hoy con mi grupo charlamos que podiamos mejorar lpara la pagina web.\r\nvamos a mejorar la presentacion ya que lo que es html y css esta todo completo con sus respectivas preguntas.','2021-08-05'),(3185,170,'Configuracion','Configuramos la pagina/aplicación para poder poner las vistas conectadas y tuvimos inconvenientes pero lo solucionamos, y después tenemos inconvenientes con las imágenes pero ya sabemos cual es el problema por lo que la siguiente clase lo arreglaríamos.','2021-08-05'),(3186,190,'5/08 ','El día de hoy lo que hicimos fue continuar con el proyecto de la red social para el colegio, trabajamos con boostrap studio y visual studio.','2021-08-05'),(3187,176,'Bolsa de Trabajo','El dia de la fecha trabajamos con nuestra bolsa de trabajo , perfeccionamos las vistas y creamos sus respectivos links','2021-08-05'),(3188,179,'Vuelta a clases','En el día de la fecha volvimos a clases y nos pusimos a reanudar los contenidos que previamente habíamos analizados y trabajado antes del receso invernal del año 2021, actualmente estamos en el 2do cuatrimestre del año, es decir la segunda parte del año.\r\nEn esta clase de practicas profesionalizantes continué con los que ya hacia anteriormente, es decir que segui avanzando con el manual de usuario y mi carpeta de campo, añadí capturas, cambie pequeñas cosas y pequeñas imperfecciones pero significativas en todos los casos de las vistas enviadas por mi compañera de clases Daiana Alvarez. \r\nEn fin hoy fue una clase muy buena ya que estamos terminando el proyecto de aprende conmigo!','2021-08-05'),(3189,177,'de regrezo a clace ','hoyn he dormido','2021-08-05'),(3190,171,'Proyecto','En el día de hoy empecé a realizar mi carpeta de campo y coordinar e investigar como estamos en nuestro proyecto de pagina y empezar a codificar con CodeIgniter, ayudando a mi grupo a poder seguir avanzando en nuestro trabajo. ','2021-08-05'),(3191,172,'Clase 5/8','En el día de la fecha nos juntamos con nuestro grupo para seguir añadiendo lineas a nuestro código. Para asi tener mas respuestas a las consultas que ingrese el usuario.','2021-08-05'),(3192,192,'Proyecto en clase presencial','El dia de hoy 05/8/2021 avanzamos con todo el proyecto, por sobretodo con la pagina principal, añadiendo y cambiando cosas, utilizando bootstrap y tambien usando codigo de texto normal para cosas como los tamaños y resoluciones de imagenes principales. Tuvimos complicaciones con el tema de la resolucion y el tamaño de la pagina principal, dado que bootstrap no nos dejaba, por lo que lo modificamos con atom y pudimos solucionarlo.','2021-08-05'),(3193,189,'5/8','El dia de la fecha continuamos con el proyecto haciendo la vista principal en bootstrap, haciendola mas vistosa y funcional, tuvimos complicaciones pero el profesor nos ayudó y pudimos avanzar','2021-08-05'),(3194,170,'Conexiones de la pagina','Seguimos conectando cada vistas de la pagina, y tuvimos un inconveniente para poder cambiar parte del diseño de la vista de curso. ','2021-08-06'),(3195,179,'Segundo dia vuelta a clases','En el dia de la fecha, continue con mi trabajo de el manual de usuario o tambien conocida como la guia de usuario para que todas aquellas personas con dudas acerca de una pagina web o aplicacion web puedan resolver y solventar todas aquellas dudas de cualquier indole sobre la pagina web, es decir la pagina Aprende conmigo.\r\nContinue con mi trabajo reiteradas veces, es decir continue con el manual añadiendo capturas de pantalla y especificando cada parte de la aplicacion web de mi proyecto y de mis compañeros de escuela de la tecnica 32 de 14. \r\nPor suerte cada vez queda menos que hacer y estoy agradecido con todos y todas por este año lectivo del 2021¡¡¡¡¡','2021-08-06'),(3196,177,'trabajo de imagen','el día de hoy reanude mi trabajo del proyecto de la pagina web','2021-08-06'),(3197,174,'dia 6 del 8','El dia de hoy creamos nuevas vistas para la paigna del chatbot del colegio asi se hace mas didactico y mas lindo para la gente que lo pueda ver.\r\ncon bootstrap creamos la vista de inicio y maquetamos las paginas de contactos, chatbot e inicio ','2021-08-06'),(3198,172,'Clase 06/08','El dia de hoy creamos nuevas vistas para la paigna del chatbot del colegio asi se hace mas didactico y mas lindo para la gente que lo pueda ver.\r\ncon bootstrap creamos la vista de inicio y maquetamos las paginas de contactos, chatbot e inicio ','2021-08-06'),(3199,171,'Carpeta de Campo','En el dia de hoy realice mi seguimiento de la carpeta de campo y ayude a mi compañeros en algunas configuraciones, luego empezare a realizar algunos detalles que faltan en nuestro proyecto, y realizamos el logo de nuestro proyecto.','2021-08-06'),(3200,197,'INSTALACION UBUNTU EN VSPHERE ','Descarga de ubuntu en un usb, abrimos el vsphere client configuramos la virtual machine, cuando ya la tenemos lista nos dirigimos a getting started y despues a options, boot options y le hacemos click en force BIOS Setup. Luego iniciamos la maquina virtual y ponemos usuario y contraseña y idioma. Le damos en siguiente y esperamos a la instalacion.','2021-08-06'),(3201,173,'6 de agosto','El dia de hoy creamos nuevas vistas para la paigna del chatbot del colegio asi se hace mas didactico y mas lindo para la gente que lo pueda ver.\r\ncon bootstrap creamos la vista de inicio y maquetamos las paginas de contactos, chatbot e inicio ','2021-08-06'),(3202,204,'Comienzo proyecto','Ideé mi proyecto y comencé a realizar el código del mismo.','2021-08-06'),(3203,182,'Practicas Profesionalizantes - 11/8','El día de la fecha se realizó un análisis e investigación acerca de &quot;formik&quot; implementándolo en el formulario correspondiente para darle una apariencia mucho mas simple y estética, este formulario realizado con formik, reemplazo el anterior formulario realizado en React','2021-08-11'),(3204,187,'dia ??','Este dia avanzamos con la pagina planeando mejor como realizar el projecto y seguimos investigando como usar una raspberry en el projecto de acuaponia. ','2021-08-11'),(3205,164,'Empezamos la base datos','El día de hoy realizamos un diagrama sobre nuestra base de datos la cual se encuentra ya casi completada y le faltan algunos retoques.','2021-08-11'),(3206,188,'proyecto acuaponia','El día de hoy nos dedicamos a investigar sobre la placa raspberry pi y sobre los sensores que utilizaremos en el proyecto, aparte de corregir el código y modificar algunas funciones.','2021-08-11'),(3207,161,'Clase N°2 11/08/2021','El dia de hoy los profesores revisaron mi avance en la carpeta de campo del proyecto ademas de charlar con mis compañeros de grupo sobre el css de la pagina','2021-08-11'),(3208,181,'Acuaponia','El día de hoy nos dedicamos a investigar sobre la placa raspberry pi y sobre los sensores que utilizaremos en el proyecto, aparte de corregir el código y modificar algunas funciones.','2021-08-11'),(3209,168,'Diagrama de la base de datos','Comenzamos la creación del diagrama de la base de datos con draw.io, dentro de ella pusimos las categorías que necesitaremos para llevar adelante el proyecto.','2021-08-11'),(3210,166,'Desarrollo y pruebas','Hoy trabajamos en la parte del marcador y el objeto 3d del proyecto, empezó como un dinosaurio chiquito, pero se pudo mejorar haciendo pruebas de escala, rotación y posición.','2021-08-11'),(3211,170,'Armado de nuevas vistas','Hicimos nuevas vistas y mejoramos otras ya realizadas. Enlazamos las vistas nuevas y hicimos la realizacion de la base de datos','2021-08-12'),(3212,179,'Variedad','En el dia de la fecha hoy he hecho varias cosas respecto al proyecto de aprende conmigo de la materia de practicas profesionalizantes. Con mi compañera de proyecto la señorita Daiana Elizabeth Alvarez Ayllon hicimos la base de datos de el proyecto, creando diversas tablas como register, inicio, contactanos, usuarios, etc. En esas tablas cargamos diversos datos como nombres, apellido, año de nacimiento, edad, materia que sea necesaria inscribirse, email, contraseña, entre otras.\r\nAdemas continue con mi carpeta de campo personal y el manual de usuario del proyecto, principalmente añadi capturas de pantalla de la base de datos, tablas, y de los insert.\r\nIncluso estamos pensando modificar un poco el logo de nuestro proyecto informatico que se llama &quot;Aprendé conmigo&quot; y quisimos añadirle una nueva bombilla, es decir una lampara o tambien conocida popularmente por la poblacion Argentina y de muchos paises de latinoamerica, me refiero al nombre de &quot;FOCO&quot;\r\n','2021-08-12'),(3213,171,'Creando base de dato','En el día de hoy termine de arreglar algunos cambios en las vista, y cree la pagina de comentarios de nuestro proyecto para cada materia y con mi compañero creamos la base de datos e investigamos un poco sobre las conexiones entre tablas (materias, registrarse, materias con los datos del usuario, sistemas de comentarios de preguntas y respuestas) luego insertamos algunos datos en cada tablas. Después acordaremos en crear un nuevo logo.','2021-08-12'),(3214,177,'trabajo de miradassssss','hoy e mirado para poder evaluar mi función en el proyecto trabajado actualmente, sin resultados. \r\nFFFFF ','2021-08-12'),(3215,173,'12 de agosto','en el dia de la fecha hicimos la vista de inicio y corregimos el inicio, colocamos todos los links en sus respectivo botones, agregamos preguntas ','2021-08-12'),(3216,175,'BOLSA DE TRABAJO','El dia de hoy estuvimos trabajando con el cierre del proyecto, aunque tuvimos unos problemas con errores de codigo y errores en bootstrap studio\r\nnos falta completar el login, register y el log out. y vincular la base de datos con el proyecto','2021-08-12'),(3217,174,'dia 12 8','en el dia de la fecha hicimos la vista de inicio y corregimos el inicio, colocamos todos los links en sus respectivo botones, agregamos preguntas ','2021-08-12'),(3218,195,'scala y onlick de nuevo ','investigamos este nuevo lenguage que podria ser util, y otra ves volvimos con el tema del onclick(). aparte completamos la carpeta de campo personal','2021-08-12'),(3219,172,'12 del 8','en el dia de la fecha hicimos la vista de inicio y corregimos el inicio, colocamos todos los links en sus respectivo botones, agregamos preguntas ','2021-08-12'),(3220,202,'12 8','en el dia de la fecha hicimos la vista de inicio y corregimos el inicio, colocamos todos los links en sus respectivo botones, agregamos preguntas ','2021-08-12'),(3221,176,'BOLSA DE TRABAJO','El dia de hoy pulimos la pagina principal de los estudiantes , redimencionando las fotos y el texto. Al terminar la clase empezamos a vincular y crear la respectiva Base de Datos','2021-08-12'),(3222,190,'12/08','El día de hoy, lo que hicimos fue realizar la carpeta de campo grupal. \r\n','2021-08-12'),(3223,192,'Proyecto PP','Hoy seguimos en grupo agregando contenido a la pagina de bienvenido, inicio y registrarse, y tambien nos centramos mas en la carpeta de campo porque muy pronto se va a realizar uin checkpoint y ya tenemos todo listo para poder presentar.+\r\n\r\n','2021-08-12'),(3224,192,'Proyecto PP','Hoy seguimos en grupo agregando contenido a la pagina de bienvenido, inicio y registrarse, y tambien nos centramos mas en la carpeta de campo porque muy pronto se va a realizar uin checkpoint y ya tenemos todo listo para poder presentar.+\r\n\r\n','2021-08-12'),(3225,190,'12/08','El día de hoy, lo que hicimos fue realizar la carpeta de campo grupal. \r\n','2021-08-12'),(3226,190,'12/08','El día de hoy, lo que hicimos fue realizar la carpeta de campo grupal. \r\n','2021-08-12'),(3227,192,'Proyecto PP','Hoy seguimos en grupo agregando contenido a la pagina de bienvenido, inicio y registrarse, y tambien nos centramos mas en la carpeta de campo porque muy pronto se va a realizar uin checkpoint y ya tenemos todo listo para poder presentar.+\r\n\r\n','2021-08-12'),(3228,171,'Carpeta de Campo','En el día de hoy realice la carpeta de campo, ordenando los días cronológicamente, algunos cambios y detalles ortográficos, escribiendo los links de fuente de información e investigación, luego tome capturas de las vistas y describiendo cada una de ellas mostrando así como fue cambiando cada momento hasta la fecha.  ','2021-08-13'),(3229,179,'Carpeta de campo','En el día de la fecha estuve toda la tarde del viernes con mi carpeta de campo personal, estuve agregando capturas de pantalla de las vistas del proyecto &quot;Aprende conmigo&quot; y describiéndolas y agregando algún que otro comentario. Fui explicando los cambios que hice en mi carpeta de campo, lo errores que tuve y que actualice.\r\nCambien puse una captura de pantalla de el código de la vista, era de una etiqueta &lt;p&gt; que decía &quot;lorem ipsus..&quot; en latin me parece, entonces la cambie a una descripción correcta y como debe ser de las materias asignadas que eran matemáticas, historia y la posibilidad de añadir una nueva materia si así lo deseas o lo quieres. Las descripciones las tome de paginas webs como\r\n&quot;https://definicion.de/historia/&quot; donde es una enciclopedia, como una wikipedia hasta una biblia para algunos internautas informaticos, geeks apasionados por la tecnología y las computadoras, casi no hace falta buscar definiciones en un tipico y normal diccionario, Internet lo tiene todo!!','2021-08-13'),(3230,177,'nada nada','nada nada nada','2021-08-13'),(3231,176,'BOLSA DE TRABAJO','El dia de hoy casi ni pudimos trabajar porque la pc andaba para atras y apenas pudimos modificar el login','2021-08-13'),(3232,189,'13-08','El día de la fecha continuamos con la carpeta de campo','2021-08-13'),(3233,173,'13 de agosto','En el dia de la fecha, al entrar al drive donde guardamos nuestro progreso en el proyecto nos encontramos con que no guardamos los archivos actualizados y estan en un pendrive en manos de un compañero el cual no vino y no vendra hasta el viernes de la semana que viene. De igual manera estuvimos pensando ideas para implementar al bot.','2021-08-13'),(3234,172,'Clase 13/08','En el dia de la fecha, al entrar al drive donde guardamos nuestro progreso en el proyecto nos encontramos con que no guardamos los archivos actualizados y estan en un pendrive en manos de un compañero el cual no vino y no vendra hasta el viernes de la semana que viene. De igual manera estuvimos pensando ideas para implementar al bot.','2021-08-13'),(3235,175,'DUDAS','hoy estuvimos aclarando dudas, y hablando sobre como podemos terminar el login y la base de datos','2021-08-13'),(3236,201,'GRUPO','Estuvimos continuando con el proyecto, nos dificulto en la parte de la base de datos poder ingresar, pero añadimos nuevas tablas para poder terminar con lo que estuvimos ayer, para podercargar la pagina y los botones cuando se aplican para poder trabajar','2021-08-13'),(3237,204,'Arregle errores y agregué unos SVGs','Corregí unos errores que hacían que independientemente de la cuenta con la que te loguees, mostraba la misma base de datos. también agregué SVGs al menú para cerrar sesión, añadir registros y filtrar.','2021-08-13'),(3238,192,'Proyecto PP','En el día de la fecha terminamos de hacer unos cambios en lo que sería el &quot;bienvenido&quot; que da la página una vez se accede con el login, y sobretodo nos centramos en terminar la carpeta de campo, añadiendo contenido de lo realizado entre ayer y hoy para así completarla.','2021-08-13'),(3239,203,'Creación de diagrama de la DB','Creamos el diagrama de la base de datos pública en Lucidchart. Incluye las 4 colecciones.','2021-08-17'),(3240,188,'organización de la carpeta','Hoy estuvimos organizando y codificando las modificaciones necesarias para que nuestra pagina sea responsive ,y de paso estuvimos escribiendo la carpeta de campo.\r\n\r\n\r\npd:Lautaro Arroyo hizo un buen trabajo','2021-08-17'),(3241,182,'	Practicas Profesionalizantes - 17/8','El dia de la fecha realizamos el diagrama de la base de datos con tablas no relacionales, indicando los campos y los valores que reciben cada uno en dicho caso','2021-08-17'),(3242,168,'Avance en la carpeta de campo','Junto a mis compañeros de proyecto retomamos la carpeta de campo, llenando con la nueva informacion e imagenes el archivo de word.','2021-08-17'),(3243,187,'dia ???','Hoy investigamos con respecto a la base de datos y realizamos una investigacion con respecto a la codificacion con respeco a raspberry.','2021-08-17'),(3244,164,'Actualizacion de la carpeta de campo','el dia de hoy nos pusimos al dia con la carpeta de campo modificando en la carpeta asi quedaba bien','2021-08-17'),(3245,184,'&gt;&gt; Bitácoras en conjunto','Bitácora 17/08\r\nTítulo: Ingreso de nuevos registros\r\nDescripción: Adapté los formularios Formik para que el administrador pueda agregar nuevos registros. Implementé validaciones de datos, preview de imágenes y envío de información en formato json.\r\n\r\nLas siguientes bitácoras no han podido cargarse en su momento puesto que esos días no se habilitó su subida:\r\n\r\nBitácora 22/06\r\nTítulo: Rediseño de las páginas de contacto y preguntas frecuentes\r\nDescripción: Hice un rediseño de estas páginas puesto que los anteriores no coincidían con el estilo de la página y rompían con la estética del branding. Al igual que la semana pasada, agregué la lectura de objetos json para su exhibición.\r\n\r\nBitácora 23/06\r\nTítulo: Continuación del trabajo de ayer\r\nDescripción: Continúe el trabajo de ayer terminando con un diseño de la página más sutil, flexible y cómoda a la lectura del usuario. Cambié el formato de la exhibición de las preguntas y respuestas donde muestre las preguntas y al hacer clic en ellas despliegue la respuesta.\r\n\r\nBitácora 30/06\r\nTítulo: Animación de iconos para la tarjeta del formulario de login\r\nDescripción: Trabajé en una animación sencilla de keyframes para la carta de inicio de sesión y registro de usuarios. Simplemente es una animación decorativa que añada de manera resumida lo que puede esperar el administrador en el dashboard.\r\n\r\nBitácora 06/07\r\nTítulo: Formato y presentación de las cartas de noticias\r\nDescripción: Incorporé funciones para que puedan crearse estas cartas de una manera más flexible con componentes y contenido flexible. De mismo modo, este contenido es ordenado y limitado al tamaño más óptimo.\r\n\r\nBitácora 03/08\r\nTítulo: Categorías de la página de contacto\r\nDescripción: En lugar de diseñar una página para contactar a los administradores decidí implementar formularios con las casillas correspondientes a la categoría que decida ver el usuario. El mismo botón que enviaba al usuario a la antigua vista ahora lo redirecciona a esta categoría en la página de contacto. Las opciones para mostrar son: Legal, Colaboración Voluntaria, Patrocinio o Relación Empresarial, Problema Técnico y Consulta General.\r\n\r\nBitácora 04/08\r\nTítulo: Resize del header\r\nDescripción: Debido a que la navegación es continua el usuario deberá ver la información que solicite. Por eso, ahora al cargar una nueva vista el header que contenía la ilustración y el encabezado ahora se verá reducido en tamaño y únicamente muestra el fondo y las partículas.\r\n\r\nBitácora 07/08\r\nTítulo: Corrección de estilos y breakpoints del carrusel\r\nDescripción: Modifiqué la estructura y el funcionamiento del carrusel que exhibe al equipo de trabajo.\r\n\r\nBitácora 11/08\r\nTítulo: Envío de formulario en formato json\r\nDescripción: Utilicé el módulo Formik, un módulo que integra formularios y su respectivo funcionamiento en javascript, implementándolo en la interfaz de administrador para que los valores y los datos escritos puedan guardarse o exponerse como un objeto.\r\n','2021-08-17'),(3246,161,'Clase N°23 18/08/2021','el día de hoy realizamos varias pruebas con la conexión a la base de datos además de buscar como hacer que el usuario pueda agregar valores a los campos de moongo\r\n','2021-08-18'),(3247,166,'Objeto animado','Hoy conseguimos hacer que el objeto 3D, en este caso el personaje Wall·E haga sus animaciones.','2021-08-18'),(3248,182,'Practicas Profesionalizantes - 18/8','El dia de la fecha fue destinado a la realización y coneccion de la base de datos a través de mongo DB','2021-08-18'),(3249,167,'Carpeta de campo','lo del titulo','2021-08-18'),(3250,203,'Trabajo con node.js','En el día de hoy instalamos la base de datos en el localhost de una computadora de la escuela, y probamos a realizar algunas consultas con Node.','2021-08-18'),(3251,164,'La fuente de datos de nuestra base de datos','El dia de hoy buscamos servidores de anime los cuales nos proporcionen los datos que necesitamos para poder llenar nuestras bases de datos, obteniendo asi una pagina la cual adeas de tener los datos que buscamos tenia mas de lo que queriamos.','2021-08-18'),(3252,168,'Recuento de informacion db','Hoy estuvimos junto a nuestro grupo buscando información acerca de servidores que contengan los capítulos de respectivos animes. Encontramos muchas paginas e información que será subida a la carpeta de campo próximamente.','2021-08-18'),(3253,200,'Avance del proyecto grupal','Hicimos funcional toda la nueva vista principial(welcome), tanto como los botones de logout y cambio de contraseña, como también el pie de página que contiene la página oficial del colegio, las respectivas carreras con sus planes de estudio y las redes de la escurla','2021-08-19'),(3254,170,'Enlace de base de datos','En el dia de hoy estuve tratando de conectar la base con el programa también usando un código para registrarse y que quede guardado en la base y poder iniciar sesión','2021-08-19'),(3255,189,'Avance del proyecto','El día de la fecha hicimos funcional la vista principal (welcome), donde también retocamos todo el proyecto para tenerlo casi listo, agregando funciones como el pie de la página y el poder agregar un avatar.','2021-08-19'),(3256,176,'Bolsa de Trabajo','El dia de hoy estuvimos realizando la configuracion del login , creando las tablas para el login y para subir un perfil al home de la pagina. Al finalizar el dia solo llegamos a terminar el login funcional pero la subida de archivos no quedo totalmente funcional.','2021-08-19'),(3257,171,'Presentimiento del Proyecto ','En el día de hoy comencé a editar La presentación del proyecto, escribiendo las partes que hicieron cada miembro del equipo, sobre nuestro objetivo, el análisis del FODA, el diagrama de Gantt para la administración de las actividades, y los últimos cambios de las vistas finales.','2021-08-20'),(3258,177,'repaso ','tras terminar el logo, me dedique el día de hoy a investigar/repasar los tipos de diagrama que debo hacer para el proyecto grupal, los cuales son: Diagrama de casos de uso, Diagrama de flujo, Diagrama de colaboración.\r\n\r\n','2021-08-20'),(3259,177,'repaso ','tras terminar el logo, me dedique el día de hoy a investigar/repasar los tipos de diagrama que debo hacer para el proyecto grupal, los cuales son: Diagrama de casos de uso, Diagrama de flujo, Diagrama de colaboración.\r\n\r\n','2021-08-20'),(3260,177,'repaso ','tras terminar el logo, me dedique el día de hoy a investigar/repasar los tipos de diagrama que debo hacer para el proyecto grupal, los cuales son: Diagrama de casos de uso, Diagrama de flujo, Diagrama de colaboración.\r\n\r\n','2021-08-20'),(3261,179,'Diagrama de Gantt y carpeta de campo','En el día de la fecha estuve modificando fechas en el diagrama de Gantt, porque muchas tareas individuales del proyecto ya están finalizadas/terminadas o en un rumbo favorable de una realización cercana, es decir que les falta poco.\r\nAdemas continué con mi carpeta de campo, entregue al profesor mi carpeta de campo que ya tiene 22 hojas completas, le voy a seguir añadiendo cosas nuevas respecto a mi desarrollo de la materia de practicas profesionalizantes. Puse cosas de el diagrama de Gantt, base  de datos, logotipo del proyecto, manual de usuario, complicaciones, cambios, conclusiones, pensamientos y sensaciones individuales. La clase siguiente pondré acerca de la presentación del proyecto. En la presentación del proyecto hice la problemática, es decir que problemas podría haber con el proyecto. El problema principal seria que los alumnos no usen la pagina  o le den poco uso, ademas del problema de la baja o nula conexion de internet en lugares, provincias, municipios, partidos, localidades, pueblos con poca conexion.!','2021-08-20'),(3262,179,'Diagrama de Gantt y carpeta de campo','En el día de la fecha estuve modificando fechas en el diagrama de Gantt, porque muchas tareas individuales del proyecto ya están finalizadas/terminadas o en un rumbo favorable de una realización cercana, es decir que les falta poco.\r\nAdemas continué con mi carpeta de campo, entregue al profesor mi carpeta de campo que ya tiene 22 hojas completas, le voy a seguir añadiendo cosas nuevas respecto a mi desarrollo de la materia de practicas profesionalizantes. Puse cosas de el diagrama de Gantt, base  de datos, logotipo del proyecto, manual de usuario, complicaciones, cambios, conclusiones, pensamientos y sensaciones individuales. La clase siguiente pondré acerca de la presentación del proyecto. En la presentación del proyecto hice la problemática, es decir que problemas podría haber con el proyecto. El problema principal seria que los alumnos no usen la pagina  o le den poco uso, ademas del problema de la baja o nula conexion de internet en lugares, provincias, municipios, partidos, localidades, pueblos con poca conexion.!','2021-08-20'),(3263,192,'Carpeta de campo','En el dia de hoy termine de completar lo restante en la carpeta de campo para entregarla este mismo dia, agregando informacion sobre los avances de estas ultimas clases acompañadas con imagenes del proyecto para tener la carpeta de campo lo mas completa y decente posible para su entrega.','2021-08-20'),(3264,201,'Grupo de carpeta de campo','He hecho la carpeta de campo con los otros compañeros, uno poor su parte y cada uno le entregamos al profe para corregir','2021-08-20'),(3265,189,'Carpeta de campo','Entregamos la carpeta de campo','2021-08-20'),(3266,169,'Carpeta de Campo','Hoy estuve realizando la carpeta de campo, completando lo que falta y corrigiendo algunas cosas junto a mis compañeros, para poder entregarla lo más completa posible explicando todo el proceso del proyecto actual de la bolsa de trabajo y del anterior proyecto de parquimetro - estacionamiento','2021-08-20'),(3267,175,'Carpeta de campo','Hoy complete la carpeta de campo y ayude a mi compañero con el prototipado rapido y el foda','2021-08-20'),(3268,200,'Carpeta de campo','El dia de la fecha termine y entregue la carpeta de campo','2021-08-20'),(3269,187,'24-08','Hoy realizamos actualizaciones a la carpeta de campo y estuvimos viendo como realizar una base de datos con Json, y msql para que reacciones con la rasphberry.','2021-08-24'),(3270,203,'RASN-Avance en la carpeta','En el día de hoy no fue posible avanzar con el código, así que decidí actualizar la carpeta.','2021-08-24'),(3271,168,'Clase de repaso','Al no poder tener acceso a node en las computadoras decidi empezar a ver videos tutoriales que tenia guardados de mongodb con node.','2021-08-24'),(3272,184,'Presentismo','Asistí a la clase sin embargo no tuve las herramientas para trabajar en el proyecto.','2021-08-24'),(3273,188,'24-08 organización de la carpeta','El día de hoy estuvimos corrigiendo y modificando la carpeta de campo,aparte de añadir las ultimas funciones y detallar algunas partes del código. ','2021-08-24'),(3274,166,'Finalidad del proyecto','Hoy nos pusimos a pensar cual sería la finalidad del proyecto ya que hasta ahora no nos lo habíamos puesto a pensar y ya tocaba.\r\nLo que se decidió fue que el objetivo sería hacer que cuando se enfoque la entrada del colegio desde la página muestre un objeto con información del colegio y si se clickea el objeto te redirecciona a la página del colegio.','2021-08-24'),(3275,167,'responsive','descripcion','2021-08-25'),(3276,187,'25-08','realizamos una búsqueda del funcionamiento de los distinto sensores a usar como sensor de luz o servomotores. Y realizamos actualizaciones con respecto a los distintos fallos de la pagina web.','2021-08-25'),(3277,182,'Practicas Profesionalizantes - 25/8	','El día de hoy, realizamos el desfrezo de las computadoras para poder guardar el repositorio correspondiente al proyecto en las computadoras del laboratorio, esto nos permitirá avanzar mas rápido mientras pasen las clases debido a que no perderemos tiempo descargando y clonando el repositorio directamente desde GitHub','2021-08-25'),(3278,161,'Clase N|24 y 25    dias: 24/08/2021   y 25/08/2021','el dia 24/08 estuve probrando node 10.14.0 en windows 7 durante toda la clase intentando hacer que funcionara sin lograr esto.\r\n\r\nel dia 25/08 realizamos un avance en la parte de diseño en dos de las vistas ademas de actualizar el diagrama de gann y la carpeta de campo del proyecto','2021-08-25'),(3279,168,'Guardado de archivos y distribucion de tareas','En la clase del día de hoy, desfrezamos las computadoras y guardamos nuestro proyecto para así facilitar el acceso a los mismos en las clases siguientes. Además de ello nos distribuimos las futuras tareas en el grupo, voy a comenzar a avanzar en la api que nos permite tener en la base de datos los animes.','2021-08-25'),(3280,166,'vistas','Hoy cambiamos los estilos de las vistas en las páginas con colaboración de launick9.','2021-08-25'),(3281,188,'25-08 codificación de los sensores ','El día de hoy estuvimos codificando las funciones que cumplirán los sensores que irán conectada a la placa raspberry , de tal forma también estuvimos viendo como conectarlos a la pagina web.','2021-08-25'),(3282,184,'Selección y display de datos con node y react','Logramos relacionar la conexión con la base de datos con node y obtener registros de ella para luego ser mostrados con react. Trabajamos con la colección de animales mostrando los registros conseguidos en formato JSON logrando que conserven la misma estructura que las colecciones de  muestra.','2021-08-25'),(3283,202,'dia 26 del 8','el dia de hoy realizamos la vista de contactos y estuvimos charlando con los profesores sobre como ibamos en el proyecto','2021-08-26'),(3284,189,'Retoques','hoy hicimos retoques en la vista principal','2021-08-26'),(3285,189,'Retoques','hoy hicimos retoques en la vista principal','2021-08-26'),(3286,202,'dia 26 del 8','el dia de hoy realizamos la vista de contactos y estuvimos charlando con los profesores sobre como ibamos en el proyecto','2021-08-26'),(3287,174,'26 del 8','el dia de hoy realizamos la vista de contactos y estuvimos charlando con los profesores sobre como ibamos en el proyecto','2021-08-26'),(3288,190,'26-08','Hoy finalizamos el proyecto, solo nos queda la entrega de la carpeta de campo grupal.','2021-08-26'),(3289,200,'Index','El dia de la fecha optimizamos la vista principal','2021-08-26'),(3290,175,'LOGIN ','En la clase de hoy terminamos lo que es la parte del login falta modificar un par de cosas pero estamos bien, hicimos la parte del log out y tuvimos un problema con la version del xampp, tambien ayude a mi compañero a completar la presentacion del proyecto\r\n','2021-08-26'),(3291,173,'26 del 8','el dia de hoy realizamos la vista de contactos y estuvimos charlando con los profesores sobre como ibamos en el proyecto','2021-08-26'),(3292,192,'Index','En el dia de la fecha terminamos de retocar todo sobre el index principal, corrigiendo los botones, el fondo y el tamaño de un par de cosas.','2021-08-26'),(3293,172,'Dia 26/8','El dia de hoy realizamos la vista de contactos y estuvimos charlando con los profesores sobre como ibamos en el proyecto','2021-08-26'),(3294,179,'Cerca del final','En el día de la fecha estuve continuando con el manual de usuario añadiendo capturas y comentarios, describí como funcionaria la vista de usuarios, miembros y clase.\r\nAdemás continúe con mi carpeta de campo escribiendo mi progreso del día, de alguna manera es como si hiciera dos carpetas de campo o dos manuales de usuario. Hoy fue un día bastante calmado, me falta una sola vista que es el progreso del usuario general donde se muestran las estadísticas del ya mencionado. Es una vista bastante sencilla que espero ya mañana tenerla hecha!.','2021-08-26'),(3295,189,'Arreglar errores','Hoy arreglamos errores de código y continuamos con la carpeta de campo','2021-08-27'),(3296,177,'.','.','2021-08-27'),(3297,200,'ARREGLOS','El dia de la fecha hicimos arreglos de codigo y continuamos con la carpeta de campo','2021-08-27'),(3298,171,'Agregando detalles del proyecto','En el día de hoy empecé a arreglar algunos detalles de la carpeta del proyecto Aprende Conmigo, hablando con nuestro profesor, nos dió algunos concejos de como hacer la presentación, y con mi equipo planeamos acordar a realizar los diagramas que hacen falta y a ayudar a un compañero con la conexión de la base de datos.','2021-08-27'),(3299,169,'Revisión del código de la página','hoy estuvimos revisando el código de la página ya que tenía varios errores, como que no se subían las imagenes ni las descripciones a los perfiles de la pagina, también que cuando querías ir al home, mandaba un error php','2021-08-27'),(3300,179,'Ultimos dias','En el día de la fecha hemos estado compartiendo una velada entre los participantes del proyecto, cada vez queda menos que hacer pero quedan cosas pequeñas repartidas que aun no han sido resueltas o están a medio camino de su nacionalización total.\r\nMi trabajo para la próxima clase es investigar acerca de diversos y varios diagramas o cuadros. Entre ellos están el diagrama de flujo de datos, diagrama entidad relación, diagrama de clase, diagrama de caso de uso y otro mas que ahora mismo no recuerdo con exactitud y total precisión en mi perpepcion visual de internauta. Mi compañero Brandon Basaldua deberá encargarse del diagrama de caso de uso y yo tendré que  hacer el diagrama de entidad relación. Estamos en esto juntos los dos.\r\nPara la próxima clase ya tendremos algunos diagramas si es posible y poder compartirlo en clase junto al resto del equipo del proyecto Aprende conmigo de la materia de practicas profesionalizantes del profe Olaso.\r\nHoy fue un día bastante tranquilo y relajado en todo sentido emocional e académico. Si quiero decir con exactitud y total perseverancia.','2021-08-27'),(3301,188,'31-08  Completar la carpeta de campo','El día de hoy estuvimos realizando la corrección y incorporación de información de la carpeta de campo, de tal forma también estuvimos poniendo imágenes del código y de la pagina','2021-08-31'),(3302,161,'Clase N°23 31/08/21','Realize una actualizacion en la carpeta de campo ademas de charlar las cosas que faltan para el cheking del dia de mañana','2021-08-31'),(3303,181,'Completar la carpeta de campo','El día de hoy estuvimos realizando la corrección y incorporación de información de la carpeta de campo, de tal forma también estuvimos poniendo imágenes del código y de la pagina','2021-08-31'),(3304,182,'Practicas Profesionalizantes - 31/8','El día de la fecha fue destinado a la búsqueda de posibles aplicaciones para las wave con movimiento, esto resulto ser una tarea demasiado complicada por lo que se retomara en la próxima clase','2021-08-31'),(3305,168,'Busqueda de informacion','El dia de hoy estuvimos viendo como avanzar junto a las APIs y las base de datos','2021-08-31'),(3306,203,'Trabajo con APIs, backend y visualización de datos','En el día de la fecha desarrollamos varios endpoints para mostrar datos, así como funciones para efectuar cambios en la DB desde el frontend de React. Queda pendiente implementar algunas funciones','2021-08-31'),(3307,184,'Fetch de registros para animales','Realizamos una api que obtenga los registros de animales desde la base de datos de mongo mostrándolos en la vista del cliente, además de enviar valores de manera inversa mediante método post, logrando eliminar el registro seleccionado. En su conjunto, logramos obtener los valores de un registro actualizable a través de método get.','2021-08-31'),(3308,166,'Modelo 3D','hoy fue un día de investigación sobre como hacer modelos 3d','2021-08-31'),(3309,167,'Check Point','','2021-09-01'),(3310,186,'Checkpoint ','El día de hoy hubo un checkpoint el cual el profesor corrigió y observo como íbamos encaminados en nuestro proyecto, dándonos consejos de como avanzar, además de esto estuvimos viendo como recrear el diseño de la pagina mediante el efecto parallax.','2021-09-01'),(3311,185,'Checkpoint','El día de hoy tuvimos el checkpoint en el que concordamos los próximos avances del proyecto, y empezamos a planear el manual de usuario que implementaremos en la propia pagina','2021-09-01'),(3312,166,'Checkpoint','Repasamos lo que tenemos hasta ahora y fijamos nuevos objetivo','2021-09-01'),(3313,188,'1-9-21 Checkpoint ','El día de hoy estuvimos revisando y mostrando que realizamos en el proyecto acuaponía, como partes del código, carpeta de campo  y la parte grafica de la pagina web.','2021-09-01'),(3314,163,'Checkpoint Agosto','Mejorar la carpeta de campo y funcionalidad de la página','2021-09-01'),(3315,187,'CLASE 1/09','Rellenamos la carpeta de campo con todo lo necesario para el checkin y revisamos el codigo para mejorar de manera visual la pagina web.','2021-09-01'),(3316,203,'Trabajo con APIs, backend y edición de datos','En el día de hoy implementamos INSERT y UPDATE en la colección de animales, y DELETE de la tabla de FAQ. ','2021-09-01'),(3317,184,'Finalización del CRUD de registros de animales para administradores','Acabamos de programar las funciones de actualización e inserción de animales, validando los datos desde la vista del cliente. Implementamos la función para eliminar preguntas y respuestas.','2021-09-01'),(3318,182,'Practicas Profesionalizantes - 1/9','El dia de la fecha se realizo el checkpoint del proyecto para mantener al dia los avances realizados, ademas, actualizamos la documentacion en la carpeta de campo grupal','2021-09-01'),(3319,168,'Checkpoint','En el día de la fecha estuvimos presentando los avances del proyecto, en este comentamos todos los cambios y planes a futuro.','2021-09-01'),(3320,180,'1 de septiembre 2021 - Aubone Juan Pablo	','En el día de la fecha, estuvimos trabajando en el fetch de la base de datos para mostrar la informacion de las tablas en la intefaz grafica. Ademas hicimos un check point de lo trabajado hasta la fecha.','2021-09-01'),(3321,177,'hoy','hoy','2021-09-02'),(3322,190,'2/09','Hoy hicimos retoques antes del punto de control, haciendo funcional algunas partes de la página ','2021-09-02'),(3323,189,'Punto de control','Hoy hicimos por completo funcional la página antes del punto de control, que no fue hoy','2021-09-02'),(3324,170,'Punto de control','Estuvimos revisando la conexión con la base de datos y la verdad que no pudimos debido a que la configuración en el codeinaiter es mas compleja por lo que se decidió no utilizar codenaiter.','2021-09-02'),(3325,174,'dia 2 del9','el dia de hoy tuvimos el punto de control con el profesor. La resolucion de el es que estamos bastantes avanzados y le gustaria que hagamos unas actualizaciones para asi colocarla en la pagina de la escuela.\r\nLas actualizaciones que nos dijieron fueron las siguientes.\r\n1)Diagraas caso de uso, actualiizacion de diagrama de gantt\r\n2)El bot despues de un tiempo de inactividad de borre todo a cero\r\n3)pasar todo texto a mayuscula con la base de datos\r\n','2021-09-02'),(3326,172,'dia 2 del9','el dia de hoy tuvimos el punto de control con el profesor. La resolucion de el es que estamos bastantes avanzados y le gustaria que hagamos unas actualizaciones para asi colocarla en la pagina de la escuela.\r\nLas actualizaciones que nos dijieron fueron las siguientes.\r\n1)Diagraas caso de uso, actualiizacion de diagrama de gantt\r\n2)El bot despues de un tiempo de inactividad de borre todo a cero\r\n3)pasar todo texto a mayuscula con la base de datos','2021-09-02'),(3327,202,'dia 2 del9','el dia de hoy tuvimos el punto de control con el profesor. La resolucion de el es que estamos bastantes avanzados y le gustaria que hagamos unas actualizaciones para asi colocarla en la pagina de la escuela.\r\nLas actualizaciones que nos dijieron fueron las siguientes.\r\n1)Diagraas caso de uso, actualiizacion de diagrama de gantt\r\n2)El bot despues de un tiempo de inactividad de borre todo a cero\r\n3)pasar todo texto a mayuscula con la base de datos','2021-09-02'),(3328,173,'dia 2 del9','el dia de hoy tuvimos el punto de control con el profesor. La resolucion de el es que estamos bastantes avanzados y le gustaria que hagamos unas actualizaciones para asi colocarla en la pagina de la escuela.\r\nLas actualizaciones que nos dijieron fueron las siguientes.\r\n1)Diagraas caso de uso, actualiizacion de diagrama de gantt\r\n2)El bot despues de un tiempo de inactividad de borre todo a cero\r\n3)pasar todo texto a mayuscula con la base de datos','2021-09-02'),(3329,169,'Correcciones ','Hoy se corrigieron varias líneas de código, relacionadas más que nada el login de la página y con la base de datos ','2021-09-02'),(3330,171,'Carpeta del proyecto','En el día de hoy realice con mi compañero Ignacio la carpeta de nuestro proyecto Aprende Conmigo, en el describimos como fue el proceso de nuestro proyecto, describimos nuestro prototipado, y la organización con la ayuda del Gantt, también describimos el FODA que muestra las fortalezas, oportunidades, las debilidades y las amenazas que pueden surgir en nuestra Página web.','2021-09-02'),(3331,204,'Checkpoint proyecto','Creé y le compartí una carpeta en Google Drive al profesor, junto con el proyecto, la carpeta de campo, FODA, y Gantt.','2021-09-02'),(3332,170,'Sin codenaiter ','En el día de hoy, seguimos con la configuración en  php para la coleccione con la base de datos sin usar codenaiter. ','2021-09-03'),(3333,170,'Sin codenaiter ','En el día de hoy, seguimos con la configuración en  php para la coleccione con la base de datos sin usar codenaiter. ','2021-09-03'),(3334,189,'Agregados','El dia de hoy agregamos unos links funcionales referidos a las pàginas de las especialidades, cambiando todo el estilo del texto','2021-09-03'),(3335,190,'3-09 ','Hoy agregamos liks funcionales referidos con las especialidades del colegio. ','2021-09-03'),(3336,177,'viernes','el día de hoy trabaje en la carpeta de campo grupal , por lo que me encontré buscado en diversas fuentes una definición y función de los logotipos ','2021-09-03'),(3337,179,'Diagramas','En el dia de la fecha he estado trabajando respecto a los diagramas, el diagrama que he hecho es el diagrama de entidad relacion o tambien conocido como modelo entidad relacion, en los ultimos dias anteriores al dia de hoy estuve investigando su funcion en una empresa o proyecto y porque es importante hacerlo. El diagrama de entidad relacion que hice junto a mi compañera Alvarez Ayllòn Daiana Alvarez fue acerca de la base de datos del proyecto de aprende conmigo. En el diagrama de entidad relacion dibujamos varias entidades como: Alumnos, materias, preguntas, respuestas y sugerencias, la entidad entre ellas fueron cursada, duda y pregunta. Es decir que hubieron dos relaciones con el mismo tipo pero con distinto sinonimo es decir la palabra duda, consulta, entre otras.\r\nEstas entidades tuvieron varios atributos como id, nombre, apellido, materias incriptas, edad, dni, entre otras, todas las anteriores ya mencionadas son partes de la entidad de alumnos. Tambien habia varias claves primarias que casi siempre eran el Id de la propia entidad ya mencionada al comienzo de este texto, tambien hubo claves foraneas que estan relacionadas a las demas entidades como: nombre, fecha, pregunta, entre otras.\r\nLo unico restante que me quedarias seria es graficarlo por computadoraordenador con algun tiipo de programa informatico, deberia investigar acerca de eso porque ahora mismo con exactitud no lo recuerdo bien, el proximo jueves hare eso.','2021-09-03'),(3338,171,'Diagramas','En el día de hoy tuvimos con mi grupo problemas para realizar los diagramas, y hablamos con nuestros profesor para poder sacarnos las dudas y empezamos a relacionar los diagramas de la base de datos de nuestro proyecto Aprende Conmigo, luego pasaremos a graficarlo en la computadora','2021-09-03'),(3339,181,'Continuidad de proyecto ','En el dia de la fecha, verificamos que el codigo de los sensores funcionen ','2021-09-07'),(3340,184,'Debugging de promesas de tarjetas','Al añadir nuevas funciones del back entraron en conflicto diferentes funciones rompiendo la búsqueda de información a la base de datos y hoy estuve resolviendo ese inconveniente.','2021-09-07'),(3341,161,'Clase N°27 08/09/2021','realice una investigación de como realizar una verificación en la vista login para saber si el usuario ingreso datos iguales que hay guardados en la base de datos','2021-09-08'),(3342,167,'Login','','2021-09-08'),(3343,185,'diagrama de gantt y investigación','El día de hoy complete el diagrama de gannt con las tareas actuales. Tambien empeze con la investigacion para formular las preguntas, comenze con las preguntas para las carreras de ingeniería en informática, ingeniería en electrónica , ingeniería en mecatrónica, y Lic. En sistemas.','2021-09-08'),(3344,168,'Avance en tareas varias','En el dia de la fecha, realice una serie de tareas variadas.','2021-09-08'),(3345,166,'Trabajo en tinkercad','Se realizaron objetos 3d en tinkercad y los testeamos en la página pero no funcionaron xd','2021-09-08'),(3346,188,'8-9 código en Arduino','Hoy estuvimos realizando el código para las funciones de los sensores en Arduino ,ya que no pudimos utilizar la placa raspberry, aparte utilizamos los componentes físicos , y agregamos 2 luces LED para determinar la temperatura  ','2021-09-08'),(3347,182,'Practicas Profesionalizantes - 8/9	','El día de la fecha nos dedicamos a la investigación y realización de diferentes procedimientos los cuales nos ayudaran a resolver los futuros inconvenientes que se presenten','2021-09-08'),(3348,187,'8-9 código en Arduino','El dia de hoy realizamos una prueba de sensores con el codigo de arduino debido a ciertos inconvenientes que se presentaron con la placa de raspberry.\r\n','2021-09-08'),(3349,184,'Arreglo de estilos responsive','Intenté trabajar en las acciones administrativas pero me encontré un error en la conexión con node que me impidió testear las rutas. En su lugar trabajé con estilos de las páginas de ini