e','2021-10-15'),(3550,173,'dia 15 del 10','el dia de hoy estuvimos investigando en como hacer nuestra pagina responsive, y nos planteamos en como colocar el chatbot en la pagina del colegio, para ello lo haremos como si fuese tipo un menu responsive\r\n','2021-10-15'),(3551,170,'Continuacion de mejoras','En el día de hoy estuvimos mejorando las vistas de clases, y los alumnos que ingresan a la misma. ','2021-10-15'),(3552,198,'','Hoy se siguió trabajando en los ejercicios','2021-10-15'),(3553,177,'viendo ','el día de hoy e visto Dragon Ball Z Capítulo1','2021-10-15'),(3554,195,'bloquear el use de ctrl + v para a pag web','pudimos sumar una nueva funcionalidad para los ejercicios, se trata de no poder usar el &quot;ctrl + v&quot; de este modo impedir que peguen las respuestas en la pag web, seguimos investigando mas tipos de ejercicios para despues producirlos en masa','2021-10-15'),(3555,179,'Editar comentarios','En el dia de la fecha junto a mi compañera de clase y de proyecto Daiana Alvarez, hemos estado trabajando en editar los comentarios en las clases del proyecto de Aprende conmigo. La opcion de crear y eliminar comentarios funciona a la perfeccion, la seccion de responderlos aun esta pendiente. Como he mencionado con anterioridad la opcion de modificar u editar fue realizada casi toda, en consecuencia no esta completa, hay alertas de unos errores pero eso se corregira la proxima clasee','2021-10-15'),(3556,171,'Sistema de editar comentarios','En el día de hoy con la ayuda de mis compañeros realice la vista de editar comentario, así el usuario puede editar su comentario, pero aún no se a podido realizar lo de manera funcional, trataré de hacerlo este fin de semana','2021-10-15'),(3557,191,'bloquear el use de ctrl + v para a pag web','jose encontro una forma de que no puedan copiar las respuestas y pasarse de vivos, estamos investigando mas tipos de ejercicios, un par mas y ya estaria para hacer muchos mas de esos .','2021-10-15'),(3558,189,'CSS continuación',