e nos dio acceso a los materiales de la materia para poder desarrollar el primer trabajo de todos, el cual se trato de un cuestionario donde teníamos que responder con la guía &quot;Introducción a las Prácticas Profesionalizantes&quot;.\r\nLuego, tuvimos que realizar un mapa conceptual el cual debía contener los primeros conceptos abordados relacionados a las Prácticas profesionalizantes.','2022-03-03'),(3675,213,'Conceptos basicos de P.P (Tarea 1 y Tarea 2)',' Se realizó el formulario sobre prácticas profesionalizantes y además se creó un mapa conceptual de los conceptos básicos de las P.P. ,es decir, se la da fin al primer módulo presentado en el classroom.','2022-03-03'),(3676,210,'Introduccion ,Tarea 1 y 2','Nos explicaron de que va la materia y luego nos juntamos en grupo para realizar un cuestionario sobre Practicas Profesionalizantes y un mapa conceptual.','2022-03-03'),(3677,211,'03/03/22 - modulo 1: tarea 1 y 2','En el día de hoy empezamos con Ciclo Inicial Modalidad Virtual Secuencia Didáctica, empezando por un formulario sobre la introducción a las Practicas Profesionalizantes y después un mapa conceptual relacionado a los primeros conceptos abordados sobre las Practicas Profesionalizantes.','2022-03-03'),(3678,209,'TP 1-2 03/03/2022','En el dia de la fecha nos presentaron la materia e iniciamos leyendo unos pdf, para después realizar el TP1 y avanzar el TP2, el cual esta casi finalizado.\r\n\r\n- Lectura de material\r\n- TP 1: Finalizado\r\n- TP 2: Casi finalizado\r\n','2022-03-03'),(3679,216,'Introducción a la materia - Modulo 1','Hoy, como primer día con la materia de Prácticas Profesionalizantes, los profesores procedieron a comentarnos de qué se tratará la misma, las actividades que realizaremos y cómo debemos cumplir para su aprobación.\r\nMe uní al Classroom, allí leí lo adjuntado bajo el nombre de &quot;Modulo 0&quot; y luego comencé a trabajar con el material del &quot;Modulo 1&quot;, leyendo y viendo los vídeos adjuntados en este. Realicé ya el primer cuestionario (Tarea N° 1) de nombre &quot;Introducción a las Practicas Profesionalizantes&quot; y comencé a bocetar en papel el mapa conceptual solicitado dentro de la Tarea N° 2.','2022-03-03'),(3680,215,'03/03/2022 Prácticas Profesionalizantes','Leí y vi los  2 videos del Modúlo 1, termine la tarea N°1 y tambien casi completo la tarea N°2 del DET - Modúlo 1.\r\nLa tarea N°1 estaba relacionada con los 2 videos y la lectura que eran unas preguntas para responder.\r\n','2022-03-03'),(3681,212,'03/03/2022  -  Tarea numero 1 y 2.','En el día de hoy leímos la introducción a las practicas profesionalizantes, leímos un PDF y vimos 4 vídeos referidos al tema. Luego realizamos 2 tareas. La primera es un cuestionario llamado &quot;Introducción a las Prácticas Profesionalizantes &quot; el cual consistía en 10 preguntas sobre lo aprendido el día de hoy. Para la segunda hay que realizar un mapa conceptual que contenga todos los conceptos abordados el día de hoy.','2022-03-03'),(3682,214,'Practicas Profesionalizantes- DET Modulo 1','Empece leyendo todo el material del modulo 1 junto a unos vídeos subtitulados sobre estudiantes que trabajan con las practicas profesionalizantes\r\nLa tarea 1 un cuestionario sobre el documento del modulo 1 me costo la ultima pregunta y le pregunte a un compañero después empece la tarea 2 hacer mapa conceptual','2022-03-03'),(3683,218,'Habilidades Blandas y Competencias Profesionales (Clase 2)','Hoy realizamos el Tercer Modulo del Classroom, el cual estaba relacionado con el Curriculum Vitae. \r\nDespués de leer el PDF &quot;Guía de Habilidades&quot; y &quot;Guía de Armado de un Currículum Vitae&quot;, y con la información obtenida, responder el cuestionario, procedimos a realizar el test de habilidades blandas de Computrabajo.\r\nPara finalizar, se nos invito a hacer nuestro propio Currículum Vitae de forma personalizada, siguiendo los conejos dados en el PDF.','2022-03-04'),(3684,208,'Habilidades blandas y el acercamiento a un nuevo proyecto','Realizamos un test de habilidades blandas, nos explicaron como vamos a trabajar en el proyecto y ademas nos dieron una idea de como sacar la idea de un proyecto','2022-03-04'),(3685,210,'Bitacora 2 ','Estuvimos hablando de los proyectos que teniamos pensado hacer en esta materia mas adelante ','2022-03-04'),(3686,217,'Registro de Compu trabajo','hicimos el registro de y curriculum en la pagina web de compu trabajo, tambien se ustuvo debatiendo acerca de como se realizara el siguiente trabajo del año','2022-03-04'),(3687,217,'Registro de Compu trabajo','hicimos el registro de y curriculum en la pagina web de compu trabajo, tambien se ustuvo debatiendo acerca de como se realizara el siguiente trabajo del año','2022-03-04'),(3688,220,'Registro de Compu trabajo ','se realizo el registro de compu trabajo y se realizo dos test uno de competencias y de compu trabajo\r\n','2022-03-04'),(3689,222,'Scrap','vimos lo que es un proyecto con ejemplos,sobre cubrir las necesidades del cliente entre otras cosas','2022-03-04'),(3690,211,'04/03/2022 ','hoy hablamos de proyectos que íbamos a hacer para el futuro','2022-03-04'),(3691,213,'Habilidades blandas , creación de perfil profesional y orientación para los proyectos','Hoy hicimos 2 cuestionarios para ver nuestro perfil profesional y terminamos la clase con los profesores orientándonos para la creación de los futuros proyectos ','2022-03-04'),(3692,209,'TP2 - Habilidades Blandas - CompuTrabajo - Propuesta de proyectos','Hoy termine el TP 2 del DET, empece a leer el material de Habilidades Blandas, hice el formulario de competencia e hice el test de habilidades blandas de CompuTrabajo.\r\n\r\n-Lectura de material Habilidades Blandas\r\n-TP2: Finalizado\r\n- Test de CompuTrabajo\r\n- Repaso de Scrum\r\n- Propuesta de proyectos','2022-03-04'),(3693,212,'04/03/2022','El día de hoy hicimos 2 cuestionarios acerca de habilidades blandas en Computrabajo y una encuesta de habilidades sobre la materia.','2022-03-04'),(3694,214,'Scrum','realizamos un repaso corto sobre la metodologia de trabajo scrum y realizamos un conjunto de ideas para ejemplos de programas','2022-03-04'),(3695,221,'04/03/22 Encustas y Formularios','Estuvimos realizando encustas y formularios sobre como es o seria nuestro desempeño en el ambito laboral. \r\nTambien estuvimos discutiendo sobre como realizar un proyecto y como llevarlo a cabo.\r\nRepasamos scrum y planteamos como llevaremos a cabo las actividades grupales a lo largo del año.','2022-03-04'),(3696,216,'Encuesta de habilidades','Al ingresar se nos dejó como tarea la realización de un formulario del Classroom para conocer nuestras habilidades dentro de diferentes ámbitos grupales de trabajo, luego se nos hizo registrarnos en Computrabajo para realizar otra encuesta la cual descargamos como PDF y subimos a una tarea dejada en el Classroom.\r\nAl final de la clase repasamos la modalidad de Scrum.','2022-03-04'),(3697,215,'DIA 203/04/2022','Realize la encuesta de habilidades y HABILIDADES BLANDAS - COMPUTRABAJO y complete el test de habilidades y lo subi al classroom\r\n','2022-03-04'),(3698,223,'Formularios y propuestas de proyectos','Creamos una cuenta en computrabajo y rellenamos en formulario con el cual obtendremos nuestras capacidades de trabajo, del cual descargamos un PDF y lo subimos al classroom, también hicimos otro formulario sobre nuestra forma de realizar trabajos, el cual se subió al clasroom y por ultimo hicimos un ejemplo de como pensar un proyecto en el cual nos enfocaremos en el transcurso del año.','2022-03-04'),(3699,226,'Clase 1','','2022-03-09'),(3700,238,'Clase 1','Empezamos a hacer las tareas del classroom.\r\nLeímos los PDFs y vimos los videos introductorios a Practicas Profesisonalizantes y enviamos los formularios de google correspondientes.\r\n','2022-03-09'),(3701,225,'Clase 1 ','Se revisaron y completaron los puntos pertinentes a los módulos 0 y 1 del classroom, incluyendo en estos el mapa conceptual y el test de competencias','2022-03-09'),(3702,233,'Clase 1','Fechas:\r\nSemana 1\r\n 8/3/2022\r\nEl día de hoy los docentes Acosta Nahuel y Consorti Gonzalo nos dieron una introducción de la materia, como vamos a organizarnos y como se dará la evaluación de la misma.\r\n9/3/2022\r\nLos docentes a cargo de la materia (mencionados anteriormente) nos dieron a realizar una encuesta sobre nuestras habilidades junto un cuestionario de CompuTrabajo.\r\nTrabajos realizados el día de la fecha:\r\nTarea número 1 -Formulario de prácticas profesionalizantes: Realizada.\r\nTarea numero 2- mapa conceptual sobre el primer trabajo: En proceso.\r\n','2022-03-09'),(3703,237,'Clase 1','Comenzamos a hacer las tareas y trabajos en clase.\r\nEstos fueron una lectura del PDF a la introducción a las practicas profesionalizantes y trabajo en grupo.','2022-03-09'),(3704,239,'clase 1','el dia de hoy 9/3 le dedicamos el tiempo a completar PDFs y trabajos los cuales podían ser grupales o individuales. Estos PDFs son sobre la materia &quot;Practicas profesionalizantes&quot;','2022-03-09'),(3705,229,'Clase 1','Concretarse las primeras dos encuestas - Realización de los módulos 0 (Lectura de material), módulo 1 - (Efectuar de forma correcta las tareas 1 y 2) - Iniciación del módulo 2 - (Iniciación de la lectura de Material)\r\nIngreso a las paginas - encuentrotecnologico.com.ar - https://www.computrabajo.com.ar/','2022-03-09'),(3706,230,'Clase 1','Hice un currículum en Computrabajo (https://candidato.computrabajo.com.ar/Candidate/Home) para luego hacer un test de competencias laborales en la misma página. Este evalúa la responsabilidad, autogestión, liderazgo, motivación, inteligencia social, autonomía, arbitraje y cooperación. \r\nPor último hice la primer tarea, un cuestionario sobre la introducción a las prácticas profesionalizantes. ','2022-03-09'),(3707,228,'Clase 1 ','Leí el material del modulo 1 (introducción a las practicas profesionalizantes), realice 3 tareas (Tarea 1: cuestionario sobre los conceptos básicos de practicas profesionalizantes, tarea 2: mapa conceptual sobre los conceptos básicos de practicas profesionalizantes, tarea 3: armar un curriculum) y completé 1 encuesta (test de competencias laborales) ','2022-03-09'),(3708,231,'Clase 1','Esta fue nuestra segunda clase de PP en la que empezamos con algunos trabajitos para entregar dentro de 2 semanas, hoy avanzamos demasiado, creamos una cuenta en candidato computrabajo para saber en que nos desarrollamos mas y nuestras debilidades(y pensar que caresco de inteligencia social :v) respondimos dos cuestionarios y me quede en la segunda tarea que es armar un mapa conceptual del PDF de PP','2022-03-09'),(3709,235,'clase 1','el día hoy hice leímos las practicas profesionalizante, completamos el test de competencias laborales y empezamos con los trabajos prácticos .','2022-03-09'),(3710,227,'Clase 1','El día de la fecha comenzamos a leer acerca de las prácticas profesionalizantes. Posteriormente, completamos algunos formularios y realizamos el test de competencias laborales. Además, hicimos un mapa conceptual con los contenidos aprendidos.','2022-03-09'),(3711,224,'Clase 1','Leí el \'Modulo 1\' (Introducción a practicas profesionalizantes), luego contesté dos formularios sobre el tema (que abarcaban la tarea 1 y 2) , realicé una encuesta sobre \'Competencias laborales\' (tarea 1), y luego realicé un CV con la ayuda del \'Modulo 2\' que abarcaba la tarea 3.','2022-03-09'),(3712,232,'CLASE 1','Hoy junto a mi compañero Iván González Harms completamos el primer trabajo de los nueve que había hasta el momento en el classroom, este trabajo consistía en completar un formulario, respondiendo a todos los conceptos aprendidos previamente. Por mi parte, junto a la mayoría de la clase, terminé el test de competencia laboral desde la pagina &quot;computrabajo.com.ar&quot; en este test se toma rasgos tales como la autonomía, el liderazgo, la responsabilidad, la cooperación y la motivación (https://candidato.computrabajo.com.ar/Candidate/Competences/). Durante esta clase comencé a hacer los primeros bocetos para así empezar correctamente el mapa conceptual de la segunda tarea, donde tendremos que recopilar los conocimientos que adquirimos con anterioridad.','2022-03-09'),(3713,240,'Clase 1','El día de hoy dimos inicio con las actividades y el material , realice la tarea 1 y 2 de la materia, complete los cuestionarios de habilidades blandas Computrabajo y encuestas de habilidades, también vi los vídeos del modulo 1.','2022-03-09'),(3714,234,'Clase N°1','Realizamos la tarea N°2,  los formularios, un test de competencias laborales y un mapa conceptual de la materia.\r\nTambién terminamos con el Modulo N°1','2022-03-09'),(3715,226,'Clase 1','El día de hoy completamos el cuestionario de Habilidades Blandas - Computrabajo, Encuesta de Habilidades\r\nY realizamos la tarea 1 y 2 revisando el contenido del modulo 1.\r\n','2022-03-09'),(3716,241,'Bitacora Clase N°1 - Tomás Ortellado 6°1° C',' En la clase de hoy tuve que realizar una serie de formularios, uno en un perfil de trabajo que hacía preguntas en torno a distintas aptitudes relevantes para el ambiente laboral, y luego otro que realizo una serie de preguntas sobre Practicas Profecionalizantes usando un pdf como fuente de información, proporcionados desde el aula virtual. \r\n \r\nEntre medias con los dos profesores de la materia tuve una charla sobre exploración gastronómica.','2022-03-09'),(3717,236,'Clase 1','Al principio de la clase hicimos una encuesta en la cual completamos datos según nuestras personalidades, habilidades, destrezas y demás complementos, al finalizarlo llevamos a cabo la realización de la lectura del material del &quot;Modulo 0&quot;, luego realizamos la encuesta de la &quot;tarea 1&quot; y el mapa conceptual de la &quot;tarea 2&quot; ubicadas en el modulo 1 y para terminar realizamos el primer registro de la bitacora y carpeta de campo.','2022-03-09'),(3718,220,'10/03','Se designo los grupos para los proyectos, una vez que los profesores nos designaron los grupos y determinamos los proyectos que llevariamos a cabo, hicimos la designacion de roles del metodo scrum. yo teniendo la idea de un proyecto sobre una app web para restaurantes y se unifico con otro grupo. y los diagramas de gantts referentes al tiempo que nos tomara el proyecto\r\n','2022-03-10'),(3719,217,'proceso de organizacion','Se realizaron las tares 2, 3 y 4 de las 9 en total, también se estuvo informando acerca del nuevo proyecto a realizar durante el año, comenzamos a armar la carpeta de campo y la carpeta de proyecto, ademas a ultimo momento se hicieron busquedas de softwares para el uso en proyecto final.','2022-03-10'),(3720,223,'Asignación de grupos y proyectos','El día 10/03 continuamos con los trabajos del classroom mientras que los profesores designaban los grupos para los proyectos, una vez que los profesores nos dijeron los grupos y determinamos los proyectos que llevaríamos a cabo, hicimos escribimos las virtudes y roles de cada miembro del grupo, junto con los lenguajes de programación y programas que usaremos para el proyecto. Y por ultimo hicimos el diagrama de gantt del proyecto.\r\n','2022-03-10'),(3721,213,'Creacion de Grupos e Ideas','Concretamos el grupo de 7 integrantes para la realización de 2 proyectos que se van a llevar a cabo de manera simultanea \r\nEl proyecto ROJAS conformado por  :\r\n -Danilo Emanuel Soler Salazar\r\n -Brayan Farfan\r\n -Sosa Lucas \r\n -Alejandro Tolosa\r\nY el proyecto STONKS conformado por :\r\n -Dominic Guzman \r\n -Agustin Fiasche\r\n -Delio Matias','2022-03-10'),(3722,221,'Inicio de proyecto','El dia de hoy empezamos a desarrollar los distintos proyectos de cada grupo y ver que se requiere tener para la inicio y continuacion del proyecto tanto en formato papel como practico. Nuestro proyecto se basara en un sitio web para aprender a programar distintos leguajes dados del punto de vista de un alumno, deberemos estudiar programar y enseñar a programar durante el proyecto.','2022-03-10'),(3723,215,'10/03/2022 Tarea','Termine el mapa conceptual del DET - Modulo 1 tarea n°2 y leí el DET - Modulo 2,  hice un curriculum y después nos mandaron a investigar ','2022-03-10'),(3724,208,'10/3 Curriculum y Comienzo del proyecto','Al principio de la clase empeze con algunas tareas de la det, como armar un cv y completar un formulario luego se pensaron diferentes ideas para un proyecto en grupo, decidimos armar un grupo de 7 personas y trabajar con 2 proyectos en paralelo los trabajos son la pagina web para un consultorio odontologico y una pagina web interactiva para la administracion de pedidos en persona en un restaurante','2022-03-10'),(3725,211,'10/03 proyecto hospital','empezamos con un proyecto sistema de internación domiciliaria\r\ntarea 3 y 5','2022-03-10'),(3726,209,'10-03-22 Propuesta de proyecto sistema de hospital','-Formación del equipo de trabajo\r\n-Diagrama de Gantt\r\n-Avance en TP5\r\n-Finalizacion de TP3-4\r\n-Inicio de investigacion CodeIgniter y Materialize\r\nPor ultimo definimos una serie de pautas a seguir en el proyecto:\r\n-Va a estar programado en HTML, CSS, JS, PHP, SQL\r\n','2022-03-10'),(3727,216,'Inicio del primer Proyecto - Sistema de internación domiciliaria','Ayer, dediqué parte de la clase a la realización de una de las tareas del Modulo 3. \r\nCerca del final de la clase se nos dividió en grupos y uno de los integrantes del mio plateó un proyecto en el que nos encontraremos trabajando a partir de hoy. Realizamos el diagrama de GANTT.','2022-03-10'),(3728,212,'10-03-22','El dia de hoy hice la tarea Numero 3 que era un cuestionario y la tarea numero 4 que era hacer mi CVU, ademas nos agrupamos para hacer un proyecto en grupos, en el cual me tocó con Pereyra, Velarde y Gantus, empezamos haciendo el diagrama de Gantt en Project y mañana lo vamos a empezar.','2022-03-10'),(3729,210,'bitacora 3 10/3/2022','Hoy comence con el modulo 5 del classroom al terminar las 2 primaras actividades me llamaron para proponer mis 3 proyectos de los cuales me quede solo con uno ya que los otros 2 ultimos eran demasiado complejos. me uni al grupo de Sosa lucas y les propuse mi proyecto a los de su grupo y les gusto la idea. me mostraron el suyo y decidimos en hacer 2 proyectos al mismo tiempo pero para hacerlos decimos meter a 3 integrantes mas.\r\n','2022-03-10'),(3730,219,'10/03 Asignacion grupos de proyecto - Inicio del proyecto','Ya tenemos los grupos asignados para los proyectos, en mi caso me toco con Matias Delio y Domini Guzman, decidimos hacer una aplicacion web para restaurantes y cafeterias con la cual segun el codigo qr de la mesa se podra acceder al menu y pedir desde la misma aplicacion, esta viene acompañada de la opcion para llamar al mesero, pedir la cuenta e incluso el pagar con mercado pago.\r\n','2022-03-10'),(3731,222,'Modulo 1 y Inicio de proyecto internacion domiciliaria','Hoy 10/03/2022 arranque con el modulo 1, que consta de material y tarea que dejaron mis profesores, aprendi que son las practicas profesionalizantes, hice un cuestionario sobre introduccion a las practicas profesionalizantes, luego lei una guia sobre como hacer apropiadamente un curriculum vitae, hice el segundo cuestionario sobre las habilidades blandas y curriculum vitae, y luego los profesores me asignaron un grupo para iniciar el proyecto, Sistema de internacion domiciliaria, hicimos un project para organizar bien todas las tareas y luego concluimos el dia','2022-03-10'),(3732,242,'10-3-2022','El dia de hoy estuve dando toda atención como podía, con eso me estuve ordenando tanto mentalmente y muy lentamente las tareas que, con mis compañeros, estaba preparando para mi, siendo el propio proyecto lo ultimo que había hecho en el día. Hoy mismo había hecho un par de tareas del classroom, me costó aunque no fue demasiado.','2022-03-10'),(3733,220,'11/03','se inicio el maquetado del programa web se prioriso todas las tareas que se son nesesarias para la realizacion del proyecto','2022-03-11'),(3734,208,'Bocetos y Vistas','En esta clase nos dedicamos a hacer un bosquejo o boceto a mano alzada, teniendo en cuenta las diferentes necesidades de los posibles clientes que van a utilizar la pagina web. Entre las vistas hechas esta el home, tratamientos, contacto y turnos','2022-03-11'),(3735,243,'11-03-22','Hoy hice las 2 encuestas que se encontraban en el classroom y nos asignamos cada tarea para cada uno','2022-03-11'),(3736,219,'Comienzo del proyecto &quot;Stone&quot;','En el dia de la fecha comenzamos con el proyecto en cuestion, estamos haciendo con Domini el maquetado del sitio de administracion y Matias comenzo con la Base de Datos, la verdad es que la experiencia que ya tenemos con el diseño web y PRUFEX se nos facilito absolutamente todo.','2022-03-11'),(3737,223,'Comienzo del proyecto ','El día de hoy dimos inicio al proyecto, planeando como iniciaríamos y dando prioridad a los distintos posesos del proyecto, por mi parte comencé a averiguar sobre la base de datos MongoDB y averiguar como descargarla, ya que sufrimos ciertas dificultades en el proceso.','2022-03-11'),(3738,210,'bitacora 4 11/03/2022','hoy apenas llegamos nos pusimos a ver que habia que hacer primero en el proyect y comenzamos a planificar nuestras vistas de la pagina web del proyecto Rojas que consiste en una pagina de un consultorio odontologico. Dibujamos las vistas de home, tratamientos, turnos y contactos\r\nal realizar estas vistas planificamos que mejorarles mas adelante','2022-03-11'),(3739,213,'Realizando los bocetos de las vistas ','Después de realizar el Daily correspondiente decidimos que debíamos de empezar con las vistas de la pagina .\r\nY nos encontramos debatiendo como dar mas información al cliente sin ser molesto a la vista ','2022-03-11'),(3740,221,'Planificacion del proyecto','Hoy estubimos discuendo el como irganizar y repartinos las distintas tareas y cuales haremos primero y cuento tiempo nos llevara. Debido a que hoy tenemos solo 2H no puedimos realizar nada mas mas alla de la organizacion y empezar un poco.','2022-03-11'),(3741,216,'Investigación - Proyecto &quot;Sistema de internación domiciliaria&quot;','En el día de la fecha, tuvimos la primera daily, revisamos el diagrama de GANTT realizado ayer y en base a ello dividimos las tareas de investigación que colocamos en el. Yo por mi cuenta estuve navegando por la página web del framework Materialize el cual utilizaremos para el frontend de nuestro sistema, a su vez, estuve viendo también unos vídeos que explicaban dicha página.','2022-03-11'),(3742,222,'Segundo dia de Proyecto Sistema de Internacion Domiciliaria','Hoy llegue a clases con parte de la informacion que necesitabamos para arrancar el proyecto, luego tuvimos una charla de 15 minutos con mi grupo para determinar que hariamos cada uno, yo por mi parte me encargue de hacer las vistas a mano alzada y luego vimos un poco de materialize y concluimos con el dia.','2022-03-11'),(3743,211,'11/03 investigacion','hoy empezamos a investigar sobre codeignite, materialize, mvc y la base de datos relacional y la no relacional. por mi parte investigue sobre la base de datos relacional y la no relacional y vi un vídeo sobre de introducción a codeigniter 3','2022-03-11'),(3744,214,'Boceto Pagina ','Trabajamos en el proyecto rojas discutiendo sobre como debería ser la pagina web y realizamos un boceto a mano alzada sobre las vistas que debería tener la misma buscando referencia en otras paginas, en total hicimos 4 vistas y elegí la de tratamientos','2022-03-11'),(3745,209,'11-03-22 Investigacion y planteo de vistas','-Planteamos las vistas del login y el listado de pacientes\r\n-Investigacion de CodeIgniter\r\n-Investigacion de MVC\r\n-Prototipo de login en HTML y CSS\r\n','2022-03-11'),(3746,215,'11/03/2022','Hoy revisamos 11 laptops y verificamos algunos problemas','2022-03-11'),(3747,217,'proceso de organizacion','','2022-03-11'),(3748,241,'Bitacora Clase N°2 - Tomás Ortellado 6°1° C','Hoy no hice avances en clase con los trabajos del classroom, pero ayude a un compañero a dar los primeros pasos rápido, siendo que faltó las dos primeras clases.','2022-03-15'),(3749,227,'Bitacora 15/03/22','El día de la fecha continué con los formularios (tarea 3) y leí acerca de las habilidades blandas. Posteriormente, comencé a realizar mi curriculum vitae informándome acerca de cómo realizarlo correctamente','2022-03-15'),(3750,237,'Clase 2','Hoy continuamos con los trabajos de la anterior clase, \r\nEmpecé con la lectura de la guía de empresa simulada, para completar los trabajos correspondientes.','2022-03-15'),(3751,238,'Clase 2 15/03/2022','Terminé mi CV.\r\nY comencé a realizar la tarea 5, en la que debemos contestar preguntas relacionadas con la Guía de Empresa Simulada.\r\n','2022-03-15'),(3752,226,'Clase 2','Revisé los contenidos de la &quot;Guía de Habilidades Blandas&quot; y &quot;Guía de Armado de un Curriculum Vitae&quot; y posteriormente realice el cuestionario. también hice mi primer curriculum vitae ','2022-03-15'),(3753,239,'Clase 2','El dia de hoy 15/3 le dedicamos el tiempo a completar PDFs y trabajos de la clase pasada los cuales decidi hacerlos de forma grupal con otros dos compañeros. Estos PDFs son sobre la materia &quot;Practicas profesionalizantes&quot;','2022-03-15'),(3754,230,'Clase 15/03','Hoy hice un cuadro conceptual sobre las prácticas profesionalizantes, consigna del segundo trabajo, en base a un croquis del mismo que desarrollamos con un compañero en la clase pasada. también empecé el cuestionario del trabajo número 3. ','2022-03-15'),(3755,228,'Clase 2','Corregí la entrega de la tarea 4 (había entregado la tarea en la sección de la tarea 3) y comencé a realizar la tarea 5 (Cuestionario sobre la &quot;Guía de Empresa Simulada&quot;)','2022-03-15'),(3756,232,'CLASE 2 - 15/03/2022','El día de hoy empecé a leer, resumir y asignar los tiempos y trabajos de cada integrante del grupo para completar todo a tiempo. Leí sobre las habilidades blandas, el desarrollo de formato de practicas profesionalizantes y el armado correcto de un curriculum vitae para posteriormente empezar a hacer los formularios, para empezar el formulario sobre las habilidades blandas. Seguidamente, mi compañero Ivan Gonzalez Harms completo el mapa conceptual de la &quot;Tarea 2&quot; el cual previamente yo hice el croquis propio.','2022-03-15'),(3757,231,'Clase 2 (15/3/22)','Técnicamente es la tercera clase que tenemos, el día de la fecha continuamos/ continué con los Trabajos prácticos asignados yo voy por el cuarto modulo con el TP N°5 que es el cuestionario de 38 preguntas con un PDF de 101 paginas, ya entregue mi CV y mi mapa conceptual de los módulos anteriores','2022-03-15'),(3758,229,'15-03-2022','En el día de hoy se avanzo con los Módulos 2(Lectura del Material - Perfiles Profesionales - ), Módulo 3(Lectura de las Guías sobre Habilidades Blandas y Realización correcta del CV - Curriculum), ejecución de actividades de dichos Módulos(Tarea n°3 y n°4), un CV de practica y se le dio inicio al Módulo 4 con su respectivo material de lectura y actividades \r\n','2022-03-15'),(3759,234,'Clase N°2','En el día de hoy empezamos a ver el módulo N°3 el cual trataba de que son las habilidades blandas y para que sirven, también vimos que es un curriculum vitae y como armar un cv de calidad.','2022-03-15'),(3760,240,'Clase 2','Realice el cuestionario de la tarea 3 sobre  Habilidades Blandas y Curriculum Vitae revise y leí el contenido para poder completar el mismo. también hice mi primer curriculum vitae ','2022-03-15'),(3761,225,'Bitacora 15-03-22','Se completaron los contenidos pertinentes al modulo 3','2022-03-15'),(3762,236,'clase 2 (15/03/2022)','En la clase de hoy realizamos la lectura de los PDF dejados en el classroom, una vez finalizados de leer iniciamos con la realización de un simulacro de Curriculum vitae, por siguiente hicimos el cuestionario que se basaba lo leído anteriormente, y para finalizar, realizamos la bitácora correspondiente del día','2022-03-15'),(3763,245,'inicio de todo','en el dia de la fecha 13/3/2022 \r\ncreado mi sesión en encuentrotecnologico.com.ar,para poder hacer bitácoras,\r\nen el transcurso de la clase he desarrollado el CV para entrega en el dia de hoy\r\nluego he entregado los trabajo 1 y 2 de practicas profesionantes.','2022-03-15'),(3764,237,'Clase 3','Esta clase pensamos Proyectos para desarrollar en el año,\r\nmientras tanto terminábamos unos trabajos pendientes de la materia.','2022-03-16'),(3765,226,'Clase 3','el día de hoy se trató en idear un proyecto tecnológico basado en un problema escolar','2022-03-16'),(3766,239,'clase 3','hoy 16/3/22 me dedique a terminar trabajo de los pdf encomendados en la primera clase. Ademas estuvimos viendo, yo y mi grupo, ideas para el proyecto del año en el cual solo llegamos a pensar en 2 ideas seguramente para la próxima clase ya tenemos una idea elegida.','2022-03-16'),(3767,231,'Clase 3 ','El día de hoy estuvimos pensando y organizando los grupos para el proyecto para PP, se ocurrieron un par de ideas, entre ellas estaba involucrarme con la radio del colegio ya que nunca la encuentro activa y la otra es armar o diseñar un sistema de asistencia para los alumnos y docentes de la escuela, no avanza demasiado','2022-03-16'),(3768,240,'Clase 3','El día de hoy planteamos que proyecto realizar, el armado de grupos y las herramientas que utilizaremos ','2022-03-16'),(3769,227,'Planteo del Proyecto 16/03/22','El dia de hoy comenzamos la planeación del proyecto. Comenzamos con una lluvia de ideas entre varios compañeros y poco a poco nos fuimos explayando en una de ellas, algunos coincidimos y formamos un grupo menor y otros decidieron irse por su lado. Posteriormente nos subdividimos asignando distintas tareas y elegimos las tecnologías a utilizar durante el proyecto.','2022-03-16'),(3770,228,'Clase 3','definí el proyecto que realizare y escribí un borrador con funcionalidades y tecnologías que podría usar ','2022-03-16'),(3771,229,'16-03-2022','Se avanzo poco en el Módulo 4(Cuestionario)\r\nEl día de hoy se hablo sobre la formación de los equipos para la realización del futuro proyecto final donde se dio como idea la creación de una web con formato stack overflow para el cuestionamiento sobre especialidades y cuestionarios de pedagogía(Ayuda para el DOE) para alumnos ','2022-03-16'),(3772,232,'CLASE 3 - 16/03/2022','El día de hoy empezamos a desarrollar nuestro trabajo/proyecto principal a lo largo del año. Los integrantes de este grupo son Ignacio Girón (yo), Mendez Agustín, Gonzalez Esteban, Ortellado Tomás, Geist Mateo y Abdias Peña. En este trabajo nos enfocamos a hacer las ideas generales de que va a ser nuestro trabajo, este mismo se va a basar en un juego de navegador tipo &quot;Estrategia a tiempo real&quot;, en donde la tematica será capturar los terrenos del equipo enemigo a base de responder preguntas y distintas variantes de minijuegos. Ya establecimos en cierto modo como serian las reglas del mismo. El titulo de este por el momento es &quot;Conquizt&quot;, juego de palabra entre Conquest y Quiz, palabras del habla anglosajona.','2022-03-16'),(3773,245,'diseño del producto','el dia de hoy 16/3/2022 \r\nseguimos haciendo trabajos de PP para entrega el dia del domingo 20/3/2022 \r\ny hablamos de que proyecto empezaríamos a realizar para entregar a fin de año.\r\ncon mi grupo por ahora se nos ocurrió hacer una pagina de super vinculos llena de maginas de mercado u otras ','2022-03-16'),(3774,238,'Clase 3 16/3','Continuamos con el desarrollo de la tarea 5 &quot;Guía de Empresas Simuladas&quot;.\r\nPlanteamos ideas para realizar el Proyecto PP, definimos los grupos y posteriormente las tecnologías y funcionalidades que vamos a implementar.\r\n','2022-03-16'),(3775,236,'clase 3 (16/03/2022)','En el día de la fecha avanzamos un poco lo que seria el cuestionario numero 3. Luego se nos dio el anuncio de elegir nuestro proyecto que haremos en todo el año, mi grupo, que esta conformado por Ignacio Rios, Ivan Britez, Maria Morales y Nicolas Domeq, y lo que elegimos fue hacer una pagina web con un formato de stack overflow','2022-03-16'),(3776,234,'Clase N°3','En la clase de hoy estuvimos debatiendo con algunos compañeros acerca de que podríamos realizar como proyecto final.\r\nUna vez ya decidido el tema del trabajo, investigamos sobre Node js y React Native para realizar este mismo.','2022-03-16'),(3777,241,'Bitacora Clase N°3 - Tomás Ortellado 6°1° C','Forme grupo de proyecto y junto a mi grupo formamos nuestra idea de proyecto y lo que haremos.\r\nYa tenemos una idea de los roles que tomaremos y como nos diviremos el trabajo, también tenemos una idea de que lenguajes usaremos.','2022-03-16'),(3778,242,'17-03-22','En el día de hoy empezamos el código para la página cual va a ser dedicada al proyecto que tendremos que hacer, usando Atom como programa. Precisamente yo no lo hice, pero estuve ayudando en lo posible a mi compañero, aunque por mi parte hice lo que pude, ya que necesitábamos repasar un poco en el tema de HTML. Hoy mismo también comencé la carpeta de campo, añadiendo los días en el que me faltaban armar, excepto el primer día (03-03-22) debido a que no estaba inscrito.','2022-03-17'),(3779,212,'17/03/2022','El dia de hoy mis compañeros y yo empezamos a hacer la pagina para el proyecto mediante html, no logramos terminarla pero hicimos un progreso. Luego empece con la carpeta de campo y la actividad numero 6 del modulo numero 4.','2022-03-17'),(3780,222,'Proyecto Sistema de internacion domiciliaria','Hoy hicimos la reunion de 15 minutos del dia para charlar que es lo que teniamos que hacer cada uno, nos pusimos de acuerdo para entender bien que es lo que necesita nuestro sistema para cubrir las necesidades de internacion de pacientes, yo por mi parte me encargue de perfeccionar el login. lei informacion sobre el foda y la presentacion de nuestro proyecto, y me puse a analizar bien un sistema parecido al que necesitamos hacer, una informacion que me pasaron para guiarme un poco sobre todo lo que tiene que tener la parte de prestaciones de la pagina, y en base a eso vamos a continuar haciendo la base de datos y varias vistas de la pagina.','2022-03-17'),(3781,208,'Vista contacto','Con las vistas ya definidas para cada uno de nosotros empezamos a programarlo en html, yo me encargue de la vista de contacto. La estrategia fue dividir la pagina en un grid de 3 columnas la primera para que el usuario agregue un formulario la segunda para ver los datos de la clínica y la tercera para que se vea la ubicación del consultorio en google maps. En esta clase solo se termino con la primera de las 3 columnas','2022-03-17'),(3782,216,'Análisis 01 - Proyecto &quot;Sistema de internación domiciliaria&quot;','Hoy, estuve leyendo el material dentro de &quot;Guías para documentación&quot; que se encuentra dentro del Classroom, con el avanzamos con la &quot;Presentación del proyecto&quot; y me dediqué a realizar a su vez parte del &quot;FODA&quot; con dicho material.\r\nTambién hice en colaboración con mis compañeros de proyecto el Diagrama de Caso de Uso.','2022-03-17'),(3783,211,'documentacion','En el día de la fecha estuvimos haciendo la documentación, empezamos leyendo la guía para hacer el Foda, luego leímos la guía para presentación de proyecto para después empezar a hacerlo, mas tarde también terminamos el diagrama de caso de uso.','2022-03-17'),(3784,219,'Desarrollo aplicacion web &quot;Stone&quot;','En el día de hoy seguimos con la programación y con el desarrollo del proyecto, ya tenemos avanzadas varias vistas además de tener diagramada la estructura del sistema, aun así tenemos unas cuantas dudas acerca del sistema de qr, ya que queremos que el programa funcione a base de escanear un código qr y ya ingresar y pedir. Empezamos la base de datos y seguimos viendo si es que el programa usado para programarla nos sirve para lo que necesitamos en este proyecto.\r\nAún seguimos discutiendo algunas cosas del proyecto, como por ejemplo la pestaña de órdenes, debido a que estamos intentando de que sea lo más intuitiva posible y fácil de entender.\r\n','2022-03-17'),(3785,217,'busqueda de archivos','para el dia de hoy se hicieron un recuento general de las computadoras y por saber que la mayoria se encuentran bloqueadas y no se pudieron desbloquear por medio del soporte tecnico de conectar igualdad por lo que mi camarada y yo propusimos el desbloque manual por medio de un booteo de la bios y cargar un bios nuevo sin el bloqueo, se estuvo investigando acerca de los archvos y se continuara el dia de mañana','2022-03-17'),(3786,221,'Jueves 17/3','El día hoy estuve planteando el cómo sería la construcción de la página. Debido a que nuestro proyecto debe contar con un progreso  obligatorio para el usuario se nos complicó el diseño de la página. Al final optamos por poner un ejercicio debajo de cada explicación y un recuadro donde el usuario pueda completar tal ejercicio y la pagina corrija sus errores. También comencé con la presentación del proyecto. ','2022-03-17'),(3787,223,'Diseño y programación de la base de datos y la pagina administrativa','El día de hoy diseñe el diagrama de la base de datos del proyecto, luego de que lo modificaran y approbaran mis compañeros cree la base de datos en MongoDB. Tambien diseñe y programe parte de la pagina administrativa del proyecto la cual quedo inconclusa ya que me quede sin tiempo para corregir los errores','2022-03-17'),(3788,215,'17/03/2022','Hoy volvi a revisar las netbooks que nos faltaban la otra vez y encontre 1 netbook que prendia, le instale el google chorme, ya estaba reparada pero habia un problema en la pantalla procedimos a abrir la pantalla y le faltaba 2 tornillos, pasamos a desarmar una netbook que estaba rota y le sacamos los 2 tornillos faltantes para la otra netbook.','2022-03-17'),(3789,210,'bitacora 5 17/03/2022','Hoy les presente las vistas a mis compañeros y comenzamos hacerlas en html, lo cual algunas cosas se complicaron por los diferentes bugs que habia en los codigos y en el responsive. termine de hacer el navbar junto al body entero de la pagina y el footer de la misma. solo quedaria mejorarla con CSS y JS o cambiando algunas cosas en HTML','2022-03-17'),(3790,214,'Vista Contacto-Pagina','Con las vistas definidas nos dividimos en 3 compus para avanzar la página web, estuve trabajando junto a un compañero en la vista de contactos le buscamos un fondo acorde a la temática la dividimos en 3 partes e hicimos un formulario','2022-03-17'),(3791,220,'17/03 ','Se realizó el esqueleto de la  página de administración y se realizó ya la base de datos en mongo bd . Realize una investigación de como usar php en mongo bd para conectar la base de datos a la pagina','2022-03-17'),(3792,213,'Inicio de las vistas','El de hoy se baso en su totalidad en el empezar a codear las vistas conforme teníamos en el bosquejo realizado . Al inicio del día el Scrum master vino con el navbar ya hecho para que todas las paginas tengan el mismo navbar y mantener un orden entre las vistas. La que me toco a mi fue la de Turnos que se va a basar en el hecho de pedir turnos tanto por Whatsapp como por la pagina ','2022-03-17'),(3793,216,'Análisis 02 - Proyecto &quot;Sistema de internación domiciliaria&quot;','Al llegar abrí el Drive que tenemos en común del proyect, revisé el diagrama de GANTT para ver por donde comenzar, estuve revisando la &quot;Presentación del proyecto&quot; en la cual estuvimos trabajando ayer, junto con mi compañero presente realizamos algunos aportes a dicho documento.\r\nCreamos un repositorio en GitHub donde iremos subiendo nuestros avances en el código del mismo cuando comencemos con el.','2022-03-18'),(3794,211,'Documentación y Github','En el día de hoy seguimos avanzando en la documentación de proyecto y también sobre el foda, ademas tuvimos que entrar a Github para crear un grupo para empezar a subir toda la documentación que hagamos hecho para que los profesores lo puedan ver ','2022-03-18'),(3795,242,'18-03-2022','En el día de hoy realmente no hice mucho junto a mi único compañero que estuvo presente esta fecha, pero si lo que el profe me mandó a hacer, como crear una cuenta para GitHub, invitar tanto a mis demás compañeros hasta ambos profesores. De última intente hacer algo, repasar algo de Python (mi tema tocado en este proyecto) pero poca idea tengo en cómo iniciar, sea la página y por donde comenzar. ','2022-03-18'),(3796,210,'bitacora 6 18/03/2022','Hoy continue tratando de mejorar la pagina agregando efectos de WAVE a los margenes de las imagenes para darle un toque mas moderno a la pagina tambien agregue un boton al inicio de la pagina pero un tengo que codearlo para que sea responsive ya que cuando esta en modo celular el boton sale del margen por unos pixeles y es molesto. tambien le di tareas nuevas a mis compañeros para que continuen el trabajo','2022-03-18'),(3797,212,'18/03/2022','El día de la fecha hice cree el GitHub junto a mis compañeros y lo configuramos un poco como pudimos, luego seguimos trabajando en el formado de la pagina desde Atom, no hicimos mucho progreso pero algo es algo, también vi bastante acerca de como crearla así que creo que ya voy teniendo una idea de como hacerla y como queremos que quede.','2022-03-18'),(3798,220,'18/03 ','Hoy se hiso la investigacion de como implementar el php en mongo bd . se creo el github del Projecto donde agregaremos lo que se valla realizando respecto al projecto\r\n','2022-03-18'),(3799,217,'1er Desbloqueo de computadora','en el dia de hoy se buscaron los archivos en videos de youtube,(drivers) y archivos bin para el desbloqueo de las computadoras por lo que fue mas complejo de lo esperado pero finalmente se encontraron y al ponerse a preuba se logro realizar el booteo del tpm sustituyendo los archivos que bloqueaban el acceso, se continuaran con las labores de desbloqueo la proxima semana','2022-03-18'),(3800,213,'Continuando las vistas ','Apenas entramos realizamos el dialy designamos los trabajos para cada uno que fueron básicamente los mismo que los del dia anterior con esto nos asegurábamos de que cada uno trabajara con lo que empezó. Quedamos en que las vistas debían tener un forma similar a la pestaña home para que sea cómodo al usuario promedio','2022-03-18'),(3801,208,'Diagrama entidad relación y vista contacto','Se profundizo un poco mas en el formulario de la vista contacto, con la idea de que pueda mandarse un mail al terminar de rellenar el formulario, sin embargo tuve algunos problemas con eso asi que preferi seguir con el diagrama entidad relacion. Voy a informarme mas sobre como mandar un mail desde hmtl','2022-03-18'),(3802,214,'Vista tratamientos-odontologia','avance con la vista sobre los tratamientos en la web de odontologia rojas empece con el navbar predefinido que tenemos y le agregue un fondo a la pagina despues añadí 6 cards que rotan cuando se le pasa el mouse encima, para que no sea solo texto les cambie el color y busque imagenes sin copyright para cada card','2022-03-18'),(3803,215,'18/03/2022','Hoy desarme una netbook (el teclado y la tapa posterior), arregle una netbook que le faltaba algunas teclas, y le reemplaze el teclado por completo ya que no se puede cambiar tecla por tecla.','2022-03-18'),(3804,232,'CLASE 04 - 22/03/2022','El día de hoy con mis compañeros de grupo proseguimos con nuestro proyecto web llamado &quot;Conquizt&quot;, hoy empezamos a proponer los componentes y las distintas tablas que íbamos a utilizar en la base de datos para la misma pagina, los diseños, interfaces e imágenes que íbamos a utilizar, cada integrante propuso distintas ideas para el diseño de esta. Por el momento aprovechamos ideas propias como de algunos juegos de vídeo.','2022-03-22'),(3805,230,'Clase 22/03','Hoy me puse a completar la carpeta de campo con los progresos que hice en mi casa con respecto a los trabajos 3, 4, 5, 6, 7, 8 y 9 de los distintos módulos. ','2022-03-22'),(3806,224,'Clase 4','Realicé el proyecto pensando en las funcionalidades y las áreas del trabajo en las que se va a especializar cada uno de mis compañeros, también se comenzo la deliberación para el diagrama de gantt ','2022-03-22'),(3807,238,'Clase 4 22/3','Definimos las Áreas de Trabajo, comenzamos el desarrollo del Diagrama de Gantt junto con la definición de las primeras tareas que serán necesarias en el desarrollo del proyecto. ','2022-03-22'),(3808,229,'22/03/2022','Se charlo de manera civilizada sobre los diseños que se realizaron para tener una mejor distribución equitativa de trabajos para que no hubieran disconformidades en el grupo de trabajo, como también la creación de un diagrama de Gantt y Kanban, se aceptaron tres diseños de las vistas para el proyecto','2022-03-22'),(3809,228,'Clase 4','Continué realizando el proyecto pensando en funcionalidades para agregar, comencé a hacer el diagrama gantt y delibere con mis compañeros las áreas en las que se especializara cada uno','2022-03-22'),(3810,237,'Clase 4','Hoy Armamos un diagrama Kanban con mis compañeros de equipo del proyecto. Debatimos ideas al respecto del diseño y como armar el sistema de búsquedas con etiquetas.','2022-03-22'),(3811,231,'Clase 4','Bitácora del día: Hoy estuvimos avanzando con el proyecto grupal, debatiendo como será el el diseño de la pagina y que contendrá en ella, la idea principal es que la pagina es un buscador que compara los productos con menor precio entre las distintas paginas de venta existentes, aun no se dividió exactamente quien esta a cargo de cada sector, yo estoy pensando ideas del diseño de la pagina pero aun no lo hice publico ;v','2022-03-22'),(3812,241,'Bitacora Clase N°4 - Tomás Ortellado 6°1° C','Continuamos con los conceptos de nuestro proyecto, más en particular con la interfaz de la página web, con los menús y la tipografía.','2022-03-22'),(3813,227,'Planificación de diseño y BDD','Creamos un documento en el cual colocamos una lluvia de idea de campos y tablas posibles para incluir en la base de datos del proyecto.\r\nAdemas, utilizamos la herramienta &quot;figma&quot; para realizar los primeros diseños de bocetos de las vistas, tales como:\r\n- Pantalla inicial\r\n- Menu\r\n- Gameplay','2022-03-22'),(3814,234,'Clase N°4','Con mi grupo en la clase de hoy, empezamos a hacer el diseño para la página web para el proyecto final.\r\nEstuvimos armando un boceto en la página figma, hicimos la pantalla de inicio, el menú y como sería in-game.\r\nTambién colocamos en un word los elementos básicos para armar la base de datos.','2022-03-22'),(3815,239,'clase 4','hoy estuvimos discutiendo ideas del diseño del proyecto y armamos un diagrama kanban con trello para organizarnos. ','2022-03-22'),(3816,225,'Bitacora 22-3-22','En el día de la fecha, se dio inicio al proyecto grupal &quot;Conquizt&quot; planteando el estilo y &quot;personalidad del juego&quot; haciendo esquemas de los menús y diseño. También, se planteó una base de datos básica con datos sujetos a modificacion ','2022-03-22'),(3817,240,'Clase 4','Estuvimos hablando acerca del diseño del proyecto y la distribución de tareas, también simulamos una pequeña prueba del primer diseño de la pagina y discutimos sobre los tiempos del proyecto.','2022-03-22'),(3818,226,'Clase 4','Estuvimos hablando acerca del diseño del proyecto y la distribución de tareas, también simulamos una pequeña prueba del primer diseño de la pagina y discutimos sobre los tiempos del proyecto.','2022-03-22'),(3819,245,'22/3/2022','Hoy el día de la fecha se discutió con mi grupo, el boceto del proyecto y temas a futuro como una barra de búsqueda y uso de etiquetas\r\ntambién creamos un cuenta en trelo para usar organizaciones y hacer la carta gantt\r\n','2022-03-22'),(3820,246,'bitácora 23/03/2022--- Arenas Gonzalo Nicolas','En el día de la fecha realice y entregue el trabajo practico numero 8, trabajo practico numero 6 y trabajo practico número 7. Organizamos grupal mente las divisiones de los temas que le corresponde a cada uno, investigue sobre las bases de datos no relacionales (NoSQL)','2022-03-23'),(3821,245,'23/3/2022','El dia de la fecha arme la base de datos y programe codigo de php para asegurar una conexion base con la pagina y la base de datos\r\ncon mi grupo tambien discutimos sobre rl titulo y los logos y termino siendo mi titulo que dije que es all shops in one ','2022-03-23'),(3822,235,'clases 23/3','en el día de hoy estaba terminando los trabajos practico y empezamos con mi grupo con el trabajo','2022-03-23'),(3823,232,'CLASE 05 - 23/03/2022','El día de hoy con mi grupo empezamos finalmente con el desarrollo de nuestro proyecto &quot;Conquizt&quot; por el momento está recién empezado, mis compañeros Mendez, Gonzalez y Geist empezaron a desarrollar todo el apartado visual y el menú de la pagina, mientras que yo, Girón, junto a Ortellado, empezamos a aprender, desarrollar y hacer los primeros procedimientos y programas para crear la base de datos de nuestro trabajo, de base de datos vamos a utilizar MongoDB, y para este mismo también haré uso de los archivos .JSON. Nos queda bastante por delante en este trabajo, pero promete bastante.','2022-03-23'),(3824,224,'Clase 5','Empecé el diagrama de gantt en Project, después junto a mis compañeros diseñamos las vistas de la página para la clase que viene comenzar a trabajar en HTML y CSS. ','2022-03-23'),(3825,231,'Clase 5','El día de la fecha avanzamos demasiado al menos en el tema del logo y del proyecto aun no tenemos el logo definitivo y yo estoy encargado de los bocetos que debo diseñar, pero por otro lado ya tenemos el nombre de la pagina y unos posibles logos aun no definidos, tengo que agregar todo esto a la carpeta de campo y dibujar un par de ideas que tengo, aun no tenemos la estructura final de la pagina pero algo en mente','2022-03-23'),(3826,237,'Clase 5','Hoy inicialice un proyecto en GitHub, trasfiriendo así el Kanban de Trello a este.\r\nDividí el trabajo entre mis compañeros y empezamos a subir los archivos al GitHub.\r\nDebatimos el nombre (All Shops In One) y el logo del proyecto.\r\nDibuje como se vería la pagina de inicio.\r\n','2022-03-23'),(3827,230,'Clase 23/03','Hoy comencé a estudiar el lenguaje de programación Java (en https://www.w3schools.com/java/default.asp) para en clases futuras poder hacer la página de enseñanza correspondiente a este lenguaje. Llegué hasta la sección de Arrays bidimensionales (matrices). ','2022-03-23'),(3828,229,'23/03/2022','La clase de hoy se dio como finalizado la tarea de bocetaje de las vistas de la web site, se pudo realizar un prototipo de las 8 vistas dibujadas, como a su vez se les escribió en formato de lista, el funcionamiento de cada una para que a futuro quede como referencia sobre el manual de usuario, sacándonos un futuro peso en el proyecto ','2022-03-23'),(3829,226,'Clase 5','El día de hoy fue muy productivo: diseñamos los primeros bocetos de la pagina que vamos a realizar como proyecto y desarrollamos los diagramas de Gantt y el diagrama de Kanban. Creamos un repositorio en GitHub y También diseñamos el prototipo del primer boceto y lo documentamos en la carpeta de campo.','2022-03-23'),(3830,225,'23-03-22','En el día de la fecha se avanzamos con el armado de la página principal y menús del juego. También se hicieron los diagramas de Grantt y Kanban','2022-03-23'),(3831,228,'Clase 5','Colaboré en la realización del diagrama de Gantt del proyecto y el armado del prototipo de las vistas de la pagina web y comencé a pensar en los datos que serán necesarios incluir en la base de datos','2022-03-23'),(3832,239,'clase 5','hoy me puse tirar ideas sobre el diseño, nombre, logo, animaciones de la pagina. uno de los miembros del grupo planteo una idea que nos gusto a todos y en base a esa pudimos hacer lo demás, logo, diseño, animaciones, y hasta llegamos a plantearnos una animación de carga.\r\nTambién empezamos a usar github para subir y compartir con el grupo todas las ideas archivos que tengamos y/o terminemos.','2022-03-23'),(3833,240,'Clase 5','El día de hoy: \r\n-Diseñamos los bocetos de la pagina\r\n-Organizamos los tiempo con el diagrama de Gantt\r\n-Con el Kanban puse a la vista todas las futuras tareas del proyecto  \r\n','2022-03-23'),(3834,241,'Bitacora Clase N°5 - Tomás Ortellado 6°1° C','Empece junto a un compañero la base de datos, comenzando con el aprendizaje del lenguaje que usaremos, MongoDB y algunos conceptos básicos sobre las bases de datos relacionales y no relacionales.\r\nHasta ahora lo que vi fue lo básico, siendo que vi como crear un objeto y sus atributos, como modificarlos y eliminarlos, ademas de agregar nuevos atributos a estos objetos. No estoy seguro si vi arrays.','2022-03-23'),(3835,236,'clase 5 (23/03/22)','En la clase de hoy realice el diagrama Gantt, también lo implemente en Project que seria lo mismo que el diagrama Gantt pero mas detallado, ademas termine con las tareas n°6 y 8 que me habían faltado terminar por falta de tiempo, y por ultimo ayude un poco con la continuación del boceto de la pagina ','2022-03-23'),(3836,227,'Gantt, kanban y Comienzo de desarrollo','El dia de hoy nos dividimos en 2 grupos. Mi grupo se encargó de realizar el kanban, con algunas de las tareas. Ademas, el diagrama gantt con algunas tareas mas generales. Finalmente, y la mayor parte del dia, comenzamos el desarrollo HTML y CSS, haciendl una pantalla inicial básica y un menu un poco mas desarrollado, con fondo y colores provisorios, pero con una estructura similar a la final','2022-03-23'),(3837,234,'Clase N°5','Nos dividimos en dos grupos para realizar las tareas.\r\nCon mi grupo realizamos bocetos de la página, el diagrama de Gantt en el cual colocamos las actividades que vamos a llevar a cabo en el proyecto, también empezamos con el html y css en el visual studio.','2022-03-23'),(3838,238,'Clase 5 23/3/2022','Realizamos (con mi grupo) una lista de tareas a seguir, comenzamos a analizar los datos que vamos a necesitar para la elaboración de la BDD.\r\nTraslade el diagrama de Gantt del Excel al Project Profesional. Creé el proyecto en GitHub (Kanban). Y comencé a realizar un Prototipo del formulario en base a lo diseñado en canva.\r\n','2022-03-23'),(3839,210,'bitacoria 7 25/03/2022','Hoy estuve ayudando a mis compañeros con las vistas del proyecto rojas, luego estuve mas tiempo con mi compañero Tolosa arreglando un bug que tenia con 6 cards que añadió a su vista de Tratamientos, estuve comentándoles a mis compañeros que el lunes tenemos permiso para ir al consultorio odotologico para hacer algunas preguntas a los doctores y hacer algunas tomas para la paginas ademas de mostrarles como venimos trabajando con la pagina hasta ahora y que es lo que podríamos llegar hacer','2022-03-25'),(3840,216,'Carpeta de campo personal - Proyecto &quot;Sistema de internación domiciliaria&quot;','El día de hoy me encontré completando y puliendo algunos detalles de mi carpeta de campo para la entrega de la misma.\r\nDiscutí con mis compañeros el estado del proyecto.','2022-03-25'),(3841,213,'Completando la carpeta de campo','El día de hoy lo base en recordar las cosas que hice en casa para ponerlas en la carpeta de campo, ya sea poniendo que tareas realice que problemas tuve con la mismas el tiempo de duración entre que empece y termine en algunas .Y recordando el paso a paso que tuve para la finalización de las mismas','2022-03-25'),(3842,209,'Lectura de material y avance en presentacion de proyecto','-Mayormente me dedique a leer material, ya que estuve ausente 2 dias\r\n-Avanzamos en la presentacion\r\n-Avanzamos en la documentacion\r\n-No hubo avances sustanciales en el producto ','2022-03-25'),(3843,242,'25-03-2022','prácticamente no he hecho nada o mucho, debido a un par de cosas que nos faltó para nuestro grupo. Tengo la oportunidad de repasar para Python (Mi lenguaje de programación elegido por mi) pero no tengo ni la más mínima idea de como comenzar a dar el tutorial que se me encargó de tal proyecto. Revisé un poco de la página anteriormente hecha para saber en qué puedo avanzar, pero tampoco soy el encargado de hacer la misma. Sin saber que podía hacer, era mejor hacer la tarea pendiente de la materia, cuando estaba haciendo una tarea de forma directa y literal, se cerró sola, así que en parte debo de comenzar desde cero.','2022-03-25'),(3844,214,'Vista tratamientos','edite la pagina y deje 2 columnas de 3 filas agrupándolas usando este código row-cols-1 row-cols-md-2 g-4 que busque en boostrap después las centre en css cambie las imágenes de cada carta y les agregue una descripción.','2022-03-25'),(3845,217,'problemas','el dia de hoy no hubo problemas con los drivers y no se reconocia el dispositivo por lo que se seguira intentando desde casa fue un dia de desaprovecho ya que mi compañero tambien tuvo problemas al descargar el ISO de windows 8.','2022-03-25'),(3846,219,'Desarrollo proyecto Stone','Continuamos con la realización del proyecto Stone y a pesar de la falta de tiempo pudimos avanzar un poco con las vistas de Órdenes y Productos (Gestion de Stock). A mi compañero Matías se le complico en gran parte el poder ubicar los elementos de la página de Órdenes, pero después de que me puse a ayudarlo junto a Domini, pudo terminar con lo propuesto.\r\nPor mi parte estoy en pleno desarrollo de la página de Productos y aunque no pude avanzar mucho pude darme una idea del cómo voy a organizarla y que es lo que tendrá dentro.\r\n','2022-03-25'),(3847,215,'25/03/2022','Hoy instale el windows 8.1 iso al pendrive para poder instalar a la netbook, y para eso mire videos que algunos me sirvieron y otros no. \r\nPerdi todo el dia por eso y que el internet andaba mal y no cargaba las cosas','2022-03-25'),(3848,223,'Solución de errores y ajustes de la pagina administrativa','El día de hoy, a pesar de la falta de tiempo para trabajar en el aula, avance mucho respecto a la pagina administrativa ya que logré, junto con mis compañeros, planificar cómo resolveremos el dilema de la segunda tabla de la página de ordenes, ademas de eso logré, con ayuda de mis compañeros insertar botones dentro de las tablas que conduzcan a una pagina mas detallada del pedido más adelante','2022-03-25'),(3849,220,'Gran avance de la pagina','Se realizó la parte de la página que realiza los pedidos','2022-03-25'),(3850,239,'clase 6','El dia de hoy dedique mi tiempo a estudiar la animacion sprite mediante css y terminar las ideas generales de la pagina.','2022-03-29'),(3851,237,'Clase 6','En esta clase estuve investigando sobre la api de Google o ver la manera de comunicar la pagina con el buscador de Google y futuramente del resto de las paginas, arme un diagrama con cada vista de la pagina.\r\n','2022-03-29'),(3852,246,'bitacora 29-03-2022-- Arenas Gonzalo Nicolas','En el día de la fecha realizamos un cambio en las tecnologías del trabajo , especificamente en la base de datos no relacional fue cambiada a una base de datos relacional. Por otro lado yo segui con la vista de videos sobre de base de datos y ayude  ami compañero con el login en codigo de php.','2022-03-29'),(3853,227,'Diseño gameplay','Continuamos el figma realizando frames correspondientes a la parte visual del proyecto en donde el usuario jugará la partida. Ademas, continuamos con el aprendizaje de MongoDB.','2022-03-29'),(3854,231,'Clase 6','Continuamos con con el proyecto, hoy recibimos a un nuevo integrante que la verdad no se que parte del proyecto hará, en cambio hoy presente un par de logos y diseños de bocetos que hice fuera del horario de la materia, el profesor Nahuel paso alumno por alumno para ver como vamos con la carpeta de campo también para ver como vamos con el avance del proyecto ;)','2022-03-29'),(3855,232,'CLASE 06 -29/03/2022','Hoy individualmente desarrolle e instalé todos los operativos y aplicaciones necesarias para el uso de MongoDB, mis compañeros por su parte prosiguieron con el diseño web del susodicho juego. Durante mi desarrollo para instalarlo tuve complicaciones con el querer conectarlo el CMD de Windows, el cual para eso tendré que utilizar &quot;mongosh&quot;, previamente habiendo declarado las variables de entorno en el directorio PATH','2022-03-29'),(3856,234,'Clase N°6','En el día de hoy empezamos a hacer el boceto del mapa de juego, con el reloj para la partida y la duración de las rondas, también diseñamos los territorios.','2022-03-29'),(3857,229,'29/09/2022','En esta clase, lo que realice fue una actualización de mi carpeta de campo al cambiarme de grupo de trabajo y poniéndome al día con lo que avanzaron mis nuevos compañeros de equipo ','2022-03-29'),(3858,238,'Clase 6 28/03/2022','Revisamos las tecnologías con las que íbamos a trabajar, y cambiamos algunas relacionadas con la BDD.\r\nContinúe trabajando con el diseño del formulario en HTML y CSS.\r\n','2022-03-29'),(3859,228,'Clase 6','seguí investigando sobre PHP y debatí con mis compañeros sobre la tecnología a utilizar para la base de datos, finalmente decidimos utilizar una base de datos relacional ','2022-03-29'),(3860,241,'Bitacora Clase N°6 - Tomás Ortellado 6°1° C','Hoy junto a mi grupo, seguimos con las ideas de lo que será el juego y la dinámica de este.\r\nLlegue un poquito tarde así que no tuve la oportunidad de hacer mucho, también siendo que mis compañeros acapararon el trabajo sobre el proyecto y cuando me propuse hacer algo aparte del proyecto, relacionado con Practicas Profesionalizantes, solo quedaba tiempo para hacer la bitacora.','2022-03-29'),(3861,245,'29/3/2022','el día de hoy seguí completando la carpeta y revisando cambios a futuro sobre php y html y la base de datos ','2022-03-29'),(3862,240,'Clase 6','Estuve realizando la vista de computación de nuestro pagina en HTML, he investigando como hacer un carousel','2022-03-29'),(3863,226,'Clase 6','Realice las vistas y trabaje con el diseño del login y register, también desarrolle la pagina principal y su respectivo estilo\r\n','2022-03-29'),(3864,225,'Bitácora 29-03-22','En el día de la fecha se continuó con los bocetos del juego. Esta vez se finalizaron parcialmente los diseños base de lo que sería la interfaz dentro de la partida y como se verían los territorios tanto de jugadores como neutrales. Todo esto se hizo mediante figma ','2022-03-29'),(3865,236,'clase 6 (29/03/2022)','En la clase de hoy, en mi grupo seguimos realizando cambios en las vistas de la pagina y fuimos agregando mas cosas en los diagramas de Kanva y Gantt.','2022-03-29'),(3866,230,'Clase 29/03','Comencé a ver programación orientada a objetos en Java a través de videos explicativos de un canal llamado yacklyon. Aprendí algo de teoría sobre este paradigma de programación y vi cómo crear un proyecto, un paquete y una clase. ','2022-03-29'),(3867,233,'Clase 29/3/22','El día de hoy continuamos con el proyecto. Por mi parte seguí con la investigación, busque información sobre el paradigma de la programación y como funciona el lenguaje de Python para el desarrollo de la pagina web','2022-03-29'),(3868,231,'clase 7','Hoy seguimos avanzando con el proyecto a que yo me estuve encargando de diseñar el logo a paritr de photoshop aunque tarde un poco tambien se me ocurrió usar adobe illustator tardo un poco la instalacaion pero al final no fue de mucha ayuda porque termine haciendo el logo por photoshop los demas integrantes siguieron con la consttruccion de la pagina y tengo un trabajo extra para casa','2022-03-30'),(3869,235,'clases 30/03','en el dia hoy, empezamos con el trabajo en grupo. voy a trabajar con el lenguaje HTML','2022-03-30'),(3870,224,'Clase 7','Colaboré con mi grupo en la parte de la organización de la base de datos, en el diseño del index de la pagina web, en la estructura de la misma. También, perfeccionamos en conjunto las tablas de la base de datos para luego, poder llenarlas con la información.','2022-03-30'),(3871,230,'Clase 30/03','Hoy creé mi primer programa con programación orientada a objetos con la ayuda de un video del canal yacklion. En este programa creé una clase llamada Perro con un par de métodos y de ahí creé varios objetos.\r\nVideo: https://www.youtube.com/watch?v=vdRf_sApv2c&amp;list=PLg9145ptuAiiA1S27X8QeFsloBvad5Cy9&amp;index=4','2022-03-30'),(3872,234,'Clase N°7','Empecé a buscar información sobre Java Script para posteriormente poder desarrollarlo en el proyecto.\r\nTambién debatimos sobre distintos temas con mi grupo, cambiamos cosas del menú, la temática de las preguntas, pensamos como podría ser el mapa (papel o físico), entre otras cosas.','2022-03-30'),(3873,232,'CLASE 07 - 30/03/2022','Hoy seguí desarrollando y completando las bases de datos y empecé a profundizar y seguir conociendo herramientas y atajos en el lenguaje JavaScript. Mis compañeros con el apartado grafico descartaron la mayoría de los diseños previamente diseñados retomando nuevas ideas y conceptos, cosa que me hará reformular vertiginosamente los programas que vaya desarrollando.','2022-03-30'),(3874,228,'Clase 7','Continué estudiando PHP y comencé a idear las tablas de la base de datos junto con mi equipo.','2022-03-30'),(3875,246,'bitácora 30-03-2022 Arenas Gonzalo Nicolas','Avanzamos con el trabajo final de la materia, debatimos grupal mente nuevas ideas para poder implementar al trabajo (los servicios que va a brindar nuestra pagina, etc.)\r\npor mi parte realice y empece la base datos. Las tablas principales, que luego sera modificadas y se le agregaran mas cosas, y posteriormente continuare avanzando con la misma base de datos y colaborando con la conexion de la misma.','2022-03-30'),(3876,227,'Cambio de rumbo','Al comenzar el dia entramos en discusion en cuanto al diseño, por lo que nos pusimos de acuerdo con el grupo entero e ideamos una nueva tematica para el diseño, el cual consistirá en una temática en papel. Ademas, debatimos otros temas como la conquista de territorios y el sistema de dificultad de preguntas.\r\nFinalmente, realizamos los nuevos bocetos en figma, continuamos la base de datos y empezamos el desarrollo de diseño en photoshop.','2022-03-30'),(3877,226,'Clase 7','El día de hoy desarrolle las vistas del login, register, y la vista principal de la pagina, elegimos los iconos por defecto que aparecerían en la edición del perfil.','2022-03-30'),(3878,237,'Clase 7','Arranque con la api de mercado libre armando un formulario que llamara a un id de mercado libre para que me devuelva una descripción con imágenes. ','2022-03-30'),(3879,229,'30/03/2022','El día de hoy di como finalizada la &quot;creación&quot; de los diseños para la web del SuperBuscador, repase de forma visual lo que seria código html y css.\r\n\r\nPara finalizar, decidí crearme una cuenta de Udemy para poder repasar, buscar y aprender todo lo necesario para la realización del trababa .','2022-03-30'),(3880,236,'clase 7 (30/03/22)','En el día de la fecha realice investigaciones acerca de CSS para analizar mas a profundidad ciertas áreas para modificar la pagina a gusto, también estuve realizando ciertos cambios en las vistas de la pagina y fui probando ciertas cosas para ver  como iría quedando el boceto de la pagina','2022-03-30'),(3881,240,'Clase 7','Realice la vista de computación, automotores, mecánica, luego busque iconos para las imágenes de perfil de la pagina ','2022-03-30'),(3882,247,'Primera Clase Desarrollando el Proyecto (30/3)','Hoy empezamos a desarrollar el proyecto de la página web, la cual tiene 4 lenguajes de programación. Empezamos haciendo el diseño de cómo sería la página y continuamos con una versión beta de lo que sería una versión primitiva de la página.','2022-03-30'),(3883,239,'clase 7','El día de hoy discutí con mi grupo una base para empezar con la pagina, y empezamos con la creación de las vistas de la pagina ','2022-03-30'),(3884,225,'Bitácora 30-03-22','Se discutió sobre el diseño cambiando la temática de los menús a papel y se cambiaron también las mecánicas de conquista de territorios. \r\nSe avanzó con los diseños en photoshop y figma','2022-03-30'),(3885,238,'Clase 7 30/03/2022','Continúe con el desarrollo del formulario.\r\nDefinimos las tablas que vamos a utilizar en la BDD.\r\nComencé el desarrollo del Index en HTML y CSS.\r\n','2022-03-30'),(3886,245,'30/33/2022','El día de la fecha con mi grupo avanzamos mas con el producto, en mi caso personal agregue en la base de datos un carrito para guardar la selección de compra de los clientes y tambien en la sección de perfiles agregue la posibilidad de que las personas puedan guardad el gusto que quieran de su fondo de perfil ','2022-03-30'),(3887,233,'Clase 7 30/3/22','En la clase de hoy planificamos como será el diseño de la página y realizamos una versión beta . Luego cada integrante siguió con la investigación de los lenguajes.','2022-03-30'),(3888,241,'Bitacora Clase N°7 - Tomás Ortellado 6°1° C','El grupo de proyecto hicimos grandes avances con lo que queremos que sea el juego y conceptos visuales. Empezamos con la idea de hacer las interfaces con un estilo tipo papel/papiro y el gameplay realista, pero al final decidimos que tanto las interfaces como el gameplay tome ese estilo visual.\r\nTambién decidimos con serán los menus y empezamos a crear un mapa.\r\nPor supuesto, también continuamos con el desarrollo del juego como tal, con cosas como ventajas por terreno, o, desventajas por moverse en terreno difícil, entre otras cosas.\r\nAunque lo primero que pensamos fue en que culturas (europeas) se van a inspirar las facciones dentro del juego.','2022-03-30'),(3889,209,'Login, vista principal y diagrama','-Terminamos de diseñar el login\r\n-Empezamos a diseñar la vista principal\r\n-Continuamos la presentacion, planteo de problema en proceso\r\n-Diagrama de flujo de datos\r\n','2022-03-31'),(3890,210,'bitacoria 8 25/03/2022	','Estuve ayudando a Soler, Tolosa y Sosa a terminar sus vistas. corrigiendo errores que tenían al momento de hacer la pagina responsive y agregando funcionalidad a lo ya preestablecido para luego poder unificar las 4 vistas en una sola y poder presentárselo al cliente en cuestión y darle un adelanto sobre la pagina web','2022-03-31'),(3891,208,'Formulario Vista Contacto','Rediseñe el formulario de la vista contacto ya que era bastante feo, ahora es mucho mas bonito me queda darle algunos retoques.\r\nTuve un problema al usar el Span de algunos divs, al poner su position en absolute se me superponen y se vuelve ilegible. La idea es agregarle animaciones con JS para que sea mas interactivo','2022-03-31'),(3892,211,'login, diagrama y carpeta de campo','seguimos avanzando con el login y ya lo terminamos, retoque la carpeta de campo','2022-03-31'),(3893,216,'Proyecto N° 1 #06','Avanzamos con la presentación del proyecto, realizamos el diagrama de flujo de datos del sistema y pensamos en cómo serian sus vistas.','2022-03-31'),(3894,214,'vista tratamiento','avance con la pagina definiendo los colores que tendrá la misma una vez terminada también corregí el código borrando lineas sin funcionalidad dejando los botones de las tarjetas','2022-03-31'),(3895,213,'Modificando y Agregando funciones','Al realizar la daily que nos correspondía nos fuimos cada uno a trabajar en su vista correspondiente. En mi caso sigo con la vista de Turnos pero realmente no podía modificarla mucho mas ahora lo que si realice fue agregarle funcionalidad a los botones ya existentes como el de Whatsapp y el de Urgencia. El de Whatapp crea una conversación con un numero en especifico y el de Urgencia empieza de inmediato una llamada al numero correspondiente','2022-03-31'),(3896,215,'31/03/2022','Hoy no pude avanzar mucho ya que mi compañero de trabajo, el tenia el programador y gracias a eso estuve revisando otras maquinas que el profesor me mando a revisar, algunas eran nuevas y estaban bloqueadas, por otro lado habian muchas netbook que no tenian la bateria.\r\nMe puse a ver un video de como instalar el windows en la netbook','2022-03-31'),(3897,215,'31/03/2022','Hoy no pude avanzar mucho ya que mi compañero de trabajo, el tenia el programador y gracias a eso estuve revisando otras maquinas que el profesor me mando a revisar, algunas eran nuevas y estaban bloqueadas, por otro lado habian muchas netbook que no tenian la bateria.\r\nMe puse a ver un video de como instalar el windows en la netbook','2022-03-31'),(3898,215,'31/03/2022','Hoy no pude avanzar mucho ya que mi compañero de trabajo, el tenia el programador y gracias a eso estuve revisando otras maquinas que el profesor me mando a revisar, algunas eran nuevas y estaban bloqueadas, por otro lado habian muchas netbook que no tenian la bateria.\r\nMe puse a ver un video de como instalar el windows en la netbook','2022-03-31'),(3899,215,'31/03/2022','Hoy no pude avanzar mucho ya que mi compañero de trabajo, el tenia el programador y gracias a eso estuve revisando otras maquinas que el profesor me mando a revisar, algunas eran nuevas y estaban bloqueadas, por otro lado habian muchas netbook que no tenian la bateria.\r\nMe puse a ver un video de como instalar el windows en la netbook','2022-03-31'),(3900,223,'Replanteamiento del proyecto y continuación en la pagina administrativa','El día de hoy trabajamos respecto a las nuevas peticiones del proyecto que nos encargaron, aparte de eso me ocupe de continuar con la pagina administrativa de la plantilla, en la sección de ordenes y productos, y en la base de datos en MongoDB','2022-03-31'),(3901,215,'01/04/2022','Hoy desarme la netbook para hacer un cambio de pantalla, ya que la pantalla estaba rota por dentro y poder repararla.','2022-04-01'),(3902,216,'Proyecto N° 1 #07','Al llegar revisamos el GANTT, hablamos sobre el rumbo del proyecto, vimos entre todos el código actual mientras discutíamos la manera en la que deberíamos seguir.','2022-04-01'),(3903,208,'Volviendo Responsive la pagina web','Hoy use la mayor parte de las horas en arreglar el @media en mi archivo estilos.css para que las etiquetas .contactForm y .contactInfo se vuelvan responsive y de esta forma se podrá usar la pagina desde cualquier tipo de dispositivo electrónico con cualquier tipo de resolución ya sea una pc,tablet, ipad o telefono celular','2022-04-01'),(3904,213,'Suplantación administrativa','El dia de hoy tras la falta de nuestro Scrum Master decidí ir a ver el trabajo de mis compañeros de grupo para ver en que tareas podria ayudarlos. Considere que mi vista de la página estaba terminada por lo que me pude permitir lo antes dicho. En un principio buscamos como agregar un mapa de maps a una vista pero iba a quedar muy sobrecargar de información ','2022-04-01'),(3905,209,'Replanteo de vistas, inicio de desarrollo, investigamos materialize','-Replanteamos el aspecto de la vista principal\r\n-Empezamos el desarrollo de la misma\r\n-Investigamos como implementar Materialize en nuestro proyecto\r\n','2022-04-01'),(3906,214,'Vista Contacto-tratamiento','Hoy avance e hice que la vista de tratamientos fuera responsive debido a que el contenedor de las cartas era muy grande sin limitarlo luego junte todo la vista en un contenedor,luego con un compañero le ayude a terminar un formulario corto de la vista contacto y faltó el que sea responsive','2022-04-01'),(3907,211,'inicio de desarrollo de la vista principal','en el día de hoy comenzamos el desarrollo de la vista principal de la pagina, adeamas decidimos investigar y utilizar los elementos que ofrece materialize.','2022-04-01'),(3908,217,'reparacion de PCs','se intentó reparar el programador CH341A y en un principio parecia que funcionaba al probarlo en un solo tpm, pero dentro de unos pocos minutos ya no reconocio mas el tpm, por lo que se pudo deducir que habria un falso contacto con los pines asi que se averiguara que mas hacer en casa o la proxima clase.','2022-04-01'),(3909,246,'05-04-2022 Arenas Gonzalo Nicolas','Hoy seguí con mi carpeta de campo, complete unas cosas que me faltaban agregar (que lo anote en un word aparte) y también seguí con el proyecto, modifique unas cosas mínimas de la misma y también hable con el docente sobre los frameworks que son y cuales hay.','2022-04-05'),(3910,247,'Desarrollo del Proyecto II (5/4)','El día de hoy, se han realizado un par de cambios en la pagina web. Se agregaron nuevas secciones donde se hable en detalle varios aspectos del lenguaje a desarrollar, como por ejemplo las tablas, el output, navbar, etcétera, sumado a un cambio en la paleta de colores de la página. Hoy también se reviso las Carpetas de Campos desarrolladas hasta este momento y cuan completas están en relación a la actividad realizada.','2022-04-05'),(3911,224,'Clase 8','Continué con el desarrollo del diseño de pagina conjunto a mí grupo, participé en el debate sobre las implementaciones a la página y trabaje en mí carpeta de campo.','2022-04-05'),(3912,234,'Clase N°8','Empecé a realizar el javascript en el Visual Studio Code para el proyecto final, también busqué más información sobre este tema para poder realizarlo en HTML.','2022-04-05'),(3913,227,'Continuacion de figma nuevo','Continuamos el diseño del los bocetos en figma, pensando, diseñando y debatiendo cómo podria ser la pantalla en la cual se lleva a cabo la partida, es decir, el gameplay.','2022-04-05'),(3914,228,'Clase 8','Actualice la carpeta de campo agregando mas detalle a las actividades realizadas y converse con el docente y mi compañero encargado de la bdd sobre formas de mejorar la seguridad para evitar inyecciones sql','2022-04-05'),(3915,245,'5/4/2022','El dia de hoy empezamos a deseñar la pagina web mediante html y css segun los bocetos anteriormente hechos en mi grupo \r\n','2022-04-05'),(3916,231,'clase 8','la clase fue algo corta pero pude avanzar con el diseño, los chicos estuvieron ocupados con el armado de PHP y un problema con X código, Dariel trajo consigo una tableta gráfica para que la utiliza en el desarrollo del diseño pero no funciono ya que la aplicación de la que depende necesita que la computadora se reinicie para que esta funcione y sin eso aun continuo con el diseño ya que voy algo atrasado','2022-04-05'),(3917,229,'05/04/2022','En la clase de hoy, se hablo sobre como empezar la pagina, dando como resultado el implementar el software de diseño y desarrollo web, mas conocido como Bootstrap, con la que podremos a futuro, tener una manipulación mas cómoda y rápida sobre el trabajo   ','2022-04-05'),(3918,230,'05/04','Seguí practicando POO con Java, más específicamente los conceptos de métodos y de constructor con el siguiente video:\r\nhttps://www.youtube.com/watch?v=5PFtcRIQx0I&amp;list=PLg9145ptuAiiA1S27X8QeFsloBvad5Cy9&amp;index=5\r\nTambién organicé mejor mi carpeta de campo.','2022-04-05'),(3919,241,'Bitacora Clase N°8 - Tomás Ortellado 6°1° C','El día de hoy iba a empezar a agregar contenido a la base de datos, pero como recién estamos empezando el proyecto y realmente aún no tenemos las bases planteadas para hacer una base de datos en condiciones, decidí junto a la recomendación de un compañero expandir mis conocimientos con Mondodb para cuando tenga que realizar la base de datos.','2022-04-05'),(3920,239,'clase 8','hoy solo estubimos resolviendo algunos problemas en el html pero eran demasiados y decidimos optar por usar boostrap studios un software que ayuda en la creacion de la pagina web.','2022-04-05'),(3921,238,'Clase 8 05/04/2022','Continúe con el desarrollo del formulario, empezando a diagramar el responsive de las cajas principales utilizando display: flex -&gt; flex-wrap: wrap.','2022-04-05'),(3922,225,'Bitácora 05-04-22','En el día de la fecha seguimos debatiendo sobre el diseño, en este caso del HUD de la partida.','2022-04-05'),(3923,237,'Clase 8','Hoy continué viendo las Apis, en especifico la de Ebay con el buscador de productos para añadirlo a al proyecto','2022-04-05'),(3924,240,'Clase 8','Busque y re organicé las imagines para la pagina','2022-04-05'),(3925,236,'clase 8 (05/04/22)','En el día de la fecha seguimos realizando la parte de las vistas y seguí realizando investigaciones que me ayuden a seguir con la parte de CSS y HTML.','2022-04-05'),(3926,226,'Clase 8','Modifiqué los iconos del footer, busque contenido multimedial para la pagina y organicé el github del proyecto','2022-04-05'),(3927,247,'Desarrollo del Proyecto III (6/4)','Hoy se continuo con el desarrollo de la pagina web sobre los lenguajes de programación. Se le añadió un navbar a la página, la cual incluía, entre otras cosas, el &quot;Inicio&quot;, la posibilidad de elegir cual lenguaje ver haciendo click en &quot;Java&quot;, &quot;Javascript&quot;, &quot;Python&quot; o &quot;MySQL&quot;. Aparte de esto, las personas que entren a la página ya pueden registrarse e iniciar sesión en el lugar. También se añadió un buscar para quien desee buscar un elemento específico de la página.','2022-04-06'),(3928,234,'Clase N°9','Realice un boceto de un JavaScript para el proyecto, en el cual mostré los elementos que hay en la base de datos.\r\nTambién ayudé un poco a mis compañeros de grupo que realizaban un boceto de un mapa.','2022-04-06'),(3929,224,'Clase 9','Continué con la modificación de la visual del index. Junto a mis compañeros de equipo, debatimos cuestiones sobre el formulario y la base de datos para poder iniciar con el PHP. ','2022-04-06'),(3930,232,'CLASE 09 - 06/04/2022','Hoy logré recopilar información sobre el funcionamiento de NODE.JS y como es que vamos a implementar MongoDB en nuestro archivo principal de JavaScript, yo personalmente me siento de acá en adelante a empezar a desarrollar el proyecto principal de JavaScript, solo será cuestión de aprender varios conceptos nuevos, las bases ya las tengo adquiridas de antes.','2022-04-06'),(3931,238,'Clase 9 06/04/2022','Continúe desarrollando el formulario.\r\nCambiamos la forma en la que se definía si el servicio era a domicilio o al local para facilitar el uso posterior de PHP.\r\n','2022-04-06'),(3932,228,'Clase 9','Continué realizando la conexión entre la base de datos y el formulario. Debatí con mis compañeros sobre los datos que debíamos ingresar en el formulario, como ingresarlos y las tablas y campos que debía tener la base de datos.','2022-04-06'),(3933,246,'Clase 9','Continue realizando la carpeta de campo, modifique la base de datos, hable con mis compañeros sobre los cambios a realizar en la base de datos..','2022-04-06'),(3934,229,'06/04/2022','La clase de hoy nos centramos en comprender la utilización de APIs.\r\nSe realizo un avance en el diseñado mediante bootstrap, colocando los diseños principales.\r\nSe realizara un trabajado de bootstrap y codificación manual para el proyecto\r\n','2022-04-06'),(3935,230,'06/04','Hoy vi, practiqué haciendo algunos códigos y vi las diferencias entre los modificadores de acceso como public y private usando un video como guía. También practiqué el uso del get y del set. Los videos son los siguientes:\r\nhttps://www.youtube.com/watch?v=FA6hRabTcio&amp;list=PLg9145ptuAiiA1S27X8QeFsloBvad5Cy9&amp;index=6 \r\nhttps://www.youtube.com/watch?v=pPSH0gcv8Zc&amp;list=PLg9145ptuAiiA1S27X8QeFsloBvad5Cy9&amp;index=7 ','2022-04-06'),(3936,227,'Comienzo de animación del menu','El dia de hoy comencé la base del HTML y CSS de la pagina remodelada, siguiendo el nuevo desarrollo en fima con la nueva tematica. Investigué acerca de cómo hacer la animación de menú giratorio y realicé algunas pruebas al respecto.','2022-04-06'),(3937,241,'Bitacora Clase N°9 - Tomás Ortellado 6°1° C','En esta clase estuve aprendiendo las bases de Javascript, así como también sin querer me dormí en el recreo y me pegue una siestita rejuvenecedora de media hora, y luego de eso fue que me puse a ver Javascript junto a mi compañero Ignacio Giron, siendo que antes de eso (yo)  estaba muy cansado y no tenía claro con que seguir en el proyecto.\r\nNo hay nada más destacable por resaltar.','2022-04-06'),(3938,245,'6/4/2022','El dia de hoy con mi compañero estuvimos trabajando en un prototipo de html para la pagina web ','2022-04-06'),(3939,240,'Clase 9','Cambie el origen de todas las imágenes, desarrolle la vista información general :)','2022-04-06'),(3940,231,'clase 9','el día de hoy tuvimos un gran avance los chicos continuaron con el PHP y Dariel con el diseño CSS, por mi parte yo continué con el diseño para la pagina hoy diseñe un fondo para esta con un efecto como los fondos por defecto de whatsap, termine una idea de diseño del logo que que elegimos pero aun me falta por hacer los demás logos responcive con esto seria todo lo avanzado el día de hoy aunque me quedaria por actualizar la carpeta de campo','2022-04-06'),(3941,237,'Clase 9','El día de hoy comencé a hacer el buscador de productos de la api de mercado libre y unificarlo con el código que  muestra sus descripciones de cada uno de ellos.','2022-04-06'),(3942,226,'Clase 9','Modifiqué el diseño del footer, rediseñé la vista perfil y cree las vistas de seguridad e información general.','2022-04-06'),(3943,233,'clase: 6/4/22','El día de la fecha se continuó con la investigación del lenguaje de programación Python.  Los temas abordados fueron:\r\n-Sintaxis -Comentarios - Variables -Tipos de Datos -Strings - Booleanos y Operadores','2022-04-06'),(3944,236,'clase 9 (06/04/22)','En la clase de hoy seguimos realizando las vistas y estuvimos investigando maneras de poder acomodar las vistas correctamente, básicamente lo mismo que la clase pasada','2022-04-06'),(3945,239,'clase 9','El día de hoy terminamos la plantilla de lo que seria nuestra pagina utilizamos el programa boostrap studios para hacerlo de forma mas rápida luego la idea es usar la plantilla y cambiar el css y html para terminar la pagina','2022-04-06'),(3946,213,'Dominios y hosting','El dia de fuimos con el profesor para ver de qué forma podríamos subir nuestra pagina a internet y vimos que esto deberíamos poner el dominio a nombre de alguien y contratar un servicio de hosting con esto comparamos los precios en el mercado para ponerle un precio acorde a lo que es la página ','2022-04-07'),(3947,210,'bitacoria 9 25/03/2022	','Hoy estuvimos preguntandole al profe del funcionamiento de una pagina web y como y cuanto podriamos cobrar a nuestra clienta del consultorio odontologico, luego estuvimos debatiendo en como rehcacer las nuevas vistas de la pagina para cumplir con la actividad y ademas para poder ofrecerle un mejor servicio a nuestra clienta','2022-04-07'),(3948,215,'07/04/2022','Hoy pase todos los apuntes a un Excel y estuvimos arreglando el programador que todavía no sabemos cual es el problema, ya que al parecer la pinza no anda.','2022-04-07'),(3949,217,'intento de reparacion','se intento repara el progamador CH341A con todo tipo de ayudas entre videos y consejos pero no se pudo, con lo que se llego a la idea de comprar un nuevo progamador tambien se continuo con la carpeta de campo y se estuvo poniendo en practica el continuar con erl desarme de las computadoras que son casi imposibles de reparar','2022-04-07'),(3950,220,'3er Reinicio del proyecto ','se aclararon las ideas que se tenian desconocidas de antes ya que hubo mucha desinformacion y no se habia llegado a nada \r\nempezaremos a trabajar en la pagina administrativa que teniamos y cambiamos cosas','2022-04-07'),(3951,215,'08/04/2022','Hoy ordene cada máquina con su número respectivo, estuve viendo algunas netbook que no tenían apuntadas en la libreta donde están todas las netbook. ','2022-04-08'),(3952,213,'Inicio de las base de datos','Hoy me centré en el avance del proyecto más como aplicación que como una página web por lo que inicie con la creación de la base de datos \r\nMe realize las preguntas para que necesitaria una base de datos en una clínica odontológica y se me vino la idea de la organización de turnos en esta misma \r\n','2022-04-08'),(3953,210,'bitacoria 10 08/04/2022	','hoy estuve corrigiendo las wave de la pagina para que no tenga esa forma recta la pagina y tener la pagina un poco mas &quot;morderna&quot; que otras, ademas estuve con mi compañero soler hablando sobre como seria la base de datos y cuantas partes tendria ademas de que funcionalidad tendria cada una','2022-04-08'),(3954,217,'cambio de pantalla','al no poder usar el programador ch341a lo que ocurrio fue que tuvimos que reemplazar la pantalla dañada de una co