mos en el minuto 47, los detalles de lo visto en el video estarán en la carpeta de campo.','2022-04-12'),(3971,227,'Continuacion de animacion css','El dia de hoy modifiqué el archivo css para animar el menu. Me basé en un trabajo ya hecho de internet y lo adapté utilizando animaciones infinitas en vez de transform.','2022-04-12'),(3972,232,'CLASE 10 - 12/04/2022','Hoy estuve profundizando sobre el uso de JavaScript, me puse con mi compañero Tomas Ortellado a ver un vídeo donde se recapitulaban conceptos básicos, funciones y expresiones lógicas para su correcto funcionamiento, apartado de esto, desde mi propia computadora instalé Node.js, estoy aprendiendo sobre su funcionamiento.','2022-04-12'),(3973,230,'12/04','Hoy añadí, con ayuda de mi compañero Santiago Potenza, el logo a la vista de prueba de la página. También comencé a diseñar la página de prueba donde estarán las explicaciones de los distintos temas de Java.  ','2022-04-12'),(3974,236,'clase 10 (12/04/22)','En la clase del día de hoy avanzamos con lo que seria el diseño de las vistas de manera &quot;oficial&quot;, digo oficial porque ya creamos todas las vistas, y ya empezamos a hacerle sus retoques correspondientes.','2022-04-12'),(3975,247,'Desarrollo de la pagina JavaScript (13/4)','El día de hoy, se pudo realizar la versión beta de la página dedicada a enseñar el lenguaje de programación &quot;JavaScript&quot;. Su diseño, parecido al de la pagina principal, cuenta con un sidenav con 6 temas distintos, los cuales también tendrían una opción para acceder a más opciones dentro de los temas. Esta también cuenta con una poca cantidad de texto, la cual pronto se va a convertir en una introducción al lenguaje, sumado a un video donde también se explique de que trata JavaScript y como funciona.','2022-04-13'),(3976,234,'Clase N°11','En la clase de hoy terminé con el JavaScript de la base de datos y empecé a investigar para desarrollar el JavaScript del css.','2022-04-13'),(3977,239,'Dia 11 13/4/22','continué con la creación de la pagina principal del proyecto ','2022-04-13'),(3978,232,'CLASE 11 - 13/04/2022','Hoy conocí sobre la pagina para hosting &quot;000webhost.com&quot;, acá vamos a plasmar todos nuestros códigos para empezar a darle forma física a nuestro proyecto, hoy desarrollé archivos JavaScript tanto para implementar MongoDB, como para agregar registros JSON usando MongoDB. ','2022-04-13'),(3979,237,'Clase 10','Continué desarrollando el php con el api de mercado libre agregándole un formato y los atributos de los productos y un link directo a mercado libre','2022-04-13'),(3980,230,'13/04','Hoy continué haciendo una plantilla de lo que sería el diseño de la sección de Java de la página a desarrollar en html. Le agregué un menú lateral con cada tema, opciones las cuales se abren y tendrían allí cada subtema. También le agregué otro menú en la parte superior con los distintos lenguajes y otras opciones. ','2022-04-13'),(3981,240,'Clase 11','Continué con el diagrama de entidad de relación, Investigue de como normalizar un diagrama de entidad y los pasos a seguir ','2022-04-13'),(3982,231,'Clase 11','El día de hoy avanzamos con las animaciones, empece a diseñar un diseño animado de que se podría de decir con forma de malvaviscos con vida y personalidad, recibí ayuda con las ideas por parte de Tobias para el diseño de los dos docentes de la materia (Gonzalo y Nahuel), tambien imagenes PNG para el fondo de la pagina con respecto al diseño y quedo pendiente el movimiento de animacion ya que nos pasamos la mayor parte de la clase con el diseño de Gonzalo ya que tuvimos que hacer dos que no es necesario explicar','2022-04-13'),(3983,228,'Clase 11','modifique y corregi errores en las consultas PHP y modifique campos de la base de datos','2022-04-13'),(3984,233,'Clase 10 13/4/22','En la clase de hoy, realice un boceto del logo de nuestra página web para, posteriormente re diseñarlo de manera digital. Luego de realizar el boceto, continuamos con el diseño de la página web.\