l. Esta versión cuenta con logo propio, las secciones del cuerpo ahora tienen imágenes relacionadas al lenguaje en cuestión, sumado al cambio en el diseño y la paleta de colores de la página. También se realizó la página para poder registrarse en la futura página.','2022-04-19'),(3995,232,'CLASE 12 - 19/04/2022','Hoy me puse a desarrollar y modificar algunos de los diagramas pertinentes a nuestro proyecto, uno de estos fue el FODA, el cual plasmamos nuestras fuerzas y debilidades del trabajo. Para completarlo utilice de la herramienta web llamada “draw.io”. El otro fue el diagrama de Gantt, empecé a modificar algunos valores en los mismos para que se vean mas acordes a nuestros lapsos de tiempo reales','2022-04-19'),(3996,224,'Clase 12','Actualicé y puse al día mí carpeta de campo, colaboré con el armado del kanban en conjunto a mí grupo terminamos de determinar las tareas.','2022-04-19'),(3997,228,'Clase 12','Subi el proyecto a github, realice un versionado del proyecto y su kanban ','2022-04-19'),(3998,226,'Clase 12','Le dimos introducción a la nueva integrante del proyecto, le puse títulos html a las vistas y le agregué un favicon para ver como quedaba','2022-04-19'),(3999,238,'Clase 12 19/04/2022','Trabaje en la carpeta de campo, tanto personal como del proyecto.\r\nAyude a crear un repositorio en GitHub del proyecto.\r\n','2022-04-19'),(4000,249,'Clase 1','El día de hoy me sume a un grupo para iniciar con el proyecto, estuve familiarizándome con dicho  trabajo, viendo las carpetas de cada uno de los integrantes, y también comencé con los test de las practicas','2022-04-19'),(4001,245,'19/4/2022','El día de hoy he hablado con mis compañeros para seguir arreglando cosas del trabajo.\r\nEn mi caso personal he hecho parte del documento llamado FODA','2022-04-19'),(4002,229,'19/04/2022','El día de hoy, finalice las animaciones de Gonzalito(Consorti modo caricatura)\r\nRediseñado de la mascotita de Nahuelito(Acosta Nahuel)','2022-04-19'),(4003,241,'Bitacora Clase N°12 - Tomás Ortellado 6°1° C','El día de hoy junto a mi compañero Ignacio Girón realizamos el primer concepto de análisis FODA de nuestro proyecto.\r\nAparte de eso hice un ligero progreso con la carpeta de campo, así como la bitácora de la clase anterior, ya que me olvide de realizarla siendo que me retire antes.','2022-04-19'),(4004,227,'Clase 19-04','El dia de hoy continué la vista &quot;configuracion de partida&quot;. Intenté agregar una rueda para seleccionar la facción, sin embargo, se me mezcló el código en el proceso y tuve que borrar todo. En conclusion, el avance realizado (además de conocer cómo realizar lo que intentaba tras esta experiencia) fueron algunos cambios minimos de letra y tamaños.','2022-04-19'),(4005,237,'Clase 12','El día de hoy me centre en el api de ebay, es mas complicada que la de mercado libre debido a que necesito keys y registros. creando htmls y php','2022-04-19'),(4006,230,'19/04/2022','Hoy pudimos arreglar un problema que teníamos al poner las opciones de iniciar sesión y registrarse con HTML en la página de inicio. También investigamos sobre cómo hacer sidebars para poder ponerlas de una manera más prolija y adecuada con los respectivos temas en las páginas donde se explican los lenguajes.  ','2022-04-19'),(4007,231,'Clase 12','Hoy es martes y la clase fue corta pero continuamos con el proyecto en mi caso yo entregue los diseños que hoze el finde largo para que Nahuel lo convierta en un gif o una imagen en movimiento admito q fue algo complicado diseñar al profe Gonzalo y debati con Tobias hacerca del diseño del profe Nahuel y el día d mañana continuaremos con su diseño y animacion','2022-04-19'),(4008,239,'dia-12 19/4/22','hoy continua con la edición del css de la pagina ya que la primera vista daba una idea muy obscena si que la tuve que cambiar.','2022-04-19'),(4009,236,'clase 12 (19/04/22)','En la clase del día de hoy me dedique mayormente a lo que seria en la documentación del proyecto y hacer varias correcciones de las vistas de la pagina, ademas de también corregir lo que seria algunos diagramas.','2022-04-19'),(4010,233,'Clase 19/4/22','En la clase de hoy le investigamos sobre como funcionan los sidebar para luego añadirlos en a la página web y también solucionamos el error de los botones de inicio de sesión en la misma.','2022-04-19'),(4011,240,'Clase 12','Finalice el diagrama de Foda, el profesor verifico el diagrama de uso de casos que realice, estuve explicándole a la nueva integrante del grupo acerca de que se trata el proyecto  ','2022-04-19'),(4012,225,'Bitácora 19-04-22','Se finalizó la Pantalla de inicio de la carta con el sello y se comenzó con el menú principal','2022-04-19'),(4013,237,'Clase 13','Hoy me dedique a seguir leyendo e investigando como usar la Api de ebay, sin lograr ningún resultado hasta el momento mas que errores.','2022-04-20'),(4014,230,'20/04/2022','Hoy investigué un poco sobre JavaScript para usar en un futuro en la página. También, con ayuda de w3schools.com, conseguí implementar una sidebar en la sección de Java, la cual puede abrirse y cerrarse, además de implementar la navbar que teníamos en la página de inicio en la página de Java. ','2022-04-20'),(4015,234,'Clase N°13','Debatimos en grupo sobre qué facciones deberían aparecer en el juego y como deberían ser las tropas.\r\nLuego empecé a investigar para hacer el javascript de las animaciones.','2022-04-20'),(4016,228,'Clase 13','Realice el diagrama de los casos de uso e investigue sobre AJAX y la forma normal de las bases de datos ','2022-04-20'),(4017,247,'Diseño de la Nueva Versión de la Página I (20/04)','El día de hoy, se estuvo investigando para la mejora del navbar y la implementación del sidebar en la página del lenguaje Java. Se vieron varias opciones, desde animadas hasta no animadas o de distintos estilos. También modificamos el cuerpo de la página para poder acomodar mejor el texto y el sidebar.','2022-04-20'),(4018,238,'Clase 13 20/04/2022','Trabaje en la carpeta de campo. Comencé a hace