),(4026,235,'clase 20/4','seguimos trabajando en grupo','2022-04-20'),(4027,232,'CLASE 13 - 20/04/2022','Hoy estuve desarrollando en JavaScript cómo insertar archivos de la Base de Datos en un archivo, esto lo haré primordialmente a partir de la función “onClick()”, a su vez, creé un correo electrónico en 000webhost dedicado a nuestro grupo donde alojaremos nuestro proyecto y empecé a desarrollar otra tabla para nuestra base de datos, la cual se llamó “Facciones”.','2022-04-20'),(4028,248,'20-04-2022','Hoy termine de revisar cada netbook con sus respectivos problemas, y revise algunas 4 que eran nuevas y estaban bloqueadas, con una netbook perdí 10 minutos por que esperaba que prendieron pero al parecer la pantalla no funcionaba, parecía en buen estado pero la pantalla no prendía.','2022-04-20'),(4029,226,'Clase 13','Borré espacios de mas, arregle problemas de identación, orienté el diseño de todas las vistas a Bootstrap y le puse favicon a todas las vistas','2022-04-20'),(4030,225,'Bitácora 20-04-22','Se continuo con el desarrollo de los bocetos de figma, se cambio el orden de algunas carpetas del github, se establecieron las civilizaciones que formaran parte del juego y se cambiaron las resoluciones de algunas imágenes','2022-04-20'),(4031,236,'clase 13 (20/04/22)','En la clase del día de la fecha complete la carpeta de campo y corregí ciertos datos en el diagrama de Gantt, también hice la vista de infoGeneral y complete lo que faltaba','2022-04-20'),(4032,229,'20/04/2022','En la clase de hoy, realice la finalización del gif, pero luego de unas pruebas, se decidió hacerlo por Sprites\r\nEl panel de Sprites de el Consorti Caricatura se logro finalizar','2022-04-20'),(4033,239,'dia-13 20/4/2022','Hoy me dedique a terminar el titulo de la pagina con una animación neón y cambio de colores','2022-04-20'),(4034,241,'Bitacora Clase N°12 - Tomás Ortellado 6°1° C','Hoy continúe viendo JavaScript, discutimos algunas de las ideas del juego, pero que decidimos posponer hasta 