or() eliminarPaciente() eliminarDoctor() \r\ntriggers: \r\nfechaSuperpuesta() backUp() el trigger backup no va a ser solo uno si no que va a ser la misma cantidad de backUps que de tablas ya que cada dato de la tabla se va a guardar en su correspondiente backup','2022-04-21'),(4038,208,'Diagrama Entidad Relacion, Tablas de la base de datos, Store procedures y Triggers','el día de hoy me encargue de recopilar información sobre el trabajo, la pagina web ya esta apunto de terminar y se tuvieron algunos inconvenientes con mongodb ya que es incompatible con windows 7, sin embargo se uso el tiempo para seguir con el diagrama entidad relación de la base de datos del consultorio, se agregaron las necesarias tablas (Paciente,doctor,fechas,turnos) si en algún momento se necesitan mas tablas serán agregadas, ademas se hicieron los siguientes store procedures: \r\nagregarPaciente() agregarDoctor() eliminarPaciente() eliminarDoctor() \r\ntriggers: \r\nfechaSuperpuesta() backUp() el trigger backup no va a ser solo uno si no que va a ser la misma cantidad de backUps que de tablas ya que cada dato de la tabla se va a guardar en su correspondiente backup','2022-04-21'),(4039,213,'Base de datos 2','El dia de hoy ante la falta de la mayor parte del grupo revisamos el diagrama entidad relación de el cual re hicimos para que tuviera mas funcionalidades y revisamos que cumpliera con la reglas de normalizan de una base de datos hasta 3FN \r\nEn lineas generales el día se baso en reunir datos para completar este diagrama , también buscamos algunos Store procedure que pudieran entrar dentro de esta base de datos para completar el ABM','2022-04-21'),(4040,217,'continuamiento con las reparaciones','el dia de hoy 21/04 se pudo obtener un nuevo progamador CH341A y se pudieron hacer el desbloqueo de 6 computadoras funcionales tambien se intento buscar otros archivos para computadoras de otras generaciones lo cual se realizara en casa o el dia siguiente hasta entonces todavia quedan computadoras bloqueadas o con otros defectos','2022-04-21'),(4041,223,'Reinicio y base de datos y pagina web reechas','El día de hoy reiniciamos todo el proyecto ya que estábamos muy atrasados con el mismo, decidimos eliminar todo lo que teníamos echo sobre la base de datos y la pagina administrativa y empezar de cero, y eso fue o que hicimos, yo hice la nueva base de datos en MySql, Fiasche se encargo de la pagina web y Dominick investigo y continuo con la aplicación instalable','2022-04-21'),(4042,222,'Codeigniter','hoy con mi grupo discutimos al principio de la clase sobre como vamos con las cosas del proyecto, luego de saber masomenos que necesitamos para seguir me puse a ver cursos sobre codeigniter para entender mejor el framework y poder hacer bien el abm y el login que necesito hacer para la pagina del sanatorio de internacion domiciliaria web','2022-04-22'),(4043,219,'Progreso de tareas','En el día de la fecha, terminamos algunas cosas como la vista de login de la aplicación, ademas de empezar con los estatutos de la empresa simulada (PRUFEX S.R.L.). Para hacer esto me estoy apoyando en los estatutos de la asociacion de mi viejo (Grafica Chacabuco S.R.L.).','2022-04-22'),(4044,210,'bitacoria 11 22/04/2022	','Estuve continuando arreglando el codigo de inicio en github por que el dia de ayer le pedi a una amiga que viera como se ve en su celular la pagina de dental rojas y en su celular se rompia todo al tamaño 700px x 1400x lo cual hoy me dedique a corregir ese error y ademas arregle la posicion del mapa de la parte de contactos que tenia 10 o 15 pixles de mas lo que hacia que no se viera centrado','2022-04-22'),(4045,209,'22-04-22 Revision estetica del login y vista principal','-Discutimos nuevos módulos para agregarle al proyecto\r\n-Empezamos el desarrollo del modulo de usuario\r\n-Eliminamos la vista de la tabla de profesionales\r\n-Definimos estéticamente el login\r\n-Finalización del login\r\n','2022-04-22'),(4046,220,'22-03','el dia de hoy se modifico el diagrama 