a que discutimos con que iba a trabajar hoy cada uno. Eliminamos la tabla de profesional y en su lugar pusimos una de perfil del usuario, modificamos la parte estética del login.','2022-04-22'),(4053,223,'Inicio de los estatutos, modificación del diagrama de gant y planificación de la semana que viene ','El día de la fecha codificamos algunas cosas que no estaban terminadas de la pestaña de inicio de sesión en la aplicación instala ble aparte de eso nos organizamos para trabajar la semana que viene, rabien modificamos el diagrama de gant con las nuevas modificaciones del trabajo, tales como la actualización de la pagina web, la aplicación instala ble, y por ultimo empezamos con los estatutos de la empresa simulada PRU-FEX S.R.L.','2022-04-22'),(4054,232,'CLASE 14 - 26/04/2022','Hoy gracias al profesor aprendí otro método de aplicar mi base de datos en MongoDB, me explicó y hoy logré crear una base de datos de manera online en “Atlas” otra ramificación de Mongo. En esta creé la base de datos respectiva, habilité unos cuantos computadores para que puedan interactuar con la misma y la anexé con la DB Compass en el escritorio de la computadora.','2022-04-26'),(4055,234,'Clase N°14','En la clase de hoy estuve con el profesor Nahuel, revisando la carpeta de campo','2022-04-26'),(4056,230,'26/04/2022','Comencé a investigar sobre cómo hacer un login y registro con HTML, CSS, JavaScript, PHP y MySQL.\r\nVideos empezados: \r\nhttps://www.youtube.com/watch?v=37IN_PW5U8E&amp;t=192s \r\nhttps://www.youtube.com/watch?v=37IN_PW5U8E&amp;t=192s\r\nLista de reproducción que estoy siguiendo: https://youtube.com/playlist?list=PLAFTVct4TDOa1HHObYNcGqRXsYTcCnfF4 \r\n','2022-04-26'),(4057,233,'Clase 26/04/22','En la clase de hoy hubo un chequeo sobre las carpetas de campo, luego junto a mi grupo, le dimos los últimos retoques para la entrega.','2022-04-26'),(4058,228,'Clase 14','Investigue sobre la validación de formularios en PHP','2022-04-26'),(4059,246,'clase 13','hoy seguí con el diagrama entidad relación y seguí también con mi carpeta de campo.','2022-04-26'),(4060,241,'Bitacora Clase N°14 - Tomás Ortellado 6°1° C','En esta clase me dedique a avanzar exclusivamente con la carpeta de campo para la próxima clase que la tengo atrasada.','2022-04-26'),(4061,247,'Simulacro (26/04)','El día de hoy hubo una revisión del material expuesto en las carpetas de campo de cada uno, sumado una pequeña investigación sobre los lenguajes que desarrollaremos en la página.','2022-04-26'),(4062,224,'Clase 14','Perfeccioné la carpeta de campo individual y comencé con la carpeta de campo grupal para documentar el proyecto','2022-04-26'),(4063,225,'Bitácora 26-04-22','- En el día de la fecha se realizo la revisión previa a la entrega de carpetas de campo\r\n- Actualicé el diagrama Kanban en mi carpeta de campo\r\n- Seguí con la búsqueda de imágenes útiles para los iconos del juego\r\n','2022-04-26'),(4064,238,'Clase 14 26/04/2022','Trabaje en la carpeta de campo. \r\nEn base al navbar responsive que realice en mi casa, lo duplique y lo empecé a transformar para que se vea como el que necesitamos para el proyecto.\r\n','2022-04-26'),(4065,229,'26/04/2022','En la clase de hoy me centre en finalizar la carpeta de campo y seguir avanzando con las animaciones','2022-04-26'),(4066,236,'clase 14 (26/04/22)','En la clase del día de hoy estuve realizando la parte de documentación y estuve realizando ciertas investigaciones para realizar las vistas de manera que se adapte al boceto','2022-04-26'),(4067,231,'clase 14','hoy avanzamos con el diseño de Nahuel (otra vez) estamos haciendo un cambio con su peinado en la animacion para luego empezar con su diseño de perfil para luego ir a parar con su animacion que sera un trabajo algo largo pero no tan largo como el de consorti, creo que no hay mucho que comentar\r\n','2022-04-26'),(4068,237,'Clase 14','Hoy Ordene los archivos en carpetas, ademas de seguir buscando la manera de  utilizar la api de ebay.','2022-04-26'),(4069,245,'26/4/