r empecé con los cuestionarios de la DET. Tengo la intención de dedicarme a ellos hasta terminarlos.','2022-04-27'),(4089,226,'Clase 15','Investigue la detección del tema del navegador para cambiar el favicon y completé las 50 hojas de la carpeta de campo','2022-04-27'),(4090,239,'dia-15 27/4/2022','hoy me dedique a terminar la animación de neón y poner una fuente el titulo. y terminar la carpeta de campo.','2022-04-27'),(4091,237,'Clase 15','Al verme imposibilitado y no saber como continuar con lo de ebay decidi continuar con mejorando el php que habia hecho para la api de mercadolibre, ademas de ayudar a mis compañeros','2022-04-27'),(4092,229,'27/04/2022','El dia de hoy se avanzo de gran manera con las Sprites, pero al final, se descubrieron algunos inconvenientes ','2022-04-27'),(4093,248,'27/04/2022','Hoy fue un día perdido ya que mi pendrive booteable no funcionaba y ademas de eso estaba descargando los archivos necesarios para todas las netbook con su respectiva generación(Por que cada uno es distinto del G1 al G9).','2022-04-27'),(4094,238,'Clase 15 27/04/202','Utilice el navbar responsive que realice anteriormente, y se lo agregue a las visitas ya realizadas.\r\nPosteriormente agregue todos los archivos a una carpeta común y los entrelace.\r\n','2022-04-27'),(4095,242,'28-04-22','El día de hoy fue un tanto relajado, no fue mucho lo que hicimos pero al final fue un intento, quedamos con el intento de terminar con la vista de la página y al final ya está completa, solo nos queda acomodar los futuros enlaces, demás páginas y todo que nos queda por pensar cómo preparar algo así.','2022-04-28'),(4096,213,'Envio de Correos','El día de hoy deje un poco de lado lo que respecta a la base de datos para centrarme un poco en lo mas &quot;Basico&quot; de la pagina . Hoy estuve todo el día buscando información e intentando mandar un mail al momento de llenar un formulario se me presentaron muchas dificultades sobre todo la cantidad de vídeos que no considero que tengan una buena explicación sobre este tema el único que me sirvió fue el del youtuber CodyTron ','2022-04-28'),(4097,209,'28-04-22 Inicio de Backend de login','-Retomamos parte de la investigacion de Code Igniter\r\n-Prácticamente terminamos con el login\r\n-Avanzamos con la documentacion\r\n-Terminamos las 2 vistas principales\r\n-Dejamos los preparativos para seguir el desarrollo del backend de la otra vista\r\n-Terminamos la base de datos','2022-04-28'),(4098,209,'28-04-22 Inicio de Backend de login','-Retomamos parte de la investigacion de Code Igniter\r\n-Prácticamente terminamos con el login\r\n-Avanzamos con la documentacion\r\n-Terminamos las 2 vistas principales\r\n-Dejamos los preparativos para seguir el desarrollo del backend de la otra vista\r\n-Terminamos la base de datos','2022-04-28'),(4099,217,'28/04 nuevos trabajos','el dia de hoy llego un profesor de mecanica pidiendo que les desbloquearan las computadoras y reinstalaran un nuevo sistema operativo el cual no se puede realizar de momento porque no se tuvo en cuenta que requeria el uso de un usb booteable, pero tambien se logro el desbloqueo de 2 computadoras que ya no se bloquearan y que estan funcionales para el dia de mañana intentare conseguir un USB booteable','2022-04-28'),(4100,210,'bitacoria 11 28/04/2022	','estuve rehaciendo la pagina de turnos del cual fue algo fácil por que ya estaba casi armado solo faltaba hacerlo responsive y agregarlo a la carpeta nueva del donde esta subido la pagina de Dental rojas en github y unir los archivos css y js en una sola carpeta para no tener todo desordenado. luego ayude a mi compañero soler con la vista de contactos en php pero nos trabamos en una parte asi que nuestro profesor olaso nos ayudo ','2022-04-28'),(4101,223,'Entrega de carpeta de campo, cierre de notas  y armado de Base de Datos por segunda vez','El día de hoy cierran bimestres y debemos entregar la carpeta de campo por ello me ocupe de completarla. Se perdió todo el progreso hecho el jueves anterior. A causa de todas las dificultades nos vimos en la obligación de hacer nuevamente la base de datos  con todas las tablas Administrador, Cupones, Stock y Usuario También encontramos unas páginas que son FrameWorks para HTML, CSS y JS que son muy útiles ya que el diseño de sus componentes es muy diferente al de bootstrap y nos da las puertas de jugar mucho más con el diseño de la página administrativa.','2022-04-28'),(4102,220,'28/04/2022','el dia de hoy realize la copilacion a apk de la app que ando realizando lo ultimo que faltaria hacer para avanzar un monton seria hacer la conexion en php que la hare en casa de momento se actualizara la pag administrativa visualmente y acomodaran otras cosas','2022-04-28'),(4103,219,'Progreso y Entrega de Carpetas','En el dia de hoy, los profesores pidieron las carpetas de campo para corregir, ya que hoy era el ultimo dia para entregarlas. La verdad es que a nadie le fue bien con respecto a las carpetas, ya que no es una tarea muy facil el llegar a las 50 hojas. \r\nFuera de todo lo anterior hoy comenzamos con la estructura del programa web, investigamos y pudimos agregar 4 nuevos frameworks de css y js. Todo para no usar mucho bootstrap durante la realizacion del proyecto, y para que quede mas amigable a la vista.','2022-04-28'),(4104,211,'terminamos','en el día de hoy terminamos la base de datos, el backend del login, seguimos investigando sobre el codeigniter, casi terminamos las dos vistas principales','2022-04-28'),(4105,222,'progreso del proyecto','hoy estuvimos viendo codeigniter para poder terminar el login, terminamos el backend del login, arrancamos y dejamos lista para usar la base de datos con un par de tablas para poder hacer la conexion a la hora de hacer el envio de datos del login entre otras cosas','2022-04-28'),(4106,216,'Proyecto N° 1 #09','Realicé la base de datos, ya finalizamos con el login, finalizamos la vista principal.','2022-04-28'),(4107,213,'LOGIN ADMIN','Al dia que nos acontece  el scrum master me designo una nueva tarea en relacion con la vista admin que otros compañeros estan realizando en mi caso me dio la vista para el inicio de sesion al momento de entrar en las vistas admin esto para aumentar la seguridad de los datos en la vista admin podran ser modificados . Ante el problema propuesto me puse a diseñar en una hoja las cosas que iba a necesitar . Esto me llevo a tener que hacer de manera casi segura una nueva tabla para la base de datos por en caso de que se  necesitaran mas de un admin o si se requieren admins de diferentes rangos eso queda a disposicion del cliente ','2022-04-29'),(4108,220,'29/04/2022','En el dia de hoy revisamos una pagina web de tienda que realizo nuestro compañero Agustin Fiasche, de la cual vamos a sacar el maximo provecho de los recursos que nos dio para tener presente en este trabajo \r\ndel cual pudimos acceder desde el xammp metiendo el archivo zip que nos envio ,pasando el archivo a la carpeta htdocs\r\n\r\nluego colocando en el navegador \r\npudimos acceder a la primera vista de la tienda \r\n\r\nya habiendo hecho eso importamos la base de datos para poder acceder a la vista de admin al meternos al apartado de administrador iniciamos con  contraseña y usuario ‘’administrador’’\r\n','2022-04-29'),(4109,208,'Justificacion y Objetivos del proyecto','La fecha de hoy la utilize para finalizar con la presentacion del proyecto, para ser mas especifico termine con la justificaicon y los objetivos de la presentacion, ademas de darle algunos detalles a lo anteriormente escrito. Consulte con mis compañeros si les gustaba la presentacion y considieron junto a mi que estaba bien, en caso de necesitar algun tipo de cambio o desarrollo extra lo hare en alguna otra ocasion ya sea en una clase o en caso contrario desde mi hogar.','2022-04-29'),(4110,216,'FODA personal - Proyecto Nº 1 #10','Retome la realización de mi análisis FODA personal.','2022-04-29'),(4111,210,'bitacoria 11 28/04/2022	','Continue con la pagina de contactos volviendola