29,'04-05-2022','En el día de hoy e realizado la animación del logo de carga, dándole un movimiento sencillo \r\nRealizar arreglos en las animaciones de Gonzalito\r\nHoy se volcó todo en el GitHub','2022-05-04'),(4121,234,'Clase N°16','Lo que estuve realizando en el día de hoy fue investigación para realizar el js de las animaciones.','2022-05-04'),(4122,241,'Bitacora Clase N°16 - Tomás Ortellado 6°1° C','Volví a ver algunas de las bases de mongodb e instalar mongodb en mi equipo y prepararlo para realizar consultas en la consola.','2022-05-04'),(4123,224,'Clase 16','Actualicé mi carpeta de campo con información que estuve investigando sobre los colores en las páginas HTML, \'Normalicé\' la base de datos del proyecto y colaboré con la actualización del diseño de la página','2022-05-04'),(4124,231,'clase 16','el día de hoy es miércoles y la clase del martes no hubo clases por jornada EMI, hoy continué con la animación de Nahuelito para la animación en movimiento, tarde un poco al aplicar la paleta de colores de la animación luego otro par de minutos para las poses que simulen el movimiento del personaje con un par de poses bastara para terminar su diseño y comenzar con algun que otro re-diseño al boceto de gonzalo','2022-05-04'),(4125,247,'Desarrollo del Iniciar Sesión y Registrarse (4/5)','El día de hoy, aparte de continuar mi investigación sobre JavaScript, investigue junto a mi compañero como realizar un Iniciar Sesión y Registrarse personalizado y con responsive.','2022-05-04'),(4126,230,'04/05/2022','Hoy terminé de diseñar el Login y register con HTML, CSS y JavaScript. Usé animaciones para hacer la transición de la opción de registrarse a la de logeo y viceversa al apretar un botón. También lo hice con responsive.\r\nUsé este video como guía: https://www.youtube.com/watch?v=c3GoigQ5vRE&amp;t=2273s','2022-05-04'),(4127,236,'clase 16 (04/05/22)','En la clase del día de la fecha estuve actualizando la vista de &quot;Seguridad&quot;  agregándole lo que faltaba y según lo que estaba en el boceto. También, le agregue un botón a la vista que pueda redirigir hacia la pagina de inicio, ademas estuve actualizando la carpeta de campo que estaba un poco dejada de lado.','2022-05-04'),(4128,240,'Clase 16','Arregle el diseño de la pagina de registre y login, hice la vista olvido de contraseña, y empece a investigar y aprender PHP','2022-05-04'),(4129,239,'Dia-16 4/5/2022','el día de hoy me dedique a hacer el css del buscador para la pagina use un background-image: linear gradient para hacer el fondo de la vista una ves echa hice el cuadro del buscador para buscar el producto.','2022-05-04'),(4130,227,'Cambios de nombres funcional y modal de ajustes','El dia de hoy se realizo la funcionalidad de cambio de nombres de los jugadores que integran la partida. Además, se agregó un modal para los ajustes de la partida.\r\nSe tomó la decisión de que, inicialmente, las partidas sean offline, ya que la implementación de juego online va a ser mas complicada.','2022-05-04'),(4131,242,'5-05-22','Fue un tranquilo comienzo, una vez abierta la pagina con su respectivo editor intenté pensar en que puedo seguir diseñando, tocaba el “”registrarse” e “Iniciar sesión” lo cual hicimos bastante rápido. Se pudo haber dicho que hoy fue un día donde se pudo elaborar bastante las cosas, como las 4 paginas de vistas para los demás lenguajes de programación.','2022-05-05'),(4132,213,'Login admin 2','Al día de la fecha me centre en la actualización del diagrama de entidad y relación para ya que el que teníamos anteriormente le faltan y o sobraban campos los cambios mas importante que se le realizaron fue la extracción de nro_paciente con este campo teníamos pensado que se utilizara como una primary key ya que este era autoincrement lo cual nos dejaba de manera implícita que no se podia llegar a repetir pero al momento de ver mejor la tabla nos dimos cuenta que el dni es también algo irrepetible por ende también se puede usar como primary key ','2022-05-05'),(4133,208,'Conexion e Insert, Base Rojas en php','Este dia se hicieron 2 cosas por separado la primera fue dar un panorama general de como conectar la vista de gestion de turnos, realizar los diferentes tipos de tablas de la base de datos y el codigo a la hora de ingresar un nuevo turno en la base de datos\r\nYo me encargue de dar a entender el panorama general y organizar un poco la situacion, Soler modifico la base de datos con los cambios que requiriesen y Brian sigue finalizando la vista\r\nLuego me auto asigne la tarea de realizar el codigo de php para que a partir de ese codigo se puedan agregar turnos con su respectivo tratamiento, doctor, paciente, fecha y horario','2022-05-05'),(4134,209,'05-05-2022 Backend de login y vista principal','-Termine los inserts de la seccion medica de la vista principal\r\n-Terminamos la validacion del login ','2022-05-05'),(4135,210,'bitacoria 11 28/04/2022	','Estuve continuando con la pagina de turnos de dental rojas creandole una ventana nueva que ocupara el 100% de la vista haciendo que parezca que sea otra vista nueva pero sigue siendo la misma esta tiene el formulario del cual se tomaran los turnos del boton &quot;Turnos Online&quot; con un formulario progresivo que tendra el tipo de tratamientos, dentistas, fechas y hora y el paciente\r\n','2022-05-05'),(4136,222,'insert de datos','hoy basicamente con un compañero nos pusimos a perfeccionar el login para que el mismo pueda hacer la validacion de datos, iniciar sesion, y pasara la siguiente vista donde ya podes cargar pacientes, luego de eso yo me encargue de hacer la insercion de datos del paciente, aun no lo termine pero avance bastante','2022-05-05'),(4137,211,'documentacion y login','en el dia de hoy tuvimos algunos problemas para conectar el login con la vista de los pacientes pero despues lo arreglamos, despues estuvimos intentado ingresar datos de los pacientes de la pagina a la base de datos, y por ultimos seguimos completando la documentacion del proyecto.','2022-05-05'),(4138,217,'05/05 desbloqueo de los ultimos proyectos','el dia de hoy se estuvo intentando reparar el error que se cometio con algunas maquinas del profesor de mecanica el cual solo se logro reapara 1 y por lo que parece que las otras 2 quedaron sin funcionar asi que tambien hicimos un recoteo de todas las maquinas que quedaron reparadas y las que no con el fin de reorganizarnos tambien aparecio de la nada mi amigo felix que parece que continuara con el proyeto los dias que yo vengo.','2022-05-05'),(4139,217,'05/05 desbloqueo de los ultimos proyectos','el dia de hoy se estuvo intentando reparar el error que se cometio con algunas maquinas del profesor de mecanica el cual solo se logro reapara 1 y por lo que parece que las otras 2 quedaron sin funcionar asi que tambien hicimos un recoteo de todas las maquinas que quedaron reparadas y las que no con el fin de reorganizarnos tambien aparecio de la nada mi amigo felix que parece que continuara con el proyeto los dias que yo vengo.','2022-05-05'),(4140,223,'Comienzo de la pagina administrativa','El día de hoy iniciamos con la pagina administrativa eliminando lo no necesitado de la tienda virtual y modificando las cosas necesarias, también teníamos planeado continuar con la aplicación mocil ya que, a pesar de las clases que tuvimos, solo hemos avanzado con la vista de login y nada más, aparte no tuvimos oportunidad de continuarla debido a que mis compañeros Agustin Fiasche y Dominick Guzman no vinieron a clases, este ultimo porque se encontraba enfermo','2022-05-05'),(4141,216,'Documentación - Proyecto N° 1 #11','Daily. Retome la presentación del proyecto, leí el PDF guía en el Classroom y busqué algún que otro vídeo para ello.','2022-05-05'),(4142,242,'6-05-22','Inicio cansado pero a su vez algo acelerado debido a que el día de hoy debí de rehacer todo, ya que no pude guardar todo el proceso de antes y eso fue bastante molesto, eso que apenas y si me di cuenta ayer a la hora de salir de la escuela.\r\nTermine de rehacer todo lo que hicimos ayer pero me doy cuenta que no fue demasiado, quizá por que me aceleré en el proceso del mismo y posiblemente ya tenía conocimiento de como era hacerlo. \r\n','2022-05-06'),(4143,221,'6/5/22','El día de hoy estuve terminando el FODA del proyecto. Ya con esto tenemos la guía de documentación. Solo nos quedaría el proyect, el diagrama de gutts, la base de datos y la pagina en sí. Hoy también empezamos la creación de las correspondientes páginas para cada lenguaje. Tenemos dudas de cómo vamos a hacer los ejercicios ya que hay que traerlos de una base de datos pero no estamos muy familiarizado con eso.\r\nTomaremos como modelo la página W3 que es también una página que enseña a programar y también cuenta con una serie de ejercidos.\r\n','2022-05-06'),(4144,208,'HTML y PHP','La mayor parte del tiempo en la clase de hoy se invirtió en investigar y recopilar información sobre como mostrar una tabla en html, para luego en php tomar las variables dadas desde la vista turnos e así mostrar las tablas en una vista, sin embargo el diseño de la vista no está detallado el punto principal es que funcione el código php','2022-05-06'),(4145,213,'Re creacion de la base de datos','Ahora me centre en la creación de la base de datos conforme al nuevo diagrama entidad relación que se creo en el día de ayer con esto en mente me di en la misión hacerlo por mi cuenta aprendiendo lo necesario para poder terminarlo en el día de la fecha para que mis compañeros puedan continuar con sus trabajos sobre todo en lo que respecta al que se encargar del php de la pagina \r\nVolví a recordar muchas cosas sobre la programación en php y la verdad me parece extremadamente divertido el hecho de aprender mas cosas sobre la programación ','2022-05-06'),(4146,223,'Investigación sobre php y kotlin y continuación de la aplicación','El día de hoy teníamos los planes de trabajar en la aplicación instalable y a su vez investigar sobre la conección entre kotlin y php. En el caso de la investigación tuve que enfocarme en continuar la carpeta de campo y no me quedó tiempo restante para investigar demacrado, pero con el tiempo que tenia me puse a buscar videotutoriales en youtube sobre la conección con la base de datos entre lo que busque encontré un video que parece explicar de forma detallada cómo realizar dicha conección\r\n','2022-05-06'),(4147,210,'bitacora 15','hoy solo hice unos pequeños cambios de posicionamientos en la vista de turnos ya que estuve dando vueltas buscando una pc DECENTE como para poder minimo ABRIR el google chrome ya que las 2 primeras computadoras que agarre eran pesimas. La primera no abria el visual studio code, la segunda con 2gb de ram la pobre no podia abrir el google chrome y abrir eso con el visual hizo que la computadora se apague sola y en esta que encontre porfin pude entrar a mi drive :D','2022-05-06'),(4148,217,'06/05 Continuidad con el desbloqueo','el dia de hoy se pudo realizar el desbloqueo de 2 computadoras incluida la reparacion de 1 que yo habia hecho el cambio de pantalla el cual al principio no encendia y que tenia el teclado en mal estado, como sea tambien se intento el ultimo intento del desbloqueo de una netbook coradir el cual resulto mal y continuamos buscando un nuevo programa.','2022-05-06'),(4149,234,'Clase N°17','En la clase de hoy me dediqué a realizar correcciones en la carpeta de campo para que esta pueda quedar más completa y avancé con uno de los bocetos del js de animaciones','2022-05-10'),(4150,228,'Clase 17','Corregi la validacion PHP','2022-05-10'),(4151,224,'Clase 17','Conversé con mis compañeros para continuar con la elección de la paleta de colores para la página web.','2022-05-10'),(4152,226,'Clase 17','Le agregué una encriptación MD5 cuando el usuario inicia sesión o se registra','2022-05-10'),(4153,247,'Investigación de JavaScript II (10/5)','El día de hoy visite el canal &quot;FalconMasters&quot; para estudiar el lenguaje JavaScript más allá de las múltiples &quot;limitaciones&quot; que puede tener la página w3school. Vi varios elementos básicos los cuales reforcé con esta serie de videos explicativos, además de claro, crear mis propias variaciones con los temas vistos en esta clase.','2022-05-10'),(4154,233,'10/5/22','El dia de hoy investigue sobre el funcionamiento de la sintaxis, las variables y los datos en php.','2022-05-10'),(4155,230,'10/05/2022','Hoy organicé los directorios de la carpeta donde se encuentra el diseño del login y register. También empecé a investigar sobre bases de datos y php, creando en la cual se almacenarán los usuarios del login. \r\nUsé este video como guía: https://www.youtube.com/watch?v=veoZts7H-ZI ','2022-05-10'),(4156,236,'clase 17 (10/05/22)','En la clase de hoy estuve haciendo un boceto del index en el cual se vea con un menú desplegable y señalando que significaba cada cosa, también estuve viendo vídeos de como hacer el menú desplegable con HTML, CSS y JS.','2022-05-10'),(4157,238,'Clase 17 10/05/2022','Modifique el responsive de la sección principal del Index.\r\nCambiamos la paleta de colores de las vistas.\r\n','2022-05-10'),(4158,241,'Bitacora Clase N°17 - Tomás Ortellado 6°1° C','Seguí viendo MongoDB, como crear bases de datos y usar la consola','2022-05-10'),(4159,227,'Pequeños cambios en configuracion / turnos de partida','Se agrega configuracion de color a &quot;configuracionPartida.html&quot; y un botón de jugar que lleva a &quot;partida.html&quot;. A esta última se le agregó una funcionalidad básica de turnos para iniciar la funcionalidad de la partida.','2022-05-10'),(4160,231,'clase 17','este clase es martes falto Tobias termine con las poses de la animacion de Nahuel y ahora del gif se encarga Ivan(Britez) para que luego lo implementen en el modelo de pagina que tenemos hasta el momento, probablemnte haga otro fondo para la pagina o un nuevo logo ','2022-05-10'),(4161,249,'Clase 5','Hoy modifique la información general de la pagina','2022-05-10'),(4162,237,'Clase 17','En el día de hoy continué con las Apis, ya tengo una idea de como es el sistema, aun que no logre ningún logro importante en el avance del código','2022-05-10'),(4163,248,'10-05-2022','Hoy use el programador ch341a para desbloquear la netbook numero 37, la cual estaba bloqueada y al intentar resetearla no funcionaba la batería, tampoco prendía la pantalla.','2022-05-10'),(4164,239,'Dia-16 10/5','Re diseñe el index de la pagina y empece con la creación de las demás vistas de la pagina.','2022-05-10'),(4165,247,'Intento de Desarrollo con el Sidebar (11/5)','El día de hoy me dedique a investigar constantemente distintos tipos de sidebar y cuales podrían ser aplicables a la página web, aunque lamentablemente no encontré ninguno que pudiera ajustar perfectamente a la página. También repase algunos conceptos de JavaScript (para no perder la tradición).','2022-05-11'),(4166,249,'Clase 6','Desarrollé el código para agregar la fecha de nacimiento al registro','2022-05-11'),(4167,231,'clase 18','fue una clase traquila(Falto Tobias), como en la bitacora anterior lo comente ya termine con el diseño de poses para la animacion de Nahuelito y como no tengo mucho que hacer me puse a dieñar una idea de logo que me surgio luego de que estara viendo tutoriales de photoshop en Intagram, la verdad nose si quedo bien, siento que esta algo vacioo y que es algo simple pero tenia que hacerlo por si les agradaba a los chicos para la pagina :b','2022-05-11'),(4168,228,'Clase 18','Subí archivos a github, corregí el repositorio y ayude a realizar correcciones en la normalizacion de la base de datos','2022-05-11'),(4169,226,'Clase 18','Colaboré a desarrollar el menú desplegable del usuario','2022-05-11'),(4170,235,'clase 11/05','en el día hoy seguimos trabando en grupo','2022-05-11'),(4171,246,'Clase 18','En el dia de la fecha realice la normalizacion de la base de datos y me puse al dia con los cambios que hicieron mis compañeros de grupo al proyecto, ya que debido a mis faltas no estuve con ellos.','2022-05-11'),(4172,230,'11/05/2022','Hoy continué desarrollando el login y el register, más específicamente el register. Logré que al ingresar los datos para el registro (nombre completo, correo electrónico, nombre de usuario y contraseña) se guarden en una base de datos. Al ingresar los datos muestra un mensaje de usuario creado si se creó y de error si no lo hace y devuelve al usuario a la página de login y registro. ','2022-05-11'),(4173,232,'CLASE 17 - 27/04/2022','Hoy estuvimos desarrollando conexiones a la base de datos, hacer logos tipo PNG de cada faccion del juego, en especial la de los romanos y egipcios, interfaces graficas del mismo','2022-05-11'),(4174,233,'Clase 11/5/22','El dia de hoy busque videos de como crear una base de datos utilizando php y xampp. Luego me dedique a buscar como agreagarle una sidebar a nuestra página , tambien como agregarle , si es posible, animaciones extras a la misma.','2022-05-11'),(4175,238,'Clase 18 11/05/2022','Investigamos plantillas de galerías estilo pinterest.\r\nCree la vista “Servicios”.\r\nComenzamos a diseñar cada tarjeta del index.\r\n','2022-05-11'),(4176,234,'Clase N°18','En el día de hoy empecé a realizar el modelo final del js de animaciones, investigué y también ayudé a mi compañero de grupo Abdias con el photoshop para hacer el mapa.','2022-05-11'),(4177,241,'Bitacora Clase N°18 - Tomás Ortellado 6°1° C','En esta clase continue viendo cosas básicas sobre MongoDB, pero luego de no mucho tiempo pase a ver node.js, así que comencé a ver los básicos de node.js, pero tampoco duro mucho tiempo, ya que otro miembro de mi equipo se estaba encargando de lo que yo apuntaba hacer.\r\n\r\nLuego de consultar de a un compañero de equipo sobre lo que el proyecto necesita, faltaba mano de obra (por llamarlo de alguna manera) en diseño, así que pase a diseñar. Tengo diseñar los estandartes de las facciones, y me propuse empezar con el estandarte egipcio. Ahora estoy viendo ilustración en Photoshop.\r\n\r\nComo los videos en youtube no estan siendo muy utiles, o no son lo que busco...  tengo pensado consultar con un amigo que se dedica a dibujar.\r\n','2022-05-11'),(4178,237,'Clase 18','En esta clase se logro la conexión con la Api de Ebay, falta agregarle retoques.','2022-05-11'),(4179,239,'Dia-18 11/5','termine de enlazar la cada vista incluyendo el login y register faltaría poner css a las vistas de los productos','2022-05-11'),(4180,236,'clase 18 (12/05/22)','En la clase del día de la fecha realice el menú desplegable en el index y hice ciertas investigaciones para mejorar el mismo.','2022-05-11'),(4181,225,'Bitácora ','Terminé el casco romano y comencé con el casco francés','2022-05-11'),(4182,227,'Funcionalidad preguntas y modales','Se agregaron modales para la defensa y ataque de territorios. Para acceder a ellos de forma provisoria se colocaron botones en la parte inferior de la pantalla. También se desarrolló otro modal para las preguntas y demás funcionalidades.','2022-05-11'),(4183,248,'','','2022-05-11'),(4184,242,'12-5-22','empezamos tomandolo con bastante calma a las primeras horas de la clase y la realización del proyecto, por mi parte, no hice demasiado ya que un compañero mio estaba dando explicaciones de que puedo mejorar en el proyecto aunque fueron de bastante ayuda. ','2022-05-12'),(4185,219,'Progreso con la aplicacion Android | Apoyo a grupo de Gantus','En el día de la fecha, con mi grupo estuvimos completando la aplicación android, específicamente la pestaña de cupones y de inicio. Me toco trabajar con Domini y Delio a distancia, debido a que Matias tiene Covid + y Domini se sentía mal, fuera de eso pude hacer algo por mi cuenta, como arreglar de una vez por todas el login de la pagina administrativa.\r\nTambién ayude a Gantus y a su grupo con la pagina que estos tienen que hacer. Se trata de una pagina donde uno pueda registrarse y acceder a distintos cursos de Python, Java, C++ y PHP. Les ayude a terminar el diseño de la pagina y con el como tendrían que hacer la estructura de cursos,\r\ndebido a que hasta el momento no tenían una estructura definida y no sabían como hacer los ejercicios.','2022-05-12'),(4186,221,'12/05','El día de hoy estuve realizando la pagina de phyton y modificando el menú. Todavía nos faltan los otros 3 lenguajes. Como no vinieron la mitad de mi grupo no pudimos hacer mucho. ','2022-05-12'),(4187,208,'Base Rojas y Insert.php','Tuve un pequeño percance al abrir el insert.php que tenia guardado en el pendrive, ya que se había perdido parte del código por lo que tuve que volver a escribirlo. \r\nLuego de eso me puse a modificar ciertos errores que tenia la base de datos como cambiar el tipo de dato de uno de los campos de la tabla fechas_horario ya que le faltaba una clave primaria, ademas modifique parte del diagrama entidad relación.\r\nMe quedo un error y es el de la clave foránea ya que la clave foránea de turnos se comunicaba con la antigua clave primaria de la tabla fechas_horario pero ahora la clave primaria cambio.','2022-05-12'),(4188,209,'12-05-2022 Backend de ingreso de datos basicos','-Corregimos bastantes desprolijidades del código\r\n-Nos costó bastante encontrar los errores que no nos permitían hacer el insert de los datos básicos\r\n-Desechamos el botón agregar(medico)\r\n-Agregamos los botones en cada registro para editar, eliminar, agregar datos médicos\r\n-Le explique a mi compañera una noción básica de CodeIgniter\r\n-Finalmente logramos que haga el insert','2022-05-12'),(4189,210,'bitacora 16','estuve haciendo el formulario de turnos utilizando checks y dandole forma luego ayude a mi compañero lucas sosa en un problema que tuvo con la base de datos despues de terminar de hacer el primer punto de los formulario comence hacer el segundo punto de esta que es &quot;dentistas&quot; que hare cards con botones para seleccionar el dentista','2022-05-12'),(4190,217,'encontre los archivos','el día de hoy comencé intentando reparar las computadoras g4, cosa que no se pudo por errores de que no se borran bien los TPM y asi no se puede avanzar, en fin al desarmarla y volver a armarla entendí que por ahora no se como repararlas entonces me empeñe a buscar los archivos correctos de las netbook coradir que bloquee por error y al final logrando su desbloqueo con los archivos correctos, para terminar se lograron desbloquear 2 computadoras mas.','2022-05-12'),(4191,216,'PHP - Proyecto N° 1 #12','Un compañero de proyecto me explico el funcionamiento y sentencias utilizadas en PHP (CodeIgniter). Modificamos varias inconsistencias dentro del código, ya que habían nombres de datos que no coincidían entre si e incluso un elemento sin cerrar. Descartamos el botón &quot;Agregar(Medico)&quot; y en su lugar colocamos un botón &quot;+&quot; el cual se podrá encontrar luego de los datos ya ingresados de los pacientes ya que solo será visible luego de ingresar un registro.','2022-05-12'),(4192,217,'Coradir','de las marcas mas problemáticas que hay por ahora logre hacer el desbloqueo de la segunda netbook coradir y estuve revisándolas otras que tienen un problema, o no encienden cosa que me parece raro porque no son de esa marca sino de noblex, en fin pienso seguir investigando la causa del porque no dan imagen pero las luces si se encienden y todavía me quedan la netbook g4 que no tengo muchas ideas de como desbloquearlas si, con una estación de soldadura pero eso es otra historia','2022-05-13'),(4193,242,'13-5-22','Empezamos con la tranquilidad dedicando una gran parte del tiempo en hacer una de las cuatro páginas de los lenguajes de programación, en este caso hablo de hacer poco a poco la de Python, teniendo un resultado que de un inicio no nos agrada demasiado pero posiblemente conformandonos con ese pequeño inició a tomar de referencia para las otras tres páginas restantes.','2022-05-13'),(4194,210,'bitacora 17','Hoy estaba avanzando con el segundo punto del formulario de turnos creando una card nueva para colocar el boton que selecione al profesional que atendera al paciente pero antes de terminar, mi compañero Yonar, tuvo la grandisima y extupenda idea de hacer semejante barbaridad para hacer un corto que haga apagar las computadoras y perdi el progreso de hoy junto a 4 compañeros mas :D\r\nun capo total :D','2022-05-13'),(4195,208,'Comunicacion de modificaciones y Agregando registros','En el día anterior me dedique a hacer algunas tareas que eran del trabajo de un amigo ya que el habia faltado hoy esos mismos cambios y modificaciones que realice se los pase y comunique para que pudiera trabajar con ellos.\r\nLe comunique el cambio al código de la base_rojas.sql y los pequeños rediseños del diagrama entidad relación, ademas juntos resolvimos el error que daba la clave foránea de la tabla turnos.\r\nPor ultimo se agrego un registro a la tabla doctores, falta agregar algunos para probar la vista mostrar.php\r\n','2022-05-13'),(4196,213,'Base de datos 2.1 ','El día que nos acontece me centre en seguir con la base de datos el día anterior había faltado por lo que debía ponerme el día un compañero había modificado la base de datos agregando un campo mas a la tabla de fechas mas específicamente el campo de id que serviría para diferenciar los diferentes doctores que puedan tener turnos solapados ya que anteriormente la visión que teníamos de la esa tabla por lo visto era como mínimo errada , este campo el de id nos obligo a modificar la tabla de turnos también ya que el campo de fecha estaba con tipo date y el nuevo id es era un int por lo que no podríamos hacer la conexión a la tabla de fechas ','2022-05-13'),(4197,209,'13-05-22 Backend datos principales','-Hicimos el boton de delete de cada regisro\r\n-Los inserts reinician la pagina, por lo que se actualiza sola\r\n-Empezamos a remodelar el modal de estado clinico, ya que lo vamos a reemplazar por una nueva vista con todos los analisis y datos medicos\r\n','2022-05-13'),(4198,222,'botones abm','la clase de hoy nos dedicamos a hacer funcionar los botones de la abm, por mi parte, hice el delete, parte el editar y estuvimos resolviendo el como hacer bien el boton de agregar datos medicos/estado clinico, logramos tambien hacer el print de todos los datos del paciente en la pagina, y que se actualice cada vez que estos se modifican.','2022-05-13'),(4199,216,'Diagrama UML - Proyecto N° 1 #13','Planteamos entre mis compañeros quien se iba a dedicar a trabajar en cada cosa. Al final la situación se dió distinto y no seguimos lo que planteamos en un principio. Estuve revisando el diagrama de Caso de Uso que realizamos anteriormente ya que el proyecto fué tomando un rumbo distinto y ya no es del todo correcto aquel diagrama','2022-05-13'),(4200,247,'Investigación de JavaScript III (17/05)','El día de hoy continué con la investigación sobre los elementos principales de JavaScript.','2022-05-17'),(4201,249,'Clase 7','Agregue la información de la escuela a la página ','2022-05-17'),(4202,228,'Clase 19','Vi un vídeo sobre esquemas de color para mejorar la parte visual del proyecto ','2022-05-17'),(4203,226,'Clase 19','Verifiqué la funcionalidad del register e inicio de sesión y el sistema de borrado de usuario','2022-05-17'),(4204,237,'Clase 19','El dia de hoy continuamos con la pagina y revise los trabajos de mis compañeros.','2022-05-17'),(4205,230,'17/05/2022','Hoy intentamos solucionar un error que ocurría al importar la base de datos. La misma se importaba pero la tabla usuarios que  tenía en ella, si bien aparecía, mencionaba que no existía. Aunque probamos varias cosas aún no podemos importar la bdd correctamente.Luego en la página principal modifiqué un poco los botones y les di hipervínculos.','2022-05-17'),(4206,232,'CLASE 18 17/05/2022','Hoy modifique los valores en los archivos para crear la base de datos en los archivos Javascript, añadí valores de Mongodb haciendo un &quot;connect(mongodb://localhost:27017.conquizt.conquiztCOLUMNA);&quot; Esto me permitió avanzar y que errores que me daban antes a la hora de ejecutar la pagina principal','2022-05-17'),(4207,241,'Bitacora Clase N°19 - Tomás Ortellado 6°1° C','Tuve un problema con el display de mi computadora del gobierno, así que le solicite ayuda a un compañero que se estuvo dedicando a proporcionar mantenimiento a equipos como el mío.\r\n\r\nNo sabemos bien como, pero resolvimos el problema.','2022-05-17'),(4208,224,'Clase 19','Vi un vídeo sobre esquemas de color para mejorar la parte visual del proyecto.','2022-05-17'),(4209,245,'17/5/2022','el dia de la fecha  he empezado a investigar sobre encriptación php para contraseñas\r\n','2022-05-17'),(4210,234,'Clase N°19','En la clase de hoy estuvimos ayudando con los diseños de los cascos','2022-05-17'),(4211,229,'17-05-2022','En la clase de hoy, me encargue de hacer la primera prueba en las animaciones para Nahuelito y actualizar la animación del logo agregándole movimiento de ruedas para que la imagen no se viera tan estática','2022-05-17'),(4212,227,'Diseño de logo','Dado que debo esperar a que mis compañeros desarrollen la conexion con la base de datos, procedí a dar una mano con el diseño comenzando el logo del menú. Para ello investigué algunas herramientas del photoshop y realicé algunas pruebas.','2022-05-17'),(4213,236,'clase 19 (17/05/2022)','En la clase del día de hoy estuve agregando las vistas del perfil viejo al nuevo que es un PHP y haciendo pruebas técnicas de la pagina para ver como era su funcionamiento, también estuve acomodando la carpeta de campo que estaba dejada un poco de lado ','2022-05-17'),(4214,233,'17/5/22','el día de hoy comencé con el diseño de la sidebar. Utilice un vídeos y guías de referencias para  agregarle animaciones al menú hamburguesa y a la barra en sí.','2022-05-17'),(4215,225,'Bitácora 17/5/22','Cerca de terminar el casco Francés','2022-05-17'),(4216,239,'Dia-19 17/5','termine con la conexión de la base de datos y el login','2022-05-17'),(4217,240,'Clase 17','Estuve desarrollando el registre en PHP ','2022-05-17'),(4218,231,'Clase 19','Malana no hay clases por el cenco y hiy tevimos problemas allan y yo con las maquinas ya que estas se apagaban a cada momento,tuve q hacer un trabajo dos veces porque se me apago antes de guardarlo','2022-05-17'),(4219,248,'17-05-2022','Hoy arregle la netbook de un amigo que tenia en su pantalla, la pantalla le parpadeaba y despues de que la apago no prendio, la desarme y parece que habia un cable suelto y lo arregle y ahora funciona redi.','2022-05-17'),(4220,242,'19-05-22','En el día de hoy no fue mucho lo que hicimos más que el vago intento de mantener y seguir diseñando la páginas restantes en los lenguajes de programación y gracias a un compañero nos ayudó lo suficiente, al menos un poco para hacer ese poco hoy mismo.','2022-05-19'),(4221,216,'Revisión de diagramas - Proyecto N° 1 #14','Junto a un compañero nos encargamos de revisar los diagramas existentes y realizar los faltantes. \r\nSaque una captura al diagrama de &quot;Entidad-Relación&quot; que se creó a partir de la base de datos. Hice algunos cambios y añadí un par de cosas al diagrama de &quot;Caso de Uso&quot;. Modifique y organice la parte estética del &quot;GANTT&quot;, junto a otro compañero añadimos un par de cosas a este. Finalmente realicé el nivel 0 del diagrama de &quot;Flujo de Datos&quot; y revisé también el nivel 1 de este diagrama, modificando un par de detalles.','2022-05-19'),(4222,208,'Modificaciones vista tratamiento','En la clase de hoy se fue modificando la vista tratamientos las tres cosas que habian que modificar fueron:\r\n\r\nLas imagenes de las tarjetas 3D (Se pusieron imagenes mas bonitas y con el mismo tamaño de la card),\r\nLos textos para las tarjetas 3D (Se hizo mas ameno el texto que informaba en las cards 3D para que sea mucho mas facil de leer)\r\nLos botones de las tarjetas 3D (Los botones anteriormente tenian un diseño que no pegaba con la estitca de la computadora, ahora se uso unos botones con sombreado que eran iguales a los de la vista home de la pagina web)','2022-05-19'),(4223,213,'Base de datos + input ','El día viernes de la semana pasada hubo un microcorte de luz en toda nuestra zona de computadoras con esto perdí todo lo que había realizado ese día por lo que hoy me centre en rehacer eso y también agregar dentro de la vista de turnos al input los values que correspondían a cada uno de los datos dentro del form que estaba hecho','2022-05-19'),(4224,210,'Bitacora 18','ahora lo que hice fue retocar el input de calendario y luego me puse hacer la pagina de admin desde cero, tome algunos ejemplos de algunas paginas y pensé en hacer un todo en uno de la misma pagina de admin pero todavía es un prototipo de como lo haría por que aun estoy viendo que puedo poner dentro de esa sola pagina o puedo dividirla en varias secciones pero eso lo veré mas adelante','2022-05-19'),(4225,211,'diagrama','en el dia de hoy nos organizamos y decidimos que iba a hacer cada uno, por mi parte hice el diagrama de secuencia y agregue algunas cosas en el diagrama de flujo de datos','2022-05-19'),(4226,219,'Apoyo grupo de Gantus','En el dia de la fecha, no tuve mucho progreso con el proyecto de mi grupo &quot;Stone&quot;, pero estuve ayudando al equipo de Gantus con su pagina.\r\nRediseñamos algunas cosas de la misma como la pestaña de los lenguajes y las pestañas de los ejercicios. Tambien comenzamos a estructurar el como funcionaria la pagina y todo su funcionamiento.','2022-05-19'),(4227,222,'vista nueva','hoy nos encargamos de mejorar el funcionamiento de los botones del abm, decidimos hacer una vista aparte para los estados clinicos\r\nporque en el modal no entraba todo y era mucho mas complejo llevar a cabo su funcionamiento, añadimos una tabla nueva de estados\r\nclinico.','2022-05-19'),(4228,221,'19/05','El dia de hoy estuve realizando la pagina de phyton. Tuve bastante inconvenientes en cuanto al dise;o de la pagina debido a que queriamos meter un carrosuel como fondo de pantalla pero dejar blanco en el medio. Lo que termino por descartarse debido a su dificultad y lo dejamos en una imgen sola. Estuve redise;ando el menu para que no este tan basio. Utilizando paginas como W3 como modelo para los ejercisios.','2022-05-19'),(4229,217,'Un nuevo pedido','El dia de hoy estuve intentando reparar la computadora de un compañero cosa que solo me pedia desbloquearla y al final si se logro, despues al revisar algunas netbook me di cuenta que los errores de las netbook coradir no son iguales en todas sino que tambien podria deberse a un error en la pantalla como sea hice el mantenimiento de su netbook, asi que por ahora me siento satisfecho. tengo que seguir estudiando y averiguando como reparar las g4','2022-05-19'),(4230,242,'20-05-22','Una vez obtuvimos las vistas de las paginas de los lenguajes, esperamos a que una idea que se nos venga a la cabeza, primero comenzando con el lenguaje “Python” para tener mejores ideas para el resto. Incluiría que arreglamos un par de vistas en el inicio.','2022-05-20'),(4231,208,'Card Cirgia o Card ortodoncia ortognatica','En el dia de hoy se siguió modificando las cards de la vista tratamientos, ayer termine con la de ortodoncia, ahora toco la de cirugía ortográfica se modifico el texto del end de la card, ademas del boton, y el lugar del boton queda pendiente modificar la imagen de la card, ademas fui charlando posibles ideas para la vista administrador con mi compañero brian farfan','2022-05-20'),(4232,221,'20/05','El dia de hoy no avanzamos mucho, cambiamos algunas imagenes y corregimos algunos errores de diseño. Todavia no sabemos a exacta como haremos el diseño de las paginas siguientes. Pero hoy por tiempo y al no estar todo el grupo no pudimos avanzar tanto ','2022-05-20'),(4233,217,'Revision de la carpeta de campo','El día de hoy para poder despejarme de lo que paso ayer de tanto armar y desarmar notebooks, me tome un respiro y me puse a revisar y continuar mi carpeta de capo con el fin de no estarme atrasando, también llegan las preocupaciones del nuevo prefecto de la DET que por lo que dicen es bastante exigente y me pregunto como andará feliz ya que según lo que se se le rompió su programador y no sabe como continuar','2022-05-20'),(4234,210,'bitacora 19','hoy estuve creando el boceto de la vista de administración del cual tendrá muchas cosas. en el interfaz estara un menu lateral encabezado con la foto de la persona acargo de la administracion debajajo su nombre y apellido, mas abajo estara 5 botones Resumen (mostrata pequeños datelles de cada vista de los siguientes botones mas 4 botones con distintas funciones) Calendario (mostrara turnos en ese mes o en ese dia a realizar) Pacientes ( Mostrara todos los pacientes sin importar su turno ademas de algunos botones que podra eliminar, agregar, modificar y ver) Dentistas (mostrara informacion de los dentistas) ajustes(esto esta proximo a ver)','2022-05-20'),(4235,209,'19-05+20-05 Backend Estado clinico','-Como descartamos la idea de que sea un update, desarrollamos una nueva vista, en la que hicimos un nuevo formulario, el cual la primera vez, le permite al usuario realizar un insert en una nueva tabla llamada &quot;estado clínico&quot;. Si se vuelve a tocar el botón, ya con datos insertados, muestra los mismos, y permite realizar un update de esta tabla(La cual esta relacionada con la tabla &quot;paciente&quot; a través del atributo dni ).\r\n-Revisamos los diagramas, y los corregimos, de acuerdo a los cambios que surgieron a lo largo del proyecto','2022-05-20'),(4236,216,'Revisión - Proyecto N° 1 #15','Revisé los diagramas realizados ayer con uno de mis compañeros. Nos queda pendiente rehacer uno que otro de mis compañeros hizo y con ello ya tendríamos más o menos todos completos.','2022-05-20'),(4237,234,'Clase N°20','En la clase de hoy seguí avanzando con el js de animaciones','2022-05-24'),(4238,246,'24-05-2022','En el día de la fecha junto a mi compañero de trabajo, intentamos re de organizar el github y nos queda por terminar el traslado de archivos, también me dedique a corregir cosas de mi carpeta de campo.','2022-05-24'),(4239,247,'Desarrollo de los Contenidos (24/5)','El día de hoy procedí a hacer un Word con los indicadores principales de los temas y contenidos que habrpa en la página. Por ahora, se redactó la introducción y varias variables de JavaScript.','2022-05-24'),(4240,237,'Clase 20','El día de hoy me puse a editar los buscadores y añadirle estilos','2022-05-24'),(4241,228,'Clase 20','Ayude a mi compañero a reorganizar el github del proyecto e intente avanzar con la pagina web pero la computadora no cargaba el css','2022-05-24'),(4242,230,'24/05/2022','Pude solucionar el error de importación de la base de datos por lo que pude continuar trabajando en el registro. Hice que se evite la repetición de datos como el correo electrónico y el nombre de usuario a la hora de registrar un usuario nuevo con uno ya existente.','2022-05-24'),(4243,229,'24-05-2022','En la clase de hoy me encargue de simular el logo de carga para la web cada vez que la BDD necesita recopilar varios datos de una compra que se considere grande','2022-05-24'),(4244,233,'clase 24/5/22','el dia de hoy estuve realizando la sidebar para toda la pagina Hubo complicaciones con las animaciones de la misma pero lo pude solucionar viendo un video y leyendo guias.\r\n','2022-05-24'),(4245,245,'24/5/2022','el dia de la fecha seguimos investigando sobre md5 para poder incriptar contraseñas y vimos si tenemos que hacer cambios de css de la pagina web ','2022-05-24'),(4246,236,'clase 20 (24/05/22)','En la clase del día de hoy estuve completando la carpeta de campo, ya que la había dejado de lado por un tiempo y a la pagina no le falta mucho para terminarse, por eso me puse a hacer la documentación que falta','2022-05-24'),(4247,231,'Clase 20','es es nuestra segunda decima clase de PP, hasta la fecha continuamos con la elaboración de los proyectos en grupo, el nuestro va trabajando constantemente aunque el día de hoy falto Dariel y creo que tendremos que hacer un rediseño con la pagina web ya que a algunos de los compaleros de grupo no les gusto el nuevo diseño y probablemnte tenga para la siguiente clase un par de diseños','2022-05-24'),(4248,232,'CLASE 19 24/05/2022','Hoy investigue y seguí avanzando en mis códigos de la base de datos de Mongo, hoy entendí varios de los problemas que tenia a la hora de realizar el código y tratar de resolverlos. Entre ellos con un error que me tiraba con el método &quot;require&quot; que tuve en las clases pasadas.','2022-05-24'),(4249,240,'Clase 18','Seguí trabajando en el register y empece el login','2022-05-24'),(4250,227,'Continuacion logo','Continuo el logo agregando algunos detalles.','2022-05-24'),(4251,226,'Clase 20','Completé la carpeta de campo con lo que hice anteriormente','2022-05-24'),(4252,249,'Clase 8','Hoy no hice mucho, ya que me sentía mal','2022-05-24'),(4253,241,'Bitacora Clase N°20 - Tomás Ortellado 6°1° C','Casi no tuve clase al entrar tarde porque hubo acto, y por dar una charla a los chicos de 3ro computación sobre lo que van a ir viendo en los próximos años.\r\n\r\nAparte de eso, me quedo pendiente ayudar a un compañero con un problema en la base de datos, que quedará para la próxima  clase.','2022-05-24'),(4254,216,'Diagrama de Secuencia - Proyecto N° 1 #16','Estuve rehaciendo el diagrama de secuencia previamente realizado la semana pasada por uno de mis compañeros. Ví un vídeo al respecto de su realización ya que no recordaba su estructura, avancé bastante con el mismo pero aún me falta una pequeña parte. ','2022-05-26'),(4255,213,'Llenar base de datos','El día de hoy intente llenar la base de datos conforme el formulario dictaba pero mientras mas me acercaba al código en php mas me daba cuenta que no entendía sobre el tema y  esto me llevo a una frustración por consecuencia de que no podía hacer algo que yo consideraba como fácil que era el hecho de pasar los datos del formulario a la base de datos que teníamos ','2022-05-26'),(4256,208,'Tarjetas 3D','El día de hoy lo utilice para ya por fin terminar con el diseño de cada una de las cards de la vista tratamiento:\r\n°Cirugia\r\n°Implantes\r\n°Protesis\r\n°Estetica\r\n°Endodoncia\r\nSe modifico la descripción de cada una de las cards anteriormente mencionadas, ademas de cambiar cada una de las descripciones por una mas breve y por ultimo se le agrego un botón que pegue mucho mas con el diseño de la pagina\r\nEsta clase se uso para terminar por completo cada una de las cards','2022-05-26');
INSERT INTO `bitacora` VALUES (4257,217,'Carpeta de campo','El dia de hoy el profesor consorti se encuentra de licencia por covid y el posee la unica llave para abrir el almacen donde se encuentran las notebook, ya que no se pudo continuar con ello me dedique a completar un poco mas la carpeta de campo cosa que avance con 5 paginas mas y me dedique revisar y buscar anteriores bin de netbooks de conectar igualdad, solo espero que los bins no varien dependiendo la marca de cada netbook ','2022-05-26'),(4258,242,'26-5-22','El día se fue para hacer varias cosas, con un poco de la ayuda del profe intentamos mejorar la vista de la pagina principal pero al final no resulto funcionar, fue mejor quedarlo como está. Nos arreglamos con otros metodos.','2022-05-26'),(4259,211,'codigo','en el día de hoy revisamos la pagina y vimos que algunos botones no funcionaban y daban error por lo cual tuvimos que ver el código pero no supimos como solucionarlo asi que seguimos con otras cosas, ademas pensamos en agregar otras opciones a la pagina','2022-05-26'),(4260,222,'diagramas y codigo','hoy nos fijamos en terminar y modificar adecuadamente los diagramas en general, revisamos el codigo de la pagina para resolver pequeños errores con los botones y nos planteamos el empezar a agregar nuevas tablas a la base de datos para determinar donde se esta alojando los pacientes','2022-05-26'),(4261,221,'26/05','El dia de hoy estuve corrigiendo algunos problemas que tuvimos con el carrusel del menú y cambiando algunas imágenes para una mejor ambientación de los lenguajes. Todavía tenemos que corregir algunas cosas del menú crear las páginas de los lenguajes y la base de datos. De momento estamos creando cada uno por su parte los tutoriales de los lenguajes. Parece que tendremos que dejarlo en 3 lenguajes por falta de un integrante del grupo. Al final si se puede intentaremos terminarlo por el a pesar de no tener el crédito, porque quedaría feo una página de 4 lenguajes con solo 3.','2022-05-26'),(4262,210,'bitacora 20','estuve continuando con lo que hice en mi casa que fue la pagina de inicio del modo administrador , lo que hice fue cambiar el color de cards ya que estuve un rato viendo el como es que podia solucionar un error de js que no me dejaba incorporar algunas acciones de bootstrap y luego de ello le puse iconos a los botones de inicio para que luego me de cuenta que tengo un error con el bootstrap o tengo algo raro en el codigo','2022-05-26'),(4263,247,'Desarrollo del Índice y de la Introducción (31/5)','Finalmente, llegue a la conclusión de cuales serán los temas principales relacionados a mi página de JavaScript, así como también los ejercicios, además de escribir el guión para video introductorio a JavaScript. Aparte de esto, también escribí la Introducción y una pequeña parte del primer tema de los nueve que pienso desarrollar para explicar JavaScript.','2022-05-31'),(4264,246,'bitacora 31-05-2022','En el dia de la fecha trabaje en la base de datos y ayude  ami compañero en la modificacion del php y listou','2022-05-31'),(4265,230,'31/05/2022','Hoy llevé a cabo el cifrado de contraseñas en la bdd a la hora de registrarse, después la validación de un mail y contraseña para el logeo. Este último no funcionó con las contraseñas cifradas, así que saqué eso temporalmente para que funcione.  ','2022-05-31'),(4266,227,'Continuacion logo y svg','Continue el logo. Ademas, comenzamos a coordinar un trabajo en equipo con el integrante encargado de diseño para incluir el svg del mapa de forma funcional.','2022-05-31'),(4267,238,'Clase 21 31/05/2022','Modifique la cuadrilla de la vista “servicios” para que todas las tarjetas sean cuadrados iguales.\r\nDecidimos de qué forma importar la información de los servicios de la base de datos.\r\n','2022-05-31'),(4268,233,'31/5/22','El dia de hoy ya finalice con la animacion del menú hamburguesa de la side bar. Luego continue con el armado de la base de datos de la página.\r\n','2022-05-31'),(4269,224,'Clase 21','Decidimos de que forma importar la información de los servicios a la base de datos ','2022-05-31'),(4270,234,'Clase N°21','En la clase de hoy empecé a investigar para trabajar con svg en js','2022-05-31'),(4271,228,'Clase 21','Comence a realizar la conexion php entre la base de datos y la pagina web','2022-05-31'),(4272,231,'Clase 21','Hoy no hubo mucho avanze x mi parte ya que no tuve computadora para trabajar y la q traje se quedo sin bateria y no pude guardar lo q tenia hecho, por otra parte los chicos continuaron con su parte aAllan con las apis y Dariel con el nuevo diseño de la pagima web que diseñe el fin de semana','2022-05-31'),(4273,241,'Bitacora Clase N°21 - Tomás Ortellado 6°1° C','Continúe aprendiendo a manejar una base de datos, aunque considero que debería ir mas a como crearla que a como administrarla, y de ahí ver como aplicar JavaScript para base de datos.\r\n\r\nO en este caso, MongoDB.\r\n','2022-05-31'),(4274,226,'Clase 21','Discutimos sobre el date picker y continué con la carpeta de campo','2022-05-31'),(4275,229,'31-05-2022','En la clase de hoy me encargue de las pruebas de animaciones, probar y dar una animación final al logo de carga, dándole fin al mismo y empezar con las animaciones que correspondan a cada botón que el encargado del frontend pida','2022-05-31'),(4276,245,'31/5/2022','el dia de la fecha estuve completando la carpete y puede completar el codigo php para encriptar las contraseñas','2022-05-31'),(4277,249,'clase 9','se me ocurrió la idea de hacer una linea del tiempo para la página y empecé a hacerla','2022-05-31'),(4278,237,'Clase 21','El dia de hoy ordene los archivos php con el html para poder tener un mejor entendimiento de la pagina y, de esta manera mis compañeros puedan aplicarle estilos a la pagina, ademas añadi una barra de max y min de plata para poder fijar un precio de busqueda','2022-05-31'),(4279,236,'clase 21 (31/05/22)','En el día de la fecha únicamente me centre en la documentación de mi carpeta de campo y revisar varias vistas de la pagina ','2022-05-31'),(4280,239,'Dia 20 31/5/22','termine las vistas de la pagina y conectar todo para porfin unir todo y tener la pagina lista','2022-05-31'),(4281,240,'Clase 19','Continué con el sistema de usuarios','2022-05-31'),(4282,227,'Pruebas con el svg','Me reuní con mi compañero encargado de diseñar el mapa y empezamos a unir ambos trabajos. Insertamos el svg en el archivo html de la partida y comenzamos a realizar algunos cambios, poniendonos de acuerdo en cómo continuar.','2022-06-01'),(4283,237,'Clase 22','El dia de hoy arregle la configuracion de precio maximo del ebay api, me puse a investigar ademas de como hacerlo pero para mercadolibre','2022-06-01'),(4284,228,'Clase 22','Modifique la base de datos y realice la conexion entre la base de datos, index.php y servicios.php','2022-06-01'),(4285,239,'Dia 21 1/6','Cambie el estilo de la pagina elegido por el grupo  ahora tengo que hacer lo mismo con todas las paginas','2022-06-01'),(4286,233,'1/6/22','El dia de hoy busque información de como realizar una base de datos. Tanto como para la administracion de los usuarios como para el almacenamiento de los videos,informacion sobre los lenguajes, etc. ','2022-06-01'),(4287,241,'Bitacora Clase N°22 - Tomás Ortellado 6°1° C','Segui viendo consultan en mongoDB','2022-06-01'),(4288,231,'Clase 22','hoy fue miercoles aunque no hubo mucho por hacer de mi parte ya que entregue todo lo que me pidieron y no tengo ninguna idea para algun nuevo diseño ademas los chicos estuvieron entretenidos viendo el partido de Argentina vs Italia','2022-06-01'),(4289,236,'clase 22 (01/06/22)','En la clase del día de la fecha realice lo que seria la documentación del proyecto y puse los botones que faltaban en las vistas del perfil (los botones de &quot;volver a inicio&quot;)','2022-06-01'),(4290,245,'01/06/2022','el dia de la fecha continue con mi compañero la pagina web que falta bastante ','2022-06-01'),(4291,238,'Clase 22 01/06/2022','Realizamos los archivos .php de manera de que todos los registros de la tabla “servicios” se muestren como tarjetas en la página de forma dinámica. Lo mismo con los datos de contacto.','2022-06-01'),(4292,229,'01-06-2022','En la clase de hoy se realizo un gran avance con la pantalla de carga\r\nPero por problemas técnicos(Falso contacto de la zapatilla) hizo que mi sitio de trabajo se apagara y perdiera todo lo avanzado en la clase','2022-06-01'),(4293,232,'CLASE 21 01/06/2022','Hoy vi como ayudar y completar en varios archivos de JavaScript, tanto para interfaces, con los de la base de datos y resolvi varias dudas con el profesor, llegando al punto de que algunos de los problemas que tenia con la base de datos era debido a la computadora con la que trabajaba','2022-06-01'),(4294,230,'01/06/2022','Hoy empecé a escribir los contenidos teóricos que tendrá la página, tanto una explicación corta introductoria de lo que es Java, cómo instalar este y cómo crear el primer programa. También empecé a pensar en los primeros videos tutoriales a hacer.','2022-06-01'),(4295,226,'Clase 22','Modifiqué los errores del register y completé la carpeta de campo','2022-06-01'),(4296,240,'Clase 20','Evita que se repitan datos en una base de datos MySQL con PHP, busque un icono para los errores, y cree una hoja de estilos para el register','2022-06-01'),(4297,234,'Clase N°22','En la clase de hoy estuve viendo vídeos de svg en js','2022-06-01'),(4298,247,'Contenido de la Página (1/6)','El día de hoy empece a desarrollar el contenido de los primeros temas de la página de JavaScript, además de repasar conceptos que tenía medio flojos respecto a este lenguaje.','2022-06-01'),(4299,249,'clase 10','seguí avanzando con la linea de tiempo','2022-06-01'),(4300,221,'02/06','El día de hoy estuvimos avanzando con la página de Python todavía nos falta empezar las otras pero una vez terminada esta solo será copi pega el resto.\r\nEstamos teniendo dificultades para el diseño de la página todavía porque no logramos hacer el centro de la página blanco para que se pueda ver y codear mejor.\r\n','2022-06-02'),(4301,210,'bitacora 21','hoy estaba corrigiendo el error de bootstrap de la clase pasada del card y los botones, ademas de que no funcionaban los botones del Collapse la clase pasada y ya lo arregle eliminando los Link y Script anteriores y poniendo nuevos. Pero tambien estuvo ayudando a mi compañero soler y sosa lucas con un problema del formulario que es el poner una imagen, elegir tratamientos y que dependiendo cual elegis te aparezcan distintos doctores que te van atender y estuvimos casi toda la clase viendo como arreglar eso','2022-06-02'),(4302,208,'Calendario y Formulario','La primera mitad de la clase la utilice para informarme sobre como hacer un calendario de eventos o gestionador de turnos busque en distintos vídeos de youtube e imágenes de google para tener un ejemplo claro y conciso de lo que necesito y quiero realzar\r\nTuvimos un pequeño coloquio sobre la eficiencia de nuestro formulario ya que no se podían completar los datos y que se inserten en la base de datos. Charlamos nuestro inconveniente con el profesor y nos dio variadas soluciones como por ejemplo utilizar una función de php llamada ajax','2022-06-02'),(4303,217,'Nueva PC','El dia de ayer me encontre con felix, por sorpresa para me comento que un ex compañero que se cambio de turno a la mañana tenia una computadora de conectar igualdad G9 bloqueada cosa que el tenia aquella pc y me la entrego a mi para que pudiera realizar su desbloqueo, este dia lo hice y no fue muy complicado, lo que si a veces siento desconfianza al querer montar los tornillos de vuelta ya que me ocurrio un error del cual es dificil de olvidar','2022-06-02'),(4304,219,'Problemas con Stone','Ultimamente tuvimos problemas con el proyecto Stone, ya que como este esta ciertamente basado en el código de una tienda que hice, tiene el problema de que los códigos no están preparados para un proyecto tipo maxirest. Por lo que no parábamos de tener problemas con la programación de las vistas y de los controladores. \r\nConsultándole a un profesor, nos dijeron que debíamos usar el JQuery Ajax, por lo que decidimos por 4ta vez reiniciar la pagina web y su programacion. Mantendremos la estructura que ya veníamos planeando pero vamos a volver a programar la pagina porque sinceramente ya no podemos seguir con estos problemas.','2022-06-02'),(4305,220,'02/06/2022','el dia de hoy se arreglaron unos temas de la pag administrativa y se creo una nueva vista de la app android ','2022-06-02'),(4306,213,'Debate serio sobre el form de turnos ','Al día que nos acontece intente seguir con el form que tenia de tarea mi compañero de trabajo llego con un archivo .php que contenía un insert para que al momento de rellenar el form este complete la base de datos con lo rellenado en el form para que podamos mostrar esto mismo en la pagina de admin \r\nTras esto intentamos hacer cambios visuales a la vista de turnos al momento de pedir uno lo que debía de hacer esta vista es la de al momento de ir avanzando en la barra de progresión los datos deberían ocultase o mostrarse dependiendo lo antes rellenado','2022-06-02'),(4307,242,'02-06-22','Hoy hicimos lo que pudimos, como ya tener una idea de pies a cabeza en la página inicial para cada lenguaje que tenemos planeado hacer. Tomamos el inicio para Python para hacer que aquella idea este completa y luego hacerlo con los demás.','2022-06-02'),(4308,223,'Reincorporación a las clases después de tener COVID','Debido a mi ausencia en las últimas semanas debido a que me enferme de covid mis compañeros de grupo se retrasaron mucho en el proyecto, por eso hoy decidí enfocarme por completo en el avance de la pagina administrativa junto con las modificaciones apropiadas a la base de datos\r\nEstas modificaciones en la base de datos consisten en eliminar las filas que no sirven en la tabla de ventas.\r\nPor otro lado, en el código de las vistas de la pagina también modifique algunas cosas\r\n','2022-06-02'),(4309,242,'3-6-22','acticamente hicimos lo que no pudimos terminar ayer, aunque hoy tampoco logramos dar un mejor avance ya que tuvimos varios problemas cuales no logramos resolver, nos quedamos haciendo casi nada. ','2022-06-03'),(4310,219,'a?','En el dia de la fecha, no hicimos nada. Fue mas que nada un dia para tocar la guitarra con Brian.','2022-06-03'),(4311,223,'Investigación sobre conexiones php y ajax','El día de hoy nos concentramos en investigar las cosas que nos generaban dudad sobre conexiones del los códigos del proyecto, conexiones como kotlin y php para conectar con la base de datos, también investigamos breve mente sobre Java Stript Ajax para poder cargar la informaciòn de la pagina por bloques y no tener problemas a la hora de mostrar nueva información. Por otro lado, complete algunas cosas que estaban inconclusas en mi carpeta de campo con respecto a ayer y hoy.','2022-06-03'),(4312,210,'bitacora 22','Hoy en el dia de la fecha no hice nada pero aprendi a tocar 4 temitas de la guitarra que mi compañero fiasche me enseño :D','2022-06-03'),(4313,213,'Ajax ','El dia que nos acontece me centre en buscar el funcionamiento del ajax encontre una pagina llamada MDN Plus dentro de este espacio digital me informe e investigue sobre el funcionamiento del ajax por su necesitad dentro del proyecto que tenemos asignado este sera necesario para la actualizar la pagina cada ves que avance la barra de progresion que pusimos al momento de rellenar la base de datos \r\nY despues al momento profundizar mas en el tema me abrumo justamente unos compañero trajeron guitarras y me prendí a la banda','2022-06-03'),(4314,217,'Primer Desbloqueo G4','El dia de hoy el profesor que vino ayer con su computadora g4 de conectar igualdad, la trajo hoy y me pidio si podia desbloquearla, cosa que al principio tenia mis dudas porque era nueva y no sabia mucho como hacerlo pero al final si se dio el caso depues de eastra tanto luchando con un miserable tonillo y tendre que conseguir nuevos destornilladores chiquitos, luego de eso estuve tambien luchando por saber cual era la pata 8 del chip y al final de prueba y error pude leer el chip y realizar el desbloqueo, un dia de trabajo.','2022-06-03'),(4315,245,'7/6/2022','el dia de la fecha fuimos a una capacitación de dmd de seguridad informática \r\ny luego ingresamos devuelta a la escuela y en mi caso empecé a investigar sobre sistema de encriptación SHA','2022-06-07'),(4316,229,'07-06-2022','En la clase de hoy, empece con las pruebas de fuentes externas, para tener ideas para la fuente personalizada que se utilizara para nuestro proyecto\r\n','2022-06-07'),(4317,231,'Clase 23','Se podria decir que nuestra clase comenzo desde las 10 de la mañana ya que tuvimos que ir a un eventro del asac y estuvimos alli dos horas para luego tener un largo viaje ya de regreso al aula no hubo mucho que podria hacer ya que no tengo nada oara aportar ','2022-06-07'),(4318,246,'bitacora 7/06/2022','hoy comencé a ver unos cursos de sql, la diferencia en las nosql y las sql y revise todos los sectores en los cuales nos dividimos los integrantes del grupo','2022-06-07'),(4319,234,'Clase N°23','Seguimos trabajando en grupo, aparte por la mañana tuvimos un encuentro en el cmd','2022-06-07'),(4320,233,'7/6/22','El día de hoy asistimos a una capacitación en el Centro Metropolitano de Diseño sobre Ciberseguridad. Luego volvimos a la escuela y continuamos con nuestros proyectos. ','2022-06-07'),(4321,240,'Clase 21','Comencé el re diseño de la pagina','2022-06-07'),(4322,241,'Bitacora Clase N°23 - Tomás Ortellado 6°1° C','Esta mañana fuimos a una charla en Barracas  en el Centro Metropolitano de Diseño sobre seguridad.\r\n\r\nAparte de eso, a la tarde continué un poco con las consultas en MongoDB \r\n\r\n','2022-06-07'),(4323,247,'Charla de Seguridad Informática (7/6)','El día de hoy, viajamos hacia Barracas para tener una charla sobre seguridad informática en el Centro Cultural Metropolitano, charla que se dividió en dos secciones: la primera, muy técnica, que trata sobre los protocoles sobre la seguridad y la segunda relacionada a los hackers. Ya en Proyecto Informático, investigue y desarrolle un poco más la Introducción de JavaScript.','2022-06-07'),(4324,249,'clase 11','tuvimos una charla de ciberseguridad y empecé a rediseñar las vistas de la página.','2022-06-07'),(4325,230,'07/06/2022','Hoy tuvimos una charla de capacitación sobre ISACA, ciberseguridad y hacking ético en barracas, al final completamos un cuestionario sobre dichos temas y relacionados. También hoy hice el guión para el tutorial de instalación de Java.','2022-06-07'),(4326,226,'Clase 23','Completé la carpeta de campo y realicé algunos cambios en la rama main','2022-06-07'),(4327,236,'clase 23 (07/06/22)','En la clase del día de la fecha estuve realizando el diagrama de Gantt de nuevo, ya que lo había perdido en el drive, también estuve haciendo documentación en la carpeta de campo ya que estaba incompleta.','2022-06-07'),(4328,227,'Avance JS','El dia de hoy logramos implementar el código JS correspondiente a la apertura de modales al clickear sobre un territorio. Además, incluimos otras funciones de JS sobre los territorios como, por ejemplo, que cambie de color de fondo segun de qué jugador sea el territorio.','2022-06-07'),(4329,232,'CLASE 22 07-06-2022 / CLASE 23 08-06-2022','CLASE 22 07-06-2022\r\n\r\nHoy asistimos a una charla sobre ciberseguridad, en esta nos contaron sobre dos empresas complemente distintas destinadas a lo mismo, una siendo ISACA y otra ROOT-SECURE. En esa charla nos explicaron conceptos y las maneras en las que se arman sistemas de seguridad apropiados\r\n\r\nCLASE 23 08-06-2022\r\n\r\nHoy desarrolle la base de datos utilizando el lenguaje MySQL y también utilizando PHP haciendo uso de jQuery. Logré hacer varias tablas de las que se tenía que hacer','2022-06-08'),(4330,226,'Clase 24','Continué con la carpeta de campo, Charlamos los nuevos diseños de las paginas y restauré un navbar que había sido borrado por error','2022-06-08'),(4331,231,'clase 24','el dia de hoy es miercoles, falto Tobias hize un nuevo diseño para le buscador de la pagina y no se cuanto avanzo el resto, por mi parte no hize mas de lo mencionado hace un momento','2022-06-08'),(4332,239,'Dia 22 8/6','termine el css de la vista main y empece con el de las demas vistas','2022-06-08'),(4333,228,'Clase 24','Complete la carpeta de campo y colabore con la realización del login','2022-06-08'),(4334,249,'Clase 12','Se empezó a hacer los bocetos de todas las vistas para rediseñar la página','2022-06-08'),(4335,229,'08-06-2022','En la clase de hoy, me centre en codificar un borrador completa al encargado del frontend, para que no pierda tiempo en el pensamiento y diseñaje desde cero','2022-06-08'),(4336,237,'Clase 24','Hoy me dedique a orientar un poco al equipo y armar un sistema para subir datos a la base de datos.','2022-06-08'),(4337,234,'Clase N°24','En la clase de hoy estuve investigando sobre las civilizaciones con las que realizaremos el proyecto final, descubrí que tipos de bandera tenían para poder realizar el escudo de cada facción.','2022-06-08'),(4338,240,'Clase 22','termine junto con mi compañera los bocetos','2022-06-08'),(4339,227,'Investigación Ajax y Arreglo de dimensiones','Comencé el día realizando una investigación acerca de ajax y cómo utilizarlo para hacer una conexión con la base de datos, anoté los códigos que me servian. Posteriormente, dimos solución a una problemática que surgió al ver que las dimensiones del mapa no eran correctas y sus bordes no estaban bien delimitados. Finalmente, descargué el XAMPP para comenzar a trabajar con php y ajax..','2022-06-08'),(4340,238,'Clase 24 08/06/2022','Empecé a realizar la vista para la sección del administrador. Desde esta se podrán agregar registros a la base de datos de ‘servicios’ y modificar los datos de contacto.','2022-06-08'),(4341,247,'Funciones Básicas de JavaScript (8/6)','El día de hoy, explique en el documento que posteriormente será subido en la página, lo que es JavaScript, para que sirve, algunos temas relacionado a la consola de JavaScript, además de un glosario de términos a los que uno deberá acostumbrarse para trabajar con este lenguaje de programación.','2022-06-08'),(4342,233,'Clase 8/6/22','El dia de hoy me enfoque en el estructuramiendo de la página. Estableciendo las distintas secciones con los temas correspondientes al lenguaje y solucioné un problema con la sidebar en el cual no se mostraba las animaciones de desplazamiento. ','2022-06-08'),(4343,241,'Bitacora Clase N°24 - Tomás Ortellado 6°1° C','Hoy decidimos cambiar la base de datos.\r\n\r\nDebido a eso, pase a trabajar a diseño, de vuelta, pero esta vez será de un plazo mayor al anterior.\r\n\r\nMi meta será diseñar los estandartes de las facciones.\r\n','2022-06-08'),(4344,236,'clase 24 (08/06/22)','En la clase del día de la fecha realice una campanita de notificación en el navbar, que lo que hace es mostrar un mensaje y mostrar la cantidad de mensajes recibidos o no leídos por el usuario, ademas, estuve haciendo la carpeta de campo ya que la tenia media incompleta','2022-06-08'),(4345,230,'08/06/2022','Hoy estuve modificando el diseño de las páginas en donde irá la información explicativa de Java, además de estar agregando material a las mismas, más específicamente a la página introductoria al lenguaje y con la de fijarse la versión y la instalación del lenguaje. ','2022-06-08'),(4346,242,'09-06-22','Hoy hemos hecho una variedad de cosas, aprender de una I.A. bastante curiosa, dimos nuestro mejor intento de mejorar como es la base de Python, aunque esta costandonos bastante de nuestra imaginación. El resultado no fue lo que esperamos pero fue al menos un buen avance.','2022-06-09'),(4347,221,'09/06','El dia de hoy estuve completando la carpeta de campo llenando con la experiencia que tuvimos en la expocision de ciberseguridad. Y avanzando con nuestro proyecto.\r\n','2022-06-09'),(4348,210,'bitacora 23','cree la vista de dentistas con la misma tabla del primer pagina de administracion la vez que estaba probando y tambien cree con la misma estructura pero le cambie algunos colores asi se puede diferenciar mejor todo esto tambien cambie una funcion que iba a tener el contador de la vista de inicio y estoy pensando en poner imagenes en la tabla de dentistas','2022-06-09'),(4349,209,'09-06-22 Finalizacion del primer modulo','-Finalizamos la pagina con su primer modulo de ABM de datos.\r\n-Tienen funcionalidad todos los botones.\r\n-La base de datos tiene 2 triggers que cuando se eliminan registros en las tablas principales, copian los datos en una tabla de respaldo\r\n-Queda revisar la pagina en el aspecto de la estetica(es muy fea)','2022-06-09'),(4350,217,'cambio de pantalla de mofelo diferente','el dia de hoy un alumnos de 3er año vino a mi para realizar el cambio de display de su netbook ya que el suyo estaba roto y el habia traido un display nuevo que habia comprado antes por lo que al principio estuvimos alrededor de 2 horas intentando separar la carcaza del display y desarmando la parte baja de la pc, al final si se púdo cambiar el display y el muchacho se fue a casa. luego yo continue con mi proyecto de desblqueo y al parecer descubri que no todas las netbook son iguales en su chip TPM','2022-06-09'),(4351,213,'Ajax 2 ','Hoy tuvimos una reunión para ver el futuro del proyecto sobre todo con el tema del Ajax y su dificultad a la hora de implementar por nuestros medios debido a que no contamos con el conocimiento suficiente para la realización e implementan de este método dentro del formulario de la vista de turnos . Teniendo esto en cuenta se dio  a pensar que podríamos realizar distintas vistas para evitar este tema del Ajax y con cada una de estas llamar en consecuencia a la base de datos dependiendo lo requerido','2022-06-09'),(4352,219,'Progreso Stone','En el dia de la fecha avanzamos tanto con la aplicacion android y sus vistas como con las vistas de la aplicacion web. En el caso de la aplicacion android continuamos las vistas de inicio, cupones y menú. Y en la aplicacion web, comenzamos nuevamente con el dashboard y con el diseño que va a tener esta.\r\nCave recalcar que el proyecto volvio a reiniciarse porque se nos dificulto la aplicacion del AJAX por php, por lo que decidimos pasar al AJAX de JS','2022-06-09'),(4353,220,'09/06/2022','el dia de hoy hubo errores al tratar de implementar un carrusel en android\r\n','2022-06-09'),(4354,223,'Nuevo planteamiento sobre el proyecto','El día de hoy no fue demasiado productivo debido a que asisti a clases con un malestar muy grande y me vi en la obligacion de retirarme antes de que la clase terminara, pero en el tiempo que tube aprobeche para repasar con mis compañeros los problemas y posibles soluciones del trabajo, y llegamos a la conclucion de que lo mejor es empezar con la pagina administrativa de cero, por otro lado investigue que es y como funciona ajax para comprenderlo mejor y llegar a utilizarlo pronto ','2022-06-09'),(4355,238,'Clase 25 14/06/2022','Nos vimos obligados a modificar nuevamente la base de datos ya que la última vez el encargado no guardó los cambios.\r\nInvestigamos como hacer el login.\r\n','2022-06-14'),(4356,237,'Clase 25','el día de hoy estuve con mi compañero viendo cómo unificar el loading con el buscador, el loading se creó como pantalla de carga ya que el request tarda tiempo para mostrar los resultados','2022-06-14'),(4357,228,'Clase 25','Modificamos la base de datos y investigue como hacer el login','2022-06-14'),(4358,247,'Comentarios y Estructuras de JavaScript (14/6)','El día de hoy avancé en el desarrollo de la página la parte de la explicación en texto, específicamente, la parte donde hablo de los comentarios, como hacerlos en JS y cual es su utilidad para los trabajos en equipo, aparte de explicar que son las estructuras de control.','2022-06-14'),(4359,249,'Clase 13','Volví a hacer el boceto del login ya que vimos que otro grupo ya tiene el modelo que nosotros habíamos pensado ','2022-06-14'),(4360,241,'Bitacora Clase N°25 - Tomás Ortellado 6°1° C','Me puse a ver un video curso básico de Photoshop.\r\n\r\nEl autor se llama Ruva y vi hasta el minuto 44. Esto ultimo lo menciono para cuando lo pase a la carpeta de campo.','2022-06-14'),(4361,227,'Comienzo conexion con bdd','Comenzamos la conexion con bdd utilizando php y ajax.\r\nInvestigamos un poco mas acerca del mismo.','2022-06-14'),(4362,232,'CLASE 24 - 14/06/2022','Hoy avanzamos en cuanto al PHP, incorporando al HTML de una pagina estos segmetos de codigo en PHP, permitiendonos enviar a una base de datos en Localhost los nombre de los usuarios. Estos aun asi nos tiraban error pero no nos limitaban ya que nos permitian seguir avanzando.','2022-06-14'),(4363,240,'Clase 23','comencé con el re diseño y otros ajustes del nuevo diseño','2022-06-14'),(4364,236,'clase 25 (14/06/22)','En la clase del día de la fecha estuve actualizando el diagrama de Gantt (sus fechas y lista de tareas para ser mas especifico) y estuvimos asignando las tareas para el re diseño de la pagina que estuvimos hablando en la semana.','2022-06-14'),(4365,231,'Clase 25','Ingrese tarde a clases, una vez dentro de clases trate de ver en que podia ayudar ya que no tenia nada que hacer, ayude a Ivan con el tema de la paleta de colores del carrito para insertarlo en la pagina de carga y trata de ver q mas podia hacer ya que tambien olvide mi pendrive en casa','2022-06-14'),(4366,229,'14-06-2022','En la clase de hoy, re-modelamos las letras del titulo LOADING... de la pantalla de carga e intentamos mediante js tratar de agregarlo como evento al momento de que se genere el delay cuando las APIs compilen todos los datos que el consumidor haya indicado para buscar','2022-06-14'),(4367,239,'Dia 23','hoy junte las apis con la pagina para por fin ponerle css a la parte del buscador pero se me frizo la PC y ahora tengo que hacerlo de nuevo','2022-06-14'),(4368,245,'14-6-2022','el dia de la fecha he perfeccionado la incriptacion md5 para poder encriptar cuentas he usuarios. \r\nLa base de datos ya puede registrar y leer cuentas encriptadas con md5\r\n','2022-06-14'),(4369,234,'Clase N°25','Empecé a realizar el escudo para la facción de los romanos','2022-06-14'),(4370,226,'Clase 25','Discutimos el diseño del proyecto nuevamente y continué con la carpeta de campo','2022-06-14'),(4371,230,'14/06/2022','Hoy diseñé el botón para ir a la página anterior en los tutoriales de Java, además de seguir completando la página de iniciación, más específicamente la creación del primer programa. ','2022-06-14'),(4372,237,'Clase 26 ','El dia de hoy termine la primera version del programa de busquedas en las apis y ayude a mis compañeros con sus inconvenientes con el mismo.','2022-06-15'),(4373,247,'Estructura JavaScript (15/6)','El día de hoy me dedique a escribir y desarrollar lo que es la estructura en JavaScript, con los condicionales If, Else, If Else, ?: y Switch.','2022-06-15'),(4374,238,'Clase 26 15/06/2022','Realizamos el Login para el modo de administración. Hicimos que desde este sea posible ver todos los servicios disponibles, modificarlos, eliminarlos y también insertar nuevos. Le agregue un sencillo css.','2022-06-15'),(4375,233,'15/6/22 ','El dia de hoy continuamos con el desarrollo de la página.\r\n','2022-06-15'),(4376,231,'clase 26','el dia hoy fue miercoles y no pude ayudar mucho en el proceso de la pagina web ya que no tenia nada en mente y nada nuevo que aportar, por otro lado estuve practicando un poco con adobe ilustraitor para saber si puedo hacer algo nuevo','2022-06-15'),(4377,228,'Clase 26','Termine de arreglar el login, realice la funcionalidad para insertar, editar y eliminar registros de la base de datos desde la pagina web','2022-06-15'),(4378,232,'CLASE 25 15/06/2022','Hoy pudimos finalmente conectar el boton de la configuracion de partida para que el usuario que nosotros metamos lo redireccione a una base de datos en localhost, tambien ayudé en el apartado de diseño grafico recoloreando algunas de las texturas que se van a usar.','2022-06-15'),(4379,229,'15-06-2022','En la clase de hoy, seguí con la pantalla de carga, pero esta vez tratando de utilizar el método modal para poder generar la pantalla de carga, pero al final los intentos fueron un fracaso','2022-06-15'),(4380,227,'Avance con ajax','El dia de hoy logré conectar la base de datos mediante ajax. Luego, vinculé los nombres de los jugadores con los de la base de datos, además de continuar investigando y mejorar la base de datos actual.','2022-06-15'),(4381,246,'Bitacora 15/06','En el dia de la fecha modifique la carpeta de campo y ayude un poco a mis compañeros con la conexion de php con la BDD.','2022-06-15'),(4382,249,'Clase 14','Empecé a diseñar el index','2022-06-15'),(4383,234,'Clase N°26','Hoy seguí buscando diseños para los escudos y empecé a diseñar el escudo de los romanos.','2022-06-15'),(4384,245,'15/6/2022','En el día de la fecha con mi compañero juntamos mi trabajo de php con su html y la base de datos \r\n\r\ntambién en el día de hoy llegue a 82 paginas en mi carpeta','2022-06-15'),(4385,241,'Bitacora Clase N°25 - Tomás Ortellado 6°1° C','Continué viendo el vídeo tutorial de Photoshop, esta vez pasando lo que estuve viendo a carpeta de campo, tomando recortes de pantalla y redactando lo que hacen las distintas herramientas e información que fue dando el autor del video.','2022-06-15'),(4386,239,'Dia 24','Hoy conecte todo a la pagina un un login y un register completamente funcional y cconecte las apis echas por mi compañero Allan, el problema es que no funcionan del todo.','2022-06-15'),(4387,230,'15/06/2022','Hoy seguí completando los pasos a seguir en la creación de un primer programa Java en el tutorial, además de empezar a buscar contenidos para la siguiente sección. Hubo varios inconvenientes como con las variables de entorno, no pudiendo compilar con el comando javac. Tambbién perdí dos veces el progreso de hoy teniendo que hacerlo desde el principio. ','2022-06-15'),(4388,226,'Clase 26','El día de hoy ayude con el re-diseño del perfil y del formulario del registro','2022-06-15'),(4389,236,'clase 26 (15/06/22)','En la clase del día de la fecha estuve haciendo documentación del proyecto, también, estuve haciendo modificaciones en las vistas del perfil agregándole iconos y cambiándole el &quot;:hover&quot;','2022-06-15'),(4390,240,'Clase 24','Inicie el re-diseño del register','2022-06-15'),(4391,242,'16-06-22','Hoy poco hicimos, nos distrajimos haciendo alguna cosa que era otra materia, pero aun así con el resto del tiempo que nos sobró intentamos deducir que cosas nos faltó para la el proyecto, como fue terminar las descripciones de tal lenguaje de programación.\r\n','2022-06-16'),(4392,221,'16/07','El día de hoy tuvimos menos tiempo debido a una reunión de los profes aun así seguimos avanzando en la página y corrigiendo algunas cosas. En mi caso tuve un problema en mi casa y se perdió el progreso que tenía hasta ahora del tutorial de mi lenguaje por lo que me tome el tiempo de la clase para volver a hacerlo lo más rápido que pude ya que me acordaba a medias lo que ya había puesto pero tendré que hacer otra vez el video en mi casa y eso que me llevo algo de tiempo pero bueno. ','2022-06-16'),(4393,209,'16-06-22 Mejoras en seguridad ','-Modificamos un el backend para que los datos esten encriptados con md5()\r\n-Empezamos a diseñar/programar un nuevo formulario de register','2022-06-16'),(4394,217,'nueva notebook','el dia de hoy recibi una netbook g7 que intente reparar en un principio en mi casa cosa que al principio no tenia los archivos correctos y tuve que buscarlos, tampoco fue un problema lo que si al parecer una vez hecho un flash al TPM o chip de bloqueo al parecer queda semi inhabilitado, una vez en clase intente hacer un cambio de mother cosa que resulto pero en un principio no prendia y llegue a pensar en hacer un flash del bios completo y reescribir los archivos de bloqueo, en fin tarea para el finde largo tambien se continuo con la carpeta de campo y muy probablemente se terminara en casa','2022-06-16'),(4395,210,'bitacora 24','hoy estuve haciendo los modales de la vista de de administración como lo son los modales de Agregar Administradores y cada modal de &quot;eliminar&quot; de las vistas de las tablas de administradores, dentistas y pacientes no tuvimos mucho tiempo debido  a que hoy hubo una jornada institucional e ingresamos tarde pero pude avanzar la carpeta de campo hasta la pagina 91 :D','2022-06-16'),(4396,216,'Encriptación, Materialize - Proyecto N° 1 #17','Realizamos la encriptación de las contraseñas con md5. Comenzaremos a realizar el diseño del register. Ví algunos video tutoriales sobre Materialize.','2022-06-16'),(4397,213,'Introduccion a JS','Al día que nos aconteciesen debido a un jornada institucional entramos a las 3 pero esto no fue impedimento para el avance del proyecto. Al momento de subir me puse a cuestionarme sobre el avance del proyecto y sobre todo en lo que respecta al tema del formulario debido a que este necesita el Ajax para avanzar y mostrar lo que es correcto al momento debido según se completen los datos ingresados por el usuario \r\nPero para empezar en el uso de Ajax debía aprender como era la sintaxis básica de los archivos .Js(JavaScript) y hoy me centre en aprender a hacer la conexión entre el archivo .Js y el .html ','2022-06-16'),(4398,237,'Clase 27','En el dia de hoy estube armando la carpeta de campos y ayudando a mi compañero con el formulario de las apis ya que le generan problemas','2022-06-21'),(4399,228,'Clase 27','Realice modificaciones menores al modo administrador ','2022-06-21'),(4400,246,'bitacora 21/6','en el día de la fecha comencé con las diapositivas del proyecto a exponer el dia 29 de junio del año 2022','2022-06-21'),(4401,249,'Clase 15','Empecé a hacer junto con mi compañero nico la presentación del proyecto.','2022-06-21'),(4402,226,'Clase 27','Discutimos la presentación del proyecto','2022-06-21'),(4403,234,'Clase N°27','En la clase de hoy terminé el escudo de los romanos y empecé a buscar diseños para el escudo de los franceses','2022-06-21'),(4404,245,'21/6/2022','el día de hoy me comprometí a terminar la carpeta para el fin del bimestre hasta la fecha la cantidad de paginas son 112 \r\ntambién organizamos como vamos a desempeñar la presentación del trabajo que lo tenemos que exponer el día 29/6','2022-06-21'),(4405,238,'Clase 27 21/06/2022','Modificamos el modo admin, combinando las vistas en las se ven todos los servicios y la que permite modificarlos.\r\nComencé a darle estilos al Modo Admin.\r\n','2022-06-21'),(4406,247,'Más Apartados Técnicos de JavaScript (21/6)','El día de hoy aprendí varios puntos claves relacionados a la creación de una base de datos para la página. Sumado a esto, seguí avanzando en el contenido textual de la página explicando que son los bucles e iteraciones (el día de hoy fue más corto debido a un acto a las 3 de la tarde).','2022-06-21'),(4407,240,'Clase 25','Adelante la carpeta de campo y discutí acerca de la presentación ','2022-06-21'),(4408,231,'clase 27','hoy tuvimos una clase más corta de lo peculiar debido a que tuvimos el acto del Día de la bandera y en el perdimos 25 minutos de clase luego de las 3pm sin en embargo antes de esta hora estuvimos actualizando la carpeta de campo y en como vamos a presentar nuestro proyecto desarrollado del cual aun esta en proceso','2022-06-21'),(4409,239,'Dia 25','El día de hoy estuve haciendo la carpeta de campo y se presento un acto en memoria del 20/6.','2022-06-21'),(4410,241,'Bitacora Clase N°26 - Tomás Ortellado 6°1° C','Continué con el curso introductorio de photoshop, solo que al terminar el recre tuvimos un acto, y al cabo de terminar el acto nos retiramos.','2022-06-21'),(4411,227,'Resolucion de problemas y acomodo de código','El dia de hoy surgió un problema en el cual los datos obtenidos de la base de datos no eran almacenados en las variables. El problema era que ajax demora un poco en traer los datos, por lo que puse un timeout para retrasar medio segundo la ejecución del código.\r\nAdemás, acomodé los ids de los territorios, les asigné una clase y acomodé el código de los mismos.','2022-06-21'),(4412,233,'Clase 21/6/22','El día de hoy con mi grupo, debatimos como será la estructura de la base de datos. Luego me dedique a actualizar el contenido de la Carpeta de Campo.','2022-06-21'),(4413,230,'21/06','Hoy seguí pensando y escribiendo los contenidos de la página tutorial de Java, como podrían ser temas como el método print() y println() y empecé con los comentarios. ','2022-06-21'),(4414,236,'clase 27 (21/06/22)','En la clase del día de hoy seguí documentando lo que seria la carpeta de campo ya que estaba incompleta  y comenze a preparar la presentación del proyecto que seria la semana que viene.','2022-06-21'),(4415,234,'Clase N°28','En la clase de hoy estuve dibujando y remarcando los bordes del escudo romano para así poder terminarlo','2022-06-22'),(4416,249,'Clase 16','Empecé la presentación del proyecto','2022-06-22'),(4417,247,'La Presentación (22/6)','El día de hoy realice junto a mi grupo el PowerPoint para la futura presentación de lo que vendría a ser nuestro proyecto, además de guionizar lo que diríamos cada uno en nuestra respectiva parte.','2022-06-22'),(4418,241,'Bitacora Clase N°27 - Tomás Ortellado 6°1° C','Termine con el video de introducción a photoshop y empecé a diseñar la bandera para la facción japonesa.','2022-06-22'),(4419,229,'22-06-2022','La clase de hoy, me dedique a la creación del diseño de varios botones para aligerar un poco su trabajo, en donde logramos coincidir con un diseño final','2022-06-22'),(4420,237,'Clase 28','Se cambiaron partes del html y css de los resultados de la búsqueda para una mejor estética y, acercarse mas al producto final','2022-06-22'),(4421,231,'clase 28','hoy estuve completando la carpeta da campo y aun me faltan paginas pero creo que para el martes que viene la tenga casi completa... espero por otro lado estuve probando un par de cosas para los diseño de las animaciones y los chicos estan avanzando con sus carpetas y la presentacion','2022-06-22'),(4422,228,'Clase 28','Colabore con la corrección de errores en el modo administrador y ayude a realizar la presentacion del proyecto en PowerPoint ','2022-06-22'),(4423,239,'Dia 26','El Dia de hoy termine la función de buscador de la pagina y es completamente funcional excepto por algunos errores que luego voy a corregir\r\n','2022-06-22'),(4424,233,'22/6/22','El día de hoy realizamos las diapositivas que vamos a mostrar en la explosión del proyecto. Luego continué con la carpeta de campo.\r\n','2022-06-22'),(4425,226,'Clase 28','Probé la compatibilidad de la pagina con el sistema operativo Kali Linux\r\n','2022-06-22'),(4426,238,'Clase 28 22/06/2022','Continúe dándole estilos al modo administrador y también lo hice responsive.\r\nAyudé a realizar el Power Point para la presentación de los avances del proyecto. Evaluamos posibles vulnerabilidades del sitio.\r\n','2022-06-22'),(4427,227,'Recuperación de datos de la bdd','Aquellos elementos que hasta ahora contenian texto provisorio, se los conectó con la base de datos y se recupero la información correspondiente al mismo. Además se remodeló la base de datos y se agregaron otras pequeñas funcionalidades de javascript','2022-06-22'),(4428,232,'CLASE 27 - 22/06/2022','Hoy completé varios logins usando PHP, use distintos metodos y sintaxis en la misma para llegar al mismo punto, tambien hice uso de AJAX para facilitarmelo. Parte de lo aprendido lo hice a partir de un video de youtube que me sirvio de base para completarlo','2022-06-22'),(4429,248,'22-06-2022','Hoy vi unos videos de como arreglar el programador ch341a y aparte de eso veia videos de como instalar el windows 7 y 8 para las netbook G4, G5 y G9, encontre muchas cosas y instale los 2 windows para el martes que viene asi los instalo a las netbook.','2022-06-22'),(4430,240,'Clase 26','seguí trabajando con mi carpeta de campo','2022-06-22'),(4431,236,'clase 28 (22/06/22)','En la clase del día de hoy estuve completando la carpeta de campo y empece preparando lo que viene siendo la presentación del proyecto haciendo la introducción de la exposición y haciendo la descripción de las diapositivas.','2022-06-22'),(4432,230,'22/6/2022','Hoy empezamos a desarrollar la presentación que haremos sobre nuestra página web. Empezamos a hacer un powerpoint que nos ayude a explicar y enseñar la misma a los demás, además de ir pensando más o menos como podría ser el discurso. ','2022-06-22'),(4433,245,'22/6/2022','el dia de la fecha segui completando la carpeta y tambien hice el diagrama de entidad relacion de la base de datos y complete a pedido de compañeros la base de datos\r\n\r\n','2022-06-22'),(4434,225,'Bitácora 22/6','Se vuelve épicamente a las bitácoras.\r\nEn este periodo se terminó con el casco Francés y el Vikingo. A su vez, comencé con el casco egipcio','2022-06-22'),(4435,220,'23-06','El dia que acontece decidimos no reiniciar el projecto para no perder todo lo realizado en las semanas anteriores , se decidio sacar a delio del grupo ya que no se veia progreso en el proyecto se hicieron los respectivos diagramas , el trello , actualizamos el diagrama de gants y se realizo una dialy para repartir tareas que debemos realizar.','2022-06-23'),(4436,208,'Organizacion General','El propósito de esta clase fue el de organizar las tareas que hicimos hasta hoy, para lograr esto simultáneamente actualizamos el diagrama de gantt, gitlab y nuestro trello. En la daily se me otorgo la tarea de actualizar el diagrama de gantt y le agregue cada tarea que hicimos hasta la actualidad; Se partió ingresando las 3 grandes cosas que estamos haciendo Vistas, Código y Base de Datos, el resto de tareas agregadas nacen de estos tres grandes centros','2022-06-23'),(4437,217,'Preparacion para entrega Final','El dia de hoy tuve inconvenientes con mis compañeros que no querian venir a practicas profesionalizates ya que decian que se sentian cansados por ed fisica o por las solas cuestiones de no querer venir pero eso no me detuvo ni a mi compañero soler, una vez en el aula el profesor nos explico como sera la entrega de la carpeta de campo y los otros archivos para la presentación el dia 30, hoy lo unico que estuve haciendo fue completar las cosas que me faltaron por ej el gantt, git lab, trello entre otras cosas y la carpeta de campo esta a punto de ser entregada.','2022-06-23'),(4438,211,'actualizacion del diagrama de gantt','en el día de hoy nos pusimos a conversar y decidimos que tareas nos quedaban pendientes y actualizar otras y no las repartimos entre los participante del grupo, por mi parte tuve que agregar nuevas cosas al diagrama de gantt como los predecesores de las tareas y configurarle bien las fechas, y después nos llamaron y nos hablaron sobre como iban a ser las notas de la materia.','2022-06-23'),(4439,216,'Trello - Proyecto N° 1 #18','Realicé el Trello del proyecto, agregué las columnas de &quot;Lista de tareas&quot;, &quot;En proceso&quot;, &quot;Testing&quot; y &quot;Finalizados&quot;,  agregué las tareas que estuvimos realizando a lo largo del proyecto y las coloqué en las columnas correspondientes.','2022-06-23'),(4440,221,'23/06','El dia de hoy, como estamos ya a fines de mes tenemos que terminar  varias cosas, como actualizar el diagrama de Gantt que ya tenemos, subir los archivos al Github y terminar el trello. Hoy también tuvimos una reunión con los profes donde nos explicaron y aconsejaron sobre coordinación que tenemos que utilizar durante las horas de clase.','2022-06-23'),(4441,210,'bitacora 25','estuve con mis compañeros haciendo la daylist con el profesor olaso, luego nos pusimos hacer distintas tareas, mi compañero Sosa lucas estaba haciendo el Gantt, mi compañero Soler estaba haciendo y mi compañero Tolosa que aparecio de la nada le dije que haga el calendario que habia quedado pendiente ya que era complicado. y yo estuve armando toda la pagina con las piezas que estuvimos trabajando todo este tiempo en las distintas vistas de todo esto para luego subirlo a github','2022-06-23'),(4442,213,'PHP','El dia de hoy en este momento me situo en un estado de estudio en referencia lenguaje de programacion llamado php debido a que requerimos de este lenguaje de programacion para entablar una relacion con la base de datos y mover archivos y pedir datos entre la vista admin y la base de datos con esto en mente estoy en busqueda y reconomiento de videos en relacion al aprendizaje de este lenguaje \r\n\r\nGracias a esto hoy descubri una funcion en php que me servira de aqui hasta que termine la pagina de admin esta es llamada header() con esta funcion nos trasladamos a la pagina referida. ','2022-06-23'),(4443,212,'','','2022-06-23'),(4444,209,'23-06-22 Replanteo de Login, Errores generales bdd','-Rediseñamos el login y la vista del register\r\n-El register es funcional y realiza el insert con md5()\r\n-Actualizamos el Gantt\r\n-Actualizamos el Trello(Kanban)\r\n-La version anterior del proyecto tenia muchos problemas con la base de datos, corregimos la gran mayoria hoy','2022-06-23'),(4445,243,'23-06-22','Tuvimos la charla con los docentes en el tema del proyecto, completando lo que seria la carpeta de campo y nos reunimos con el grupo y charlamos sobre el tema','2022-06-23'),(4446,222,'organizacion y avance en css','hoy hicimos una reunion para delegarnos las tareas, yo me encargue de hacer un login y un register con php html y css nuevos para mejorar la apariencia de la pagina, avanzamos con el gantt y arreglamos un par de cosas que daban error con la base de datos','2022-06-23'),(4447,214,'Arreglo vista tratamientos','hoy empezamos la clase reuniéndonos unos 15 min para organizarnos sobre las tareas que haríamos y que nos faltaban terminar decidiendo que haría una modificación en la vista de tratamientos donde necesitaba un cambio de color en la navbar y actualizar el footer para que quede como las demás vistas luego de terminar la vista tratamientos empece a investigar sobre hacer una agenda web para tener todas las citas','2022-06-23'),(4448,219,'Progreso proyecto Stone','Apenas comenzamos la clase, decidimos ir a por todo con respecto al proyecto, decidimos no reiniciar el proyecto y avanzar todo lo posible con lo que ya teníamos armado (La Plantilla de la tienda).\r\nComencé arreglando algunas cosas visuales con respecto al inicio y al login del programa, modifique el título y el subtítulo del programa, además del título y quitar el antiguo carrito de compras. Seguido de esto comencé a con el registro de usuarios que había quedado un poco incompleto, separe este en 2: ADMINISTRADORES Y CAJEROS.\r\nLa idea de dividirlos en dos (Administrador y Cajero) es para que los gerentes tengan acceso a editar y controlar absolutamente todo, mientras que los cajeros o aquellos empleados con este rango inferior solo puedan controlar y observar, no modificar.','2022-06-23'),(4449,242,'23-06-22','el día de hoy fue poco movido, ya que no teniamos como guiarnos pero al final hoy el profesor nos dió una buena guia de lo que haremos diaramente como para facilitarnos tanto a nosotros en el trabajo al igual que en la carpeta de campo21}}\r\n','2022-06-23'),(4450,221,'24/06','El día de hoy estuve realizando el tutorial de mi correspondiente lenguaje, ósea C++. Estuve viendo un video a medida que lo explicaba con mis propias palabras los pasos a seguir mientras ponía capturas del problema. \r\nUtilicé Visual estudio Code y tuve un problema ya que no se usarlo muy bien y tuve que instalarle sus extensiones para C++. Y no sé porque el problema no me tira el resultado y me tira error. Luego lo probare en mi casa utilizando el Dev C++ que es el programa predilecto de C++. De momento llevo explicación de cómo usar C++ y como hacer el típico “Hola Mundo”.\r\n','2022-06-24'),(4451,220,'24-06 ','el dia de hoy me la pase repasando el codigo 