ón de ProgramaFácil y el contenido que contiene esta página. Al final del día, tuvimos que entregar la carpeta de campo con las 100 páginas hechas.','2022-06-29'),(4466,231,'clase 29','el día d hoy es miércoles y la clase del martes se paso por alto debido a que era feriado, hoy estuvimos presentando la venta y progreso del proyecto de cada grupo y como va el desarrollo de su proyecto, a todo esto nosotros fuimos los últimos en exponer pero fue bastante bien hasta que la computadora se frizo y tuvimos que reiniciar la computadora','2022-06-29'),(4467,226,'Clase 29','Tuvimos la presentación del proyecto','2022-06-29'),(4468,234,'Clase N°29','En la clase de hoy expusimos frente al curso el proyecto, explicamos las características del mismo y sus funcionalidades.','2022-06-29'),(4469,241,'Bitacora Clase N°28 - Tomás Ortellado 6°1° C','El día de hoy los distintos grupos de proyecto estuvimos expusimos sobre nuestro proyectos, lo que hemos logrado, para donde apunta, etc.\r\n\r\nTambién realizamos la entrega de la carpeta de campo, con la meta de llegar a 100 páginas a la fecha de hoy.','2022-06-29'),(4470,240,'Clase 27','Presentación de proyectos','2022-06-29'),(4471,239,'Dia 27','El dia de hoy termine la base de la pagina llegue a 91 paginas en la carpeta de campo y tuvimos la presentación del producto (la pagina web)','2022-06-29'),(4472,227,'Exposición de proyectos','El dia de hoy expusimos cada grupo su proyecto. Nos pusimos de acuerdo en qué iba a decir cada uno y realizamos nuestra exposición comentando las bases del proyecto, el progreso y la situación actual, entre otros.','2022-06-29'),(4473,230,'29/06/2022','Hoy tuvimos que hacer una presentación sobre nuestro proyecto, nuestros avances en el mismo y tratar de venderlo. También observamos las presentaciones de otros grupos y realizamos preguntas, tal como nos preguntaron a nuestro grupo. ','2022-06-29'),(4474,236,'clase 29 (29/06/22)','En la clase del día de la fecha dimos una presentación del proyecto, en la 