 carpeta','El dia de hoy lo unico que se pudo continuar fue la carpeta de campo ya que por temas de descansar y continuar escribiendo prefiero no quedarme atras en es aspecto pero sigo viendo y buscando diferentes soluciones a las pcs que todavia estan bloqueadas ya queda poco para desbloquearlas todas y despues seguira la continuacion del proyecto que sera trabajar con los SO','2022-07-01'),(4491,220,'01/07','el dia de hoy me propuso el prof consorti de hacer funcionar una impresora 3d que se le habia hecho de deshuso debido a que se despegaban de la plaqueta y no estaba bien calibrada','2022-07-01'),(4492,247,'Funciones Básicas de JavaScript (5/7)','El día de hoy desarrolle lo que serían los comentarios, las estructuras de control, los bucles e iteraciones, la identación de código y las bases para elegir nombres en JavaScript.','2022-07-05'),(4493,246,'05-07.2022','en el día de la fecha realizamos unas modificaciones en el diseño de la pagina en el modo admin y me dedique a completar la carpeta de campo. también junto al maestro hicimos que sea aprueba de inyecciones SQL.','2022-07-05'),(4494,228,'Clase 30','Mejore la seguridad del login para evitar inyecciones sql','2022-07-05'),(4495,234,'Clase N°30','En la clase de hoy ya terminé el escudo de los romanos, con sus bordes ya remarcados. Una vez finalizados, subí los archivos png y psd del escudo al repositorio que tenemos con mi equipo en git hub.','2022-07-05'),(4496,238,'Clase 30 05/07/2022','Modificamos el código del login de forma de que ya no sea posible ingresar realizando una inyección SQL.\r\nModificamos la estética del Modo Admin.\r\n','2022-07-05'),(4497,231,'clase 30','la clase de hoy fue martes y adivinen que .... al parecer cambiaremos de proyecto y al parece sera un juego de terror aun no estoy enterado de que se tratara pero creo q empezare a diseñar de nuevo, nose si estar alegre o ponerme furioso pero sera más contenido para la carpeta de campo y tendremos que empezar de cero','2022-07-05'),(4498,232,'	CLASE 29 - 05/07/2022','Hoy me encargue de hacer el login de usuarios a la base de datos en localhost, esto lo hice a partir de un if(isset) en un archivo PHP que se pueda conectar con el elemento HTML que hace referencia, despues hice la sentencia SQL para que lo integre.','2022-07-05'),(4499,227,'Values territorios','El dia de hoy logré obtener los datos de la base de datos corrrspondientes a los values de los territorios (nombre de jugador por territorio) y asignarlos a los territorios html para q se le de un color a cada territorio de forma automática dependiendo del dueño del mismo.','2022-07-05'),(4500,249,'Clase 18','Empecé a rediseñar las tarjetas del index','2022-07-05'),(4501,230,'05/07/2022','Hoy investigué sobre los compiladores y como llevarlos a cabo, además de un editor de texto en linea, así poder dar ejemplos en las páginas tutoriales del proyecto. ','2022-07-05'),(4502,233,'5/7/22','El día de hoy continué con la investigación de  python','2022-07-05'),(4503,241,'Bitacora Clase N°29 - Tomás Ortellado 6°1° C	','Continue con el estandarte japones, solo que por un tema de darle un major detalle, lo tuve que hacer más grandes respetando las proporciones.\r\n\r\nEsto es algo que luego debería pasar a la carpeta de campo, o al menos eso espero...','2022-07-05'),(4504,237,'Clase 30','El dia de hoy nos pusimos a hablar respecto al futuro del proyecto y si merece la pena seguir continuándolo o en cambio comenzar uno desde 0','2022-07-05'),(4505,229,'05-07-2022','Entramos en una discusión donde hablamos de forma seria el cambio del proyecto por uno distinto, siendo este un juego de aventura 2D o 3D(En discusión) al no poder seguir avanzando con el proyecto que estábamos armando con anterioridad','2022-07-05'),(4506,240,'Clase 28','Continue con el re diseño','2022-07-05'),(4507,245,'5-7-2022','el día de hoy discutimos en nuestro equipo por un cambio de proyecto, ya que no avanzaba en gran medida el super buscador\r\n','2022-07-05'),(4508,226,'Clase 30',