,'2022-07-07'),(4529,242,'7-7-22','Hoy si fue bastante productivo como hacer el inicio del toturial y escribir lo suficiente en la carpeta de campo','2022-07-07'),(4530,242,'8-7-22','Se hizo todo lo que pudo lo que el día de ayer no había logrado hacer, aun así logre terminar con el primer cuadro de explicación básica de mi lenguaje.\r\n','2022-07-08'),(4531,221,'08/07','El dia de hoy no hice mucho debia al tiempo y a la falta del grupo. Solo pude prosegir un poco con el tutorial de C++. Con este serian 3 videos ya. El objetivo seria llegar a los 10 junto con 2 videos. Mientras uno o dos de los integrantes continuaron con la pagina base. Lo bueno es que ya podremos ir mas rapido.','2022-07-08'),(4532,243,'08-07-22','Hoy estuve repasando un poco de lo que seria el lenguaje PHP y completando la carpeta de campo ','2022-07-08'),(4533,208,'ABM - Modificar dentro de la vista pacientes','En la daily de este día decidimos las tareas correspondientes , a mi me toco hacer la modificación del ABM, dentro de la vista pacientes; La clase pasada ya logramos terminar con la Baja y mi compañero soler ya se encargo de la Alta, al terminar la Modificación el ABM ya estaría completo.\r\nEl plan para realizar el update es, un botón que desprenda un modal cuyo modal se le rellene un formulario y estos datos se iban para otra vista que los tomaba y actualizaba el registro en cuestión.','2022-07-08'),(4534,217,'buscando informacion','por lo que pude buscar y leer de algunos lugares, encontre para 1) crear mi propio logo.bin el cual quiero para no tener que usar los.bin de otras personas y asi tambie poder dejar un legado de lo que hice en este colegio 2)estuve completando la carpeta de campo con un poco de informacion de linux para que se sepa cuales son sus ventajas y desventajas con respecto de windows en las que encontre varias razones por las cuales agregar mas seguridad. ','2022-07-08'),(4535,211,'expusimos','bueno en el dia de hoy tuvimos que exponer como va nuestra pagina, que tenemos que agregar y que tenemos que mejorar o cambiar, ademas tambien seguimos con el desarrollo de las sessions en php.','2022-07-08'),(4536,209,'07-08/07/22 Session','-Empezamos y seguimos remodelando esteticamente la vista principal\r\n-Seguimos el desarrollo de las session\r\n-Al estar trabados en este ultimo item, nos dedicamos mas a investigar\r\n-Seguimos corrigiendo detalles de la base de datos','2022-07-08'),(4537,216,'07/07/2022 y 08/07/2022 - CSS, Exposición del proyecto','Estos dos días estuve organizando un poco el código de la Vista Principal para trabajar en el CSS del mismo; ya tengo definidos varios cambios estéticos que quiero implementar. Finalmente expusimos un poco del estado actual de nuestro proyecto con el curso.','2022-07-08'),(4538,210,'bitacora 29','luego de hacer la daylist mis compañeros me comentaron que la clase pasada crearon las Altas de las tablas de pacientes y dentistas luego comenzaron hacer las bajas de pacientes y mi compañero tolosa avanzo con el calendario luego de esto asigne tareas a cada uno y estuve ayudando a mi compañero sosa ya que el tenia unos problemas con los styles de los botones, y los modales ','2022-07-08'),(4539,214,'Vista Contacto-agenda','Continúe con la investigación sobre como mandar un mail y al final se necesita un hosting lo deje ahí y continúe con la vista agenda añadiendo un navbar para conectar las demás vistas con esta y poniéndole un fondo acorde ','2022-07-08'),(4540,213,'Recapitulando ','Debido a mi ausencia en el día anterior debi de ponerme al dia con los hecho en la pagina \r\nTras el daily que se realizo pude darme una idea de la posición en la que estamos con respeto al proyecto sabiendo por ejemplo que ayer se realizo la baja de la pagina de admin y hoy se empezo con el modificar de la misma','2022-07-08'),(4541,245,'12/7/2022','El dia de la fechas nos organizamos y avanzamos con el carrito y la sección de perfil','2022-07-12'),(4542,249,'Clase 20','Edite la tabla de tareas en github y empec