ista de las especialidades.','2022-07-12'),(4553,241,'Bitacora Clase N°31 - Tomás Ortellado 6°1° C','Seguí editando los kanjis del banner.\r\n\r\nMe deshice de los bordes blancos de los kanjis de fuerza y virtud, además de remarcarlos.','2022-07-12'),(4554,238,'Clase 32 12/07/2022','Creamos una nueva rama en GitHub, subimos todos los archivos de la página ahí, y aprendí a vincularlo con Visual Studio de forma que ya no sea necesario guardar los cambios manualmente en Drive.','2022-07-12'),(4555,226,'Clase 32','Realice una seccion para cmabiar la contraseña en la vista de seguridad','2022-07-12'),(4556,240,'Clase 30','seguí trabajando en el re diseño','2022-07-12'),(4557,227,'Clase 12/07','Trabajo en el svg acomodando territorios','2022-07-12'),(4558,229,'12-07-2022','En el día de hoy, di inicio a los retoques de las vistas de perfil','2022-07-12'),(4559,237,'Clase 32','El dia de hoy añadi una descripcion especifica para los productos de mercado libre y tengo que terminarlo el de Ebay','2022-07-13'),(4560,247,'Adaptación del Guión a la Página (13/7)','El día de hoy, me dedique a refinar los últimos toques al guión de la primera parte y, posteriormente, procedí a adaptarlo a lenguaje HTML para que así aparezca en la página.','2022-07-13'),(4561,249,'Clase 21','Seguí haciendo el slider','2022-07-13'),(4562,231,'clase 33','el dia de hoy falto tobias y ahora tengo algo nuevoo para hacer, DAriel me pidio que si podia cambiar la paleta de colores que tenia el carrito de la pagina y decidi cambia un par de cosas y agregar un par de cosas y ademas empeze a hacer un boceto sobre un nuevo logo','2022-07-13'),(4563,228,'Clase 33','Comence a estudiar sobre ciberseguridad para poder evitar futuras vulnerabilidades y arreglar las actuales ','2022-07-13'),(4564,230,'13/07','Hoy estuve buscando teoría y escribiendo más de los contenidos que irán en la página. También, con el profesor, se intentó hacer una inyección SQL al Login, lo cuál no se pudo hacer. Después estuve investigando sobre PHP para poder hacer un sistema de sesiones, tanto el entrar con una cuenta como el cerrar la sesión ','2022-07-13'),(4565,227,'Colores y modal de resultados','El dia de hoy logré obtener los colores de los usuarios de la base de datos y colocarlos en las distintas partes de la pagina (tabla de usuarios, turno del usuario, mensajes/avisos). Además, creé un modal para mostrar los resultados de la partida una vez pasadas las 3 rondas de juego, vinculando los datos de la misma con los de la base de datos.\r\n\r\nRecordatorio: terminar de realizar las funciones para insertar registros (ejemplo: insertar registro cuando un usuario conquista un territorio)','2022-07-13'),(4566,229,'13-07-2022','En la clase de hoy, me encargue de crear unas plantillas para la sección de Usuario','2022-07-13'),(4567,234,'Clase N°33','En la clase de hoy pinté el fondo del escudo francés y volví a remarcar los bordes debido a que el color de fondo se superpuso por sobre el color de los bordes.','2022-07-13'),(4568,239,'Dia 30','Re hice el login y en register .php para agregarle una animación al mismo.\r\nContinúe con el css de la vista de la cuenta y la edición del usuario','2022-07-13'),(4569,236,'clase 33 (13/07/22)','En la clase del día de hoy empece el re diseño de la sección de preguntas y respuestas y estuve ayudando en la realización del boceto para el nuevo diseño','2022-07-13'),(4570,226,'Clase 33','Ayudé con el rediseño del perfil y a pensar en el boceto del foro de las especialidades','2022-07-13'),(4571,240,'Clase 31','Boceto de especialidades','2022-07-13'),(4572,241,'Bitacora Clase N°32 - Tomás Ortellado 6°1° C','Casi termino con los kanjis del estandarte Japones, en la clase que viene debería poder terminar con ellos, especialmente teniendo en cuenta que la clase que viene es de las largas.','2022-07-13'),(4573,210,'Bitacora 30','Estuve creando vistas de ediatar para usar en las paginas de pacientes y de dentistas para cuando en las tablas sea llamado el boton de Editar este direccione a cada vista de editar Pacientes o Dentistas. luego estuve corrigiendo botones de la tabla de pacientes y tratamientos en el codigo de mi compañero Sosa y estuvimos en una charla de Liderazgo de un ex alummno del colegio','2022-07-14'),(4574,242,'14-07-22',' Hoy hice lo que pude, haciendo una lista de los ejercicios e incluso la carpeta de campo, no avanzando demasiado pero haciendo el promedio \r\n\r\n\r\n :/','2022-07-14'),(4575,213,'Login De admin','El dia de hoy tras la realizacion del daily se me dio a la tarea de terminar con la vista de login para los admins en consecuncia a esto me impuse a terminar dicha vista . Para la terminacion de la vista debi de aprender a realizar un session en php conforme a lo que tenemos en la base de datos a la cual modifique para que tuviera una tabla mas dedicada a los datos de los admins debido a que dentro del codigo de php se requiere esto ','2022-07-14'),(4576,221,'14/07','El dia de hoy estuve corrigiendo que un del grupo habia cambiado para su propio gusto. Usamos parte de un ABM que hicimos anteriormente para el login y register del programa. Y todavia estamos viendo como hacer las vistas de los ejercisios y como hacer la base de datos.','2022-07-14'),(4577,208,'ABM - Modificacion y Baja  - Completados al 100%','En el daily de hoy debatimos las ideas que íbamos a tratar me toco terminar con los botones que pertenecían a la vista de doctores y paciente, el primer botón en cuestión fue el de eliminar (baja) que faltaba hacerlo en la vista de doctores/pacientes en esta clase se termino por completo y se le agrego el estilo correspondiente, por otra parte se termino el botón de modificar. El modificar tuvo el siguiente esquema:\r\nVista (Boton modificar) -&gt; Formulario (Se rellenan datos) -&gt; (Se toman los datos) Realiza Update -&gt; Vista\r\nEste esquema formo parte del modificar de pacientes y doctores','2022-07-14'),(4578,214,'Agenda','En la vista sobre la agenda le agregue el navbar predefinido para las vistas de admin y luego modifique la pagina para que sean todos los elementos visibles, busque informacion sobre como añadir un boton para editar la cita ya cargada y tambien un boton para eliminar la misma','2022-07-14'),(4579,219,'Apoyo equipo de gantus','Hoy toco ayudar al equipo de Gantus debido a que Matias Delio, falto y me pidieron ayuda. Hicimos el login y que se pueda mantener la sesión iniciada, ordenamos las tareas con los integrantes del grupo, etc. Ademas de esto ayude al equipo Rojas con el login de administrador.','2022-07-14'),(4580,217,'se aplicaron ideas','El dia de hoy estuve aplicando la idea de poder cambiar el logo de inicio de windows y gracias a eso ahora se ve un poco  mas formal, tambien estuve completando la carpeta de campo cosa que agregue unas 2 paginas mas y asi completar para llegar a las 50, algo mas para agregar estuve verificando unos discos duros que encotre en mi vieja PC y asi comprobar que contenian','2022-07-14'),(4581,221,'15/07','El día de hoy estuve corrigiendo el login y register de la página haciéndolos la primera vista de la página.\r\nCosa de que el usuario no pueda acceder a la página sin antes crearse un perfil. Esto nos solucionaba el problema de hacer que el usuario no pueda hacer los ejercicios sin un perfil y no tener que dividir la explicación de los ejercicios o que no se registre el progreso. Por eso esto es más fácil de implementar así nos aseguramos que tengan un perfil si o sí.\r\n','2022-07-15'),(4582,223,'Completar la carpeta de campo y charla con mis compañeros','El día de hoy me enfoque en completar la carpeta de campo ya que tenia muchas anotaciones que no termine y debía de completar para generar mas paginas de la carpeta, también hable con mis compañeros sobre el proyectos ya que teníamos unas dificultades con la pagina debido a que ellos querían utilizar la suya pero estaba muy des prolija para mi gusto y por lo tanto yo quería utilizar la mía.','2022-07-15'),(4583,217,'completando tareas','el dia d