 presentacion a partir de una empresa la cual se llama &quot;Schub&quot;, la cual se encarga de dar un respaldo y ayudar a empresas terceras con programas y/o herramientas que necesiten. Esta charla fue encabezada por sus tres fundadores, Luis Vinay, Gaston Valdés y Eduardo Mora. La charla tomó dos horas exactas y en ella nos explicaron tanto metodologias de sus trabajos, experiencias y que tipo de perfiles laborales estaban buscando en nuestro curso en especial.','2022-08-10'),(4646,236,'Clase 36 (10/08/22)','En la clase del dia de hoy seguí ayudando a mi compañero Ivan con las vistas del perfil y revisando los bocetos de las misma, luego tuvimos una charla con la empresa Schub acerca de las pasantias','2022-08-10'),(4647,208,'Search e Instant Search','Me reevi el ejemplo del boton del search, me llegaron un monton de problemas, pude realizar la consulta con varios OR y LIKE, la consulta en si no es el problema pero no estoy pudiendo filtrar el select con la busqueda en cuestion. En mi busqueda de la solucion encontre un nuevo ejemplo de como realizarlo, asi recorri 4 videos desde 2009 hasta 2022. Llegue a la decision de hacer un Instant Search con ajax y JsQuery, los proximos pasos van a hacer realizando el instant search','2022-08-11'),(4648,213,'Audits y Login ','El día de hoy  empece con el intento de realizar el login el cual después de que el profe nos mostrara las Audits de la pagina termine volcando mi trabajo del dia a realizar que estas audits tengan el numero mas alto por que esto sera requerido para aprobar la materia tras esto me puse en camino a buscar lo requerido en cada uno de los puntos por suerte la Audits medio que te dicen que esta mal y en base a eso me guié para la mejora de la app  ','2022-08-11'),(4649,242,'11-8-22','Se pudo hacer un poco bastante de mi tutorial, como pequeños temas pero que los considero importante al tomarlas como referencias con tareas previas','2022-08-11'),(4650,221,'11/08','El día de hoy estuve buscando como realizar los ejercicios de la página. Ya que se nos dificultaba por el hecho de que ninguno de nosotros sabía cómo hacer para que almacenaran el progreso.\r\nTerminamos optando luego de consultarle al profe que usaríamos quiz de hitgub para poder hacer un formulario. Pero luego se nos ocurrió mejor el usar un google form.\r\nCon ese se nos facilitaba mucho el hacer el formulario donde irían los ejercicios prácticos.\r\nTambién cambiamos el cómo serían los ejercicios. Ahora en vez de ser una serie de ejercicios prácticos con un video extra al final. Termino siendo in video central de tutorial y un formulario de google con 10 ejercicios teóricos y luego implementaremos 5 ejercicios prácticos sencillos los cuales contaran para el progreso del usuario pero no tendrán una barra de progreso.\r\n','2022-08-11'),(4651,219,'Proyecto Stone - Avances con la aplicacion','Por fin despues de tanto tiempo ya tenemos avances con la aplicacion del proyecto Stone, Domini encontró una pagina la cual nos va a permitir desarrollar la aplicacion con la misma flexibilidad y con aun mas facilidad que Kotlin (Que porcierto ya nos estaba poniendo demasiado nerviosos, debido a que su lenguaj, aunque parecido a Java funcionaba de manera distinta y se nos era demasiado complejo. Ademas que el emulador no funcionaba correctamente). Tambien conseguimos avances con la pagina como por ejemplo el añadir los iconos y opciones restantes al menu de admin y tambien comenzamos a investigar el como migrar la base de datos a Firebase, la cual nos va a ayudar para integrarla tambien a la aplicacion Android.','2022-08-11'),(4652,220,'11/8','El dia de hoy avanze un monton con la aplicacion android usando varios programas como flutter y figma el cual pre generar plantillas que puedo usar para modificarlo a mi gusto y realizar mi trabajo mas rapido . lo cual nos ahorrara tiempo para finalizar el proyecto y usarlo en nuevos ','2022-08-11'),(4653,210,'bitacora 33','Hoy estuve haciendo la nueva daylist ya que una compañera se integro en nuestro grupo asi que le asigne la tarea de poner animaciones con un front de JS, mis compañeros Sosas, Soler y Tolosa siguen con los trabajos anteriores mientras que yo me dedique a rehacer un nuevo @Media de CSS para la parte del latinpage','2022-08-11'),(4654,223,'Perdida de la pagina e continuación de la otra','El día de hoy los planes eran iniciar con las vistas de los tutoriales de la página, para mi desgracia a la hora de descargar las carpetas de la página me di cuenta que todo el progreso que hice la clase anterior se había perdido, desconozco la razón de tal echo desafortunado. Tras eso me puse a trabajar en la pagina de mis compañeros y avance respecto a ella ','2022-08-11'),(4655,214,'Edicion Agenda','estuve viendo en la pagina de full calendar maneras de editar los colores botones etc del calendario, luego en la vista de la agenda me puse a editar el form en el que se añaden las citas para que sea un modal flotante y salga cuando se clickea un dia en el calendario, prepare el modal pero no pude hacerlo funcionar cuando se clickea el dia','2022-08-11'),(4656,217,'un nuevo pedido y revisiones','el dia de hoy estuve reorganizando y continuando el proceso de verificacion de los discos duros ademas de eso vino un profesor que anteriormente ya me habia pedido que le haga la reparacion de otras PCs suyas con respecto a eso tambien tenia otros defectos como el boton de inicio cosa que se tuvo que reemplazar y y probar tambien el correspondiente desbloqueo','2022-08-11'),(4657,216,'04/08, 05/08 y 11/08 - Nuevo grupo y proyecto &quot;Rojas&quot;, animaciones JS/CSS con framework AOS','Durante la semana pasada no estuve realizando tareas con respecto al proyecto en el que estaba trabajando con mi grupo inicial, debido a que no sabiamos si uno de nuestros integrantes iba a continuar con nosotros y esto generó varias dudas con respecto a la composicion del grupo, barajandose la posibilidad de que se me asigne otro grupo. Hoy, decidí unirme a otro grupo con compañeros distintos a los cuales venia trabajando, estos tenian ya su proyecto (Dental Rojas) ya avanzado por lo cual debieron ponerme al dia, hacerme parte de las carpetas compartidas, el Trello, etc. Este proyecto, el proyecto Rojas es una pagina web para una clinica dental, tiene varias vistas que hablan sobre los trabajos odontologicos que realiza el lugar, los especialistas a cargo, tiene un gestor de turnos, entre muchas otras funciones. Se me asignó la tarea de poner animaciones dentro de todas estas vistas (cards, textos, botones, imagenes, etc.) con el framework AOS.','2022-08-11'),(4658,242,'12-8','No hubo una mejor producción por hoy, lo que pude hacer al final de este día fue mayormente pensar en que hacer como el tutorial que estaba siguiendo de forma lenta','2022-08-12'),(4659,210,'bitacora 34','Hoy no hice nada mas que estar viendo dond es el error del footer el cual era un grupo de Div cols que estaban unidos y hacian que tengan cualquier tamaño y haga que este mismo se rompiese a determinada medida luego de encontrarlo cree el CSS llamado Responsive.css para que este pueda hacer que el footer y otras cosas mas cumplan la funcion de responsive agregando el @media este trabajo del footer y hacer que los contenidos sean responsive lo hare con Mariel para que me ayude haciendo el footer y yo corrigiendo otros errores mas de la pagina web','2022-08-12'),(4660,208,'Search (Codigo no implementado)','Use la clase para recaudar informacion sobre el boton de search e hice el codigo para que funcione, ayer el profe me dijo que todo tenia que ser realizado en la misma vista cosa que hice. Por culpa de lo lenta que andaban las computadoras no pude usar VisualStudioCode. Use el Notepad++ e ahi hice el codigo pero todavia no esta implementado en la vista','2022-08-12'),(4661,214,'Vista agenda','hoy estuve probando combinaciones de colores para el fondo de la pagina manteniendo el degradado de colores de las vistas principales intentando que el degradado emp