a de dentistas','2022-08-18'),(4704,221,'18/08','El día de hoy estuve con un compañero resolviendo el cómo hacer la respectiva vista del lenguaje C++.\r\nNos costó bastante a pesar de no haber terminado por el tema de que el fondo se nos complicaba para ajustarlo a lo que buscábamos. Primero tuvimos la idea de un fondo de color blanco pero quedaba muy vacío todo y lo cancelamos. \r\nLuego quisimos poner una imagen y nos costó buscar una imagen de programación con buena resolución y luego ponerla como fondo sin que se agrande o se repita.\r\nComo esta idea se acercaba más pero todavía quedaba vacío debido a que el contenido de la página parecía flotar por encima del fondo y no era un efecto muy agradable a la vista.\r\n','2022-08-18'),(4705,220,'18/08/2022','En el dia de la fecha terminamos las vistas principales de la aplicacion android, solo toca integrar la base de datos de firebase con flutter. Sinceramente el proceso es bastante complejo, xq pide una cantidad de paso los cuales hay que hacer antes de crear el proyecto.','2022-08-18'),(4706,213,'Debuggin','El dia de hoy me dispuse a subir las estadistas de cada una de las vistas correspientes al apartado de landing page de nuestro proyecto , las estadisticas a subir se muestren en el apartado de analitycs o lighthouse este muestre que tan &quot;normalizada&quot; esta una pagina web es decir una auditoria ','2022-08-18'),(4707,214,'Agenda-CV Actualizado','En la base de datos agregue una tabla para ingresar los nombres en forma de prueba en la tabla para los odontologías haciendo que funciones los botones de editar y borrar, actualice el cv añadiendo el nivel de ingles que obtuve del test de ingles','2022-08-18'),(4708,217,'Se intentaron procesos','El dia de hoy quiero implementar lo que hice la clase pasada con el programador pero resulto que a la hora de programar el mismo chip no lo reconocia bien y al momento de borrar los datos tampoco los borraba bien por lo que pienso que las netbook conectar igualdad de marca EDUNEC no pueden ser reparadas a menos que encuentre otra forma de desbloquearlas que no sean por el programador y además quiero creer que por el hecho de que no prendan solo se deba a que esta mal programado el chip y que no se daño algún componente o alguna otra cosa','2022-08-18'),(4709,216,'Responsive footer, grid (col)','Me asignaron la tarea de solucionar unos problemas que tenía el footer en cuanto a lo responsive; en cierto tamaño de pantalla se superponía el logo del footer sobre el texto que lo acompañaba, logré solucionarlo con los atributos col del display grid; debo seguir revisando la distribución de los elementos dentro del footer ya que en pantallas más pequeñas se desordena todo lo que contiene.','2022-08-18'),(4710,223,'Soluciones a nuestros problemas y continuación de la pagina','El día de hoy tenía planeado continuar con la pagina y ponerle fin a la parte de la vista de clases, eso fue lo que hice hoy, también junto con mi compañero propusimos ideas para el problema vigente de los formularios y las corroboramos junto con los profesores dándonos sus puntos de vista y soluciones para nuestros problemas ','2022-08-18'),(4711,221,'19/08','El día de hoy estuvimos viendo cómo hacer con el tema de los cuestionarios debido a que los formularios de google no podían conectarse con la base de datos y eso nos cobró bastante caro ya que todo lo que hicimos sobre los cuestionarios el cómo hacerlos y como ubicarlos fue al pedo.\r\nPor lo que estuvimos buscando el cómo hacer un cuestionario nosotros mismos y terminamos encontrando un video que nos mostraba todo lo que necesitábamos y hasta más de lo que queríamos.\r\n','2022-08-19'),(4712,217,'No se pudo continuar + nuevo proyecto','estoy buscando información sobre como desbloquear aquellas PCs espero que sea posible en cualquier caso ya que de otro modo solo hay una manera de desbloquearla y esa sería el tener que desoldar uno o mas componentes de la placa madre, cosa que derivaría a provocar un pequeño corto en el chip de bloqueo y eso permitiría que se desbloqueara el problema es que es un procedimiento mucho mas complejo en el que se sueldan y desueldan componentes para esto requiere una estación de soldadura cosa que no es muy sencillo de encontrar porque requiere varias herramientas de diversos usos por ej un soldador, para agregar un compañero me trajo para revisar una PC cosa que voy a hacer el procimo martes por temas de no contar con las herramientas.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n','2022-08-19'),(4713,209,'19-08-22 Vista de perfil empresa','-Ligeras correcciones en la vista de perfil de estudiante\r\n-Diseño de vista perfil de empresa\r\n-Inicio de backend de Login','2022-08-19'),(4714,216,'Responsive footer, unión de vistas','Continué trabajando con los inconvenientes con respecto al footer de la página, una vez finalicé con el, uniremos todas las versiones de las vistas con las que cada uno de mis compañeros estuvieron trabajando para continuar.','2022-08-19'),(4715,223,'carpeta de campo y planificación sobre formularios y exámenes','El día de hoy tenía planeado planificar cómo continuar con el trabajo respecto a los formularios y la prueba final, aunque esos eran los planes me enfoque principalmente en continuar la carpeta de campo mientras que planeábamos que hacer con la ayuda de agustin fiasche','2022-08-19'),(4716,219,'19/08','En el dia de la fecha, estuve mas activo como consultor del equipo de Gantus, les ayude a conseguir un modelo de una pagina para poder registrar las evaluaciones que tiene que tomar su pagina, ahora deben eliminar las cosas que sobren de esa pagina y fusionarla con la pagina principal que tienen ellos. Ademas de eso Domini ya pudo conectar la base de datos de Firebase con FlutterFlow. Ahora ya podemos terminar la aplicacion android y comenzar o mejor dicho terminar con la programacion de la pagina web.','2022-08-19'),(4717,242,'19-8','El dia de hoy se baso en planear ideas y cosas que se podrian hacer en 