e mucha programación para los plugins y mods.','2022-09-08'),(4833,220,'08-09','el dia de hoy agregre unos parametros para el cura y agregre unas pestañas para la app','2022-09-08'),(4834,213,'PP + Subida de analiticas','EL dia se nos informo sobre una practica profecionalizante que se dara en el dia 14 de septiembre a lo cual debimos de realizar una autorizacion para una salida didactica tras realizar esto prosegi con la mejora de los numeros de la analiticas de la vistas hoy tocaba la de index en la cual logre subir los puntajes en una gran medida\r\n','2022-09-08'),(4835,223,'Ayuda a mi grupo y avance de la pagina','Hoy tenía el plan de continuar con la página terminando la vista de admin y avanzando en las demás vistas de la página, vistas tales como la vista de las clases, la vista principal, la cual necesita algunos diseños estéticos debido a que la vista actual no se ve para nada bien.\r\nTambien el día de hoy me encargue de trabajar con mi grupo ayudándolos a terminar con las tareas que le faltaban, en cosas como la barra de progreso, la creación de los formularios el avance de la pagina, etc.','2022-09-08'),(4836,217,'Completando la carpeta','El día de hoy pienso continuar con la carpeta de campo y al hablar  con Félix me ha dicho que no es ni necesario el tener que instalar Linux sino que con el tan solo formatear las PCs ya era suficiente, ahora pasare a hablar acerca de las inseguridades que tengo, las cuales serían lo que ocurrió ayer en el colegio con los 2 profesores lo que llevo a hacer un faltazo por que la profesora de desarrollo de software generalmente no viene y eso llevo a especular aque mis compañeros quieran hacer faltazo, sinceramente yo no soy de hacer eso porque en un principio odio las faltas y mis padres no están nada contentos con faltar asi que no tuve elección y tuve que seguirlos en ese aspecto, porque las consecuencias de quedarse eran que varios tenían viajes bastantes largos o se sentían mal por lo que querían irse y eso sería tod