limpiadas','2022-09-14'),(4856,227,'Desarrollo inicial olimpiadas','Comenzamos la planeación y primer desarrollo del proyecto propuesto para las olimpiadas. Hicimos con mi grupo la api y una primer base de datos.','2022-09-14'),(4857,240,'Clase 43','Realice los bocetos para el proyecto de las olimpiadas','2022-09-14'),(4858,232,'CLASE 39 A 40','Estos dias tuvimos un proyecto imprevisto sobre las &quot;Olimpiadas 2022&quot;, en ella se nos encargó hacer un programa tanto web como movil para personas con visibilidad reducida para que personas puedan hacer guias y tours por un museo de Capital Federal, se me fue designado el grupo de back-end de dispositivo movil junto Mendez Agustin y Ignacio Rios Lahore, hoy en el primer dia desarolle unos programas para verificar los registros','2022-09-14'),(4859,247,'Olimpiadas (14/9)','El día de hoy nos dieron todos los puntos para realizar un proyecto para las olimpiadas tecnológicas en las cuales participa mi escuela. Yo me dedique a hacer la parte de HTML, CSS Y Bootstrap junto a mis compañeros Iván Nahuel, Tristal y María Morales.','2022-09-14'),(4860,226,'Clase 43','Se organizó y se empezó a realizar el proyecto de las olimpiadas informáticas','2022-09-14'),(4861,229,'14-09-2022','Se avanzo con las olimpiadas','2022-09-14'),(4862,236,'clase 45 (14/09/22)','En la clase del día de hoy no hicimos nada de el proyecto, solo nos dedicamos a las tareas de las olimpiadas y cada uno tenia una tarea para hacer','2022-09-14'),(4863,237,'Clase 43','El dia de hoy añadi un archivo .php como ejemplo para poder ver los resultados de la compra, ademas de pedir ayuda en un foro de Api de ebay por el error 404 debido que el producto no se encuentra y no veo la manera de resolverlo','2022-09-14'),(4864,234,'Clase N°45','En la clase de hoy estuve realizando los diseños mobile del proyecto informático para las olimpiadas.','2022-09-14'),(4865,233,'14/9/22','El día de hoy, junto con el profesor comenzamos un proyecto sobre las olimpiadas tecnológicas, la cual nuestra escuela será la sede.\r\nEl objetivo es desarrollar una aplicación la cual permita a gente no vidente poder disfrutar de un recorrido en un museo; a mi grupo le toco desarrollar la parte visual de la página para dispositivos móviles.\r\n','2022-09-14'),(4866,230,'14/09','Hoy tuvimos una reunión donde conocimos a grandes rasgos el proyecto que deberemos llevar a cabo. Además continué con el curso de AWS. ','2022-09-14'),(4867,228,'Practica externa Día 2','Estudie el curso de AWS practitioner essentials. Tuve una reunión de 2hs en la que hablamos de que es el proyecto que vamos a realizar, vimos un diagrama del proyecto y finalizamos hablando de que tecnologías vamos a usar y porque. ','2022-09-14'),(4868,238,'Practica Externa 14/09/2022','Tuvimos una reunión en la que nos explicaron de qué iba a tratar el proyecto en el que íbamos a trabajar.\r\nContinúe estudiando del material que nos dieron.\r\n','2022-09-14'),(4869,228,'Practica externa Día 3','Continue estudiando el curso AWS cloud practitioner essentials y tengo una reunion en la que me van a ayudar a mejorar el perfil de linkedin\r\n','2022-09-15'),(4870,222,'olimpiadas','hoy hice 2 diagramas decaso de uso para las olimpiadas, uno de la parte web y otro de la parte mobil','2022-09-15'),(4871,242,'15-09-2022','Hoy hicimos  un poco de todo en lo referido al proyecto, sobre todo el formulario y el otro proyecto cual por mi parte hice una galeria\r\n','2022-09-15'),(4872,217,'Olimpiadas informaticas','El dia de hoy Se nos informó a todos los 6tos de unas olimpiadas de informáticos en la cual se nos informó que tenemos que hacer la creación de una página web en la cual va a estar dirigida a un museo pero lo curioso es que tiene que estar adaptada para personas no videntes y que también sea para celulares, en un principio nos tomó de sorpresa ya que varios de nosotros no entiende bien programación y que también se nos presentó con atraso, cosa que nos complicó bastante ya que no habíamos ni siquiera dividido las tareas y este proyecto se entrega una semana después de que nos avisaron de crearlo.','2022-09-15'),(4873,211,'olimpiada informatica','en el día de hoy seguimos con el el trabajo de las olimpiadas divididos en distintos grupos','2022-09-15'),(4874,221,'15/09','El dia de hoy ayude con parte del proyecto este de las olimpiadas. Nose mucho pero hice lo que se medio por mas la parte de registro y diagramas.','2022-09-15'),(4875,243,'15-09-2022','Estuvimos avanzando con el proyecto olimpiada y empezamos con lo de html y css ,agregamos una galería de fotos  para la pagina.','2022-09-15'),(4876,208,'Olimpiadas informaticas','La clase de hoy la utilizamos para continuar con las olimpiadas informáticas, en mi caso estuve trabajando en el sector de base de datos donde realice todo el diagrama entidad relación y con el uso del mismo termine la base de datos, tuve problemas con la inserción de datos ya que estaban en tipo blob por lo tanto lo tuve que cambiar a tipo texto y luego con una software de TTS se podría reproducir el texto\r\nAl final subí mi avance a un github en conjunto armado por los guías de las practicas profesionalizantes','2022-09-15'),(4877,214,'Ejercicio Olimpiadas informaticas','hoy estuve trabajando buscando informacion sobre distintos museos y junto con los diagramas que se realizaron en la clase empece a realizar el apartado php de la pagina ','2022-09-15'),(4878,213,'Olimpiadas Informaticas','El día de hoy empezamos a realizar las olimpiadas informáticas que se nos había comentado el día martes de esta semana en el área de redes por el profesor nahuel con fecha limite el dia 16 de septiembre por lo que debíamos apurarnos a tenerlo lo mejor posible hasta ese dia y tener algo minimamente entregable . Al momento de llegar dispuse a terminar el diagrama de entidad relación de forma de que mi compañero Sosa Lucas el otro encargado de la base de datos pueda tener algo con lo que trabajar. Tras terminar este apartado me dispuse a buscar la forma de utilizar las API´s pertinentes para este proyecto ','2022-09-15'),(4879,220,'Tecnolimpiadas','el dia de hoy se me encargo de realizar toda la consigna de la aplicacion android/ios ,teniendo que realizar el front y el back end  solo ','2022-09-15'),(4880,219,'15/09','En el día de la fecha continuamos con el proyecto de las olimpiadas. Yo me dedique a hacer el diagrama de secuencia y el diseño de la pagina junto a brian.','2022-09-15'),(4881,238,'Practica Externa 15/09/2022','Tuvimos una reunión para orientarnos en como realizar un buen perfil de Linkedin y una reseña de lo que hicimos en la semana.\r\nContinúe estudiando del material que nos dieron.\r\n','2022-09-15'),(4882,216,'Olimpiadas informáticas, HTML y CSS','Esta semana son las Olimpiadas informaticas. Nos asignaron un proyecto que consiste en una página web y aplicacion android de un museo ambas enfocadas a cumplir con las necesidades de una persona no vidente; todo el curso se separó en varios grupos para encargarse de las distintas partes que componen el proyecto; estoy con el HTML y CSS de la pagina web, junto a otros compañeros me voy a encargar del Frontend de la página. \r\nPartimos desde un proyecto ya empezado de un compañero mio e investigamos varias paginas de distintos museos. La pagina ya tiene forma. Estuve modificandola toda de forma general.','2022-09-15'),(4883,230,'15/09','Continué con el curso de AWS y tuvimos una reunión donde nos aconsejaban sobre cómo armar nuestro LinkedIn. ','2022-09-16'),(4884,211,'olimpiada tecnologica 2','en el dia de hoy seguimos con las olimpiadas y terminamos algunas cosas','2022-09-16'),(4885,217,'Terminando el Gantt','El día de hoy al no poder continuar con mi proyecto en prácticas profesionalizantés y como ya había terminado el diagrama de Gantt me termine dedicando a  terminar unos trabajos prácticos  que tengo que entregar para el dia de hoy los cuales espero que no sean demasiado complicados, también quiero aclarar que cuando nos pusimos a organizar los grupos ese mismo día yo ya había acabado de hacer el tal diagrama pero me emparejaron con un equipo el cual no tiene muchas ganas de hacer mucho y  que se distrae con facilidad pero ese tema en realidad es de ellos ya que cuando nos juntaron como equipo nos pidieron hacer 4 diagramas en el cual 1 lo hacía yo y los otros ellos ','2022-09-16'),(4886,242,'16-09-2022','Logré aprender un poco bastante de como hacer una galeria digna para la pagina','2022-09-16'),(4887,221,'16/09','El día de hoy continuamos con las actividades de las olimpiadas informáticas.\r\nA pesar de ir algo atrasados debido a la tardía noticia la cual nos informaron el lunes 13 de septiembre. Lo cual nos dejaba con tan solo 5 días para poder cumplir con el proyecto, lo cual nos dejó en una situación bastante complicada a mi parecer por que debíamos dejar de lado otras materias para poder realizar dicho proyecto que a su vez es bastante complejo por lo que no estamos seguros si nos alcanzaría el tiempo.\r\n','2022-09-16'),(4888,219,'16/9','El dia de hoy llegue tarde a clase, xq el colectivo no llegaba y vine caminando. Quitando eso llegue y comenze con la aplicacion android de las olimpiadas, pero nos encontramos con un inconveniente, que las computadoras no tienen windows 10, por lo que el Node no puede correr en estas computadoras, en especial la version 14.15 la cual es la que necesitamos para poder correr IONIC. Ahora estamos viendo para usar otras computadoras para poder entregar la aplicacion.','2022-09-16'),(4889,223,'Trabajo en las olimpiadas y completar la carpeta de campo','El día de hoy tanto yo como todos mis compañeros nos ocupamos de las olimpiadas académicas continuando con el trabajo del museo, aparte de ocuparme de eso me ocupe de trabajar en mi carpeta de campo ya que la semana que viene es la entrega de la misma.\r\nUna de las cosas en la que me enfoque mas fue ayudar amis compañeros con los problemas que tenían trabajando en la pagina y la aplicación para el proyecto de las oli