2-10-20'),(5091,223,'Cambio de archivos y mejora de las estadísticas ','El día de hoy me ocupe de remplazar los cambios que mis compañeros hicieron en una versión antigua de la pagina a mi versión actualizada de la misma, también me ocupe de trabajar en mejorar las estadísticas de la pagina ya que en eso se vasa la valoración final de las paginas de los trabajos de cada uno.','2022-10-20'),(5092,228,'Practica externa Dia 18','Realice en conjunto con mis compañeros un commit al repositorio del proyecto y tuve una reunion sobre dockers\r\n','2022-10-20'),(5093,234,'Día Nº17 PE','Elaboré dos facturas, dos remitos, un protocolo y luego escaneé facturas.','2022-10-20'),(5094,238,'Practica Externa','Revisamos e intentamos hacer un Pull Request en lo trabajado ayer. Comenzamos a investigar y realizar los test unitarios de las funciones Fetch y Serialize. Tuvimos una reunión en la que nos introdujeron a Docker y algunos conceptos básicos. Lo instalamos y realizamos algunas pruebas.','2022-10-20'),(5095,242,'21-10-2022','Hoy  solamente estuvimos dando una pequeña charla más que un trabajo debido a la falta de tiempo en este día ','2022-10-21'),(5096,217,'Reparacion Sorpresa','El día de hoy dada la falta de tiempo vamos a ponernos a continuar con la carpeta de campo si bien el día de ayer explique un poco el procedimiento de como hice para vulnerar una contraseña del inicio de Windows lo que tenía planeado hacer hoy era reemplazar el display de una computadora que no encendía por unos que tenía ya guardados en el armario, me tomo de sorpresa cuando recién el profesor consorti vino a consultarme acerca de desbloquear una PC Generación 9 de conectar igualdad, pero algo de lo que no esperaba encontrarme era que al abrir la tapa me encontré con dinero dentro.','2022-10-21'),(5097,221,'21/10','El día de hoy no pudimos hacer literalmente nada debido a que estaban haciendo un revocado a las aulas y pintándolas por lo que debido a eso no tuve la capacidad ni el tiempo de llegar a hacer algo y me estuve dedicando lo que quedaba de tiempo a la carpeta de campo la cual en estos momentos no está en su mejor forma. Todavía nos queda hacer los formularios o cuestionarios de la página y junto con eso sus respectivas vista que lo acompañan, además del modo admin el cual deberá actualizar o tener la capacidad de poder editar los ejercicios, los usuarios y sus notas.','2022-10-21'),(5098,216,'Redirección de login Admin a pagina principal Admin','Realicé un header location en el php de que hace que el login inicie sesión para que una vez termine de iniciar la sesion redirija al administrador a la pagina principal, intenté hacerle un commit utilizando el GitHub Desktop pero no me tomo bien el mail cuando inicie sesión con mi cuenta y no me dejó; las computadoras andaban algo lentas asi que no pude rehacer las cosas hoy.','2022-10-21'),(5099,223,'Recuperar imagenes','El día de hoy me ocupe de trabajar en recuperar las imágenes perdidas el día anterior y en completar algunos aspectos de la carpeta de campo, todo esto a pesar de que entramos tarde a clase debido a inconvenientes ','2022-10-21'),(5100,234,'Día Nº18 PE','Escaneé facturas y un remito.\r\nLuego hice una orden de trabajo, un remito y dos protocolos.','2022-10-21'),(5101,238,'Practica Externa','Tuvimos una reunión en la que el desarrollador a cargo de nosotros nos explicó como realizar un Pull Request y un Commit correctamente.\r\nLuego realizó una revisión en vivo de nuestro código dándonos un feedback.\r\n','2022-10-24'),(5102,234,'Día Nº19 PE y Día Nº20 PE','Día Nº19 PE\r\nArmé dos presupuestos, dos órdenes de trabajo y luego realice un cálculo del precio de venta de moldeados en excel.\r\n--------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\r\nDía Nº20 PE\r\nEscaneé una factura y un remito, luego armé un presupuesto y una orden de trabajo.','2022-10-25'),(5103,238,'Practica Externa','Tuvimos una reunión en la que, junto al desarrollador, comenzamos a escribir los tests de la función Fetch. Continúe viendo el curso de git.','2022-10-25'),(5104,247,'Inicio y Finalización de la Sexta Parte (26/10)','El día de hoy empece y termine la sexta parte de la página de JavaScript, llamada &quot;Arrays&quot;, que contiene las siguientes secciones: que son las array, como buscar elementos en un array, modificar o crear subarrays, ordenación de un array, funciones array y desestructuración de arrays.','2022-10-26'),(5105,233,'26/10/22','En la clase de hoy estuve solucionando un problema de compatibilidad entre los estilos de la barra lateral y la barra de navegación (sidebar y navbar respectivamente). Para solucionar dicho problema realice una navbar desde cero para poder configurar manualmente los estilos, luego modifique algunas cosas del manual de usuario y por ultimo agregue las modificaciones a la carpeta.','2022-10-26'),(5106,226,'Clase 52','Continue con el desarrollo de la campanilla ','2022-10-26'),(5107,229,'26-10-2022','En la fecha de hoy, termine casi por completo la vista de |Ultima Actividad| donde se visualiza los datos de la ultima conexión del usuario ','2022-10-26'),(5108,231,'Clase 53','La clase de hoy fue miercoles y no hize mucho durante esta clase porque ya tengo todo al dia, por otro lado hoy estuve solo con respecto al grupo ya que todos faltaron, la clase de ayer no hubo clases y hoy estuve practicando un poco el uso de Adobe Illustrator','2022-10-26'),(5109,249,'Clase 42','Seguí con la carpeta de campo y terminé completamente el index.','2022-10-26'),(5110,234,'Día N°21 PE','Imprimí una orden de compra, realice un protocolo y un remito.','2022-10-26'),(5111,227,'Respuestas aleatorias y sistema de facciones','Se cambió la base de datos para permitir respuestas aleatorias y se modificó el sistema de asignación de preguntas acorde a este cambio en la bdd. Luego, se realizaron los cambios correspondientes a la base de datos para implementar funcionalidad a las facciones. Desde la configuración se logró que los jugadores pueden elegir su facción que luego los representa en la partida, y luego las preguntas son respecto a eso. Se desarrolló dicho sistema.','2022-10-26'),(5112,240,'clase 52','estuve desarrollando la ultima session del usuario','2022-10-26'),(5113,236,'clase 54 (26/10/22)','En la clase del día de la fecha termine de hacer todos los bocetos que me dejaron para hacer y me puse a volcar todos los elementos en en la pagina para ir finalizando ','2022-10-26'),(5114,225,'Bitácora 26-10-22','Empecé el diseño del menú (Aparentemente casi terminado)','2022-10-26'),(5115,238,'Practica Externa','Investigue acerca de como se realizan los Branchings y Pull Request en Git y Github. Luego lo pusimos a prueba realizando un repositorio aparte.\r\nRealizamos las correcciones del último commit que habíamos realizado en el proyecto.\r\n','2022-10-26'),(5116,234,'Día Nº22 PE','Realicé tres órdenes de trabajo, escaneé dos facturas y realicé una factura.','2022-10-27'),(5117,208,'Modificaciones a la Base de Datos','Hoy modifique el archivo innit.sql o el archivo encargado de importar la base de datos entera, ademas le sume la tabla admin para que se encuentre dentro del archivo principal y agregue la tabla admin.sql dentro la carpeta tablas y por ultimo cambie la conexion de tipo mysqli a una conexion de tipo PDO','2022-10-27'),(5118,242,'27-10-2022','Avance bastante en todo lo que era la carpeta de campo, dedicandome a profundizar un poco bastante sobre lo que era Python, algo de su historia, para que servía y más, pero aun no lo termine de explicar del todo.\r\n','2022-10-27'),(5119,221,'27/10','El día de hoy, solo fuimos 2 integrantes asistidos y 5 faltaron.\r\nPoco a poco ya me voy acostumbrando a eso y ya no me sorprende.\r\nSiguiendo con el tema de los cuestionarios desde ya hace como 2meses hoy probamos usar la página esta para crearlos.\r\nHoy también nos llamaron sorpresivamente para una capacitación la cual trataba de proyectos a futuro y como uno debe tener en mente o no que hacer para su futuro una vez que termine.\r\nLa capacitación era una charla de dos personas que nos mostraban su página o plan para ayudar a las personas con diversos cursos gratuitos de todo lo que puedas pensar y sin título secundario obligatorio.\r\nDecían que era para personas que quieren hacer o practicar cosas que no pudieron y que eso de paso les ayude a su curriculum como una experiencia que se pueda valorar.\r\n','2022-10-27'),(5120,210,'bitacora 43','Hoy hice un poco de la carpeta de campo que me quedo anteriormente y ademas estuve ayudando en el proyecto de Prufex haciendo correcciones de un portafolio donde el cual puedo utilizarlo luego para el proyecto rojas para su lading page, luego de esto estuve ayudando a tomar fotos a mi compañero soler que necesitaba 1 foto para este mismo portafolio','2022-10-27'),(5121,213,'Seguida con la subida de los puntajes ','El dia de hoy tras la realizacion del daily empeze con la instalacion de todo lo que teniamos para avanzar en el proyecto pero surgio una pequeña charla en el zoom que nos dio la agencia de aprendizaje del gobierno de la cuidad con el objeto de que nosotros vieramos que futuro podriamos toma en correspondencia a nuestros sueños habilidades etc etc ','2022-10-27'),(5122,217,'Revision y completar carpeta','El dia de hoy pienso en continuar con la Pc la cual no daba imagen y en el momento en que la abrí lo único que ocurrió fue que el Flex estaba desconectado y también pensaba que no estaría desbloqueada pero al final resulto que si, entonces reconecte el Flex y todos los componentes que había empezado a desarmar y no hubo ningún inconveniente, lo que ocurrió después de que terminara de hacer el mantenimiento fue que tuvimos una capacitacion inesperada que duro 1 hora y despues se siguio el dia con normalidad','2022-10-27'),(5123,219,'27/10','En el dia de la fecha estuve bastante ocupado con la pagina de PRU-FEX, la pagina  de mi empresa. Terminamos la seccion de portafolio ademas de la seccion de contacto, que tenia un pequeño bug.','2022-10-27'),(5124,238,'Practica Externa','Junto a mis compañeros realizamos algunas pruebas con extensiones de Visual Studio Code para poder editar un documento en vivo los tres a la vez.\r\nTrabajamos en el desarrollo de los Tests.\r\n','2022-10-27'),(5125,228,'Practica externa Dia 21','Me olvide de subir la bitacora el martes 25 y miercoles 26 pero basicamente estuve realizando test unitarios del proyecto y estudiando documentacion nueva que subieron los de schub. Hoy hice lo mismo','2022-10-27'),(5126,242,'28-10-2022','Lo que màs puedo asegurar es como termine de dar una gran cantidad de informaciòn para la carpeta, también con un poco aprendido sobre mi lenguaje y que posiblemente para la próxima vaya a ayudar con los demás y seguir el tutorial\r\n','2022-10-28'),(5127,217,'Continuando la carpeta','El día de hoy tengo pensado seguir con la carpeta de campo ya que estando en esta última instancia tengo que tener las hojas listas para presentar el correspondiente día, por lo que estuve investigando en casa descubrí un par de páginas web las cuales tienen los drivers pertenecientes a las netbook g5 de conectar igualdad con algo de suerte para la semana que viene voy a traer esos archivos y ver que contienen, ','2022-10-28'),(5128,208,'Avanzando con la carpeta de Campo','Esta clase me encargue en pulir algunos detalles en los que tenia que hablar dentro de mi carpeta de campo, ya que cuando me quedo programando suelo dejar de pensar en la carpeta de campo y me olvido de anotar ciertas cuestiones, es una verdadera lastima que las computadoras sean bastante lentas ya que no me permite seguir avanzando con el proyecto pero por lo menos pude seguir con la parte de documentacion','2022-10-28'),(5129,213,'Organizacion','El dia de hoy al ser un viernes y la imposibilidad de usar las maquinas debido a tu potencia infima e insuficiente como para realizar cualquier tarea en el visual Studio Code nos pusimos a hablar sobre los temas a terminar tales coo los triggers y store procedure ','2022-10-28'),(5130,234,'Día Nº23 PE','Escaneé dos facturas, realice un remito junto con la factura, hice dos protocolos e imprimí dos notas de envío.','2022-10-28'),(5131,234,'Día N°24 PE','Escaneé dos facturas y rellené con los datos de los empleados los papeles que se usan para fichar la llegada y la salida.','2022-10-31'),(5132,247,'Inicio y Finalización de la Séptima Parte (1/11)','El día de hoy empece y termine la séptima parte de la página web dedicada al tema del Set y el Map, dividido en tres secciones: Qué es un Set, Operaciones de conjuntos y y qué es un Map.','2022-11-01'),(5133,231,'clase 54','la clase del día de hoy fue martes y esta clase estuve completado la carpeta de campo del proyecto, estuve agregando datos y pequeños fragmentos de narración en lo que explicaba como fue que avanzamos en el lado de diseño, aunque aun falta cambiar un par de aspectos en la presentación de la carpeta aunque eso esperara hasta la siguiente clase','2022-11-01'),(5134,245,'1/11/2022','El dia de la fecha continue con el manual de usuario y la carpeta de campo\r\nen mi carpeta personal llegue a las 201 paginas','2022-11-01'),(5135,227,'Imagenes y facciones','Logré obtener la descripción de cada facción de la base de datos y colocarla en el front de la configuración de partida. También logré verificar que antes de jugar todos los jugadores elijan su facción. En caso contrario se muestra una alerta. Además, coloqué algunas imagenes de diseño y acomodé las imagenes de facciones (Falta acomodas algunos elementos y aumentar el tamaño de estas imagenes).','2022-11-01'),(5136,234,'Día Nº25 PE','Modifiqué el excel con los precios de los rodillos e imprimí un par de facturas.','2022-11-01'),(5137,236,'clase 55 (1/11/22)','En la clase del día de hoy únicamente estuve acomodando un poco lo que realice la clase pasada y estuve investigando como empezar el responsive.','2022-11-01'),(5138,237,'Clase 50','El día de hoy continué lo que hice en casa del trabajo añadiendo cosas nuevas  a la pagina y arreglando errores','2022-11-01'),(5139,249,'Clase 43','Rediseñando el menú junto a mi compañera y seguí con la carpeta de campo general.','2022-11-01'),(5140,229,'01-11-2022','Retoques en la vista de perfil','2022-11-01'),(5141,239,'Dia 38','Arregle el css de la vista login_register que la animacion de cambio de formulario no funcionaba','2022-11-01'),(5142,241,'Bitacora Clase N°52 y 53 - Tomás Ortellado 6°1° C','N°52 - 26/09\r\nEl día de hoy continúe con el diagrama de Gantt y realice el Casos de uso\r\n\r\nN°53 - 01/11\r\n  Termine con el diagrama de Gantt...  a groso modo. Empecé con el Manual de uso, aunque para eso necesite ejecutar la página, y para eso es necesario subir la base de datos a phpMyAdmin, cosa que haré el día de mañana.\r\n ','2022-11-01'),(5143,240,'clase 53','diseño de menu','2022-11-01'),(5144,225,'Bitácora 1-11-22','Terminé el diseño del menú principal y una prueba de insertar las preguntas a la base de datos','2022-11-01'),(5145,247,'Inicio y Finalización de la Octava y Novena Parte (2/11)','El día de hoy empece y concluí la octava y novena parte de la página web. Se trataban de los módulos y orientada a objetos. Los módulos se dividieron en las siguientes secciones: qué son, como exportarlos, importarlos y un import dinámico. Orientada a objetos se dividió en: qué son, clases, propiedades, métodos y herencia.','2022-11-02'),(5146,249,'clase 44','seguí haciendo la carpeta general del proyecto.','2022-11-02'),(5147,229,'02-11-2022','Hice algunas correcciones en las vistas de Perfil y Ultima Sesión\r\nRealice un pequeño avance en el Manual de Usuario y se lo envié a mi compañero para que realice una corrección sobre el mismo y empezar con el índice   ','2022-11-02'),(5148,245,'2/11/2022','El dia de la fecha hosteamos con las actualizaciones la pagina, y se nos presento algunas dificultades ','2022-11-02'),(5149,237,'Clase 51','Continue con el php de administracion para borrar y editar usuarios ','2022-11-02'),(5150,231,'clase 55','la clase de hoy fuer miércoles y continué con la actualización a la carpeta de campo grupal y me pase la mayor parte de la clase completándola hasta que la termine, ya con el tiempo restante me la pase dibujando y haciendo un par de bocetos ','2022-11-02'),(5151,239,'Dia 39','trabaja junto con mi compañero en la pagina','2022-11-02'),(5152,233,'2/11/22','En la clase del día de hoy desarrolle varias secciones de la pagina.','2022-11-02'),(5153,227,'acomodar imagenes y sistema de colores','Acomodé las imágenes de las facciones para que se ajusten a la rueda de configuración. Además, creé el sistema de elección de colores, que incluye un diseño modal para la elección y las correspondientes funciones en JS para almacenarlo en la base de datos, etc. La vista de configuración ya tiene el sistema de colores implementado funcionando, falta hacer el de la vista de partida.','2022-11-02'),(5154,225,'Bitácora 2-11-22','Termine la prueba de sql a la base de datos y diseñé las selecciones de nación','2022-11-02'),(5155,234,'Día Nº26 PE','Agregué en excel los datos con los honorarios de cada uno de los empleados de la fábrica, mandé dos mails y escaneé una factura.','2022-11-02'),(5156,226,'Clase 54','No pude realizar nada por la mediocridad de las computadoras','2022-11-02'),(5157,240,'clase 54','cambio de contraseña ','2022-11-02'),(5158,228,'Practica externa Dia 23','Continuamos realizando test unitarios e investigando como hacerlos\r\n','2022-11-02'),(5159,236,'clase 56 (02/11/22)','En la clase del día de hoy empece a darle los últimos detalles al diagrama de Gantt y lo empece a pasar a Project , también, termine de modificar el manual de usuario ','2022-11-02'),(5160,241,'Bitacora Clase N°54 - Tomás Ortellado 6°1° C','El día de hoy continué con el manual de usuario que recién había comenzado la clase pasada.\r\n\r\nLa mayor parte de este está terminado, al menos todo lo que son los menus y la configuración de partida, pero probablemente también tenga que hacer el apartado del gameplay (mi expectativa es que esto sea así), que sería una porción importante del manual de usuario.\r\n\r\n\r\nAparte de esto tuve que hacer un par de asuntos extras como subir una base de datos y ajustar unos estilos para el correcto funcionamiento de la página, pero esto es más una anotación mía como recordatorio a la hora de hacer la carpeta de campo que bitacora.','2022-11-02'),(5161,238,'Practica Externa','Investigamos sobre test unitarios y Mocks en peticiones URL.\r\nTrabajamos en los tests de las funcion Serialize.','2022-11-02'),(5162,242,'03-11-2022','Lo que más habia hecho en el día fue reunir cantidades de información de un lenguaje de programación para detallar un poco en','2022-11-03'),(5163,221,'03/11','El dia de hoy me la pase haciendo la carpeta de campo nose como pero la verdad hice bastante carpeta para lo que hice. Pase de estar muy mal a menos mall','2022-11-03'),(5164,210,'bitacora 44','Hoy lo que hicimimos primero fue una daylist donde dije que iba a hacer un speedrun de mi carpeta y alcance hacer 13 paginas mas de la carpeta de campo, luego subi el proyecto al repositorio donde esta subido en la pagina web de git para que lo vea el cliente y me estuve peleando mano a mano con el internet del colegio ademas que al final estuve buscando paginas de referencia para ver como puedo hacer la nueva vista de turnos.\r\n','2022-11-03'),(5165,219,'03/11','En el día de la fecha me estuve dedicando tanto a completar la carpeta de campo como a instalar mi sistema operativo en un ssd que traje. El sistema operativo en cuestión es PrufexOS Emirate, una distribución que cree para que los integrantes de PRU-FEX y yo podamos usar para conectarnos mas fácilmente a los servidores de hosting y programar con mas facilidad y flexibilidad.','2022-11-03'),(5166,213,'Base de datos reeplanteo','Al dia de hoy tras realiza la daily nos dispusimos a seguir cada uno con su trabajo en esta daily se dio la idea de replantear la base de datos debido a un Sosa Lucas al ir a BDT  aprendio sobre el backend y me comento sobre el hecho y sus intenciones de reeplantar la base de datos para que sea mas organizada (sepadando las tablas en diferentes sql y realziar un init que sea basicamente el conjunto de todas estas tables y los inserts que tiene )','2022-11-03'),(5167,214,'Agenda','Hoy estuve modificando el codigo de la agenda para que cuando se clicke un dia aparezca un form flotante con el dia clickeado mostrado pudiendo modificarlo mas espacios para llenar tuvo un par de errores y no pude conseguir que mostrara el dia pero lo demas funciona , tambien entre al github para subir y compartir los archivos','2022-11-03'),(5168,208,'Laburito con Workbench y replanteamiento de la base de datos','Nuestro guía Damian Olaso nos enseño breves cosas sobre como usar una Workbench (nos dio el ejemplo que es como la especie de Idle de Phpmy admin, a mi en particular esa definición me ayudo un montón) luego nos dio una idea de como hacer el backup de la base de datos, esa idea la anote toda en la carpeta de campo\r\nPor otro lado nos fuimos cuestionando como esta diseñada y hecha la base de datos ya que cuando la empezamos a hacer no teníamos el conocimiento que tenemos ahora, le estamos poniendo mas énfasis en el código de Mysql y no tratar de hacer todo con php, agregue una funcion agregarTurnos\r\nPor ultimo empezamos con el planteamiento del modelo MVC','2022-11-03'),(5169,217,'Pedido de desbloqueo coradir','El día de hoy tenía pensado con seguir con la carpeta de campo al buscar un poco de cómo se crearon las computadoras y como se ensamblaron en tierra del fuego y por qué varias empresas son las que están implicadas, pero dejando eso de lado el profesor consorti me vino a hablar acerca de lo que sería unas PC de taller que se encuentran bloqueadas el único dilema es que me comento que hay posibilidad de que esas máquinas fueran de la marca coradir y si es el caso me aterra el solo hecho de pensar que se  podría llegar a bloquear y nunca más volver a prender son cosas que me temo puedan ocurrir, así que comenzamos:','2022-11-03'),(5170,228,'Practica externa Día 24','Continue realizando test unitarios y tuve una reunion en la que me ayudaron con cosas que no me salian','2022-11-03'),(5171,228,'Practica externa Día 24','Continue realizando test unitarios y tuve una reunion en la que me ayudaron con cosas que no me salian','2022-11-03'),(5172,234,'Día Nº27 PE','Ordené el escritorio de la pc, escaneé una retención, un plano y un remito. Luego realice dos presupuestos.','2022-11-03'),(5173,238,'Practica Externa','Tuvimos una reunión en la que revisamos los Tests junto al desarrollador.\r\nComenzamos a investigar posibles pruebas de fallas que podemos implementar (ej: que la petición tarde mucho tiempo en realizarse).','2022-11-03'),(5174,210,'bitacora 45','En resumen lo que hice hoy fue hablar con mi compañero, soler , fiasche y el profesor Olaso acerca de el hosting y el lag que tenia nuestra página web de prufex.com.ar luego explique muy cortamente como es que averiguamos que el lag era provocado por el tamaño de las imagenes y tambien el nuevo diseño de turnos que tengo en mente para la vista de turnos','2022-11-04'),(5175,242,'04-11-2022','solamente terminaria haciendo una muy pequeña parte de la carpeta de campo, buscando algo de información de demás lenguajes de programación\r\n','2022-11-04'),(5176,211,'proyecto php','hasta el dia de la fecha no seguí con el proyecto de php, y tampoco me dijeron que me apure a hacerlo por lo que vere si sigue en pie o termino','2022-11-04'),(5177,223,'Carpeta de campo y cierre de año','El día de la fecha me concentre en trabajar en la carpeta de campo ya que solo nos quedan dos semanas de clases y me quedan varias paginas para terminar la carpeta de campo por lo que trabaje en eso toda la clase, llegue a realizar diez paginas de la misma y aun me quedan varias mas por completar con el contenido de clases anteriores.','2022-11-04'),(5178,221,'04/11','El dia de hoy estuve buscando el alguna pagina que pueda crear un cuestionario en php y MsQl.\r\nEncontre videos o paginas de muestra pero ninguna servia del todo.\r\nLuego de un rato termine encontrando una: https://desarrolloweb.com\r\nEn esta pagina explica el como crear la tabla en la base de datos.\r\n','2022-11-04'),(5179,219,'04/11','En el dia de la fecha estuve ayudando a yonar a reparar una computadora que traje, porque necesito tener una notebook para trabajar fuera de casa. Pudimos repararla exitosamente, a parte de eso tambien hice las pruebas a mi sistema operativo PrufexOS, las pruebas consistian en abrir varias ventanas en los distintos escritorios para comprobar el rendimiento. En total fueron 6 escritorios simultaneos.','2022-11-04'),(5180,213,'Subida de la performance y SEO del index','Hoy se ausento el scrumMaster debido a esto no se realizo una daily pero cada uno sigue con los trabajos que adeudaba yo seguí con el tema de subida de puntajes en este caso me puse a subi los puntajes del performance y de la vista de index de forma que quedar ya casi terminada esta vista y ver si puedo avanzar con las otras  ','2022-11-04'),(5181,217,'Reparando la PC de un compañero','El dia de hoy tenia pensado intentar desbloquear la PC del &quot;mono&quot; ya que me dejo a cargo unas cuantas pc que tengo que intentar desbloquear, pero al final resulto que no, por tal hecho de que mi compañero necesitaba urgentemente la pc asi que pasaron unas 2 horas en esas 2 PC que el me trajo y en las que al final tuve que realizar un cambio completo de las PC tanto con la mother como con la pantalla y la carcaza de estas, pero lo bueno es que ya tengo suficientes hojas para terminar la carpeta de campo la cual voy a continuar el fin de semana','2022-11-04'),(5182,234,'Día Nº28 PE','Realice dos protocolos, escanee facturas y realice un remito y una factura.','2022-11-04'),(5183,234,'Día Nº29 PE','Escaneé un remito, una factura y mandé un presupuesto.','2022-11-07'),(5184,234,'Día Nº30 PE','Ordené el escritorio de la pc e hice un trámite en la página del gobierno.','2022-11-08'),(5185,247,'Inicio de la Décima Parte (8/11)','El día de hoy me dedique a introducir las primeras secciones de la décima parte de Javascript dedicado a DOM (Document Object Model, en español, Modelo de Objetos del Documento). Estas primeras secciones tratan sobre que es el DOM y como selección y crear elementos.','2022-11-08'),(5186,227,'Carpeta de campo y manual de usuario','Agregué las capturas de los últimos dias a la carpeta de campo y trabaje en el manual de usuario con mi compañero.','2022-11-08'),(5187,245,'8/11/2022','Seguimos con la carpeta de campo general, llegamos a las 70 paginas','2022-11-08'),(5188,239,'Dia 40','Arreglos de la pagina y meto informacion en la carpeta de campo general','2022-11-08'),(5189,237,'Clase 52','El dia de hoy me concentre con mis compañeros en escribir la carpeta de campos general','2022-11-08'),(5190,231,'clase 56','la clase de hoy fue martes y estuve completando un poco la carpeta de campo grupal, cambiando el aspecto un poco y luego de eso nada más, se podria decir que otras vez ando sin cosas que hacer','2022-11-08'),(5191,229,'08-11-2022','En esta clase me dedique a la carpeta de campo','2022-11-08'),(5192,240,'clase 55','funcionalidad cambio de contraseña','2022-11-08'),(5193,241,'Bitacora Clase N°55 - Tomás Ortellado 6°1° C','Empecé con el Manual de usuario de partida.\r\n\r\nTuve que hacer un screenshot al que le fui añadiendo viñetas para ir señalizando cosas de la partida.\r\n\r\nEn eso se baso mi trabajo de hoy.','2022-11-08'),(5194,226,'Clase 55','Arregle el error del sesion','2022-11-08'),(5195,236,'clase 57 (08/11/22)','En la clase del día de hoy me puse a completar y rellenar la carpeta de campo, ademas, inserte el footer nuevo a mi repositorio que estaba anteriormente en el repositorio de Thris.','2022-11-08'),(5196,238,'Practica Externa','Actualizamos las características de los Posts (tanto en el código como en los tests). Investigamos sobre como controlar que nuestra función no tome más de X cantidad de segundos en ejecutarse. Investigamos como testear el error 500 en servidores simulados.','2022-11-08'),(5197,228,'Practica externa Día 25','Continue realizando test unitarios e investigando timeout en golang','2022-11-08'),(5198,239,'Dia 41','Hice retoquen en el css de la pagina y arregle un pull request que no funcionaba en el github','2022-11-09'),(5199,233,'9/11/22','El día de hoy estuve aplicando los distintos estilos a todas las vistas(secciones) que ya poseemos.','2022-11-09'),(5200,247,'Finalización de la Décima y Onceava Parte, e inicio de la Doceava Parte (9/11)','El día de hoy termine la décima parte de la página web dedicada al DOM. Además, empece y termine la onceava parte, que trataba de los eventos, métodos, objetos, eventos en HTML y JavaScript. Por último, empece la doceava parte dedicada a la explicación de las expresiones regulares.','2022-11-09'),(5201,236,'clase 58 (09/11)','En la clase del día de hoy estuve rellenando la carpeta de campo y también le agregue la paginación a las vistas de las especialidades','2022-11-09'),(5202,245,'9/11/2022','El dia de la fecha continue con el manual de usuario y mi carpeta personal \r\n\r\npaginas de mi carpeta: 213 \r\n\r\npaginas del manual de usuario: 40','2022-11-09'),(5203,231,'clase 57','la clase de hoy fue miércoles y no hice demasiado, ya que solo estuve completando un poco la carpeta de campo compartida y luego de eso me la pase leendo un poco, ya completado todo lo que tenia que hacer trate de ver si puedo hacer algunos cambio de aspecto a la carpeta','2022-11-09'),(5204,229,'09-11-2022','En la fecha de hoy, me dedique a realizar carpeta de campo','2022-11-09'),(5205,238,'Practica Externa','Tuvimos una reunión con el desarrollador principal en la que terminamos de realizar los Tests y realizamos el Merge con la Branch principal. Comenzamos a investigar tecnologías para realizar el Publisher.','2022-11-09'),(5206,237,'Clase 53','El boton de Compra del carrito funciona y tiene un confirmar muy rudimentario.\r\nEl PDF del Carrito aparece con los productos y se puede descargar.\r\nEl eliminar usuarios cumple con su función.','2022-11-09'),(5207,241,'Bitacora Clase N°56 - Tomás Ortellado 6°1° C','El día de hoy termine con el Manual de usuario de la partida.\r\n\r\n\r\nAnotación para la carpeta de campo.\r\nTuve que eliminar y volver a subir la base de datos para que la versión actualizada del proyecto funcione. ','2022-11-09'),(5208,227,'Correcciones y verificacion','Se corrigieron los errores en la partida a partir del nuevo sistema de colores. Se agregó una verificación a los ingresos de datos para evitar ataques y brindar seguridad al proyecto.','2022-11-09'),(5209,249,'Clase 45','Empecé a ser la validación de contraseña para el registro.','2022-11-09'),(5210,226,'Clase 56','Desarrollé la funcionalidad de la paginacion de las preguntas','2022-11-09'),(5211,234,'Día Nº31 PE','Imprimí dos planos, guardé archivos en sus respectivas carpetas y elaboré un presupuesto.','2022-11-09'),(5212,228,'Practica externa Día 26','Tuve una reunion con Joao Moura y terminamos los test unitarios','2022-11-09'),(5213,240,'clase 56','hice cambios en la vista de perfil','2022-11-09'),(5214,223,'Carpeta de campo, avances de proyecto y organización con mis compañeros','El día de hoy me ocupe de varias cosa durante el transcurso de la clase, me ocupe de terminar de escribir las cosas que me quedaron pendientes en la carpeta de campo, cosas de los días jueves 20/10/22, viernes 21/10/22 y 4/11/22, una vez que termine de escribir los detalles de esos días en la carpeta quería avanzar en el proyecto puliendo algunos detalles que debíamos corregir urgentemente. Dentro de esas cosas en las que trabaje se encuentra la corrección de muchos errores de sistema, cree archivos necesarios para la vista de admin (eliminar.php, actualizar.php y vista-actualizar.php), corregí errores de código que generaban problemas de usuario y trabaje con mis compañeros en como avanzaremos con el proyecto en nuestras casas.','2022-11-10'),(5215,221,'10/11','Lastimosamente solo pudimos agregar esto el día de hoy debido a que no pudimos proseguir debido a una falta de compañeros de trabajo lo cual nos dejó solo a mí y otro integrante el día de hoy.\r\nAhora estamos dudando de cómo vamos a hacer para llegar a hacer los cuestionarios para la semana que viene sin la necesidad de usar formularios de google ya que un profesor nos dejó bien en claro que nos reprobaría si dejábamos los formularios de google.\r\n\r\n\r\n\r\nNos queda por terminar los cuestionarios y los videos pero en vista de que solo somos 3 en el grupo en vez de 7 como se supone que seriamos estamos muy apretados con el tiempo y encima de eso al estar en la última semana del año tenemos todas la pruebas juntas y nos estamos muriendo tratando de aprobar todo.\r\n','2022-11-10'),(5216,208,'verificarVacio y verificarEspeciales','Empeze con la seguridad de los datos de la base de datos y vamos a migrar a la opción de hacer los inserts directamente con el llamado de una función, dentro del mvc, y no haciendo la consulta sql directamente desde una vista. Antes de hacer el llamado del agregarDoctor o agregarPaciente, dentro de ahi se van a llamar a los verificarVacio y verificarEspeciales dentro de cada uno de los campos que se registren para evitar que se envie algun mal dato o un carácter especial que pueda llevar a un ataque o error en la base de datos','2022-11-10'),(5217,217,'Examinando Las PCs','El dia de hoy tengo que hacer un examen de todas las PCs ya que después de lo que me conto felix estoy con inseguridades acerca de si continúan de esa manera o ya se solucionaron por si mismas, en el video informativo explica que cuando ocurre este error.\r\nYa para cambiar un poco el tema creo que hace 1 semana los directivos de taller me habían llamado para desbloquearles una PC la cual no pude entregarles hasta el dia de hoy por la carga horaria la cual me tuvo todos estos días ocupado con exámenes entre otras cosas pero al dárselas les propuse el quitarle el inicio de Windows ya que estaba bloqueado con una contraseña\r\n','2022-11-10'),(5218,219,'10/11','Ahora estamos dudando de cómo vamos a hacer para llegar a hacer los cuestionarios para la semana que viene sin la necesidad de usar formularios de google ya que un profesor nos dejó bien en claro que nos reprobaría si dejábamos los formularios de google.\r\n-----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\r\nNos queda por terminar los cuestionarios y los videos pero en vista de que solo somos 3 en el grupo en vez de 7 como se supone que seriamos estamos muy apretados con el tiempo y encima de eso al estar en la última semana del año tenemos todas la pruebas juntas y nos estamos muriendo tratando de aprobar todo.','2022-11-10'),(5219,213,'MVC y login php','El dia de hoy tras realizar la daily nos pusimos a trabajar en lo que respecta a la base de datos y la vista de login por lo que nos dispusimos a eso en el dia pedimso ayuda de tanto compañeros como de profesores para tener una buena idea de como hacer las cosas agregamos mas .php con el objeto de que sean utiles para realizar el login de manera correcta ','2022-11-10'),(5220,238,'Practica Externa','Comenzamos a crear las carpetas y archivos necesarios para traer la Imagen de RabbitMQ (lo que usaremos para enviar nuestros mensajes). Para esto realizamos un checkout de la rama main a una rama que bautizamos “chore/rabbit-mq” y comenzamos un Pull Request.\r\nCreamos los archivos base y los probamos.\r\n','2022-11-10'),(5221,228,'Practica externa Día 27','Comence a investigar sobre rabbitMQ para la nueva funcion del proyecto ','2022-11-10'),(5222,217,'Realizando el cambio de mother','La idea de reemplazar la placa madre con la vieja PC que tengo así que por lo que pude desarmar la notebook y la placa madre son idénticas lo único que me queda es que al hacer el cambio respondan de la misma manera sin problemas de compatibilidad por lo que pude ver también lo son sus chips eeprom, al fian ltermino resultando porque sus compatibilidades eran iguales y lo unico raro es que la PC es demasiado antigua para soportar cosas de ahora y dudo que funcione bien mas adelante.\r\n','2022-11-11'),(5223,242,'11-11-2022','Hoy se trató completamente de buscar cada vez más información pero del lenguaje &quot;c++&quot;, cual hice una buena cantidad de hojas al menos en un día, buscando buena información o lo que yo creo que es buena','2022-11-11'),(5224,219,'11-11','En el dia de la fecha estuve terminando algunos detalles de la pestaña de administracion del peoyecto School, tambien organizamos el como se va a presentar el proyecto ya que los integrantes: FRANCO, EZEQUIEL, VELARDE Y FACUNDO no cumplieron asistencia los dias de practicas profesionalizantes, por lo que solamente quedamos FEDE, DELIO, GANTUS Y YO.','2022-11-11'),(5225,221,'11/11','El dia de hoy vinimos antes al colegio por una cuestio de que teníamos yo y otros mas teníamos POO previa y tuvimos que venir a unas clases por parciales que en realidad son para preparar la previa para diciembre en las que nos explicaron muy rápida mente que es POO y para que sirve.\r\nLuego tuvimos una hora y media hasta que sea la hora de PP y nos fuimos a pasear por ahí.\r\nAhora en PP estamos tratando de subir las cosas a github para asi tener todo mas organizado y poder compartirlo con todos mas fácilmente y sin necesidad de ir pasándonos los archivos con cada cambio que hacemos.\r\n','2022-11-11'),(5226,223,'Carpeta de campo y código con fiasche y gantus','El día de hoy trabaje completando algunas paginas de mi capeta de campo revisando el texto de días anteriores y agregando contenido, en total llegue a completar diez paginas de la carpeta. También trabaje junto con fiasche y gantus en la pagina comenzando a realizar los cambios que fiasche quería realizar para poder aprobar la materia.','2022-11-11'),(5227,208,'Funciones agregarDoctor y verificarCorreo','Me encargue de terminar las funciones de agregarDoctor, dentro de la fucion agregar doctor se pasa por los verificar vacio y especiales que hice ayer, se pasa por estos verificar para que no se agregue algun registro que pueda afectar a la base de datos, en caso de que este todo ok se efectua el insert y se agrega el doctor, faltaria termianr con el agregarPaciente; por otro apartado tengo que terminar con los verificar se me ocurrio agregar un verificarCorreo verificar dni y verificar tamaño (verificar tamaño utilizado en telefonos)','2022-11-11'),(5228,213,'Login e prevencion de inyecciones y hackeos','Al momento de llegar mi scrum master no estaba por lo que empezamos a realizar las tareas adeudadas tras esto y hablar con Brian sobre el login me dispuse a aquello de forma de poder terminar el login tras realizar modificaciones a la vista de index.php y de login.php con el tema de los require pude completar el login y era funcional pero al momento de querer cerrar sesion esto era imposible debido a que el codigo correspondiente a session destroy no estaba por lo que me dispuse a hacer esto para que se pueda cerrar la sesion. Tras completar esto pedi a los profesores si podian intentar hackear el login y resulto ser complicado de hackear por lo que estoy feliz de que funcionara bien','2022-11-11'),(5229,234,'Día Nº32 PE y Día Nº33 PE','No concurrí.\r\n-----------------------------------------------------\r\nCalculé un presupuesto para un rodillo.','2022-11-11'),(5230,210,'bitacora 46','Esta vez trabajando en el aula de al lado tuve un problema en el windows con una de las computadoras pero lo resolvi rapido, Entre al github desktop pero me salia como si ya tuviera un usario ahi dentro, lo cual me sirvio para descargar el proyecto y poder editar la vista de turnos como lo estaba planeando de hace tiempo pero luego estuve ayudando a mi compañero soler con el php del login hasta que vino el profesor Nahuel que habia venido para intendar &quot; Hackear&quot; el login y tratar de ingresar pero no pudo xd','2022-11-11'),(5231,234,'Día N°34 PE','Escaneé una factura y un remito e hice una factura.','2022-11-14'),(5232,238,'Practica Externa','Vi un tutorial de como subir un sitio web utilizando docker.\r\nRealicé el curso de Schub de introducción a docker y luego empecé con la segunda parte que empezaba a trabajar con Bases de Datos.\r\n','2022-11-14'),(5233,228,'Practica externa Día 28','Estudie la documentacion sobre docker proporcionada por Schub','2022-11-14'),(5234,247,'Finalización de la Parte Número 12 y 13','El día de hoy finalice la doceava parte dedicada a las expresiones regulares, explicando que son, las propiedades, flags, buscar y capturar textos y cómo crear expresiones regulares. A su vez, termina la treceava parte, sobre la asincronía, explicando qué es, las funciones callbacks, las promesas, las promesas de grupo y el Async/Await.','2022-11-15'),(5235,231,'clase 58','la clase de hoy fue martes y continuamos con la actualizacion y a terminar con el proyecto, por mi parte no hubo mucho que hacer ya que tengo todo lo mio subido tanto a mi carpeta de campo como a la carpeta compartida','2022-11-15'),(5236,229,'15-11-2022','Empece con la presentación ','2022-11-15'),(5237,233,'15/11/22','El día de hoy continué desarrollando vistas y también desarrolle la carpeta de campo.','2022-11-15'),(5238,245,'15/11/2022','El dia de la fecha he continuado con mi carpeta y la carpeta de campo\r\n\r\nhe hecho el diagrama de &quot;caso de uso&quot; para la carpeta de campo general ','2022-11-15'),(5239,249,'Clase 46','Terminé el responsive del slider','2022-11-15'),(5240,227,'Diseño menu','Se agregaron los diseños creados por mis compañeros para el menu y se acomodaron los elementos para que giren sin romperse. Además, se cambio la fuente.','2022-11-15'),(5241,234,'DÍA Nº35 DE PE','Reenvíe los puertos del internet.','2022-11-15'),(5242,237,'Clase 54','El día de hoy en la sección de administración se puede modificar/editar el usuario,nombre y contraseña de los usuarios. a su vez arregle un problema con el buscador de mercado libre, el problema era un error de codeado con HTML.','2022-11-15'),(5243,236,'clase 59 (15/11/2022)','En la clase del día de hoy estuve trabajando en las vistas del menú desplegable, acomodando junto a Maria ciertas cosas de esa vista, ademas, estuve completando la carpeta de campo','2022-11-15'),(5244,226,'Clase 57','Centralicé la logica de las especialidades','2022-11-15'),(5245,231,'clase 59','la clase del dia fue miercoles y no hice damsiado, la primera parte de la clase me la pase buscando diseñosy logos de la web para enviarselos a Tobias para que él haga la presentacion del proyecto mediante un power point, luego de eso estuve completando mi carpeta de campo porque olvide actualizarla un poco','2022-11-16'),(5246,249,'Clase 47','Terminé todo el responsive.','2022-11-16'),(5247,229,'16-11-2022','Avance de la presentación','2022-11-16'),(5248,239,'Dia 42','El dia de hoy me centre en terminar la vista Buscador donde se muestran los productos a comprar y hice muchos cambios tanto en el css como html y php.','2022-11-16'),(5249,233,'16/11/22','En el dia de hoy realice los preparativos para la presentación de la próxima clase, además de investigar un poco acerca de bootstrap\r\n','2022-11-16'),(5250,237,'Clase 55','Se puede ver el carrito de cualquier usuario desde administración, se arreglo un problema con el ticket que se repetían los productos.','2022-11-16'),(5251,226,'Clase 58','Termine de centralizar toda la logica de las espeicalidades y ayude con el responsive de la pagina','2022-11-16'),(5252,234,'Día Nº36 PE','Escaneé un plano, una factura de gas y dos facturas de compra en supermercado, e hice un remito, una factura y una nota de crédito.','2022-11-16'),(5253,240,'clase 57','cambio de diseño, y de la card de seguridad','2022-11-16'),(5254,227,'Acomodar imagenes configuracion','Continue avanzando con las olimpiadas haciendo la api y el appinventor. Continue el diseño de conquizt acomodando las imagenes de la  vista de configuracion','2022-11-16'),(5255,236,'clase 60 (16/11/22)','En la clase del día de hoy empece a hacer el responsive de las especialidades, para ser mas especifico, en la parte de la tarjeta, ya que este se rompe al achicarlo, y estuve haciendo carpeta de campo','2022-11-16'),(5256,238,'Practica Externa','Tuvimos una Call con Joao (desarrollador principal) para ver en que íbamos a trabajar ahora. Quedamos con la tarea de buscar información, experimentar e implementar ORMs con PostgreDB.\r\nTuvimos una segunda parte de Docker con uno de nuestros tutores en la que  revisamos los ejercicios que habíamos hecho e hicimos los que nos faltaban.\r\n','2022-11-16'),(5257,228,'Practica externa Dia 29','Tuve una llamada para hablar del proyecto y otra llamada que fue una clase de dockers','2022-11-16'),(5258,221,'17/11','El dia de hoy actualizamos la información que buscamos de la historia de los lenguajes ya que quisimos poner una información mas  histórica de los lenguajes ya que la información explicativa estaría en los tutoriales. Ahora que me acuerdo me falta poner la actualización de la presentación del proyecto ya que cambiamos el grupo las imágenes que mostraba, lo peor encima es que ya lo había hecho pero un compañero espacialito me cerro el archivo.','2022-11-17'),(5259,216,'Diagrama de caso de uso, carpeta de campo','Me asignaron la tara hoy de hacer el diagrama de caso de uso del proyecto (haremos 2, este primero es específicamente de la pagina admin) ya que no tenemos ninguno; luego de abrir la pagina admin para guiarme, buscar información en artículos, vídeos y en imágenes de ejemplo pude realizar parte del mismo, aun esta incompleto y procurare continuarlo mañana. \r\nComplete un poquito mas mi carpeta de campo con lo realizado hoy.','2022-11-17'),(5260,242,'17-11-2022','Me propuse a llegar a la carpeta de campo, intentar buscar más o intentarlo sobretodo en  seguir con la guía del tutorial','2022-11-17'),(5261,217,'Reparando un error propio y sorpresa','El dia de hoy tenemos que hacer entrega de las carpetas de campo las cuales yo ya tengo las hojas listas, lo único de lo que quería asegurarme es que todas las netbooks que eh desbloqueado siguen igual, y por lo que se asi es, pero yo tadavia seguía con la pc la cual no iniciaba Windows y cuando la desarme para ver que contenia, me di cuenta que le faltaba el disco duro, y era normal que saltara el error de BOOT/BCD, porque no encuentra el lugar donde esta alojada la partición ni el sistema operativo, asi que era lógico lo que tenia que ocurrir y es que una vez terminado el proceso de testear todo tipo de formas para encontrar una solución a ese error, era muy fácil pero lo que me ocurrió después fue por pura negligencia mía y es que no se en que estaba pensando pero accidentalmente le coloque una contraseña al inicio del BIOS y cuando se reinicio me pidió la contraseña, la cual yo use para pruebas es “avenida123”, pero cuando la ingreso ocurre que no me deja acceder. ya dejando de lado eso los directivos de taller me dieron una caja de febrero rocher por haberles desbloqueado la PC de conectar igualdad.','2022-11-17'),(5262,219,'17/11','El dia de hoy me dedique a hacer la carpeta de campo, ya que me faltaban 4 paginas, aunque  mi gran amigo FEDERICO PEREYRA me dio 9 paginas regaladas, mas algunas cosas extra, ya llegue a las 200 paginas de la carpeta, mañana entregare todo porque quiero editar algunas cosas, porque en gran parte de la carpeta insulte a mis compañeros que me dejaron abandonado :) . ','2022-11-17'),(5263,213,'Mas cuestiones de login','El dia de hoy teniamos pensado avanzar con la vista de calendario pero resulto en otra cosas totalmente diferente en relacion con el login y como  hicimos junto con olaso todo el tema de $_session [\'campo\'] tras esto movimos todas las carpetas y cambiamos las url o los href tanto del body como del header','2022-11-17'),(5264,208,'Trabajo en equipo y Puliendo detalles','Al principio dela clase pusimos en claro que es lo qeu nos falta para terminar el proyecto, tenemos que atacar con toda la vista de agregarTurnos. Estuvimos fixeando ciertos problemas en la vista de ajuste para que funcione la session y tome variables correspondientes, ademas tuve la ayuda de mi mentor/guia que me enseño como hacer un view y como funciona','2022-11-17'),(5265,238,'Practica Externa','Revisamos una sección de código hecha por nuestro tutor.\r\nInvestigamos sobre ORMs descartando las opciones que no nos servían y comparando las que si, elegimos GORM y comenzamos a estudiarla.\r\nTuvimos una call con nuestro tutor en la que repasamos su código y nos indico en que debíamos trabajar ahora. Realizamos un PR en el que empezamos a trabajar en lo indicado.\r\n','2022-11-17'),(5266,228,'Practica externa Día 30','Investigue sobre GORM y tuve una llamada para hablar del proyecto','2022-11-17'),(5267,223,'Entrega carpetas de campo','El día de hoy era el ultimo en el que podíamos trabajar en la carpeta de campo siendo este mismo día el ultimo en el que podremos entregarlo, así que dadas las circunstancias me puse a trabajar en la carpeta de campo logrando llegar a las 201 paginas las suficientes para aprobar, logrado ese objetivo me puse a charlar con mis compañeros de como haremos para terminar la pagina, la cual nos falta trabajar en los formularios y hacerlos funcionales para la entrega final, con ello también nos queda pasar con Nahuel y asegurarnos de que nuestra pagina sea resistente a sus ataques','2022-11-18'),(5268,242,'18-11-2022','me la pase un poco distraido pero aun así haciendo poco a poco lo que era la carpeta de campo que me restaba','2022-11-18'),(5269,219,'18/11','El dia de hoy estuve trabajando en los formularios del proyecto School, sinceramente aun tenemos dudas sobre el funcionamiento de todo esto, ya que aun no tenemos el diseño ni el php armado.','2022-11-18'),(5270,217,'Terminando la carpeta y preparando la presentacion','El dia de hoy al estar buscando métodos para borrar datos de bios me encontré con un video el cual lo único que requiere es tener que un USB flasheable y tener que descargar un archivo el cual una vez conectado al iniciar la PC iniciara con unos comandos los cuales podrán borrar los datos del bios, pero eso ya lo explicare luego, ahora sigo buscando ideas de como continuar para desbloquear.','2022-11-18'),(5271,221,'18/11','El día de hoy entregamos la capeta de campo con las 200 hojas. Gracias a dios yo llegue a las 208 paginas y eso que ayer a mi me faltaban 79 pero con la guía para los tutoriales pude avanzar bastante para hoy.\r\n','2022-11-18'),(5272,210,'bitacora 47 y 48 ','Bitacora 47\r\nayer lo que paso es que me fui apurado y no comi nada y tenia 10minutos para comer. Ayer pude hacer que la vista de turnos sea responsive y ademas pude subirlo al git donde esta la pagina web subida, luego estuve ayudando a Sosa y Soler en el tema de la session de php en las vistas de administradores ya que teniamos un problema con la session que no recopilaba todos los datos del usario ingresado y unicamente podiamos mostrar los datos que se ingreso en el login como el Email y contraseña\r\n\r\nBitacora 48\r\nHoy estuve ayudando a soler un poco con la unificacion de la vista de calendario que hizo mi compañero tolosa en el proyecto que hicimos ayer pero luego me dedique hacer la carpeta de campo de ayer y hoy para luego guardarlo y entregarlo','2022-11-18'),(5273,213,'Entrega de la carpeta de campo ','El dia de hoy ya es la entrega del trabajo practico como de la carpeta de campo por lo que hasta aca llega la carpeta de campo y este es mi ultimo dia  esto seria todo por ahora no vino nahuel por lo que el testing no se hizo esto nos dejo medio desubicados en que se va a hacer pero bueno esto es lo poco que se hizo en el dia ','2022-11-18'),(5274,216,'Finalización diagrama de caso de uso ','Termine con lo que me quedo pendiente del diagrama de caso de uso el día de ayer; con ayuda del scrum master agregue algunos detalles faltantes y coloque las relaciones entre la base de datos y el resto de cosas. Seguí con la carpeta de campo.','2022-11-18'),(5275,208,'Implementando Calendario y retoques finales','Tolosa nos paso la vista calendario que anteriormente había hecho y ahora la tuvimos que agregar a nuestro código, el problema con su vista calendario es que el estaba trabajando por fuera del GitHub entonces tenia su propia conexión a la base de datos sus propios archivos css, js y PHP\r\nPor otra parte estuve ayudando con la finalización de la documentación nos faltaría exportar el DER, actualizar el Gannt pero el Diagrama de Caso de uso ya esta terminado','2022-11-18'),(5276,249,'Clase 48','Penúltima clase, terminé la presentación.','2022-11-22'),(5277,229,'22-11-2022','Prepare la presentación','2022-11-22'),(5278,236,'clase 61 (22/11/22) ','En la clase del dia de hoy me puse a completar la carpeta de campo y me puse a hacer la parte de sub respuestas de la vista de especialidades','2022-11-22'),(5279,238,'Practica Externa','Investigamos sobre como realizar una conexión a una base de datos Postgres utilizando GORM. Tuvimos una reunión con el desarrollador principal para orientarnos.\r\nRealizamos un Pull de la imagen de Docker y creamos una tabla, luego comenzamos a investigar y experimentar para llenar la BDD con registros.\r\n','2022-11-22'),(5280,228,'Practica externa Día 31','Comence a trabajar con una base de datos postrgreSQL en un docker, tuve una reunion con Joao para preguntar sobre dudas del proyecto y nos dijo que poblemos la base de datos','2022-11-22'),(5281,249,'Clase 49','Última clase, presentamos el proyecto.','2022-11-23'),(5282,229,'23-11-2022','En esta fecha, se realizo la presentación sobre el proyecto','2022-11-23'),(5283,229,'23-11-2022','En esta fecha, se realizo la presentación sobre el proyecto','2022-11-23'),(5284,239,'dia 43','hoy me enfoque en terminar la carpeta de campo','2022-11-23'),(5285,247,'Presentación Final (23/11)','El día de hoy presente, junto a mi compañero Lucas Moreno, lo que vendría a ser la versión final de la página de programación, explicando para que sirve, sus funciones y los diagramas.','2022-11-23'),(5286,240,'clase 58','presentación del proyecto final :) ','2022-11-23'),(5287,227,'Presentacion final','El dia de hoy presentamos nuestros proyectos terminados','2022-11-23'),(5288,233,'23/11/22','El día de hoy realizamos la presentación de nuestro proyecto, a pesar de las complicaciones pudimos cumplir los objetivos para la presentación.\r\n','2022-11-23'),(5289,234,'Día Nº37, 38, 39, 40 PE','No concurrí.\r\n---------------------------------------------------------------------------------------------------------------------------------------------------------------\r\nRealicé un protocolo, un remito y llamé al proveedor de agua para realizar un pedido de botellones.\r\n---------------------------------------------------------------------------------------------------------------------------------------------------------------\r\nImprimí una factura.\r\n---------------------------------------------------------------------------------------------------------------------------------------------------------------\r\nRealice una orden de trabajo, un remito, luego escaneé este mismo ya firmado y una factura, y también realice un presupuesto.','2022-11-23'),(5290,236,'clase 62 (23/11/22)','En la clase del día de hoy hicimos unos retoques en la pagina para poder presentarla e hicimos la presentación final del proyecto','2022-11-23'),(5291,238,'Practica Externa','Tuvimos un catch-up con Edu.\r\nIntentamos realizar el código para hacer inserts a la base de datos.\r\nTuvimos problemas con las variables de entorno, al principio para crearlas desde un archivo .env, luego las seteamos manualmente desde el cmd.\r\nNos queda resolver el código porque no las toma correctamente.\r\n','2022-11-23'),(5292,228,'Practica externa Día 32','Tuve una reunion con Eduardo para hablar sobre el cierre de las practicas, continue con el proyectotratando de setear variables de entorno y tuve otra reunion con Joao para hablar del proyecto','2022-11-23'),(5293,226,'Clase 60','Tuvimos la presentacion final del proyecto','2022-11-23'),(5294,217,'Preparando la presentacion','El dia de hoy vino mi compañero felix diciéndome que tenia que realizar la presentación del proyecto el cual no sabia y yo estaba algo nervioso ya que pensaba que también me tocaba exponer a mi pero al final no ocurrio asi lo que si tuvimos que armar una presentación para explicar el como se realizaron las operaciones y si hubo dificultades en el proceso los cuales si que hubo y que también en el proceso se pudo ayudar a mas personas las cuales eran tanto profesores como alumnos de otros cursos, ahora estuvimos con felix revisando el Excel en el cual se encontraban las PC que se habían reparado y las que no se pudieron reparar.','2022-11-24'),(5295,220,'Ultimo dia','el dia de hoy realize los diagramas  pertenetes del proyecto como el diagrama de gants y el diagrama de flujo\r\n','2022-11-24'),(5296,219,'24/11','En el dia de hoy estuvimos presentando nuestros proyectos a los profesores, por lo que vimos, es probable que aprobemos la materia, debido a que el proyecto esta a un 90% y mi carpeta de campo ya cuenta otra vez con las 200 paginas.','2022-11-24'),(5297,242,'24-11-2022','Hoy detalle algo que nos faltaba, el diagrama de flujo que nos faltaba e incluso hacer la exposición el día de hoy','2022-11-24'),(5298,221,'24/11','El dia de hoy al ser el ultimo dia de PP expusimos el proyecto con todo lo que teniamos.','2022-11-24'),(5299,223,'Entrega de proyecto','El día de hoy debíamos de terminar el proyecto para poder entregarlo y tener la nota final de la materia, a mitad de la clase nos dimos cuenta de que hoy era el día donde debíamos entregar el proyecto final. A costa de que nos faltaban muchas cosas por hacer me puse a trabajar en la pagina, gantus se puso a hacer el power point de el proyecto y pereyra trabajo en los diagramas que no teníamos echos, en el que mas se enfoco fue en el de diagrama de flujo ','2022-11-24'),(5300,228,'Practica externa Día 33','Tuve una reunión con todos los miembros de Schub en la que se hablo de la historia de la compañía, que tecnologías usan, el trato con los clientes y a donde quieren ir como empresa. continue con el proyecto trabajando en la base de datos\r\n ','2022-11-24'),(5301,238,'Practica Externa','Tuvimos un “All Hands”.\r\nInvestigamos sobre Variables de entorno y resolvimos el problema junto a Joao.\r\nComenzamos a intentar realizar inserts a la base de datos. Nos encontramos con un par de errores hasta que dimos con el formato correcto. Luego tuvimos un error porque los cambios no se veían reflejados en el DBeaver. Los resolvimos junto a Joao nuevamente (había un error en el nombre de la base de datos).\r\nFinalmente pudimos ver los inserts en el DBeaver.\r\n','2022-11-24'),(5302,251,'Comienzo PP - 07-03-2023','El día de hoy me logueé en el Classroom de la materia, así como en la página de encuentrotecnologico.com.ar.\r\nLeí el módulo 1 del DET.','2023-03-07'),(5303,250,'Comienzo Practicas Profesionalizantes MARTES 07 03 2023','Comenzamos a leer el pdf que nos envió el det para responder el cuestionario','2023-03-07'),(5304,266,'7/3/2023 - Introducción a la asignatura','Ingresamos al classroom y creamos nuestra cuenta en Encuentro Tecnológico. Conformamos el equipo y empezamos a ver la documentación y la guía de trabajo. Empezamos con las primeras paginas del modulo 1.','2023-03-07'),(5305,260,'Introduccion a DET y registro en encuentrotecnologico ','Nos unimos al classroom, y empezamos a trabajar con las actividades y ver los módulos.','2023-03-07'),(5306,252,'Clase 0 - Introduccion a la asignatura','Hoy tuvimos una introducción a lo que sería la planificación de la asignatura y nos creamos un perfil en la página de Encuentro Tecnológico. Por otro lado, ingresamos al classroom y con mi equipo de trabajo comenzamos a ver la primer guía de la materia junto con sus videos y pdfs','2023-03-07'),(5307,267,'7/3/2023','Ingresar al classroom, al encuentro tecnológico y empezar con el modulo 1','2023-03-07'),(5308,259,'Inicio 7/3 Practicas Profesionalizantes','El día de hoy, Nahuel Acosta nos dio la introducción a la materia, diciéndonos todo acerca de ella, cosas y proyectos de futuro, y mas tarde nos dio y dejo un total de 9 trabajos para hacer para introducirnos en el mundo de P.P\r\nDándonos hasta 2 semanas de estima y aproximación en que el cree que haremos estos trabajos.','2023-03-07'),(5309,255,'Comienzo Practicas Profesionalizantes MARTES 07 03 2023','En el día de la fecha, nos unimos al classroom con nuestras cuentas y trabajamos con el material proveído. Hicimos nuestras cuentas en la página de Encuentro Tecnológico para poder registrar nuestras bitácoras a lo largo del año, y se nos dio una introducción a lo que va a ser la materia. :)','2023-03-07'),(5310,268,'07-03-2023','Hoy comensamos con una charla introductoria sobrela la materia P.P. Al terminar la introduccion ingrese al classroom de la materia al ya estar adrento del classroom comense a ver el video &quot;Prácticas Profesionalizantes - Video 1&quot; del DET - Modulo 1 y al terminar comense con la tarea n°1. Despues me registre en la pajina &quot;Encuentro Tecnologico&quot; para asi poder enviar la primera bitagora.','2023-03-07'),(5311,256,'Modulo 1 y 0','Hoy leí los módulos 1 y 0.','2023-03-07'),(5312,254,'Modulo 1 y 0','Lei el modulo 1 y 0 para realizar la tarea 1. ','2023-03-07'),(5313,257,'7/3/2023','Hice el coso de habilidades blandas, vi los videos del classroom con algunos compañeros y respondimos en la cuenta de otro chico un cuestionario que tengo q hacer en mí cuenta   :)','2023-03-07'),(5314,264,'07/03','Realización del cuestionario sobre del documento &quot;Introducción a las Prácticas Profesionalizantes&quot;','2023-03-07'),(5315,261,'07/03/2023','Ingrese en classroom de Practicas Profesionales , me registre en la pagina Encuentro Tecnológico y hice el cuestionario del modulo 1 tarea 1','2023-03-07'),(5316,262,'Introduccion a la materia','Hoy al comienzo de la clase lo primero que hicimos fue charlar en que se basa el año escolar y los temas que vamos a ver, por otra parte tambien charlamos y comenzamos con la introduccion con el tema de Practicas Profesionalizantes; en base a eso luego ingresamos/logeamos en el claasroom de la misma para obtener informacion desde allí y tambien nos logeamos en esta plataforma con el CODE que el profesor nos paso.\r\nLuego de todo lo introductorio comenzamos con los cuestionarios de Practicas Profesionalizantes, el cual se dividen en varios trabajos, hoy solo realizamos el numero 1 y tambien se realizo el envio del mismo.','2023-03-07'),(5317,253,'Introducción a las Prácticas Profesionalizantes','Hoy dimos inicio a la asignatura de PP y con el profesor charlamos sobre qué se trata, los temas que vamos a ver, qué posibles caminos tenemos durante el transcurso del año, cuáles serían nuestras obligaciones y requisitos para aprobar y más cosas.\r\nNos dejó 9 cuestionarios para completar en todo el año y hoy debimos hacer el primero.','2023-03-07'),(5318,263,'Primera bitacora','La primera bitacora habra mas y serviran para hacer el proyecto','2023-03-07'),(5319,260,'8/3/2023 ','realizando las actividades de los modulos y creando CV','2023-03-08'),(5320,254,'8/03/2028 tarea 1 y tarea 2','Termine la tarea q1 y 2, y revise los siguientes módulos para la tarea 3','2023-03-08'),(5321,256,'08-03-23 Tareas','El dia de hoy realice las tareas 1,2 y casi termino la tarea 3.','2023-03-08'),(5322,250,'Dia 2 de Practicas Profesionalizantes Miercoles 08-03-2023 ','En este día concluimos con el modulo 1 y empezamos el modulo 2','2023-03-08'),(5323,266,'08-03-2023 - Avance importante en la guía de trabajos ','Hoy avance con la guia de la materia, termine con exito los contenidos y actividades del modulo 1,2,3 y 4. Quedo pendiente terminar el trabajo de 38 preguntas del modulo 4, la proxima clase la termino y sigo con las evaluaciones de diagnostico y la carga de mi CV y Linkedin. El trabajo lo hice en colaboracion y conjunto con Gonzalo Gimenez y Diego Sanchez trabajando a la par en diferentes compus para perfeccionar el trabajo.','2023-03-08'),(5324,257,'08/03/2023','Hice el formulario de habilidades, el examen de inglés e iniciamos el mapa conceptual, tenemos una idea clara de como vamos a hacer el proyecto y ya repartimos las ideas','2023-03-08'),(5325,268,'08-03-2023','Hoy comense con la tarea 2 del classroom que se basaba en hacer un mapa conseptual del lo que se trata la materia de Practricas Profesionalizantes despues de 3 hora termine y comense con la tarea 3 del modulo 2 donde respondi las preguntas sobre habilidades blandas y en donde hice y termine el CV (Curriculum vitae).','2023-03-08'),(5326,259,'Continuacion trabajos','El dia de hoy 8/3 continue los trabajops y llegue a hacer el 1 y 2 y estoy a punto de empezar el 3\r\n','2023-03-08'),(5327,264,'08/03 Tarea n°2 y 3','Desarrollo del mapa conceptual y el cuestionario de habilidades blandas','2023-03-08'),(5328,258,'08/3/2023','hoy hice el tp num 1 ademas del examen de ingles ,el formulario de habilidades ,aparte de repartir las tareas junto fenoglio y giupponi y hacer el mapa conceptual del proyecto en si','2023-03-08'),(5329,267,'8/3/2023','Terminé la tarea 1 y 2, en la 3 me falta el CV','2023-03-08'),(5330,270,'8/3/23','El día de hoy continuamos haciendo las tareas del classroom, esta vez comencé con la tarea 2 en donde realicé el mapa conceptual sobre practicas profesionalizantes  a base del apunte dado en el mismo. termine el mismo al finalizar la clase y lo entregué en su respectiva tarea.','2023-03-08'),(5331,252,'Clase 1 - Modulo 1, 2, 3 y 4','Hoy dimos comienzo a leer el material de cada módulo y completar las tareas que cada uno de los módulos tenia asignadas.\r\nLlegué a completar las primeras 4 tareas. Modulo 1, 2, y 3. También hice la mitad de la tarea 5, del módulo 4, que son 38 puntos a responder. Además hoy creamos nuestro CV y nuestro LinkedIn.','2023-03-08'),(5332,265,'08-03-2023','El día hoy empece a con la tarea N°2, que consiste en crear un mapa conceptual sobre las Practicas Profesionalizares, junto a Javier Rojas, y consecutivamente, luego de terminarlo, hice la tarea sobre el n°3, sobre &quot;Habilidades blandas&quot;, que constaba de responder una serie de preguntas a base de leer un cuetionario,','2023-03-08'),(5333,255,'Dia 2 de Practicas Profesionalizantes Miercoles 08-03-2023 ','Hoy día continuamos trabajando en las tareas que nos mandaron por classroom, yo avancé con el primer módulo.','2023-03-08'),(5334,271,'08-03-2023','En el día de la fecha comencé con la tarea 2, mapa conceptual, pero no lo finalice. También voy agregar que ayer, hice la tarea 1 pero no me pude hacer la cuenta, por eso no lo escribí en el día de ayer','2023-03-08'),(5335,263,'','','2023-03-08'),(5336,253,'Miércoles 08/03/2023 - Tarea N° 2 Mapa Conceptual','Hoy hicimos lo que es el mapa conceptual de los conceptos y características principales de Prácticas Profesionalizantes.','2023-03-08'),(5337,262,'08/03/2023','En el dia de hoy continuamos con los trabajos introductorios con Practicas Profesionalizantes y realizamos un mapa conceptual de informacion respecto a lo solicitado al trabajo numero 2, el cual fue publicado en el classroom y fue entrego por la misma plataforma. ','2023-03-08'),(5338,273,'Tarea 1','En el día de la fecha me dispuse a realizar distintas tareas que se encontraban en el sitio web de Classroom Google. Entre ellas, hice los distintos modulos del DET (del modulo 0 al 4), donde se pedía realizar 2 formularios distintos, un mapa conceptual, un Curriculum Vitae y crear un perfil de LinkedIn.\r\n\r\nCon respecto a los formularios, uno se trataba de responder información acerca de Practicas Profesionalizantes, y el otro se trataba de las Habilidades Blandas.\r\nEl mapa conceptual se trataba también acerca de las Practicas Profesionalizantes y su información, por lo que decidí organizar todo lo que puse en el formulario anterior y traté de hacerlo más resumido y poner lo vital nada más.\r\nEl Curriculum Vitae ya tenía uno pre-armado y solamente se los enseñé a los profesores para que me lo corrijan.\r\nMi perfil de LinkedIn ya está creado, por lo que me falta hacer los certificados que se encuentran a disposición.','2023-03-09'),(5339,272,'Registro en Habilidades Blandas - Computrabajos ','Registro de cuenta personal e ingreso y realización de exámenes laborales con información personal adicional.','2023-03-09'),(5340,279,'Modulo 1 DET y CompuTrabajo','Este dia lo hice fue poder entrar a classroom y poder registrarnos en encuentro tecnologico ademas de que nos explicaron de como iria esta materia y las tareas designadas de esta ademas de comenzar una carpeta de campo que hice hoy comentando lo que hice y que fue mayormente ver como iba tarea asignada y con cual mejor ir y las que pude completar el dia de hoy son los de Modelo 1 DET y el de la matricula de CompuTrabajo.','2023-03-09'),(5341,276,'Introduccion, Test de Competencias Laborales (Habilidades Blandas), curso linkedin, carpeta de campo','Hoy empezamos con la introducción a las Practicas Profesionalizantes. Estuve haciendo un análisis de los módulos empezando por los módulos 0 y 1, también estuve viendo los videos explicando sobre los temas de las practicas profesionales y sus concepto y su finalidad para aquellos alumnos que quieran realizar estos tipos de practicas. También hice el test de competencias laborales en CompuTrabajo, ingrese al curso de desarrollo de software que trata de los lenguajes, estructuras y demás relacionados con la computación, y a su vez empecé a implementar la Carpeta de Campo la cual iré completando en función a las tareas diarias que realizare mas adelante. ','2023-03-09'),(5342,275,'Primera clase ','Hoy lo que hice durante la clase fue unirme al classroom, unirme a encuentro tecnológico, hacer varios cuestionarios, el de ingles que me hicieron varias preguntas escritas en ingles para después hacer preguntar con diversos audios, no me fue muy bien pero al menos me saque algo de encima, luego hice un curso de LinkedIn de softwares fue medio largo pero interesante, supuestamente un solo curso basta pero quiero hacer mas y por ultimo un cuestionario en CompuTrabajo aparte de empezar la carpeta de campo y el primer cuestionario. ','2023-03-09'),(5343,274,'Modulo 1, registro en Linkedin y test de Competencias Laborales','El día de hoy realice las actividades del modulo 1, que era leer el archivo pdf y mirar los videos explicativos. Tambien me registré en Linkedin para anotarme en un curso y el test de Competencias Laborales.','2023-03-09'),(5344,278,'Clase N° 1   9/3/2023','En este día realice el formulario del modulo 1 de la tarea subida a Classroom. Además realice la tarea del modulo 2 , la cual consistía en armar un mapa conceptual. Por ultimo cree mi cuenta en LinkedIn.','2023-03-09'),(5345,280,'Bitacora','Entrega del primer cuestionario pautado en el classroom. \r\nEfectuada la inscripción a distintos cursos con certificados presentados a través de distintas páginas, los cuales son los siguientes:\r\n\r\nScram: clase pautada para el sábado 11 de marzo.\r\nAnálisis de proyectos: Horario libre\r\nAdministración de sistemas: Horario libre\r\nDesarrollo de software: Horario libre\r\n\r\nRealización de test de habilidades blandas en la página de CompuTrabajo\r\n\r\n','2023-03-09'),(5346,283,'Habilidades Blandas (computrabajo), carpeta de campo, curso de linkedin, modulo 1 ','El día de hoy comencé a ver los videos del modulo 1 para terminarlos después en casa. \r\ntermine las cuentas de Habilidades Blandas (CompuTrabajo), y luego me cree una cuenta en LinkedIn y comencé un curso.','2023-03-09'),(5347,284,'Tarea 1','Empecé leyendo &quot;Reglamentación de Practicas Profesionalizantes para informarme sobre todo , luego lei el material del módulo 1 &quot;Introducción a las Prácticas Profesionalizantes&quot; , y Luego realicé el Google form del mismo módulo.\r\nDespues comenze el modulo 2 , comenze leyendo el material , y luego de eso empecé el Google form pero no llegue a terminarlo.','2023-03-09'),(5348,293,'Carpeta de Campo y Tarea modulo 1','Inicie con la carpeta de campo de lo que se hiso en clase y lo que realice. También vi los 2 videos después inicie el modulo 1 y esta casi completo. Estuve en clase. ','2023-03-09'),(5349,286,'Modulo 1, Habilidades Blandas y Tarea N°1','Hoy tuvimos una charla de iniciacion con los profesores y empece a trabajar, comence leyendo el DET - Modulo 0 con los videos, luego el material, segui con el Modulo 1 y con eso puede responder el cuestianario de la Tarea 1, realizando el grafico de Habilidades Blandas, destacando en responsabilidad, autogestion y motivacion.','2023-03-09'),(5350,290,'Primera','Empece haciendo el test de inglés pero preferí arrancar con el módulo 1, previo a eso leí la Introducción a las prácticas profesionalizantes y vi los 2 videos que estaban en el archivo, luego comence el módulo 2 que todavía no termine y por ultimo revise las certificaciones que deje para mañana','2023-03-09'),(5351,291,'Explicación del profesor, Habilidades Blandas y Tarea 1','Al comienzo de la clase los profesores explicaron de que trataba la materia y lo que realizaremos en el transcurso del año, luego ingrese en la pagina de habilidades blandas &quot;candidato.ar.computrabajo.com&quot; y me registre en esta, luego realice el test de competencias laborales, realizarlo fue fácil pero no entendí algunas preguntas y le pregunte al profesor y a mi compañero a mi costado y después por ultimo realice la tarea 1 con ayuda del PDF y el profesor respecto a algunas preguntas.','2023-03-09'),(5352,282,'Analisis de tareas, Test de competencias laborales','Al principio de la jornada escuchamos atentamente al profesor explicar las bases de Practicas profesionalizantes, además nos relato brevemente sobre la posibilidad de conseguir practicas en empresas externas a la escuela. Posterior a la explicación del profesor, ingresé al classroom de las practicas y me registre en las paginas encuentrotecnologico.com.ar y en computrabajo.com.ar, dado que esto fue pedido como un requerimiento.\r\nAl entrar a la pagina computrabajo.com.ar, el profesor nos solicito realizar un test de competencias laborales, al completarlo analicé mis resultados, los descargue como un archivo PDF y lo envié por clasroom.','2023-03-09'),(5353,277,'Primera clase','Complete la parte escrita del test de inglés, no pude terminar la parte a audio porque las computadoras de la escuela no tienen auriculares o parlantes. También hice la cuenta de Computrabajo.\r\nLuego hice el módulo uno y dos, el primero eran unas preguntas las cuales no fueron muy complicadas, el segundo trataba de hacer un mapa conceptual de las Prácticas Profesionalizantes, fue algo más complicado ya que nunca antes había hecho uno, pero pude terminarlo al finalizar la clase.','2023-03-09'),(5354,281,'Dia 1','Hoy empecé a cursar practicas profesionalizantes, lo primero que hice fue realizar el test de ingles, luego de leer el modulo 0 procedi a hacer el forms del modulo 1. \r\nDespues de hacer todo esto empece el modulo 2 el cual se trataba de realizar un cuadro conceptual sobre PP.\r\n','2023-03-09'),(5355,288,'Clase n1','Las primeras horas de clase las dedique a leer los PDF adjuntados en el módulo número 0 y los respectivos videos en los cuales muestra como van a ser los primeros pasos a seguir y chicos que formaron aparte de prácticas profesionalizantes y su experiencia en misma.\r\nLuego leí el PDF del módulo 1 en el mismo están las respuestas para poder responder con nuestras palabras el formulario de Google que está en el mismo módulo.\r\nFinalizado el módulo 1 empecé a hacer el módulo 2 en el cual pide un mapa conceptual, el cual hice en diagrams net y adjunté finalizado el mismo al classroom módulo 2.','2023-03-09'),(5356,292,'','','2023-03-09'),(5357,287,'Carpeta De Campo, La Introducción, El curso en Linkedin y el Test de Analisis Financiero','09/03 = Comenze haciendo la carpeta de campo tambien con la introducción sobre las Practicas Profesionalizantes, estuve viendo los videos dando explicacion sobre los temas de las practicas profesionales y sus concepto con la finalidad para aquellos alumnos que quieran comenzar estos tipos de practicas, arranque haciendo el curso a travez de Linkedin sobre &quot;ANALISIS FINANCIERO&quot; , Ingrese al curso de Analisis Financiero  que explica los conceptos mas basicos sobre todo lo que tenga que ver de empresarial tambien practicas con herramiento de software entre otros muchos temas mas y por ultimo realize el Test de Competencias Laborales (%82 Responsabilidad, %75 Inteligencia Social y %71 De Liderazgo)\r\n\r\n','2023-03-09'),(5358,289,'Dia 1 Fecha 09/03','Lo primero que hice fue leer el módulo 0.\r\nDespués seguí con el primer módulo, leí el Introducción a las PP. Para luego seguir con la 1era tarea, la cual consiste en responder un formulario. \r\nEntre que hacia eso, complete el computrabajo (el perfil y trabajo). Terminando el formulario 1 y enviándolo, me fije en los cursos que ofrece Microsoft en conjunto de Linked In, leyendo las propuestas de todos, termine eligiendo el de Administración de sistemas ( ese que fue el que más me llamó la atención y mas me gusto) \r\nTambién me anote a lo de Scrum, tuve que pedir ayuda a Maxi, porque no sabia como anotarme, terminando anotando para el Viernes 17.\r\nEmpecé con el módulo 2, al principio no entendí como haría el cuadro conceptual, pero gracias a un compañero me explico como hacerlo y pude encontrarle la vuelta. Aún hoy no lo termino, pero ya tengo una idea mas clara para seguir mañana.\r\nMucha gracias por leer!!! Nos vemos mañana. \r\n\r\n','2023-03-09'),(5359,280,'Tareas: 3/4-Cursos','Se realizaron las siguientes tareas:\r\n\r\n\r\nCuestionario de Habilidades Blandas(Tarea N3)\r\nCurriculum Vitae\r\nPerfil de linkedin (Adjuntado al curriculum)\r\nInicio de certificación para administración de software.\r\nInicio de capacitación para para git y docker.\r\n','2023-03-10'),(5360,274,'Test de Inglés, Cuestionario N°1, Cuestionario N°2, Curriculum Vitae','En el día de hoy, lo que hice fue realizar el test de inglés, el cual consistía de una sección de Grammar, Reading y Listening,\r\ncon una duración total de 50 minutos. El resultado fue C2 Proficiency. Luego, lo que hice fue realizar el cuestionario N°1 que me había quedado\r\npendiente de la última clase. Me quedaban 4 preguntas que terminé en clase. Después, realicé el cuestionario N°2, el cual era sobre habilidades\r\nblandas. Lo terminé en alrededor de 20 minutos. Por último hice el Curriculum Vitae utilizando Canva. Dentro del mismo puse mis datos\r\npersonales, información acerca de quien soy, habilidades, experiencia laboral y trayectoria escolar.','2023-03-10'),(5361,273,'Bitacora 2','En el día de la fecha me dispuse a hacer el formulario número 5 del Módulo 5. Este otorgaba información sobre proyectos institucionales, cómo se deben realizar, ejemplos de estos y las distintas cosas que se debe tener en cuenta. Había preguntas tales como, qué es un perfil profesional, qué son las metas, los indicadores, qué cosas se deben tener en cuenta (higiene, la actividad ambiental, los costos de un proyecto, etc) y los objetivos de un proyecto. ','2023-03-10'),(5362,276,'Cuestionario Modulo 1 &quot;Introducción a las Prácticas  Profesionalizantes” - Curso LinkedIn - Test Ingles','Hoy seguí realizando las tareas pendientes. Para empezar, empecé a analizar los contenidos dentro del modulo 1 y a su vez logre realizar el cuestionario 1 de &quot;Introducción a las Practicas Profesionalizantes&quot;. Por otro lado, seguí realizando el curso de LinkedIn, viendo dichos contenidos de los capítulos 1, 2 y 3, y habiendo realizado los test de los mismos, aun me queda por terminar los demás capítulos. Des para finalizar empecé a realizar el test de ingles determinado en el classroom, no pudiendo terminar el mismo debido a que no dispuse de tanto tiempo, por lo tanto lo terminare a continuacion.\r\n','2023-03-10'),(5363,279,'Modelo 2 Det aun incompleto','El día de hoy se intento trabajar y avanzar intentando de comenzar con la tarea 2 de Modelo Det 2 pero por temas de que el calor era insufrible y que cada cierto tiempo se me congelaba la computadora haciendo que tuviera reiniciar la computadora siendo que me paso como 4 veces y el trabajo trataba de hacer un mapa conceptual de la guía de inicio de practicas profesionalizantes.','2023-03-10'),(5364,278,'Clase N° 2 10/03/2023','En el día de la fecha realice el cuestionario del modulo numero 3 que hablaba sobre las habilidades de un técnico fuera del ámbito formal , sino, como era como persona , si era sociable , creativo , si podía trabajar en equipo , entre otras cosas. Además cree mi Curriculum Vitae con la ayuda de la guía de Armado de CV. Al final del día comencé  con el cuestionario del Modulo 5 sobre la Introducción a los Proyectos  Institucionales de Prácticas  Profesionalizantes.\r\n','2023-03-10'),(5365,289,'Clase 2 10/03','Hola.\r\nHoy hice lo siguiente:\r\n-Termine la tarea 2 (el cuadro conceptual)\r\n-Leí los pdf´s del modulo 3.\r\n-Hice la carpeta de campo (del día de hoy)\r\nEso es todo por hoy, muchas gracias por leer. Hasta la semana siguiente!','2023-03-10'),(5366,286,'','Hoy, al llegar al aula, me senté en una computadora que estaba vacía para empezar a trabajar solo y sin distracciones. Empecé terminando el cuestionario de la Tarea N°1 que había dejado a medias el día anterior, completándolo con el archivo &quot;Introducción a las Practicas Profesionalizantes&quot;. Luego seguí con la Tarea N°2, que proponía hacer un cuadro conceptual que contenga los primeros conceptos de las Prácticas Profesionalizantes. Luego de completar esto, agregué a la carpeta de campo lo que hice hoy e inmediatamente creé una carpeta en Google Drive llamada &quot;Prácticas Profesionalizantes&quot; para insertar allí todos los archivos que tengan que ver con esta materia.','2023-03-10'),(5367,275,'Dia 2 tarea 2,3 y problemas técnicos ','Durante el  día de hoy 10/3/2023 quise hacer mas trabajos prácticos y demás cosas, aparte que esta mañana termine el cuestionario n°1 que empecé ayer antes de ingresar en el colegio, cuando prendí la computadora y me dispuse a hacer los cuestionarios 2 y 3 empezaron los problemas, el 2 me pedía hacer un mapa conceptual que debía hacerlo con el programa draw.io pero la se me tildaba mucho la compu cuando lo usaba asi que si bien lo empecé hoy lo terminare en casa en algun otro momento pero lo peor fue que cuando intente hacer el 3 se me congelo la compu y tuve que reiniciarla, mas tarde paso de nuevo y no puede terminarlo por este inconveniente sacando eso los puede avanzar bastante y cuando pueda los voy a terminar. ','2023-03-10'),(5368,296,'Bitácora 1','Hoy empeze analizar todos los módulos y realice la tarea n°1 ,la cuál deje casi por terminar del módulo 1 junto con toda la lectura del mismo y los vídeos','2023-03-10'),(5369,282,'Mapa conceptual (Tarea 2) y carpeta de campo','Al ingresar al salón de clases, como primeria medida, me encargue de confirmar que la bitácora del día 09/10/2023 se haya subido y estuviera correcta. Tras esto, como el día anterior, utilicé alrededor de 15 minutos de mi tiempo para analizar que tarea era mas convincente de hacer en este día, siendo que elegí realizar la tarea numero 2, la cual trata de realizar un mapa conceptual sobre el apunte &quot;Introducción a practicas profesionalizantes&quot;. Cuando finalicé dicho mapa conceptual, lo descargué a modo de JPG y lo subí a la tarea correspondiente en classroom.\r\nTras esto me encontré en un espacio de 1 hora en la cual decidí completar y perfeccionar la carpeta de campo de Practicas Profesionalizantes.','2023-03-10'),(5370,295,'DET Modulo 1 - Habilidades Blandas, Computrabajo','La tarea n° 1 la hice leyendo el PDF de Introducción a las Practicas Profesionalizantes y complete Google Form respondiendo las preguntas en base a ese PDF.\r\nPara lo de habilidades blandas, realice el test de competencias laborales, que fueron una serie de preguntas y me dio un resultado de distintos aspectos de mi personalidad.\r\n','2023-03-10'),(5371,294,'DET - Modulo 1 - Tarea n°1 / Habilidades Blandas - Computrabajo','Hoy realice la tare n°1 que era un cuestionario y me basé en la guía de Introducción a las PP, con eso pude completar todo el cuestionario. \r\nDespués complete el Test de Competencias Laborales en la página de CompuTrabajo.\r\nTambién comencé a realizar la carpeta de campo plasmando lo que hice en el día de hoy.\r\n','2023-03-10'),(5372,290,'Segunda','Hoy continúe con los módulos que deje ayer, el 2 todavia no lo termine, hice el test obligatorio de compu trabajo y también empecé el módulo 3, junto a ello comence a hacer el cv que pide en este módulo con la aplicación canva y me faltan cosas que agregar en el, quise ingresar a las certificaciones de Microsoft y LinkedIn pero no me dejó, mañana intentaré ingresar de vuelta ','2023-03-10'),(5373,285,'Tarea N°2','Hoy me dedique a hacer el Mapa Conceptual de la Segunda Tarea. \r\nTuve dificultades con la computadora que me agarre, ya que esta se trababa y se quedaba congelada.\r\nAdemás de eso, hoy pude hacer la cuenta de Computrabajo, todavía me falta hacer la evaluación que se pide con esta, pero muy probablemente la haga cuando llegue a mi casa.\r\nTodavia me falta ponerle algunas cosas al Mapa Conceptual, pero va bien, por así decirlo.','2023-03-10'),(5374,287,'Curso Linkedin - Cuestionario N1 - Curriculum','En la fecha de hoy, Comenze con el tema del curso sobre analisis empresarial y lo doy por finalizado dicho curso. Despues de haberlo terminado, arranque con el cuestionario numero 1 de &quot;Practicas Profesionalizantes&quot; y tambien lo doy por finalizado dicho cuestionario. Y por ultimo tambien arranque con el tema del curriculum, y lo doy por finalizado el curriculum','2023-03-10'),(5375,288,'Clase N2','La primera hora del dia de hoy, realicé el test obligatorio de computrabajo, donde mide tus aptitudes a la hora de trabajar en grupo e individuales, el cual consta de varias preguntas que hay que responderlas sinceramente y mediante nuestra experiencia en el colegio o exterior a éste. Luego empecé el módulo 3, leí los respectivos pdf que lo componían, y comencé el formulario de Google, el cual consta de 5 actividades a realizar, de las cuales 4 las hice, me quedó solo 1, la del CV. Empecé a realizar el CV correspondiente a mi persona, para la ultima actividad, no llegué a finalizarlo y planeo terminarlo en mi hogar.','2023-03-10'),(5376,277,'Segunda clase','Hoy terminé el test de computrabajo, el día anterior no me había dado cuenta pero además de registrarse había que hacer un cuestionario para saber tus fortalezas y aptitudes. También me hice una cuenta de Linkedin, aunque todavía no hice nada con eso.\r\n	Comencé con el módulo tres que cuenta con dos tareas, la primera fue un cuestionario el cual complete bastante rápido, aunque hubieron pequeños problemas de por medio, la computadora que estaba usando se congeló repetidas veces y la única forma de repararla era reiniciarla. El último punto del cuestionario era hacer un CV, que fue lo que se llevó gran parte de mi tiempo, intenté hacerlo bastante profesional e investigué más a fondo sobre las clases que tomé.\r\n	Dentro del módulo tres también estaba la tarea 4 qué era exactamente lo mismo que el último punto del cuestionario, hacer un CV, aunque esta vez me tenía que explicar en mayor medida sobre lo que podría brindarle a la empresa que me quiera contratar.\r\n	También tenía que ponerlo en mi Linkedin pero no pude hacerlo y planeo terminarlo en casa.','2023-03-10'),(5377,283,'pdf del modulo 1, formulario del modulo 1 y diagrama de la tarea 2','vi los videos de el dot para las practicas profesionalizantes, lei el pdf de sobre las pp y me asesore para responder las preguntas del formulario. \r\nel mismo pdf tuve que leerlo muchas veces y tambien al mismo tiempo con las preguntas para poder resolverlas.\r\ndi comienzo al diagrama y lo terminare en breve.  \r\n','2023-03-10'),(5378,281,'Dia 2','Lo primero que hice al llegar a clase fue empezar a realizar el test obligatorio de la pagina computrabajo, donde a traves de distintas preguntas iban midiendo tus cualidades sobre trabajar en grupo e individualmente. \r\nLuego comence el trabajo 1 del modulo 3 el cual es sobre las habilidades blandas, aunque me falto el ultimo punto el cual es sobre hacer un cv.','2023-03-10'),(5379,291,'Cuestionario de habilidades blandas','Este dia realize el cuestionario de habilidades blandas donde preguntaba de que entendia sobre eso, porque era importante desarrollarlas y que usos\r\nson pueden dar para la vida laboral, que habilidades blandas tenia y cuales deberia desarrollar mas, las habilidades blandas que tenia eran varias\r\nalgunas de ellas eran la resposabilidad, motivacion, inteligencia social y cooperacion, deberia desarrlor mejor las otras habilidades blandas tales como liderasgo, motivacion y arbitaje, también preguntaba cuatro habilidades que pondrán pondrán juego una entrevista esta pregunta la discutí con mi compañero de clase y los dos coincidimos en que esas cuatro eran las más importantes y por último tuve que armar un currículum vitae el cual me tomó alrededor de 20 minutos hacerlo y con eso concluye lo que realize en el día.','2023-03-10'),(5380,297,'15-03-23','Realice tarea 1 y 2 ','2023-03-15'),(5381,254,'15-03-2023','estoy por terminar la tarea 3, me falta completar el cv','2023-03-15'),(5382,250,'Dia 3 Practicas Profesionalizantes Miercoles 15/3/23','Hoy avanzamos en la evaluacion de computrabajo, nos registramos en un curso de SCRUM y se reanudo con la tarea numero 2','2023-03-15'),(5383,252,'Clase 2 - Módulos 4 y 5','Hoy continué haciendo la tarea N°5 del módulo 4 hasta terminarla. Una vez entregada la tarea 5, seguí con la 6 que se trataba de una red conceptual. Cómo última tarea del día, hice el formulario de la tarea N°7 del Módulo 5. Por otro lado, hoy me anoté en Scrum para el día viernes 24/03 tener un meet sobre el tema.','2023-03-15'),(5384,257,'15/3/2023','Hoy hice la tarea 1,2, 3,4 y parte de la 5, más algunos formularios del classroom ','2023-03-15'),(5385,251,'Primeros Trabajos - 15/03/2023','El día de hoy realicé las tareas n°1 y n°2 y dejé la n°3 a casi terminar.\r\nAproveché también para realizar el test de habilidades blandas y subí el PDF al Classroom.\r\nTambién me inscribí en el curso de SCRUM y el curso de Administración de Sistemas de Linkedin-Microsoft. ','2023-03-15'),(5386,264,'15/03  Habilidades Blandas - Computrabajo','Realización y etrega del Test de Competencias Laborales de Computrabajo','2023-03-15'),(5387,258,'15/3/2023','Hoy hice las tareas 3,4 y una parte de la 5 del classroom','2023-03-15'),(5388,256,'15-03-23','El dia de hoy termine las tareas 3 y 4, y tambien comence la tarea 5.','2023-03-15'),(5389,270,'15/03/23','El día de hoy realicé la tarea 3 del classroom en donde respondí las preguntas de esta e hice el curriculum que pide, el cual luego entregué nuevamente en la tarea 4, junto con mi perfil de LinkedIn. Al terminar estas tareas comencé con la tarea 5 aunque no llegué a terminarla y me quedaron algunos puntos pendientes.','2023-03-15'),(5390,266,'15-03-2023  Avance con la guia ','En el dia de hoy realice un gran avance, terminando el modulo completo del 4 y 5. Entregue ambos trabajos, ademas me anote y organice para hacer las certificaciones de Scrum e ingles','2023-03-15'),(5391,263,'15/3/23','Hoy estuve haciendo las tareas en el classroom entre esas tareas estaban la tarea 5 y la 3, mapa conceptual de la tarea 2 pendiente y curriculum pendiente','2023-03-15'),(5392,268,'15/03/23','Hoy termine la tarea N°4 que trataba sobre hacer tu CV y agregar tu url de Linkedin Con Baqueiro y Diego Rojas hicimos la tarea N°5 atte: Lucas Javier Rojas Liambo.','2023-03-15'),(5393,259,'Miercoles 15/3','Con Nicolas Nieto avanzamos e hicimos el trabajo 2, ya luego yo en mi casa haré las Certificaciones Obligatorias y avanzare con los trabajos principales para no atrasarme','2023-03-15'),(5394,261,'15/03/2023','Termine la tarea N° 4 modulo 3 y la tarea N°5 modulo 4','2023-03-15'),(5395,267,'15/03/2023','Finalicé la tarea 3 y 4 y estoy por terminar la 5 (Falta una pregunta)','2023-03-15'),(5396,260,'15/3/2023','Terminando CV y tareas de la 5 a la 9','2023-03-15'),(5397,255,'Dia 3 Practicas Profesionalizantes Miercoles 15/3/23','Hoy me registre en un curso de SCRUM e hice el test de computrabajo :3','2023-03-15'),(5398,253,'Miércoles 08/03/2023 - Tarea N° 3 y N° 4 y comienzo de la Tarea N° 5','Hoy entregué las tareas N° 3 y 4 y comencé con la tarea N° 5. ','2023-03-15'),(5399,273,'Bitacora 3','En el día de la fecha me dispuse a realizar el cuestionario número 5 del módulo 4 que se encuentra en el Classroom de google. Luego de eso, me inscribí en el curso de Scrum que se realizará el 24 de marzo. Posteriormente, estuve revisando los distintos cursos que ofrece Microsoft y todavía no sé por cuál decantarme. Estoy entre Análisis de Datos y Desarrollo de Sistemas.\r\n','2023-03-16'),(5400,286,'Habilidades Blandas y Competencias Profesionales, Certificado SCRUM, Cuestionario Guía Empresa Simulada','Abrí el pdf de la carpeta de campo así puedo documentar cada cosa que voy haciendo al instante, abrí el classroom y entré a la clase “Practicas Profesionalizantes”, seguí con la tarea 3 del Módulo 3 y la complete en un instante leyendo el pdf “Guía de Habilidades Blandas” en “Material” dentro de “DET - Módulo 3”. Luego fui al apartado “Certificaciones OBLIGATORIAS” y entré a la tarea “Certificado SCRUM”.  Más tarde, empecé a hacer el cuestionario de la tarea n°5 utilizando la información proporcionada por el material del Módulo 4.','2023-03-16'),(5401,274,'Mapa conceptual, Currículum Vitae, Certificado SCRUM, Cuestionario de la guía de Empresa Simulada','En el día de hoy lo que hice fue realizar el mapa conceptual de los conceptos básicos de las Prácticas Profesionalizantes, los cuales se encontraban en un pdf que previamente había leído. Una vez que terminé esto, procedí a hacer mi Curriculum Vitae. Para esto, lo que hice fue añadir mis habilidades, conocimientos, formación académica, experiencia laboral y certificados. Luego me anoté a un curso para obtener un certificado SCRUM. Por último, hice unas preguntas del cuestionario de la guía de Empresa Simulada.\r\n','2023-03-16'),(5402,281,'Dia 3','Hoy realicé el tp 3 del modulo 3 que era un formulario sobre las habilidades blandas y competencias profesionales. Además entregué el tp 4 que se trataba de hacer y entregar mi curriculum vitae.\r\nY también llegue a completar más de la mitad del tp 5 del modulo 4 que se trata sobre la guía de empresa simulada.\r\n','2023-03-16'),(5403,278,'Clase N°3  16/03/23','En el dia de hoy , comence a escribir mi carpeta de campo , en la cual plasme lo que realice las ulitmas 3 clases.Ademas me inscribi en el curso de Scrum de Linkedin.Tambien comence con el cuestionario del modulo N° 4.Por ultimo modifique mi curriculum vitae ya que estaba desprolijo.','2023-03-16'),(5404,283,'2ER y 3ER modulo completado: mapa conceptual, formulario, curriculum y perfil de linkedin','el dia de hoy di por finalizado todo el modulo 2 y 3. Para empezar con esta tarea abri\r\ndiagrams.net y el pdf de  para seguir con el desarrollo del mapa conceptual en el cual fui \r\ndividiendo por diferentes partes como: &quot;actores, caracteristicas, su deficion, su propósito\r\netc&quot;. Luego de terminar todo el Mapa Conceptual segui formulario de habilidades blandas en el\r\nque tuve que leer dos pdf, los cuales son: &quot;Guia de Habilidad&quot; y &quot;Guia de Armado de un Curriculum Vitae&quot;\r\ny el video que esta con los pdf. \r\nLuego segui con la ultima tarea del modulo 3, donde se pedia realizar un curriculum vitae con el pdf anterior\r\ny luego crear un perfil de linkedin. Este tambien debia ser agregado al curriculum vitae.','2023-03-16'),(5405,296,'Bitácora 2','Hoy decidí que iba a realizar los cuestionarios primero así que empeze con la tarea 3 de habilidades blandas,la termine y empeze con la tarea 7 de introducción a los proyectos la cuál esta por la mitad de hacer ','2023-03-16'),(5406,293,'Modulo 2 Modulo 4 modulo 5 y modificacion del carpeta campo','hoy termine el modlo 2 que lo tenia incompleto al igual que el 4 y por ultimo termine el modulo 5 ','2023-03-16'),(5407,272,'Módulos y LinkedIn ','Hoy realicé los primeros 2 módulos e inicie el 3, creando mapa conceptual, respondiendo formularios y fortaleciendo mi currículum con nueva información. También aproveche la jornada y me creé una cuenta de LinkedIn, ingresando mi información y completando los primeros pasos de la página.','2023-03-16'),(5408,298,'clase 1','Leí el modulo 0, 1 y 2. Realicé la tarea 1 y comencé la tarea 2, luego hice el test de competencia laboral. ','2023-03-16'),(5409,280,'bitacora','Obtencion de certificado de desarrollo de software en linkedin (Manejando mayormente JS)\r\nInicio de curso de administracion de sistemas en linkedin.\r\n\r\nDia con dolor de cabeza','2023-03-16'),(5410,275,'dia 3 ','hoy termine las tareas 2 y 3 (las quería terminar en mi casa pero no tenia luz) en general fue bastante fácil, también empece con la tarea n°4 y también vi por encima la 5 ','2023-03-16'),(5411,282,'Tarea 7 Modulo 5 y tarea 5 modulo 4','A lo largo de la jornada realizamos junto a mi compañero de banco la totalidad de la tarea numero 7, relacionada al PDF &quot;Introducción a los proyectos&quot;, lo cual nos llevo gran parte de la clase. Además realizamos la tarea numero 5, relacionada al PDF &quot;Guía de empresa simulada&quot;, la cual avanzamos hasta la pregunta numero 11 pero no fue totalmente finalizada, por lo cual esperamos finalizar para el día de mañana por la tarde durante el horario correspondiente a practicas profesionalizantes. Como ultimo punto, revisamos la información relacionada al curso de mañana para recibir nuestro certificado de Scrum, el cual comenzará a las 12:00 y finalizará a las 17:00.','2023-03-16'),(5412,295,'Tarea nro 2 - Tarea nro 3 - Tarea nro 4','Hoy realicé el mapa conceptual de la Introducción a la PP, también realicé un cuestionario sobre las habilidades blandas y el cuarto trabajo práctico era hacer el Curriculum Vitae y adjuntarle el link de linkedIn.','2023-03-16'),(5413,295,'Tarea nro 2 - Tarea nro 3 - Tarea nro 4','Hoy realicé el mapa conceptual de la Introducción a la PP, también realicé un cuestionario sobre las habilidades blandas y el cuarto trabajo práctico era hacer el Curriculum Vitae y adjuntarle el link de linkedIn.','2023-03-16'),(5414,294,'Tarea n°2 - Tarea n°3 - Tarea n°4','En el día de hoy realice 3 tareas distintas, la primera hice un mapa conceptual explicando la introducción de las PP, la segunda tarea fue realizar un cuestionario sobre las habilidades blandas y el trabajo, y la ultima tarea fue armar mi Currículum Vitae y agregar un link de linkedIn. ','2023-03-16'),(5415,292,'tp 7introduccion a los proyectos- tp 5','en el día realice el trabajo 7 del modulo 5 introducción a los proyectos junto a mi compañero de escritorio, este trabajo nos llevo la mayor gran parte del día por no decir todo vimos y nos organizamos sobre como participar en la clase de scrum para recibir nuestro certificado.\r\ntambién el trabajo 5 modulo 4 de guía de empresas simulada, también con mi compañero, no llegamos a terminar todo el trabajo y planeamos terminarlo en el día de mañana ','2023-03-16'),(5416,287,'Cuestionario Modelu 3 y Curriculum ','En el día de hoy, empecé a realizar el 2do cuestionario de &quot;Habilidades Blandas y Competencias Profesionales&quot;. Terminando. A su vez empecé a realizar el CV (Currículo Vitae) con toda mi información personal, mis estudios y nivel de lenguaje ingles, conocimientos, títulos, etc.','2023-03-16'),(5417,287,'Cuestionario Modulo 3, Curriculum Vitae, Curso LinkedIn','El dia de hoy empeza a realizar el 2do cuestionario hasta el momento de &quot;Habilidades Blandas y Competencias  Profesionales&quot;, habiendo finalizado el mismo. A su vez empecé a realizar el CV (Curriculum Vitae) con toda mi información personal, mis estudios y nivel de lenguaje ingles, conocimientos, títulos, etc. Por otro lado seguí completando los demás capítulos del curso de LinkedIn, habiendo terminado la primer parte del curso, teniendo pendiente la 2da parte y el examen final para obtener el certificado. ','2023-03-16'),(5418,279,'Tarea 2 3 4 hechos','Hoy lo que pude hacer fue la tarea 2 3 y 4 que constaban como la 2 de hacer un mapa conceptual, de la 3 trataba de un cuestionario donde había una pregunta que no sabía responderlo pero gracias al profe lo pude contestar que era la parte de CV vitae y también cuenta haber hecho el 4 que era mandar un cv vitae','2023-03-16'),(5419,286,'Curriculum Vitae','Empecé abriendo el classroom de Prácticas Profesionalizantes y dí un vistazo a lo que tengo pendiente, empecé haciendo el Curriculum Vitae, que ya tenía una parte creada en la página de Canva. En la parte de la creación del cv se me complicó un poco porque no sabía que poner, por lo tanto, empecé a buscar consejos en internet de cómo hacer y cómo no hacer un curriculum vitae, gracias a varias páginas que visité pude informarme un poco más aunque no me sirvieron de mucho, entonces decidí recurrir a algunos compañeros de clase que ya lo habían hecho. Al final agregué más información e hice un cambio en la paleta de colores para que se vea más atractivo.','2023-03-17'),(5420,278,'Clase N° 4 17/03/23','En el día de la fecha continúe con la tarea N° 5 y también seguí armando mi carpeta de campo.','2023-03-17'),(5421,292,'certificado scrum','En el día de hoy me uní al curso para la certificación de scrum study, este arrancó a las 12 del mediodía con una duración de 7 horas terminando a las 17:30 el cuál por obvias razones de tiempo no pude estar presente en la mayor parte de la duración del mismo, en el horario de prácticas profesionalizantes realice con el asesoramiento de un compañero el examen final para obtener de una vez el certificado. Hacer este examen me la mayor parte de la hora de prácticas y después me tocó asesorar a mi a mi compañero. Luego de que ambos hayamos recibido nuestro correspondiente certificado.\r\n','2023-03-17'),(5422,274,'Cuestionario Guía Empresa Simulada, Detalles del Currículum Vitae','El día de hoy lo que hice fue realizar las preguntas que me habían quedado pendientes de la tarea N°5, la cual consistía en un cuestionario sobre la guía de Empresa Simulada. Concretamente contesté las preguntas 4, 5, 6, 7, 8 y 9. \r\nTambién lo que hice fue agregar algunos detalles a mi Currículum Vitae. Precisamente le agregué la sección de cursos realizados y añadí algunos conocimientos extra.','2023-03-17'),(5423,281,'4 dia','Dia 4 Hoy terminé de hacer la mitad del tp 5 que me faltaba y lo entregué. Iba a empezar a hacer el tp 6 pero no llegué con el tiempo ya que es un día mas corto comparado al de ayer','2023-03-17'),(5424,277,'Cuarta clase','Hoy estuve todo el día con el módulo cuatro, este tiene dos tareas, la primera era un cuestionario de treinta y ocho preguntas las cuales si bien no fueron complicadas, si fue bastante tardío, tuve que buscar información por internet ya que el material que me dieron no me pareció del todo completo, asi que tuve que complementar mis respuestas con lo que google me ofrecía. La segunda tarea fue mucho más corta, aunque también tuvo su complejidad, tan solo era elaborar el diseño de una empresa simulada. \r\nEn el poco rato que me quedaba logré terminar el módulo uno y dos, que me habían quedado dos preguntas sueltas.\r\n','2023-03-17'),(5425,272,'Linkeln y Curriculum','El día de hoy complete el modulo 3 por completo, finalizando así mi curriculum y la creación de mi cuenta de Linkeln.','2023-03-17'),(5426,283,'modulo 5 y  pdf ','El dia de hoy empece el modulo 5 y empece a leer el pdf de &quot;INTRODUCCIÓN A LOS PROYECTOS INSTITUCIONALES DE PRÁCTICAS PROFESIONALIZANTES&quot; para luego contestar el formulario que es la tarea numero 7.','2023-03-17'),(5427,293,'Avance de tareas ','avance con los certificados obligatorios y revise los demás módulos para ver si estaban mal','2023-03-17'),(5428,298,'clase 2','Hoy seguí con la tarea numero 2 y empecé con el modulo 3.','2023-03-17'),(5429,279,'tarea 5 (aun incompleta)','Este dia estuve trabajando con la tarea 5 del modulo 4 DET y trata sobre de una guia de una empresa simulada en lo cual empeze a responder aunque igual es bastante largo y me era dificil encontrar todas las respuestas de las preguntas quedando hasta el 10 pero despues de eso todo salio bien el dia de hoy.','2023-03-17'),(5430,289,'Clase 4 17/03','Seguí leyendo el modulo 4, y empecé a responder las respuestas del tp 5.\r\nEso fue todo por hoy, Muchas Gracias!.\r\n(olvide hacer el de ayer, piedad)\r\n','2023-03-17'),(5431,288,'Clase N4','Hoy implementé mi tiempo en terminar mi curriculum y entregarlo correctamente mediante el google forms correspondiente. Luego creé mi cuenta de linkedin, la subí junto a mi curriculum en el apartado Modulo 3 - Tarea 4, entré al curso de certificación microsoft linkedin y me vi gran parte del material adjuntado al mismo','2023-03-17'),(5432,275,'Día 4','El día de hoy me saque algunas tareas que no había terminado de hacer por ejemplo: me anote en el SCRUM, di por terminadas las tareas N°1 y N°3, termine y envié la tarea N°2, también empece con la tarea N°4 y 5','2023-03-17'),(5433,285,'Tarea N°3','El día de hoy me dedique a realizar el modulo 3, Test de ingles y de Competencia laborales.\r\nNo hubieron tantas dificultades el dia de hoy, fue tranquilo y pude trabajar a gusto.\r\nSe me complico un poco con el test de Ingles, mis auriculares dejaban de andar de a ratos y eso fue una de las razones por las que saque una nota algo baja.\r\nEl test de Competencias Laborales no fue algo tan dificil, no me costo mas de 5 mins.\r\nY el modulo 3, esta terminado y completo. Debo de arreglar un poco el CV, pero ahi va.','2023-03-17'),(5434,294,'Tarea n°7 Introducción a los Proyectos  Institucionales de Prácticas  Profesionalizantes','Hoy estuve haciendo el cuestionario de la introducción a los proyectos institucionales, no lo logré terminar debido a un inconveniente que tuve que fue la falta de tiempo y el desacomodo de la información.','2023-03-17'),(5435,295,'Tarea nro5 - Cuestionario Guía de empresas Simulada','Hoy empecé a realizar el cuestionario de “Guia de empresa simulada” pero al ser muy extenso no lo pude terminar y lo voy a continuar haciendo la próxima clase.','2023-03-17'),(5436,282,'Certificacion Scrum (ScrumStudy)','Durante la totalidad de la clase me empeñe en terminar de visualizar los videos del curso el cual habilita una certificación de saberes básicos de scrum. Dicha certificación solicitaba realizar un cuestionario de 40 preguntas, de las cuales era necesario realizar 30 respuestas acertadas, lo cual logre y por ende recibí mi certificado, el cual subí a classroom en la tarea correspondiente de certificaciones obligatorias.','2023-03-17'),(5437,290,'Tercera','Hoy lo que hice fue terminar la tarea 3, continue haciendo el currículum, empece también con uno de los diagramas, me anoté en la certificación del scrum y comencé el módulo 5 que después en casa pienso terminar, también retome las distintas tareas que anteriormente nombre para ya terminar todo junto.','2023-03-17'),(5438,300,'Curriculum Habilidades blandas','En el dia de hoy relice el test de esta tarea y me registre a la pagina Computrabajo y Linkedin','2023-03-17'),(5439,276,'Modulo 3 Tarea 3 y 4 - Curso LinkedIn - CV - Test Ingles ','El día de hoy estuve trabajando en base al modulo 3, habiendo terminado el CV y también habiendo completado el cuestionario de dicho modulo, por lo cual doy por terminado el modulo 3. Por otro lado termine la Parte 1 y 2 del curso de LinkedIn, teniendo pendiente el examen final para obtener el certificado. Por otro lado logre terminar el Test de Ingles, habiendo terminado el mismo y habiendo obtenido un promedio total de 71 y Nivel C2. ','2023-03-17'),(5440,287,'Modulo 3 Tarea 3 y 4 - CV - Test Ingles ','En el dia de hoy, empeze con el Test De Ingles y lo doy finalizado ya que obtuve su certificado con un promedio de &quot;C1&quot; (%70) Y tambien entregado por classroom. Y doy por finalizado la entrega del Curriculum por classroom.  ','2023-03-17'),(5441,267,'21/3/2023','Finalizada la tarea 5','2023-03-21'),(5442,254,'21/03/2023','Entregue la tarea 3 y 4. Estoy por la mitad de la 5','2023-03-21'),(5443,256,'21/03/23','Hoy adelante la tarea 5\r\n','2023-03-21'),(5444,297,'21/03/23','termine tarea 3, 4 y empece tarea 5 ','2023-03-21'),(5445,251,'Continuamos con las tareas - 21/3/2023','En el fin de semana y en el día de hoy realicé el test de inglés, la tareas 3, 4, 7 e inicié la tarea n°5.\r\nTambién completé los cursos de Microsoft Linkedin y obtuve el certificado del mismo.','2023-03-21'),(5446,263,'21/3/23','Hoy terminamos la mayoria de tareas incluyendo hacer lo del scrum osea anotarme, lo de computrabajo, tarea 5 y 6','2023-03-21'),(5447,268,'21/3/2023','Hoy terminamos con la ultima pregunta que nos faltaba la n° 24 de la tarea n°5 y decidimos la idea del Proyecto que sera un Robot Sumo en ARDUINO y al final con los integrantes del grupo empesgamos la tarea n°6.','2023-03-21'),(5448,250,'DIa 4 Martes 21/3/2023','Hoy finalice las tareas 2 y 3 y arme mi cv','2023-03-21'),(5449,258,'21/3/2023','hoy hicicmos el tp num 6 y el tp num 7 aparte de terminar todos los formularios menos el del video (que es el tp num 9) ademas de anotarme al curso de scrum','2023-03-21'),(5450,260,'21/03/23','Empezamos la creación del AnteProyecto, con las funciones y viabilidad del proyecto ','2023-03-21'),(5451,257,'21/3/23','Hoy termine los formularios que me quedaban, menos el último, el del video, además me anoté al scrum, agregue al linkedin la licencia de la prueba efset de ingles','2023-03-21'),(5452,255,'DIa 4 Martes 21/3/2023','Hoy hice la tarea 2 y 3 y arme mi cv','2023-03-21'),(5453,259,'Martes 21/3','Hoy avanzamos con las tareas y con el grupo formado por Lucio Micheli, Sofia Marmol, Nicolas Nieto y yo presentamos a Nahuel Acosta nuestro proyecto de Practicas para todo el año que sera una Recetario.','2023-03-21'),(5454,271,'21-03-2023','En el dia de hoy hice el examen de ingles y junto a mis compañeros Enzo Romaniello, Luis Meza y Emilio Pereira, estamos pensando que proyecto hacer','2023-03-21'),(5455,261,'21/03/2023','Termine la tarea 5 y empece la tarea 6, y estuvimos discutiendo que proyecto vamos a ser.\r\nEl proyecto sera hacer un &quot;ROBOT SUMO&quot;.','2023-03-21'),(5456,266,'21/3 Comienzo de Proyecto Documentación ','En esta clase ya empezamos con el ante proyecto del proyecto. Empezamos con todos los objetivos, Descripciones de problematicas y el proyecto. Tambien con las funcionalidades entre otras cosas. Avanzamos bastante en el corto tiempo que teníamos. ','2023-03-21'),(5457,265,'21-03-2023','Terminamos la tarea 5, empecé la tarea 6, y estuvimos discutiendo con el grupo cuál seria es tema q elegiriamos para el proyecto.','2023-03-21'),(5458,269,'21/03','Realice tps enviados por classroom ','2023-03-21'),(5459,253,'21/03/2023 - T.P. N° 5 Guía de Empresa Simulada','Hoy nos tocó terminar el T.P. N° 5 y como nos sobró tiempo, comenzamos a pensar más en profundidad el proyecto que vamos a estar desarrollando durante el año.','2023-03-21'),(5460,270,'21/03/23','El día de hoy avancé en la tarea 5 del classroom y termine casi todos los puntos, solo me faltó el 24 ya que debíamos pensar con nuestro grupo el proyecto que queremos realizar, el resto del tiempo lo dedicamos a esto y ya tenemos una idea principal sobre un posible videojuego.','2023-03-21'),(5461,264,'22/03','','2023-03-22'),(5462,250,'DIa 5 Miercoles 22/3/2023','Hoy presentamos el proyecto','2023-03-22'),(5463,256,'22/03/23','Elegimos junto a mis compañeras Kiara Chunga y Kiara Romero el proyecto que vamos a realizar','2023-03-22'),(5464,263,'22/3/23','Hoy estuvimos haciendo las tareas restantes que nos faltaba para iniciar el proyecto, tambien cambiamos varias vece las ideas de como va a ser el proyecto en si desde escape rooms hasta una tematica mas de terror. Al final nos pusimos de acuerdo en combinar parte de esas ideas para el juego final ya que la idea original no iba a ser aceptada. Y termine la tarea 7, falta la 9 y 4\r\n\r\n','2023-03-22'),(5465,258,'22/03/2023','hoy entrege la tarea num 6 y estubimos hablando entre nosotros ya que tubiemos que reacher las bases del juego ya que no aceptaron la idea y despues de un tiempo de estar pensando se nos ocurrio otra idea hacer un especie de helloneightbord ','2023-03-22'),(5466,255,'DIa 5 Miercoles 22/3/2023','Hoy presentamos el proyeto','2023-03-22'),(5467,268,'22-03-2023','Hoy comense y termine la tarea n°6 que tretaba de hacer un Diagrama de alguna empresa yo la que hice fue la de Bimbo despues termine la tarea N°7 que tretaba sobre los prosesos para hacer un proyecto y al final me hice una cuenta en Comutrabajo y termine el Test.En el final con Ezequiel Baqueiro vimos los detalles y reglamentos sobre La Liga Nacional de Robotica. atte Javier Rojas Liambo ','2023-03-22'),(5468,297,'22/03/23','Definimos nuestro proyecto junto a mis compañeras y realice hasta la pregunta 20 del tp 5','2023-03-22'),(5469,252,'Clase 4 - 22/03/2023','Hoy con el equipo seguimos con la documentación la cual completamos el FODA, el Diagrama de Caso de Uso (DCU) y comenzamos a planificar las tareas del proyecto con el GANTT','2023-03-22'),(5470,267,'22/3/2023','Finalizadas las tareas 6 y 7. Investigación sobre las reglas de la Liga Nacional de Robotica en el sector de robots Sumos.','2023-03-22'),(5471,271,'22/03/23','En el día de la fecha, realice las tareas 3 y 4. Además de empezar a pensar ideas sobre nuestro proyecto de un juego junto a mis compañeros de grupo: Emilio Pereira, Enzo Romanniello y Luis Meza','2023-03-22'),(5472,254,'22/03/2023','Me faltan 3 puntos de la tarea 5 y elegimos sobre que va a ser nuestro proyecto','2023-03-22'),(5473,251,'Finalización de la Tarea 5 y Propuesta de Proyecto - 22/3/2023','El día de hoy terminé el cuestionario de la tarea n°5.\r\nCon mis compañeros de grupo: Nahuel Moreno, Sofía Mármol y Lucio Micheli; presentamos nuestro proyecto a los profesores.\r\nEl proyecto es un recetario que se encuentra en la web y cómo aplicación móvil, llamada Recetonomicón.\r\nLa semana que viene empezaremos con el desarrollo del proyecto.','2023-03-22'),(5474,261,'22/03/2023','Termine la tarea N°6 modulo 4 y N°7 modulo 5','2023-03-22'),(5475,257,'22/3/2023','Hoy entregué la tarea 4, la tarea 7 y complete 3 preguntas de la 8, hicimos un poco del video y nos pusimos de acuerdo para la idea del proyecto que vamos a realizar a lo largo del año, mí grupo va a ser con Sebastián giupponi, Luciano budman y agustin Barcia ','2023-03-22'),(5476,259,'Miercoles 22/3 ','El día de hoy, con mi grupo hemos presentado nuestro proyecto de una App y pagina Web de recetas de cocina de todo tipo, sea pastas, postres, bebidas, etc. El cual tuvo la aprobación de los profes, y nos pusimos luego de acuerdo quien haría cada cosa.\r\nPor mi parte individual, e hecho los trabajos 3 y 4 e hice el test de Ingles pero decidí rehacerlo al no estar de acuerdo con la nota en cuestión.','2023-03-22'),(5477,265,'22/03/2023','Hoy hice la tarea n°6 del módulo 4, que consistía en hacer un organigrama, y la tarea n°7 del módulo 5, en el que se debía responder una serie de preguntas de un cuestionario.\r\nTambién nos llamaron, a los 4 integrantes del grupo, para  que les expliquemos que fue lo que pensamos para hacer de proyecto.','2023-03-22'),(5478,270,'22/03/23','El día de hoy con mi grupo terminamos de idear nuestro proyecto sobre un juego tipo trivia en donde el jugador deberá ir atravesando puertas para finalizarlo, todo esto descrito en la tarea 5 del classroom la cual terminé y entregué hoy.    ','2023-03-22'),(5479,266,'22/3/2023 - Avance en la documentacion y en el DCU','Hoy junto con el equipo estuvimos realizando lo que quedaba de la documentación como el FODA y algunas funcionalidades. También dedicamos gran parte del día a la realización del DCU (Diagrama de Casos de Uso). Tuvimos varias trabas con esto pero pudimos terminar la primera versión de este. Por ultimo empece a escribir las primeras tareas del GANTT, en la aplicacion de Project libre.','2023-03-22'),(5480,260,'22/03/23','Terminamos la creacion del GANTT, El AnteProyecto  y el FODA, integramos a un compañero mas al grupo y aclaramos mas dudas en cuanto a tecnologías para desarrollar la aplicacion.','2023-03-22'),(5481,274,'Tarea  N°7 y Proyecto Integrador','En el dia de hoy, lo que hice fue seguir respondiendo las preguntas de la tarea N°7, el cual trataba sobre la introducción a los proyectos institucionales de prácticas profesionales. Respondí entre cinco y diez preguntas, aunque todavía me quedan un par por responder. \r\nLuego, lo que hicimos junto al grupo fue pensar en distintos proyectos para finalmente elegir uno. Pensamos en cinco proyectos distintos y terminamos optando por un mapa de seguridad de la ciudad de CABA.\r\n','2023-03-23'),(5482,277,'Quinta clase','Hoy me centré en la búsqueda de información para la creación de nuestro proyecto en grupo, originalmente teníamos planeado crear un robot mediante arduino, pero esto no cuenta con una problemática clara y tuvimos que cambiarlo. Estuvimos preguntando a distintas personas del salón si tenían alguna idea pero fue en vano, buscamos por internet problemáticas típicas del día a día pero tampoco funcionó.\r\n	Eventualmente simplemente se nos vino a la mente las IA, se nos ocurrió hacer una Inteligencia Artificial que cree música completamente original, aunque aún no sabemos si seremos capaces de hacerlo. Ya que estábamos con las IA, fuimos a hablar con una para que nos de ideas, la IA en cuestión era ChatGPT. Nos guardamos tres ideas, un contabilizador de tus finanzas, como deudas y sueldos, un robot controlado mediante comandos de voz y la IA que genera música original.\r\nAún no sabemos cual vamos a elegir y tenemos que hablarlo con mayor profundidad, pero por ahora tenemos un par de ideas. ','2023-03-23'),(5483,273,'Bitacora N°4','En el día de la fecha me dispuse a realizar los trabajos que me faltan. Empecé a hacer la Tarea N°6 y con mi grupo, que se terminaron de confirmar los miembros de este hoy (Luca Patiño, Geronimo Estigarribia, Tobias Alegre, Amir Gomez y yo) empezamos a pensar posibles proyectos a realizar. Entre estos, estábamos pensando en realizar un sistema que sirva para cancelar el ruido alrededor, algo como una especie de cortina de goma eva que se active al escuchar sonidos fuertes alrededor del área de una habitación. También pensamos en páginas con información de distintas cosas, como por ejemplo colectivos, o información sobre donde podrían encontrarse distintas cosas útiles. Por último, también pensamos en modificar y mejorar la página del profesor Olaso, &quot;encuentrotecnologico&quot;, que necesita una actualización urgente.','2023-03-23'),(5484,281,'Dia 5','Hoy dediqué todo mi tiempo en la busqueda de información para nuestro proyecto en grupo, originalmente iba a ser un robot sirviente que calentase el agua hecho con arduino, pero no cuenta como una necesidad asi que tuvimos que cambiar el rumbo de este. Buscamos por internet problematicas cotidianas pero no fue una buena idea ya que no salian mas que problemas globales tales como el racismo y desigualdas. Despues charlamos sobre IAS, y el resultado de esta charla fue tener una conversación con la ia chatGPT  que nos dió varias ideas y pero terminamos filtrando  dos:  Un robot controlado por voz y una pagina que te ayuda a controlar tus finanzas.','2023-03-23'),(5485,286,'Trabajo N°7, Proyecto de la materia','Hoy abrí el trabajo n°7 que ya tenía parte de este hecho, y casi lo termino. Luego de haber completado la gran mayoría del formulario. Con el equipo de la materia terminamos eligiendo como proyecto por una aplicación de seguridad que pueda descargar la gente e informar sobre robos y todo tipo de incidentes.','2023-03-23'),(5486,276,'Curso LinkedIn + Certificado - Modulo 4 Guia Empresa Simulada Cuestionario - Cuestionario Modulo 5 Tarea 7 Introducción a los Proyectos  Institucionales de Prácticas  Profesionalizantes - Modulo 2 Tarea 2 Mapa Conceptual','Desde la ultima bitácora, estuve realizando diversas tareas. Para empezar termine con el curso de LinkedIn, habiendo finalizado también con el\r\nexamen final del curso y habiendo obtenido mi certificado de LinkedIn. Por otro lado, empecé a realizar el cuestionario de &quot;Empresa Simulada&quot; del Modulo 4, analizando el material dado pude realizarlo y darlo por terminado. Por otro lado, en base al modulo 5 realice la tarea 7, el &quot;Introducción a los Proyectos  Institucionales de Prácticas  Profesionalizantes&quot;, habiendo analizado el material pude completar el cuestionario. Y para finalizar, empecé a analizar los contenidos del Modulo 2 y realice la tarea 2 &quot;Mapa Conceptual de las PP&quot;. ','2023-03-23'),(5487,278,'Clase N° 5 23/03/023','En el dia de hoy finalice con el formulario de la tarea n°7 , ademas continue con el cuestionario de la tarea N° 5. Por ultimo conformamos el equipo para realizar el proyect este año , los integrantes somos :\r\nAlegre Tobias\r\nEstigarribia Geronimo\r\nGomez Amir\r\nPatiño Luca \r\nLescano Pedro\r\n\r\nEl scrum master es pedro.\r\n\r\nEl proyecto que tenemos en mente realiar es reversionar la pagina &quot;encuentrotecnogolico.com.ar&quot; para que los proximos sextos años puedan tener una mejor experiencia en ella y en las PP.\r\n','2023-03-23'),(5488,292,'eleccion de proyecto- trabajo practico 5, 6,7 y8','En el día de hoy 23 de marzo al llegar a la clase de prácticas profesionalizantes comience a realizar 1 de las 3 actividades restantes de el trabajo práctico empresa simulada con mi compañero como ya lo habiamos organizado el día anterior, luego de hacerla seguimos con el trabajo 6 que consistía en hacer el organigrama de una empresa, esto nos llevó desde que terminamos el primer punto hasta el receso.\r\nContinuamos con los 2 puntos que nos faltaban de la actividad 5. Luego con el grupo que se formó la clase anterior se decidió cuál iba a ser el proyecto que vamos a realizar y terminé el último punto del trabajo número 5. \r\npor ultimo entregué el trabajo practico 8 anteriormente hecho con mi compañero pero no lo había entregado','2023-03-23'),(5489,288,'Clase n5','Hoy realizamos la búsqueda y creación de ideas para nuestro proyecto grupal que diseñaremos a lo largo del año, teníamos planeado un robot Arduino el cual tenía como función, despertador, parlante, calculadora, entre otras más cosas. Pero luego de una charla nos pusimos de acuerdo en 3 ideas un robot controlado a voz, un contador virtual, una página que te soluciona problemas sean de informática o motrices acerca de la mecánica de los vehículos. También hicimos el cuadro del módulo número 5 tarea 8.','2023-03-23'),(5490,293,'Grupo 5','hoy disidimos hacer un a proyecto que tenga que ver con el GPS con adruino.','2023-03-23'),(5491,283,'modulo 5 tp 7','\r\nEl dia de hoy termine el pdf que contenia las respuestas para responder el formulario del Trabajo Practico 7.\r\nTambien charlamos sobre algunas preguntas y dudas que teniamos acerca del formulario. \r\nDecimos que integrantes iban a formar nuestro grupo de Practicas Profesionalizantes, los cuales esta conformado por Alan Gonzalez, \r\nNicolas Ezequiel Mangialavore, Thiago Hernan Arroyo, Lucan Bulacio Novick y por mi (Ciro Andre Lobotrico). Tambien se me eligio como Scrum Master que\r\ntiene como trabajo ayudar y guiar en todos los problemas que pueda llegar a tener el grupo.','2023-03-23'),(5492,285,'Día 4 PP','¿Que logre hacer hoy?\r\n\r\nEl día de hoy logré terminar el Modulo N°2 y el N°3.\r\nLogre hacer el CV, los 2 cuestionarios hechos en Form y entregarlos.\r\nSiento que se me complico un poco hacer el Modulo N°2, porque no tenía idea de como hacer un Mapa, hice lo mejor que pude guiándome y lo entregué.\r\n\r\n¿En que se me complico?\r\n\r\nTuve algunas dificultades trabajando con este, la computadora se congelaba de a ratos, me costaba un poco entender el texto y no sabia como hacer un mapa.\r\nAl estar algunas semanas trabajando en este, el dia de hoy pude terminarlo y entregarlo sin problemas\r\n\r\n\r\n¿Qué estuve investigando?\r\n\r\nSeguí investigando como hacer el mapa y en que guiarme para hacerlo, pero ya terminé.\r\nInvestigue el cómo sacar algunas certificaciones que me falta, como el SCRUM, va a ser medio complicado, por lo que oí es una conferencia de 7 horas.\r\nAhora mismo tengo que investigar cómo empezar con el siguiente módulo… O tal vez saltarmelo y empezar a investigar para algún otro, Estoy pensando en adelantarme un poco y hacer el 7, ya para tener terminado los cuestionarios hechos en form.\r\n','2023-03-23'),(5493,279,'Tarea 5 (aún incompleto pero avanzado)','El día de hoy lo que hice mayormente fue avanzar en el tema de la tarea 5 donde tuve ayuda de un compañero donde estuvimos resolviendo y buscando las respuestas además de poder avanzar mas en el cuestionario de 38 preguntas aunque algunas no sabemos que poner o era muy complicado hacerlo.','2023-03-23'),(5494,280,'Organizacion de grupos y proyecto','En el dia de hoy se formo el grupo 1 de practicas compuesto por 5 personas\r\n\r\nEl proyecto estara enfocado mayormente al hogar permitiendo que cualquier persona que necesite una receta pueda buscarla segunlos ingredientes q tenga. Agilizando el proceso de busqueda y este podra ser utilizado por voz con una forma o varias ya que sera representado como un asistente fisico portable','2023-03-23'),(5495,298,'Clase 3','Terminé con la tarea 2 y comenzamos a pensar el proyecto que vamos a hacer, pensamos en un robot pero ahora estamos teniendo en cuenta la idea que nos propuso el profe :)','2023-03-23'),(5496,275,'Dia 5','este día se baso únicamente en hacer la tarea mas larga esta ahora la cual era del modulo 5, es un cuestionario con 38 preguntas las cuales tengo que hacer usando una guía, hasta ahora hice hasta la pregunta n°18 y la seguiré haciendo por el resto de días y también forme un grupo para el proyecto que tendremos que hacer. ','2023-03-23'),(5497,284,'Bitacora 23/3/23','Hoy finalicé el módulo 4 &quot;Guia de empresa simulada&quot; , y pude arrancar el modulo 5  ','2023-03-23'),(5498,287,'Certificado - Modulo 4 Guia Empresa Simulada Cuestionario - Cuestionario Modulo 5 &quot;tarea 7 Introducción a los Proyectos  Institucionales de Prácticas Profesionalizantes&quot; - Modulo 2 &quot;Tarea 2 Mapa Conceptual&quot;','Desde la ultima bitácora, entregue el certificado del curso linkedin. Por otro lado, empece a realizar el cuestionario de &quot;Empresa Simulada&quot; del Modulo 4, analizando el material dado pude realizarlo y darlo por termianado.Por otro lado, en base al modulo 5 realice la tarea 7, el &quot;Introducción a los Proyectos  Institucionales de Prácticas  Profesionalizantes&quot;, \r\nhabiendo analizado el material pude completar el cuestionario. Y para finalizar, empece a analizar losm contenidos del Modulo 2 y realice la tarea 2 &quot;Mapa Conceptual de las PP&quot;. \r\n','2023-03-23'),(5503,290,'Cuarta','Hoy continúe con el módulo 4 y 5 que había dejado la clase anterior, termine el cuestionario, pero deje para después el el formulario, revise el módulo 6 para ver si podía adelantarlo pero no tuve tiempo y lo deje para cuando llegue a mi casa','2023-03-23'),(5499,272,'Módulo 4 y formación de grupo del proyecto','El día de hoy empecé el módulo 4 completando un poco del cuestionario sacando la información del PDF proporcionado por el profesor y formamos el grupo de proyecto, el cuál está conformado por Alan González, Nicolás Mangialavore, Lucan Bulacio, Ciro Lobotrico y yo. El proyecto hay que elegirlo todavía.','2023-03-23'),(5500,289,'Clase 5','Hoy además de seguir con el cuestionario 7, con mi grupo discutimos sobre que proyecto haríamos. Al principio decidimos hacer un baymax, pero no era viable, entonces decidimos hacer una lluvia de ideas pero no servía nada. Entonces tomamos la idea del profesor de hacer una app de recetas de cocina según los ingredientes y la época que tenga y decir los pasos en voz alta. \r\nEso es todo por hoy..\r\nMuchas gracias!','2023-03-23'),(5501,282,'Tareas 5 y 6 + Eleccion de proyecto','Durante la tarde de esta jornada, junto a mi compañero de banco finalizamos la tarea numero 5, en la cual nos quedaban pendientes 3 preguntas de largo contenido, las cual como dije anteriormente terminamos.\r\nAdemas de esto utilizamos parte del tiempo para realizar la tarea numero 6 en su totalidad.\r\nComo ultima actividad presentamos distintos proyectos para que los profesores de practicas profesionalizantes, de los 6 proyectos prensentados, se nos fue aprobado el proyecto que consistia en un mapa intercativo acerca de delitos e incidentes en la Ciudad Autonoma de Buenos Aires','2023-03-23'),(5502,294,'Tarea n°5 - Cuestionario Guia de Empresa Simulada  - Elección de proyecto en grupo','En el día de hoy realice la tarea n°5, en la que fui avanzando con el tema de las preguntas; no lo llegue a terminar por falta de tiempo y exceso de preguntas. Además estuvimos eligiendo en grupo que proyecto vamos a hacer en el resto del año','2023-03-23'),(5504,295,'Tarea nro 7 - Introducción a los proyectos de Prácticas Profesionalizantes','Hoy realice la tarea n7 en la que respondí todas las preguntas pedidas en el cuestionario. Después al final del día tuvimos la elección del proyecto en grupo que vamos a recorrer todo el año. Elegimos un asistente funcional a voz que te ayude a cocinar dictándote recetas y pasos con los recursos que tengas a mano.','2023-03-23'),(5505,291,'Modulo 5 Tp 7','El día de hoy termine el pdf que contenía las respuestas para responder el formulario del Trabajo Practico 7. También charlamos sobre algunas preguntas y dudas que teníamos acerca del formulario. Decimos que integrantes iban a formar nuestro grupo de Practicas Profesionalizantes, los cuales esta conformado por Alan Gonzalez, Ciro Lobotrico, Thiago Hernan Arroyo, Lucan Bulacio Novick y por mi. También se eligió el Scrum Master que es Ciro Lobotrico que tiene como trabajo ayudar y guiar en todos los problemas que pueda llegar a tener el grupo.\r\n','2023-03-23'),(5506,264,'28/03','Finalizacion de tareas pendientes ','2023-03-28'),(5507,258,'28/03/2023','hoy hicimos los 2 ultimos tps de la guia apartir de mañana empezaremos con el proyecto en si ','2023-03-28'),(5508,254,'28/03/23','Hoy realice un boceto de la vista de la pagina ','2023-03-28'),(5509,250,'DIa 6 Martes 28/3/2023','Terminamos las tareas para empezar con el proyecto','2023-03-28'),(5510,252,'Clase 5 - Inicio Carpeta de Campo','El día de hoy, Martes 28/03/2023, comencé a completar mi Carpeta de Campo individual y con el equipo del proyecto comenzamos el Diagrama de Entidad Relación','2023-03-28'),(5511,256,'28/03/23','Estuve haciendo la tarea 7\r\n','2023-03-28'),(5512,257,'28/3/2023','Hoy finalizamos la edición del video de la tarea 9, casi finalizamos la tarea 8 y mañana vamos a empezar a diagramar y a asignar tareas','2023-03-28'),(5513,271,'28/3/2023','En el dia de la fecha, arranque con un par de las preguntas de deportes para el proyecto tecnologico que tengo con mis compañeros Luis Meza, Emilio Pereira y Enzo Romaniello. Tambien los ayude con la historia del juego en la documentacion. Y pensar el nombre del juego de nuestro proyecto tecnologico, denominado &quot;The Fourth Lost&quot;.','2023-03-28'),(5514,269,'Clase 5 inicio de carpeta de campo ','Hoy martes 28/03/2023 realicé los tos que me faltaban del classroom, hice una revisión de mis conocimientos de HTML y css, comencé mi carpeta de campo individual.\r\nCon el grupo empezamos el DER y realizamos el vídeo de presentación del grupo ','2023-03-28'),(5515,261,'28/03/2023','Hoy hice la portada del proyecto &quot;Proyecto Robot-Sumo&quot;','2023-03-28'),(5516,267,'28/03/2023','Hoy hice la portada del proyecto','2023-03-28'),(5517,267,'28/03/2023','Hoy hice la portada del proyecto','2023-03-28'),(5518,267,'28/03/2023','Hoy hice la portada del proyecto!','2023-03-28'),(5519,251,'Finalización de los TPs - 28/3/2023','El día de hoy terminamos junto a mi equipo los Trabajos Prácticos restantes (6, 8 y 9) para poder empezar con el proyecto mañana.','2023-03-28'),(5520,267,'28/03/2023','Hoy hice la portada del proyecto!\r\netet','2023-03-28'),(5521,263,'28/03/23','Hoy hicimos los guiones del video para luego hacer el video y editarlo. Fin de informe','2023-03-28'),(5522,301,'28/03/23','Hoy realizamos el guion del video de la tarea 9 junto con su edicion y yo personalmente realize las tareas 2 y 3 ','2023-03-28'),(5523,259,'Martes 28/3 Nahuel Moreno','Durante el fin de semana hasta hoy hice el certificado en Scrum y rehice la evaluacion de Ingles y tambien la entregue, todo por Classroom.','2023-03-28'),(5524,265,'28-03-2023','Hoy hice la tarea n°8 y organizamos, en base al proyecto, que es lo que le tocaba a hacer cada uno.\r\nYo tuve que hacer el FODA junto a otra compañero.','2023-03-28'),(5525,253,'Martes 28/03/2023 - Planteamiento final del videojuego','Hoy lo que hicimos fue terminar de dejar en claro cuales serán las funcionalidades del videojuego y los caminos que este tendrá. Además, comenzamos lo que es la documentación y los diagramas del mismo.','2023-03-28'),(5526,260,'28/03/23','Empezamos a completar la carpeta de caampo, y empezamos el DER y creamos el video de presentación del proyecto.','2023-03-28'),(5527,269,'Clase 5 inicio de carpeta de campo ','Hoy martes 28/03/2023 realicé los tos que me faltaban del classroom, hice una revisión de mis conocimientos de HTML y css, comencé mi carpeta de campo individual.\r\nCon el grupo empezamos el DER y realizamos el vídeo de presentación del grupo ','2023-03-28'),(5528,268,'28/03/2023','Hoy con mi grupo nos organizamos sobre que hariamos el dia de hoy y el de mañana y hise un repositorio Git para asi tener un Canva donde marcaremos las actividades que estan en proseso y finalizadas. Con Bolla terminamos el foda.','2023-03-28'),(5529,266,'28/03/2023 - finalizacion de documentacion e inicio del DER','Hoy finalizamos la documentación, avanzamos con la carpeta de campo, hicimos el vídeo de los tps previos al proyecto y empezamos el Diagrama de entidad Relación. Incluimos al grupo al nuevo integrante ciro y lo pusimos al dia con todo ','2023-03-28'),(5530,270,'28/3/23','El día de hoy comenzamos con la documentación del proyecto, terminando de discutir el funcionamiento del videojuego en el &quot;daily&quot; con el grupo y, explicándolo en la propia documentación, el resto de tareas del classroom las terminé de entregar hace unos días.','2023-03-28'),(5531,262,'28/03/2023','Hoy comenzamos con el planteamiento de como comenzar el camino del proyecto y la documentación del mismo. También realizamos nuestro primer dayli del grupo, donde creamos el nombre del videojuegoque vamos a realizar y cerrando detalles que vamos a realizar el dia de hoy y mañana. ','2023-03-28'),(5532,254,'29/03/23','Termine el boceto de la pagina y ayer termine todos los tp','2023-03-29'),(5533,251,'Inicio del Proyecto - 29/3/2023','El día de hoy empezamos el proyecto Recetonomicón con mi grupo. Hicimos una reunión Daily en la que definimos los roles y que haríamos esta semana. Terminamos el FODA, el Gantt, empezamos con el KanBan y con el DER.','2023-03-29'),(5534,263,'29/3/23','Hoy hice el gantt, la tarea 8 y parte del diagrama de entidad relacion pero aun esta en desarrollo','2023-03-29'),(5535,250,'Dia 7 Miercoles 29/3/2023','Hoy empezamos a diseñar los diagramas y la planificacion necesaria para comenzar el proyecto.','2023-03-29'),(5536,257,'29/3/2023','hoy nos sacamos los formularios de encima, hicimos el gantt e iniciamos el diagrama de caso de uso y el der, si todo sale bien el miercoles que viene empezamos a modelar','2023-03-29'),(5537,255,'Dia 7 Miercoles 29/3/2023','Hoy empezamos a diseñar los diagramas y la planificación necesaria para comenzar el proyecto.','2023-03-29'),(5538,266,'Clase 29-03 Creacion del proyecto React','Hoy terminamos la parte del Diagrama de Entidad Relacion y empezamos con el desarrollo de la app. Subimos todo al repositorio y pudimos crear el proyecto con React Next. ','2023-03-29'),(5539,267,'29/03/23','Hicimos el diagrama de caso de uso, el primer boceto del proyecto a escala y con las medidas y peso de sus componentes.','2023-03-29'),(5540,256,'29/03/23','Entregue la tarea 7 e hice bocetos sobre el proyecto','2023-03-29'),(5541,269,'Finalización del DER y repaso html','Hoy miércoles 29/03 terminamos el DER.\r\nTambién continúe revisando mis conocimientos de html y css, y comencé a practicar con ejemplos prácticos para poder aplicarlos al proyecto.','2023-03-29'),(5542,260,'29/03/23','Creamos el proyecto y lo subimos al repositorio de GitHub y terminamos el DER, tambien fui completando mas la carpeta de campo','2023-03-29'),(5543,253,'Míercoles 29/03/2023 - Diagramas','Hoy mi grupo y yo llegamos a hacer los diagramas GANTT, DER, Caso de Uso y el FODA.\r\nYo aporté a los diagramas DER y GANTT.','2023-03-29'),(5544,268,'29/03/2023','Hola buenos tardes hoy despues de tener la charla del grupo con Bolla comenzamos con el Gantt despues de que no pudieramos guardalo en el Project de windows lo pasamos todo al ProjectLibre tambien el el repositorio de Git hagrege las actividades que tendremos que hacer y altermina con todo tubimos la charpara para ya tener una idea de que haremos el martes.','2023-03-29'),(5545,252,'Clase 6 - DER y Práctica de JS','El día de hoy terminamos el DER del proyecto de PP y yo estuve practicando código de javascript','2023-03-29'),(5546,271,'29/03/23','En el día de hoy junto a mis compañeros Enzo Romanniello, Emilio Pereira, Valentín Bentos y Luis Meza, cambiamos el nombre de juego a &quot;The Five Lost&quot;. Además hicimos los diagramas y colabore en los diagramas Gantt y DER.','2023-03-29'),(5547,265,'29-03-2023','Hoy comencé con la carpeta de campo e hice el diagrama de GANTT junto a mi compañero ','2023-03-29'),(5548,265,'29-03-2023','Hoy comencé con la carpeta de campo e hice el diagrama de GANTT junto a mi compañero ','2023-03-29'),(5549,261,'29/03/2023','Hoy Hicimos el diagrama de Caso de Uso y el boceto del Proyecto, midiendo sus medidas y sus pesos de los componentes  ','2023-03-29'),(5550,270,'29/03/23','El día de hoy nos organizamos en el daily para hacer los diagramas del proyecto, pudimos finalizar los diagramas:caso de uso, DER, Foda y gantt.\r\nYo en especifico realice el Gantt y DER. Ademas ahora el juego se modifico ya que tenemos un nuevo integrante.','2023-03-29'),(5551,259,'Iniciacion de Proyecto 29/03','Hoy arrancamos con la organizacion del proyecto, haciendo el FODA, Gantt y dividiendonos las tareas y realizacion de cada una de ellas, por mi parte yo hare la parte de la base de datos en sql, y ayude en el Foda y Gantt mismo','2023-03-29'),(5552,302,'29/03/2023','Hoy ingresé a un nuevo grupo en el cual se va a realizar un videojuego y me inteorizé dentro del mismo,también participe de mi primer dayli en el grupo y realice los detalles acordados(análisis foda y diagrama de caso de uso).','2023-03-29'),(5553,262,'29/03/2023','El dia de hoy se nos incorporo un nuevo compañero (Valentin) al grupo y le explicamos en que se basa nuestro proyecto/videojuego y tambien lo interiozamos con lo aprendido y PP. Luego realizamos otro dayli diario y planteamos las cosas que se realizarian el dia de hoy y fueron realizar el Diagrama GANTT, DER, Caso de Uso y analisis FODA. Valen y yo realizamos el FODA y Diagrama Caso de Uso. Emilio, Diego, Enzo realizaron el DER y GANTT','2023-03-29'),(5554,286,'Inicio de Proyecto','Empezamos teniendo una reunión del grupo y una charla sobre los objetivos del proyecto, al terminar, pensamos en el diseño de la página, encontramos un color amarillo como el de la página de Buenos Aires y más tarde buscamos cómo hacer un mapa interactivo, encontramos un código abierto de un mapa de CABA y empezamos a ver que era cada cosa desde el apartado de inspeccionar de google. Luego buscamos las líneas de código anteriormente mencionadas y empezamos a borrar lo que no nos servía. Más tarde, con la ayuda del profesor, pudimos conseguir lo que queríamos, tener el mapa solo, sin ninguna función.','2023-03-30'),(5555,299,'Proyecto','Hoy decidimos el proyecto con el grupo y finalizamos los formularios ','2023-03-30'),(5556,283,'modulo 4 y 5, finalización ','El dia de hoy cambie alguinas respuestas y termine el Formulario del trabajo practico 7\r\nCreamos un grupo por Whatsapp donde podremos charlar, discutir y sobre lo que hicimos y \r\nnos falta hacer en clase. El mismo grupo esta conformado por Nicolas Ezequiel Mangialavore,\r\nThiago Hernan Arroyo, Alan Gonzalez, Lucan Bulacio Novick y por mi (Ciro Andre Lobotrico). \r\nAhora con el grupo esperaremos que nos llamen para charlar sobre nuestro proyecto. \r\nEmpece a leer el pdf del modulo 4 para poder concluir con los trabajo practico 5 y el 6 \r\nSegui el trabajo practico n6 donde tenia que hacer organigrama de una empresa simulada.\r\nEmpecé el trabajo practico numero 5 y luego termine el trabajo practico numero 6. ','2023-03-30'),(5557,272,'Modulos y selección de proyecto anual','El día de la fecha continue con la finalización de mis modulos pendientes y, junto a mi grupo, determinamos el proyecto a seguir hasta final de año, una tienda digital de juguetes infantiles, hecha para la tia de Ciro Lobotrico, uno de los integrantes del grupo, ésta será nuestra clienta en este año.','2023-03-30'),(5558,285,'Dia 5 en PP','¿Que logre hacer hoy?\r\n\r\n\r\nHoy logré terminar La tarea 7, Me uní al grupo que me corresponde y ando haciendo la tarea 5\r\n\r\n\r\n¿En que se me complico?\r\n\r\nMe costó un poco la parte de la investigación que se necesitaba hacer para el cuestionario, no entendía del todo el documento que me mandaron así que decidí buscar algunas cosas por internet.\r\nY no hay tantos problemas, pude completar el cuestionario y ando enfocados en los que debo por el momento.\r\n\r\n\r\n¿Qué estuve investigando?\r\n\r\nInvestigue en Google y por el Classroom para ver como hacer estos cuestionarios\r\nNecesito algo de ayuda adicional de mis compañeros, ya que se me medio dificulto hacer esto solo.\r\nY me llevó unas 2 semanas completar el TP5, el 7 me llevo masomenos una semana y media, pero ya están los 2.\r\n','2023-03-30'),(5559,293,'Comienzo de Proyecto','Hoy día decidimos el proyecto y avanzamos con los diagramas y la propuesta del cliente también hablamos del diseño de la página web que será de compra de ropa','2023-03-30'),(5560,274,'Prototipado, API de mapa, edición del código del mapa','El día de hoy ya iniciamos con el proyecto. Lo primero que hicimos fue hacer una reunión con los integrantes del grupo. Luego decidimos que utilizaríamos un fondo blanco con detalles amarillos como página principal. \r\nDespués buscamos alternativas a Google Maps, para de esta manera tener una API para utilizar en el proyecto.\r\nUna vez que la teníamos, decidimos borrar todos los íconos de los lugares que aparecían en el mapa, como estaciones de servicio, bicicletas, estacionamientos, etc.\r\nA pesar de haber borrado todos los archivos, no pudimos borrar estas funciones de manera definitiva. Con ayuda del profesor, pudimos borrar los botones de estas funciones y el mapa quedó limpio.','2023-03-30'),(5561,280,'Proyecto chicken assistant','Investigacion de del ahrdware y software necesario para la realizacion del proyecto\r\n\r\nInicio de la documentacion necesaria\r\n-Analisis Foda\r\n-Programacion en c++\r\n-Trello\r\n-Git\r\n','2023-03-30'),(5562,276,'Certificado Scrum - Diseño Empresa Simulada - Propuesta de Proyecto - Video - Inicializacion de Proyecto PP','Desde la ultima bitácora, pude realizar las siguientes tareas: \r\n- Para empezar me inscribí en un curso de Scrum, en el cual me asignaron material en PDF, una clase de 5 horas y luego de realizar el examen final, pude obtener mi Certificado Scrum.\r\n- Por otro lado, Seguí analizando los módulos, esta vez el modulo 4, en el cual realice la tarea 6, Diseño de Empresa Simulada, el cual consistía en realizar una clase de organigrama pensando en su función, estructura, actores y roles.\r\n- Por otro lado, analice el Modulo 5, Tarea 8, y realice la Propuesta de Proyecto Tecnológico, analizando la situación de la escuela, elegí la inseguridad como tema, ya que el establecimiento habría recibido bastantes inconvenientes al respecto.\r\n- Por otro lado, analice el modulo 6, Tarea 9, y analizando los materiales, se me asigno realizar un video personal sobre mi, mis interés, que conocimientos pondría en practica, etc. el cual realice sin problemas\r\n- Y para finalizar la bitácora, este mismo día empezamos a armar el grupo de trabajo para poder empezar los dichos Proyectos de las PP, habiendo terminado por decidir en tomar el emprendimiento de venta de ropa de mi compañera de grupo, y realizar una pagina web funcional de la misma, la cual tenga funcionalidades similares a la de una pagina web de una marca oficial. Estando en proceso al respecto, por el momento se realizaron ciertos diagramas y los Requerimientos del cliente.\r\n','2023-03-30'),(5563,295,'Investigacion sobre el proyecto - Analisis FODA','En el dia de hoy realizamos una investigación profunda sobre nuestro proyecto planteado e investigamos los componentes y los precios que cuestan cada uno. Hicimos la daily y el analisis FODA con sus amenazas, fortalezas, debilidades, oportunidades(que no terminamos).','2023-03-30'),(5564,275,'30-30-23 Comienzo del Proyecto ','En el día de hoy empezamos con el proyecto que haremos a lo largo del año, el tema que decidimos realizar fue hacer una pagina de compra/venta de ropa, empezamos haciendo las pautas para el trabajo, viendo que lenguaje de programación usaremos y por mi parte empecé a hacer los diagramas FODA, GANT y camino critico ','2023-03-30'),(5565,278,'Clase N 6 30/03/2023','En el día de la fecha finalice el cuestionario de la tarea N 5. Además finalmente decidimos qué proyecto vamos a realizar a lo largo de este año . Este consiste en una pagina web y una aplicación para controlar el inventario de una inmobilaria. La aplicación servirá para agregar un nuevo producto al inventario  y generar un código QR para pegarlo en el mueble y así poder escanearlo mas fácil .','2023-03-30'),(5566,291,'Selección de proyecto y tareas','El día de hoy relize algunos de los módulos que tenia pendiente y algunos cuestionarios, también charlamos con el profesor hacerca del proyecto que realizaremos el día de hoy, después de eso investigamos hacerca de nuestro proyecto que sería una página web de juguetes.','2023-03-30'),(5567,273,'Clase 6','En el día de la fecha me dispuse el diagrama que me faltaba acerca de una empresa simulada, que debía constar de distintas cosas, tales como su estructura, su función, sus actores, etc. También me puse a pensar acerca de un proyecto tecnológico y resolvimos con los demás integrantes de nuestro equipo a realizar una aplicación movil y una página web que sirva para tener total control del inventario de muebles de una pequeña o mediana empresa. El mismo deberá contar con una función de escaneo QR y de esta forma se podrá subir toda la información a la página.','2023-03-30'),(5568,287,'Certificado Scrum - Diseño Empresa Simulada - Propuesta de Proyecto - Inicializacion de Proyecto PP','Desde la ultima bitácora, pude realizar las siguientes tareas: \r\n- Para empezar me inscribí en un curso de Scrum, en el cual me asignaron material en PDF y luego de realizar el examen final, pude obtener mi Certificado Scrum.\r\n- Por otro lado, Seguí analizando los módulos, esta vez el modulo 4, en el cual realice la tarea 6, Diseño de Empresa Simulada, el cual consistía en realizar una clase de organigrama pensando en su función, estructura, actores y roles.\r\n- Por otro lado, analice el Modulo 5, Tarea 8, y realice la Propuesta de Proyecto Tecnológico, analizando la situación de la escuela, elegí la inseguridad como tema, ya que el establecimiento habría recibido bastantes inconvenientes al respecto.\r\nDe este modo doy por finalizados los Modulos de las PP. \r\n\r\n- Y para terminar la bitácora, este mismo día empezamos a armar el grupo de trabajo para poder empezar los dichos Proyectos de las PP, habiendo terminado por decidir en tomar mi emprendimiento personal de venta de ropa, y realizar una pagina web funcional de la misma, la cual tenga funcionalidades similares a la de una pagina web de una marca oficial. Estando en proceso al respecto, por el momento se realizaron ciertos diagramas y los Requerimientos del cliente.','2023-03-30'),(5569,279,'El comienzo del Proyecto','En el dia de hoy empeze a trabajar con mi grupo con nuestro proyecto para practicas profesionalizantes en el cual comenzamos a buscar el color amarrillo del logo de buenos aires osea la pagina web para despues buscar como hacer un mapa interactivo en el cual encontramos un codigo abierto para analizar como funcionaba con el modo inspeccionar de google y despues buscando el mismo codigo dentro de el codigo abierto con visual studio y empezamos a borrar lo que no nos servia pero en un momento nos quedamos sin saber que hacer asi que pedimos ayuda al profesor y gracias al profesor pudimos conseguir solamente el mapa pero sin ninguna funcion.','2023-03-30'),(5570,294,'Analisis FODA - Investigacion del proyecto','En el dia de la fecha realizamos la investigacion sobre nuestro proyecto, a mi me toco investigar los materiales que vamos a necesitar para complementarlo. Además hicimos el análisis FODA que cuenta con las oportunidades, fortalezas, debilidades y amenazas que cuentan en nuestro proyecto, no lo terminamos.','2023-03-30'),(5571,282,'Charla acerca de las bases del proyecto e inicio de investigacion.','Como primera medida, en conjunto a mis compañeros Forte, Filippa y Caceres tuvimos una Reunión interna en la cual representamos las bases del proyecto y sus funcionalidades esperadas. Tras esto realizamos unos intentos de prototipados los cuales no resultaron satisfactorios debido a no conocer las medidas del mapa. Tras esto, empezamos con una búsqueda acerca de como realizar mapas interactivos. Encontramos un mapa de código libre y sus correspondientes API´s, el cual tratamos de separar por partes y analizar sus funciones, lo cual resulto en tener un mapa base interactivo y totalmente funcional.','2023-03-30'),(5572,289,'Clase 30-3','Hoy hicimos lo siguiente\r\n•Primera Daily Grupal\r\n•Investigar sobre los componentes\r\n•Investigar que app usaremos\r\n•Documento de Carpeta de campo grupal para anotar que hicimos e investigación\r\n•Empezamos e foda\r\nEso es todo por hoy...\r\nMuchas Gracias!','2023-03-30'),(5573,277,'Sexta clase','Hoy buscamos información para llevar a cabo nuestro proyecto, pensamos distintas ideas y al final llegamos a la conclusión de hacer una página de música que lea canciones y las transforme en partituras para distintos instrumentos.','2023-03-30'),(5574,290,'Quinta ','En el día de la fecha termine casi todos los módulos, faltandome solo 2, hice el organigrama sobre tecnología, también hice el último formulario del módulo 5 y también termine el mapa conceptual del módulo 2.','2023-03-30'),(5575,288,'sexta clase','Durante el día de hoy hemos estado recopilando información para poner en marcha nuestro proyecto. Después de analizar diversas ideas, finalmente hemos decidido crear una página web de música que sea capaz de interpretar canciones y transformarlas en partituras para diferentes instrumentos.','2023-03-30'),(5576,281,'Dia 6',' Hoy estuvimos pensando arduamente en grupo sobre que proyecto podriamos hacer, al principio estuvimos pensando en hacer una pagina web de finanzas pero realmente no iba a tener mucho impacto y no valia la pena, entonces pensamos en una pagina web que te permita introducir canciones y puedas ver: Melodia, partitura, y como poder tocarla en piano, guitarra y otros instrumentos. Ademas estuvimos investigando como podriamos hacerlo, usando una API','2023-03-30'),(5577,278,'Clase N° 7 30/03/2023','En el dia de la fecha finalice el cuestionario N° 5 .Realizamos la daily en la cual nos dividimos que diagramas deberia hacer cada inegrante del equipo, a mi me toco realizar la presentacion del proyecto  y los requerimientos del usuario.Hoy empece y termine los requerimientos del usuario.Ademas creamos un github para subir todas las tareas realziadas por el equipo.','2023-03-31'),(5578,286,'Mapa y HTML','Hoy empezamos haciendo una daily con el grupo. Al terminar esta, con mi compañero Christian tuvimos que volver a buscar la página de donde sacamos el código y la api de ayer para el mapa porque habíamos perdido el archivo y no lo encontrábamos en el drive, ni en el historial ni en el apartado de &quot;Marcadores&quot; de Google. Una vez descargados todos los archivos necesarios para el trabajo empezamos a ver cómo funciona la opción de marcar coordenadas en el mapa.','2023-03-31'),(5579,279,'Dia 2 Del Proyecto','Este día estuvimos empezando a avanzar con el trabajo mientras mis compañeros se encargaban de recuperar el trabajo perdido de ayer en mi caso lo que hice fue mayormente hacer varias diagramas como pedía el profesor como el de Gantt, el de Foda y el Trello compartiendo este para que los demás de mis compañeros de grupo lo puedan actualizar cuando avancemos nuestras tareas y también empezaron a hacer el diseño de app Mobile en Figma.','2023-03-31'),(5580,293,'Proyecto en proceso ','Hoy día avanzamos con los diagramas con el gantt y flujo de datos también hicimos la deily.','2023-03-31'),(5581,274,'Daily, restauración de archivos','En el día de hoy lo primero que hicimos fue una daily. Luego, buscamos la página del código y la api del mapa ya que habíamos perdido el archivo y no lo encontrábamos en ningún lado. Descargamos todos los archivos de nuevo y vimos cómo funciona la opción de marcar coordenadas en el mapa.','2023-03-31'),(5582,285,'Dia 6 en PP','¿Qué logre hacer hoy?\r\n\r\nEmpezamos la realización del proyecto haciendo el Kanban en Trello y Termine la tarea n°5\r\n\r\n¿En que se me complico?\r\n\r\nPor parte el inicio del proyecto no fue tan complicado.\r\nSe me complicó un poco haciendo la tarea n°5 al ser un cuestionario demasiado largo.\r\n\r\n¿Qué estuve investigando?\r\n\r\nInvestigamos cómo hacer un Kanban después de tanto tiempo sin hacer uno.\r\nInvestigue los apuntes que había en el classroom para hacer la tarea y terminarlo.\r\n','2023-03-31'),(5583,275,'31-03-2023','Hoy hicimos la dailys para ver en que continuar, decidí terminar el diagrama GANTT y también el camino critico, pudimos terminarlos y para así poder comenzar con algo mas como por ejemplo el diseño de la pagina.','2023-03-31'),(5584,273,'Clase 7','En este día estuvimos platicando con mis compañeros acerca de la documentación que habría que realizar para el proyecto. Estuvimos dividiéndonos las determinadas tareas sobre los diagramas a realizar y en mi caso me toca realizar el Diagrama de Gantt y el Camino Crítico del proyecto. Finalicé el diagrama de Gantt creado en ProjectLibre y también hice un tablero Kanban en Trello, a su vez que hice un repositorio en GitHub para guardar toda la documentación. ','2023-03-31'),(5585,280,'Proyecto dia 3','Realizacion de la investigacion del desarrollo de la app mobile (Lenguaje)\r\nRealizacion del diagrama de gantt \r\nProgramacion base de la app mobile','2023-03-31'),(5586,272,'Organización inicial del grupo y proyecto','El día de hoy iniciamos con la organización del proyecto y sus respectivas etapas y tareas. Determinamos que integrante realiza cada tarea y los tiempos de las mismas. Una vez todos los integrantes esten presentes se empezara a relizar el proyecto en cuestión.','2023-03-31'),(5587,299,'Organización ','Hoy realizamos el kanban y distribuimos las tareas entre nuestros compañeros para facilitar y acelerar el proyecto aparte de empezar con algunos diagramas','2023-03-31'),(5588,290,'Sexta','En el dia de la fecha arranque a hacer la tarea 8 que deje para después y también empezamos con mi grupo a realizar las tareas de los diagramas de caso de uso y de entidad-relacion','2023-03-31'),(5589,276,'Proyecto PP - Analisis FODA - Requerimientos del Cliente','El día de hoy seguimos trabajando en base al proyecto de las PP. Mencionado anteriormente, conformamos nuestro grupo de 4 integrantes y nos decidimos por hacer una pagina en formato de tienda virtual relacionada con el emprendimiento que lleva a cabo mi compañera Alison Gargate. Esta consiste en realizar una clase de pagina web para dicho emprendimiento y asi hacerla funcional y demás.\r\nPor el momento las actividades que realizamos hasta el momento son el Analisis FODA. En este volcamos nuestras Fortalezas, Debilidades, Oportunidades y Amenazas. \r\nTambién realizamos los requerimientos del cliente y volcamos todos las necesidades y requerimientos de nuestro cliente, lo cuales implementaremos dentro de nuestro proyecto.\r\nPor el momento eso es todo. ','2023-03-31'),(5590,289,'Clase 7 ','Hoy luego de la Daily hice lo siguiente:\r\n-Seguí con el Foda\r\n-Empezamos con carito a anotar las ideas de como será la app\r\n-Buscamos paginas para buscar cosas que nos gustaran \r\n-Investigamos la competencia\r\nEso es todo por hoy..\r\nMuchas Gracias!\r\n','2023-03-31'),(5591,298,'Clase 5','Hoy empezamos a anotar las ideas que tenemos para la app y para la página \r\n','2023-03-31'),(5592,294,'Investigacion de conexión y codeo - Trello','Hoy realizamos una investigación profunda sobre las conexiones que vamos a hacer con los componentes que tenemos en cuenta en base al proyecto. También creamos un trello entre todo el grupo para exhibir todas las tareas que vamos realizando en el proyecto.','2023-03-31'),(5593,287,'Proyecto PP - Analisis FODA - Requerimientos del Cliente','El día de hoy seguimos trabajando en base al proyecto de las PP. Mencionado anteriormente, conformamos nuestro grupo de 4 integrantes y nos decidimos por hacer una pagina en formato de tienda virtual relacionada con el emprendimiento que llevo a cabo personalmente. Esta consiste en realizar una clase de pagina web para dicho emprendimiento y así hacerla funcional y demás.\r\nPor el momento las actividades que realizamos hasta el momento son el Análisis FODA. En este volcamos nuestras Fortalezas, Debilidades, Oportunidades y Amenazas. \r\nTambién realizamos los requerimientos del cliente y volcamos todos las necesidades y requerimientos de nuestro cliente, lo cuales implementaremos dentro de nuestro proyecto.\r\nPor el momento eso es todo. ','2023-03-31'),(5594,281,'Dia 7',' El día de hoy estuvimos buscando en internet distintas API de música, al principio no encontrabamos mucha información, después encontramos Deezer API pero no pudimos comprender del todo el código hasta que vimos una API llamada shazam la cual sirve para detectar canciones, la cual seria perfecta para nuestro proyecto. Aunque no sabemos del todo como usarla yo creo que es un buen paso. Además con un compañero hicimos una página web bastante sencilla para empezar','2023-03-31'),(5595,277,'Séptima Clase','El día de hoy estuvimos buscando por internet cómo utilizar una API, mis compañeros se encargaron de hacer una página web algo sencilla para comenzar, tan solo dos inputs donde poner el nombre de la canción y el artista. Mientras que yo me puse a investigar distintas APIs para buscar música, al principio intentamos usar Deezer API, vimos un poco el código pero no pudimos entenderlo completamente. Debido a esto decidimos movernos a Shazam API, una aplicación que sirve para detectar canciones, la cual sería perfecta para nuestro proyecto. Aunque no es exactamente lo que buscamos, es un buen primer paso.','2023-03-31'),(5596,291,'Organización de proyecto','El día de hoy iniciamos la organización de nuestro proyecto con los integrantes presentes el día de hoy que son Alan Gonzalez, Thiago Arroyo y Lucan Bulacio, también realizamos la daily que consiste en responder tres preguntas.','2023-03-31'),(5597,295,'Investigación sobre la conexión y código de componentes - Creación de Trello','Hoy realizamos la investigación sobre las conexiones que se realizaran en base a los componentes que necesitaremos para nuestro proyecto. Además hicimos un Trello donde vamos poniendo todas las actividades que realizamos en todo el proyecto.','2023-03-31'),(5598,288,'Septima clase','Hoy realicé la interfaz principal de la página, el boceto, claramente no va a ser la página definitiva pero para empezar nos sirve de primer paso, estuve informándome sobre las API musicales gratuitas y como integrarlas al código de html. Realice la página con bootstrap y la personalice un poco, intentamos integrar el API de deezer a nuestra pagina pero aún seguimos intentandolo ya que salió fallido el mismo.','2023-03-31'),(5599,282,'Prototipado de App Mobile en Figma, recuperar archivos perdidos dia anterior, charla para alcanzar logros del proyecto','Como primera mención acerca de lo realizado a lo largo del día, al ingresar, en conjunto a mi compañero Ledesma, dialogamos y discutimos distintas opciones acerca de lo que queríamos para nuestra app Mobile, llegando a realizar una gran parte del diseño inicial, pero no finalizándolo. Siendo que quedo como punto pendiente la elección de colores para el menú relacionado con los incidentes.\r\nAdemás, ayudé a mis compañeros Forte y Filippa a recuperar y rearmar varios archivos perdidos con respecto al mapa realizado ayer.\r\nComo ultimo punto y tras esto, tuvimos una pequeña charla acerca de las metodologías de trabajo y cual era la forma mas factible de conseguir cumplir con los plazos y objetivos solicitados','2023-03-31'),(5600,292,'Prototipado de App Mobile en Figma, charla para alcanzar logros del proyecto','En el día de hoy me explicaron las cosas que se hicieron el día 30/3 ya que no pude asistir por motivos personales. por desgracia las cosas de eldia anterior no se pudieron guardar y se perdieron, a su vez empezamos con el diseño para la app Mobile en Figma, lo cual se hizo la mayor parte en lapiz para luego hacerlo en figma. no nos dio el tiempo para terminarlo pero si hacer la mayor parte. también se intento  recuperar el trabajo perdido el día anterior y charlamos acerca de como lograr los objetivos pautados hoy y que demás cosas debíamos hacer','2023-03-31'),(5601,264,'04/04','Realización del FODA','2023-04-04'),(5602,256,'04/04/23','Junto a Kiara Chunga, Kiara Romero y Kevin mondaca hicimos el Gantt y el Foda','2023-04-04'),(5603,250,'Dia 8 Martes 4/4/2023 ','Hoy avance en la investigación sobre HTML y el equipo avanzó con el DER (Nahuel Moreno y Nieto Nicolas) y el mockup (Marmol Sofia)','2023-04-04'),(5604,259,'Martes 4 Proyecto Recetario - Nahuel Moreno','Hoy como grupo hemos avanzado respecto al Recetario, yo por mi parte hice el DER, o al menos avance en el, añadiéndole sus tablas y conexiones, las cuales seguirán mañana Miércoles mis compañeros ya que yo no podre estar.','2023-04-04'),(5605,297,'04/04/23','Realizamos el gantt del proyecto en conjunto con mis compañeros. ','2023-04-04'),(5606,269,'04/04/2023 ','Hoy seguí aprendiendo css mediante cursos en Youtube y puse en práctica los conocimientos adquiridos creando una página de ejemplo','2023-04-04'),(5607,257,'4/4/2022','Hoy en la daily quedamos de hacer con seba los diagramas que pudiéramos, empezamos con los diagramas DER y UML, además de averiguar que van a ser muuuuy largos a comparación de los anteriores, vimos algunos avances en cuanto a codificación y modelaje 3d','2023-04-04'),(5608,263,'4/4/23','Hoy estuve haciendo el diagrama der mientras que Axel Fenoglio estuvo haciendo el diagrama de clases lamentablemente Luciano falto por covid y Agustin no sabemos','2023-04-04'),(5609,255,'Dia 8 Martes 4/4/2023 ','Hoy avance en el mockup del proyecto, y mis compañeros avanzaron con el DER (Moreno Nahuel y Nieto Nicolas)','2023-04-04'),(5610,271,'4/4/2023','Tuvimos la charla del Daily, junto a mis compañeros Valentín Bentos, Enzo Romaniello, Emilio Pereira y Luis Meza. Además de que mejoramos el DER( Diagrama Entidad Relación)','2023-04-04'),(5611,260,'4/4/23','Estuve viendo videos sobre React y cambiamos el proyecto en vez de hacerlo con Next lo haremos con Vite ','2023-04-04'),(5612,261,'04/04/2023','Hoy estaba trabajando el diseño 3D del proyecto.','2023-04-04'),(5613,266,'04/04/2023 - Migracion del proyecto ','Esta clase nos estuvimos encargando con Diego de migrar el proyecto desde Next.js a Vite. Cambien estuve intentando crear las rutas dinámicas, no pude así que lo voy a seguir en mi casa. ','2023-04-04'),(5614,268,'04-04-2023','Hoy despues del la Daily comenzamos con el diseño 3D en Blender del Robot Sumo que tenemos planeado termina para el final de la clase de mañana. Atte Javier Rojas Liambo de 6°1°C','2023-04-04'),(5615,254,'04/04/23','Hoy realizamos el GANTT junto a mis compañeras y vimos como realizar el foda junto a mi compañero mondaca','2023-04-04'),(5616,267,'04/04/2023','Hoy estuve haciendo el diseño 3D','2023-04-04'),(5617,265,'04-04-2023','Hoy, luego de la Daily, buscamos modelos sumos para poder inspirarnos y tomarlos como ejemplo. Luego empezamos a ver videos de YouTube para saber usar Blender.','2023-04-04'),(5618,252,'Clase 7 - Práctica de JS y DOM','Hoy practiqué código de javascript, aprendí y practiqué código sobre DOM','2023-04-04'),(5619,270,'4/04/2023','El día de hoy comenzamos con el grupo haciendo el daily y terminando de acordar detalles sobre el videojuego final. Luego nos dimos cuenta de un error en el diagrama de Base de Datos y tuvimos que crear una nueva tabla. Con esto terminamos el ultimo diagrama del proyecto para ya comenzar a investigar sobre unity y poder empezar a programar.','2023-04-04'),(5620,262,'04/04/2023','El dia de hoy comenzamos con un curso gratuito en youtube de Unity para adentrarnos en ese mundo y el manejo del mismo, ya que es algo nuevo para nosotros que deseamos experimentar, tambien al principio realizamos el Dayli como siempre, por otra parte comenzamos con las preguntas y BDD.','2023-04-04'),(5621,253,'Martes 04/04/2023 - Corrección de diagramas','Hoy corregimos algunos diagramas que teníamos incompletos y, comenzamos a pensar en las preguntas qie tendrá nuestro videojuego. Además, vimos algo muy por encima de lo que es Unity.','2023-04-04'),(5622,301,'Bitacora Agustin Barcia 05/04','este dia empezamos a investigar y crear el diagrama de unity para empezar nuestro juego, tambien buscamos mapas y herramientas para la creacion del mapa, tambien definimos exactamente de que va a tratar nuestro juego','2023-04-05'),(5623,268,'05/04/2023','Hoy después de descargar Blender continúe con el diseño de ayer pero al ver que había cosas que ya estaban mal comencé otra vez con un poco de conocimiento de videos de youtube y al final comencé con la carpeta de campo con la ayuda de las Bitácoras.','2023-04-05'),(5624,253,'Míercoles 05/04/2023 - Creación de preguntas','Hoy creamos las preguntas de las diferentes categorías que tenemos en el videojuego para ya comenzar con el desarrollo de la base de datos.','2023-04-05'),(5625,264,'05/04','Pert y CPM (camino critico)','2023-04-05'),(5626,257,'5/4/2023','Hoy hicimos los diagramas DER, empezamos el de caso de uso, el diagrama de clases, un poco el camba y el foda, además de elegir los assets de unity para el mapa, y repasamos algunos codigos','2023-04-05'),(5627,260,'05/04/23','Estuve viendo videos sobre React y el tema de los Hooks y useEffects y useState y haciendo practicas, tambien fui completando un poco la carpeta de campo\r\n','2023-04-05'),(5628,266,'05-04-2023 -  Rutas en react','En esta clase me dedique a profundisar en las rutas, distribui las paginas utilizando Route. Tuve muchas dificultades debido a que no anda muy bien Vite con las rutas. ','2023-04-05'),(5629,263,'5/4/23','Hoy estuvimos haciendo devuelta el diagrama esta vez lo estuvimos terminando y nos queda el resto de diagramas como el de caso uso y el foda','2023-04-05'),(5630,256,'11/04/23','Realizamos el diagrama Uml entre todos con ayuda del profe','2023-04-11'),(5631,264,'11/04','Diagrama de clases UML','2023-04-11'),(5632,263,'11/4','Hoy estuve haciendo el diagrama Kanvat, no hubo mucha novedad hoy aparte de eso pero aun asi puede que falte agregar algunas tareas mas en el kanbat','2023-04-11'),(5633,271,'11/4/23','En el día de hoy. Arranque con mi parte del código en la base de datos, ingresando mis preguntas y mis respuestas, pero aún no está terminado ','2023-04-11'),(5634,267,'11/04/2023','Empezamos con el circuito del sensor de ultrasonido en Tinkercad','2023-04-11'),(5635,254,'11/04/2023','Hoy planeamos lo que vamos hacer y terminamos el diagrama UML','2023-04-11'),(5636,297,'11/04/23','terminamos junto a mis compañeros el diagrama UML','2023-04-11'),(5637,258,'11/04/2023','hoy empeze y termine el foda','2023-04-11'),(5638,251,'Revisión general del Proyecto - 11/4/2023','El día de hoy realizamos otra Daily con mi grupo y me comentaron con que avanzamos en la semana en la que me enfermé. Luego, conversé con mi compañera Sofía para definir el diseño de la página web y el Mock Up High Fidelity. Finalmente revisé el DER de la aplicación, el cual completaré mañana.','2023-04-11'),(5639,252,'Clase 8 - React','Hoy aproveché la clase para comenzar a crear una carpeta de react y aprender toda la configuración básica, tanto como crear un proyecto, para que sirve cada archivo creado, abrir el servidor e ir practicando código de html, css, js y también jsx','2023-04-11'),(5640,261,'11/04/2023','Hoy empece con el circuito del sensor de ultrasonido en Tinkercad todavia no lo termine.','2023-04-11'),(5641,268,'11-04-2023','Hoy después de hablar con mis compañeros comense con la programación y el armado del motor en Tinkercad donde logre que funcionara mañana continuare en el y le agregare los movimientos y los tiempo.','2023-04-11'),(5642,269,'11/04/2023','Hoy creé el DER en MySQL workbench con sus primaryKeys, y foreingnKeys, y luego realicé el código de la estructura de la base de datos.','2023-04-11'),(5643,255,'Día Martes 11/4/2023','Hoy busque cositas sobre Figma y entendí mi lugar en el proyecto. Ahora puedo empezar con el diseño meow meow meow meow :3','2023-04-11'),(5644,265,'11-04-2023','Estuve repasando los temas de arduino y los practique en tinkerkat ','2023-04-11'),(5645,260,'11/04/23','Empecé el desarrollo del Header del about','2023-04-11'),(5646,266,'11/4 - Rest API ','Hoy me estuve dedicando a las rest api, investigue y documente bastante para poder la próxima clase empezar con el desarrollo de la rest api. ','2023-04-11'),(5647,250,'Dia 10 Miercoles 11/4/2023','Hoy avanzamos el mockup a high fidelity convirtiendolo en codigo css','2023-04-11'),(5648,257,'11/4/2023','Hoy en la daily hablamos de repartir 3 diagramas entre los chicos y yo hice el de caso de uso, lo empecé pero falta agregar varias funcionalidades ','2023-04-11'),(5649,253,'Martes 11/04/2023 - Personajes','Hoy solamente vimos una manera de diseñar nuestros personajes en 3D con Unity.','2023-04-11'),(5650,256,'12/04/23','Corregimos el diagrama de clases (uml)','2023-04-12'),(5651,271,'12/4/23','En el día de hoy, termine mi parte de las preguntas y las respuestas de deportes de la base de datos de nuestro videojuego ','2023-04-12'),(5652,258,'12/04/2023','seguimos trabajando en los diagramas','2023-04-12'),(5653,297,'12/04/23','terminamos toda la documentación, para luego empezar a programar. ','2023-04-12'),(5654,264,'12/04','Diagrama entidad relacion (Base de Datos)','2023-04-12'),(5655,263,'12/4/23','Sin mucha novedad solo que el kanbat lo termine, hasta que se necesite mas tareas en el proyecto ','2023-04-12'),(5656,255,'Día Miércoles 12 / 4 / 2023','Hoy avancé con Figma y el primer prototipo de la página web. :))))','2023-04-12'),(5657,269,'12/04/2023','Hoy solucione todos los problemas del código SQL para que funcione perfectamente y lo puse a prueba. Además realice varios inserts en cada tabla de la BD.\r\nLuego con el tiempo que me sobró comencé un curso de JavaScript y fui practicando lo que aprendía','2023-04-12'),(5658,268,'12/04/2023','Hoy despues de la charla nos juntamos con el Profe Nahuel para hablar sobre los materiales para el proyecto el informomamos los materiales como los precios y en el resto del dia buscamos informacion y seguimos con la programacion yo con la del motor haciendo que se muevan en adelante y atras.','2023-04-12'),(5659,254,'12/04/2023','Hoy terminamos toda la documentacion y los diagramas para empezar a programar','2023-04-12'),(5660,251,'Investigación y Pruebas - 12/4/2023','El día de hoy corregí el DER de Recetonomicón. Luego, cree un repositorio privado en GitHub, invité a mis compañeros y creé ramas para cada área del desarrollo de la APP.\r\nLuego, me puse a investigar APIs en PhP, y experimenté con el Framework Leaf 3.0.  ','2023-04-12'),(5661,260,'12/04/23','Estuve terminando el header del about y la parte de about, hice 3 secciones y los estilos\r\n','2023-04-12'),(5662,301,'12/04/2023','Hoy seguimos investigando unity y charle con mis compañeros acerca de la utilizacion de blender para crear los personajes y modelar algunas cosas, tambien corregimos un poco el DER\r\n','2023-04-12'),(5663,261,'12/04/2004','Hoy hicimos una lista de los materiales para el proyecto e investigue el código del sensor ultrasónico.','2023-04-12'),(5664,265,'12-04-2023','Hoy estuvimos haciendo una lista de materiales en la que mediamos el presupuesto y estuve viendo videos de como usar el sensor ultrasonico.','2023-04-12'),(5665,266,'12/4 - inicializacion rest api','Durante toda la clase de hoy me dedique a realizar las configuraciones de la res api. cree las ramas correspondiientes y cree algunas funcionalidades de crud. Tambien hice una actualizacion en el BDD que estaba mal. ','2023-04-12'),(5666,267,'12/04/2023','Hoy hicimos una lista de los materiales con su presupuesto y seguimos con el codigo en tinkercad.','2023-04-12'),(5667,252,'Clase 9 - Creación de página','Hoy hice una página con React donde mostraba la información de diferentes trabajadores (Nombre y apellido, especialidad y la información de su trabajo) utilizando Java Script y CSS','2023-04-12'),(5668,273,'Día 13/04/23','Hoy hicimos una daily con el equipo entero y decidimos ué tareas realizaríamos en el día de la fecha. A cada uno se le asignaron dos tareas, de las cuales se elegiría una para hacer hoy. En mi caso, me tocó hacer el camino crítico del proyecto, que para eso necesitaría revisar el diagrama de Gantt que realicé en la clase anterior. Tras hacer el camino crítico, pude deducir cuáles son las tareas con prioridad y cuáles se pueden atrasar un tiempo. Al final de todo, se pudo saber la duración total del proyecto, la cual es de 109 días.','2023-04-13'),(5669,274,'Prototipado de la página web','El día de hoy lo que hice fue, como todos los días, hacer una reunión daily, en la cual hablamos acerca de lo que habíamos hecho la última clase. Una vez que la finalizamos, el project mánager nos encargó a mí y a mi compañero hacer el prototipado de la página web. Hicimos el prototipado de la página que van a ver los administradores. \r\nLo primero que hicimos fue hacer una base y posteriormente, hicimos varios prototipados con distintos colores. Finalmente, optamos por un diseño basado en los colores de la policía de Buenos Aires. Luego buscamos una fuente similar a la de la policía de Buenos Aires.\r\nDespués elegimos un nombre para el proyecto entre todos los integrantes del grupo. \r\nPor último, iniciamos a escribir el código html, basándonos en el prototipado.\r\n','2023-04-13'),(5670,286,'Prototipado de Página','Hoy llegamos al aula y empezamos teniendo una daily de 15 minutos contando lo que hicimos, qué haremos y cómo lo haremos. Más tarde, con mi compañero Christian, empezamos  a buscar los colores de la Policía de la Ciudad de Buenos Aires para hacer el prototipado de la página para que la policía pueda ingresar usuario y contraseña y poder entrar. Luego buscamos la página web oficial de la Policía de la Ciudad, sacamos una screenshot y la pegamos en Paint, una vez hecho esto, obtuvimos el RGB de los colores bordó, celeste y turquesa. Con los colores obtenidos, empezamos a hacer un par de prototipados. Con el grupo nos decidimos por el primero. Después, nos pusimos a buscar la tipografía de la policía, luego de una ardua búsqueda, encontramos lo que necesitábamos. Al final empezamos a hacer la página con css.','2023-04-13'),(5671,293,'Diagrama caso de uso extends y maqueta de página web ','continuamos con los diagramas y la maqueta para la página de web de tienda de ropa. Terminamos el diagrama de caso de uso extends donde mostramos en funcionamiento del cliente hacia el dueño y también la administración cada uno con distintos funciones y opciones &lt;Extends&gt; y eso es todo lo que hicimos.\r\n\r\n\r\n','2023-04-13'),(5672,279,'Dia 3 de Proyecto','En el día de hoy se avanzo en el proyecto al habernos faltado los daily fui el encargado de hacerlos cada uno con ayuda de los chicos se pudo completar todos siendo por ahora 4 dailys y avanzar un poco con el Foda agregando mas fortalezas como oportunidades y debilidades y como claro amenazas.','2023-04-13'),(5673,272,'Análisis FODA, Diagrama entidad-relacion y caso de uso','Hoy empezamos con el trabajo sobre el proyecto final, repartiendo las tareas con un Kanban ya creado anteriormente y realizamos el daily, en lo personal pude terminar el análisis FODA, el diagrama entidad-relación y el diagrama caso de uso. Por otro lado, mi equipo terminó la investigación de competencia y los requisitos del cliente.','2023-04-13'),(5674,276,'Proyecto PP &quot;Lu\'s shop&quot;: KANBAN - DFD - DER - GANTT','El dia de hoy continuamos trabajando en base le proyecto de las PP, el cual hemos llamado &quot;Lu\'s Shop&quot;, siendo de manera provisoria por el momento. \r\nEmpezamos a realizar aun mas tareas dentro del proyecto, y esas fueron las siguientes:\r\n- Realizamos un KANBAN en Trello, donde volcamos todas las tareas a realizar a lo largo del proyecto, separando las tareas en diferentes secciones tales como los Diagramas, Daily´s, Pagina Web, las tareas en Proceso y las Terminadas. Diariamente se ira actualizando mediante se determinen nuevas tareas y se terminen de realizar ciertas tareas.\r\n- Realizamos el Diagrama de Flujo de Datos el ucal consiste en tomar dos actores principales, en este caso Cliente y Vendedor, declarando las acciones de nuestra tienda virtual entre si con el Vendedor que controla la pagina y el cliente que compra dentro de ella, y habiendo dividido el diagrama en 3 niveles (0, 1 y 2), donde mientras mas alto sea el nivel, se explotan las burbujas y se explica de manera mas especifica la accion de cada una. \r\n- Tambien realizamos el Diagrama de Entidad de Relacion, mostrando como interactúan las entidades, que en nuestro caso serian vendedor, cliente, producto, venta y comprobante. De este modo, usaremos tal diagrama en forma de base para la base de datos a realizar proximamente. \r\n- Por ultimo empezamos a realizar el diagrama de GANTT, en el cual ingresamos las tareas a realizar y la duracion aproximada (por le momento) que tomaria realizar cada una de ellas a lo largo del proyecto. Este debera ser actualizado diariamente pero ya tenemos una base de las tareas que iremos realizando. \r\nTambien hemos realizado la Daily. ','2023-04-13'),(5675,275,'13/04/23','13/04/23:Pues hoy seguimos el trabajo maso menos por donde lo dejamos  desde el 31/3 la semana pasada no hicimos nada porque no teníamos clase esos días sin embargo algunos de nosotros seguimos trabajando desde casa, lo que hoy hicimos yo fue el diagrama de caso de uso extendido aunque todavía me falta terminar su descripción.\r\nFue algo complicado pero se pudo, no sabría decir también seguí actualizado los diagramas , GANTT y camino critico','2023-04-13'),(5676,282,'Descarga de cursos y prototipados','Durante el dia de hoy, en conjunto a mi compañero Ledesma, utilizamos la totalidad del dia de clase para realizar la descarga de 5 cursos, los cuales abarcan PHP, Node, Java Spring, React y React Native, lo cual nos llevo practicamente la totalidad de la clase.\r\nEn el tiempo que no estuvimos con esta tarea, analizamos prototipados para administradores en conjunto e incentivamos a mis compañeros a realizar las dailys','2023-04-13'),(5677,278,'Clase N° 8 13/04/23','En el día de la fecha realice la corrección de los requerimientos del cliente. También empecé a diseñar la presentación del proyecto en Canva, nuestra empresa se llama &quot;EcceSoft&quot; y se encarga del desarrollo de software de aplicaciones móviles y paginas webs.','2023-04-13'),(5678,292,'descargas de cursos para desarollar el trabajo','\r\nDurante el dia de hoy, en conjunto a mi compañero Enzo Bartoletti, utilizamos la totalidad del dia de clase para realizar la descarga de 5 cursos, los cuales abarcan PHP, Node, Java Spring, React y React Native, lo cual nos llevo practicamente la totalidad de la clase.\r\nEn el tiempo que no estuvimos con esta tarea, analizamos prototipados para administradores en conjunto e incentivamos a mis compañeros a realizar las dailys, luego de una amplia charla se decidió el nombre del proyecto y se perdieron los datos de las descargas debido a que se apago la computadora\r\n','2023-04-13'),(5679,289,'13/04 Clase 8','Holis, hoy hice lo siguiente:\r\n-El trello colocando las tareas.\r\n-Empezamos a hacer el prototipo de la pagina web. \r\nEso es todo por hoy, muchas gracias!','2023-04-13'),(5680,283,'avance del proyecto','El dia de hoy comenzamos con la daily rutinaria y hablamos sobre lo que hicimos la clase anterior, que haremos esta clase y que vamos a hacer la siguiente. \r\nEn esta misma hablamos sobre como tenemos que dirigir la pagina de juguetes que competencia tenemos como vamos a enfrentarla, buscamos precios sobre los juguetes, etc\r\ntambien hicimos el uso del kanban para dividirnos las tareas entre nosotros 5, Alan teniendo como tarea el prototipado de la pagina. Lucan en cambio hizo la investigacion de la competencia\r\nthiago realizo el Diagrama de entidad relacion, El foda y el Diagrama de caso de uso. nicolas mangialavore hizo el diagrama de camino critico y termino los requisitos del cliente.\r\nYo (Ciro Lobotrico) empece el gantt, los requisitos del cliente, un codigo pre eliminar de la pagina que vamos a usar. al final de dia actualizamos cosas sobre el kanban.\r\n','2023-04-13'),(5681,284,'Bitacora 3','Hoy realicé el  analisis Foda , ayude a mis compañeros con sus diagramas , ayude para realizar el.diagarama de caso de uso , y ayude a realizar el diagrama de secuencia.','2023-04-13'),(5682,298,'Clase 6','Investigue acerca de los test unitarios y con mi grupo empezamos con el prototipo de la página web.','2023-04-13'),(5683,288,'Octava Clase','Hoy nuestro respectivo compañero de equipo nos ha dado la orden de cambiar nuevamente nuestra idea de trabajo para poder facilitar el proyecto, ya que en la idea anterior no sabemos exactamente cómo codificarlo. De esta manera estuvimos buscando varias ideas de proyectos para realizar, y logramos encontrar en el transcurso del dia varias, de las que mencionaré a continuación; Sistema de seguridad doméstica, Aplicación para el seguimiento de gastos, Plataforma de intercambio de libros,Sistema de riego inteligente, entre otras varias. Entre hoy y mañana intentaremos ponernos de acuerdo para decidir por una de las mismas.','2023-04-13'),(5684,290,'Septima','En el día de la fecha lo que hice fue, realizar el diagrama de caso de uso para el proyecto que vamos a hacer sobre una aplicación movil','2023-04-13'),(5685,294,'Investigacion - Conexion','En el dia de hoy lo primero que hicimos fue realizar la daily de todos los dias, charlando que hacer cada uno en el dia. Luego hice la conexion de fritzing con los componentes e investigue que base de datos tendremos en cuenta en base al proyecto.','2023-04-13'),(5686,296,'Bitácora 3','Hoy nos asignamos los trabajos que íbamos a realizar cada integrantante yo empeze con el diagrama de secuencia y también ayude un poco a un compañero a hacer el FODA','2023-04-13'),(5687,281,'Dia 8','Hoy realmente nos dimos cuenta de que es muy complicado codificar el proyecto que teniamos pensado hacer ya que es complejo y no nos conviene para nada, ademas de que posiblemente se nos dificulte cada vez mas asi que decidimos juntos que deberiamos cambiar el proyecto aunque todavia no tenemos una idea concreta de que podriamos hacer.','2023-04-13'),(5688,287,'Proyecto PP &quot;Lu\'s shop&quot;: KANBAN - DFD - DER - GANTT','Continuamos trabajando en la base le proyecto de las PP, el cual se llama &quot;Lu\'s Shop&quot;, siendo un ejemplo x ahora\r\nEmpezamos a realizar aun mas tareas para el proyecto, y esas fueron las siguientes:\r\n- Realizamos el Diagrama de Flujo de Datos el ucal consiste en tomar dos actores principales, en este caso Cliente y Vendedor, declarando las acciones de nuestra tienda virtual entre si con el Vendedor que controla la pagina y el cliente que compra dentro de ella, y habiendo dividido el diagrama en 3 niveles (0, 1 y 2), donde mientras mas alto sea el nivel, se explotan las burbujas y se explica de manera mas especifica la accion de cada una. \r\n- Realizamos un KANBAN en Trello, donde volcamos todas las tareas a realizar a lo largo del proyecto, separando las tareas en diferentes secciones tales como los Diagramas, Daily´s, Pagina Web, las tareas en Proceso y las Terminadas. Diariamente se ira actualizando mediante se determinen nuevas tareas y se terminen de realizar ciertas tareas.\r\n- Tambien realizamos el Diagrama de Entidad de Relacion, mostrando como interactuan las entidades, que en nuestro caso serian vendedor, cliente, producto, venta y comprobante. De este modo, usaremos tal diagrama en forma de base para la base de datos a realizar proximamente. \r\n- Por ultimo empezamos a realizar el diagrama de GANTT, en el cual ingresamos las tareas a realizar y la duracion aproximada (por le momento) que tomaria realizar cada una de ellas a lo largo del proyecto. Este debera ser actualizado diariamente pero ya tenemos una base de las tareas que iremos realizando. \r\nTambien hemos realizado la Daily. ','2023-04-13'),(5689,295,'Boceto - Avance de Trello - Avance de carpeta de campo','Hoy realizamos la daily de todos los dias. Luego realize el boceto junto a mi compañera victoria (scrum) que respecta con la pagina que utilizaremos en el proyecto con el programa FIGMA. Además continuamos con el TRELLO completando la trayectoria de las tareas realizadas. Continue completando la carpeta de campo.\r\n','2023-04-13'),(5690,280,'Guia de node','Investigacion de los conceptos de node y como aplicarlos en el trabajo actual teniendo en cuenta los conocimientos manejables\r\nCreacion de base de datos, sus tablas, consultas, conexion con node, conexion a un prototipo de arduino\r\nCreacion de voceto en figma para luego llevarlo a cabo en html css y js (prototipado )\r\n','2023-04-13'),(5691,291,'Avance del proyecto','El dia de hoy comenzamos con la daily rutinaria y hablamos sobre lo que hicimos la clase anterior, que haremos esta clase y que vamos a hacer la siguiente. \r\nEn esta misma hablamos sobre como tenemos que dirigir la pagina de juguetes que competencia tenemos como vamos a enfrentarla, buscamos precios sobre los juguetes, etc. Tambien hicimos el uso del kanban para dividirnos las tareas entre nosotros 5, Alan teniendo como tarea el prototipado de la pagina. Lucan en cambio hizo la investigacion de la competencia Thiago realizo el Diagrama de entidad relacion, El foda y el Diagrama de caso de uso. Ciro empezó los requisitos del cliente, el gantt y un prototipo de código de la página que usaremos. Yo termino los requisitos del cliente que mi compañero ciro empezó y también empecé el camino crítico.\r\n','2023-04-13'),(5692,285,'Dia 7 en PP','¿Que logre hacer hoy?\r\n\r\n\r\nEl día de hoy me dediqué a trabajar en mi respectivo grupo haciendo el prototipado rápido en hoja.\r\n\r\n¿En que se me complico?\r\n\r\nSe me complico teniendo la idea de que hacer, el diseño de la página, el cómo distribuir sus secciones respectivas y que meterle.\r\nTodo esta solucionado, prototipe 3 página.\r\nLa de inicio, compra y búsqueda.\r\n\r\n¿Qué estuve investigando?\r\n\r\nInvestigue que es el prototipado rápido, como hacerlo y cómo dividir todo.\r\nInvestigue algunas páginas de compra y venta para tener de base algo para hacer el prototipado de la página, ya tengo unas 3 páginas prototipadas y supongo que es todo.','2023-04-14'),(5693,274,'HTML y curso de react','En la presente fecha me agrada informar que hemos continuado con la realización del sistio web en conjunto con mi compañero de equipo. Agregamos una imagen en el header y luego agregamos un login para que los administradores puedan iniciar sesion. Al mismo, tiempo pasamos al pendrive los videos del curso de React.','2023-04-14'),(5694,283,'gantt terminado e investigacion de servidor ','El dia de hoy emepzamos haciendo una daily y definiendo lo que hizo cada uno el dia de ayer, que haremos el dia de hoy, etc\r\nComo por ejemplo:El integrante Alan Gonzalez no asistió el día de ayer por intensos dolores estomacales, Lucan hizo la investigación de competencia, Ciro hizo la prueba de una página que al final no se usó, empezó el gantt, empezó los requisitos del cliente y creó la inicialización el servidor usando MySQL, Thiago hizo el foda, el caso de uso y el DER (Diagrama Entidad Relación), Nicolas hizo terminó los requisitos del cliente, el camino crítico y el diagrama de secuencia.\r\nEl día de hoy se realizo el daily con el equipo hablamos entre nosotros y nos hicimos las Ciro realizará el Gantt y seguirá el servidor de MySQL, Alan está boceteando el prototipado rápido de la página principal en una hoja de papel cuadriculada, para luego llevarlo al figma. Lucan ayudó al compañero Alan a realizar el prototipado rápido.\r\ntermine el diagrama de gantt y luego investigare para elegir un buen servidor para la pagina. ','2023-04-14'),(5708,280,'Node sql y wsl','uso de los modulos de node para hacer conexion a una base de datos en mysql para agregarlo en el proyecto\r\nInvestigacion de Wsl y Wsl2 para el uso de scripts mkweb que permite agilizacion en la creacion y dominio de los proyectos\r\nUso de wsl en debian ','2023-04-14'),(5695,273,'14-04-2023','Hoy 14 de abril empecé a aprender ReactJS para hacer la página web y la aplicación de este trabajo. Ya empecé a comprender la función de este, y con suerte para las proximas dos clases ya podré usarlo a nivel intermedio.','2023-04-14'),(5696,279,'Dia 4 del Proyecto','En el día de hoy estuve haciendo la daily del día de hoy y el del día anterior y después en el resto del día me ocupe mayormente en la parte de hacer el diagrama de caso de uso de forma detallada completando todo lo posible con todo lo que podría hacer un cliente y el administrador de la pagina por ahora aunque después en el futuro posiblemente habría cambios en temas de algunas funciones o cambios grandes de como seria todo el proyecto al final.','2023-04-14'),(5697,278,'Clase N° 9 12/04/2023','En el día de hoy realice el prototipado rápido en papel de la pagina web. Luego comencé a diseñar la pagina web , hasta que me di cuenta que necesitaba un logo, entonces, con mi compañero Tobias empezamos a diseñar uno, lo terminamos y finalmente los colocamos en la pagina web.','2023-04-14'),(5698,292,'continuacion del dia de ayer, descarga de cursos para el trabajo','En el día de la fecha junto a mi compañero Enzo bartoletti reunimos los pendrives para poder descargar los cursos react,php, etc y cuando estábamos por descargarlos el profesor nos pasó una página donde ver algunos de los cursos gratis y sin la necesidad de descargarlos. Luego con otro profesor nos dijo que podíamos hacer el trabajo solo con react y redirigimos el camino del trabajo con unas ideas nuevas que no se nos habían ocurrido como un botón de pánico \r\n','2023-04-14'),(5699,275,'14/04/23','14/04/23: Hoy seguí con lo del caso de uso solo que con la descripción de este, de nuevo actualice los demás diagramas, \r\naparte de eso también tuve que cambiar el diagrama de caso de uso  para que este concordara mas con lo que queríamos hacer, en la descripción del caso de uso intente buscar/ hacer una plantilla para esta pero no encontré nada bueno, así que solo use el Word usando tablas.  ','2023-04-14'),(5700,286,'Continuación de Página Web','En el día de la fecha, empecé a trabajar con mi compañero de grupo Christian y continuamos con el trabajo de la página web que empezamos ayer. Estuvimos averiguando cómo centrar un texto que hay arriba de todo de la página. Para continuar, tuvimos que descargar de nuevo el logo de la Policía de la Ciudad ya que ayer no guardamos, seguimos haciendo un div, un rectángulo negro en el medio de la página para poner allí los input de texto para el nombre de usuario y un input de password para que la persona que quiera ingresar ponga su contraseña.','2023-04-14'),(5701,299,'Hoy','Ayer no pude hacer bitácora porque me tuve que ir por lesión de muñeca y hoy solo pude ayudar a mis compañeros al no poder usar un mouse o typear','2023-04-14'),(5702,293,'Diagrama de secuencia y especificacion de caso de uso','Hoy día hicimos el diagrama de secuencia y especificacion de caso de uso.','2023-04-14'),(5703,284,'Bitacora 4','Hoy arranque el prototipado figma de la pagina , estuvimos adelantando los diagramas con mis compañeros , yo finalicé los mios ya','2023-04-14'),(5704,298,'Clase 7','Hoy continuamos con el prototipo de la página web con Victoria','2023-04-14'),(5705,290,'Octava','En el día de la fecha lo que hice fue, realizar el logo de la página web del proyecto que estamos haciendo y desde una aplicación de desarrollo web, empecé a diseñar está pagina','2023-04-14'),(5706,282,'Descarga de cursos','En el día de la fecha junto a mi compañero Enzo bartoletti reunimos los pendrives para poder descargar los cursos react,php, etc y cuando estábamos por descargarlos el profesor nos pasó una página donde ver algunos de los cursos gratis y sin la necesidad de descargarlos. Luego con otro profesor nos dijo que podíamos hacer el trabajo solo con react y redirigimos el camino del trabajo con unas ideas nuevas que no se nos habían ocurrido como un botón de pánico \r\n','2023-04-14'),(5707,277,'Novena clase','Estuvimos pensando un nuevo proyecto que hacer debido a que el anterior es muy complejo, estuve buscando algunos cursos en internet para aprender más de código pero estos son muy caros o inaccesibles. Logré anotarme a uno llamado Generación T que enseña HTML, CSS y otros agregados, de todas formas no creo que me sea muy útil para el trabajo que estamos intentando llevar a cabo.\r\n	Estamos cortos de ideas, no estoy seguro de que hacer y no se me ocurre qué hacer.\r\n','2023-04-14'),(5709,276,'Proyecto PP &quot;Lu´s Shop&quot;: Realizacion de Bocetos Pagina Web','Este día seguimos trabajando en base a los diagramas faltantes dentro de nuestro proyecto, algunos ya están terminados y algunos siguen en proceso. \r\nPor otro lado, empezamos a realizar bocetos para darle una base al diseño de nuestra pagina web, y tal como ya se ha mencionado, tendrá funcionalidades y un diseño similar a las de una pagina oficial de ropa. Por el momento empezamos diseñar en un boceto a mano el diseño que tendría nuestra pestaña de inicio de la pagina, contando con una barra de navegación que tenga un numero de contacto, carrito de compras, opción de iniciar sesion, las secciones y después un footer con demás información. Luego trabajamos un poco en base al diseño del inicio de sesion y tambien una forma de registrarse, cosa que implementaremos dentro de la BDD proximamente. Por ultimo hicimos un pequeño diseño de las secciones, donde mostraran fotos de los productos vendidos, sus precios y pequeña información en si, luego se seguirá implementando demas al terminar el boceto hecho a mano. a su vez fuimos realizando una maqueta en Canva para poder analizarlo visualmente. \r\neso fue todo por hoy. ','2023-04-14'),(5710,287,'Proyecto PP &quot;Lu´s Shop&quot;: Realizacion de Bocetos Pagina Web','Este día seguimos trabajando en base a los diagramas faltantes dentro de nuestro proyecto, algunos ya están terminados y algunos siguen en proceso. \r\nPor otro lado, empezamos a realizar bocetos para darle una base al diseño de nuestra pagina web, y tal como ya se ha mencionado, tendrá funcionalidades y un diseño similar a las de una pagina oficial de ropa. Por el momento empezamos diseñar en un boceto a mano el diseño que tendría nuestra pestaña de inicio de la pagina, contando con una barra de navegación que tenga un numero de contacto, carrito de compras, opción de iniciar sesion, las secciones y después un footer con demás información. Luego trabajamos un poco en base al diseño del inicio de sesion y tambien una forma de registrarse, cosa que implementaremos dentro de la BDD proximamente. Por ultimo hicimos un pequeño diseño de las secciones, donde mostraran fotos de los productos vendidos, sus precios y pequeña información en si, luego se seguirá implementando demas al terminar el boceto hecho a mano. a su vez fuimos realizando una maqueta en Canva para poder analizarlo visualmente. \r\neso fue todo por hoy. ','2023-04-14'),(5711,296,'Bitácora 4','Empeze el prototipado de la página web y estuvimos pensando un diseño para el logo aunque no llegamos a tener una idea clara','2023-04-14'),(5712,289,'14/04','Hoy con caro hicimos el boceto de la pagina que dejamos ayer sin terminar\r\nEso es todo por hoy,  muchas gracias!!','2023-04-14'),(5713,288,'Novena clase','Nos encontramos en una situación en la que nuestro proyecto actual se ha vuelto extremadamente complejo y hemos estado reflexionando sobre la posibilidad de iniciar un nuevo proyecto. Con el fin de mejorar nuestras habilidades y conocimientos en programación, he estado buscando cursos en línea que me permitan adquirir más habilidades en código. Sin embargo, me he encontrado con que muchos de estos cursos son costosos o no están disponibles en este momento.\r\n\r\nDespués de mucho buscar, finalmente encontré un curso llamado &quot;Generación T&quot;, que enseña HTML, CSS y otros conceptos relacionados. Aunque no estoy seguro de que este curso me sea útil para el trabajo que estamos intentando llevar a cabo, me inscribí en él con la esperanza de adquirir nuevas habilidades que puedan ayudar en futuros proyectos.\r\n\r\nA pesar de esto, todavía estamos enfrentando un bloqueo creativo y no tenemos muchas ideas sobre qué hacer a continuación. Me preocupa que no podamos encontrar una solución pronto y nos quedemos estancados en este punto. Espero que podamos encontrar alguna inspiración pronto para continuar avanzando en nuestros objetivos.','2023-04-14'),(5714,297,'18-04-23','mire videos relacionados a la creación del frontend ','2023-04-18'),(5715,264,'18/04','','2023-04-18'),(5716,256,'18/04/23','Hoy comencé con el código de clases en java','2023-04-18'),(5717,260,'18/4/23','Hice condicional el renderizado del header, y empecé a hacer responsivle el diseño del about','2023-04-18'),(5718,251,'18/4/2023 - Investigación de las APIs 2','El día de hoy continué investigando acerca de cómo desarrollar APIs en PhP. Me dediqué a comprender los modelos (basados en la BDD) y los controladores, que servirán más tarde.','2023-04-18'),(5719,268,'18/04/2023','Hoy despues de charlar con mis compañeros de grupo y con el profesor Nahuel me puse a ponerme al dia con la Carpeta de Campo.','2023-04-18'),(5720,261,'18/04/2023','Hoy hice el codigo del Sensor infrarojo y una parte los motores.','2023-04-18'),(5721,271,'18/4/23','Debatimos junto a mis compañeros Enzo Romanniello, Luis Meza, Emilio Pereira y Valentín Bentos sobre cuál podría ser el contexto y el lugar del videojuego.','2023-04-18'),(5722,267,'18/04/2023','Hoy seguimos con el codigo en tinkercad (infrarrojo y motores)','2023-04-18'),(5723,250,'dia 12 Martes 18 14 2023 ','empece el curso de javascript :3','2023-04-18'),(5724,257,'18/4/2023','Hoy nos terminamos de hacer el diagrama de caso de uso, capaz si hay cambios lo actualizamos pero en principio esta','2023-04-18'),(5725,252,'Clase 10 - Creación de logo del proyecto','Hoy aproveché el día para crear el diseño del logo de DateTy. Cree varias opciones pero de todas esas consulté con mi equipo y pudimos elegir la indicada para nuestro proyecto. El logo lleva un simbolo de calendario en color violeta y a su lado lleva escrito DATETY en una buena tipografía que va con el diseño del calendario; de fondo el color negro para hacer combinación con el violeta del logo.','2023-04-18'),(5726,255,'dia 12 Martes 18 14 2023 ','trabajé arduamente en el mockup high fidelity y terminé la home-page ','2023-04-18'),(5727,266,'18/4 documentación api','Hoy me estuve dedicando a empezar la documentación de la rest API. También estuve viendo un poco de validaciones y de como autenticar la api, pero luego de mucho debate, voy a retomar más adelante el tema ','2023-04-18'),(5728,265,'18-04-2023','Estuve viendo tutoriales de como usar el sensor de ultrasonido y a la vez lo testeaba','2023-04-18'),(5729,253,'Martes 18/04/2023 - Personajes','Hoy pensamos en el contexto del videojuego, o sea, como iba a comenzar y terminar. Además pensamos el diseño del escenario principal y como serían los ambientes.','2023-04-18'),(5730,270,'18/04/2023','El día de hoy nos juntamos con el grupo para discutir sobre el contexto del juego al iniciar el mismo además y comenzamos a diseñar el escenario principal con sus plataformas y skylines.','2023-04-18'),(5731,283,'gs1, daily y gantt','Comenzamos el día visitando GS1 para conocer oportunidades de pasantía y la empresa. Esta exp. fue valiosa, ya que nos permitió conocer de cerca el funcionamiento de una empresa y las oportunidades que podríamos tener. Por otro lado, hemos concluido nuestra reunión diaria, aunque lamentablemente la mayoría del equipo no pudo asistir. Sin embargo, contamos con la presencia de un integrante valioso del equipo, Mangialavore N. Ezequiel. A pesar de la falta de miembros del equipo presentes, logramos avanzar significativamente en nuestras tareas, lo cual fue una gran victoria. &quot;Concluimos diagrama de Gantt para planificar y cumplir objetivos&quot;. &quot;Es importante la colaboración y comunicación en equipo para el éxito del proyecto. A pesar de las dificultades, seguimos avanzando hacia nuestros objetivos.&quot; En resumen, hemos tenido un día emocionante y productivo aprendiendo sobre la empresa GS1 y avanzando en la planificación de nuestro proyecto con la finalización del diagrama de Gantt. Con nuestro equipo unido y enfocado en nuestros objetivos, seguiremos trabajando juntos para alcanzar el éxito en nuestro proyecto.','2023-04-20'),(5732,286,'CSS, HTML de Usuario Web y Página Administrador e Interconexión de computadoras mediante servidor','El día de hoy fui a las 2 de la tarde a la empresa GS1 a tener una charla sobre de qué trata la empresa y como se desarrolla, luego de casi una hora volvimos a la escuela a retomar nuestras clases de Prácticas Profesionalizantes y seguir con la página web del proyecto. Empecé haciendo de 0 la página web para los usuarios, codeando en html y css. Más tarde, mi compañero Enzo Bartoletti, me pasó un par de extensiones para el Visual Studio Code para facilitarnos el codeo. Al rato, subí mi progreso de la página web de usuario al drive. Luego, con la ayuda de los profesores de la materia, logramos hacer una interconexión entre la computadora de mi compañero Christian y la mía para poder ver en tiempo real los cambios que va haciendo cada uno en los códigos de html y css. Para finalizar, fui haciendo modificaciones en el css de la página de usuario para ver si los cambios los podía ver mi compañero, nos dimos cuenta que todo funcionaba bien y nos pusimos contentos.','2023-04-20'),(5733,292,'Investigación de las api a utilizar ','Bitacora: \r\nDurante el dia de hoy, en conjunto a mi compañero Ledesma, utilizamos la totalidad del dia de clase para realizar la descarga de 5 cursos, los cuales abarcan PHP, Node, Java Spring, React y React Native, lo cual nos llevo practicamente la totalidad de la clase.\r\nEn el tiempo que no estuvimos con esta tarea, analizamos prototipados para administradores en conjunto e incentivamos a mis compañeros a realizar las dailys','2023-04-20'),(5734,293,'Investigación de Competencia','hoy inicie la investigación de Competencia comparando las ventajas y desventajas de nuestra pagina web con las otras\r\n ','2023-04-20'),(5735,274,'Página web de administradores','El día de hoy fuimos a una charla que brindaba la empresa &quot;GSI&quot; para conocer las actividades que realizan. Duró aproximadamente 1 hora. Al terminar, volvimos a la escuela a  seguir con nuestras actividades. Lo que hice fue continuar con el login de la pagina de administradores. También comparti los archivos a la pc que utilizaba un compañero, así podíamos editar ambos el archivo.','2023-04-20'),(5736,289,'Dia 20/4','Hoy hicimos lo siguiente:\r\nFuimos a la empresa GS1, en la cual nos brindaron una charla sobre las pasantías de la cual habían 2 puestos. Sobre que trataba la empresa y como funcionaba (y un rico te)  Luego de eso volvimos a la escuela e hicimos lo siguiente:  \r\n-Diagrama de Caso de uso\r\nEso es todo por hoy, muchas gracias!\r\n','2023-04-20'),(5737,282,'Charla GS1 / Tareas como Scrum Master y relacionados','Durante la jornada de hoy, hasta las 16:20 estuvimos fuera de la escuela, debido a una charla en la empresa GS1. Al volver, continué con mis labores de scrum master, ayudando y dandole una mano a mi compañero Andres Caceres a realizar los diagramas necesarios para el proyecto. Ademas de esto, colabore activamente con mis compañeros Filippa y Forte a encontrar extensiones utiles para la realizacion del codigo de HTML/CSS/PHP mientras a su vez conectamos remotamente las pc CS-01 y CS-03 para optimizar los tiempos y modos de trabajo, al trabajar el mismo archivo en dos computadoras a la vez, lo cual se logro realizar. Como ultimo punto de la jornada, conseguimos otra API relacionada con los mapas, la cual es de MapBox','2023-04-20'),(5738,278,'Clase N°10 20/04/23 ','En el día de hoy concurrí a una charla a las 14:00hs a la Empresa GS1 , en dicha charla hablamos sobre las pasantías que se hacen en la empresa, este año va a haber 2 vacantes , una para la Gestión de proyectos y otra para Trazabilidad. Yo elegí postularme para la Gestión de Proyectos , ya que ,  durante estos años practicamos mucho sobre la documentación y los diagramas. Luego de la charla volvimos al colegio y seguí con el diseño de la pagina web para nuestro proyecto de control de stock de la empresa de muebles.','2023-04-20'),(5739,277,'Décima Clase','Hoy empezamos el trabajo tarde ya que salimos de excursión, finalmente nos decidimos por un proyecto, vamos a llevar a cabo una página web para la venta de impresiones 3D. Hoy estuvimos haciendo la página principal y buscando modelos 3D para imprimir, además de aprender a hacer nuestros propios modelos en el programa de Blender.\r\n	También estamos buscando maneras de hacer nuestra página más llamativa que las demás.','2023-04-20'),(5740,279,'Dia 5 del proyecto','En este día estuve trabajando mayormente en los diagramas y además de hacer el daily del día de hoy aunque al final estuve haciendo mayormente la parte del diagrama del caso de uso extendido donde tuve que hacer varias tablas de Word y empezar a llenar estas con las informaciones necesarios del caso de uso usando el caso de uso que yo había hecho.','2023-04-20'),(5741,284,'Bitacora 5','Hoy tuvimos la visita a la empresa GS1 , nos hablaron sobre la trazabilidad  y la gestion de proyectos , eramos 2 cursos , nos explicaron sobre los 2 temas y nos dijeron que van a realizar 2 pasantias , es decir que hay 2 bacantes , para cualquiera,  yo me postule para gestión de proyectos,  luego volvimos al colegio , y seguimos con los diagramas , y con la pagina web','2023-04-20'),(5742,288,'Decima Clase','Hoy finalmente logramos ponernos de acuerdo en un proyecto emocionante y novedoso: una página web para la venta de productos creados con impresora 3D. Yo fui el responsable de crear la página web y trabajé con mis compañeros para seleccionar las imágenes y fijar los precios de los productos. Estamos muy entusiasmados de tener este proyecto en marcha y estamos considerando agregar descripciones detalladas de los productos para mejorar las ventas y seguir avanzando. Me siento orgulloso de haber contribuido a este proyecto y seguiré trabajando con mi equipo para hacer que nuestra página web sea la mejor.','2023-04-20'),(5743,290,'Novena','En el día de la fecha fuimos a una empresa y nos hablaron sobre lo que se hacía dentro de ella en modo de presentación, luego en el colegio hice el diagrama que me correspondía en mi grupo','2023-04-20'),(5744,298,'Clase 8','Hoy empezamos a hacer los diagramas, con Vicky estuvimos haciendo el de caso de uso. La clase que viene empezamos con el de secuencia.','2023-04-20'),(5745,275,'20-04-2023 ','ok para empezar lo que queria hacer hoy era terminar el camino critico, lo cual no pude porque primero se tiene que tener el Diagrama GANTT hecho, me dispuse a terminar dicho diagrma, al final pude terminarlo para empezar con el otro, no llegue al terminar el diagrama critico aunque bueno de igual modo tendre que actualizar estos dos diagramas constantemente (Cabe recalcar que hoy tuvimos poco tiempo como 2 horas de clase nomas porque tuvimos una charla empresarial).','2023-04-20'),(5746,281,'Dia 9','Hoy empezamos a trabajar un poco tarde ya que tuvimos que entrar a las 3:40 porque los profes se habian ido de excursión. Tuvimos la gran idea de empezar a encaminar nuestro proyecto a que sea una pagina que venda cosas hechas por una impresora 3d ya que un integrante del grupo posee una y podriamos recrear las cosas que pongamos en la página. Los objetos van desde llaveros hasta esculturas de series, películas, animes etc. Ya avanzamos bastante con la página falta diseñarla un poco mas pero creo que estamos en buen camino','2023-04-20'),(5747,280,'tareas','Desarrollamos la aplicacion de agilizacion para el proyecto asi extraer todos los archivos en la mayor brevedad posible\r\nDesarrollo del diagrama de gantt y el diagrama de secuencia tomando de base el orquestado en mysql\r\nDesarrollo de los primeros comando en la app del proyecto\r\nAsistencia a la empresa Gs1 para una charla de orientacion profesional y posibles pasantias las cuales se decidiran a traves de examenes en la cual tenemos las opciones de trazabilidad(linea de tiempo sobre objetos) y gestion de proyectos(Todo lo referente a la documentacion)','2023-04-20'),(5748,295,'Visita a empresa GS1 - Diagrama de flujo de datos','El día de hoy fuimos a la empresa de GS1 en la cual nos hablaron sobre dos puestos de pasantías y de que sea trataba cada uno, y las tareas que se tendrían que realizar, además de la explicación de lo que se trata la empresa. Al volver a la escuela junto a mi compañero empezamos a realizar el diagrama de flujo de datos.','2023-04-20'),(5749,276,'Proyecto &quot;Lu´s Shop&quot;: Diagrama Secuencia - Diagrama de Colaboracion - Investigacion de Competencia - Boceto Pagina Web a mano y Maqueta Software','El dia de hoy seguimos trabajando en base al nuestro proyecto en las PP, y esas son las siguientes:\r\n- Para empezar terminamos de realizar los Diagramas de Secuencia y de Colaboracion. Asi mismo aun quedan pendientes ciertos diagramas que por lo tanto seguirán en proceso.\r\n- Empezamos con la investigacion de la competencia, de modo que podamos ver las diferencias entre nuestra pagina web y las demas paginas que ofrecen los mismos servicios que la nuestra, esto para poder ver factores con los que cuenta nuestra pagina en especial, y demas factores con los que no contamos\r\n- Por ultimo, seguimos realizando el boceto a mano de la pagina web, y a su vez, seguimos realizando la Maqueta Software de modo de dar un ejemplo del diseño de nuestra pagina web.\r\nEso fue todo por hoy. ','2023-04-20'),(5750,291,'Avance de proyecto','El día de hoy empezamos las Prácticas Profesionalisantes tarde por que algunos alumnos tuvieron una excursión a la empresa GS1, entramos 15:45 porque ellos se fueron a las 14:00 y volvieron a las 15:45, también terminamos el Diagrama de Gantt, el Diagrama de secuencia, el Test de unitarios, y el desarrolló. Fue un día muy productivo para el poco tiempo que tuvimos.','2023-04-20'),(5751,287,'Proyecto &quot;Lu´s Shop&quot;: Diagrama Secuencia - Diagrama de Colaboracion - Investigacion de Competencia - Boceto Pagina Web a mano y Maqueta Software','El dia de hoy seguimos trabajando en base al nuestro proyecto en las PP, y esas son las siguientes:\r\n- Para empezar terminamos de realizar los Diagramas de Secuencia y de Colaboracion. Asi mismo aun quedan pendientes ciertos diagramas que por lo tanto seguirán en proceso.\r\n- Empezamos con la investigacion de la competencia, de modo que podamos ver las diferencias entre nuestra pagina web y las demas paginas que ofrecen los mismos servicios que la nuestra, esto para poder ver factores con los que cuenta nuestra pagina en especial, y demas factores con los que no contamos\r\n- Por ultimo, seguimos realizando el boceto a mano de la pagina web, y a su vez, seguimos realizando la Maqueta Software de modo de dar un ejemplo del diseño de nuestra pagina web.\r\nEso fue todo por hoy. ','2023-04-20'),(5752,294,'Visita a empresa GS1 argentina - Creacion diagrama flujo de datos','En el dia de hoy con la mitad del curso que se anoto fuimos a la empresa GS1 y tuvimos una charla en base a 2 puestos de trabajo como pasante con todos los requisitos y propuestas. \r\nCuando volvimos a la escuela realize con mi compañera un diagrama de flujo de datos que respecta al proyecto planteado con sus niveles respectivos.','2023-04-20'),(5753,273,'Clase 20-04-2023','En el día de la fecha realizamos una daily y hablamos sobre las tareas a realizar. En mi caso, yo seguí viendo el tutorial sobre cómo usar ReactJS.','2023-04-20'),(5754,299,'Hoy','En la reunión de hoy, concluimos el diagrama de Gantt y avanzamos en el\r\nprototipado rápido de la página, próxima fase del proyecto. El equipo ha trabajado\r\narduamente para finalizar el prototipado y pasarlo a Figma, una herramienta útil para\r\nel diseño de interfaces. Mangialavore ha completado los últimos diagramas,\r\npermitiendo una perspectiva detallada del proceso de desarrollo. Por otro lado,\r\nLobotrico ha comenzado el desarrollo del servidor de la página, tarea crucial para su\r\ncorrecto funcionamiento. A pesar de obstáculos, el equipo avanzó','2023-04-21'),(5755,283,'figma, diagramas y base de datos','Iniciamos etapa importante en proyecto: identificación de camino crítico y creación de diagrama flujo, esencial para planificación efectiva y cumplimiento de tiempo y forma. Hemos tomado decisiones importantes sobre recursos y herramientas para la creación de la página. Se eligió un servidor adecuado para el proyecto. Hemos optado por utilizar Java, CSS y HTML para crear una página web atractiva, funcional y eficiente. Es importante destacar que la elección de recursos y herramientas es crucial para el éxito del proyecto. Por ello, hemos analizado cuidadosamente y elegido las más adecuadas para cumplir con nuestros objetivos. En la próxima fase del proyecto, seguiremos trabajando en el diagrama de flujo y la implementación de las herramientas seleccionadas. \r\nMejoramos el diagrama de entidad - relacion para posterior poder continuar con la base de datos. tambien luego seguiremos con el prototipado de la pagina de figma. \r\n','2023-04-21'),(5756,272,'Figma de la página web','El día de hoy comencé a realizar el diseño de la página web en Figma, para su posterior realización en HTML. Importando librerías de la misma página para utilizar iconos y así complementar la misma.','2023-04-21'),(5757,278,'Clase N° 11 21/04/23','En el día de hoy me dedique a seguir con la pagina web , primero probé colocando un offcanvas a modo de menú pero finalmente no me convenció, por lo que inserte 2 cards en los cuales se va a encontrar el inventario de la empresa. También cambiamos el color de la pagina, antes era de color bordo y crema pero ahora decidimos hacerla de color gris con negro.','2023-04-21'),(5758,286,'Charla sobre GitHub, Intento de interconexión de computadoras y HTML y CSS de Usuario Web','El día de hoy empezó con una charla de scrum master (Enzo) sobre github, nos enseñaba una forma para que cada uno pueda subir las tareas que realizamos en el día de una forma más organizada. Al terminar esta charla intentamos, con mi compañero Christian y uno de los profesores, hacer la interconexion entre dos computadoras para que podamos trabajar conjuntamente y de una manera más rápida, al no poder realizar esto, seguí haciendo la página web del usuario, cambiando colores, ajustando tamaños, cambiando la fuentes de las letras, agregando checkboxs, etc.','2023-04-21'),(5759,292,'Investigación de apis, que resultó fallido','En el día de hoy me dedique a pleno a la investigación de las apis restantes para el mapa del proyecto con la supervisión de mi compañero Enzo bartoletti, luego de separar las más relevantes y que nos eran útiles nos dimos cuenta de que no eran gratis ya que mapbox solicitaba una tarjeta de crédito y por eso todo lo investigado fue sin sentido y volvimos desde 0. La próxima clase probaremos con otras opciones como openlayers y leaflet.','2023-04-21'),(5760,282,'Investigacion de API´s','En el día de hoy proseguí con la investigación de la API para el mapa relacionado con el proyecto, el cual investigamos y separamos lo mas relevante para nuestro proyecto.  Pero al querer descargar dichos módulos, la pagina MapBox solicitaba una tarjeta de crédito, lo cual no tenemos ni queremos poner. Por lo cual en la próxima semana probaremos otras dos alternativas de API´s, Openlayers y Leaflet. Además intentamos realizar como el día anterior la conexión entre las pc´s de Forte y Filippa, ademas de darle una mano a Caceres con los diagramas','2023-04-21'),(5761,284,'Bitacora 6','Hoy continue y finalice con los diagramas , ayude a mi compañero a finalizar el figma de la pagina web , y ayude a otro compañero con la pagina web , estuvimos haciendo rotoques ','2023-04-21'),(5762,296,'Bitácora 5','Hoy termine de hacer el prototipado de la página web en móviles y ayude a mis compañeros con un tema de diagramas y con la página web en si','2023-04-21'),(5763,291,'Avance de proyecto','El dia de hoy realice y termine el Camino crítico, el cual pude realizar ya que tenía a mi disposición el  Diagrama de Gantt para poder guiarme con la duración de cada tarea y el orden de estas, también realice el Diagrama de secuencia el cual no sabía hacer pero gracias a mi compañero Ciro al cual pregunté como se tenía que realizar y después de una breve explicación pude realizarlo y completarlo.','2023-04-21'),(5764,273,'Clase 21-04-2023','En el día de la fecha seguí viendo el tutorial de ReactJS.','2023-04-21'),(5765,293,'Corrección de diagrama entidad de relacion avance investigación de competencia ','hoy día corregí el diagrama entidad de relacion pero no logre terminarlo y sobre la investigación ya esta completa','2023-04-21'),(5766,293,'Corrección de diagrama entidad de relacion avance investigación de competencia ','hoy día corregí el diagrama entidad de relacion pero no logre terminarlo y sobre la investigación ya esta completa','2023-04-21'),(5767,293,'Corrección de diagrama entidad de relacion avance investigación de competencia ','hoy día corregí el diagrama entidad de relacion pero no logre terminarlo y sobre la investigación ya esta completa','2023-04-21'),(5768,279,'Dia 6 del Proyecto','En este día estuve mayormente siguiendo con completar el caso de uso extendido agregando mas tipos de casos de usos que estamos usando aunque posiblemente sea cambiado a futuro o parecido aunque también mi compañero de Proyecto, Enzo, Nos estuvo enseñando de como hacer algo con HitHub para tenerlo todo completo y poder subirlo a este aunque necesitaría que me explicara de nuevo y que también quería ayudarme con hacer los requerimientos aunque al final estuvo haciendo otras cosas.','2023-04-21'),(5769,298,'Clase 9','Hoy Vicky continuó con el diagrama de caso de uso, yo empecé con el diagrama de secuencia.','2023-04-21'),(5770,294,'Finalización diagrama de flujo - Daily','En el día de hoy primeramente hicimos la daily de todos los días con nuestros compañeros de trabajo\r\ndespues finalizamos con mi compañera el diagrama de flujo de datos con todos los niveles correspondientes ','2023-04-21'),(5771,276,'Proyecto Lu´s Shop: &quot;Vicson&quot;: Maqueta Software - Codificacion Pagina Web','El día de hoy seguimos realizando las siguientes tareas:\r\n- Para empezar seguimos completando la Maqueta Software, habiendo realizado algunas pestañas nuevas de las que teníamos pendientes, ya habiendo finalizado con la pestaña de Inicio, El diseño de secciones y un pequeño login. \r\n- Por otro lado, como nueva tarea, empezamos con la Codificación de la Pagina Web, ya teniendo el diseño de la pagina de Inicio de la pagina, empezamos a codificarla en HTML, aunque por el momento fue un pequeño avance, luego será trabajada mas a fondo e intentar que los resultados sean similares a los diseños de la Maqueta Software\r\nPor ultimo de modo de comentario, el nombre ya determinado de nuestro sitio web será &quot;VicSon&quot;, aun así el nombre del proyecto en si seguirá siendo Lu´s Shop: \r\nEso fue todo por hoy. ','2023-04-21'),(5772,289,'21-04','Hoy con caro avanzamos en los diagramas. Yo continúe con el diagrama caso de uso, mientras caro empezaba con el diagrama de Secuencia.\r\neso es todo por hoy, muchas gracias!!!','2023-04-21'),(5773,287,'Proyecto Lu´s Shop: &quot;Vicson&quot;: Maqueta Software - Codificacion Pagina Web','El dia de hoy seguimos realizando las siguientes tareas:\r\n- Para empezar seguimos completando la Maqueta Software, habiendo realizado algunas pestañas nuevas de las que teniamos pendientes, ya habiendo finalizado con la pestaña de Inicio, El diseño de secciones y un pequeño login. \r\n- Por otro lado, como nueva tarea, empezamos con la Codificacion de la Pagina Web, ya teniendo el diseño de la pagina de Inicio de la pagina, empezamos a codificarla en HTML, aunque por el momento fue un pequeño avance, luego sera trabajada mas a fondo e intentar que los resultados sean similares a los diseños de la Maqueta Software\r\nEso fue todo por hoy. ','2023-04-21'),(5774,285,'Dia 8 en PP','¿Que logre hacer hoy?\r\n\r\nHoy logré completar la etapa de diseño inicial del proyecto en papel y finalicé el esbozo del proyecto. También pude seleccionar adecuadamente los recursos y herramientas necesarios para el proyecto, incluyendo la elección de un servidor apropiado y las tecnologías de programación Java, CSS y HTML para crear una página web funcional y atractiva.\r\n\r\n¿En que se me complico?\r\n\r\n No experimenté ninguna complicación en el proyecto en cuestión.\r\n\r\n¿Qué estuve investigando?\r\n\r\nDurante el día, estuve investigando sobre las mejores prácticas para la implementación de programación Java, CSS y HTML en la creación de páginas web eficientes y atractivas. También estuve buscando diferentes herramientas y recursos para la creación de diagramas de flujo y la planificación efectiva de proyectos. Finalmente, estuve investigando sobre cómo crear bases de datos eficientes y efectivas para el proyecto en cuestión.','2023-04-21'),(5775,274,'Página web administradores','En el día de la fecha no pude avanzar demasiado, ya que junto a un docente intentamos compartir mis archivos de la página web a mi compañero, pero no pudimos. \r\nTambién estuvimos discutiendo algunas cuestiones con mis compañeros de equipo.\r\nAl final de la clase, ambos instalamos la extensión “Live Server” que nos recomendó nuestro docente, para así poder trabajar con distintas partes del código al mismo tiempo.','2023-04-21'),(5776,253,'Martes 25/04/2023 - Carpeta de Campo','Hoy el profe nos dijo que le metiéramos a la carpeta de campo porque ya se acercaba la entrega del 1er bimestre. Así que hoy yo me puse en el día con la carpeta de campo.','2023-04-25'),(5777,254,'25/04','Sigo con la carpeta de campo y termino a bdd','2023-04-25'),(5778,271,'25/4/23','En el día de la fecha. Comencé mi carpeta de campo en la cual el objetivo es llegar a 50 paginas aproximadamente, e informar sobre nuestro trabajo en la carpeta de campo de como va nuestro proyecto, ademas de contar un poco de que se trata nuestro proyecto','2023-04-25'),(5779,257,'25/04/2023','Hoy nos pusimos de acuerdo con nuestro grupo a hacer las carpetas en llamada, en aprender a hacer blueprints y hacer en lan el proyecto ','2023-04-25'),(5780,262,'25/05/23','EL día de hoy realizamos un dayli para charlar como encaminar el proyecto ya que un compañero se lesiono y no podrá asistir al colegio unas clases, después por otra parte tuvimos una charla con el profesor con el tema de la carpeta de campo y cerramos algunas dudas y tips que nos dio para poder completar de manera correcta la carpeta de campo y a continuación con esa información pusimos como prioridad la carpeta de campo el día de hoy','2023-04-25'),(5781,258,'25/4','hoy teste aver si nos deja importar el proyecto que tengo echo (osea la planta baja) del juego','2023-04-25'),(5782,301,'Agustin Barcia','Hoy empece a estudiar  unity blueprint para hacer el diagrama de comportamiento de  nuesstro juego','2023-04-25'),(5783,268,'25/04/2023','En la fecha de hoy agrege y mejore la carpeta de campo ademas de ayudar y aconsejar a mi grupo como a mis compañeros de curso.','2023-04-25'),(5784,259,'Martes 11/4 ','Hoy ya termine el DER, añadiendole ya las conexiones y de ultima algunas Foreign Key en otras tablas restantes. Para ya la clase siguiente empezar con todo la Base de Datos','2023-04-25'),(5785,297,'25/04/23','Actualice mi carpeta de campo y seguí viendo videos relacionados a lo que me corresponde del proyecto ','2023-04-25'),(5786,265,'25-04-2023','Hoy estuve haciendo la carpeta de campo y revisando las bitácoras anteriores para recordar que fue lo que hice.','2023-04-25'),(5787,256,'25/04/23','Ayer 24/04 busque referencias para el código de Java.\r\nHoy comencé la carpeta de campo ','2023-04-25'),(5788,251,'Investigación de las APIs 3 - 25/4/2023','El día de hoy continué trabajando con la API de prueba de PhP. Creé métodos para conectarse con la BDD y tomar todos los registros por una tabla y acceder a un registro específico por su ID, pero sin limpiar los datos aún.','2023-04-25'),(5789,252,'Clase 11 - Creación del Login','Hoy cree el Login para nuestro proyecto DateTy, para eso necesite crear 3 inputs, uno para el nombre, otro para la contraseña y un checkbox por si queres mostrar la contraseña. Pero crear 3 inputs diferentes, y teniendo que asignarle un estilo a cada uno, cree un componente Input el cual abarca a todos los inputs que hayan en el código. Esto permite que todos tengan los mismos atributos asignados, pero también te permite modificar cada uno a tu gusto en el Login o cualquier otra clase que necesites de un Input','2023-04-25'),(5790,263,'25/4','Hoy el profe nos pregunto sobre como iba nuestro proyecto, estuvimos hablando mas que nada de los diagramas y de la inteligencia artificial que tendrá nuestro juego y arreglamos de que tendremos que hacer estos diferentes diagramas que representaran diferentes partes de nuestro juego estos diagramas luego tendrán que ser interpretados y pasados a codigo que utilizara el juego para ejecutar las diferentes partes.\r\n\r\n','2023-04-25'),(5791,250,'25 4 2023 martes dia 12','hoy no hice nada :33','2023-04-25'),(5792,267,'25/04/2023','Hoy me dediqué a hacer la carpeta de campo.','2023-04-25'),(5793,260,'25/04/23','Hicimos un pull del about y tuve unos errores por descuidos mios, ya estan solucionados y creamos un componente input','2023-04-25'),(5794,261,'25/04/2023','Hoy hice la carpeta de campo e investigue mas codigos.\r\n','2023-04-25'),(5795,255,'25 4 2023 martes dia 12','hoy avance con el logo y la página web como de costumbre','2023-04-25'),(5796,266,'25-4 Cambio de login','Hoy me estuve enfocando en la api, especificamente en la creacion de el endopoint de login con hash y guardado en bdd. tambien complete mi carpeta de campo','2023-04-25'),(5797,257,'26/04/2023','Hoy avanzamos con la carpeta de campo, pensamos como seria usar realidad aumentada, solo que no terminamos de decidir','2023-04-26'),(5798,269,'26/04/2023','Hoy continúe con el curso de javascript y avance mucho, mientras ponía en práctica todo lo que aprendí ','2023-04-26'),(5799,251,'26/04/2023 - Finalización de Pruebas API y Carpeta de Campo','El día de hoy finalicé el curso de APIs en PhP con Leaf, dejando la rama de pruebas API finalizada. Funciona a modo de CRUD, con get, post, put y delete. Luego, empecé con la carpeta de campo, para poder llegar a las 50 páginas antes del lunes. ','2023-04-26'),(5800,250,'Dia 14 MIERCOLES 26/4/2023','Hoy comencé y elabore 7 paginas de la carpeta de campo','2023-04-26'),(5801,265,'26-04-2023','Estuve mirando vídeos en youtube para poder terminar la programación del sensor de ultra sonido y completando parte de la carpeta de campo','2023-04-26'),(5802,268,'25-04-2023','El día de hoy mejore la carpeta de campo agregando una carátula y en Tinkercad mejore el motor del sumo. Ahora puede avanzar, retroceder y girar. Todo a través de los videos de “Sistema de Bibliotecas - Alcaldía de Medellín”.','2023-04-26'),(5803,254,'26/04/23','Estoy por terminar la carpeta de campo, para poder ver junto a kiara el frontend ','2023-04-26'),(5804,271,'26/4/2023','En el día de hoy ayude a mis compañeros Enzo Romanniello, Emilio Pereira, Luis Meza y Valentín Bentos con la vista principal de nuestro juego','2023-04-26'),(5805,259,'26/4 Nahuel Moreno','Hoy termine de hacer las tablas en cuestión del Sql, sus conexiones y ya agregue una numerosa cantidad de objetos para Ingredientes varios y luego hacerlo con Recetas. Pasa q luego de q se frizzara mi compu tuve q rehacer las cosas y no llegue tan lejos como cuando estaba, afortunadamente no tuve q rehacer todo otra vez xD.','2023-04-26'),(5806,262,'26-04-2023','El día de hoy agregamos texturas a nuestro trabajo de unity y también el profesor gonzalo consorti nos recomendó hacer el juego compatible con la realidad virtual y realice algunas publicidades/presentaciones del mismo con el juego. También tuvimos una charla extensa, sobre si vamos a aplicar esta compatibilidad al juego, pero no llegamos a un acuerdo definitivo.','2023-04-26'),(5807,264,'26/04 - Investigación de Backend','','2023-04-26'),(5808,263,'26/4/23','Hoy nos centramos mas en completar la carpeta de campo con mas explicaciones y fotos, tambien el profesor nos dio la idea o posibilidad de poder hacer el proyecto usando unos lentes 