cambie el diseño 3D agregando el protoboard.','2023-04-26'),(5819,283,'Diagrama entidad-relacion, figma, base de datos.','\r\nno pudimos avanzar en algunas cosas como el prototipado para ya empezar a hacer la pagina o avanzar con la base de datos. todo esto se debe a la falte de un ontegrante que tenia \r\nel prototipado para hacer la pagina. Pero igualmente pudimos avnzar con el diagrama de entidad relacion para poder terminar de una vez con la base de datos. \r\nEl dia de mañana seguiremos con la pagina y el armado de la base de datos para ya ternibar el armado del proyecto. luego conectarla pagina cpon php y mmysql. ','2023-04-27'),(5820,292,'Carpeta de campo y api','Bitácora:\r\n En el día de hoy junto a mi compañero Enzo bartoletti comenzamos la clase buscando y descargando mapas apis para nuestro proyecto pero no llegamos a probarlos debido a que no había wifi. Luego procedí a ayudar a mi compañero Enzo con su bitácora y continúe haciendo la mía con ayuda de la carpeta de campo de mo compañero y debido a que el profesor nos informó que debía ser formato norma apa tuve que cambiar la mayoría','2023-04-27'),(5821,285,'Dia 9 en PP','¿Que logre hacer hoy?\r\n\r\nHoy se logro completar el diagrama entidad relación y avanzar en la base de datos del proyecto en conjunto con mi grupo durante la sesión de trabajo.\r\n\r\n¿En que se me complico?\r\n\r\nNo pudimos avanzar en algunas cosas como el prototipado para hacer la página o avanzar la base de datos debido a la falta de un integrante del grupo que tiene el prototipo hecho en figma.\r\n\r\n¿Qué estuve investigando?\r\nNo estuve investigando nada en particular ya que me dediqué a avanzar en la parte del proyecto que me correspondía.\r\n','2023-04-27'),(5822,285,'Dia 9 en PP','¿Que logre hacer hoy?\r\n\r\nHoy se logro completar el diagrama entidad relación y avanzar en la base de datos del proyecto en conjunto con mi grupo durante la sesión de trabajo.\r\n\r\n¿En que se me complico?\r\n\r\nNo pudimos avanzar en algunas cosas como el prototipado para hacer la página o avanzar la base de datos debido a la falta de un integrante del grupo que tiene el prototipo hecho en figma.\r\n\r\n¿Qué estuve investigando?\r\nNo estuve investigando nada en particular ya que me dediqué a avanzar en la parte del proyecto que me correspondía.\r\n','2023-04-27'),(5823,276,'Lu´s Shop: &quot;VicSon&quot; - Boceto Pagina Web a mano -  Maqueta Web - Codificacion Pagina Web','El dia de hoy seguimos trabajando en base a nuestro proyecto de las PP, las tareas que realizamos fueron las siguientes:\r\n- Habiendo finalizado el Boceto de Pagina Web a Mano, y habiendo diseñado distintas pestaña en papel, hemos podido terminar de realizar la Maqueta Software, habiendo hecho un diseño mucho mas definido sobre las pestañas en si, ademas de las pestañas de inicio y de la seccion ya realizadas, diseñamos mas sobre la pestaña de login, tambien agregando un diseño de una pagina de registro de cuenta, una pestaña donde se muestran los detalles de los productos, la pestaña del carrito de compras y ciertas pestañas a la hora de realizar la compra y abonar, junto con un diseño de factura.\r\n- Por otro lado, aun seguimos trabajando en base a la codificacion de la pagina de Inicio, la cual por el momento esta quedando bastante similar a la de la Maqueta Software. \r\n\r\nPor otro lado, seguimos realizando y actualizando ciertos diagramas.\r\n','2023-04-27'),(5824,289,'27/4','El dia de hoy, con caro terminamos el diagrama de secuencia ademas de terminar el diagrama de Caso de uso. \r\nMientras en este proceso, vimos en video en vivo de un proyecto de Cansat.\r\nAdemas hoy realize el examen para entrar GS1 en el area de Gestion.\r\nEso es todo por hoy, muchas gracias!!!','2023-04-27'),(5825,293,'diagrama entidad relación','hoy dia comenze a realizar el diagrama entidad relación.','2023-04-27'),(5826,286,'CSS y HTML de la página de Administrador','El día de hoy empecé descargando los archivos de HTML y CSS que anteriormente había modificado mi compañero Christian para abrirlos con la aplicación de Visual Studio Code. Una vez abiertos todos los archivos y teniendo todo listo, lo primero que intenté hacer fue intentar camniar la fuente de los textos de la página a un tipo de fuente que había descargado hace unas semanas. Luego de ver varios videos y tutoriales de como hacerlo, decanté por rendirme, ya que no encontré la forma de usar la fuente. Más tarde consulté al scrum manager que era más viable trabajar. Seguí trabajando, agregando botones, modificando textos, modificando el footer de la página, ordenando todo el CSS para que esté acorde con el HTML y comentando los dos códigos.','2023-04-27'),(5827,291,'Avance del proyecto','El día de hoy al inicio de la clase hicimos la daily, hablas de las tareas que faltaban y le pedimos al integrante de nuestro grupo que no pudo asistir el prototipado figma para poder terminar el diseño de la pagina y poder empezar a hacerla, también modifique con mi compañero Ciro el diagrama de entidad-relacion, lo arreglamos, borramos y ajustamos algunas tablas que no estaban correctas.','2023-04-27'),(5828,287,'Lu´s Shop: &quot;VicSon&quot; - Boceto Pagina Web a mano -  Maqueta Web - Codificacion Pagina Web','El dia de hoy seguimos trabajando en base a nuestro proyecto de las PP, las tareas que realizamos fueron las siguientes:\r\n- Habiendo finalizado el Boceto de Pagina Web a Mano, y habiendo diseñado distintas pestaña en papel, hemos podido terminar de realizar la Maqueta Software, habiendo hecho un diseño mucho mas definido sobre las pestañas en si, ademas de las pestañas de inicio y de la seccion ya realizadas, diseñamos mas sobre la pestaña de login, tambien agregando un diseño de una pagina de registro de cuenta, una pestaña donde se muestran los detalles de los productos, la pestaña del carrito de compras y ciertas pestañas a la hora de realizar la compra y abonar, junto con un diseño de factura.\r\n- Por otro lado, aun seguimos trabajando en base a la codificacion de la pagina de Inicio, la cual por el momento esta quedando bastante similar a la de la Maqueta Software. \r\n\r\nPor otro lado, seguimos realizando y actualizando ciertos diagramas.\r\n','2023-04-27'),(5829,275,'Examen GS1 y documentación de caso de uso ','Pues bueno, hoy lo que yo hice fue aparte de tener un examen de la empresa GS1 fue hacer la documentación del diagrama de uso, lo del examen fue una gestión de proyecto pues lo que me pedía era ordenar un grupo de tareas en el orden que me pareciera y documentar porque lo hacía de esta manera.','2023-04-27'),(5830,284,'Bitacora 7','Hoy realice la prueba de la empresa gs1 , la verdad fue sencillo , nada complicado , y luego realicé algunos diagramas para adelantar el proyecto','2023-04-27'),(5831,299,'Hoy','Hoy hicimos el prototipado de página y corregimos diagramas a pesar de la falta de Internet en las maquinas','2023-04-27'),(5832,295,'Diagrama de flujo de datos - Prototipado app movil','En el dia de hoy termine el diagrama de flujo de datos junto a mi compañero y empezamos con el prototipado de la aplicacion móvil, mientras veía la capacitación de cansat \r\n\r\n','2023-04-27'),(5833,282,'Tareas de scrum master y diseño de la pagina web','Durante la jornada de Practicas Profesionalizantes realicé varias actividades relacionadas con el proyecto; mi primera medida del día fue charlar con Caceres acerca de la realizacion de los diagramas correspondientes y los avances en relacion a la semana anterior.\r\nAdemas se le solicitó a todos los alumnos la adaptacion de la carpera de campo a las normas APA, lo cual ya realicé.\r\nEn materia de las visuales del proyecto, proseguí con los prototipados post login para los administradores en conjunto a mi compañero Christian Forte y además de lo anteriormente mencionado realicé avances en el html del login en conjunto con mi compañero Manuel filippa','2023-04-27'),(5834,280,'Capacitacion ','Se realizo paralelo al proyecto una capacitacion de cansat q incluye 