HTML y CSS que había modificado el día de ayer para volver a abrirlos con la aplicación de Visual Studio Code. Una vez abierto todos los archivos y teniendo todo listo,  me puse a descargar las extensiones de la aplicación para que me ayuden a codear más rápido y que el proceso sea más llevadero. Empecé corrigiendo los tamaños del div del centro de la página, agrandando los input de tipo text y password, el tamaño de la letra de P.D.L.C., saqué los textos de usuario y contraseña y los puse dentro de los input respectivamente haciendo uso del &quot;placeholder&quot;, también cambié los bordes del div y del botón que ahora dice &quot;Iniciar Sesión&quot;. Más tarde ajuste el tamaño del footer. Para finalizar el día de trabajo pude encontrar la forma de ingresar y usar la fuente de texto que había descargado semanas antes, ayudándome con un trabajo práctico que había hecho hace 2 años.','2023-04-28'),(5840,283,'base de datos y prototipado de la pagina web en figma','El dia de hoy ayude al prototipado de la pagina web en figma, añadimos un footer, un header, favoritos para que los compradores puedan guardar los items que mas les gusten, logos para la pagina. Luego realice la base de dato dentro de mysql, lo cual primero la quise hacer en la interfaz pero decidí hacerlo en código donde cree las 4 tablas con sus respectivas primary key y foreign. La semana que viene voy a terminar de delegar el trabajo para los demas y luego seguir con la base de datos para hacer los respectivos inserts para luego ya en la página web poder conectarla con la base de datos con php. ','2023-04-28'),(5841,272,'28/04 Prototipado de página principal','Hoy junto a Nicolas Mangialavore terminamos el diseño principal de la página, con sus respectivos botones, secciones y funciones. Faltan partes de la página tales como el carrito, los ítem favoritos de la página, una barra de búsqueda funcional y la función de registrarse e iniciar sesión en la página.\r\nDe momento lo realizado es una tarjeta de ítem disponibles o novedosos, sección de ofertas y destacados, sin olvidar el header y footer de la página principal. ','2023-04-28'),(5842,291,'Avance del proyecto','El día de hoy empezamos realizando la daily la cual fue corta porque faltaron la mayoría de integrantes de nuestro grupo pero afortunada mente un compañero más se nos unió a la clase tarde. Este día empezamos a progresar con el ptrototipado figma la cual no pudimos avanzar la clase anterior debido a que el compañero que lo creó falto por algunos problemas, empeze investigando como funcionaba el figma porque es la primera vez que lo uso, pero afortunadamente el compañero que se nos unió tarde sabia como usarlo y me ayudó a entender como usar figma, agregamos iconos de redes sociales de la pagina, tambien agregamos una sección de ofertas y creamos otra parte de la página con su header y footer correspondiente y a esa nueva parte de la página pusimos una sección de destacados, el día de hoy avanzamos un montón a comparación del dia anterior.','2023-04-28'),(5843,279,'Dia 8 del Proyecto','En el día de hoy estuve ahora maso menos haciendo el trello via en GitHub así para tener una idea de como se organiza eso si lo tuve que hacer en la cuenta de GitHub de Enzo al ser quien lo creo y después estuve haciendo los requerimientos con la ayuda de Enzo también para después de terminar el día haciendo el daily.','2023-04-28'),(5844,284,'Bitacora 8','Hoy estuve ayudando a mis compañeros con la pagina web y finalicé todos mis diagramas','2023-04-28'),(5845,292,'carpeta de campo','en el dia de hoy me la pase todo el dia realizando cambios a la carpeta de cambio ya que se acerca la fecha de entrega ','2023-04-28'),(5846,278,'Clase N° 12 28/04/23','En el día de hoy empezamos haciendo la daily como todos los días que trabajamos en el proyecto , luego de la reunión continúe realizando la pagina web, esta vez empecé con la parte del inventario, intente hacerlo con Bootstrap pero no me gustaba el resultado, entonces busque en internet un modelo para tener de guía y empecé a hacerlo por mi cuenta.','2023-04-28'),(5847,293,'Actualización de carpeta de campo y avance de base de datos ','hoy día actualice la carpeta de campo con la norma APA pero no la termine y estuve avanzando un poco la  base de datos.','2023-04-28'),(5848,274,'Modificación prototipado login de administradores','En el dia de la fecha lo que hice fue hacer algunas modificaciones en el prototipado de inicio de sesion de los adminsitradores. También investigué un poco acerca de como hacer un reponsive. ','2023-04-28'),(5849,273,'Clase 28/04/23','En el día de la fecha empecé a experimentar con ReactJS, sobre cómo haremos la página y las funciones que está tendra','2023-04-28'),(5850,296,'Bitácora 6 ','Después de terminar el prototipado empezamos a armar la página desde el formato de móvil ','2023-04-28'),(5851,276,'Carpeta de Campo ','El dia de hoy, dado a ciertas circunstancias dentro de las PP, tuve que darle ciertos arreglos a mi carpeta de campo.\r\n- Para empezar, necesitaba completar cierta documentacion faltante en si, dentro de las actividades en los modulos de las PP y tambien relacionadas a los proyectos que venimos realizando grupalmente y en este caso sobre el desarrollo que le dimos hasta el momento a nuestro proyecto de Tienda Virutal.\r\n- Por otro lado, debía darle ciertas modificaciones a los formatos de la carpeta de campo en si, ya que se dicto que tenia que coumplir con ciertos formatos especificos para su aprobacion, incluyendo fuentes, sangrias, tamaño del papel y demas. \r\nPor lo tanto este dia me dedique a actualizar mi carpeta de campo personal. ','2023-04-28'),(5852,287,'Carpeta de Campo ','El dia de hoy, dado a ciertas circunstancias dentro de las PP, tuve que darle ciertos arreglos a mi carpeta de campo.\r\n- Para empezar, necesitaba completar cierta documentacion faltante en si, dentro de las actividades en los modulos de las PP y tambien relacionadas a los proyectos que venimos realizando grupalmente y en este caso sobre el desarrollo que le dimos hasta el momento a nuestro proyecto de Tienda Virutal.\r\n- Por otro lado, debeia darle ciertas modificaciones a los formatos de la carpeta de campo en si, ya que se dicto que tenia que coumplir con ciertos formatos especificos para su aprobacion, incluyendo fuentes, sangrias, tamaño del papel y demas. \r\nPor lo tanto este dia me dedique a actualizar mi carpeta de campo personal. ','2023-04-28'),(5853,269,'02/05/2023','Hoy martes 2 de mayo continúe con el curso de javascript, y aprendi que son y cómo utilizar Arrays, arrays asociativos, y parte del funcionamiento de bucles e interacción (while, for, etc)','2023-05-02'),(5854,297,'02-05-23','corregimos los diagramas ','2023-05-02'),(5855,271,'2/5/2023','En el día de hoy continúe con mi carpeta de campo para llegar al objetivo de las 50 paginas','2023-05-02'),(5856,262,'02-05-2023','El día de hoy nos movimos de espacio de trabajo a otro laboratorio y tuvimos que volver a hacer el proceso de instalación de unity ya que estas computadoras son nuevas. Por otra parte ayudamos a nuestro compañero Diego Saracino a completar la carpeta de campo y cerramos algunas dudas con el profesor sobre la base de datos.','2023-05-02'),(5857,268,'02/05/2023','Hoy comense con las ideas para el logo y nombre del equipo hice 4 modelos en canva.','2023-05-02'),(5858,253,'Martes 02/05/2023 - Correción de base de datos','Hoy me dediqué a resolver un error que tenía que en la base de datos.','2023-05-02'),(5859,257,'02-05-2023','hoy recupere un poco del progreso en la carpeta de campo que perdi tras un apagon de internet','2023-05-02'),(5860,251,'Inicio de la API - 02/05/2023','El día de hoy creé la API que usaremos en el proyecto en la rama Desarrollo_API. Descargué el Framework Leaf y creé un nuevo proyecto. Creé los modelos de las tablas de la BDD y empecé a crear el controlador de la tabla Ingrediente.','2023-05-02'),(5861,256,'02/05/23','Presentamos el diagrama UML al profe nahuel y