e campo. Yo no llegue a hacer mucho.','2023-05-03'),(5873,250,'Dia 16 Miercoles 03 05 2023','Hoy terminé la carpeta de campo','2023-05-03'),(5874,297,'03/05/23','vi videos para reforzar contenidos sobre el frontend ','2023-05-03'),(5875,263,'3/05/23','Hoy entregue la carpeta de campo aunque es probable que modifique su contenido o corrija ciertas cosas, el caso es que seguiremos trabajando en el proyecto durante estas semanas.','2023-05-03'),(5876,268,'03-05-2023','Hoy con mis compañeros de grupo pensamos nombre animales y colores para el logo y Bolla hicimos algunos bocetos del logo.','2023-05-03'),(5877,258,'03-05-23','Hoy no hicimos mucha cosa solo entregamos la carpeta de campo aun que es muy probable qu eme pidan mas cosas en la carpeta de campo pero se lo entrego así','2023-05-03'),(5878,260,'','Estuve ayudando a gonza explicandole algunos conceptos del DOM, y Dylan me ayudó y me empezó a explicar como fue construyendo la api, y me enseñó a usar postman, estuve practicando hacienod algunas operaciones con la api que el hizo y como la api anda anduevieron bien','2023-05-03'),(5879,251,'Controlador de Ingredientes e investigaciones - 03/05/2023','El día de hoy finalicé el controlador de la tabla Ingrediente y decidí investigar acerca de las funcionalidades que el framework Leaf me proveía, sobre todo aquellas respecto al usuario. Investigué acerca de los tokens, las sesiones, las autenticaciones y muy levemente respecto a la BDD. Queda pendiente continuar con esto y, de ser posible, una especie de integración con Lavarrel (otro Framework de PhP) sugerida por el profesor Consorti.','2023-05-03'),(5880,267,'3/5/2023','Busqué nombres para el grupo en chat GPT','2023-05-03'),(5881,257,'3/5/2023','hoy estuve completando la carpeta de campo ','2023-05-03'),(5882,252,'Clase 14 - Estilos Login Terminados','En la clase de hoy me enfoque en terminar los estilos del Login utilizando jsx, pero para ciertos estilos tuve que utilizar un archivo css aparte. También le agregué una imagen para que ocupe espacio en blanco de la página y quede agradable a la vista todo en conjunto gracias a la elección de colores.','2023-05-03'),(5883,254,'03-05-23','modifique el DER y termine la base de datos','2023-05-03'),(5884,261,'03/05/2023','hoy termine el diseñado 3D del ROBOT SUMO. ','2023-05-03'),(5885,259,'3/5 Nahuel Moreno Practicas Profesionalizantes','Pese a que la maquina se me frizzo y perdí alguno de los ingredientes, hoy estuve mas que nada con el sql agregando ingredientes para mas tarde empezar a hacer Recetas con esos mismos ingredientes, que luego ordenare en orden de carnes, frutas y de manera alfabetica ','2023-05-03'),(5886,256,'03/02/23','Hice cambios en el uml en las clases persona, fecha,  ticket y pedido. Los cambios están comentados en el diagrama ','2023-05-03'),(5887,266,'03 5- servicen en front end ','Hoy estuve investigando sobre fetch y como hacer los services de el backend con la rest api','2023-05-03'),(5888,269,'03/05/2023','aprendí que es una api. Aprendí a instalar node.js. Hoy empecé a ver un vídeo de React para saber para que sirve.\r\nLuego, con el resto de la clase empecé un curso de 8 horas para aprender a usar React, y llegue hasta el minuto 45 del vídeo.','2023-05-03'),(5889,301,'Agustin Barcia','Hoy empece a realizar el diagrama de acciones con el blueprint y continue la investigacionb del mismo\r\n','2023-05-03'),(5890,265,'03-05-2023','hoy estuve haciendo el logo y nombre del equipo utilizando una pagina y el programa After Effects','2023-05-03'),(5891,262,'03-05-2023','El día de hoy instale nuevamente el Unity HUB y  el Blender en las computadores nuevas, ya que ayer nos cambiamos de laboratorio y no estas computadores no tenían los programas que necesitamos para el proyecto. Luego de terminar instalar los programas me puse  a realizar bocetos del juego ya que quedaba poco tiempo de trabajo.','2023-05-03'),(5892,280,'No salida a la uba','El dia de hoy se realizo un curso sobre javas script y node donde se plasmaron conceptos basicos tales como:\r\nCreacion de clase\r\nCreacion de objetos\r\nAtajos dentro de javascript\r\nInstalacion y manejo de paquetes en node\r\n\r\nJunto con eso se actualizo el diagrama de gantt colocando la sultimas tareas realizadas y a realizar junto con la creacion de otro diagrama de gantt el cual evalua el desarrollo semanal y no el del todo el proyecto\r\nSe realizo una daily individual ya que los compañeros de trabajo acudieron a una charla en la Facultad de Ciencias Exactas','2023-05-04'),(5893,279,'Dia 9 del Proyecto','En este dia estuve no haciendo mucho si no mas bien haciendo algunas modificaciones al caso de uso extendido y los requerimientos ademas de hacer la daily de hoy y despues en toda la clase estuve viendo de aprender a usar HTML','2023-05-04'),(5894,293,'Uba ciencias exactas','Hoy día fuimos a la universidad uba de ciencias exactas dónde nos explicaron toda la info','2023-05-04'),(5895,285,'Dia 10 PP - Salida a la UBA ','¿Qué logré hacer hoy?\r\nHoy asistí a una charla sobre ciencias de la computación en la Universidad de Buenos Aires. Me registré temprano y tuve la oportunidad de conocer a otros asistentes. Durante la charla, aprendí mucho sobre la historia y evolución de la informática, así como también sobre los desafíos actuales en la industria de la tecnología.\r\n\r\n¿En qué se me complicó? \r\nNo experimenté ninguna complicación durante la charla. Fue una experiencia muy agradable y bien organizada.\r\n\r\n¿Qué estuve investigando? \r\nEstuve investigando sobre la ciencia de la computación y su impacto en diferentes áreas de la vida, así como también sobre los desafíos actuales en la industria de la tecnología. También aprendí sobre la inteligencia artificial y el aprendizaje automático. Además, investigué sobre cómo los científicos de la computación están trabajando para superar estos desafíos y mejorar la tecnología en el futuro.\r\n','2023-05-04'),(5896,274,'Salida a la U.B.A.','En el día de la fecha tuvimos una salida a la Facultad de Ciencias Exactas y Naturales de la Universidad de Buenos Aires. Ahí nos dieron una charla acerca de las carreras que se dictan en esa facultad. La misma tuvo una duración aproximada de 2 horas.','2023-05-04'),(5897,283,'Salida a la Ciudad Universitaria de Buenos Aires','Hoy asistí a una charla sobre ciencia de la computación en la UBA en el salón de conferencias de la facultad de ciencias exactas y naturales. Los organizadores dieron la bienvenida y presentaron al orador principal, un reconocido profesor de ciencias de la computación, quien habló sobre la historia y evolución de la informática. Luego, explicó cómo la computación ha impactado en diferentes áreas de la vida. Como drones, autos autónomos o agilización de procesos. La charla fue interesante y educativa. Después de la charla, hubo una sesión de preguntas y respuestas donde pudimos hacerle preguntas al orador principal.','2023-05-04'),(5898,282,'Charla en UBA - Licenciatura en ciencias de la computacion','En la tarde de hoy, en conjunto a 6° 1° asistimos a un encuentro en el pabellón cero mas infinito de la UBA, ubicado en ciudad universitaria. Este encuentro duro dos horas y media y relato los aspectos mas importantes de la carrera de Licenciado en ciencias de la computación, dictada en este espacio. Esta charla explico acerca de las materias presentes en el plan de estudios, nos invito a pensar si en distintas problemáticas se podría aplicar la computación y los campos de trabajo donde esto se puede aplicar.','2023-05-04'),(5899,292,'charla en la uba','en el día de la fecha no asistimos a la jornada de practicas profesionalizantes debido a que asistimos en conjunto con los demás compañeros de 6 segunda a una charla sobre la carrera de licenciatura en ciencias de la computación en  la facultad de ciencias exactas en la ciudad universitaria pabellón 1, la charla duro aproximadamente 2 horas y media en la cual se nos comentaba las problemáticas, una visión sobre que trataba la materia junto con los objetivos a alcanzar, la cantidad de materias que debíamos rendir y de que manera, donde teníamos que asistir, se nos dijo que para asistir a la facultad primero debíamos realizar el correspondiente cbc.','2023-05-04'),(5900,286,'Charla sobre la carrera de Ciencias de la Computación','Hoy luego de terminar la materia de Educación Física me fui con mis compañeros de clase directamente a Ciudad Universitaria, donde entramos al pabellón o + ? donde recibí una charla sobre qué es la Ciencia de la Computación y qué veremos en esa carrera si es que la elegimos. Luego de una introducción y una explicación de toda la carrera, hablando sobre las materias, las cantidad de años que dura la carrera, los lenguajes de programación que veremos y un montón de cosas mas, con una duración de 2 horas y media, concluyó la charla y realicé un cuestionario sobre la charla que recibimos. Al terminar esto, volví a la escuela.','2023-05-04'),(5901,289,'4/5','El día de hoy, el curso concurrimos a la universidad de ciencias exactas y naturales. Fuimos para una charla informativa de licenciatura de ciencias de la computación. Fue una carrera interesante, pero no creo seguirla.\r\nEso fue todo por hoy, muchas gracias!!! ','2023-05-04'),(5902,295,'Charla en la UBA de Ciencias de la Computación ','En el día de hoy fuimos a la facultad de UBA exactas en donde nos hablaron sobre la carrera de Licenciatura en Computación, que se trata de como resolver gracias a la computación  problemas cotidianos de la vida, también nos mostraron la comparación con otras carreras y porque elegir esa, además nos explicaron cómo sería la inscripción y que hay que hacer el cbc antes de poder ingresar a la facultad. Me gustó mucho la charla ya que podría llegar a ser la carrera que elija a futuro.','2023-05-04'),(5903,275,'UBA','Hoy fuimos a la ciudad universitaria (UBA) para iniciar el ciclos de charlas de la facultad de ciencias Exactas y naturales de la UBA, la charla fue hecha sobre temas de computación, mas que nada orientados a lo que queremos/deberíamos estudiar o hacer en el futuro de nuestras carreras,. ','2023-05-04'),(5904,284,'Bitacora 9','Hoy fuimos a la facultad de ciencias exactas y naturales , tuvimos una charla sobre la informática dentro de esa facultad , hablamos sobre las materias y sobre el CBC de esa facultad.\r\nFue muy interesante y me sirvió para informarme mas sobre mis futuros estudios ','2023-05-04'),(5905,287,'Salida Didáctica UBA','El día de hoy participamos de una salida didáctica en la Facultad de Ciencias Exactas y Naturales en la cual tuvimos una charla sobre las carreras que se llevan a cabo dentro de esta. \r\nLa charla fue conllevada por un profesor de ciencias el cual nos dio una introducción a al carrera de computación, mostrándonos sus utilidades, sus contenidos, los años que conlleva obtener una licenciatura, profesorado y bachillerato dentro de la carrera y demás información sobre los temas dentro del mismo. \r\nDebido a dicha charla, eso fue lo único realizado el di de hoy. ','2023-05-04'),(5906,276,'Salida Didáctica UBA Facultad Ciencias Exactas y Naturales','El día de hoy participamos de una salida didáctica en la Facultad de Ciencias Exactas y Naturales en la cual tuvimos una charla sobre las carreras que se llevan a cabo dentro de esta. \r\nLa charla fue conllevada por un profesor de ciencias el cual nos dio una introducción a al carrera de computación, mostrándonos sus utilidades, sus contenidos, los años que conlleva obtener una licenciatura, profesorado y bachillerato dentro de la carrera y demás información sobre los temas dentro del mismo. \r\nDebido a dicha charla, eso fue lo único realizado el di de hoy. ','2023-05-04'),(5907,273,'Bitacora 05/05/2023','En el día de la fecha llegué y me di cuenta que había una nueva problemática para el proyecto: no sabía qué tipo de base de datos iba a usar (relacional o no relacional) por lo que empecé a ver distintas formas de hacerlo. Por los distintos vídeos y recomendaciones que vi, me di cuenta que debería usar una base de datos no relacional, y para esto usaría MongoDB. El año pasado tuvimos un poco de clases acerca de este tipo de programa, pero no lo vimos en conjunto con ReactJS o NodeJS. Así que, empezaré a ver tutoriales acerca de cómo usarlos en conjunto y, a su vez, cómo debería hacer el inventario de muebles: Gestión de stock con React, Next JS, Node JS y Mongo DB\r\nAntes de hacer esto, tengo que averiguar el cómo usar ExpressJS para hacer el backend de la aplicación. Para esto, empecé a ver cómo usar Express desde 0, y estuve viendo que hay que utilizar distintos módulos de Node y también distintas extensiones de archivos que nunca manejé antes.\r\n','2023-05-05'),(5908,276,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificacion y demas diagramas','El día de hoy realizamos las siguientes tareas:\r\n\r\n- En primer lugar, seguimos trabajando en base a la codificacion de la pagina web general. Esta misma se retraso un poco debido a que hubieron ciertos problemas con los archivos a la hora de guardarse, por lo que tuvimos que realizar la codificacion otra vez desde cero en vez de seguirlo desde lo ultimo hecho. Aun asi, se le dio cierto avance a la codificacion de la pagina de inicio de nuestra pagina web, y el resultado ya fue guardado correctamente, de modo que podremos continuar con el trabajo desde lo ultimo realizado. \r\n- Por otro lado, aun seguimos con la realización de ciertos diagramas faltantes dentro de los proyectos, tales como el camino critico y el caso de uso extendido, aunque aun siguen en proceso. \r\n\r\nEso fue todo lo realizado por hoy. ','2023-05-05'),(5909,286,'Realización de codigo CSS y Api','En el día de hoy empezamos con una complicación, las computadoras que ibamos a usar no prendían, el problema perduró poco por lo que más tarde decidí empezar a trabajar, pero me ocurrió otro problema, mi computadora se congeló y tuque que colaborar en conjunto con mis compañeros Christian Forte, Ezequiel Ledesma y Enzo Bartoletti en la realización de código, enfocándonos en arreglar errores del navbar, ya que había áreas las cuales no quedaban realmente bien para verse. También trabajamos en torno a las Api\'s, consiguiendo que la Api de Leaflet funcione de manera efectuca y la cual vamos a tener que adecuar al trabajo esperado en Practicas Profesionalizantes. Más tarde, le pregunté a una compañera del curso si podía mostrarme el código CSS de su página, ya que me parecía muy profesional y bien hecha y además con lo visto puedo sacar información para inspirarme','2023-05-05'),(5910,282,'Avances en la API / Diseño de navbar Login','En el día de hoy colaboré en conjunto con mis compañeros Christian Forte, Ezequiel Ledesma y Manuel filippa en la realización de código, siendo que nos enfocamos en arreglar errores del navbar, siendo que había áreas las cuales no quedaban realmente bien para verse.\r\nTambién trabajamos en torno a las Api\'s, consiguiendo que la Api de Leaflet funciona de manera correcta y la cual vamos a tener que adecuar al trabajo esperado en Practicas Profesionalizantes','2023-05-05'),(5911,284,'Bitacora 10','Hoy seguimos avanzando con la pagina web y empecé a informarme mas sobre react para poder ayudar a mis compañeros , ya finalice mis diagramas.\r\n','2023-05-05'),(5912,287,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificacion y demas diagramas','El día de hoy realizamos las siguientes tareas:\r\n\r\n- En primer lugar, seguimos trabajando en base a la codificacion de la pagina web general. Esta misma se retraso un poco debido a que hubieron ciertos problemas con los archivos a la hora de guardarse, por lo que tuvimos que realizar la codificacion otra vez desde cero en vez de seguirlo desde lo ultimo hecho. Aun asi, se le dio cierto avance a la codificacion de la pagina de inicio de nuestra pagina web, y el resultado ya fue guardado correctamente, de modo que podremos continuar con el trabajo desde lo ultimo realizado. \r\n- Por otro lado, aun seguimos con la realización de ciertos diagramas faltantes dentro de los proyectos, tales como el camino critico y el caso de uso extendido, aunque aun siguen en proceso. \r\n\r\nEso fue todo lo realizado por hoy. ','2023-05-05'),(5913,296,'Bitácora 7','Continuamos con la página web pero estuvimos viendo más que nada como sería el formato en celular y tratando de adaptarlo para que quede bien','2023-05-05'),(5914,293,'Avance de Camino critico','estuve avanzando el camino critico que mi compañero Maximiliano había hecho una parte y ahora sigue en proceso ','2023-05-05'),(5915,292,'eleccion de apis ','en el dia de terminamos por elegeir la api la cual fue de leaflet, yo no sabia como usrtala y como mi compañero no estaba aportando nada l pedimos ayuda al profesor el cual nos ayudo a que podamos hacerla funcionar ','2023-05-05'),(5916,295,'Prototipado app movil','En el día de hoy nso desviamos un poco del tema referido al trabajo ya que estuvimos un poco distraido con nuestros compañeros, pero aún asi realizamos con mi compañero Luciano Bellante 4 paginas del prototipado rapido de la aplicación móvil. Las paginas tratan de una incial que te pida si inciamos sesion o nos registramos, la pagina de inicio de sesión y de registro y la ultima que hicimos hasta hoy que fue la de ingresar ingredientes para elaborar la receta.','2023-05-05'),(5917,279,'Dia 10 del proyecto','En este día lo que hice mayormente es modificar mi carpeta del campo haciendo que se adapte a las reglas apa o no se como se llamen y hacer la daily aunque deje que los demás puedan editarlo para que lo llenen de lo que hicieron hoy.','2023-05-05'),(5918,272,'05/05 Realización de Daily y continuaciones del FIGMA','El día de hoy junto a mangialavore y bulacio realizamos el daily y continuamos con la realización del prototipado FIGMA. Próximamente realizaremos el diseño y funcionamiento en HTML.','2023-05-05'),(5919,299,'Hoy','Hoy avanzamos con el Figma y la daily','2023-05-05'),(5920,290,'Undécima ','En el día de la fecha lo que hice fue seguir con la página del día anterior y llegamos a crear el inventario, lo probamos ingresando productos y luego cambiamos el diseño de la página para que quede más estetico ','2023-05-05'),(5921,278,'Clase N° 13 05/05/2023','En el dia de hoy continue con la pagina web , en la cual seguimos con mi compañero tobias haciendo la parte del inventario , hicimos pruebas agregando productos al inventario y funciono, tambien cambiamos el tema de la pagina  y ahora es bordo con dorado.','2023-05-05'),(5922,291,'Avance del proyecto','Hoy entre en el horario establecido por la institución, espere a que mi compañero Lucan llegara para poder realizar la daily, más tarde en ese mismo momento llego mi compañero Thiago, realizamos la daily después del recreo establecido por el establecimiento escolar, en la daily escribimos sobre la salida didáctica que tuvimos a la facultad de ciencias económicas UBA.','2023-05-05'),(5923,294,'prototipado app movil','En el dia de la fecha estuve mayormente distraido hablando con mis compañeros, pero aun asi logre realizar con mi compañera Geraldinde Abregu 4 paginas de el prototipado usando la aplicación canva. las paginas tratan primero de una que te pide que inicies sesion o te registres, despues viene la pagina de inicio de sesion y registro y como ultima del dia de hoy una pagina que tengas que ingresar los ingredientes para que te busque una receta.','2023-05-05'),(5924,298,'Clase 10','Hoy estuvimos haciendo la página web para el proyecto junto a Vicky, terminamos con la página de registro y ahora estamos trabajando con la de inicio de sesión. ','2023-05-05'),(5925,264,'09/05','Inicio de prueba de practica del modelo mvc','2023-05-09'),(5926,254,'09/05/23','Hoy documente lo que hice la clase pasada y empecé a ver videos para ver el frontend con kiara.','2023-05-09'),(5927,265,'09-05-2023','Hoy en conjunto a mis otros compañeros estuvimos buscando ejemplos y pensando como podría ser el nombre del grupo y cual seria el logo','2023-05-09'),(5928,250,'Dia 17 Martes 09 05 23','Estuve practicando javascript','2023-05-09'),(5929,297,'09/05/23','segui viendo videos sobre el frontend y hable con kiara sobre los videos ','2023-05-09'),(5930,259,'9/5 Nahuel Moreno Practicas Profesionalizantes Recetonomicon','Hoy precisamente seguí poniendo la mayor cantidad de Ingredientes posibles, para luego con esos mismos hacer las Recetas mismas.','2023-05-09'),(5931,262,'09-05-2023','El día de hoy continuamos con los bocetos del menú del video juego, ya que algunas computadoras del laboratorio no estaban en funcionamiento. También aprovechamos a investigar un poco más sobre Unity.','2023-05-09'),(5932,269,'09/05','Hoy continúe con el curso de React de 8 horas del canal freeCodeCamp Español.','2023-05-09'),(5933,255,'Dia 17 Martes 09 05 23','Hey chicos, sabían que en terminos de reproducción entre hombres humanos y Pokémon hembras, Vaporeon es el Pokémon mas compatible para los Humanos?\r\n\r\nNo solo porque están en el Grupo Huevo Campo, que está principalmente conformado por Mamíferos, Vaporeon tiene en promedio una medida de 91.44 Cm. de altura y un peso de 28,98 Kg., esto significa que son suficientemente grandes para soportar penes humanos, y con sus impresionantes Estadisticas Base de PS y acceso a Armadura Ácida, puedes ser duro con ella.','2023-05-09'),(5934,252,'Clase 15 - Ventanas Modal','Hoy cree una ventana Modal que su función sea mostrarte un aviso. Cree un botón y le apliqué estilo para que esté en el centro y sea agradable a la vista, no solo eso sino que también al clickearlo te salte el modal de aviso creado anteriormente. Aún no está terminado pero viene muy bien encaminado y así facilitar la creación de futuros modales','2023-05-09'),(5935,261,'09/05/2023','Hoy nombramos a nuestro equipo &quot;SCRAP BOYS&quot; chicos de chatarra y hice le el beceto del logo del equipo.','2023-05-09'),(5936,271,'9/5/23','En el día de la fecha, investigamos junto a mis compañeros un poco de Unity y además, hicimos un par de bocetos del juego, ya que en las computadoras de esta nueva aula no está instalado unity y no pudimos seguir con eso ','2023-05-09'),(5937,268,'09-05-2023','Hoy con mi grupo hablamos con el profesor Nahuel sobre los materiales que usaremos probablemente el martes de la siguiente semana:\r\nDespués de discutir con mí grupo al fin tenemos un nombre y una temática para el grupo nos llamaremos los scrap boys y el nombre del robot será Servbot.','2023-05-09'),(5938,251,'Re-estructuración de la API - 09/5/2023','El día de hoy me percaté de un gran error. El archivo .gitignore del framework Leaf, hizo que no se guarden los datos de las funciones con las que debía trabajar, por lo que decidí crear dos ramas:\r\nArregloAPI, donde creé un nuevo proyecto con el Framework Leaf pero modificando el gitignore.\r\nInvestigación Lavarel Api, donde investigaré Lavarel, otro Framework de PhP, teniendo en cuenta la recomendación del profesor Consorti.\r\nTambién, subí una copia del proyecto de ArregloApi a mi Drive personal, en caso de otro inconveniente. nya &gt;.&lt;','2023-05-09'),(5939,263,'9/5/23','En el dia de hoy, junto con Luciano Budman seguimos con el proyecto, lamentablemente Axel Fenoglio falto en el dia de hoy por un tema medico pero hoy estuve mirando un tutorial de blender para asi poder hacer los modelos de los personajes','2023-05-09'),(5940,260,'','Creé un modal de alerta y le agregué un par de funcionalidades, aun quedan varias','2023-05-09'),(5941,303,'09-05-2023','Hoy continuamos haciendo los bocetos de los diseños (menú, pantalla principal, etc) del juego y a la vez investigamos mas sobre unity.','2023-05-09'),(5942,266,'Avance en front end','Estuve dedicandome a hacer los services de user en front end, y también la parte de env para variables globales. ','2023-05-09'),(5943,253,'Martes 09/05/2023 - Unity','Hoy dimos un par de ideas de cómo afrontar el modelado en Unity.','2023-05-09'),(5944,270,'09/05/23','el día de hoy, al no funcionar la computadora con unity, empezamos con los bocetos del menú del juego y corregimos algunas cosas de la carpeta de campo.','2023-05-09'),(5945,297,'10/05/23','visita a la feria del libro ','2023-05-10'),(5946,257,'10/5/2023','Hoy fuimos a la feria del libro ','2023-05-10'),(5947,258,'10-05-2023','hoy fuimos a la feria del libro\r\n','2023-05-10'),(5948,271,'10/5/23','En el día de la fecha tuvimos una excursión a la rural sobre la feria del libro ','2023-05-10'),(5949,251,'Excursión a la Feria del libro - 10/05/2023','El día de hoy fuimos de excursión a la Feria del Libro con la profesora Jimena Balado y los profesores Gonzalo Consorti y Juan McLoughlin. Me compré un libro de Ghost in the Shell.','2023-05-10'),(5950,261,'10/05/2023','Hoy fui a la feria del libro','2023-05-10'),(5951,268,'10/05/2023','Hoy con mis compañeros de clase fuimos a la 47° feria de libro en la Rural a las 14:00 hasta las 16:30.','2023-05-10'),(5952,253,'Miércoles 10/05/2023 - Feria del Libro','Hoy tuvimos una excursión a la Feria Internacional del Libro de Buenos Aires.\r\nGracias a esta visita, pude sacar varias ideas de posibles preguntas para mi categoría en el videojuego.','2023-05-10'),(5953,270,'10/05/23','El dia de hoy tuvimos una excursión a la feria del libro, por lo tanto no pudimos avanzar con el proyecto','2023-05-10'),(5954,303,'10-05-2023','Hoy no hubo prácticas profesionalizantes, ya que tuvimos una salida didáctica a la feria del libro.En la cual pudimos ver la gran cantidad de variedad de géneros, escritores, tipos de culturas , libros, etc.','2023-05-10'),(5955,262,'10-05-2023','El día de hoy no trabajamos en los laboratorios ni el proyecto ya que surgio una salida didactica a la &quot;Feria del Libro&quot;.','2023-05-10'),(5956,256,'10/05 salida','Hoy fuimos con los profes y los de 5to a la feria del libro ','2023-05-10'),(5957,259,'Salida Didactica Feria del Libro','Salimos a la Feria del Libro y paseamos epicamente por toda la feria, con Balado, Mcloguin y Consorti. Estuvo re piola :D\r\n ','2023-05-10'),(5958,298,'Clase 11','Hoy seguimos con la página web, ya terminamos la página de inicio de sesión y la del registro de cuenta, próximamente haremos la página principal.','2023-05-11'),(5959,298,'Clase 11','Hoy seguimos con la página web, ya terminamos la página de inicio de sesión y la del registro de cuenta, próximamente haremos la página principal.','2023-05-11'),(5960,272,'Empiezo el desarrollo de la página web','Hoy, comencé el desarrollo web con el uso de FIGMA como herramienta de prototipado visual. El prototipado está en la etapa final y aprovechando empecé con el desarrollo. En la reunión de equipo, todos los integrantes se presentaron y nos pusimos manos a la obra sin dificultades.','2023-05-11'),(5961,296,'Bitácora 8','Hoy terminamos el diseño de la página web y estuvimos viendo cómo era el tema de hacer que la página sea responsive','2023-05-11'),(5962,292,'Nuevas funciones a la api','En el día de hoy durante la jornada de prácticas profesionalizantes me encargue de expandir la api descargada anteriormente ya que con la ayuda del profesor el mapa o ucupaba menos de la mitad de la pantalla. Por lonque la expandimos y agregue la función de que en la localización donde aparecerían los formularios por incidentes también aparezcan las múltiples opciones que se tienen que completar como la cantidad de asaltantes/robado y el obtengo sustraído, trate de agregarle css pero como no pudd busque páginas para poder hacerlo pero no hubo caso','2023-05-11'),(5963,299,'Hoy','Hoy adelante el Figma y el HTML ','2023-05-11'),(5964,291,'Avance del proyecto','El día de hoy realizamos la Daily como de cotumbre sobre lo que hicimos el día anterior, que vamos a hacer el día de hoy y que inconvenientes tenemos, después de realizar la Daily ayude a mi compañero Thiago a realizar la pagina web con HTML y PHP, pero después de unos momentos cambié de lugar con mi compañero Lucan que estaba ayudando a mi compañero Ciro con el servidor MySQL porque se más de base de datos que de HTML, junto a Ciro logramos realizar el servidor MySQL, el cual tenia varies errores pero pudimos arreglarlos y con eso terminarla.','2023-05-11'),(5965,294,'Pagina Web del proyecto','En el dia de hoy estuve mayormente en la creacion de la pagina web del proyecto. ayude a mi compañera victoria a fabricar los formularios respectivos para iniciar sesion en la pagina. Usamos visual studio code para la misma y nuestros conocimientos basicos.','2023-05-11'),(5966,285,'Dia 11 en PP','¿Que logre hacer hoy? \r\n\r\nHoy me dediqué a trabajar en el prototipado de un proyecto importante utilizando el software de diseño Figma. Después de haber creado el prototipo en papel, trasladé todo a la pantalla y aseguré que estuviera todo en su lugar y con la funcionalidad deseada. Trabajar con Figma me permitió mover y ajustar fácilmente los elementos en la pantalla, lo que resultó muy conveniente y me ahorró tiempo y esfuerzo. Además, logré terminar el módulo 8 de mi proyecto, lo cual fue un gran logro para mí. Aunque ha sido un proceso desafiante, estoy muy satisfecho con lo que he logrado hasta ahora y estoy ansioso por seguir avanzando en mi proyecto. \r\n\r\n¿En que se me complico? \r\n\r\nPor suerte, hoy no experimenté ninguna complicación en mi proyecto. Todo se desarrolló sin contratiempos y pude avanzar de manera fluida en cada una de las etapas del proceso. \r\n\r\n¿Qué estuve investigando? \r\n\r\nDurante el día, no estuve investigando sobre ningún tema en particular. Me dediqué por completo a trabajar en mi proyecto y asegurarse de que todo estuviera en su lugar y funcionando correctamente. En resumen, ha sido un día muy productivo y estoy satisfecho con los resultados que he obtenido.\r\n','2023-05-11'),(5967,283,'base de datos, html y css y finalizacion de figma','El dia de hoy hicimos la daily, dividimos que cosa haria cada uno y luego estuve modificando la base de datos donde tuvimos problemas con la misma con mi compañero mangialavore. La misma tenia problemas de syntax o con las foreign key pero logramos resolverlos. Luego nuestros otros compañeros terminaron el figma y ya empezaron con el html y css. La clase que viene seguiremos con php para conectarla con la base de datos','2023-05-11'),(5968,282,'Avances en el mapa / Mejoras en el login','En el día de hoy trabajé en conjunto con mis compañeros de grupo Christian Forte, Manuel Filippa y Ezequiel Ledesma. Avanzamos en el proyecto siendo que el mapa resultó de manera exitosa al lograr amplificar la pantalla y que se vea de manera tal como teníamos esperado también estuvimos intentando añadirle funcionalidades nuevas tales como el que se pueda ver alertas en un modo resumido clickeando en un punto.\r\nBien colaborando con Forte y Filippa logramos mejorar el login en comparación a lo que estaba actualmente','2023-05-11'),(5969,286,'Carpeta de Campo, HTML y CSS','Hoy al llegar al aula empecé, intentando abrir la carpeta de campo de la materia, ya que había un error el cuál no me permite a día de hoy editar mi archivo original de carpeta de campo. Más tarde me puse a trabajar en el HTML y CSS de la página de administrador. Al abrir esta me di cuenta que necesitaba un cambio de diseño inmediatamente. Saqué el borde que tenia el login, achiqué el tamaño del border radius, reubiqué la imagen de la policia del &lt;header&gt; al login por lo que quité el texto de P.D.L.C, añadí sombras al login y a los &lt;input&gt; y al botón de ingresar, pulí un par de detalles de gramática, edité en Photopea las letras del logo de la policía e intenté agregar una imagen dentro del login.','2023-05-11'),(5970,276,'Proyecto PP Lu\'s Shop: &quot;VicSon&quot; - codificación - CDD - Correcciones ','El día de hoy realizamos las siguientes tareas: \r\n- Seguimos en base a la codificación de nuestra página web, aunque debidos a ciertos problemas se vio retrasada, por lo que aún seguimos trabajando en la pestaña de inicio, dentro de la cual seguimos trabajando en darle el diseño similar al de la Maqueta Software, y así poder empezar a codificar las demás pestañas. \r\n- Por otro lado, se estuvo realizando el Diagrama de Caso de Uso Extendido, el cual hasta el momento se tiene la base general de lo que sería el Diagrama, aunque aún queda pendiente la documentación del mismo para completarlo.\r\n- Por otro lado, se realizo ciertas correcciones en base a ciertos aspectos del proyecto, tales como el Camino Crítico, el Diagrama de Entidad de Relación, la BDD y demás\r\nEso fue todo por hoy. ','2023-05-11'),(5971,280,'Dia sin supervisores','Dia de hoy solo trabajamos enfocados en los diseños de las paginas web lo cual es lo ultimo para poder hacer funcionar la pagina donde se mostraran las recetas. Se dio diseño al login y se probo ciertas funcionalidades para llevar a cabo, ademas que se planteo el uso de node ya que aun cuando es el motor que ya hemos deicidido presentamos dudas en la aplicacion','2023-05-11'),(5972,293,'Base de Datos Avance','Hoy dia me dedique a hacer el base de datos.','2023-05-11'),(5973,287,'Proyecto PP Lu\'s Shop: &quot;VicSon&quot; - codificación - CDD - Correcciones ','El día de hoy realizamos las siguientes tareas en base al proyecto: \r\n- Seguimos codificando nuestra página web, aunque hubo algunas complicaciones , por lo que aún seguimos trabajando en la pestaña de inicio, dentro de la cual seguimos trabajando en darle el diseño similar al de la Maqueta Software, y así poder empezar a codificar las demás pestañas e intentar darle los demás diseños y funcionalidades a las demás pestañas. \r\n- Por otro lado, se estuvo realizando el Diagrama de Caso de Uso Extendido y aunque aún se encuentra en proceso, ya se tiene la base general de lo que sería el Diagrama. \r\n- Por otro lado, se realizo ciertas correcciones en base a ciertos aspectos del proyecto, tales como el Camino Crítico, el Diagrama de Entidad de Relación, la BDD y demás\r\nEso fue todo por hoy.','2023-05-11'),(5974,274,'Login de administradores, base de datos','En el día de la fecha tuve una entrevista con la empresa GS1, junto a dos compañeros. Una vez finalizada la misma, junto con un compañero del equipo estuvimos realizando algunas modificaciones en el CSS del inicio de sesión de los administradores. Yo por mi parte lo ayudé con el diseño. Luego intenté trabajar con el PHP de la página donde son reportados los incidentes, pero no pude debido a que había un error con la contraseña del servidor SQL en todos los ordenadores del aula. Por último, coloqué una imagen a la derecha del login, donde los administradores ingresan su usuario y contraseña.','2023-05-11'),(5975,285,'Dia 12 PP','¿Qué logré hacer hoy?\r\n\r\nHoy he estado trabajando en el prototipado de una página web utilizando la herramienta de diseño Figma. Me han solicitado la creación de dos secciones en la página, una de Favoritos y otra del Carrito de compras. He logrado avanzar en la creación de ambos prototipos y en este momento, me encuentro perfeccionando los detalles finales para garantizar una experiencia de usuario óptima.\r\n\r\n¿En qué se me complicó?\r\n\r\nAunque he avanzado en la creación de ambos prototipos, he encontrado algunas dificultades para encontrar un diseño adecuado que diferenciara claramente ambas secciones. Pensar en un diseño completamente nuevo para la sección de Favoritos me ha costado un poco más de esfuerzo, pero he logrado superar esta dificultad y he conseguido un resultado satisfactorio.\r\n\r\n¿Qué estuve investigando?\r\n\r\nHoy he estado investigando sobre las mejores prácticas de diseño web para crear una experiencia de usuario óptima. Me he enfocado en la estructura utilizada por Mercado Libre para la sección del Carrito de compras, y he buscado inspiración para la sección de Favoritos en otras páginas web. He estudiado diferentes opciones de diseño y he trabajado en crear un diseño atractivo y diferenciado que sea fácilmente reconocible por los usuarios. También he buscado información sobre cómo mejorar la navegabilidad de la página web y cómo garantizar una experiencia de usuario satisfactoria.\r\n','2023-05-12'),(5976,299,'Hoy','Hoy seguimos con el Figma y el HTML, lo estamos mejorando para que quede lo mejor posible','2023-05-12'),(5977,274,'CSS, Login','En el dia de hoy, lo que hice fue volver a editar el css de la página de inicio de sesión de los administradores, debido a que no estaba convencido de las propiedades que había utilizado el día anterior. Miré algunos tutoriales y diseños web para ver que partes podía modificar, pero no pude editar mucho. Luego, edité la foto que se encuentra en el lado derecho del login con la ayuda de photoshop, ya que era muy ancha, y al colocarla ahí se deformaba el ancho. Por último, creé un nuevo html para realizar un nuevo login, en el que iba a ir probando distintos diseños hasta que me convenciera alguno, y de esta manera no arriesgarme a modificar el login original.','2023-05-12'),(5978,278,'Clase N° 14 12/05/2023','En el día de hoy me dispuse a continuar con la pagina web. Estuve trabajando en el inventario , agregando las imágenes de cada producto y sus características. Además modifique el navbar , colocándole un fondo con una imagen de madera. También le agregue un icono a la pagina para que quede mas estética.','2023-05-12'),(5979,286,'HTML Y CSS de Página Usuarios','El día laboral de hoy comenzó con la misma dificultad que la semana pasada. Al llegar al aula, intenté prender la computadora y esta no respondía, al cabo de un rato esta reaccionó, prendió y pude iniciar sesión en mi cuenta de Google como siempre.\r\nUna vez abierta mi cuenta, me dirigí hacia Google Drive, entré a la pestaña &quot;Destacados&quot; y abrí la carpeta que contiene todos los archivos relacionados a nuestro trabajo de la materia. Una vez dentro, busqué la carpeta de &quot;Usuario Web&quot; y la descargué para poder modificarla.\r\nLuego abrí el Visual Studio Code e ingresé la carpeta descargada allí para poder modificar la página. Empecé buscando en YouTube tutoriales para saber cómo hacer un sidebar desplegable, al cabo de unos minutos, uno de los profesores me recomendó que use la herramienta Bootstrap donde pude encontrar lo que buscaba. Copié el código que me proporcionaba y lo pegué en el Visual Studio.\r\nUna vez teniendo todo listo para empezar a modificar lo proporcionado, abrí el prototipado que anteriormente habían hecho mis compañeros de grupo Enzo Bartoletti y Ezequiel Ledesma y fui agregando al sidebar todo lo que dicho prototipado contenía.\r\n','2023-05-12'),(5980,284,'Bitacora 12','Hoy estuve ayudando a mi compañero amir gomez con el figma de la página web , y continuando con mi carpeta de campo','2023-05-12'),(5981,272,'Desarrollo de página WEB','El día de hoy me focalicé en el desarrollo de la página web y sus funciones principales del inicio, tales como un slider para mostrar las novedades de la página, y tarjetas de ofertas, con un boton para mostrar más ofertas, esto utilizando CSS y JS, falta mucho pero se va por buen camino.','2023-05-12'),(5982,290,'Duodécima ','En el día de la fecha lo que realice fue ayudar a un compañero a continuar con el avance de la página para el inventario','2023-05-12'),(5983,293,'Base de Datos Proceso','hoy día corregí los problemas de la base de datos que anteriormente quedo y aun sigue en proceso.','2023-05-12'),(5984,287,'Proyecto PP Lu\'s Shop: &quot;Vicson&quot; - Codificacion - CDD - Base Datos','El dia de hoy seguimos realizando las mismas tareas que la bitacora anterior:\r\n- Por un lado, seguimos en avance a la codificacion de la pagina web, a la cual terminamos de codificar y diseñar la barra de navegacion y el footer. Y ademas, se le agrego ciertos botones para acceder a las demas secciones de ropas. Hasta el momemento el resultado de la pagina web estaa gustando bastante.\r\n- Por otro lado, se sigue realizando el Caso de Uso Extendido, el cual por el moememnto se han realizado ciertas documentaciones sobre el mismo, se espera poder terminar con dicho diagrama hasta la proxima daily.\r\n- Por ultimo, se estuvo realizando cierto arreglo dentro de la base de datos, tratando de hacerla mas acorde a los objetos dentro de nuestra tienda virtual.\r\nEso fue todo por hoy. ','2023-05-12'),(5985,276,'Proyecto PP Lu\'s Shop: &quot;Vicson&quot; - Codificacion - CDD - Base Datos','\r\nEl dia de hoy seguimos realizando las mismas tareas que la bitácora anterior:\r\n- Por un lado, seguimos en avance a la codificacion de la pagina web, a la cual terminamos de codificar y diseñar la barra de navegacion y el footer. Y ademas, se le agrego ciertos botones para acceder a las demás secciones de ropas. Hasta el momento el resultado de la pagina web esta gustando bastante.\r\n- Por otro lado, se sigue realizando el Caso de Uso Extendido, el cual por el momento se han realizado ciertas documentaciones sobre el mismo, se espera poder terminar con dicho diagrama hasta la proxima daily.\r\n- Por ultimo, se estuvo realizando cierto arreglo dentro de la base de datos, tratando de hacerla mas acorde a los objetos dentro de nuestra tienda virtual.\r\nEso fue todo por hoy. ','2023-05-12'),(5986,296,'Bitácora 9','Hoy empezamos a realizar la página web pero viste desde la PC y estuvimos seleccionando los colores definitivos','2023-05-12'),(5987,275,'Finalización del diagrama de caso de uso y su documentación ','El día de ayer me dedique a ayudar un poco en la pagina web y también en la base de datos(Digo esto porque no pude hacer la bitácora de ayer ) y hoy pude terminar todo lo que seria lo de caso de uso así se podría decir que me saque una cosa mas, lo único que quedaba por terminar era el tema de la documentación porque el grafico ya lo tenia terminado desde hace días, anote  las condiciones, precondiciones, un resumen de lo que seria la pagina de venta y las acciones de actores y sistemas. ','2023-05-12'),(5988,280,'Actualizar software','El dia de hoy solo se realizaron tareas pensadas para la actualizacion del software y optimizar algunas partes del software. \r\nEl codigo principal en el sql y node presenta fallos al tratar de pasar algunas consultas.','2023-05-12'),(5989,282,'Trabajo con el Login HTML','En el dia de hoy, nos presentamos tanto Forte, Filippa y yo a Practicas Profesionalizantes y trabajamos unicamente en el area de HTML, debido a que pensaba continuar con la carpeta de campo pero la computadora que pensaba utilizar se tildó y no me dejo progresar en esta.\r\nPor lo cual, como en el dia de ayer, progresamos con el login, cambiando parcialmente el diseño y agregando una imagen al Login','2023-05-12'),(5990,294,'comienzo de app movil','En el dia de la fecha me desvie un toque del tema de la pagina web y fui comenzando con los formularios que corresponde a la parte movil del programa. Empece la parte de inicio de sesion para registrar al usuario y que se registre en la base de datos correspondida.','2023-05-12'),(5991,295,'Diseño de pagina web','En el día de hoy empecé con la primera pagina del sitio web del proyecto en la cual se deben ingresar los ingredientes, también le puse el nav que va en todas las interfaces de la página. Además empezamos junto a mi compañero a hacer la app mobile que ya habíamos hecho el prototipado la clase anterior.','2023-05-12'),(5992,289,'','','2023-05-12'),(5993,298,'Clase 12','Hoy seguimos con la página, le dimos un retoque a las páginas de ingreso e inicio de sesión, además de hablar sobre el diseño del robot.','2023-05-12'),(5994,263,'16/5','Hoy teniamos planeado hacer ahora el mapa en Unity pero lamentablemente no pudimos hacer mucho en el dia de hoy debido que las compus que estamos utilizando en el colegio no tienen descargado y instalado Unity','2023-05-16'),(5995,263,'16/5','Hoy teniamos planeado hacer ahora el mapa en Unity pero lamentablemente no pudimos hacer mucho en el dia de hoy debido que las compus que estamos utilizando en el colegio no tienen descargado y instalado Unity','2023-05-16'),(5996,268,'16/05/2023','Hoy despues de la charla grupal empese con el diseño en 3D del logo del equipo en tinkercad que servira agregar al diseño del robot sumo.','2023-05-16'),(5997,267,'16/05/2023','Hoy mejoré el modelo 3D, tenía un fallo que dejaba al sensor ultrasonido expuesto.','2023-05-16'),(5998,254,'16/05/23','hoy documente lo que estuve haciendo y seguí viendo videos para entender java web, ya la próxima clase puedo empezar a programar el frontend ','2023-05-16'),(5999,262,'16-05-2023','El día de hoy realizamos el dayli y coordinamos en separarnos en dos partes, una parte siguió diseñando la base del hospital del juego en Unity y la otra parte comenzó a interiorizarse en el lenguaje que vamos a utilizar para nuestro videojuego en este caso C Sharp, logramos entender que es una lenguaje que contiene varios conceptos como HTML, CSS, JavaScript, POO y sus características.','2023-05-16'),(6000,255,'Martes 16 05 2023','hoy avancé con las vistas de la página web en figma','2023-05-16'),(6001,265,'16-05-2023','Hoy estuve ayudando a mi compañero a hacer el logo del grupo en la página web tinkerkad','2023-05-16'),(6002,261,'16/05/2023','Hoy agregue mas cosas al diseño 3D.','2023-05-16'),(6003,256,'16/05/23 modificaciones UML','Modifique el método Emitir Ticket: Comprador por Persona y agregue más atributos.\r\nLuego revisamos el diagrama junto a Kiara Chunga y el profesor Nahuel modificamos la clase Producto, eliminando el método Emitir Ticket. Tambien agregue info a la carpeta de campo.','2023-05-16'),(6004,250,'Martes 16 05 2023','Hoy seguí viendo cursos de Javascript y CSS','2023-05-16'),(6005,259,'16/05 Recetonomicon Practicas Profesionalizantes Nahuel Moreno','El dia de hoy continue poniendo mas Ingredientes y Recetas para la base de Datos ','2023-05-16'),(6006,270,'16/05/23','El dia de hoy comenzamos con la daily dividiendo las tareas en dos grupos, uno el cual se encargó de investigar sobre el lenguaje qquee utilizaremos es decir C#, y el otro dedicandose a avanzar en el escenario principal del juego.','2023-05-16'),(6007,271,'16/5/2023','En el día de la fecha realizamos la Daily y nos pusimos de acuerdo en dividir las tareas el día de hoy en dos partes. Por una parte seguimos diseñando la base del hospital y la otra averiguo más sobre el Lenguaje de C sharp','2023-05-16'),(6008,301,'Agustin Barcia','Hoy probamos y elegimos mapas en unity  para el juego, vamos a seguir en pruebas o vamos a decidir si crear uno (Basico) desde cero ','2023-05-16'),(6009,303,'16-05-2023','Hoy nos dividimos en dos mini grupos, uno siguió diseñando la base del juego y el otro empezó a ver en profundidad el  lenguaje C Sharp.','2023-05-16'),(6010,260,'','Implemente la funcion que hizo dylan para crear un usuario en la BD y la implementé en el front para darle la funcionalidad al register','2023-05-16'),(6011,266,'registro funcional y servicios ','estuvimos avnasxando con los servicios en el frontend. Principalmente los servicios de usuario, la parte para registrar un nuevo usuario ya se encuentra funcionando y en perfectas condiciones. tambien estuvimos corrigiendo bugs. resolvi un par de bugs de la api y mergeamos a las ramas','2023-05-16'),(6012,251,'Arreglo_API pt1 - 16/5/2023','El día de hoy verifiqué si mi trabajo realizado en Arreglo_API había surgido efecto. Efectivamente, ya no tenía errores. Me dediqué a reemplazar el código y a agregar el que ya había realizado.','2023-05-16'),(6013,269,'16/05/2023','Hoy empecé con el proyecto React\r\nAprendí como ejecutar un proyecto en la consola y como ponerlo en marcha, luego empecé con las primeras modificaciones en el código ','2023-05-16'),(6014,251,'Jornada Recreativa - 17/5/2023','El día de hoy organicé los torneos de ajedrez de la jornada recreativa en las horas de Prácticas Profesionalizantes, con el permiso de los profesores Nahuel Acosta y Gonzalo Consorti.','2023-05-17'),(6015,291,'Avance del proyecto','El día de hoy empeze abriendo el canvan y ver las tareas que faltaban los cuales son pocas y se pueden completar con tiempo, junto a mi compañero Alan revisamos el prototipado Figam para verificar que todo este bien y listo para finalizar, corregimos algunas cosas de este y lo terminamos, luego del recreo realizamos la daily, también voy a ayudar a mi compañero Thiago a realizar la pagina la cual esta costando en realizar, pero podremos terminarla a tiempo.','2023-05-18'),(6016,286,'HTML y CSS de Página Usuarios 2','El día de hoy no comenzó con ninguna dificultad, a diferencia de las clases pasadas. Al entrar al aula inicie sesión en mi cuenta de la escuela en Google y me diriji a Goolge Drive a descargar la carpeta &quot;Usuario Web&quot;. Una vez hecha la descarga, abrí la aplicación para programar de confianza, Visual Studio Code, allí metí la carpeta anteriormente descargada y seguí con el codeo. Continué lo que había dejado la clase pasada, resumidamente hice: cambié el color el &lt;navbar&gt; a blanco, moví el formulario desplegable hacia la izquierda y lo agrandé a un poco más del doble de tamaño del que tenía anteriormente, ordené todo lo que contiene este formulario, cambié el color de fondo, el color de los textos, el color de los &lt;h5&gt; y &lt;h6&gt;, borré código innecesario como también lo modifiqué, corregí un par de errores de diseño, agruegue botones e hice la página un poco más estética.','2023-05-18'),(6017,272,'Desarrollo WEB','El día de hoy, como la clase anterior, seguí el desarrollo web, creando y arreglando funciones y partes estéticas de la página principal.','2023-05-18'),(6018,285,'Dia 13 PP','¿Qué logré hacer hoy? \r\n\r\nHoy ha sido un día muy productivo para mí. En la última clase, finalizamos el prototipado en Figma, lo cual nos permitió tener una guía clara para el desarrollo de la página. Durante el día de hoy, continué progresando con el desarrollo de la página utilizando HTML y PHP. Me enfoqué en completar las secciones restantes y asegurarme de que todos los elementos estuvieran correctamente estructurados y funcionales. Trabajé en la implementación de diferentes funcionalidades, como formularios de contacto y elementos interactivos, para hacer la página más dinámica y atractiva. \r\n\r\n¿En qué se me complicó? \r\n\r\nAfortunadamente, no encontré ningún obstáculo importante durante la sesión de hoy. Sin embargo, hubo algunos compañeros que llegaron tarde a la clase, lo cual afectó un poco la dinámica del grupo. Aunque no mencionaré específicamente a los compañeros, fue importante mantener un ambiente colaborativo y asegurarnos de que todos estuvieran al tanto de los avances y las tareas asignadas. \r\n\r\n¿Qué estuve investigando? \r\n\r\nDurante el día, estuve investigando sobre algunas técnicas avanzadas de HTML y PHP para mejorar la funcionalidad y la apariencia de la página web. Investigué sobre cómo utilizar diferentes etiquetas y atributos de HTML de manera efectiva, así como cómo implementar scripts en PHP para procesar formularios y manipular datos del servidor. Además, investigué sobre buenas prácticas en el diseño web y exploré diferentes recursos en línea para obtener ideas y soluciones creativas.\r\n','2023-05-18'),(6019,283,'php, pagina y base de datos','Hoy día productivo en proyecto. Completamos base de datos, paso importante para finalización desarrollo. Una vez finalizada tarea, nos concentramos en mejorar página web ofreciendo experiencia óptima a usuarios. Dedicamos tiempo a pulir detalles visuales, optimizar navegación y garantizar usabilidad en diferentes dispositivos. &quot;Nos enfocamos en mejorar la velocidad y seguridad de la página implementando prácticas en desarrollo web y en programación en PHP.&quot; Se inicia creación del código para funcionalidad dinámica de página, permitiendo interacción de usuario con base de datos. Etapa fundamental para cumplir objetivos establecidos. Hoy fue clave para avanzar en el proyecto. Completamos la base de datos y mejoramos la página web, iniciando la codificación en PHP. Continuaremos trabajando para completar funcionalidades y pulir detalles restantes.','2023-05-18'),(6020,282,'Tareas de Scrum','Durante la jornada del dia de hoy en Practicas Profesionalizantes me encargue de la distribución de tareas al grupo, delegando a Forte la implementacion de nuevas funcionalidades al login, mientras que Filippa continuó con la interfaz de usuario, realizando el form. Como ultima tarea, caceres visualizó una parte de un curso de React.','2023-05-18'),(6021,279,'Dia 11 Del Proyecto','En el día de hoy estuve haciendo las dailys que no pude hacer de la semana pasada por lo que se lo pregunte a Enzo que estuvieron haciendo y aunque quede corto el daily 13 es mayormente porque solo vinieron 3 del grupo y así por eso pero también tuve que hacer la 11 ya que lo había dejado a los chicos completarlos pero al final no lo hicieron y después de terminarlo me pidió Enzo empezar a ver y entender el lenguaje react.','2023-05-18'),(6022,293,'Base de Datos terminado','hoy día termine la base de datos y corrigi algunas diagramas','2023-05-18'),(6023,280,'Guia react','\r\nEl dia de hoy me dispuse a crear una guia para orientacion sobre react para mi grupo y para mi. Enfocandome principalmente en en concepto basico , instalacion, condicionales y visualizacion de datos. Tomando de inicio la pagina oficial de react y utilizando otras herramientas propias del react js como los snippets que son aplicables en distintas ramas utilizadas  tales como js typescript html etc. \r\n','2023-05-18'),(6024,276,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificacion - CDD - Camino Critico - Base de Datos','El día de hoy realizamos las siguientes tareas: \r\n- Consideramos en realizar la pestaña de login, de modo que podamos realizar una pequeña conexión inicial sobre la pagina web y con la base de datos, por lo que en el día de hoy empezamos a realizar la pestaña del login, la cual consiste en pedir usuario y contraseña, y da un botón para ingresar. Por el momento el diseño dado a la pestaña convenció bastante y es bastante similar a la que diseñamos dentro de la maqueta software. Esperamos el poder realizar la pestaña de registro y de algún modo realizar cierta conexión con la base de datos\r\n- Por otro lado, seguimos haciendo ciertos arreglos dentro de la base de datos y demás arreglos en los inserts y demás, aunque por el momento no se esta del todo seguro de su funcionalidad para poder conectarla, se esta llevando a cabo cierta actualización de la misma. \r\n- Por ultimo, se termino de realizar el camino critico y el Caso de Uso Extendido. \r\n\r\nEso fue todo por hoy.','2023-05-18'),(6025,288,'Undécima Clase','Durante el transcurso de la jornada actual, he logrado avances significativos en diversas áreas del proyecto en curso. Específicamente, me he enfocado en el desarrollo y mejora de dos aspectos clave: la parte gráfica de nuestra página web y la estructura de la base de datos. En primer lugar, he dedicado tiempo y esfuerzo a perfeccionar la apariencia visual de nuestra página web. He trabajado en la selección cuidadosa de elementos gráficos, colores y disposición de elementos para crear una interfaz atractiva y agradable a la vista. Asimismo, he aplicado técnicas de diseño web modernas para garantizar la usabilidad y la experiencia del usuario. Además, he dedicado atención a la construcción y organización de la base de datos necesaria para respaldar el funcionamiento de nuestra tienda virtual. He redactado y estructurado meticulosamente la base de datos, teniendo en cuenta los diferentes tipos de información requeridos y las relaciones entre los distintos elementos. Esta base de datos servirá como el soporte fundamental para el correcto almacenamiento y gestión de los datos relacionados con los productos, los clientes y otros aspectos relevantes de nuestra tienda en línea. \r\nPara lograr una integración fluida entre la parte gráfica y la base de datos, he llevado a cabo la implementación del código correspondiente en el entorno de desarrollo web. \r\nHe creado la interfaz HTML necesaria, asegurándome de que esté correctamente estructurada y optimizada para una navegación intuitiva. \r\nAdemás, he aplicado hojas de estilo CSS para definir el aspecto visual de la interfaz y garantizar una presentación coherente y atractiva en todos los dispositivos. \r\nPara la interacción entre la interfaz de usuario y la base de datos, he utilizado PHP, un lenguaje de programación ampliamente utilizado en el desarrollo web. \r\nMediante la codificación adecuada, he establecido la conexión entre la interfaz y la base de datos, permitiendo la recuperación y actualización de datos de manera eficiente y segura. Para brindarte una mejor comprensión de los avances logrados en este día, adjunto imágenes dentro de mi carpeta de campo, que reflejan el trabajo realizado hasta el momento. \r\nEstas imágenes destacan los aspectos visuales y funcionales implementados en la página web, brindándote una visión más completa del progreso alcanzado en el proyecto.\r\n','2023-05-18'),(6026,292,'kanban','en el día de hoy me puse a anotar las tareas que había hecho hasta el omento en el espacio de camba predeterminado hecho anteriormente por mi compañero enzo bartoletti, luego de haber puesto las tareas en sus respectivos lugares procedí a realizar unas tareas de otra materia ya que se entrega en el dia y luego de un tiempo y después de finalizar sus tareas mi compañero Christian forte se sumo. también mientras hacia la otra tarea iba observando los cambios que había mi otro compañero manuel fillipa mientras aplicaba los cambios que se debían hacer en la versi0n de computadora de la app web y le iba indicando algunos cambios a hacer ','2023-05-18'),(6027,287,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificacion - CDD - Camino Critico - Base de Datos','El día de hoy realizamos las siguientes tareas: \r\n- Consideramos en realizar la pestaña de login, de modo que podamos realizar una pequeña conexión inicial sobre la pagina web y con la base de datos, por lo que en el dia de hoy empezamos a realizar la psetaña del login, la cual consiste en pedir usuario y contraseña, y da un boton para ingresar. Por el momento el diseño dado a la pestaña convenció bastante y es bastatnte similar a la que diseñamos dentro de la maqueta software. Esperamos el poder realizar la pestaña de registro y de algun modo realizar cierta conexion con la base de datos\r\n- Por otro lado, seguimos haciendo ciertos arreglos dentro de la base de datos y demas arrelgos en los inserts y demas, aunque por el moemento no se esta del todo seguro de su funcionalidad para poder conectarla, se esta llevando a cabo cierta actualizacion de la misma. \r\n- Por ultimo, se termino de realizar el camino critico y el Caso de Uso Extendido. \r\n\r\nEso fue todo por hoy.','2023-05-18'),(6028,274,'Login administradores','En el día de la fecha, lo que hice fue modificar el header del inicio de sesión de los administradores. Centré los cuatro links que se encontraban ahí, ya que había mucho espacio innecesario. Luego, hice algunas pruebas en la base de datos, utilizando PHP. Inserté un usuario en una tabla y posteriormente lo ingresé en el login, que luego me redireccionó a la página de incidentes. Si ponía una contraseña o usuario erróneo, me aparecía un texto que decía &quot;Usuario o contraseña incorrectos&quot;. Luego, ayudé a uno de mis compañeros con el css de la página de inicio que ven los usuarios, ya que había detalles en la barra desplegable que tenía inconvenientes en la modificación de algunos elementos.','2023-05-18'),(6029,290,'Decimotercera','En el día de la fecha lo que realice fue continuar con el inventario, pudimos crear las casillas necesarias para ya ingresar los distintos productos que teniamos que poner dentro de ellas, nos faltan varios detalles todavia pero no creo que nos falte mucho.','2023-05-18'),(6030,289,'18/5','El dia de hoy, trabajamos en seguir completando la pagina web (La parte de formulario), ademas de hacer el logo para la pagina. Eso es todo por hoy,muchas gracias!','2023-05-18'),(6031,275,'Ayuda con la base de datos entre otras cosas ','Lo principal de hoy fue ayudar un poco a Sáenz en la base de datos, mas que nada porque no tenia ninguna otra tarea asignada, sin embargo lo primero que hice fue mostrarle a Kevin lo que hice con el caso de uso, después de analizarlo le hice unos pequeños cambios en el diagrama, mas que nada para prolijearlo, para después juntarme con Sáenz y ayudarlo con la base de datos, ya había avanzado mucho con le código así que no fue mucho problema, en lo mas ayude fue cuando el mysql mostraba errores cuando queríamos continua, eran porque pequeñas cosas, aunque hubo un momento donde se borro la base de datos y lo tuvimos que rehacer sacando eso nos fue bien  ','2023-05-18'),(6032,295,'Pagina Web','En el dia de hoy continué haciendo la interfaz de la página web que me asignó la scrum de nuestro grupo para que lo haga junto a mi compañero, en la cual tuvimos que hacer la parte de ingresar los ingredientes y estuvimos modificando algunas cosas del prototipado , discutiendolo en grupo hasta llegar a la decisión de que en esa parte del ingreso de los ingredientes se van a ingresar en la barra de búsqueda, en vez de seleccionarlos, que era la otra opción de hacerlo.','2023-05-18'),(6033,295,'Pagina Web','En el dia de hoy continué haciendo la interfaz de la página web que me asignó la scrum de nuestro grupo para que lo haga junto a mi compañero, en la cual tuvimos que hacer la parte de ingresar los ingredientes y estuvimos modificando algunas cosas del prototipado , discutiendolo en grupo hasta llegar a la decisión de que en esa parte del ingreso de los ingredientes se van a ingresar en la barra de búsqueda, en vez de seleccionarlos, que era la otra opción de hacerlo.','2023-05-18'),(6034,273,'18-05-2023','En este día me di cuenta que no iba a poder realizar el proyecto con ReactJS y NodeJS por lo que empecé a pensar en qué tecnología podía realizarlo, por lo que me empecé a fijar si había librerías para interactúar con código de barras en Java. A su vez, también empecé a configurar el servidor de TomCat y empecé a investigar sobre el framework de Spring sobre el cual realizaría toda la configuración JSP.','2023-05-18'),(6035,294,'pagina del proyecto (recetas)','En el dia de hoy con mi compañera de proyecto estuvimos principalmente trabajando con la pagina del proyecto referida a las recetas. Esta se trata de que ingresemos ingredientes que tengamos en casa y posteriormente te sugiera una receta con los ingredientes ingresados. No esta terminada por ahora pero estamos en eso.','2023-05-18'),(6036,296,'Bitácora 10','Realice el diagrama de entidad relación y continúe con la página web, tuve varios problemas al momento de diseñar el formulario pero al final lo pude hacer','2023-05-18'),(6037,298,'Clase 13','Hoy cambiamos algunos detalles de la página, íbamos a comenzar con el diseño 3d de nuestro robot pero nos enfocamos más en eso.','2023-05-18'),(6038,285,'Día 14 PP','¿Qué logré hacer hoy?\r\n\r\nAyer hicimos un buen progreso en el desarrollo de la página web utilizando HTML. Trabajamos arduamente y logramos avanzar significativamente en el proyecto. Pudimos resolver varios problemas relacionados con la página, lo que nos permitió continuar avanzando sin contratiempos.\r\n\r\n¿En qué se me complicó?\r\n\r\nAunque logramos resolver varios problemas, ahora nos enfrentamos a un nuevo desafío al crear la sección de &quot;Destacados&quot;. Nos dimos cuenta de que los &quot;cards&quot; que creamos no muestran correctamente el título y la sección de &quot;Destacados&quot; parece flotar sin conexión con el resto de la página. Esto nos ha presentado dificultades para lograr el diseño visualmente coherente que buscamos.\r\n\r\n¿Qué estuve investigando?\r\n\r\nDurante el día, me dediqué a investigar diferentes enfoques para solucionar el problema que estamos experimentando con la sección de &quot;Destacados&quot;. Busqué recursos en línea y leí documentación relacionada con el diseño de &quot;cards&quot; en HTML y CSS. También busque algunos ejemplos de código.\r\n\r\nAdemás, investigué sobre las mejores prácticas en diseño web para lograr una integración adecuada de diferentes secciones en una página. Busque el cómo asegurar que cada elemento visual encaje con el resto de la página y cómo corregir problemas de alineación y posicionamiento.\r\n','2023-05-19'),(6039,286,'HTML y CSS de Página Usuarios 3','En el día de la fecha, al llegar al aula intenté prender el computador pero apareció el mismo error de la semana pasada aunque eso no causó un gran problema ya que al poco tiempo prendió y comenzó mi jornada laboral como siempre. Abrí Google e inicié sesión en mi cuenta, descargúe la carpeta &quot;Usuario Web&quot; con la que estuve trabajando ayer, abrí el Visual Studio Code y empecé a trabajar. Fui buscando partes de códgo innecesarias y las empecé a borrar, corregí partes de diseño del formulario desplegable, eliminé el &lt;navbar&gt; ya que era innecesario o no era útil para nuestro diseño, agregué nuevas opciones y texos, y reubiqué el boton para cerrar el formulario desplegable. Intenté reubicar el botón para abrir el formulario desplegable pero no hubo caso. Más tarde, busqué en Google como hacer el famoso pop-up, el cual es una ventana emergente que aparece al presionar algo de una página web, en mi caso la quería añadir para usarlo como una ventana que le pida al usuario si quiere confirmar y enviar el formulario, editarlo o cancelarlo. Econtré un tutorial de cómo hacerlo en una página que muchas veces uso para ayudarme a la hora de programar en cualquier tipo de lenguaje, al encontrarla, lo primero que hice fue guardar el link en un bloc de notas que tenemos con el grupo de trabajo . De esta manera, finalizó mi sesión de trabajo de la fecha.','2023-05-19'),(6040,274,'Diseño de login administradores','En el día de hoy, lo que hice fue modificar el diseño de la página de los administradores, ya que la paleta de colores no nos convencía y había algunas funcionalidades que no iban a tener utilidad alguna en la página. Por eso eliminé el header que contenía cuatro links y cambié la paleta de colores a una orientada a la página del Gobierno de la Ciudad de Buenos Aires.','2023-05-19'),(6041,292,'Cursos de js y react','En el día de la fecha durante la jornada lo primero que hice fue corroborar en el Github destinado a la materia si en la casilla de los trabajos míos y de Enzo bartoletti estaban correctamente marcados, luego tuve una charla con Enzo para ver qué podía hacer y a lo que llegamos fue que comience con los cursos de react pero antes de que comience a ver lo importante del curso me preguntó si sabía algo de js y como no se mucho me dijo que vea primero un curso de eso, entre al canal de midulive a ver el curso, lo poco que pude ver qué fue media hora entendí bastante la instrucción pero no pude más por el tiempo que tenía y porque la computadora en la que estaba se tildaba varias veces y debía apagarla.lo último que llegue a ver en el curso fue los operadores de comparación','2023-05-19'),(6042,279,'Dia 12 Del Proyecto','En el día de hoy estuve mayormente trabajando en seguir con el estudio de como funciona react mirando videos tutoriales de aprender de usar react.','2023-05-19'),(6043,290,'Decimocuarta','En el día de la fecha continúe con la pagina que estaba haciendo el dia anterior, no pude avanzar mucho pero avance, también hable con el profesor sobre las pasantías que me tocan realizar ya que la empresa me tomo y pregunte acerca de los horarios y distintas cosas, mas tarde retome a hacer la pagina.','2023-05-19'),(6044,282,'Codificacion de Login, interfaz de usuario y visualizacion de cursos','En el dia de hoy continuamos con trabajando en la codificacion del login, replanteandolo por tercera vez, tambien avanzando con la interfaz de usuario y su respectivo CSS.\r\nMientras tanto derive a Ledesma y Caceres para que visualicen 16 horas de cursos relacionados a React','2023-05-19'),(6045,276,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos','\r\nEl dia de hoy estuvimos trabajando en las siguientes tareas relacionadas al proyecto:\r\n- Habiendo terminado con las tareas relacionadas a los diagramas, empezamos a enfocarnos aun mas dentro del lado de la codificacion y la base de datos de la pagina web. Habiendo terminado la pestaña de Login, empezamos a diseñar la pestaña de Registro, de modo que primeramente se pueda registrar a un usuario dentro de nuestra pagina web. Hasta el momento se realizo una pequeña base respecto a la pestaña y los datos que pide, pero aun se espera poder diseñarlo aun mas y darle las funcionalidades que se necesitan para el mismo.\r\n- Por otro lado, se sigue trabajando en la base de datos, habiendole dado un gran avance, se le dio ciertos inserts de modo que esta pueda almacenar algunos datos y demas. Próximamente se estaría probando ciertas consultas para corroborar que esta funcione correctamente. \r\n\r\nEso fue todo por hoy. ','2023-05-19'),(6046,280,'Node+sql','El dia de hoy se trato de avanzar en el contenido de react. Pero los equipos no eran lo suficientemente capaces para llevar a cabo la iniciacion del mismo, haciendo que el computador se tuviera que reiniciar en 2 ocasiones seguidas. En compensacion se actualizo la guia de node + sql con nuevos parametros de busqueda y proximamente incluyendo procesos que permitan la menor generacion de codigo posible .','2023-05-19'),(6047,295,'Investigacion Js para pagina del proyecto','En el dia ded hoy junto a mi compañero empezamos a investigar sobre la página del proyecto en base a un cambio rotundo de la misma. A esta le añadiremos JavaScript en su totalidad y despues eso se tendra que convertir en react y MongoDB para  la base de datos. La fuente de información fue en google y videos de youtube donde explicaban bien paso a paso de como usar y aplicar JavaSacript.','2023-05-19'),(6048,272,'Desarrollo WEB','El día de hoy, junto a Mangialavore y Gonzalez, seguimos el desarrollo WEB, solucionando errores y funciones. También nos repartimos las secciones de la página que va a hacer cada uno.','2023-05-19'),(6049,294,'JavaSacript - Investigación de la pagina','En el dia de la fecha estuve investigando con mi compañera, esta investigación se baso principalmente en la utilización de JavaScript en nuestra página correspondiente al proyecto. Decidimos hacerla funcional y cambiarla completamente por JavaScript para despues ser traducida al React y MongoDB (base de datos). Usamos información de videos de youtube y busquedas en google de paginas de prueba ya finalizadas.','2023-05-19'),(6050,293,'Base de Datos php','hoy día investigue la conexión de base de datos con la pagina web ','2023-05-19'),(6051,287,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificacion - Base de Datos','El dia de hoy estuvimos trabajando en las siguientes tareas relacionadas al proyecto:\r\n- Habiendo terminado con las tareas relacionadas a los diagramas, empezamos a enfocarno aun mas dentro del lado de la codificacion y la base de datos de la pagina web. Habiendo terminado la pestaña de Login, empezamos a diseñar la pestaña de Registro, de modo que primeramente se pueda registrar a un usuario dentro de nuestra pagina web. Hasta el momento se realizo una pequeña base respecto a la pestaña y los datos que pide, pero aun se espera poder diseñarlo aun mas y darle las funcionalidades que se necesitan para el mismo.\r\n- Por otro lado, se sigue trabajando en la base de datos, habiendole dado un gran avance, se le dio ciertos inserts de modo que esta pueda almacenar algunos datos y demas. Proximamente se estaria probando ciertas consultas para corroborar que esta funcione correctamente. \r\n\r\nEso fue todo por hoy. ','2023-05-19'),(6052,289,'19/5','Hola, el día de hoy, termine de darle unos  ultimo detalles al formulario y registro... personalmente aún no me gusta, así que intentare cambiarlo en mi casa. Eso es todo por hoy, muchas gracias! \r\nHasta dentro de 2 semanas :D','2023-05-19'),(6053,273,'Bitacora 19/05/2023','Hoy quise empezar a usar el framework de Spring para realizar el proyecto y el mismo trataba de la misma tecnología que ReactJS pero en Java. Estuve intentando durante mucho tiempo el cómo intentar compilar un proyecto pero no pude.','2023-05-19'),(6054,275,'Base de datos ','De nuevo ayude un poco a Saenz con la base de datos, comprobando que funcionara correctamente,realizando varios inserts y comprobando si la podiamos conectar a una pagina web de prueba(Porque la de lushop todavía no esta terminada),','2023-05-19'),(6055,277,'Onceava Clase','Durante la jornada de hoy, nos enfocamos en el desarrollo de nuestra página web para el proyecto en curso. Nuestra principal tarea fue realizar modificaciones en el código CSS con el objetivo de mejorar la estética y presentación de la página. No obstante, nos encontramos con desafíos inesperados que demostraron ser más complejos de lo que habíamos previsto en un principio. Conscientes de la importancia de avanzar en el proyecto de manera eficiente, decidimos posponer temporalmente esta tarea específica para no estancarnos y dirigimos nuestros esfuerzos a otras áreas igualmente relevantes.\r\n\r\nA continuación, nos centramos en la implementación de la funcionalidad de PHP en nuestro proyecto. Un logro significativo fue establecer la conexión exitosa entre la página web y la base de datos, lo cual nos permitirá almacenar las cuentas de usuario que se registren en nuestra plataforma. Para este propósito, utilizamos SQL, un lenguaje de programación específico para la gestión de bases de datos. Aunque aún nos resta completar la verificación del Log In, estamos satisfechos con los avances realizados hasta el momento.','2023-05-19'),(6056,288,'Duodécima Clase','Hoy hemos tenido un día productivo en nuestro proyecto, ya que logramos realizar un avance significativo en el código. \r\nEn particular, nos enfocamos en modificar la base de datos y establecer una conexión fluida con el registro de nuestro sistema. Esta actualización nos permitirá gestionar y almacenar los datos de manera más eficiente y garantizar un funcionamiento óptimo. Además de trabajar en la base de datos, también nos propusimos mejorar la apariencia visual de nuestro proyecto ajustando el código CSS. \r\nSin embargo, nos encontramos con algunos desafíos inesperados que dificultaron este proceso de mejora. Decidimos tomar la sabia decisión de posponer la tarea de optimizar el diseño para un momento más oportuno. Reconocemos la importancia de una interfaz atractiva y amigable para los usuarios, pero en este momento consideramos que es más crucial garantizar un funcionamiento estable y una conectividad sólida entre la base de datos y el registro. Al posponer la modificación del código CSS, podemos concentrarnos en resolver cualquier obstáculo técnico pendiente y asegurarnos de que nuestro proyecto funcione de manera eficiente. \r\nValoramos la paciencia y comprensión de nuestro equipo mientras trabajamos en estas mejoras fundamentales. Estamos comprometidos en ofrecer un proyecto sólido y confiable, y estamos seguros de que, a medida que superemos estos desafíos, alcanzaremos resultados aún más satisfactorios. Seguiremos trabajando arduamente para cumplir con nuestras metas y mantener a nuestro equipo informado sobre los avances en futuras actualizaciones.','2023-05-19'),(6057,253,'Martes 23/05/2023 - Unity','Hoy tuvimos que volver a descargar Unity y Blender.','2023-05-23'),(6058,255,'martes 23 05 2023','hoy avancé con la página web del recetonomicon :3','2023-05-23'),(6059,265,'23-05-2023','Hoy tras el daily, mis compañeros y yo acordamos que, como tendriamos que rediseñar el robot varias veces, cada uno haría un modelo propio para poder así optar por el mejor. \r\nAsí que como manejo con más facilidad Tinkercad, elegí hacerlo ahí\r\n','2023-05-23'),(6060,254,'23/05/23','escribi en la carpeta de campo de mis anotaciones sobre java web y empece con el diseño de la pagina\r\n','2023-05-23'),(6061,251,'Curso Laravel pt1 - 23/5/23','El día de hoy empecé el curso de Backend de Victor Robles Web de PhP con Laravel para hacer APIs RestFul.','2023-05-23'),(6062,268,'23-05-2023','El dia de hoy despues de la charla con el profesor Nahuel instale el blender mientras la computadora estava desfrisada para asi tenerno para las futuras clases.','2023-05-23'),(6063,267,'23-05-2023','no hice nada','2023-05-23'),(6064,263,'23/5','Hoy no hicimos mucho estuvimos haciendo instalacion de sistemas y programas','2023-05-23'),(6065,261,'23/05/2023','Ayude a mi compañero con su diseño 3D del robot sumo','2023-05-23'),(6066,259,'23/5 Nahuel Moreno Practicas Profesionalizantes','El dia de hoy, termine de colocar una gran cantidad de recetas en la base de datos para luego registrarme a mi mismo en la base de datos como usuario, ya que tengo uno de los requisitos de recetas es tener un usuario registrado, y empezar a marcar y poner las recetas en la misma base de datos','2023-05-23'),(6067,252,'Clase 18 - Modal de Aviso ','Hoy seguí con el Modal Aviso y mi idea era importarlo en la clase APP para poder visualizarlo en la página y chequear si funcionaba correctamente, pero terminé el día con muchos errores, pude corregir algunos pero al final del día no me dejaba visualizar la página. No se si fue por un error de la computadora o del código, porque no me saltó ningún otro error en la consola de la página. Por lo tanto será un problema a resolver el día de mañana y así seguir con el siguiente escalón de la aplicación','2023-05-23'),(6068,266,'Avance con la API en eventos ','Hoy me puse de lleno a avanzar con los endpoints principales de eventos, los más importantes que van a manejar los eventos, empecé a hacer el getEventsForWeek ','2023-05-23'),(6069,303,'23-05-2023','Hoy el profesor nos desfrizo las computadoras, ya que estás fueron formateadas, para que nosotros podamos descargar e instalar unity y bleder.','2023-05-23'),(6070,270,'23/05/23','El dia de hoy hubo un problemas en las computadoras las cuales se formatearon y, por esta razon se borró el unity y el blender de estas. Pudimos llegar a testear algunas cosas en blender pero nada definitivo.','2023-05-23'),(6071,271,'23/05/2023','En el día de hoy intentamos hacer algo en unity, pero tardamos un poco ya que no estaba instalado en el aula y  tuvimos que instalarlo','2023-05-23'),(6072,253,'Miércoles 24/05/2023 - Bocetos','Hoy comencé a hacer bocetos de mi personaje en papel y luego lo pasé a digital.','2023-05-24'),(6073,271,'24/5/2023','En el día de la fecha, hice el boceto de mi personaje en el juego de the Five lost. Y busque un modelo en internet que se parezca más o menos a mi, para hacerlo animado','2023-05-24'),(6074,251,'Curso Laravel pt2 - 24/5/2023','El día de hoy continué con el curso. Instalé Wampserver, aprendía a crear un host personalizado e instalar Laravel, creando un proyecto de por medio. También aprendí sobre rutas y controladores en dicho Framework.','2023-05-24'),(6075,256,'24/5/23','trabaje en el código java e hice modificaciones en el diagrama UML, el trabajo de hoy ya lo anote en la carpeta de campo y agregue imagenes de los codigos hechos, especifique que cosas faltan, las agregaciones y modificaciones','2023-05-24'),(6076,255,'miércoles 24/5/2023 ','Hoy programamos el index de la pagina web','2023-05-24'),(6077,257,'24/5/23','Hoy me puse al dia de lo que hizo mi grupo y estuvimos instalando las dependencias para assets en unity, aparte guardamos todos los assets que pudimos conseguir que nos sirvieran y vamos a seguir en nuestras casas','2023-05-24'),(6078,258,'24/05','Hoy iniciamos otra vez con el proyecto por que no pude importar y al final el profe nahuel instalo unity en las cumputadoras del colegio ademas de probar un poco el codigo para interactuar con los objetos','2023-05-24'),(6079,265,'24-05-2023','Hoy seguí con mi diseño 3D del robot sumo, y comencé aumentando la altura de las paredes para añadir espacio adicional y tener más libertad al momento de acomodar todo, además tuve que hacer encajes para poder mantener las piezas fijas en un solo lugar.','2023-05-24'),(6080,250,'miércoles 24/5/2023 ','Hoy programamos el index de la pagina web :3','2023-05-24'),(6081,269,'24/05','Hoy continúe con el curso de react','2023-05-24'),(6082,262,'24/5/2023','El dia de hoy comenzamos a hacer los bocetos de nuestros personajes en una pagina que nos recomendó una compañera y tambien investigamos como comenzar bocetos en blender','2023-05-24'),(6083,262,'24/5/2023','El dia de hoy comenzamos a hacer los bocetos de nuestros personajes en una pagina que nos recomendó una compañera y tambien investigamos como comenzar bocetos en blender','2023-05-24'),(6084,263,'24/5/23','Hoy estuvimos haciendo entre todos importando lo que habiamos hecho, despues nos pusimos a hacer el tema de mapa assets y personaje.','2023-05-24'),(6085,266,'24-5 , mostracion de eventos con api','En la api, ya hice la parte de getEventsForWeek, ya esta completamente funcionando en cuanto a la api, el equiopo avanzo mucho con el front end y ya esta funcionando el login y el register, solo falta algunos detalles, pero esta funcionable el register y el login','2023-05-24'),(6086,252,'Clase 19 - Corrección de errores y funcionalidad','Ayer tuve un problema al crear el modal de Aviso ya que no me permitía visualizarlo en la página debido a un error de sintáxis con React. Hoy corregí los errores, di funcionalidad al modal de aviso y no solo eso sino que también lo apliqué en el register y el login para que al no completar los datos, salte un aviso para hacerlo, o que cuando la contraseña no es la misma al confirmarla salte un aviso tambien. El Modal tiene una animación para que aparezca desde abajo y se mantenga en la parte de abajo de la página. También había agregado que después de determinado tiempo, se cierre automáticamente pero generaba errores así que se descartó esa funcionalidad.','2023-05-24'),(6087,260,'','Agregué funcionalidad al login y terminé el Modal aviso con gonza y lo ayude a corregir un par de cosas y los implementamos al register y al login','2023-05-24'),(6088,303,'24-05-2023','Hoy terminé mi parte del código de la base de datos, además de dar mi opinión para ayudar a mis compañeros con los diseño de sus personajes.','2023-05-24'),(6089,270,'24/05/23','El dia de hoy el grupo comenzó con los bocetos de los personajes yo finalizandolo.\r\n','2023-05-24'),(6090,267,'30/5/2023','no hice nada','2023-05-30'),(6091,297,'30-05-23','realicé logos para agregar al header de la página ','2023-05-30'),(6092,271,'30/5/23','En el día de la fecha junto a mis compañeros Enzo Romaniello, Luis Meza, Valentín Bentos, Emilio Pereira comenzamos a crear nuestros personajes en Blender','2023-05-30'),(6093,262,'30/5/2005','El día de hoy comenzamos a moldear nuestros personajes en blender, usando los bocetos ya creados anteriormente. Por otra parte, también vimos una pagina de personajes de blender ya realizados para darnos una idea e interiorizarnos','2023-05-30'),(6094,270,'30/05/23','el dia de hoy comenzamos a probar blender viendo algunos videos y probando con modelos ya creados de paginas externas','2023-05-30'),(6095,253,'Martes 30/05/2023 - Personajes en Blender','Hoy pude comenzar con el modelado de mi personaje en Blender.','2023-05-30'),(6096,301,'30/05','hoy solo pudimos descargar assets para unity ya que tardaron mucho en descargar, pero ya una vez metidos en git hub la proxima va a ser mas rapido','2023-05-30'),(6097,250,'30 5 2023','Hoy intente corregir la barra de busqueda de la pagina web ya que hay un error con la seccion de noticias del proyecto pero mis intentos fueron en vano.','2023-05-30'),(6098,261,'30/5/2023','hoy ayude a Lucas.\r\n','2023-05-30'),(6099,254,'30/05/23','Hoy arregle el header de la pagina de incio y termine de diseñarla. Mañana voy a diseñar la pagina de iniciar sesion y registro para luego ir probando con la bdd','2023-05-30'),(6100,251,'Errores y Consultas - 30/5/2023','El día de hoy seguía teniendo errores con el URL not found, por lo que decidí pedirle ayuda al profesor Nahuel Acosta. Intenté creando nuevos proyectos para ver si era un problema de Laravel pero no parecía ser el caso. ','2023-05-30'),(6101,255,'Martes 30 5 2023','hoy rediseñe el high fidelity de la pagina web','2023-05-30'),(6102,265,'30-05-2023','Hoy luego del daily segui haciendo el modelo del robot a la par de la carpeta de campo ','2023-05-30'),(6103,263,'30/5/23','Hoy lamentablemente no pudimos hacer mucho debido a que formatearon las computadoras y teniamos que instalar todo devuelta unity','2023-05-30'),(6104,257,'30/05/2023','Hoy creamos un repositorio de git y al querer pasar los assets tardo mucho en descargarlos, en mi casa voy a hacer eso','2023-05-30'),(6105,268,'30-05-2023','hoy continue con el diseño en 3d del logo del equipo donde en el le agrege las manos del personaje en tinkercad.','2023-05-30'),(6106,259,'30/5 Nahuel Moreno Practicas Profesionalizantes','El dia de hoy hice Recetas desde un usuario creado por y de mi, poniendo sus respectivos ingredientes de cada Receta con la Valoración también como apartado y también porque es parte de la tabla de Recetas.','2023-05-30'),(6107,260,'','Practica de JWT con ayuda de nahuel ','2023-05-30'),(6108,303,'30-05-2023','Hoy empezamos con el modelado de los personajes en blender.','2023-05-30'),(6109,260,'','Arregle el modal de aviso por que se rompía\r\n','2023-05-31'),(6110,253,'Miércoles 31/05/2023 - Personaje en Blender','Hoy pude continuar con lo que fue el desarrollo en 3D de mi personaje teniendo como referencia un modelo ya creado.','2023-05-31'),(6111,250,'Miercoles 31 5 2023','Hoy estuve trabajando en el HUD de la aplicacion web y comence a introducir STYLES al proyecto','2023-05-31'),(6112,255,'Miercoles 31 5 2023','Hoy trabaje sobre los nuevos diseños del high fidelity :3','2023-05-31'),(6113,258,'31/05','Hoy no hicimos mucho testeamos a ver si con los assets de unity que descargamos estamos mas que bien y nada mas','2023-05-31'),(6114,269,'31/05','Continúe con el curso de react y comencé el primer proyecto','2023-05-31'),(6115,297,'31-05-23','hoy realicé junto a kiara la pag de iniciar sesión, la próxima clase seguiremos con la de registro y luego yo seguiré con la pag principal ','2023-05-31'),(6116,268,'31-05-2023','El dia de hoy el profesor Nahuel Acosta nos presto los materiales para el robot sumo a partir de su robot delivery don de con los materiales logramos hacer que funcione el motor que serviara para mover el robot sumo.','2023-05-31'),(6117,252,'Clase 21 - Modelos 3D','Hoy estuve aprendiendo a usar modelos 3d y aplicarlos dentro de una página que estoy desarrollando sobre Marvel. La idea es que muestre a los personajes de Marvel en modelo 3d, que puedas interactuar con los mismos con una cámara y alrededor del personaje aparezcan las peliculas en las que éste apareció. Una vez hecho click en una de las peliculas, se va a abrir un modal mostrando la información de la pelicula y un pequeño corto. Podria hacerlo con React para hacerlo más rápido, pero mi idea es tratar de hacerlo solo con Java Script para poder aprender más y que no todos mis proyectos sean solo React','2023-05-31'),(6118,251,'Curso Laravel pt3 - 31/5/2023 ','El día de hoy pude encontrar el error del proyecto. Tenía que ir a la pestaña public (perdón). Luego, modifique una BDD, trabajé con Modelos y logré una conexión entre la BDD y la API.\r\nA continuación los videos que usé para guiarme.\r\nhttps://www.youtube.com/watch?v=_oqhO0eaa0A\r\nhttps://www.youtube.com/watch?v=aywwITxNxyw\r\nhttps://stackoverflow.com/questions/63994237/laravel-bindingresolutionexception-target-class-does-not-exist\r\nhttps://stackoverflow.com/questions/66185760/attempt-to-read-property-name-on-null\r\nhttps://laraveldaily.com/post/laravel-relation-attempt-to-read-property-on-null-error','2023-05-31'),(6119,261,'31/05/2023','Hoy hicimos el circuito y el código del los motores en físico.','2023-05-31'),(6120,303,'31-05-2023','Terminamos todos los bocetos de los personajes, además de empezar  con los de las habitaciones. También continuamos con el modelado 3D de los personajes.','2023-05-31'),(6121,265,'31-05-2023','Hoy estuve, junto a mis compañeros, haciendo el circuito y el código a basa de prueba y error con los materiales que trajo el profesor ','2023-05-31'),(6122,267,'31-05-2023','Hoy trabajamos en la parte física con los motores DC, puente H y arduino.','2023-05-31'),(6123,270,'31/05/23','el dia de hoy ayudé  un poco a diego con su boceto y seguimos probando blender, ademas comenzamos un boceto de un escenario de las habitaciones general para que mas tarde cada uno pueda modificarlo a su tematica','2023-05-31'),(6124,254,'31/05/23','hoy junto con kiara hicimos terminamos la página de iniciar sesión. La próxima clase empezamos la de registro y luego yo con la clase conexión  para conectar la bdd en java web','2023-05-31'),(6125,263,'31/5/23','Hoy estuvimos descargando assets para el juego y estuvimos intentando guardar el juego en github en un repositorio','2023-05-31'),(6126,257,'31/05','Hoy empezamos el proyecto de unity y el repositorio git, estuvimos practicamente 3 horas cargando siquiera el proyecto por la compu, y subimos al repositorio lo que pudo la compu, despues tiro error, en las 2 horas restantes','2023-05-31'),(6127,259,'31/5 Nahuel Moreno Practicas Profesionalizantes','El dia de hoy, puse exclusivamente recetas, con sus ingredientes, el aclarado de que se trataba la receta, del usuario(yo) y su valoracion, buscando recetas y recetas por Internet','2023-05-31'),(6128,271,'31/5/23','En el día de hoy, comencé con mi boceto de mi personaje en la página aggie.io','2023-05-31'),(6129,256,'30/05/23 y 31/05/23','Estuve trabajando en el código Java haciendo el arraylist de productos y el método imprimir ticket de la clase pedido','2023-05-31'),(6130,277,'Doceava Clase','El día de hoy tuvimos una daily conversando sobre nuestros objetivos actuales, llegamos a la conclusión que debemos terminar el sistema de inicio de sesión y registro de la página, además de comenzar con el carrito de compra.\r\n	Eso es exactamente a lo que nos estuvimos concentrando en hacer, terminamos el inicio de sesión y el registro mediante una base de datos SQL, donde se guardan las contraseñas y mails de todos los usuarios, una vez registrado el cliente es redirigido a la página de inicio de sesión, donde se corrobora mediante una consulta SQL si la cuenta existe o no.\r\n	También estuvimos añadiendo botones al header para moverse rápidamente por la página, así podemos ir desde el inicio hasta la zona de productos y el registro de forma eficiente y cómoda.\r\n	El día de mañana buscamos mejorar la página visualmente utilizando Bootstrap además de comenzar el uso de un carrito donde se guarden todos los productos que el usuario decida comprar.','2023-06-01'),(6131,285,'Día 15','¿Qué logré hacer hoy?\r\n\r\nHoy me dediqué a trabajar en la página web del proyecto. Decidí reiniciarla desde cero, ya que había algunos problemas en la versión anterior que necesitaban ser solucionados. Durante el día, me enfoqué en reconstruir la página web utilizando las tecnologías de programación Java, CSS y HTML. Me aseguré de aplicar las mejores prácticas en el diseño web para lograr una interfaz atractiva y funcional.\r\n\r\n¿En qué se me complicó?\r\n\r\nDurante el proceso de reconstrucción de la página web, me encontré con algunos problemas al ubicar los inserts. Hubo dificultades para integrar correctamente los elementos de inserción de datos en el flujo de la página. Esto requirió un análisis minucioso y algunas pruebas para identificar y solucionar los problemas de ubicación. Aunque fue un obstáculo, pude superarlo con paciencia y perseverancia.\r\n\r\n¿Qué estuve investigando?\r\n\r\nA lo largo del día, estuve investigando sobre la implementación de formularios dentro de un modal en una página web. Me interesaba aprender cómo crear formularios que se desplegarán en una ventana modal, lo cual proporciona una experiencia de usuario más fluida y elegante. Investigué diferentes enfoques y técnicas para lograr este objetivo, y finalmente encontré una solución adecuada que se ajustaba a las necesidades del proyecto.\r\n','2023-06-01'),(6132,272,'Desarrollo WEB','El día de hoy, junto a mi grupo decidimos volver a empezar la página, utilizando de base bootstrap y funciones nuevas en vez de código manual. Header completado y un carrusel puesto para su posterior uso para novedades de productos. También creamos un botón para iniciar sesión utilizando un model (un tipo de notificación popup) en el cual te salta ahí el form y podes iniciar sesión desde ahí y registrarse, esto con un botón que te redirecciona a otro model de registro.','2023-06-01'),(6133,298,'Clase 14','Hoy hicimos la base de datos de ingredientes, agregando las categorías de frutas y verduras. También conversamos acerca del diseño del robot e investigamos los posibles componentes a usar.','2023-06-01'),(6134,278,'Clase N°15 01/06/2023','En el día de hoy como primer tarea nos juntamos con el equipo a hacer la daily, charlamos de como seguir encarando el trabajo.Yo con tobías continuamos con la página web ,  modificamos nuevamente la paleta de colores , también editamos es buscador , eliminando algunas líneas de código que no servían y tratando de dejar la página  minalista. También agregamos un footer , con el contacto de la empresa y el copyright.Por último empezamos a editar celda por celda donde van a encontrarse cada producto de la muebleria.','2023-06-01'),(6135,279,'Dia 13 del Proyecto','En el dia de hoy estuve mayormente en todo mi tiempo estando aun mirando los videos de como usar react aunque aun asi no lo sigo de comprender en como poder usarlo, si entiendo de como funciona pero no saber como poder usarlo en nuestro proyecto o como usarlo fuera del ejemplo que usa midudev.','2023-06-01'),(6136,286,'HTML y CSS de Página Usuarios 4','El día de hoy retomé con la materia debido a los paros de la semana pasada. Al llegar al aula, me senté en una de las computadoras que ya estaban prendidas, abrí mi navegador de confianza e inicié sesión para poder descargar la carpeta de &quot;Usuario Web&quot; y poder seguir, continué abriendo el Visual Studio Code para programar, descargué la extensión &quot;Live Server&quot; para que se me haga mas cómoda la programación y empecé a trabajar. A falta Enzo Bartoletti (nuestro Scrum Master) tuve que recurrir a las opiniones de mis otros compañeros de trabajo sobre qué más debería agregarle a la página, ellos inmediatamente me recomendaron que averigué la forma de meter el mapa de la api dentro de la página, para que se vea similar al prototipado. Empecé buscando en Google cómo meter un código HTML dentro de otro HTML y la primera página que vi me daba la solución que buscaba, pero esta era muy compleja, por lo que me decanté a abandonar este método y buscar otro. Abrí otra página que me daba una solución muchísimo más simple y al mismo tiempo efectiva. Seguí los pasos que me indicaba la página y funcionó. Seguí intentando ajustar el ancho y largo del mapa pero me topé con un problema, el botón para abrir el formulario seguía molestando. A medida que intentaba arreglarlo, aparecían más problemas hasta que pude dar con la solución. Lo ubiqué en el centro de la pantalla a la izquierda, esta vez pegado completamente a la izquierda, sin ningún tipo de separación entre el borde del monitor y el botón.\r\nAdemás, ayudé un poco a mi compañero Christian Forte con el diseño del login de la página de Administrador, buscando fuentes para los textos que se mostrarían en pantalla. También le proporcioné un poco de ayuda a mi compañero Ezequiel Ledesma para hacer que el usuario pueda interactuar con el mapa. Al final no encontramos la solución pero hubo un pequeño avance el cual nos ayudará más tarde.','2023-06-01'),(6137,284,'bitacora 13','hoy estuve realizando un login para la pagina web de nuestro proyecto , me investigue mucho en internet para poder realizar un login bastante bueno estéticamente , la proxima clase lo continuaré y ya lo finalizo y comenzamos con las conexiones con las bases de datos','2023-06-01'),(6138,292,'pop up en la api e investigación  ','En el día de la fecha mi tarea era continuar con la api que habíamos dejado de hacer debido a que no asistíamos a clases. al descargar y abrir el archivo note que una de las funciones que tiene que es tener texto encima de un pop up había desaparecido junto con el pop up, estuve bastante tiempo hasta después del receso donde pude averiguar el error y continuar donde se habia dejado la ultima vez, me habían dicho de hacer js pero decidí agregar la función de que se agregue un pop up al hacer clic y luego de visitar muchas páginas y videos pude lograr que al hacer un click salta las coordenadas de el lugar que cliqueo, aunque no es lo que quería hacer, ya era bastante yy con la ayuda de mi compañero manuel logramos dar con la soluciones de problemas de código que iba teniendo. luego de lograr que mostrara la coordenada estuve mas de media hora visitando páginas y viendo videos en youtube buscando la posibilidad de completar la tarea pero no lo conseguí \r\n','2023-06-01'),(6139,293,'Base de Datos login','hoy dia hice el login y registrar en base de datos','2023-06-01'),(6140,280,'Node','El dia de hoy se realizo la union de la pagina a mysql utilizando node. Se trato de minimizar la cantidad de codigo necesario para la creacion y automatizacion de los procesos asi poder agilizar las operaciones a futuro. Se utilizaron paginas de hosting gratuito para probar y asi no tener que ingresar cada sesion la bd. Esto no se pudo lograr ya que el mismo node no permite la utilizacion de estos hosting por lo que se hizo individualmente cada uno de los procesos.','2023-06-01'),(6141,288,'decimotercera clase','Hoy realizamos la pagina web y la base de datos de nuestra pagina web, le pusimos el nombre LiliFy, realizamos lo que seria la navegación por la pagina, de una pagina a la otra y el registro y login de la misma. Todo salió como esperamos y logramos realizarlo de perfecta forma, aun nos falta pulir varias de las cosas de la pagina, pero ya se guardan en la base de datos y tenemos insertados algunos de los productos que teniamos en mente, y se pueden ver gráficamente en nuestra pagina web','2023-06-01'),(6142,295,'Modelo 3d - Investigacion pagina','En el dia de hoy junto a mi compañero hicimos el diseño de lo que sería la parte física de nuestro proyecto que es un robot, lo primero que realizamos fue buscar ideas de diseños en la pagina de Thingiverse para poder fabricar la nuestra. Encontramos una que era un Baymax, luego lo pasamos a Tinkercad para ver bien el diseño y como quedaba en la escala real, cuando lo vimos ahi llegamos a la decisión con mi grupo de que no nos gustaba del todo, entonces buscamos mas ideas y nos gusto un diseño ya creado y decidimos usarlo  de ejemplo para poder llevar a cabo uno de nosotros mismos. El diseño quedo con una base circular, una rueda abajo de la misma y arriba con una pantalla lcd. Finalmente buscamos en el navegador tipos de ingredientes de todo el mundo para nuestra pagina web del proyecto. Para esto usamos chat GPT y paginas relacionadas.','2023-06-01'),(6143,289,'01/06','Ya en junio!!\r\nEl día de hoy, luego de hacer la Daily, con mi compañera Carito, hemos decidido comenzar el robot. Les asigne a mis compañeros empezar sus tareas. Mientras que con mi compañera, comenzamos a buscar los componentes de los cuales utilizaremos para comer hacer el robot. Al principio nuestra idea seria utilizar arduino, ya que era mas economico. \r\nLuego, el profesor Consorti nos comento que podíamos usar Blaspberry ya que tienen una placa que nos prestaran, así que terminamos optando por eso. Luego buscamos un simulador (lo encontramos), y luego comenzamos a trabajar en la db de los ingredientes de lo que será la pagina. Eso es todo por hoy, muchas gracias!','2023-06-01'),(6144,274,'Diseño de login, cyberseguridad','En el día de la fecha, lo que hice fue finalizar de una vez por todas el inicio de sesión de los administradores. Inicié cambiando el diseño, ya que no me convencía que el diseño anterior se asemejaba demasiado al de la página oficial de la Ciudad de Buenos Aires. Lo reemplazé por un diseño más minimalista, con una paleta de colores en blanco y negro. Luego, junto a un compañero, buscamos una fuente para el botón de ingresar en google fonts y en dafont, ya que la fuente que teníamos no coincidía demasiado con el diseño. Cuando finalizamos esto, me dediqué a añadirle el código necesario al login para que no sea vulnerable a inyecciones sql. Hice esto ya que estamos viendo este tema en una materia y nos dimos cuenta de que sería necesario implementar esto en un futuro.','2023-06-01'),(6145,281,'Dia 10','Hoy realizamos la página web y la base de datos de la misma, le pusimos el nombre LiliFy, hicimos lo que sería la interfaz visual de la página, el login y el registro. Estamos pensando en hacer un logo para la página, además de que faltan un par de cosas como el sistema de carrito de compra, el registro de la compra y un par de cosas más. \r\nYo creo que con el tiempo vamos a ir perfeccionando la página poco a poco, pero por ahora está quedando bien. Ya tenemos una base de datos con los clientes y productos. \r\n\r\nTambién está conectada la base de datos con el form mediante php, esta nos permite ingresar clientes y productos. Lo que sí, tendríamos que averiguar cómo editar y borrar estos así lo incluimos en el proyecto.\r\n','2023-06-01'),(6146,275,'Base de daos y pagina web conectada ','Hoy lo que se decidio hacer es crear una bases de datos para el login de la pagina, Saenz y yo hicimos eso para despues conectar esta base de datos con la pagina web, ya podemos logear usuarion en la pagina de lu´shop, también vimos algunos errores en cuanto al css de la pagina.','2023-06-01'),(6147,296,'Bitácora 11','Durante la daily nos replanteamos cambiar el formato.Al final decimos cambiar todo el diseño de la página y nos dividimos cada parte, yo empeze a. Hacer la parte de retirar y ingresar productos','2023-06-01'),(6148,273,'Bitacora 01/06/23','Hoy llegamos y realizamos la pertinente daily, donde hablamos sobre lo que realizaría cada uno para poder crear la página y la aplicación móvil.\r\nPor mi parte, empecé a probar a usar Spring (por fin pude instalarlo correctamente) e hice un “Hello World” para demostrar que este funcionaba.\r\nSegún estuve averiguando, Spring es una tecnología muy avanzada y no voy a poder dominarla en menos de 6 meses, por lo que creo que haré el proyecto en páginas JSP y Servlets. Posteriormente, empecé a realizar las clases que usarían las páginas JSP y los servlets. Realicé una clase “Mueble” que tendría toda la información de los muebles a ingresar. Luego, hice las funciones que ayudarían a realizar el código de forma más ordenada (los getters y setters) y luego el toString, para mostrar la información del mueble de una forma ordenada. A su vez, también realicé la clase de Usuario, que servirá para poder identificar a nuestros clientes. Los mismos deberán proporcionar un nombre de usuario, su nombre, su apellido, DNI y una contraseña para registrarse, y para iniciar sesión tendrán que colocar el nombre de usuario y la contraseña. Después de todo esto, empecé a programar la interacción de java con la base de datos SQL. Luego, hice las funciones que servirían para hacer inserts y selects desde java. Estos servirían para agarrar información de la base de datos, a la vez que desde los servlets podría hacer inserts con información mediante requests de html. Luego de hacer la fase “preliminar” de cómo serían los distintos objetos del proyecto, empecé a programar los servlets. Elegí hacer todos los requests en forma de Post, por lo que tuve que hacer una función en los servlets que sirva para registrar a los usuarios.','2023-06-01'),(6149,276,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexion','El dia de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas: \r\n\r\n- Por un lado, seguimos realizando las pestañas de Login y de Registrarse para nuestra pagina web, las cuales ya fueron codificadas y diseñadas muy similares a las que se determinaron en la Maqueta Software. \r\n- Ademas de eso, empezamos a configurar en la base de atos, una tabla que guarde datos relacionados al usuario a la hora de ingresar o registrarse en nuestra pagina, y de modo de ejemplo hicimos un unico insert para que a la hora de probar el login de nuestra pagina, podamos corroborar su funcionalidad. \r\n- Habiendo realizado esto, decidimos hacer una peuqeña conexion de la pagina web con la base de datos, habiendo utilizado el lenguaje PHP y el XAMPP para poder una conexion entre ambas. Creamos un archivo que crea la conexion con la base de datos, la cual usamos luego en otros archivos. Configuramos las pestañas de Login (al ingresar con el Email y la Contraseña, se crea otro archivo en el cual se genera el proceso de inicio de sesion, en el cual se genera una consulta que busca a un usuario mediante su email y su contraseña, y si estas coinciden con los datos dentro de la base de datos, se lleva al usuario al inicio de nuestra pagina web, en la cual se le configura una forma de cambiar el icono individual, incluyendo el Nombre del usuario que haya ingresado, tambien dando la opcion de ingresar a una pestaña de perfil en la que puede ver sus datos y cerrar sesion en caso de que quiera ingresar con otra cuenta, aunque la pestaña de perfil no esta totalmente diseñada por el momento) y Registro (en esta se completan los campos con la informacion solicitada, se confirma la contraseña, y se genera un proceso en el cual se genera una consulta que agrega los datos dentro de la tabla de usuario, de modo que al querer iniciar sesion, su usuario este disponible poder ingresar sin problemas).\r\n\r\nEso fue todo por hoy.','2023-06-01'),(6150,290,'Decimoquinta','En el día de hoy como primer tarea nos juntamos con el equipo a hacer la daily, Yo con mi compañero gero comenzamos a trabajar con la pagina para que se vuelva funcional y cambiar algunos diseños que no nos gustaron, añadimos un footer, modificamos el boton de buscar y dentro de la tabla borramos algunas funcionalidades','2023-06-01'),(6151,287,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexion','El dia de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas: \r\n\r\n- Por un lado, seguimos realizando las pestañas de Login y de Registrarse para nuestra pagina web, las cuales ya fueron codificadas y diseñadas muy similares a las que se determinaron en la Maqueta Software. \r\n- Ademas de eso, empezamos a configurar en la base de atos, una tabla que guarde datos relacionados al usuario a la hora de ingresar o registrarse en nuestra pagina, y de modo de ejemplo hicimos un unico insert para que a la hora de probar el login de nuestra pagina, podamos corroborar su funcionalidad. \r\n- Habiendo realizado esto, decidimos hacer una peuqeña conexion de la pagina web con la base de datos, habiendo utilizado el lenguaje PHP y el XAMPP para poder una conexion entre ambas. Creamos un archivo que crea la conexion con la base de datos, la cual usamos luego en otros archivos. Configuramos las pestañas de Login (al ingresar con el Email y la Contraseña, se crea otro archivo en el cual se genera el proceso de inicio de sesion, en el cual se genera una consulta que busca a un usuario mediante su email y su contraseña, y si estas coinciden con los datos dentro de la base de datos, se lleva al usuario al inicio de nuestra pagina web, en la cual se le configura una forma de cambiar el icono individual, incluyendo el Nombre del usuario que haya ingresado, tambien dando la opcion de ingresar a una pestaña de perfil en la que puede ver sus datos y cerrar sesion en caso de que quiera ingresar con otra cuenta, aunque la pestaña de perfil no esta totalmente diseñada por el momento) y Registro (en esta se completan los campos con la informacion solicitada, se confirma la contraseña, y se genera un proceso en el cual se genera una consulta que agrega los datos dentro de la tabla de usuario, de modo que al querer iniciar sesion, su usuario este disponible poder ingresar sin problemas).\r\n\r\nEso fue todo por hoy.','2023-06-01'),(6152,283,'php, pagina y base de datos 2 ','El dia hoy comenzamos haciendo la daily para luego empezar a decidir el rumbo q va a tomar la pagina y/o el proyecto, entonces entre los integrantes del grupo empezamos a arreglar casi tdo el proyecto para ser mas concretos solo el diagrama de entidad relacion, el figma, la base de datos, empezamos de 0 la pagina.\r\nEn el figma agregamos un iniciar sesion.\r\nLuego en la base de datos cambiamos algunas cosas de la tabla cliente y otras de la misma base de datos.\r\ndentro de la pagina cambiamos algunas cosas del css y el php para agregar un login para el usuario y register. De los mismo falta crear una otras partes mas con php asi podemos conectar la misma pagina con la base de datos anteriormente creada.','2023-06-01'),(6153,291,'Avance del proyecto','El día de hoy realizamos la daily como de costumbre, realizamos las tres preguntas correspondientes y la terminamos, un miembro del grupo falto y no pudimos estar completos pero no importo mucho ya que comenzamos a trabajar en la página y el PHP, yo realize el código PHP para la página con el cual avanze pero me trabe y busque un video que pudiera ayudarme, encontré un video que explicaba como armar un carrito el cual fue de mucha utilidad ya que teníamos que hacer uno y ahora tenemos una guía para este, a mis compañeros se les ocurrió actualizar la página a un modelo más moderno, es una buena idea pero tomará un poco de tiempo ya que tenemos gran parte de la página hecha lo que significa que actualizarla no va a hacer mucho problema.','2023-06-01'),(6154,295,'Modelo 3d - Investigacion pagina','En el dia de hoy junto a mi compañero hicimos el diseño de lo que sería la parte física de nuestro proyecto que es un robot, lo primero que realizamos fue buscar ideas de diseños en la pagina de Thingiverse para poder fabricar la nuestra. Encontramos una que era un Baymax, luego lo pasamos a Tinkercad para ver bien el diseño y como quedaba en la escala real, cuando lo vimos ahi llegamos a la decisión con mi grupo de que no nos gustaba del todo, entonces buscamos mas ideas y nos gusto un diseño ya creado y decidimos usarlo  de ejemplo para poder llevar a cabo uno de nosotros mismos. El diseño quedo con una base circular, una rueda abajo de la misma y arriba con una pantalla lcd. Finalmente buscamos en el navegador tipos de ingredientes de todo el mundo para nuestra pagina web del proyecto. Para esto usamos chat GPT y paginas relacionadas.','2023-06-01'),(6155,294,'Diseño 3d / Investigación para pagina web ingrediente','\r\nEl día de hoy hice junto a mi compañera el diseño 3d para el robot de nuestro proyecto, buscamos ideas y lo fuimos debatiendo en grupo para llegar a un acuerdo de que tipo o modelo de robot queríamos, hasta que llegamos a la conclusión de que iba a ser con la base redonda, la cual tendría una rueda debajo para el desplazamiento del robot y en la parte de arriba una pantalla. Además de eso luego hicimos una investigación de lo que serían los ingredientes para poder agregar a la base de datos de nuestra pagina web.','2023-06-01'),(6156,286,'HTML, Base de Datos y PHP de Página Usuarios','El día de la fecha comenzó normal y tranquilamente, sin ninguna complicación, mi computadora encendió normalmente por lo que me permitió empezar a trabajar antes. Abrí Google Chrome, inicié sesión en mi cuenta y descargué la carpeta de &quot;Usuarios Web&quot; para continuar con lo de ayer. Abrí el Visual Studio Code y metí ahí todo lo que iba a necesitar para trabajar. Una vez todo listo, no sabía por donde empezar, por lo que consulté con mi compañero Enzo Bartoletti (Scrum Master del equipo de trabajo) el cual no me supo dar una respuesta concisa, por lo tanto, decidí empezar a hacer la base de datos, dentro de esta base de datos se debería guardar la información que se ingresa en el formulario de la página, entonces tuve que modificar muy poco del código HTML agregándoles la propiedad &quot;name&quot; a cada elemento para que este pueda tener una relación directa con el PHP y la Base de Datos, hice una tabla pero no la completé toda, con mi compañero Christian Forte necesitamos buscar más información para que concluya. Una vez &quot;terminada&quot; la tabla, comencé con el PHP. Para esto, usé un trabajo del año pasado que me sirvió para hacer la de esta página, no fue muy complicado ya que solamente tuve que cambiar los valores y agregar nuevos. Ya hecho todo esto, consulté de nuevo con mi compañero Christian Forte si todo lo que había hecho estaba bien, ya que a él se le da mucho mejor la programación y es más experimentado. De esta forma, concluyó el día de hoy.','2023-06-02'),(6157,281,'Dia 11','El día de hoy incorporamos un nuevo método para agilizar algunas tareas y que en sí todo quede más ordenado. La herramienta que utilizamos se llama Bootstrap.\r\nBuscamos una barra de navegación y la estuvimos editando según nuestras preferencias. Le cambiamos el color a la letra y le pusimos Lilify, intentamos poner una imagen como boton pero pudimos, seguramente mas adelante lo volvamos a intentar.\r\n','2023-06-02'),(6158,277,'Décimo Tercera Clase','El día de hoy, hemos llevado a cabo una importante reestructuración de nuestra página web utilizando Bootstrap, la reconocida biblioteca de código abierto. Durante este proceso, hemos realizado diversos cambios significativos para mejorar tanto la funcionalidad como el aspecto visual de nuestro sitio.\r\n\r\nUno de los cambios más destacados ha sido la renovación de nuestra barra de navegación. Hemos reemplazado el navbar anterior por uno más elegante y estilizado, que ofrece una experiencia de usuario más intuitiva y atractiva. Además, hemos decidido incorporar una imagen que servirá como el nuevo logo oficial de nuestra empresa, brindando así una identidad visual sólida y reconocible.\r\n\r\nAdicionalmente, hemos decidido oficialmente cambiar el nombre de nuestra página a &quot;Lilify&quot;, un nombre que representa nuestra visión y misión como empresa. Este cambio refuerza nuestra marca y nos ayuda a destacar en el competitivo mundo digital.\r\n\r\nEn términos de diseño, nos hemos enfocado en mejorar los aspectos visuales tanto de la página principal como de la página de registro. Hemos realizado ajustes en la disposición de elementos, seleccionado colores más atractivos y utilizado tipografías modernas para brindar una experiencia visualmente agradable a nuestros usuarios.\r\n\r\nAunque hemos logrado un progreso significativo hoy, aún nos queda trabajo por hacer. Para mañana, nos hemos propuesto completar la página de inicio de sesión y la sección de productos. Estamos comprometidos en ofrecer a nuestros usuarios una experiencia fluida y satisfactoria, por lo que nos esforzaremos en garantizar que estas secciones estén completamente funcionales y en sintonía con el nuevo diseño de Lilify.\r\n\r\nEstamos emocionados por los cambios realizados hasta ahora y confiamos en que nuestra página web renovada será un éxito. Seguiremos trabajando arduamente para cumplir con los objetivos establecidos y proporcionar a nuestros usuarios una plataforma de calidad excepcional.','2023-06-02'),(6159,282,'Implementacion del mapa con el form','En el dia de hoy trabajamos al 100% en el diseño web de la plataforma BaVigila, siendo que logramos implementar el mapa de LeaFlet en conjunto al form de ingreso de denuncias y que este funcione, quedando como faltante el PHP.\r\nTambien finalizamos el marcado de datos, usando el elemento marker de la API','2023-06-02'),(6160,273,'Bitacora 02-06-2023','En el día de la fecha tuve un problema con la versión de apache netbeans que no reconocía los comandos para usar Java EE, por lo que estuve todo el día tratando de solucionarlos hasta que al final del día por fin pude ver qué era. Luego, empecé a realizar el servlet de Login que serviría para poder identificar a los distintos usuarios que usen la respectiva página. El mismo servlet necesita de parámetros dos atributos que vendrán del POST: nombre de usuario y contraseña. Posteriormente a esto, serán redireccionados a la página donde podrán administrar la base de datos.','2023-06-02'),(6161,274,'PHP del login','En el dia de la fecha, finalicé la parte de php de la página, ya que había un error en el código el cual pude solucionar. Utilicé un código que nos había dejado el profesor de otra materia y le cambié el nombre a las variables. Una vez que solucioné esto, el administrador podrá ver una tabla con los incidentes reportados. Esta tabla la diseñé antes de editar el php, aunque no me llevó mucho tiempo. Posteriormente, le añadí una funcionalidad para que el administrador pueda cerrar sesión.','2023-06-02'),(6162,292,'Pop up en la api','En el día de la fecha con la vuelta de mi compañero Enzo bartoletti continuamos con la opción de pop up que no había logrado agregar al código, probamos con varios cambios en el código pero todos resultaban en error o en que la página se rompiera, debido a eso letras Enzo ayudaba a otros compañeros, entre a una página de una ia para ver si podía solucionar este problema y lo logro, no solo se agregaban Pops up con un click, sino que también se borraban. Trate también de agregar otra función pero estaba en otro lenguaje que no sabíamos y lo dejamos para otro momento ','2023-06-02'),(6163,285,'Día 16','¿Que logre hacer hoy?\r\n\r\nEl día de hoy continué desarrollando la página web desde donde lo habíamos dejado. Me enfoqué en resolver algunos problemas específicos que surgieron. Uno de los inconvenientes que encontré fue que las cards en la página cubrían toda la pantalla cuando se hacía zoom, lo cual afectaba la usabilidad del sitio. Sin embargo, estoy tranquilo porque mi compañero de trabajo, Thiago Arroyo, se encargará de solucionar este problema.\r\n\r\nAdemás, aproveché el día para crear algunos banners que serán utilizados en los carruseles de la página. Me dediqué a diseñarlos cuidadosamente para que fueran atractivos visualmente y se ajustaran al estilo general del sitio web. Estoy satisfecho con los resultados y creo que los banners lucen bien.\r\n\r\n¿En qué se me complicó?\r\n\r\nAfortunadamente, no experimenté mayores complicaciones durante el día. Sin embargo, el problema con las cards y el zoom en la página fue un obstáculo que encontré. Por suerte, sé que puedo contar con la ayuda de Thiago Arroyo, quien se encargará de resolver este problema técnicamente.\r\n\r\n¿Qué estuve investigando?\r\n\r\nDurante el día, invertí tiempo en investigar diferentes aspectos relacionados con el proyecto. Me enfoqué principalmente en aprender más sobre el diseño web y cómo mejorar la experiencia del usuario en la página. Investigar sobre el comportamiento de las cards y cómo adaptarlas a diferentes resoluciones y tamaños de pantalla fue uno de mis principales objetivos.\r\n\r\nAdemás, aproveché para investigar sobre cómo crear banners atractivos y efectivos para los carruseles de la página. Busqué inspiración en diseño gráfico y exploré diferentes técnicas para asegurarme de que los banners cumplieran con los estándares de calidad y atrajeran la atención de los visitantes del sitio web.\r\n\r\nPor último, aunque no estuvo directamente relacionado con mi trabajo, también estuve al tanto de los avances de mis dos compañeros de trabajo, quienes se centraron en arreglar problemas relacionados con PHP y la base de datos. Me alegra saber que les fue bien en sus tareas y que están contribuyendo positivamente al proyecto en general.','2023-06-02'),(6164,293,'Tabla de producto','hoy día continúe con la base de datos haciendo la tabla producto y me faltan 2 tablas mas.','2023-06-02'),(6165,280,'Retrasos','El dia de hoy se tuvo q rehacer todo el contenido de ayer ya que nos e guardo en als carpetas correspondientes. \r\nCulminado esto se siguio donde se dejo el dia de ayer ahora ingresando datos y haciendo select','2023-06-02'),(6166,276,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión','El dia de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas: \r\n\r\n- Seguimos trabajando en base a la conexion entre la base de datos y la pagina web. Habiendo terminado de configurara las pestañas de Login y Registro, empezamos a configurar la pestaña de recuperación de contraseñas, de modo que al olvidar la contraseña, el usuario pueda solicitar una forma de recuperarla, la cual por le momento consistiría en generar una contraseña que se le envié por correo, la use una vez y luego la cambie directamente desde su perfil, por lo que se tiene en mente crear una pestaña mediante la cual se pueda cambiar los datos del usuario si asi el mismo lo desea. Aunque aun no esta del todo configurada, esta en proceso. \r\n- Por otro lado se estaría configurando la base de datos para poder implementar en un futuro los productos a vender dentro de nuestra pagina web. A su vez se estaría haciendo cierto cambio dentro del Diagrama de Entidad de Relacion.\r\n\r\nEso fue todo por hoy. ','2023-06-02'),(6167,298,'Clase 15','Hoy continué con la base de datos, agregué la categoría de carnes y harinas.','2023-06-02'),(6168,287,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexion','El dia de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas: \r\n\r\n- Seguimos trabajando en base a la conexion entre la base de datos y la pagina web. Habiendo terminado de configurara las pestañas de Login y Registro, empezamos a configurar la pestaña de recuperación de contraseñas, de modo que al olvidar la contraseña, el usuario pueda solicitar una forma de recuperarla, la cual por le momento consistiría en generar una contraseña que se le envié por correo, la use una vez y luego la cambie directamente desde su perfil, por lo que se tiene en mente crear una pestaña mediante la cual se pueda cambiar los datos del usuario si asi el mismo lo desea. Aunque aun no esta del todo configurada, esta en proceso. \r\n- Por otro lado se estaría configurando la base de datos para poder implementar en un futuro los productos a vender dentro de nuestra pagina web. A su vez se estaría haciendo cierto cambio dentro del Diagrama de Entidad de Relacion.\r\n\r\nEso fue todo por hoy.','2023-06-02'),(6169,278,'Clase N°16 02/06/2023','Hoy con mi compañero Tobias continuamos con la pagina web , como primer tarea colocamos mas celdas para que cada sección del producto quede separada , también colocamos una imagen de fondo  e investigamos como instalar un scroll en la tabla y lo colocamos y lo hicimos funcional , es fue todo lo que hicimos el día de hoy.','2023-06-02'),(6170,288,'Clase 14','Durante el desarrollo de nuestro trabajo práctico de hoy, hemos introducido un nuevo enfoque que nos ha permitido agilizar diversas tareas y mejorar la organización en general. Para lograr esto, hemos incorporado una herramienta altamente efectiva llamada Bootstrap. Uno de los principales objetivos que nos hemos planteado ha sido la personalización de una barra de navegación, adaptándola a nuestras preferencias y necesidades específicas. \r\nDurante el proceso, hemos realizado una serie de ajustes y modificaciones para lograr el aspecto deseado. Por ejemplo, hemos cambiado el color de la letra para que se ajuste al estilo visual que buscamos. Además, hemos aplicado un estilo conocido como &quot;Lilify&quot; para agregar un toque adicional de sofisticación y coherencia estética. Sin embargo, nos hemos encontrado con un desafío en el camino. Hemos intentado incorporar una imagen como botón en la barra de navegación, pero hasta ahora no hemos tenido éxito en esta tarea específica. \r\nA pesar de ello, estamos decididos a no rendirnos y a seguir explorando posibilidades para lograrlo en futuras iteraciones. \r\nCreemos que añadir una imagen como botón podría brindar una experiencia visualmente atractiva y mejorar aún más la usabilidad de nuestra aplicación. En resumen, el uso de Bootstrap ha sido fundamental para agilizar nuestras tareas y mantener un orden coherente en nuestro proyecto. A través de la personalización de la barra de navegación, hemos logrado ajustarla a nuestros requisitos específicos, aunque aún tenemos el desafío pendiente de incorporar una imagen como botón. Estamos emocionados por seguir explorando las posibilidades que Bootstrap nos ofrece y esperamos poder implementar nuevas mejoras en el futuro. Adjunto imágenes de el trabajo hecho en el dia de la fecha:\r\n','2023-06-02'),(6171,290,'Decimosexta','En el dia de la fecha lo que hicimos con mi amigo gero fue continuar con la pagina, le agregamos un poco mas de funcionalidad con un scroll, mejoramos el diseño pero faltan los botones para que haga las distintas acciones del inventario, pusimos un nuevo fondo y corregimos algunas columnas que estaban desordenadas.','2023-06-02'),(6172,253,'Martes 06/06/2023 - Salida Didáctica','Hoy tuvimos una salida al Centro Cultural de Recoleta.','2023-06-06'),(6173,252,'Clase 22 - Salida didáctica','Hoy fuimos de excursión al centro cultural de recoleta ','2023-06-06'),(6174,268,'06-06-2023','Hoy con el curso de 6°1° computacion y con el curso de 6°2° Compu. Fuimos a recoleta a ver una expo de tecnologia de Buenos Aires.','2023-06-06'),(6175,251,'Excursión al Centro Cultural Recoleta - 06/06/2023','El día de hoy fuimos al Centro Cultural Recoleta por una salida obligatoria de Prácticas Profesionalizantes. Hablé sobre Pokémon con el encargado de mostrar las impresoras 3D y me regalaron una libretita RE FACHERA. (Consorti o Nahuel, si leen esto no sé que más poner).','2023-06-06'),(6176,261,'06/06/2023','Hoy Fuimos a recoleta a ver una expo de tecnologia de Buenos Aires.','2023-06-06'),(6177,270,'6/6/23','El dia de hoy tuvimos una excursión al centro cultural recoleta y el grupo no pudo avanzar con el proyecto','2023-06-06'),(6178,303,'06-06-2023','Hoy fuimos a la feria &quot;Creá tu futuro&quot; en el centro cultural recoleta.En la cuál pudimos ver  puestos especializados en carreras de todo tipo para cualquier persona.','2023-06-06'),(6179,262,'06-06-2023','El día de hoy fuimos a una visita al centro cultural con el colegio y los profes en conjunto. La verdad fue una experiencia buena para aprender y despejarnos un poco.','2023-06-06'),(6180,282,'Primer dia laboral en GS1','En el día de hoy, en conjunto a mi compañero Tobías Alegre, tuvimos nuestra primera practica profesionalizante fuera de la escuela, tras pasar varios filtros selectivos, en la empresa GS1.\r\nFuimos recibidos a las 9:00 AM por Tomas, el cual había sido mi evaluador en las instancias previas. El nos llevo a recorrer parcialmente las instalaciones, además de hacernos una introducción a los proyectos actuales de la empresa. También uno de los empleados de GS1, llamado Bruno, nos hizo entrega de nuestros equipos de trabajo, los cuales abarcaban una PC, un mouse inalámbrico y auriculares. Tras esto, Rocío, otra de las empleadas y la &quot;Jefa&quot; de Alegre, nos llevo a recorrer el resto de las instalaciones de la corporación.\r\nDespués de todas las presentaciones pertinentes, se me delegó la tarea de revisar un Excel para corroborar la veracidad de sus datos, lo cual posiblemente me requiera varios días debido a su longitud.','2023-06-06'),(6181,271,'6-6-23','En el día de la fecha fuimos a la visita al centro cultural de recoleta, dónde habían varias cosas interesantes ','2023-06-06'),(6182,282,'Segundo dia laboral en GS1','Durante la mañana de hoy asistí presencialmente a las oficinas de GS1 en el barrio de chacharita, siendo que al igual que el día de ayer me focalicé en trabajar con un archivo de Excel con 1989 marcas a revisar mediante Google y el INPI.','2023-06-07'),(6183,297,'07/06/23','Realice el boceto de la pagina principal y también junto a mi compañera Kiara Chunga realizamos la pág. de registro','2023-06-07'),(6184,269,'07/06','Hoy continúe con el curso de react y empecé el primer proyecto de práctica ','2023-06-07'),(6185,250,'Miercoles 7/6/2023','hoy segui estudiando la consola de javascript ','2023-06-07'),(6186,270,'07/06/23','El dia de hoy comencé viendo un video sobre blender para modelar con un poco mas de conocimiento mi personaje y logré tener una base aunque todavia no el personaje terminado.','2023-06-07'),(6187,254,'07/06/23','Hoy hice con kiara romero la pagina de registro, la próxima clase terminaremos todos los detalles que faltan','2023-06-07'),(6188,268,'07-06-2023','Hoy con el grupo juntamos los codigos del motor y del sensor ultrasonido donde en el medimos la velocidad dependiendo la distancia y se encendia si tenia un objeto de frente y yo tambien aparte mejore los ultimos detalles del logo del grupo en tinkercad.','2023-06-07'),(6189,262,'07-06-2023','El día de hoy comenzamos a moldear/diseñar nuestro personaje del videojuego en base a los bocetos que ya dimos por finalizados, vimos videos para interiorizarnos en el moldeo y herramientas de trabajo. Luego comenzamos y terminamos el primer moldeo del personaje, en mi caso de mi personaje TADE','2023-06-07'),(6190,255,'Miercoles 7/6/2023','hoy segui rediseñando el index de la pagina web en figma :3','2023-06-07'),(6191,251,'Curso Laravel pt4 - 07/06/2023','El día de hoy continué con el curso de Laravel y PhP. Aprendí a usar los métodos HTTP en Laravel y teóricamente ya puedo ingresar usuarios a la BDD. Quedan errores por corregir.','2023-06-07'),(6192,260,'','Creé los services para eventos y configuré el modal de alerta para confirmar la creación de un evento','2023-06-07'),(6193,260,'','Creé los services para eventos y configuré el modal de alerta para confirmar la creación de un evento','2023-06-07'),(6194,267,'07-06-2023','Hola querido diario. Hoy trabajamos con la parte física con los motores DC y sensor de ultrasonido.','2023-06-07'),(6195,263,'7/6/23','Hoy esta tarde faltaron todos mis compañeros menos yo, no hice mucho el dia de hoy pero estuve viendo videos tutoriales sobre como hacer modelos de personajes, luego tendre que ir discutiendo estos temas con el resto de mi equipo.','2023-06-07'),(6196,261,'07/06/2023','Hoy empecé con un nuevo diseño 3D y trabajamos con el circuito con del sonsor Ultrasonido y con los motores','2023-06-07'),(6197,259,'7/6 Nahuel Moreno Practicas Profesionalizantes','El día de la fecha seguir poniendo recetas y viendo de instagram si, pero también visite y vi paginas para otras recetas ya que también coloque recetas de cada categoría, sea bebidas, alcohólicas o no, postres, salados o dulces, Celiacos, Vegetarianos y al menos 1 Receta para cada categoría','2023-06-07'),(6198,265,'07-06-2023','Hoy estuve haciendo la conexión de los cables con la placa arduino y haciendo probando el código que habia hecho anteriormente ','2023-06-07'),(6199,253,'Miércoles 07/06/2023 - Personaje Blender y Base de Datos','Al principio de la clase, me dediqué a probar la parte de la base de datos de Valentín Bentos que ya lo había hecho. Me puse a ver que errores tenía o sí tenía.\r\nDespués me puse a hacer mi propio personaje desde cero en Blender.','2023-06-07'),(6200,266,'Comienzo de Libreria calendario','En el dia de hoy me centre en investigar una posible libreria para manejar los eventos de forma grafica, encontre una, estuve experimentando con ella para entenderla y evaluar si se justifica utilizarla. llegue a la conclusion que es una muy buena opcion para utilizarla','2023-06-07'),(6201,303,'07-06-2023','Hoy nos desfrizaron las computadoras para instalarles blender, también seguimos viendo material sobre modelado en él y a la vez modelando nuestros personajes.','2023-06-07'),(6202,282,'Tercer dia laboral GS1','En el día de hoy tuve mi primer día laboral desde la virtualidad, siendo un día fructífero y de avances en el documento de Excel asignado, siendo que ya revise 557 filas del documento (correspondiente a un aproximado de 1/4 del total).\r\nAdemás me comuniqué a lo largo del día mediante Skype con Lucas Sosa en el caso de dudas y con Tobías para colaborar con un PowerPoint el cual debe realizar para su área de trabajo.','2023-06-08'),(6203,283,'php e ideas. por favor, ayuda!!','El día de hoy comenzamos haciendo la daily donde discutimos cómo seguir y terminamos de dividir las partner para ver quien seguiría con la  página. Luego abrí los programas para poder comenzar con mi parte, mi parte es proseguir con el php y arreglarlo para que se conecte a la base de datos. lo cual al mismo tiempo mi tarea es seguir mejorando la base de datos para que pueda llegar a contener todo lo que esperamos, como por ejemplo una carrito, un comprar, un agregar producto, etc. \r\nAl mismo tiempo tuve problemas con el archivo registro.php al ser él un trabajo en equipo no tengo conocimiento sobre algunos archivos o repositorios que crean mis compañeros entonces pierdo la noción de lo que tengo que cambiar para no afectar el trabajo hecho por mis compañeros. Igualmente he encontrado un video de un chabon donde explica mas a fondo que puede tener una tienda online, seguiré viendo sus videos para poder agarrar ideas e implementarlas en nuestro proyecto. \r\n','2023-06-08'),(6204,279,'Dia 14 del Proyecto','En el dia de hoy estuve reviendo los videos de midudev porque al final de mirarlo todos no pude entender como funcionaba asi que empeze a mirar el primer video y seguir lo que hacia para saber como funcionaba poco a poco con un ejemplo de una foto de usuario y parecido.','2023-06-08'),(6205,293,'Base de Datos Tabla compra','hoy día me dedique hacer la tabla de compra donde esta las tarjetas, código de seguridad y código QR.','2023-06-08'),(6206,274,'Diseño de tabla de incidentes, ayuda con css del mapa','En el día de la fecha lo que hice fue añadirle nuevamente un código anti inyecciones SQL, ya que la clase pasada se lo había eliminado por error. Luego, cambié el diseño de la tabla, ya que los datos ingresados en la base de datos quedaban descentrados en las filas. En paralelo, iba ayudando a un compañero de grupo con su trabajo que tenía la tarea agregarle css al mensaje emergente de la API del mapa, aunque ambos no teníamos mucho conocimiento acerca de eso, logramos un avance. Cambiamos el color de fondo del formulario que contiene los datos del incidente y también la fuente. Además, lo ayudé a añadirle una funcionalidad de agregar los pop ups en una zona, aunque no pudimos llegar a nada. ','2023-06-08'),(6207,292,'aspecto de la api y fallo al implementar una función nueva ','En el dia de hoy 8 de junio me dedique por ordenes de mi scrum master enzo bartoletti que no asistió a la jornada, debía agregar js al pop up que emerge al hacer clic en el mapa de la api ya que consideraba que estaba vacío y no ayudaba con la vista de la app, por lo que me puse a buscar tutoriales de js y con ayuda de mi compañero Christian forte puse mejorar el aspecto del mensaje del popup, después le cambie la fuente también con ayuda de mi compañero ya que no sabia donde colocar el código. Ya con  eso terminado me puse a buscar otra función que no pude implementar hasta ahora y después de muchos intentos y de cambiar mucho código no pude lograr e resultado ya que la pagina falla. Mañana tratare de implementar esta función ','2023-06-08'),(6208,273,'Bitacora 08-06-2023','En el día de la fecha realizamos una daily hablando sobre cómo ibamos con el proyecto. Por parte del diseño de la página, ya está realizada en su mayoría. Con respecto a lo demás, se sugirió hacer un cambio a la base de datos, cambiando “Mueble” por distintos tipos de muebles guardados en tablas específicas, tales como Cama, Armario, Mesa, Silla, etc.\r\nLuego de realizarlas, empecé a realizar las procedures dentro de sql que ayudarían a realizar los inserts dentro de la base de datos cuando vaya a programar en Java. Los mismos eran, realizar las funciones de InsertarCama, InsertarMueble, InsertarArmario e insertarMesa, y de esta forma darían una seguridad extra a la hora de usar la página. Posteriormente, empecé a realizar las funciones en java para realizar las conexiones, y a su vez también hice una función que busque todos los muebles que contengan cierta característica y cierto argumento que el usuario mismo puede pedir. ','2023-06-08'),(6209,275,'Base de datos ','Hoy lo que hice fue continuar junto con mi compañero Sáenz todo lo que seria la base de datos, ya teníamos el código hecho de las \r\npartes de datos personales en donde pedían el Email, Nombre, DNI, teléfono entre otras cosas, hoy hicimos la de domicilio y entrega que pedía\r\ncalle, provincia, altura, ciudad, fecha de entrega y código postal.\r\nDespués hicimos la de paso de compra que pedía tarjeta de crédito, debito, mercado pago, numero de la tarjeta, elegir cuantas cuotas quería,\r\ncódigo de seguridad fecha de vencimiento, si era MasterCard o visa, todo eso lo teníamos que pasar a php y probarlo también hay que ver como hacer un QR\r\npero en general bastante bien hoy, la base de datos ya casi esta completa, solo falta la factura que todavía no la terminamos en la maqueta y hay que ver bien como ponerla en la base de datos.','2023-06-08'),(6210,280,'','El dia de hoy se nos presento distintos hardware para ser utilizados en nuestro proyecto los cuales era el raspberry arduino y un notbook convencional. Se nos informo de las ventajas y desventajas de los mismo y terminamos decidiendo el uso de la notebook convencional ya que a la hora de trabjar es mucho mas practico y podriamos enfocarnos mas en toda la electronica y para el software de la pagina solo hariamos una especie de interfaz general la cual permita visualizar directamente las recetas en el robot mismo y en un celular','2023-06-08'),(6211,277,'Décimo cuarta clase','El día de hoy estuvimos continuamos trabajando con la página web, LiliFy, mis compañeros estuvieron haciendo el logo de la página, el cual al final quedó como un cuadrado celeste con la palabra Lify en cursiva dentro y una estrella amarilla al costado, crearon un modelo 3D para vender, un llavero de nirvana, y encontraron muchos otros.\r\n	Por mi parte estuve haciendo recreando la página desde cero, usando Bootstrap para mejoras visuales y optimización de código, cambiamos el color de la página de un verde con amarillo a un rosa con celeste y ya termine la página principal, donde se muestran descuentos y productos destacados, la de productos, donde hay una larga lista de productos para comprar además de una pendiente barra de búsqueda y separación por categorías, la de registro y la de inicio de sesión.\r\n	Todavía nos faltan muchas cosas de todas formas, el logo no está del todo terminado, además de que hay que ponerlo en la página, y hay que mejorar toda la pagina en si, todavía nos falta el sistema de carrito, los productos, imprimir una muestra 3D de estos y subir las fotos para su venta.','2023-06-08'),(6212,278,'Clase N° 17 08/06/2023','Hoy comenzamos el día realizando la daily , nos dividimos los trabajos , yo me puse a continuar con la realización de la pagina web , como primer paso edite el header , lo hice mas estético , le agregue borde y demás. Luego mi compañero pedro me pidió que coloque check box de tipo radio para que el usuario pueda seleccionar un mueble y le aparezca un menú en el cual pueda elegir el modelo/color/tamaño etc. Por ultimo corregimos el footer con mi compañero amir agregándole mas información y datos de contacto.','2023-06-08'),(6213,276,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión','El dia de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas: \r\n\r\n- Seguimos realizando ciertos arreglos dentro de la base de datos, esta vez habiendo configurado la misma con una tabla para los productos, de modo que podamos exhibirlos en la pagina de inicios donde se encontrarian algunos de los productos que se encuentran en promoción, tanto lencería, medias, pijamas y demas. Y de este modo podamos mostrar la imagen almacenada dentro de la base de datos, y tambien demas datos como el nombre del producto, su descripcion, precio, etc (Aunque tambien cuenta con otros datos los cuales en este caso no seran necesarios por el momento).  \r\n- Habiendo realizado lo anterior, configuramos el codigo de la pagina web para que por cada insert que haya dentro de la tabla de productos, muestre los datos mencionados anteriormente, y el resultado fue muy bueno, y a su vez configuramos todo para que por cada producto se genere una card y una fila por cada 4 cards, haciendo una fila debajo de una y asi sucesivamente entre los productos que se encuentren dentro de la tabla de productos. Quedaria hacer los inserts dentro de la base de datos para que muestre demas productos.\r\nPor otro lado, aclaramos que por el momento esto seria una prueba, por lo que no estaria del todo terminada esta parte, pues tambien debemos repartir los productos por las diferentes secciones que se encuentrandentro de la pagina Web, por lo que por el momento lo realizado queda como prueba para poderla implementarla y mejorarla mas adelante. \r\n\r\nEso fue todo por hoy.','2023-06-08'),(6214,287,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión','El dia de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas: \r\n\r\n- Seguimos realizando ciertos arreglos dentro de la base de datos, esta vez habiendo configurado la misma con una tabla para los productos, de modo que podamos exhibirlos en la pagina de inicios donde se encontrarian algunos de los productos que se encuentran en promoción, tanto lencería, medias, pijamas y demas. Y de este modo podamos mostrar la imagen almacenada dentro de la base de datos, y tambien demas datos como el nombre del producto, su descripcion, precio, etc (Aunque tambien cuenta con otros datos los cuales en este caso no seran necesarios por el momento).  \r\n- Habiendo realizado lo anterior, configuramos el codigo de la pagina web para que por cada insert que haya dentro de la tabla de productos, muestre los datos mencionados anteriormente, y el resultado fue muy bueno, y a su vez configuramos todo para que por cada producto se genere una card y una fila por cada 4 cards, haciendo una fila debajo de una y asi sucesivamente entre los productos que se encuentren dentro de la tabla de productos. Quedaria hacer los inserts dentro de la base de datos para que muestre demas productos.\r\nPor otro lado, aclaramos que por el momento esto seria una prueba, por lo que no estaria del todo terminada esta parte, pues tambien debemos repartir los productos por las diferentes secciones que se encuentran dentro de la pagina Web, por lo que por el momento lo realizado queda como prueba para poderla implementarla y mejorarla mas adelante. \r\n\r\nEso fue todo por hoy.','2023-06-08'),(6215,289,'8/06','El día de hoy, luego de ir de acá para allá con el modelo 3d, que la pantalla, que esto que lo otro, hemos decidido cambiar de proyecto. Volveremos a hacer todo de 0, ósea no pero sí.Haremos algo tipo computadora. Luego tendrán más detalles, eso es todo por hoy..... Muchas Gracias!!!\r\nPD: Pongan un gato de fondo de la pagina. ','2023-06-08'),(6216,295,'Diseño 3d - Cambio de idea de proyecto ','En el día de hoy lo primero que hice fue el diseño que anteriormente hice con mi compañero la clase pasada, lo volví a dibujar en una hoja para después poder llevárselo al profesor (encargado de la impresión 3D) para que nos ayude a pasar ese diseño al programa de AutoCAD, nos dió alguna de sus opiniones para poder cambiar algunas cosas, también vimos el tema de las ruedas, de lo que iría adentro del cuerpo del robot y lo que sería el “cuello” para poder unirlo con la parte de arriba.\r\nDespués de hacer eso, volvimos al aula y tuvimos que debatir algo en grupo, ya que la pantalla como del tamaño que queríamos no estaban dentro de nuestro presupuesto. Los profes nos dieron la idea de usar una mini computadora llamada Pi Top, la cual podíamos usar al desarmarla, para lo que seria la parte de arriba del robot. Y por último tomamos la segunda decisión del día la cual es reformular la forma en la que vamos a llevar a cabo el proyecto.','2023-06-08'),(6217,281,'Dia 12','El día de hoy estuvimos buscando modelos 3d para incluir en la página web. Ya tenemos 18 artículos que podríamos vender en esta. Ademas al final de la clase empezamos a diseñar el logo de LiliFy, estuvimos discutiendo sobre como seria, pero al final nos decantamos por uno que diseño mi compañero Matias Ruiz.','2023-06-08'),(6218,288,'Clase 15','Hoy mi equipo y yo trabajamos en poder buscar modelos 3d para nuestra respectiva página, la próxima clase los insertaremos dentro de la pagina, además logramos hacer un boceto de el logo de nuestra pagina LILFY, por el programa Paint.net, la proxima clase tambien intentaremos insertarlo dentro de nuestra pagina.','2023-06-08'),(6219,296,'Bitácora 12','Continuamos con el diseño de la página,cada uno hizo pagina y fuimos juntando los diseños para ver cuál era el que más nos gustaba y fuimos juntando las partes que más gustaban ','2023-06-08'),(6220,285,'Día 17','¿Qué logré hacer hoy?\r\n\r\nEl día de hoy me enfoqué en el armado de una de las páginas web pendientes. Mientras Thiago se encarga de la página principal, asumí la tarea de desarrollar la página de compra. Inicialmente, tenía la intención de hacer la página del carrito, pero descubrí que requería demasiados elementos adicionales, como componentes de JavaScript. Me resultó bastante complicado avanzar con esa página, así que decidí cambiar y concentrarme en la página de compra.\r\n\r\nDurante el día, me dediqué principalmente a trabajar en la estructura HTML de la página de compra. Estoy muy cerca de completarla y creo que para el viernes podré tenerla lista. Planeo mostrarle el progreso a Thiago para obtener su opinión y recibir sugerencias sobre posibles cambios. Estoy siguiendo de cerca el diseño que tenemos establecido, por lo que creo que estoy avanzando en la dirección correcta.\r\n\r\n¿En qué se me complicó?\r\n\r\nExperimenté dificultades al intentar desarrollar la página del carrito de compras. Esta se volvió bastante compleja debido a los diversos elementos y funcionalidades que requería, especialmente en relación con el uso de JavaScript. No me sentí cómodo con el progreso que estaba haciendo y decidí cambiar de enfoque hacia la página de compra, que era más manejable. Al realizar este cambio, logré superar las complicaciones y continuar avanzando en el proyecto.\r\n\r\n¿Qué estuve investigando?\r\n\r\nDurante el día, dediqué tiempo a investigar diversas áreas relacionadas con el desarrollo web. Me enfoqué en aprender sobre las mejores prácticas para el diseño y la estructura de páginas de compra en HTML. También investigué sobre cómo implementar de manera efectiva la funcionalidad de carrito de compras utilizando JavaScript y cómo integrarla adecuadamente con el diseño existente.\r\n\r\nAdemás, investigué sobre cómo optimizar la experiencia del usuario en la página de compra, centrándome en la usabilidad, la navegación y la presentación visual. Busqué recursos y ejemplos de páginas de compra exitosas para obtener inspiración y aprender de sus estrategias.','2023-06-08'),(6221,291,'Avance del proyecto','El día empezamos haciendo la daily como todas las clases anteriores para saber que tanto avanzamos y cuanto vamos a avanzar y las dificultades que tuvimos a la hora de hacer el trabajo, este día avanzamos con la pagina y estamos pensando cambiar la base de datos por una completamente diferente porque sentimos que le faltan cosas.','2023-06-08'),(6222,299,'Hoy','','2023-06-08'),(6223,298,'Clase 16','Hoy después de conversar sobre los componentes a usar en el robot, terminamos acordando en que rediseñariamos todo de cero. Tanto el robot, cómo la página. También estuvimos averiguando sobre la impresión del robot.','2023-06-08'),(6224,281,'Dia 13','Hoy hemos finalizado los últimos detalles de la barra de navegación y, al realizar algunos cambios de colores, hemos logrado que se vea más como deseábamos. Hicimos un intento de ubicar la imagen de nuestro logotipo en la parte superior derecha, pero lamentablemente no tuvimos éxito. Además, el tiempo del que disponíamos fue bastante limitado. Sin embargo, seguramente en la próxima clase podremos corregir este problema y comenzar a trabajar en el sistema de compras. También nos aseguraremos de que el icono sea funcional y cumpla con su propósito. Estamos ansiosos por llevar a cabo estas mejoras y brindar a nuestros usuarios una experiencia de navegación aún mejor.','2023-06-09'),(6225,285,'Día 18','¿Qué logré hacer hoy?\r\n\r\nHoy he logrado completar la página de compra en mi proyecto. Me enfoqué en implementar un sistema de calificación con estrellas que, aunque todavía deseo pulir un poco más, cumple su función y está funcionando correctamente. Me aseguré de que todo esté correctamente acomodado y que funcione perfectamente antes de realizar la última modificación. Ahora la página web está estructurada y, por el momento, cumple su función básica, aunque seguiré agregando más elementos al proyecto en el futuro.\r\n\r\n¿En qué se me complicó?\r\n\r\nAfortunadamente, no encontré grandes complicaciones durante el día de hoy. Pude avanzar sin problemas en la implementación de la página de compra y el sistema de calificación con estrellas. Aunque hubo algunos pequeños desafíos técnicos, pude resolverlos rápidamente y seguir adelante con mi trabajo.\r\n\r\n¿Qué estuve investigando?\r\n\r\nDurante el día, estuve investigando sobre cómo implementar un sistema de calificación con estrellas en una página web. Busqué diferentes enfoques y técnicas para lograrlo y elegí la que mejor se adaptaba a las necesidades de mi proyecto. Además, estuve investigando sobre las mejores prácticas de diseño y usabilidad para asegurarme de que el sistema de calificación sea intuitivo y fácil de usar para los usuarios.\r\n\r\nTambién estuve investigando sobre cómo estructurar adecuadamente una página web de compra. Aprendí sobre las secciones clave que deben estar presentes, como el carrito de compras, los detalles del producto, la información de envío y pago, entre otros. Me aseguré de obtener inspiración de diseños exitosos y estudiar cómo se organizan y presentan los elementos en las páginas de compra de otros sitios web.','2023-06-09'),(6226,276,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas: \r\n\r\n- Hicimos ciertos arreglos dentro de la base de datos. Ya que los productos mostrados dentro de la pagina web ya habiendo hecho la conexión, se mostraban por cada insert que tenia la base de datos generando una card automáticamente, se arreglo la base de datos para que los productos no se repitan, declarando la ID como primary key y a su vez dandole a cada producto una seccion, lo cual nos ayudara a la hora de codificar las demas secciones de la pagina web, y asi pudiendo separar los productos por sus respectivas secciones. \r\n- Por otro lado , empezamos a configurar el inicio y las cards, de modo que podamos codificar la pestaña en donde se mostrarian los datos del producto seleccionado, y a su vez daria ciertos detalles sobre el producto en si. Tambien daria la opcion de seleccionar el talle y el color del conjunto y el de poder agregar el producto a su carrito de compras. Esta aun esta en proceso, pues por el momento solo se hizo una pequeña prueba. \r\n\r\nEso fue todo por hoy.','2023-06-09'),(6227,288,'Clase 16','Durante la jornada de hoy, nos dedicamos con ahínco a la elaboración y diseño de la interfaz de nuestra página. Nos propusimos crear una experiencia visual atractiva y funcional para los usuarios. Nos sumergimos en la elección cuidadosa de los colores, buscando una combinación armoniosa que transmitiera la identidad y personalidad del proyecto. Sin embargo, a pesar de nuestros esfuerzos, encontramos algunos obstáculos en el camino. En particular, nos enfrentamos a dificultades al intentar incorporar el icono deseado. A pesar de nuestros múltiples intentos, no logramos alcanzar los resultados deseados. Pero, lejos de desanimarnos, nos tomamos esto como una valiosa lección y una oportunidad para aprender y mejorar. Enfocándonos en el futuro, nos comprometemos a resolver este inconveniente antes de la próxima clase. Pondremos todo nuestro empeño y conocimientos para solucionar los problemas técnicos y lograr una integración perfecta del icono en la interfaz. Estamos seguros de que, con dedicación y esfuerzo, conseguiremos un resultado satisfactorio y coherente con la visión que tenemos para el proyecto. Además de esta situación, también nos percatamos de que nos faltó completar la sección correspondiente al apartado de contacto. Reconocemos la importancia de esta parte fundamental de la página y comprendemos que es esencial para brindar una experiencia completa a los usuarios. Para remediar esta situación, nos hemos embarcado en una investigación exhaustiva sobre las mejores prácticas y técnicas para implementar esta sección de manera eficiente y atractiva. En nuestro afán por mejorar la interfaz, nos planteamos el desafío de mover nuestro icono png hacia la parte superior del navbar. Esto requirió un análisis minucioso de las diferentes opciones disponibles y una exploración de las herramientas y métodos más adecuados para lograrlo. Estamos satisfechos con los avances obtenidos hasta el momento y confiamos en que, con los ajustes necesarios, lograremos el resultado deseado. Además, como parte de nuestra dedicación a la estética y la coherencia visual, hemos decidido realizar cambios en los colores de los bordes en los formularios de registro y login. Nuestro objetivo es brindar una experiencia estéticamente agradable y coherente en toda la página, asegurándonos de que cada elemento visual esté en armonía con el conjunto. En resumen, aunque nos enfrentamos a desafíos y obstáculos en la creación de la interfaz de nuestra página, estamos comprometidos a superarlos y alcanzar un resultado exitoso. Nos hemos dado cuenta de la importancia de la paciencia, la perseverancia y la búsqueda constante de conocimientos para lograr nuestros objetivos. Estamos entusiasmados por seguir trabajando en este proyecto y estamos seguros de que los ajustes y mejoras que realizaremos darán como resultado una página atractiva y funcional que cumpla con nuestras expectativas y las de nuestros usuarios.','2023-06-09'),(6228,274,'CSS del PHP de la tabla, ayuda','En el día de la fecha lo que hice fue modificar la posición tanto del logo de la página como del icono de cerrar sesión, los cuales se encontraban en la página que contiene la tabla con los incidentes. Al mismo tiempo, lo que hice fue ayudar a un compañero del equipo ya que tenía problemas con el php de la página de los usuarios. Le dije como cargar los datos ingresados en una base de datos y que se muestren en la pantalla. Luego, intentamos solucionar un error que se producía al marcar los checkbox, aunque no pudimos solucionarlo. También discutimos algunas ideas con el Project Mánager del equipo.','2023-06-09'),(6229,283,'maldito seas estado de php!','el dia de hoy hicimos la daily para luego ponernos manos a la obra y  seguir el php y la base de datos. hicimos nuevos avances para el login y seguiremos asi para poder finalizar la ','2023-06-09'),(6230,272,'Desarrollo WEB','Hoy continúe con el desarrollo del inicio de la página. Configurando la conexión entre php hacia la base de datos y unas cards que mostraban unas ofertas de productos. Así se configuran automáticamente dependiendo de las ofertas ingresadas en la base de datos. ','2023-06-09'),(6231,286,'HTML, Base de Datos y PHP de Página Usuarios 2','El día de la fecha llegué al aula un poquito tarde y me encontré con mis compañeros que ya estaban trabajando pero eso no fue un impedimento o una complicación para mí ni para el grupo. Conseguí una computadora e hice la rutina de siempre, ingresar mis cuentas en el navegador, abrir el Visual Studio Code, descargar todos los archivos que iba a usar y además creé una variable de entorno para poder usar el cmd y la base de datos. Empecé agregando un pequeño &lt;form&gt; al index.html para que pueda enviar toda la información del formulario hacia el PHP, seguí agregando las variables faltantes al PHP y después agregué lo necesario a la base de datos para que las nuevas variables del PHP funcionen. Al haber completado todo esto, intenté poner a prueba el formulario, pero salieron un par de errores por lo que decidí consultar a mi compañero Christian Forte. Luego de varios intentos, no pudimos dar con la solución, si hubiéramos tenido más tiempo de clase, seguramente lo solucionábamos.','2023-06-09'),(6232,278,'Clase N° 18 09/06/2023','El día de hoy comencé con mi compañero Amir a desarrollar la pagina web de inicio , en la cual colocamos un titulo de bienvenida y 3 cards en forma circular con información acerca de la Empresa , Nuestra Historia y Asesoramiento. También agregamos un nav  y un footer. Nos faltaría colocar un menú deslizable para que reenvié al usuario a la pagina de inicio de sesión.','2023-06-09'),(6233,279,'Dia 15 del Proyecto','En el día de hoy estuve mejorando o mas bien aprendiendo aun mas sobre react practicando y siguiendo lo que hacia el video sabiendo que hacia en cada paso aunque algunas veces tuve que repetir el video de ver alguna parte por no poder entenderlo o como funcionaba el código.','2023-06-09'),(6234,287,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas: \r\n\r\n- Hicimos ciertos arreglos dentro de la base de datos. Ya que los productos mostrados dentro de la pagina web ya habiendo hecho la conexión, se mostraban por cada insert que tenia la base de datos generando una card automáticamente, se arreglo la base de datos para que los productos no se repitan, declarando la ID como primary key y a su vez dándole a cada producto una sección, lo cual nos ayudara a la hora de codificar las demás secciones de la pagina web, y así pudiendo separar los productos por sus respectivas secciones. \r\n- Por otro lado , empezamos a configurar el inicio y las cards, de modo que podamos codificar la pestaña en donde se mostrarían los datos del producto seleccionado, y a su vez daría ciertos detalles sobre el producto en si. También daría la opción de seleccionar el talle y el color del conjunto y el de poder agregar el producto a su carrito de compras. Esta aun esta en proceso, pues por el momento solo se hizo una pequeña prueba. \r\n\r\nEso fue todo por hoy.','2023-06-09'),(6235,280,'','El dia de hoy mi persona estuvo en un evento de feria de ciencias. En cuento llegue nos dispusimos a crear nuevas pautas para el  proyecto','2023-06-09'),(6236,296,'Bitácora 13','Hoy estuve ayudando a mi compañero gerónimo a realizar la página de inicio,estuvimos viendo distintos logos y agregando imágenes la cuáles acompañarían con la presentación de la empresa ','2023-06-09'),(6237,293,'Factura','hoy día con mi compañero Maximiliano hicimos un boceto de factura ya que no había ','2023-06-09'),(6238,292,'limites en la api','En el dia de la fecha ya con la reintegración de mi compañero enzo bartoletti, le mostré todo lo que había avanzado en el dia anterior y debatimos sobre que debía hacer en la clase de hoy. Estuve bastante tiempo sin poder hacer algo debido a que la maqu9ina en la que estaba se tildo varias veces y tuve que reiniciarla. Después de que la computadopra anduviera bien, me puse a investigar para establecer limites dentro del mapa. Lo logre pero trajo consigo un prpblema y es que los limites se establecieron en todo el mapa y no me puedo desplazar dentro de caba','2023-06-09'),(6239,290,'Decimoséptima','En el día de la fecha lo que hice fue continuar con la página en prácticas profesionalizantes, creamos un apartado para que sepan que es la empresa y quiénes somos','2023-06-09'),(6240,282,'Tareas de scrum master ','En del día de la fecha colabore con Ledesma en la busqueda de funciones para agrupar datos y restringir el alcance del mapa tan solo a la ciudad autonoma de buenos aires.\r\nA su vez ayudé a Christian Forte con el analisis del sector de administradores de BaVigila y controle las tareas de Caceres, descubriendo que esta dando sus primeros pasos en React.','2023-06-09'),(6241,289,'9-06','El día de hoy, solo fuimos 3. \r\nHemos visto algo más de cerca el proyecto, quedando así (por ahora).\r\nLa idea sería que, el robot estaría conectado al servidor (que sería nuestro), el cual tendrá dentro todas las recetas. El usuario podría conectarse por teléfono, o computadora. El cliente al elegir una receta, mandaría un 1 al robot/computadora, y este comenzará a ejecutar la receta. \r\nUsaremos Python para programar, voy a practicar el fin de semana. \r\nEso es todo por hoy, muchas gracias!!!\r\n','2023-06-09'),(6242,275,'Factura ','Hoy fue un día en donde no hicimos mucho, entre que quería adelantar un trabajo y que ya habíamos completado todo lo que seria la base de datos ayer con Sáenz no tenia mucho que hacer, solo nos faltaba hacer el tema de la facturación, pues para esto hice en el canva una hoja en la que se pondrían los datos de la compra y los datos de la persona que realiza dicha compra, terminado solo queda hacer su base de datos correspondiente. ','2023-06-09'),(6243,298,'Clase 17','Creeeeeo que ya decidimos cual sería el diseño final. Después de probar la netbook que nos prestó el profe, acordamos que la usaríamos para el trabajo. No pudimos hacer mucho, pero es bastante en comparación a otros viernes.','2023-06-09'),(6244,291,'Avance del proyecto','El día de hoy empezamos la clase realizando la daily, hoy empese a cambiar ña base de datos y agregando código php a la página.','2023-06-09'),(6245,282,'Cuarto dia de trabajo GS1','En el dia de hoy trabaje de manera virtual, a pesar que en el dia de la fecha me tocaba trabajar desde la presencialidad, debido a un supuesto paro de transporte el cual se terminó cancelando.\r\nRecien arrancada la jornada dialogué con Tobiás respecto a las tareas a realizar durante la jornada y posterior a esto Tomás se comunicó conmigo para consultarme acerca de mis avances y para solicitarme que le envie el archivo en el que estoy trabajando.\r\nEn esta jornada realicé grandes avances respecto a jornadas anteriores, siendo que realicé el analisis de mas de 400 filas de empresas, logrando llegar a 1/2 del trabajo solicitado.','2023-06-13'),(6246,262,'13-06-2023','El día de hoy seguimos trabajando en blender con los personajes e investigamos sobre las dimensiones de los personajes','2023-06-13'),(6247,260,'13/06/23','Estuve leyendo la documentacion de Fullcalendar para entenderlo y ayudar con su implementacion','2023-06-13'),(6248,269,'13/06','Llegué a las 2:30 del curso de react, y terminé mi primer página completa de la presentación de los programadores. Usando props.','2023-06-13'),(6249,271,'13-6-23','En el día de la fecha comienze a hacer mi personaje en blender','2023-06-13'),(6250,267,'13/06/2023','Hoy empecé mi propio modelo 3D del robot. Hice la parte de motores, arduino, puente h, sensor ultrasonido y la rampa.','2023-06-13'),(6251,265,'13-06-2023','Hoy, como no pudimos seguir con el armado, tuve que seguir con el diseño 3d de robot al cuan le hice un orificio para poder colocar el sensor infrarrojo\r\n','2023-06-13'),(6252,253,'13/06/2023 - Personaje Blender','Hoy continué con las piernas de mi personaje.','2023-06-13'),(6253,256,'6/6/23 y 13/6/23','segui viendo videos sobre JOptionPane','2023-06-13'),(6254,303,'13-06-2023','Hoy continuamos con el modelado de los personajes.\r\n','2023-06-13'),(6255,266,'Comienzo de la parte de logica de creacion con repeticion ','En el dia de hoy me estuve dedicando a pensar la mejor alternativaa para crear eventos de tipo fixed con la posibilidad de repeat de manera dinamica, ya me hice  una idea de como adaptar la base de datos y la api para cumplir estas necesidades. ','2023-06-13'),(6256,254,'13/06/23','termine de el formulario de restristro y la clase de la conexion de la bdd','2023-06-13'),(6257,251,'Curso Laravel pt5 - 13/06/2023','El día de hoy continué el curso de Laravel. Solucioné el error de la clase pasada, pudiendo ingresar usuarios en la bdd tras cambiar la bdd. También agregué Firebase JWT para la API.','2023-06-13'),(6258,250,'Martes 12 + 1 (Jaja no voy a dormir tan facil) ','Hoy trabaje en la materia programación sobre redes  y seguir con los cursos de java script','2023-06-13'),(6259,268,'13-06-2023','Hoy termine con el diseño 3D del logo en tinkercad y me puse a completar la carpeta de campo.','2023-06-13'),(6260,255,'Martes 12 + 1 (Jaja no voy a dormir tan facil) ','hice 2 (dos) RECTANGULOS en figma','2023-06-13'),(6261,259,'13/6 Nahuel Moreno Practicas Profesionalizantes','Hoy hice correcciones en las base de datos en amplitud, en la tabla de Recetas añadiendo &quot;Url_foto&quot; para q el usuario agregue fotos del alimento en cuestion, y posteriormente añadiendo mas alimentos en diversidad, sea de bebidas alcoholicas o no alcoholicas','2023-06-13'),(6262,252,'Clase 24 - Modal de Creacion','Hoy comencé con el modal de creación. Primero organicé todo lo que iba a necesitar para crearlo, la cantidad de inputs que iba a necesitar y sus tipos. Hice la creación del hook personalizado para el modal y un componente llamado ModalCreación. Lo importé en una página de prueba para ir visualizandolo a medida que voy haciendo cambios. Todavía no está terminado, va a llevar seguramente 2 clases más para estar al 100% funcionando','2023-06-13'),(6263,282,'Quinto dia de trabajo GS1','En el día de hoy trabaje de manera presencial, prosiguiendo con la tabla Relacion_VTA-MARCAS, especializándome en corregir errores pasados y consultar dudas pendientes. Para esta tarea me junté con Tomás y Lucas para analizar caso por caso cada defecto encontrado, como las empresas inexistentes, las que no figuran en el INPI, las que figuran con un / LA, etc.','2023-06-14'),(6264,290,'Decimoctava','6/06: En el día de la fecha entre por primera vez a la empresa GS1, nos hicieron un pequeño recorrido por toda la oficina, nos entregaron los materiales con los cuales vamos a trabajar, nos explicaron que teníamos que hacer dentro de la empresa y comencé haciendo un Listado de oportunidades de mejora, que termine ese mismo día.\r\n7/06: En el día de la fecha tuve una reunión que duro aproximadamente 2 horas y media en la cual se dividieron 3 grupos de 6 personas, en esta reunión hablamos de que se tenia que hacer un nuevo diseño de la pagina web, ya que el viejo diseño traía problemas de confusión al usuario, por lo que mi grupo se debatió temas como la ubicación de la nav-bar en modo horizontal, también se debatió sobre si las principales funciones de la pagina web deberían estar dentro de un apartado llamado codificación junto con las otras opciones, para que el usuario pueda ver que la empresa tiene mas soluciones y no solo se dedica al código de barra, luego se expuso cada uno de los diseños de los 3 grupos, y al finalizar se hizo una lista con las principales ideas o características que tenían que estar en el rediseño final de la pagina.\r\n8/06: En el día de la fecha comencé un power point en el cual tengo que hacer un breve resumen de lo que fue la reunión de ayer, tengo que finalizarlo para la semana que viene y tengo que poner las ideas principales. \r\n13/06: En el dia de la fecha continue con el power point de la semana pasada y corregí algunas cosas que estaban mal, al finalizar la 3era hora termine el power point y tuve una Reunión en la cual hablamos sobre los avances AFIP\r\n14/06: En el día de la fecha comencé con un Word sobre preguntas frecuentes que se hicieron en una charla con la empresa, enumere las principales pero todavía no les puse su respectiva respuesta  ','2023-06-14'),(6265,256,'14/6/23','Estuve viendo videos respecto al metodo buscar y comence a ver videos sobre java web para luego hacer la conexion junto a kiara','2023-06-14'),(6266,254,'14/06/23','Hoy modifique algunos errores que daban el el proyecto maven, la proxima clase creo un pequeño modelo para ver si la conexion de la bdd funiona y empezar a conectar todo ','2023-06-14'),(6267,250,'Miercoles 14/6/2023','Hoy trabaje sobre una aplicacion web que funciona para generar grids. Y rehice todo el Index de la pagina en esa herramienta\r\n','2023-06-14'),(6268,270,'14/06/23','El dia de hoy modelé un poco mas el personaje y casi finalicé su cara, informandome un poco mas de videos.','2023-06-14'),(6269,268,'14-06-2023','Hoy me puse al día con la carpeta de campo. Después de terminar de ponerme al día con la carpeta de campo empecé con el diseño en papel de mi diseño para el robot sumo.','2023-06-14'),(6270,253,'Miércoles 14/06/2023 - Personaje en Blender','Hoy continúe haciendo las piernas del personaje pero, en medio de todo, la computadora se frizó  y perdí absolutamente todo lo que estaba haciendo.','2023-06-14'),(6271,255,'Miercoles 14/6/2023','Hoy terminé de rehacer el diseño del index de figma :3','2023-06-14'),(6272,262,'14-06-2023','El dia de hoy seguimos diseñando el personaje en blender y ya comenzamos con el suavisado del mismo ya para comenzar con la ropa\r\n','2023-06-14'),(6273,251,'Curso Laravel pt6 - 14/6/2023','El día de hoy logré registrar un usuario pero al momento de logearse el mismo no se encontraba. Decidí buscar en internet pero no encontré una solución a mi problema (user = null). La clase próxima pediré ayuda al profesor Consorti.\r\nhttps://laravel.com/docs/10.x/queries\r\nhttps://stackoverflow.com/questions/29548073/laravel-advanced-wheres-how-to-pass-variable-into-function\r\n','2023-06-14'),(6274,260,'','Correcion momentanea de bug al mover un evento y seguí investgando sobre fulllCalendar ','2023-06-14'),(6275,267,'14/06/2023','Hoy seguí con mi diseño 3D, añadi los sensores infrarrojos y modifiqué el tamaño y forma del robot junto a otras mejoras.','2023-06-14'),(6276,261,'14/06/2023','hoy segui con el diseño 3D','2023-06-14'),(6277,266,'Correccion y pensamiento de logica de creacion de eventos ','estuve pensando la logica del repeat, es muuy complejo, por eso estuve tanto tiempo haciendolo, pero ya tengo algo avanzado, falta correguirlo y debugear','2023-06-14'),(6278,269,'14/06','Hoy terminé el primer proyecto de presentación de los programadores. Y comencé el segundo, el cual es un contador de clicks ','2023-06-14'),(6279,252,'Clase 25 - Modal Creacion','El día de hoy lo aproveché para terminar todo el estilo principal del modal. Visualmente se ve bien pero aún se puede mejorar mucho más. La próxima clase aprovecharé para terminar con las funcionalidades faltantes del modal, por ejemplo que pueda invitar a otros participantes para ser parte del evento, también poder elegir la opción de repetir ese evento las veces que uno quiera, ya sea por semana, por día en específico (como todos los viernes o todos los 16 de un mes), o incluso por mes. Tambíen otra función por agregar es que puedas elegir cuando mostrar una notificación como recordatorio. Por último aprovechar el tiempo que sobre para mejorar aún más lo visual en el modal.','2023-06-14'),(6280,265,'14-06-2023','Hoy segui con el diseño del robot, agregandole soporte para los sensores y para la segunda plata que agregaría más tarde','2023-06-14'),(6281,271,'14/6/2023','En el día de la fecha continúe con la creación de mi personaje pero ahora ya le hice la forma del cuerpo','2023-06-14'),(6282,258,'14-06','hoy hice una especie de modelaje en 3d y ademas de ver un video  para ser de ayuda en otra cosa','2023-06-14'),(6283,272,'Desarrollo WEB','Continuando con la página WEB estuve realizando cambios en la forma de código, utilizando clases predefinidas en el bootstrap para agregar detalles o mejor posicionamiento de los objetos.','2023-06-15'),(6284,279,'Dia 16 del proyecto','En el día de hoy estuve aun mirando los videos de react de midudev aunque después de mirar un poco mas estaba viendo videos medio obsoletos o parecido así que mirando en el mismo canal o mas bien del mismo creador mirando en midulive pude ir mirando sobre un nuevo video de enseñando react desde cero siendo ahora mas actual y siendo mas fácil entenderlo pero aun así necesito ver aun sus videos para entender bien como usar react.','2023-06-15'),(6285,278,'Clase N°19 15/26/2023','En el día de hoy , no realice muchas tareas, debido a que estaba con mucho dolor de cabeza y de cuerpo. Lo único que hice fue continuar con la pagina de inicio agregando un header , el cual contiene 2 botones que te redireccionan a la pagina de &quot;Inicio de Sesión&quot; y &quot;Agregar un Producto&quot;. Eso fue todo lo que realice el día de hoy.','2023-06-15'),(6286,292,'limites en la api y errores en la misma ','en el día de la fecha junto con la ayuda de mis compañeros christian forte y manuel filippa continuamos con la función de los limites ya que había un error que hacía que los límites no me permitieran desplazarse dentro de buenos aires. luego de varias pruebas y errores se me ocurrió la idea de hacer un limite yo mismo, entonces cambie la funcionalidad de los popups para que me mostraran las coordenadas, entonces con esas coordenadas establecí un límite, al principio el límite funcionaba pero  las funciones del zoom y de los popups habían dejado de funcionar, por lo que me dispuse a solucionarlo. Después de solucionarlo, los subí al drive y le pedí a mi compañero Manuel Filippa que lo probara en la interfaz de usuario web, llevándonos la sorpresa de que no funcionaba con el resto de la interfaz. con mi compañero Christian corroboramos que anduviera de por sí cosa que si hacía, pero al unirlo con la interfaz los límites y el zoom dejaba de funcionar. tratamos de encontrar la solución pero no hubo caso por lo que lo dejaremos para la clase de mañana. también fui documentando mis avances en la carpeta de campo, también pensé en otra función para agregar además de la unión de los popups y el formulario que marque la ubicación al instante y es que fuera del territorio de provincia, cosa que debería estar de por sí ','2023-06-15'),(6287,273,'Clase 15-06-2023','Durante este día me dediqué a revisar las páginas que hicieron mis compañeros, sugiriendo cosas para ponerles y ayudando con la correspondiente codificacion en CSS. Posteriormente, empecé a pedir que me envien las páginas para poder unir el back-end con el front-end, empezando desde la página de inicio. La primera página contiene la información acerca de nosotros, con un botón para dirigirse al login y otro para dirigirse al register. ','2023-06-15'),(6288,276,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión ','\r\nEl día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas: \r\n\r\n- Seguimos en base a la codificación de la pagina web, en la cual por el momento empezamos a codificar la pestaña en la que se muestran los datos del producto que se seleccionaría en el inicio, y en base a eso se recuperarían los datos hasta la pestaña de producto, en la cual se mostrarían la imagen del producto seleccionado, ciertos de sus datos como la ID y su nombre, la imagen, dos campos en los que se le dara al usuario la opcion de seleccionar el talle y el color de la prenda seleccionada y la descripción del producto. Por el momento fue todo lo realizado, aun sigue en proceso el poder agregar dicho producto al carrito y configurarla para que los valores de selección cambien en caso de que se trate de otro tipo de prenda en especifico. \r\n- Y por otro lado, se realizo cierto arreglo dentro de la base de datos dada para configurar el carrito de compras, pero por el momento no pudimos probarla, por lo que queda en proceso por el momento. \r\n\r\nEso fue todo por hoy. \r\n','2023-06-15'),(6289,284,'Bitacora 15','Hoy estuve finalizando con el login de la pagina y estuvimos trabajando con mis compañeros de equipo para poder hacer la parte de cada uno lo mejor posible.\r\npudimos finalizar todo y ahora solo queda juntar todo y conectar la base de datos con la pagina web','2023-06-15'),(6290,274,'Ayuda con PHP Y API del mapa','En el día de la fecha, lo que hice fue intentar solucionar un problema que tenía un compañero de mi equipo con el php de su página, la cual era donde los usuarios reportan los incidentes. Ya habíamos tenido este problema la clase anterior, ya que mostraba un error al marcar los checkbox de la sección de modalidad del incidente. Busqué algunos tutoriales pero no pude encontrar nada. Al final de la clase recordé que tenía un trabajo antiguo en el cual había utilizado los checkbox y posteriormente ingresar los valores a la base de datos, pero ya no tenía mucho tiempo. Al mismo tiempo iba ayudando a otro compañero de mi equipo, quien se encargaba del mapa de la aplicación. El problema que teníamos era que los limites del mapa se marcaban unicamente cuando éste estaba como un archivo solitario. Una vez que lo uníamos al html que contenía el formlario, no había un límite de navegación. Tampoco pudimos soluconar este problema.','2023-06-15'),(6291,277,'Décimo quinta clase','El día de hoy estuvimos avanzando bastante, comenzamos por hacer la parte del registro, primero hice la base de datos que cuenta con seis columnas, correo, donde se guarda el email del usuario, usuario, donde se guarda el nombre de usuario, contra, donde se guarda la contraseña del usuario, celular, donde se guarda el teléfono móvil del usuario, género, donde se guarda el género con las siguientes opciones: hombre, mujer y otros, y por último edad, donde se guarda la edad del usuario.\r\nLa idea es utilizar estos campos para distintas funciones, el correo y la contraseña sirven para iniciar sesión de forma segura, el nombre de usuario es una forma rápida y sencilla de comunicarse con la persona sin necesidad de utilizar su nombre personal, el celular está para mantener una comunicación cómoda y rápida, aunque planeamos abrir nuestro propio chat donde comunicarnos con nuestros clientes, el género y la edad se utilizarán para las recomendaciones de productos y para prohibir ciertas categorías no aptas para todo público.\r\nEventualmente añadiremos una página para agregar un método de pago virtual si el cliente no quiere pagar de manera física.\r\nLuego de la base de datos me dispuse a trabajar en el registro, ya teníamos la página hecha así que solo tuve que hacer un archivo PHP que se comunique con la base de datos y guarde la información que el usuario ingresó, fue muy sencillo gracias al formulario de tipo POST, que me permite comunicarme entre un archivo HTML a uno PHP de manera eficaz. Tuve que crear una variable para cada columna además de una que no se encuentra en la base de datos que es la contraseña repetida, para que el usuario no se equivoque a la hora de escribir su contraseña.\r\nLo primero que hace el código es, mediante un IF, comprobar que ambas contraseñas son iguales, si es así crea una consulta SQL de tipo INSERT que permite guardar todos los datos en la tabla REGISTRO. Si todo sale bien el usuario será enviado a la página principal con un texto que dice “CUENTA CREADA CON ÉXITO”. En el caso que no pueda comunicarse con la base de datos o la contraseña este mal, se le avisará mediante un ALERT de JS al igual que cuando si acepta la cuenta.\r\nLuego del registro me dispuse a trabajar en el login, que funciona con el mismo principio que el registro, mediante una página que afortunadamente ya habíamos terminado la semana pasada se guardan los datos que el usuario ingresa, en este caso tan solo se pide el correo electrónico y la contraseña, en un principio era necesario introducir el nombre de usuario en lugar del correo, pero en nuestra base de datos decidimos hacer el correo la primary key, un espacio que nunca puede repetirse, en cambio el usuario si puede ser repetido por una cuenta, lo cual crea errores si dos cuentas tienen el mismo nombre de usuario y la misma contraseña.\r\nComo iba diciendo, en este caso el archivo PHP tan solo recibe dos datos, el correo y la contraseña, luego hace una consulta SQL del tipo SELECT de la tabla REGISTRO donde el correo y la contraseña coincidan con las que el usuario especificó. Si se encuentra la cuenta en cuestión se envía un ALERT dándole la bienvenida al usuario junto a su nombre, si este no es el caso se le enviará, junto a otro ALERT, a la página de login una vez más.','2023-06-15'),(6292,286,'HTML, Base de Datos y PHP de Página Usuarios 3','El día de la fecha comenzó normalmente, abrí todas las aplicaciones que iba a usar, inicié sesión en mis cuentas, descargué los archivos necesarios y me puse a trabajar. Para empezar el día laboral intenté solucionar los problemas que aparecen cuando intento hacer un envío de formulario, para solucionarlos tuve que revisar las líneas de código del PHP para dar con el problema, para solucionar estos problemas fui al index.html y tuve que cambiar un par de etiquetas &lt;name&gt; para más tardes cambiar y agregar variables en PHP que corresponden a dichas etiquetas, al cambiar y agregar variables al PHP también tuve que modificar la base de datos, lo cuál fue una tarea rápida y fácil. También tuve que modificar parte de la variable &quot;instruccion&quot; de PHP para que los datos ingresados en el formulario puedan enviarse a la base de datos. A todo esto, los problemas seguían apareciendo por lo que tuve que recurrir a mi compañero Christian Forte el cuál me dió una mano y pudo solucionar los problemas y hacer más práctico el código de PHP. Mientras mi compañero me ayudaba, yo intentaba ayudarlo a él con una parte de su trabajo, buscando en YouTube y Google tutoriales o información que sirva para poder con un botón ampliar una casilla de una tabla en HTML. Lastimosamente no pude encontrar esa información. Más tarde mi compañero Ezequiel Ledesma solicitó mi ayuda para poder hacer que un botón del formulario, al presionarlo, agregue las coordenadas de donde estoy en un &lt;input&gt; de texto. Pude encontrar dos videos que probablemente sirvan de ayuda, estos videos los guardé en un documento que tenemos con el grupo en el Google Drive para guardar links de utilidad. Para terminar el día de hoy, avancé un poco en la carpeta de campo.','2023-06-15'),(6293,275,'Verificación de diagramas ','Básicamente hoy me limite a solamente revisar todo los que habíamos hecho referente a los diagramas, como el diagrama de flujo de datos, camino critico, caso de uso, colaboración, secuencia, entidad relación y el diagrama GANTT, actualizando los que necesitaba y asegurándome de que todos estuvieran terminados y en condición.','2023-06-15'),(6294,299,'Hoy','Hoy hicimos el daily','2023-06-15'),(6295,293,'base da datos','corregí la consultas del base de datos y lo verifique ','2023-06-15'),(6296,287,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión ','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas: \r\n\r\n- Seguimos en base a la codificación de la pagina web, en la cual por el momento empezamos a codificar la pestaña en la que se muestran los datos del producto que se seleccionaría en el inicio, y en base a eso se recuperarían los datos hasta la pestaña de producto, en la cual se mostrarían la imagen del producto seleccionado, ciertos de sus datos como la ID y su nombre, la imagen, dos campos en los que se le dará al usuario la opción de seleccionar el talle y el color de la prenda seleccionada y la descripción del producto. Por el momento fue todo lo realizado, aun sigue en proceso el poder agregar dicho producto al carrito y configurarla para que los valores de selección cambien en caso de que se trate de otro tipo de prenda en especifico. \r\n- Y por otro lado, se realizo cierto arreglo dentro de la base de datos dada para configurar el carrito de compras, pero por el momento no pudimos probarla, por lo que queda en proceso por el momento. \r\n\r\nEso fue todo por hoy. \r\n','2023-06-15'),(6297,296,'Bitacora 14','Hoy seguí con mi parte de la página web y ya está casi todo terminado para así unirlo y de ahí hacer la parte de la base de datos','2023-06-15'),(6298,289,'15-06','El día de hoy, empezamos de nuevo a hacer todo. Geral y Lucho comenzaron a cambiar la pagina y hacer el php. Mientras yo, comence con la app de python, el inicio de sesion. Hay más, pero por hoy eso es todo por hoy, muchas gracias!! ','2023-06-15'),(6299,282,'Sexto día laboral GS1','Durante el día de hoy, con la previa aprobación de Tomás, decidí trabajar desde la virtualidad. En este día aminore la marcha de mis progresos pero utilizando un método más eficiente, siendo que en 2 horas realicé el análisis de 300 filas, usando como principal método de comprobación el packaging.\r\nTambién hoy me focalice en eliminar registros bajo las normas aprendidas el día de ayer, siendo que el recuento de filas a revisar pasó de 140 a tan solo 90.\r\n','2023-06-15'),(6300,295,'Modificacion del proyecto y pagina web','En el día de hoy charlamos en grupo y nuestra scrum nos comentó de las modificaciones que se le iba a hacer al proyecto y como se llevaría a cabo, que eran bastante distintas a lo que era el proyecto en un principio, entonces después de hablar de eso la tarea que me asignó fue hacer junto a mi compañero la modificación de la página web ya hecha anteriormente y la empezamos a adaptar a lo que era el nuevo proyecto. Además nos dividimos las tareas próximas a hacer cada uno en el grupo con los nuevos trabajos que había que hacer de acuerdo a esta nueva forma de llevar a cabo nuestro proyecto, y fuimos anotando esas tareas en un Trello.','2023-06-15'),(6301,294,'Investigación sobre python - Reforma del proyecto','En el dia de hoy como principal tarea tuvimos que organizarnos un poco e hicimos todos un trello para ordenar las tareas que tenia pendiente cada uno, ya que habiamos cambiado severamente el proyecto. Luego investige un poco de el lenguaje de programación python, yo tenia unos conocimientos previos de algunos años anterior pero necesito lustrar conceptos que no recuerdo, este lenguaje va a ser de gran ayuda para manejar nuestro robot. Como ultimo realice con mi compañera un cambio en la parte de la pagina web que en este caso estaban hechas con html y decidimos cambiarlo al lenguaje php para conectar todo a la base de datos.','2023-06-15'),(6302,280,'Python opencv','El dia de hoy procedi a trabajar en una portatil otorgada por el instituto para trabajr con opencv ya que al ser una computadora que no esta freezada no corremos el riesgo constante de perder los datos o tener q volver a instalarlos.\r\nSolo se realizo la instalcion de los componentes necesarios y crear las variables de entorno e instalacion de microsoft visual studio.\r\nTodo esto debido a que cambiamos por 2da vez consecutiva el como hacer el proyecto.','2023-06-16'),(6303,273,'Bitacora 16-06-2023','En este día empecé a realizar testeos con lo que sería el código de barras y la base de datos. Primero hice el código que serviría para interactuar y crear un pdf que contenga el codigo de barras y que después sera leído por una aplicación móvil. Posteriormente, hice un archivo ejecutable en Java que serviría para testear todo esto. Luego, conversé con el profesor para ver qué haría el código de barras, y lo que hará este será redirigir al usuario a una página donde interactuará con la base de datos y marcará el mueble correspondiente como verificado. Para hacer todo esto, tuve que añadir una nueva columna a la base de datos de cada mueble, que sería “VERIFICADO”. A su vez, también le sumé esta característica a las funciones de SQL (las de Java se quedaron exactamente igual).\r\n','2023-06-16'),(6304,278,'Clase N°20 16/06/2023','En el día de hoy tuvimos problemas con todas las paginas webs que realizamos , ya que , ninguna tenia responsive , por lo tanto nos toca empezar de cero.Yo empece con la pagina de inicio , debido a que es la que me pareció mas sencilla.Vi tutoriales en YouTube sobre como conseguir que la pagina sea responsive, también realice un tutorial en W3Schools que me sirvió mucho.Una vez aprendido responsive , comencé a realizar el header de la pagina.','2023-06-16'),(6305,274,'Solución a errores PHP','En el día de la fecha, lo que hice fue buscar posibles soluciones al problema que saltaba en el PHP de la página de usuarios, donde son reportados los incidentes. Tras haber buscado varios videos, pude encontrar uno el cual lo explicaba. Tras haber hecho esto, pude modificar los valores que eran mostrados tras seleccionar si se requería ambulancia o bomberos. Ahora solo me quedaba un error relacionado a los checkbox, pero no llegué a encontrar una solución.','2023-06-16'),(6306,285,'Día 19','¿Qué logré hacer hoy?\r\n\r\nEl día de hoy me enfoqué en arreglar algunos problemas en la página de Compra. Uno de los principales desafíos fue convertir todas las unidades de medida de &quot;%&quot; y &quot;px&quot; a &quot;rem&quot; para lograr una mayor consistencia y flexibilidad en el diseño. Aunque todavía siento que hay algunos ajustes por hacer, logré avanzar significativamente en esta tarea y la página se ve mucho mejor ahora.\r\n\r\nAdemás, estoy trabajando en el desarrollo de la página de Compra, lo cual es un paso importante en el proyecto. Estoy implementando las funcionalidades necesarias para permitir a los usuarios realizar compras de manera eficiente y segura. Me alegra decir que voy avanzando en esta etapa y estoy seguro de que el resultado final será satisfactorio.\r\n\r\n¿En qué se me complicó?\r\n\r\nDurante el día, me enfrenté a un problema con el script de las estrellas en la página de Compra. Por alguna razón, dejaron de mostrarse correctamente y tuve que dedicar tiempo a revisar y corregir el código responsable de esta funcionalidad. Afortunadamente, pude identificar y solucionar el error, asegurándome de que las estrellas volvieran a funcionar correctamente en la página.\r\n\r\nAdemás, mi compañero realizó un cambio en el encabezado (header) de la página, lo cual causó algunos problemas en el diseño general. Como resultado, tuve que arreglar y ajustar varias secciones de la página para que se adaptarán correctamente al nuevo encabezado. Si bien esto me tomó un poco de tiempo extra, estoy comprometido a resolverlo y espero que pronto mi compañero pueda proporcionar un nuevo footer, ya que el actual causa desajustes en la estructura de la página.\r\n\r\n¿Qué estuve investigando?\r\n\r\nDurante el día, estuve investigando diversos temas relacionados con el desarrollo web y el diseño. Me enfoqué en aprender más sobre las mejores prácticas de diseño responsive y la implementación de unidades de medida relativas, como &quot;rem&quot;, para lograr una mayor adaptabilidad en la página. También investigué sobre las formas más efectivas de corregir problemas en scripts y componentes específicos, como el caso de las estrellas que mencioné anteriormente.\r\n\r\nAdemás, me mantuve informado sobre las últimas tendencias y técnicas en diseño de encabezados y footers para páginas web. Investigué diferentes enfoques y estilos que podrían mejorar la apariencia y la funcionalidad de estos elementos en mi proyecto.\r\n','2023-06-16'),(6307,286,'HTML, CSS y JS de Página Usuarios','En el día de la fecha ingresé al aula donde trabajamos todos los viernes y me senté en mi sitio de preferencia acompañado de Christian Forte, el cuál encendió mi computadora antes de que llegue para que pueda empezar a trabajar más rápido. Como siempre inicié sesión en mis cuentas, abrí todas las aplicaciones y descargué todos los archivos necesarios. Una vez terminada la rutina de siempre, comencé con mi trabajo. Al principio no sabía que hacer ya que mi compañero Christian estaba trabajando en la página de usuarios ya que necesitaba su ayuda. Consulté a mis compañeros que podría hacerle a la página, refiriéndome al diseño de esta, ya que no me convencía como estaba, por lo que llegamos a la conclusión de cambiar el diseño del formulario desplegable. Para empezar con esta labor lo primero que hice fue buscar en Google &quot;form design&quot; para ir a la sección de &quot;Imágenes&quot; y de esta forma poder ver diseños e inspirarme u obtener ideas, no encontré muchas imágenes que me ayuden pero de una logré obtener algo, eran unos iconos que enumeraban las partes del formulario que había que completar, entonces busqué la página &quot;Font Awesome&quot; la cuál me proporciona una muy amplia variadedad de logos y símbolos para agregar al código HTML. A pesar de toda esta búsqueda e investigación, no avancé en este tema. Más tarde consulté con el Scrum Master, Enzo Bartoletti, para proponerle la idea de hacer un Pop-Up que aparezca al enviar el formulario, el estuvo de acuerdo con mi idea por lo que me puse manos a la obra. Primero consulté a Christian para que pueda proporcionarme información, aunque más tarde decidí buscarla por mi cuenta haciendo uso de YouTube, encontré un video que me mostraba cómo hacerlo en JavaScript pero no dio resultado. El tiempo se acabó y concluí el día de hoy sin poder hacer un avance pero con toda la información para continuar.','2023-06-16'),(6308,279,'Dia 17 del Proyecto','En el día de hoy seguí continuando viendo el video de explicación de como usar react siendo este mas actualizado aunque también Enzo me pidió que empiece de nuevo a hacer los dailys ya que estos quedaron en standby un rato siendo que debía ver los videos aunque ahora los volví a hacer estos haciendo de los días que no hice avanzando hasta el daily numero 18.','2023-06-16'),(6309,282,'ayuda a compañeros en el aula de PP','Durante la jornada de hoy colaboré con mis compañeros en la asignacion de tareas, el analisis de las tareas en proceso y tambien ayudando con las tareas en las cuales mis compañeros habian quedado trabados y no encontraban posibles soluciones.','2023-06-16'),(6310,276,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión','\r\nEl día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Debido a que aun no terminamos la pestaña del producto en si, por el momento solamente nos dedicamos a diseñar la misma, a la cual por el momento tenemos el diseño en si, aunque solamente faltaría buscar una forma de configurar la pagina para que el color y la talla de los productos sean correctos en base al producto seleccionado y tambien una forma de agregar esos productos al carrito de compras y demas.\r\n\r\nEso fue todo por hoy. ','2023-06-16'),(6311,292,'blureo de la api','en la jornada de hoy trate de solucionar el problema de ayer que no funcionaban los límites, pero cuando trate de mostrárselo a mi compañero enzo bartoletti que se incorporó hoy, funcionaba correctamente, por lo que el error debe ser en las compus de la otra aula. después de corroborar que funcionara bien, me dijeron que busque otra funcion que seria blurear las zonas que se encontraban fuera de los limites y que no se pudieran colocar popups. busque por muchas páginas y probe con distintos pedazos de código pero no hubo resultado y voy a tratar de seguirlo en otro horario. \r\nunas de las pagijnas que probe fueron \r\n','2023-06-16'),(6312,293,'diagrama base de datos','Hoy hice de nuevo el diagrama ya que hubo demasiado cambios en la base de datos','2023-06-16'),(6313,272,'Desarrollo WEB','Hoy continúe con el desarrollo web, utilizando clases de bootstrap e importando iconos de Google icons, utilizando su código css para personalizar y agregar iconos de forma eficiente y visualmente atractiva, que seguir.','2023-06-16'),(6314,298,'clase 19','Olvidé hacer la bitácora de ayer...Hoy volví a hacer la base de datos de cero. Me falta terminar con la tabla de ingredientes, pero eso lo resuelvo a la vuelta. Después le envío las cosas a los chicos y unimos todo :) ','2023-06-16'),(6315,281,'Dia 14','Hola podrias extenderme este texto: El día de hoy terminamos de darle forma a la base de datos añadiendo los productos(Modelos 3D) que encontramos la otra vez. También pudimos ponerle el logo a la página, nuestro logo es de un perrito con sombrero.\r\nTodo esto mientras nuestro compañero Federico Tolivia diseñaba los modelos en Ultimaker Cura.\r\nAdemás creamos un repositorio en GitHub para organizarnos y tener el proyecto mas limpio en general. Agregamos un espacio con las tareas que debemos terminar y realizar.','2023-06-16'),(6316,296,'Bitácora 15','Hoy estuve ayudando a mi compañero para realizar la base de datos y hacer el lector de barra para poder registrar los productos','2023-06-16'),(6317,288,'Clase 17','El día de hoy arreglamos nuestra querida base de datos de nuestra pagina Lilify, junto con mi compañero Joseph Guerrero. Mientras que mi otro compañero Federico Tolivia, pasa los diseños 3d de archivos stl a gcode, de tal manera que quedan listos para poder imprimir por dicha impresora. Mi compañero y yo modificamos precios de la base de datos y arreglamos algunas partes que no funcionaban, luego la insertamos en phpmyadmin y verificamos su funcionamiento correcto, no llegamos por el tiempo a agregar todos los productos pero planeamos hacerlo en la semana, o en la próxima clase.','2023-06-16'),(6318,291,'Avance del proyecto','El día de hoy esperamos un rato para que nuestros compañeros puedan llegar y poder realizar la daily todos juntos, lamentablemente falto una sola persona y no pudimos realizar la todos juntos pero aun así la hicimos y después seguimos con el proyecto, hoy cambie la base de datos y le agregue varias cosas para completarla y conectarla con la pagina bien.','2023-06-16'),(6319,287,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión	','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Debido a que aun no terminamos la pestaña del producto en si, por el momento solamente nos dedicamos a diseñar la misma, a la cual por el momento tenemos el diseño en si, aunque solamente faltaría buscar una forma de configurar la pagina para que el color y la talla de los productos sean correctos en base al producto seleccionado y también una forma de agregar esos productos al carrito de compras y demás.\r\n\r\nEso fue todo por hoy. ','2023-06-16'),(6320,275,'16-06-2023','Pues por ahora lo que nos falta para avanzar con el trabajo es completar la pestaña del producto, es decir la pestaña en donde se muestra cada producto a disposición con sus datos como el precio, le tamaño y ese tipo de información.  ','2023-06-16'),(6321,277,'Decimo Sexta clase','El día de hoy me puse a mejorar visualmente la página un poco más, originalmente la barra de búsqueda contenía cinco categorías una al lado de la otra, LiliFy, la página principal, productos, donde se ven los productos, contacto, donde pueden consultar al staff de la página, registrarse y login.\r\nLo primero que hice fue agregar un sexto botón que dice “carrito”, para en un futuro agregar esta característica. Además moví las categorías de registro e inicio hacia la derecha de la página junto a un perrito que toma el lugar del logo hasta que tengamos uno oficial. Por último cambié la vista previa de la página, el título y el ícono que aparecen en las pestañas del navegador, con el nombre LiliFy y la misma foto del perrito.\r\nLuego estuve pasando los modelos 3D al programa Ultimaker Cura, este sirve para modificar los modelos en formato STL y pasarlos a GCODE, un tipo de archivo que usa la impresora 3D, además sirve para definir los soportes de la figura, el relleno, el tamaño y diversas características que tienen que ver con la calidad y la cantidad de plástico utilizado.\r\nPara la próxima clase no se si empezar a imprimir las impresiones 3D y sacarles una foto para su exposición y próxima venta o si continuar con el tema de las cuentas, si bien se pueden registrar e iniciar sesión esto no significa nada, no se guarda un inicio de sesión por así decirlo, lo cual se debe solucionar cuanto antes. Tampoco podemos olvidar el famoso carrito que aún no hicimos, tenemos que hacer el logo de la página, el método de contacto con el staff y siempre hay espacio para la mejora visual de la página.\r\n','2023-06-16'),(6322,289,'16-06','HOY TODO A ULTIMA HORA LA HICE, PERO EL DIA DE HOY SEGUI CON LO DE PYTHON, LLEGANDO A HACER UN MINIPROTOTIPO DEL INICO DE SESION, ADEMAS DE INVESTIGAR CON ALGUNOS VIDEOS DE YOUTUBE. ESO ES TODO POR HOY,MUCHAS GRACIAS!!!','2023-06-16'),(6323,295,'Continuación de la modificación de la pagina web','El día de hoy continué con la modificación de la pagina web en la cual tuvimos que pasar todo lo que estaba hecho en html a lenguaje php y definimos cuales iban a ser los campos de la base de datos que seria el inicio de sesión y la parte de registrarse. Lo primero que hicimos en la pagina fue dejar el nav como estaba anteriormente hecho y le agregamos debajo un carousel en el cual se van a mostrar algunas imágenes de comida, en la parte superior lo que seria el nav va a estar los ítems que corresponden a recetas, inicio, mi cuenta (desplegable de inicio de sesión y registrarse) y contacto. ','2023-06-16'),(6324,294,'Seguimiento de pagina web','','2023-06-16'),(6325,294,'Seguimiento de pagina web (recambio)','Hoy continué con el cambio de la pagina web en donde ayer habia cambiado algunas cosas de html al lenguaje php, tambien creé archivos php con el respectivo propósito del inicio de sesion y registro de la pagina. Nos mantuvimos con el nav que ya estaba anteriormente en el archivo html creado por mi compañera. Agregamos en nuestra pagina un carousel con imagenes de comidas típicas que se encuentra en el home, es decir, lo primero que vas a encontrarte al entrar a la pagina.','2023-06-16'),(6326,282,'Septimo dia laboral GS1','En el día de hoy trabaje junto a Tobías alegre de manera presencial, continuando con mis tareas de análisis y comprobación de la existencia de las marcas provistas en el PDF de GS1.','2023-06-21'),(6327,268,'21-06-2023','El día de hoy comencé con el modelaje en 3D del robot sumo en tinkercad.','2023-06-21'),(6328,262,'21-6-2023','El dia de hoy realizamos el mapeo del videojuego en unity\r\n','2023-06-21'),(6329,260,'','Me encargué del renderizado de los eventos de cierto usuario en el calendario','2023-06-21'),(6330,253,'Miércoles 21/06/2023 - Carpeta de campo','Hoy continué la carpeta de campo porque no llegué a agarrar una computadora que tenga blender.','2023-06-21'),(6331,267,'21-06-2023','segui con el modelo 3D','2023-06-21'),(6332,266,'Terminacion de getAllEvents','Hoy estuve poniendome al dia con la carpeta de campo y estuve avanzando y terminando la parte de getAllEventsFor week, for Month and for year. Tambien estuve investigando sobre las notificaciones con firebase. No pude hacer pruebas pero avanse bastante','2023-06-21'),(6333,252,'Clase 26 - Actualizacion del Modal de Creacion','Hoy continué con el modal de creación. Use el paint para hacerme una idea de como queria que se viera el modal, con cada input acomodado y hoy pude hacerlo a la perfección. Faltan agregar las funciones al repetidor del evento y al recordatorio. Tambien agregue un inpput para agregar participantes al evento creado','2023-06-21'),(6334,282,'Octavo día laboral GS1 / averiguación de patentes e inversores para BaVigila','Durante el día de hoy proseguí con el Excel, el cual esta a 200 filas de ser finalizado. Estimo que en un día laboral mas estará finalizado.\r\nTambién, en clase investigue sobre como registrar la patente del proyecto en el INPI, como comprar un dominio web, donde alojarlo y las distintas posibilidades de que inversores se interesen en nuestro proyecto.\r\n ','2023-06-22'),(6335,292,'polígonos para tapar las imperfecciones de la api','En el día de hoy seguí con el polígono que restringía la visión al resto de zonas a las cual no tendría acceso nuestra app. Para esto se me ocurrió que podría poner nuevos polígonos parea tapas las demás zonas, por lo que edite la función de pop up para que me marque las coordenadas y con eso agregarlas a un nuevo polígono\r\nTambién le cambie la opacidad para que no se vean demasiado las demás calles.\r\nTuve problemas con algunas de las coordenadas ya que haciendo que el polígono se comportara extraño y no ocupará el espacio que quería, por lo que cambie todas las coordenadas y logre que funcionara correctamente, después en mi casa continuare tratando de terminar con todo el contorno\r\n','2023-06-22'),(6336,289,'22-06','En el día de hoy, luego de la daily, he seguido trabajando en el login de la app (python), además de hacer un boceto de como quiero hacer el inicio de la app. Vi algunos videos para seguir con la parte de la libreria(Tkinter), siendo que hoy toco ver Posicionamiento y algo de Poo. Eso ha sido todo por hoy, muchas gracias!!','2023-06-22'),(6337,274,'Funcionalidades PHP, Reunión con el equipo, Prototipados','El dia de hoy iba a agregar algunas funcionalidades al PHP que contiene la tabla con los incidentes reportados por los usuarios, a pedido del Project Mánager de mi equipo. Lo que él me había pedido era agregar un filtro en el cual se puedan buscar los incidentes según las distíntas categorías de la tabla. Además, también debía agregarle dos funcionalidades: la de modificar un incidente y la de eliminarlo. También me pidió realizar los prototipados de los anteriores diseños que había hecho, ya que no los habíamos hecho. Tras esto, el Project Mánager nos convocó a todos los integrantes del grupo a una reunión para discutir algunas cuestiones para ver como podríamos llegar a vender nuestro proyecto. Luego dediqué un poco del tiempo a buscar alguna manera para añadir las distintas modalidades (las cuales se almacenaban en un array) a la base de datos, ya que me salia un error de que debia ser de tipo string en vez de array. Pero no pude encontrar ninguna solución. Por último, diseñé en Figma los prototipados de inicio de sesión y de la página que muestra los incidentes reportados.','2023-06-22'),(6338,295,'Pagina web ','En el día de la fecha continúe con la modificación de la pagina web de nuestro proyecto en la cual empecé con lo que seria la parte del login, el inicio de sesión y el de registrarse. Creamos un formulario tanto para el inicio como para el registro, los cuales después vamos a conectar mediante php a lo que sería la base de datos de los registros e inicios.','2023-06-22'),(6339,276,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Por el momento finalizamos en diseñar la pestaña del producto y tambien se le agrego una funcionalidad mediante la cual los selectores de talla y colores se diferencien de los demas tipos de prendar, pues no todos son similares tanto en talla como en colores, por lo que eso ya estaría resuelto. Dado asi, faltaria configurar la pagina para poder agregar los productos al carrito y asi podamos configurará la pagina del carrito. \r\n- Por otro lado, ya se estaria configurando la tabla del carrito para que asi podamos usarla dentro de la base de datos y demas, por el momento se tendria en mente la Id del producto para no hacer el codigo tan extenso.\r\n\r\nEso fue todo por hoy.','2023-06-22'),(6340,285,'Día 19','¿Qué logré hacer hoy?\r\n\r\nHoy tuve un gran avance con la página de búsqueda. Investigando y probando diferentes técnicas, logré implementar los switches para filtrar por envío gratis y la llegada de mañana. Además, conseguí que la barra de búsqueda funcionara correctamente, permitiendo a los usuarios buscar productos de su interés. Al principio, tuve algunas dificultades para codificar en JavaScript, pero gracias a un tutorial que encontré, pude guiarme y superar los obstáculos.\r\n\r\nTambién implementé un script que muestra los productos introducidos en la página. Fue emocionante ver cómo los productos se mostraban en tiempo real y cómo se actualizaban al realizar una nueva búsqueda o aplicar un filtro. Además, logré hacer que la función &quot;Max Precio:&quot; funcionara correctamente, permitiendo a los usuarios filtrar los productos según el rango de precios que deseen gastar en su compra.\r\n\r\n¿En qué se me complicó?\r\n\r\nInicialmente, tuve dificultades al tratar de codificar en JavaScript. No estaba muy familiarizado con el lenguaje y me costaba entender algunos conceptos y sintaxis. Sin embargo, pude superar este obstáculo al encontrar un tutorial detallado que me ayudó a comprender mejor cómo trabajar con JavaScript y aplicarlo correctamente en mi proyecto.\r\n\r\n¿Qué estuve investigando?\r\n\r\nDurante el día, estuve investigando principalmente sobre la implementación de filtros y funciones interactivas en una página web utilizando JavaScript. Busqué diferentes métodos para lograr que los switches funcionaran correctamente y filtraran los productos según las preferencias de envío gratis y la llegada de mañana.\r\n\r\nAdemás, investigué cómo hacer que la barra de búsqueda respondiera a las consultas de los usuarios y generara resultados relevantes. Aprendí sobre las mejores prácticas para el manejo de eventos de teclado y cómo usar la entrada del usuario para buscar en una lista de productos.\r\n\r\nTambién me enfoqué en aprender cómo utilizar bases de datos para almacenar los productos y permitir una vista previa desde la página de búsqueda. Aunque aún no he implementado esta funcionalidad, investigué diferentes enfoques y tecnologías para futuras mejoras en el proyecto.','2023-06-22'),(6341,278,'Clase N°21 22/06/2023','El día de hoy continúe con la pagina web de inicio , seguí investigando sobre el responsive y le pedí ayuda a mi compañero Luciano sobre el tema. Logre que el titulo y el header no se desformen cuando la pagina se ejecuta en un dispositivo móvil. ','2023-06-22'),(6342,286,'HTML, CSS y JS de Página Usuarios 2','El día de la fecha comenzó normalmente, abrí todas las aplicaciones que iba a usar, inicié sesión en mis cuentas, descargué los archivos necesarios y me puse a trabajar. Intenté seguir con lo que había dejado la clase pasada, hacer un cartel popup para el formulario de la página de usuarios. Empecé a hacer lo viendo el video &quot;How To Make A Popup Using HTML, CSS And JavaScript | Create a Modal Box In HTML Website&quot; de GreatStack, luego de casi 30 minutos de copiar y pegar al pie de la letra cada paso que explica el hombre del video, los resultados terminaron siendo los inesperados, literalmente no andaba nada, por lo que decidí buscar otro video. Justo en ese momento, nuestro Scrum Master Enzo Bartoletti, convoca una reunión de grupo para hablar y tratar el tema de hasta donde queríamos llegar con este trabajo y los objetivos. Al terminar esta charla tuve un pequeño receso y más tarde continué con el trabajo. ¿Cómo seguí? busqué otro video que me pueda dar una mejor explicación sobre como poder hacer el popup. Llegué al video &quot;Build a Popup With JavaScript&quot; de Web Dev Simplified y otra vez, luego de casi 30 minutos de hacer lo debido y seguir los pasos al pie de la letra, no sirvió nada, no andaba ni una función sola. No logré hacer ningún avance, por lo que siento una gran decepción y desilusión, aunque creo que pude dar con la base del problema. A mi parecer el problema se encuentra desde el principio, me refiero a que todo empieza desde el botón que abre el popup, ya que este se encuentra dentro de una &lt;ul&gt; (unordened list). Si este no es el problema, tendrá que ser algún tipo de incompatibilidad con Bootstrap (creo yo). Para concluir con el día de hoy continué un poco la capeta de campo con lo que había hecho antes de ayer y ayer.','2023-06-22'),(6343,280,'','El dia de hoy se continuo la investiacion e instalacion de opencv y visual studio en el equipo correspondiente. Debido a fallas en la conexion no hubo oportunidad de probar si el codigo escrito para leer y tomar imagenes desde la interfaz funcionara correctamente. \r\nEn compensacion se rehicieron los diagramas de gantt se actulizo el trello y se ajustaron los diseños de las paginas e interfaces utilizadas.','2023-06-22'),(6344,273,'Bitacora 22/06/23','Hoy llegué al aula y empecé a revisar el código que tenía. Decidí cambiar la base de datos, en la parte de las tablas de los muebles, y les asigné un ID auto_increment. Después, modifiqué también el código en java donde serviría para controlar la base de datos, y edité los métodos constructores de las clases.  Luego, cambié el método constructor de los muebles, pero no borrando el atributo ID, que luego serviría para hacer los selects de la base de datos y declararlos como objetos (con su respectiva ID).\r\nLuego de todo esto, realicé un package en java y una clase diferente donde guardaría todo el código para generar los codigos de barra más fácilmente y de forma más ordenada. La misma clase se llama CodeBarGenerator, y está compuesta por una función que genera el pdf según el nombre de archivo que se especifique y el String a convertir en codigo de barra. Luego de hacer todo esto, el archivo se guarda en la misma carpeta del proyecto, y luego se deberá imprimir ya que al leer el código QR con la aplicación móvil, se verificará que el objeto está dentro de la base de datos al acceder a un link que se especificará al hacer todo esto.\r\n','2023-06-22'),(6345,283,'El dia de hoy, creamos la dayli para que luego poder ponernos a continuar de manera muy exaustiva la  pagina para darle una finalizacion al proyecto. Luego de tal introoduccion que realmente da a pensar que el texto es de gran magnitud y que por consecuen','El dia de hoy, creamos la dayli para que luego poder ponernos a continuar de manera muy exaustiva la  pagina para darle una finalizacion al proyecto. Luego de tal introoduccion que realmente da a pensar que el texto es de gran magnitud y que por consecuente yo el dia de hoy trabaje arduamente para finzalizar el proyecto. Pasando de todo esto, termine ayudando a mi compañero alan para hacer la pagina de busqueda y le agregamos cosas para su funcionalidad. usamos visual studio y el xampp para el php. ','2023-06-22'),(6346,279,'Dia 18 del Proyecto','En todo el día además de llegar y abrir las paginas necesarias para poder hacer los dailys que faltaban empezó haciendo la daily 19 llendo a preguntar lo que se hizo en el día ya que no me acordaba mucho pero sabiendo que ese día cambie de videos para estudiar los reacts y viendo como Enzo estuvo colaborando con Ledesma todo el día o mayormente en el día además de ayudar a Forte, en el daily 20 mayormente Manuel estuvo haciendo arreglos con el PHP y ayudando un poco a Forte y Ledesma, en el daily 21 no encontré mucho de lo que hicieron pero mayormente Enzo estuvo ayudando a todos un poco y en el daily 22 es de hoy donde se avanzo bastante siendo que Ledesma estuvo haciendo de maso menos limitar el mapa con polígonos en HTML mientras Manuel estaba buscando como hacer un popups en JavaScript y Forte estuvo haciendo el prototipado del login de la pagina de administrador y Enzo ayudando un poco a todos y contando como poder vender nuestro proyecto.','2023-06-22'),(6347,287,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Por el momento finalizamos en diseñar la pestaña del producto y tambien se le agrego una funcionalidad mediante la cual los selectores de talla y colores se diferencien de los demas tipos de prendar, pues no todos son similares tanto en talla como en colores, por lo que eso ya estaría resuelto. Dado asi, faltaria configurar la pagina para poder agregar los productos al carrito y asi podamos configurará la pagina del carrito. \r\n- Por otro lado, ya se estaria configurando la tabla del carrito para que asi podamos usarla dentro de la base de datos y demas, por el momento se tendria en mente la Id del producto para no hacer el codigo tan extenso.\r\n\r\nEso fue todo por hoy.\r\n','2023-06-22'),(6348,281,'Dia 15','El dia de hoy estuvimos calculando el precio de cada producto segun su peso, y con regalia de un 45% por la pintura, la energia y la ganancia.\r\nTambien estuvimos sacandole fotos para promocionar el producto y ademas estuvimos viendo tutoriales de youtube para sacar el registro y la cuenta.','2023-06-22'),(6349,284,'bitacora 16','hoy estuve haciendo algunos cambios en mi parte de la pagina que tuvimos que hacer , como aplicar el responsive en la pagina ','2023-06-22'),(6350,288,'Clase 18','Hoy hemos estado evaluando el valor de cada producto en función de su peso, y hemos aplicado un descuento del 45% por concepto de pintura, energía y margen de beneficio. Además, hemos realizado sesiones fotográficas para promocionar el producto y hemos recurrido a tutoriales en YouTube para obtener instrucciones sobre cómo obtener el registro y configurar la cuenta.','2023-06-22'),(6351,277,'Décimo Séptima Clase','El día de hoy estuve imprimiendo y pintando las impresiones 3D que hice en mi casa, imprimí los cuatro protagonistas de South Park y Totoro de la película El Viaje de Chihiro. Además estuvimos sacando fotos para su exposición en la página web, con el agregado de calcular el precio dependiendo el peso de la figura con regalías de un 45% extra debido a la pintura, la energía y la ganancia.\r\nTambién estuve buscando tutoriales en Youtube para el registro e inicio de sesión de las cuentas, para brindarle mayor seguridad a los usuarios.\r\n','2023-06-22'),(6352,293,'base de datos corrección ','hoy día corregí el select de la base de datos y también un poco el diagrama de gantt','2023-06-22'),(6353,275,'Actualización ','hoy lo que hice fue básicamente actualizar todo el diagrama gantt consultando con mis compañeros las fechas de inicio y de finalización de su trabajo, también verifique si todos estaban terminados correctamente y sin ningún error sacando que faltan cosas por terminar el resto ya están prácticamente terminadas, con esto me refiero al tema de diagramas. ','2023-06-22'),(6354,294,'Pagina web - continuamos la modificación','En el dia de hoy lo que hice junto a mi compañera fue seguir con la modificación de la pagina web de nuestro proyecto, lo primero que hicimos fue la la parte del login, despues el inicio de sesion y registro. Creamos tambien un formulario en el cual servira para inciar sesion a los usuarios, y otro formulario tambien para guardarlos. Todo va a estar conectado mediante php a una base de datos. Como ultimo agregamos un footer a la pagina principal.','2023-06-22'),(6355,274,'Prototipado','En el dia de hoy lo que hice fue terminar de realizar el prototipado de la página que contiene los incidentes reportados. Esto me tomó alrededor de media hora. Una vez que finalicé esto, discutimos con el Project Manager acerca de que otras funcionalidades le añadiríamos a esta página. Las que teniamos en mente eran un filtro para filtrar los incidentes según las distintas categorías. Despues intercambiamos tareas con uno de los compañeros de mi equipo, ya que a el se le complicaba bastante su tarea.','2023-06-23'),(6356,278,'Clase N°22 23/06/2023','El día de hoy tuvimos que reversionar la pagina web y le pusimos el nombre de MoonDream. Buscamos referencias en otras paginas de muebles, y en la nuestra agregamos un carrusel con 3 imágenes , y realizamos la sección de &quot;¿Quienes Somos?&quot;. Ademas de esto verificamos que la pagina se pueda ver en un dispositivo móvil.','2023-06-23'),(6357,292,'tratar de logar que no se puedan colocar popuyps en los nuevos polígonos','En el dia de la fecha trate de conseguir que no se puedan colocar popups en los nuevos polígonos que coloque, trate de varias formas como por ejemplo que no se puedan poner los correspondientes popups en todos los polígonos con un determinado valor de color, pero no hubo caso y los popups se podían colocar igual, a lo último se me ocurrió cambiar los límites con unas coordenadas alrededor de los límites que yo quería pero esto no resulto porque los limites no se pueden moldear y la única forma que tiene es de un cuadrado o rectángulo, esto lo termine de confirmas y que al poner todas las coordenadas que quería este no funciono y se achico el rectángulo a una pequeña parte del mapa pero la función la cumplía que era que no se puedan colocar los popups, aunque no de la mera que buscaba ','2023-06-23'),(6358,286,'HTML, CSS y JS de Página Usuarios 3','El día de la fecha comenzó normalmente, abrí todas las aplicaciones que iba a usar, inicié sesión en mis cuentas, descargué los archivos necesarios y me puse a trabajar. Intenté seguir con lo que había dejado la clase pasada, hacer un cartel popup para el formulario de la página de usuarios. Para empezar, mi compañero de trabajo Ezequiel Ledesma me proporcionó via gmail una página de Leaflet que según el podría ayudarme a crear una ventana pop up, pero la página no era un tutorial o una ayuda, esta me daba métodos y para que servían estos métodos, al no entenderla, decidí buscar en Google Drive una carpeta donde tengo un trabajo de otra materia que incluye una ventana popup. Intenté copiar todo. Al hacerlo debería haber un header con un botón que habre dicho popup, resultó que no había header, el script no andaba y el css tampoco andaba. Más tarde intenté hacer un popup desde el video de YouTube &quot;Cuadro emergente modal simple usando HTML y CSS&quot; de CodingNepal pero llegando a casi la mitad del video me dí cuenta que todo lo que hacía no funcionaba, por lo que deshice todo lo hecho. Para concluir, consulté con el Scrum Master Enzo Bartoletti para me pueda dar otra tarea para hacer y esta dejársela a mi compañero Christian. Acordamos en que Christian seguía con mi tarea y to con la de Christian, el prototipado.','2023-06-23'),(6359,276,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión - Diagramas ','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- En primer lugar, empezamos a codificar la pestaña del carrito, pero por el momento solo diseñamos el momento en el que el carrito se encuentra vacio, por lo que proximamente se estaria configurando el mismo para que cuando se encuentre algo dentro de la tabla del carrito, la cual tambien se estaria configurando para probarla. Tambien se configuro un poco la pestaña del producto para crearle un modo de form mediante el cual se pudiera agregar el producto al carrito, pero aun no se termino de configurar, por lo que se estara viendo a futuro.\r\n- Por otro lado, estuvimos realizando cierta actualizacion sobre los diagramas del proyecto, pues habian ciertos de ellos que necesitaban ser actualizados. \r\n\r\nEso fue todo por hoy. ','2023-06-23'),(6360,293,'tabla envio','hoy día hice la tabla de envió para el funcionamiento del base de datos a la pagina ','2023-06-23'),(6361,288,'Clase 19','El día de hoy faltó mi gran compañero y amigo Federico Tolivia, el cual por temas personales no pudo asistir a la clase del día de hoy. Su ausencia no nos resultó un gran problema para seguir con nuestro proyecto, nuestro desempeño el dia de hoy fue bastante productivo a la hora de insertar los productos en la base de datos, terminamos la gran mayoría de productos, pero aún faltan algunos que no teníamos pensado agregar pero vamos a hacer la próxima clase. Tambien el dia de hoy agregamos imágenes al carrousel principal mediante bootstrap para que quede bonito y en un futuro cuando clickees la imagen te lleve al producto listo para comprarlo y ser enviado a tu casa en minutos. Colocamos los precios de cada uno, además de los nombres de los productos. Logramos solucionar un problema que teníamos con la imagen del producto del carrusel el cual no se veía centrado, pusimos a Mandalorian, El gato con botas y Spiderman en el cual se ve bastante bien cada uno de nuestras caricaturas. ','2023-06-23'),(6362,275,'Cosas que terminar ','para para terminar este trabajo faltan pocas cosas como por ejemplo la tabla de envió la cual estuvimos haciendo hoy y tambien el tema de la facturación .','2023-06-23'),(6363,287,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión - Diagramas ','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- En primer lugar, empezamos a codificar la pestaña del carrito, pero por el momento solo diseñamos el momento en el que el carrito se encuentra vacio, por lo que proximamente se estaria configurando el mismo para que cuando se encuentre algo dentro de la tabla del carrito, la cual tambien se estaria configurando para probarla. Tambien se configuro un poco la pestaña del producto para crearle un modo de form mediante el cual se pudiera agregar el producto al carrito, pero aun no se termino de configurar, por lo que se estara viendo a futuro.\r\n- Por otro lado, estuvimos realizando cierta actualización sobre los diagramas del proyecto, pues habían ciertos de ellos que necesitaban ser actualizados. \r\n\r\nEso fue todo por hoy. ','2023-06-23'),(6364,282,'Clase presencial PP','Durante el dia de hoy asistí presencialmente a practicas profesionalizantes, colaborando con mis compañeros en la realizacion de las tareas del dia de hoy, vinculadas a los limites del mapa, los popup\'s, el sector de administradores y su correspondiente prototipado','2023-06-23'),(6365,296,'Bitácora 16','Ayudame a mis compañeros porque tenían un problema con las imágenes de la página que no acomodaban bien en el formato del celular y también tuvimos que cambiar el nombre y estilo de la página por varios problemas ','2023-06-23'),(6366,281,'Dia 16','El dia de hoy fue bastante productivo a la hora de insertar los productos en la base de datos, terminamos la gran mayoria de productos, pero aún faltan algunos que no teniamos pensado agregar pero vamos a hacer la proxima clase. Tambien el dia de hoy agregamos imagenes al carrousel principal mediante bootstrap para que quede bonito y en un futuro cuando clickees la imagen te lleve al producto listo para comprarlo y ser enviado a tu casa en minutos. Colocamos los precios de cada uno, además de los nombres de los productos. Logramos solucionar un problema que teníamos con la imagen del producto del carrusel el cual no se veía centrado, pusimos a Mandalorian, El gato con botas y Spiderman en el cual se ve bastante bien cada uno de nuestras caricaturas. &quot; cambiame las palabras','2023-06-23'),(6367,289,'23-06','El ida de hoy, continúe con los videos que vi anteriormente ademas de averiguar algo de los diagramas, ya que como cambiamos algo de la idea del proyecto, tendremos que hacerlo todos de nuevo. Nos comento el profe que tendremos que hacer uno para hacer la pagina web y otro para el robot. Eso es todo por hoy, muchas gracias!','2023-06-23'),(6368,295,'Continuacion página web','En el día de hoy continuamos con la pagina web, con lo que serian los formularios, los seguimos haciendo ya que la clase pasada no lo habíamos podido terminar, ya que hicimos lo que sería el footer de la página y empezamos con los formularios, entonces la clase de hoy pudimos terminar con esas dos cosas.','2023-06-23'),(6369,291,'','','2023-06-23'),(6370,285,'Día 20','¿Que logre hacer hoy?\r\n\r\nHoy ha sido un día bastante complicado y frustrante para mí. Me propuse implementar una funcionalidad en la página de búsqueda del index, pero desafortunadamente no logré hacerlo funcionar. Pasé mucho tiempo intentando solucionar el problema, pero no tuve éxito. Fue realmente decepcionante, ya que esperaba poder completar esa tarea hoy.\r\n\r\nSin embargo, no todo fue negativo. A pesar de los contratiempos con la funcionalidad de búsqueda, logré agregar el nuevo footer al sitio web. Pero aquí también surgieron problemas, ya que el footer no está funcionando correctamente. No importa lo que intento, simplemente no anda, y eso ha sido muy frustrante.\r\n\r\nAdemás, continué trabajando en la página de búsqueda, tratando de resolver ese inconveniente con la funcionalidad que deseaba implementar. Aún me falta descubrir cómo hacerlo, ya que no tengo claridad si se trata de un problema que requiere un script específico. Espero poder resolverlo antes de la próxima clase, ya que es una parte crucial del proyecto.\r\n\r\n¿En que se me complico?\r\n\r\nEl principal obstáculo que encontré hoy fue la implementación de la función de búsqueda en la página de inicio. A pesar de mis esfuerzos, no pude hacer que funcionara correctamente. Intenté diferentes enfoques, revisé el código varias veces, pero no logré encontrar la solución. Fue realmente frustrante no poder completar esta tarea y me generó una sensación de decepción y desánimo.\r\n\r\nAdemás, enfrenté dificultades con el nuevo footer que agregué al sitio web. A pesar de haberlo integrado según las instrucciones, simplemente no está funcionando. No puedo determinar la causa del problema y eso me ha generado una gran frustración.\r\n\r\n¿Qué estuve investigando?\r\n\r\nDurante el día, estuve investigando diferentes enfoques para implementar la función de búsqueda en la página de inicio. Busqué en foros y documentación en línea, tratando de encontrar un método efectivo para lograrlo. Aunque no obtuve resultados positivos en esta ocasión, aprendí sobre diferentes técnicas y enfoques que podrían ser útiles en futuros proyectos.\r\n\r\nTambién dediqué tiempo a investigar cómo solucionar los problemas con el nuevo footer. Leí documentación, revisé tutoriales y busqué posibles soluciones en comunidades en línea. Aunque todavía no he encontrado una respuesta definitiva, adquirí conocimientos sobre cómo solucionar problemas comunes relacionados con los footers en páginas web.','2023-06-23'),(6371,294,'Pagina Web - Corrección de base de datos ','El día de hoy lo primero que hicimos fue terminar con los formularios que empezamos la clase pasada, tanto el inicio de sesión como el de registrarse. Después de terminar eso, corregimos algunos errores que nos daba la base de datos, la cual hizo nuestra compañera, porque nos daba error ya que falta crear la base de datos, que la vamos a usar para conectarla con php a los formularios.','2023-06-23'),(6372,290,'Decimonovena','En el dia de la fecha lo que hice fue hacer un Word con aproximadamente 16 preguntas frecuentes que se realizaron en una conversación, saque las preguntas que mas se repetían y sus respuestas, luego me puse a hacer una corrección de una maqueta de una pagina web pero no tengo muy claro lo que tengo que hacer.','2023-06-27'),(6373,282,'Finalización parcial de Excel GS1','Durante la jornada de hoy terminé la revisión de las 2311 filas correspondientes al Excel Relacion-VTA-MARCAS, quedando aproximadamente 150 filas para una revisión exhaustiva. Además me junte con Tomás para revisar alguna de estas filas catalogadas como &quot;revisar&quot; y para solicitarle acceso al BackOffice para poder realizar yo estas revisiones.','2023-06-27'),(6374,250,'Martes 27/6/2023','hoy me sentí mal no hice mucho, estuve trabajando en la materia &quot;Desarrollo de sistemas&quot;','2023-06-27'),(6375,255,'martes 27/06/23','hoy avance con el diseño de la página en figma :3','2023-06-27'),(6376,265,'27-06-2023','El día de hoy comencé a ubicar el puente H en la plataforma en donde iría en conjunto con la placa Arduino. Luego seguí moldeando un cilindro, a las medidas de los hoyos, el cual servirá para hacer los orificios en donde irán ubicados los tornillos.','2023-06-27'),(6377,253,'Martes 27/06/2023 - Unity','Hoy quise ver algo de Unity y tratar de avanzar algo en esa tarea pero no me abría el archivo de Unity que ya había creado Enzo Romaniello, me saltaba un error que no conocía y no pude hacer nada.','2023-06-27'),(6378,269,'27/6','Hoy continúe con el contador de clicks en React ','2023-06-27'),(6379,268,'27-06-2023','Hoy continúe con el diseño 3d del robot sumo donde le agregue la parte trasera donde tendrá los motores, el puente h, las ruedas,el Arduino uno y un sensor de linea.','2023-06-27'),(6380,254,'27/06/23','hoy hice la pagina de prueba para la bdd e investigue mas sobre java web','2023-06-27'),(6381,260,'','Modificacion de diseño y parte funcional con Gonzalo del modal de creacion','2023-06-27'),(6382,252,'Clase 27 - Modal Creación','Hoy con Diego, hicimos los últimos retoques visuales del modal y aplicamos una funcionalidad en el select de repetición del evento que permite que la consola lea el valor de la opción seleccionada','2023-06-27'),(6383,267,'27/07/2023','Continué con el diseño 3D, añadí la tapa del robot, modifique el tamaño de todas las paredes a 2 cm de grosor y añadí una base al puente H, luego procedí a perder todo lo que hice hoy por querer tomar una foto para la carpeta de campo.','2023-06-27'),(6384,256,'Carpeta de campo','Hoy estuve agregando información en la carpeta de campo','2023-06-27'),(6385,261,'27/06/2023','hoy cambie y termine el diseño 3D.','2023-06-27'),(6386,266,'Firebase','Hoy estuve avanzando eh investigando todavía más con firebase, ya intenté obtener un token, pero no tuve éxito ','2023-06-27'),(6387,266,'Firebase','Hoy estuve avanzando eh investigando todavía más con firebase, ya intenté obtener un token, pero no tuve éxito ','2023-06-27'),(6388,258,'27-06','hoy no pude hacer nada por que no cargaba unity(si estuvimos como 3 hr intentando arreglarlo)\r\n','2023-06-27'),(6389,263,'27/6/23','Hoy despues de mucho tiempo sin hacer un bitacora debido a que estaba enfermo estos dias estuve trabajando con el personaje del juego, tomando registro para despues pasarlo a la carpeta de campo, mis compañeros tuvieron algunos problemas con el unity del colegio ya que no les cargaba.','2023-06-27'),(6390,251,'27-06 Hackeo al profesor ','El día de hoy me traje una netbook con Kali Linux y, haciendo una auditoría wifi y usando aircrack, intente conseguir la contraseña de su punto de acceso (wifi del celular). El proceso de auditoría fue exitoso, pero el bruteforce tardaba mucho y no llegué a conseguir la contraseña.','2023-06-27'),(6391,303,'27-06-2023','Hoy investigamos sobre Unity','2023-06-27'),(6392,262,'27/6/2023','El dia de hoy comenzamos con el diseño de los cuartos del videojuego, buscamos videos de youtube para darnos una idea.','2023-06-27'),(6393,290,'Vigesima','En el dia de la fecha lo que estoy realizando es el requerimiento segun la maqueta que hice, el procedimiento fue el siguiente, yo tuve que hacer una maqueta sobre una pagina web la cual gusto y ahora estoy haciendo el requerimiento explicando la distribuicion y la funcionalidad de esta, este requerimiento luego sera enviado a los superiores para que empiecen a hablar con los desarrolladores web','2023-06-28'),(6394,282,'Finalización 2º revisión Excel GS1','En el día de hoy trabajé virtualmente de 9:00 a 13:00. En los últimos minutos de la jornada de ayer me proporcionaron acceso al BackOffice para poder realizar la revisión exhaustiva de los 150 campos pendientes. Este BackOffice permite buscar a las marcas dentro de la base de datos de GS1, pudiendo buscarla (en mi caso) por nombre o por CodEmpre.\r\nTras revisar los 150 campos pendientes durante toda la jornada, logre avanzar en más del 66% de las filas, quedando solo 43 para una revisión mucho más a fondo, ya que no se encuentran los packagings, no figuran en el BackOffice, parecieran estar mal escritos o son de otra índole.\r\n','2023-06-28'),(6395,267,'28/06/2023','continue con el diseño 3D','2023-06-28'),(6396,255,'miercoles 28 6 2023','ayooo corregí la berreteada que tenemos por base de datos :333','2023-06-28'),(6397,297,'28/06/23','actualice mi carpeta de campo y cree una parte de la pagina principal.','2023-06-28'),(6398,265,'28-06-2023','Hoy me estuve enfocando en buscar la manera de modificar mi rampa, en el diseño 3D, para que los adversarios no puedan pasar por encima','2023-06-28'),(6399,268,'28/06/2023','Hoy continúe con el diseño 3d del robot sumo donde mejore la parte delantera con un soporte y una tapa donde tiene el logo del equipo.','2023-06-28'),(6400,256,'codigo java','estuve leyendo paguinas para seguir con el codigo, mas que nada busque sobre arraylists','2023-06-28'),(6401,258,'28-06','hoy otra vez no pudimos hacer mucho ya que seguimos intentando arreglar los errores de unity','2023-06-28'),(6402,254,'28/06/23','Hoy volvía crear el proyecto Maven y le cargue la bdd, también sume el formulario de prueba para que en la próxima clase cargarlo con la bdd','2023-06-28'),(6403,263,'28/6','Hoy seguí trabajando con el personaje mientras que mis compañeros estaban intentando solucionar los problemas que tuvieron en Unity','2023-06-28'),(6404,251,'Curso Laravel pt7 - 28/6/2023','El día de hoy CASI termino el curso de Laravel, faltándome solo 3 clases del curso. Avancé mucho, logrando los CRUD de post y categoría y opciones de comodidad para los usuarios, como subir fotos o buscar sus datos.','2023-06-28'),(6405,253,'Míercoles 28/06/2023 - Unity','Hoy estuvimos haciendo lo que es la habitación en Unity para los diferentes niveles.','2023-06-28'),(6406,259,'27/6 Martes &amp; 28/6 Miércoles Practicas Profesionalizantes - Nahuel Moreno','En estos dos días, Martes 27 y Miércoles 28, termine de ultimar detalles y agregar recetas de cada categoría que habíamos incluido(siendo al menos 1 para cada categoría) terminando con lo propuesto.','2023-06-28'),(6407,271,'28-6-2023','En el dia de ayer , me olvidé de hacer la bitácora pero había investigado un poco sobre unity.\r\nY en el día de hoy tuve inconvenientes con la computadora que se me frizo 3 veces pero luego cuando pude intenté avanzar un poco en unity.','2023-06-28'),(6408,261,'28/06/2023','trabaje el diseño de 3d, lo corte en partes para imprimirlo y lo envié al profe para que lo imprima','2023-06-28'),(6409,260,'','Seguí con el modelado y funcionalidad del modal de creación. Tuve varias complicaciones a la hora de hacer la lógica para algunas cosas pero pude ir adelantando varias:\r\n','2023-06-28'),(6410,269,'28/06','Hoy continúe con el contador de clicks en react','2023-06-28'),(6411,270,'28/6/23','El día de hoy retomé el escenario principal para terminarlo en una versión primitiva para la primera entrega y comence con el primero de mi tematica aunque solo coloqué el personaje con un plano ya que termino la hora.','2023-06-28'),(6412,257,'28/6/2023','Hoy creamos una cuenta con los assets en unity, pero tuvimos problemas al ingresar a unity, no nos dejó importarlos, vamos a seguir en casa','2023-06-28'),(6413,262,'28-6-2023','El dia de hoy realizamos los cuartos de unity de cada tematica ya con sus puertas y triggers','2023-06-28'),(6414,266,'Firebase + notificaciones push descartadas ','En el dia de la fecha estuve intentnaod mandar las notificaicones, pero me di cuenta que no es rentable ni viable hacer las notificaciones. Debido a que tendria que crear services especialixzados para cada sistema. En definitiva, lleguen a la conclusion que no es viable hacer notificaciones, debido a que se tendrian que crear services tanto para ios, como para android y para cualquier sistema operativo. ya que los services son correspondientes al sisitema y no tienen nada que ver con lo web. ','2023-06-28'),(6415,250,'Miercoles 28/6','hoy estuve estudiando cursos de javascript con apis','2023-06-28'),(6416,303,'28-06-2023','Hoy hicimos escenarios del juego Unity','2023-06-28'),(6417,286,'HTML y CSS de página Administrador y Mapa de Página Usuarios','El día de la fecha comenzó normalmente, abrí todas las aplicaciones que iba a usar, inicié sesión en mis cuentas, descargué los archivos necesarios y me puse a trabajar. Para empezar el día laboral, mi compañero Ezequiel Ledesma solicitó mi ayuda con su parte del trabajo, necesitaba que busque unas coordenadas específicas dentro del mapa de la Capital de Buenos Aires, estas eran para que el pueda hacer un límite que tenga la función de no colocar popups fuera de la Capital. Lamentablemente la idea que mi compañero tenía en mente no dio los resultados esperados. Más tarde me puse a trabajar en la página de administradores en la sección de &quot;incidentes&quot;, lo solicitado por el Scrum Master era agregar tres botones para que tengan las funciones de insertar, modificar y eliminar reportes. Más tarde, el Scrum Master me encomendó la tarea de mover de lugar el logo y el botón para cerrar sesión, los cuales puse centrado y en la esquina superior derecha respectivamente.','2023-06-29'),(6418,292,'tratar de logar limites y agturpar popup','En el dia de la fecha 29/06 comencé con l idea de poder moldear el límite con la misma técnica de ver las coordenadas pero ahora creando un nuevo límite, pero esto no dio resultados, para esto mi compañero manu me había ayudado diciéndome las coordenadas de los limites. Luego de este fallo seguí con lo otro que era tratar de que los popups se agrupen, esto ya que mi compañero enzo me paso días anteriores una página la cual era hecha con leaflet. Por lo que inspeccionando la página trate de buscar la parte del código que agrupe los popups pero no la encontré, aunque no la busque demasiado, lo que si encontré fueron las funciones de geolocate que nos van a servir más adelante.\r\nencontré otra página que me decía como agregar la función pero no pude aplicarla a mi trabajo por lo que seguire en otro momento \r\n','2023-06-29'),(6419,277,'Décimo Octava clase','El día de hoy estuvimos estilizando la página, haciendo diseños para la venta de productos destacados y mejorando la experiencia del usuario. Primero hicimos un Banner, una imagen larga horizontalmente, para una de nuestras figuras en venta, del Gato con Botas, el cual al principio no nos terminó de convencer, así que tuvimos que cambiarlo devuelta más adelante. Luego hicimos el banner del Mandalorian, un personaje de Star Wars donde usamos la tipografía de la misma serie. Por último hicimos el banner de Spiderman, mas específicamente Iron Spider, una versión de spiderman que cuenta con cuatro brazos mecánicos en la espalda.\r\nPor último agregamos algunos problemas para resolver al github que intentaremos resolver el día de mañana.\r\n','2023-06-29'),(6420,278,'Clase N°23 29/06/23','El día de hoy quede muy cerca de finalizar la pagina de inicio.Agregue información sobre la fabrica de los muebles , coloque una imagen de la fabrica y realice el footer. Pero lamentablemente la computadora se quedo trabada y la tuve que reiniciar, perdí  todo lo que había echo hoy así que tuve que empezar de nuevo.Realice todo lo antes mencionado y ademas en el header agregue 3 botones que redirigen a las paginas de registro, inicio de sesión y al inventario.','2023-06-29'),(6421,299,'Hoy','Hoy hicimos la daily y decidimos agregarle una sección de admin a la página, así que modificamos la base de datos y el código','2023-06-29'),(6422,283,'top 3 base de datos mas nefastas','Hoy empezamos con la daily y luego comenzamos a cambiar la base de datos para poder enfocarnos a hacer el php, agregamos algunas tablas como:  carrito, favoritos, pedido_producto, destacados, ofertas y envio. estas tablas ya se son mas adecuadas al tipo de pagina que queremos dar con el grupo. cada una de estas estara conectada via codigo de php en las paginas. Pero este paso nos dio a entender como debemos ponernos a hacer las cosas y tomar una vista perspectiva del mismo. Quiero que se entienda al mismo tiempo que nunca tuvimos un proyecto de tal magnitud y al mismo tiempo el grupo decae cada vez mas. Espero poder llegar a dar un punto final con el trabajo. ','2023-06-29'),(6423,274,'Detalles en el php, checkbox php','En el día de hoy, lo primero que hice fue cambiar el logo que teníamos tanto en la página de inicio de sesión de los administradores como en la página que contiene la tabla con los incidentes reportados por los usuarios por un logo el cual había hecho el Project Mánager de mi equipo. Pero como éste tenía un color de fondo un poco más claro que el de la página, lo que hice fue utilizar la página web. Photopea (una versión online de Photoshop) para cambiarle el color acorde al que utilizamos en la página. Una vez que hice esto, recorté los píxeles sobrantes de la imagen. Por último, ya que se veía bastante borrosa debido al tamaño, busqué algunas páginas que contengan una Inteligencia Artificial para que mejore la calidad de la imagen. Las primeras dos que encontré requerían de un plan premium para descargar la imagen. Finalmente, encontré una página llamada PicWish la cual me permitió descargar la imagen ya mejorada, y el resultado fue mucho mejor de lo que esperaba. Por último, la añadí a la carpeta donde se encuentran todos los archivos y le bajé el tamaño de 200px a 110px utilizando la propiedad width en el archivo .css.\r\n    Luego lo que hice fue buscar alguna forma de modificar el tamaño del icono de cierre de sesión, ya que en clases anteriores había probado esto pero nada me había funcionado. Entré en una página la cual decía que se podía cambiar el tamaño de la clase hasta 10xl, pero al probar esto quedaba un cuadrado grande en color blanco. Luego, leí que se podía agrandar utilizando la propiedad font-size, lo cual finalmente me funcionó.\r\nLuego, trabaje en solucionar los errores que me salian al marcar los checkbox en el php.','2023-06-29'),(6424,285,'Dia 21','¿Qué logré hacer hoy?\r\n\r\nHoy me dediqué por completo a trabajar en la base de datos, agregando nuevas tablas y estructuras. Fue un día bastante productivo, ya que logré crear y diseñar diversas tablas que eran necesarias para el funcionamiento adecuado de nuestro proyecto. Entre las tablas que agregamos se encuentran: &quot;Cliente&quot;, &quot;Pedido&quot;, &quot;Producto&quot;, &quot;Carrito&quot;, &quot;Favoritos&quot;, &quot;Pedido_Producto&quot;, &quot;Destacados&quot;, &quot;Ofertas&quot; y &quot;Envío&quot;.\r\nCada una de estas tablas fue cuidadosamente planificada y diseñada para almacenar la información relevante de manera organizada y eficiente. Me aseguré de definir correctamente las relaciones entre las tablas y establecer las claves primarias y foráneas necesarias para mantener la integridad de los datos.\r\n\r\n¿En qué se me complicó?\r\n\r\nAfortunadamente, no encontré mayores complicaciones durante el proceso de creación de las nuevas tablas en la base de datos. Aunque hubo algunos desafíos menores, como decidir la mejor forma de estructurar ciertos campos o establecer las relaciones adecuadas entre las tablas, pude resolverlos rápidamente mediante la investigación y la consulta de documentación relevante. En general, todo transcurrió sin mayores dificultades.\r\n\r\n¿Qué estuve investigando?\r\n\r\nDurante el día, estuve investigando sobre las mejores prácticas para el diseño de bases de datos relacionales y cómo estructurar adecuadamente las tablas y relaciones entre ellas. También me informé sobre cómo definir las claves primarias y foráneas, así como cómo establecer restricciones y reglas para mantener la integridad de los datos.\r\nAdemás, investigué sobre las diferentes opciones de almacenamiento y optimización de bases de datos, considerando factores como el rendimiento, la escalabilidad y la seguridad. Busqué información sobre cómo indexar adecuadamente las tablas, cómo optimizar las consultas y cómo asegurar la confidencialidad de los datos almacenados.\r\nTambién investigué sobre las mejores prácticas para el manejo de relaciones muchos a muchos, como en el caso de la tabla &quot;Pedido_Producto&quot;. Aprendí cómo utilizar tablas de enlace y cómo establecer las relaciones correctamente para representar adecuadamente esta relación compleja.\r\n','2023-06-29'),(6425,293,'diagrama de entidad relacional ','actualice el diagrama de entidad relacional porque hubo muchos cambios en la base de datos.','2023-06-29'),(6426,291,'Avance del proyecto','El dia de hoy realizamos la daily del 29/6 donde respondimos las tres preguntas, hoy cambiamos en su totalidad la base de datos por una completamente nueva con más tablas y más eficiente con la cual podremos realizar mejor la pagina y conectar la base de datos con esta, gracias a la nueva base de datos son va a resultar más fácil realizar el php y terminar la página.\r\n(La del 23/06 se mando en blanco :( )','2023-06-29'),(6427,273,'29-06-2023','Hoy tuve una reunión con los profesores donde me dijeron que podía dividir mi proyecto en dos. Por mi parte, tendría que hacer la API (los servlets y demás cosas en Java) que posteriormente usarían mis compañeros para la parte del frontend, solamente que la API sería mi proyecto como tal. Después me dispuse a realizar los servlets, empezando por el de ingresar cama, donde me estanqué porque estuve pensando sobre cómo podría realizar el hecho de que tenga escanear el codigo de barra y posteriormente verificarlo en la base de datos.','2023-06-29'),(6428,284,'bitacora 18','Decidimos realizar toda la pagina de nuevo desde cero , nos habiamos equivocado con el tema del responsive , y arreglarlo se nos hacia muy complicado y tambien no nos termino de convencer el diseño de la pagina , hoy yo estuve realizando la pagina donde ingresas y/o retiras productos todavia me faltan terminar los form y el diseño para que quede agradable a la vista','2023-06-29'),(6429,296,'Bitácora 17','Dado que tuvimos que cambiar la página hoy empeze a hacer la parte de login y registrar, tuve varios problemas para que se acomode a la resolución del celular, y aún no puede arreglar uno de un formulario','2023-06-29'),(6430,275,'Dia normal.','Durante el día de hoy lo que estuve haciendo a fatal que nuestro project manager falto fue revisar los que estuvimos haciendo hasta ahora, es decir\r\nestuve viendo los diagramas, las dailys, la carpeta de campo grupal y tambien el codigo SQL,  ','2023-06-29'),(6431,281,'Dia 17','Hoy, junto con los colegas Ruiz Matias y Tolivia Federico Andres, terminamos de diseñar el carrusel de nuestra página de inicio (index.php), arreglando errores como la línea blanca de nuestro carrusel y  cambiando el tamaño de las imágenes en la página en detalle y diseñamos cada foto de cada producto. Usamos la aplicación paint.net para el edit de cada foto.\r\n También pusimos los nombres  de cada personaje en el carrusel y todo estuvo muy bien, todavía tenemos que decidir muchas partes de la página de inicio, por ejemplo, poner el link respectivo de cada producto en el carrusel y que te envíe directamente al producto  para comprarlo. Todavía tenemos un largo camino por recorrer, pero en la próxima clase haremos todo lo posible para seguir adelante con nuestro proyecto. También agregamos algunas tareas en el github como por ejemplo lo de la línea blanca en el carrusel de imágenes. Igual como ya los realizamos lo marcaremos como hecho. \r\n','2023-06-29'),(6432,287,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión - Diagramas','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas: \r\n\r\nPrimero que nada,Seguimos codificando la pestaña del carrito se encuentra vacio por el momento todavia, Proximamente se estara configurando el mismo para que cuando se encuentre algo dentro de la tabla del carrito, se estara configurando para probarla que tal va quedando si resalta algun error. Fuimos configurando la pestaña del producto para crearle un modo de form mediante el cual se pudiera agregar el producto al carrito, pero aun no se termino de configurar, por lo que se estara viendo a futuro.\r\nPor ultimo, Seguimos realizando cierta actualización sobre los diagramas del proyecto, pues habían ciertos de ellos que necesitaban ser actualizados. ','2023-06-29'),(6433,288,'Clase 20','El dia de hoy con mis compañeros Guerrero Joseph Perdomo, y Tolivia Federico Andres, perfeccionamos el carrousel de nuestra pagina principal (index.php), de tal manera que arreglamos errores como la línea blanca sobre nuestro carrousel y el tamaño de las imágenes de cada producto, detallamos y estilizamos cada una de ellas.\r\nTambién colocamos los nombres dentro del carrusel de cada personaje, y todo quedó muy bonito, aún nos falta terminar muchas partes de la página principal como por ejemplo que cada producto del carrousel te mande a el producto directamente para comprarlo, tenemos mucho camino por delante pero la próxima clase daré lo mejor de mi para poder avanzar en nuestro proyecto, intentaré realizar lo susodicho anteriormente y realizar por lo menos un personaje con sus imágenes, descripción y botón de compra.\r\n','2023-06-29'),(6434,290,'Vigesimaprimera','En el dia de la fecha lo que realice fue continuar con el prototipado de la maqueta del portal del socio, cuando finalice esta tarea continue con el documento de las preguntas frecuentes','2023-07-04'),(6435,282,'Finalización de Relacion-Vta_Marcas y comienzo de tarea Producto-Variedad','En el día de hoy asistí presencialmente a las oficinas de GS1, continuando y por fin acabando con el documento de Excel referido a Relación-Vta_Marcas. Además se me solicitó si podía colaborar con la realización de otro Excel referente al local de pastas “La Juvenil”, en la cual se solicitaba separar los productos de su variedad.','2023-07-04'),(6436,253,'Martes 04/07/2023 - Unity','Hoy hicimos la 2da habitación en Unity para ya comenzar con el código.','2023-07-04'),(6437,257,'4/7/2023','Hoy personalmente avance con la carpeta de campo, no mucho pero estuve escribiendo bastante, trate de ayudar a un compañero a mover los colliders del mapa en unity, aunque paso una hora entera antes de que siquiera abriera','2023-07-04'),(6438,269,'04/07/23','Continuación del curso de react y contador de clicks ','2023-07-04'),(6439,263,'4/7 ','Hoy no hubo mucha novedad segui trabajando con el personaje aunque todavia le falta pintarlo o personalizarlo y terminar de conectar bien los huesos con el cuerpo en si del personaje','2023-07-04'),(6440,260,'','Agregue mas estilos al modal de creacion y funciona al 100% solo falta aplicarle los services','2023-07-04'),(6441,262,'4-07-2023','El dia de hoy acople mi base de datos de mi tematica a la base de datos grupal.','2023-07-04'),(6442,251,'Curso Laravel FIN y Desarrollo Api - 04/07/2023','El día de hoy terminé el curso de API con Laravel y empecé a crear la API que usaremos en el proyecto. Modifiqué la BDD, cree modelos y el controlador de usuario junto a la función de registrar usuario.\r\nQueda por hacer rutas, el resto de controladores y buscar como unir las vistas con la API.','2023-07-04'),(6443,250,'martes 4/7/2023','Hoy me dedique a programar el index y los estilos de la pagina web','2023-07-04'),(6444,265,'04-07-2023','hoy hice una parte en donde se colocará el sensor de ultrasonido','2023-07-04'),(6445,270,'4/7/23','El día de hoy decidimos colocar el escenario principal junto con el de temática en la misma escena para ahorrar tiempo. por mi parte finalice los bocetos de ambos escenarios junto con Saracino y Pereira. ','2023-07-04'),(6446,255,'martes 4/7/2023','Hoy estuve diseñando la seccion de login y registro de la pagina web :3','2023-07-04'),(6447,258,'04d/07','hoy hice un menu con una casa( el cual va a ser la asa de nuestro personaje) con los assets de unity store que vimos anteriormente','2023-07-04'),(6448,259,'Practicas Profesionalizantes Nahuel Moreno 4/7','El día de hoy, al haber terminado mi parte del trabajo, al menos por ahora, continúe mi Carpeta de Campo  ','2023-07-04'),(6449,271,'4-7-23','En el día de la fecha junto a mis compañeros Emilio Pereira y Enzo Romaniello decidimos unir los escenarios del juego anteriormente realizados','2023-07-04'),(6450,268,'04/06/2023','El dia de hoy compilamos y buscamos ideas para el diseño de la precentacion audio visual que daremos como precentacion del proyecto el miercoles 12 de julio.','2023-07-04'),(6451,252,'Clase 29 - Modal Creación Terminado','Hoy con Diego Sanchez terminamos de agregar las últimas funcionalidades al modal de creación e hicimos unos cambios al estilo del modal','2023-07-04'),(6452,266,'Envío de emails','Hoy me estuve investigando y poniendo en práctica el envío de emails utilizando los servicios de Google.','2023-07-04'),(6453,303,'04-07-2023','Hoy seguimos con la creación de las salas para el videojuego.','2023-07-04'),(6454,282,'Tareas escolares - DudasRecortesMarcas','En el día de hoy no estuve totalmente centrado en el trabajo de GS1 debido a factores externos. Tuve que pedir el día virtual para presentarme en la escuela a mostrarle nuestro proyecto de la feria de ciencias al subsecretario de tecnología, siendo que además aproveche a dar más a conocer nuestro proyecto de BaVigila por lo cual le mostré nuestro Instagram, su modo de funcionamiento y sus beneficios en comparación a los productos existentes. Tras esto, acompañé a Nahuel Acosta a una charla de presentación de la carrera de Técnico en Computación para alumnos de 2° año, explicando a los alumnos sobre cómo era 6° año y la materia de prácticas profesionalizantes, logrando generar el interés de ellos por nuestra carrera. Al terminar nuestras tareas en la escuela, nos dirigimos a desayunar aproximadamente a las 11:30 a.m., tiempo en el cual me puse a trabajar durante el mayor tiempo posible en mi nueva tarea solicitada, la cual fue anotar todos los percances ocurridos durante la realización del Excel Relación_VTA-MARCAS, los cuales son muchos y de una gran variedad, a este documento se lo llamó DudasRecortesMarcas.','2023-07-05'),(6455,258,'05/07','Hoy hice que el botón de new game genere al personaje en la casa ademas de que intente hacer  otra escena pero falle ya que necesito el modelo de la escuela','2023-07-05'),(6456,252,'Clase 30 - Debug (Corrección de errores)','Hoy me encargué de corregir todos aquellos errores que se encontraban en el Login y el Register. La gran mayoría eran ocasionados por falta de uso del modal alerta, por lo que tuve que aplicarlo en los errores que pueden aparecer al completar el formulario del Login y el formulario del Register. Además cree una función que se puede usar como diccionario o traductor que te permite traducir todas las frases de los errores que estén en inglés a español. Apliqué esa función para que los errores o alertas aparezcan en español en el Modal de Alerta, por ejemplo, al no completar todos tus datos, al crear una cuenta con un correo que ya está utilizado, etc.','2023-07-05'),(6457,270,'5/7/23','El dia de hoy junto con emilio pereira estuvimos investigando sobre triggers con algunos videos y probando algunos codigos. finalmente, no logramos que funcione.','2023-07-05'),(6458,266,'envio de emails y notificaciones ','Estuve todo el dia mandando emails y viendo el tema de diseño html por email, y pude mandar emails al crear nuevos eventos. ya funciona correctametne y practicamente, no merge por que todavia hay cosas para mejorar','2023-07-05'),(6459,265,'05-07-2023','Seguí haciendo la parte en donde iría el sensor de ultrasonido preguntándoles a mis compañeros, que van mas avanzado con sus diseños 3D, de como es que habían hecho ','2023-07-05'),(6460,253,'Miércoles 05/07/2023 - Unity','Hoy traté de hacer el código de cuando el jugador entre por una puerta, se teletransporte a otro escenario.','2023-07-05'),(6461,267,'05-07-2023','Hoy hice gran parte de la carpeta de campo y estuve haciendo la presentación del proyecto','2023-07-05'),(6462,259,'5/7 Practicas Profesionalizantes Nahuel Moreno','El dia de hoy, igual que ayer, solamente continúe y avance(bastante) con la carpeta de campo','2023-07-05'),(6463,268,'05-07-2023','El día de hoy comencé con un pequeño arreglo del diseño 3D específicamente en la parte del sensor de ultrasonido donde mejore con el consejo de mis compañeros.También hoy comencé con una animación para la presentación del proyecto a través de SelfCAD donde en su canal de youtube me guíe.','2023-07-05'),(6464,261,'05/07/2023','Hicimos la precentacion canva','2023-07-05'),(6465,251,'Desarrollo Api 2 - 5/7/2023','El día de hoy continué desarrollando la API con Laravel. Logré resolver el problema del registro de usuarios y también creé varios controladores. Empezaré a trabajar en la segunda entrega de la Carpeta de Campo.','2023-07-05'),(6466,250,'miercoles 5/7/2023','Hoy programe el login y el register de la pagina web','2023-07-05'),(6467,255,'miercoles 5/7/2023','hoy diseñe las ventanas de login y register en figma','2023-07-05'),(6468,254,'05/07/23','Hoy segui investigando sobre java web y lls pasos a seguir para avanzar con el proyecto','2023-07-05'),(6469,303,'05-07-2023','Hoy empezamos a realizar el codigo de las habitaciones en unity','2023-07-05'),(6470,282,'Word DudasRecortesMarcas','Durante la mañana de hoy estuve junto a Alegre de manera presencial en las oficinas de GS1, realizando lo que me quedó pendiente del día de ayer lo cual refería a pasar los datos anotados en el Word DudasRecortesMarcas, los cuales se debían trasladar al documento Problemáticas surgidas durante Recortes-Marcas Trazabilidad - GS1 V0.1. Esto lo realicé en tan solo 15 minutos, finalizando con mis tareas en el día de hoy y quedando pendiente a nuevos objetivos los cuales serán planteados en los días venideros.\r\nDurante la tarde de hoy me presente a practicas profesionalizantes, creando una carpeta de campo propia del proyecto y avanzando sobre este documento.','2023-07-06'),(6471,290,'Vigesimasegunda','En el dia de la fecha termine el requerimiento del portal del socio, corrigiendo la escritura y agregando imagenes actualizadas de la maqueta, tambien revise los mails y busque 6 preguntas nuevas para las preguntas frecuentes de afip','2023-07-06'),(6472,298,'clase 20','Hoy volvimos a hacer el trello de cero, ya que el que tuvimos antes era un desastre. También volvimos a hacer los diagramas, seguimos trabajando en ello.\r\n','2023-07-06'),(6473,292,'mostrar las cosas que hice fuer de la escuela y carpeta de campo ','En el dia de hoy le mostré lo avanzado a mi compañero enzo bartoletti y le mostré los errores del código a la hora de bloquear los polígonos,  la idea de este código es bloquear los diferentes polígonos que fui agregando para tapar las imperfecciones, ese solo funciona pero cuando agrego las coordenadas de otro código este se rompe y los limites se ponen en cualquier lado. Trate de hacer funcionar el botón para que me muestre mi ubicación actual pero no hubo caso y lo voy a intentar más tarde en  mi casa, después del recreo me puse a escribir más hojas en la carpeta de campo y lo pude extender a 76 hojas, estoy planeando hacer al menos 115 hojas para asegurarme de pasar bien el filtro de calidad','2023-07-06'),(6474,286,'HTML y CSS de página Incidentes','\r\nEl día de la fecha comenzó normalmente, abrí todas las aplicaciones que iba a usar, inicié sesión en mis cuentas, descargué los archivos necesarios y me puse a trabajar. El día laboral empezó de la siguiente manera, consulté con el Scrum Master cierta información de la página de administradores para concluir en que cada botón de la página de &quot;Incidentes&quot; abra un formulario desplegable para que los administradores que trabajes sobre la página puedan modificar los incidentes que se almacenan en la base de datos. Para realizar estas tareas hice uso de la página &quot;Bootstrap&quot; en la que entré a la sección de &quot;Components&quot; y luego en &quot;Offcanvas&quot;, bajé hasta la parte del &quot;Toggle bottom offcanvas&quot; y copié el código de HTML que me proporcionaba. Me había olvidado de incluir el CSS y JS de Bootstrap, por lo que me dirigí a la sección de &quot;Getting started&quot; y entré a &quot;Introduction&quot; para bajar hasta el punto 2 y copiar lo necesario. Una vez todo preparado empecé con lo que me compete, copié el código del botón desplegable 3 veces dentro del código para reemplazar a los antiguos &quot;Insertar&quot;, &quot;Modificar&quot; y &quot;Eliminar&quot;. Toqueteando un poco el HTML y el CSS logré hacer que los botones tengan la apariencia anterior. Para hacer lo solicitado anteriormente, dentro de la ventana desplegable de Bootstrap, hice un &lt;table&gt; y puse dentro de los &lt;th&gt; &quot;Ubicación&quot;, &quot;Modalidad&quot;, &quot;Cantidad de Asaltantes&quot;, &quot;Cantidad de Afectados&quot;, &quot;Objetos Sustraídos&quot;, si requiere ambulancia o bomberos e &quot;Información Adicional&quot; para mas tarde poner dentro del &lt;tbody&gt; y los &lt;td&gt; los códigos necesarios para que dentro de los casilleros de la tabla aparezcan los &lt;input&gt;. Hay un poco de complicaciones porque el código CSS de la primer tabla interfiere un poco con la segunda tabla. De esta forma concluye el día de hoy. Lo que sigue luego de terminar el diseño, es hacer que la información que se inserta dentro de cada botón desplegable, puede aplicarse a la base de datos.','2023-07-06'),(6475,279,'Dia 19 del proyecto','En el día de hoy estuve haciendo los dailys que me faltaron ademas de hacer el día de hoy y después el Scrum master osea Enzo me pidió mayormente hacer como una carpeta del campo pero sobre exclusivamente del proyecto contando las cosas mas importantes de este tipo código documentación y parecido y iba a ser en parte siendo lo que tenia que llenar seria la sección de documentación de dailys.','2023-07-06'),(6476,274,'Adición de funcionalidades a la página de los usuarios','En el día de la fecha teníamos pensado recorrer las distintas aulas del establecimiento para promocionar nuestro proyecto a las distintas divisiones de ciclo inferior. Pero decidimos cancelar dicha actividad debido a que queríamos esperar a tener algunos avances más en el proyecto, así como una presentación decente.\r\n     Entonces lo que hice fue hacerle algunas mejoras en la funcionalidad de la página de los usuarios web, en la cual se reportan los incidentes. Lo primero que hice fue añadir un required al final de cada uno de los input, para que de esta manera se deba ingresar de manera obligatoria un valor. De lo contrario, no se podrá enviar el formulario debido a que saldrá una advertencia diciendo que se debe completar dicho campo. Una idea que se me ocurrió fue la de mostrar un cartel una vez que se presiona el botón para enviar los datos. Originalmente, el botón se presiona y redirecciona al usuario a la página PHP, la cual muestra los datos que el usuario ingresó. A su vez, pensé que en la parte de abajo del cartel desplegable aparezca una declaración jurada, la cual el usuario deberá aceptar cuando reporte un incidente. Le comenté esta idea al Project Mánager de mi grupo y aceptó, pero también me dijo que debía hacer un prototipado en Figma antes de iniciar el código.','2023-07-06'),(6477,285,'Día 22','¿Qué logré hacer hoy?\r\n\r\nHoy continué trabajando en la página de búsqueda y comencé a desarrollar la página del carrito. En la página de búsqueda, me enfoqué en imprimir los juguetes que estoy insertando desde la base de datos. Al principio, me encontré con varios errores, pero pude solucionarlos. Solo falta organizar la presentación de los resultados para que se vea más atractivo visualmente.\r\nMientras solucionaba esos errores, me dediqué a empezar con la página del carrito. Para esto, necesito crear una base de datos y probablemente algunos scripts para probar e insertar elementos en ella. Además, quiero que la página de compra (que ya está diseñada, pero le faltan elementos de PHP/scripts) permita guardar los artículos seleccionados en el botón del carrito y que estos se muestren correctamente en dicha página. Aunque es un proceso complejo, me gustaría lograr que funcione de esta manera.\r\n\r\n\r\n¿En qué se me complicó?\r\n\r\nDurante el día, enfrenté dificultades al imprimir los juguetes desde la base de datos en la página de búsqueda. Inicialmente, me encontré con varios errores que afectaban la visualización de los resultados. Sin embargo, después de dedicar tiempo a investigar y realizar ajustes, pude solucionar esos problemas y ahora solo necesito ordenar y mejorar la presentación de los resultados para que se vean más atractivos.\r\nEn cuanto a la página del carrito, aún no he experimentado complicaciones significativas, pero sé que el proceso de implementar la base de datos y los scripts requerirá un esfuerzo adicional y posiblemente me enfrente a desafíos en ese proceso.\r\n\r\n¿Qué estuve investigando?\r\n\r\nDurante el día, estuve investigando diferentes aspectos relacionados con mi proyecto. Me centré en encontrar soluciones para imprimir los juguetes desde la base de datos en la página de búsqueda, lo cual implicó explorar métodos eficientes y mejores prácticas en la programación PHP y en la interacción con bases de datos.\r\nTambién me dediqué a investigar cómo crear la base de datos necesaria para la página del carrito y cómo diseñar los scripts correspondientes para insertar elementos y realizar pruebas en la base de datos. Investigué sobre las mejores prácticas para la gestión de bases de datos y cómo garantizar la integridad y eficiencia de la información almacenada.\r\n','2023-07-06'),(6478,293,'diagrama entidad relacional y camino critico','hoy día modifique los 2 diagramas porque faltaba agregar cosas también los modifique.','2023-07-06'),(6479,278,'Clase N°24 06/07/23','El día de hoy comenzamos con el diseño de la pagina web que contiene el inventario , utilizamos el header y el footer de la pagina principal.Primero comenzamos con una lista que contiene el nombre de cada producto junto a un checkbox. Ademas continué armando mi carpeta de campo.','2023-07-06'),(6480,277,'Decimo Novena Clase','El día de hoy estuve rellenando la página principal con distintas utilidades para que los usuarios tengan una mejor experiencia al momento de navegar. Indiqué los métodos de pagos, estos siendo por tarjeta de crédito o débito, cuotas sin tarjeta y efectivo, además de agregarle descuentos a los métodos virtuales para promover el uso de estos.\r\nPor otro lado, agregue una lista de items en oferta la cual por ahora se encuentra vacía por la falta de productos, pero el día que tengamos muchos más para vender podremos mostrar nuestras ofertas de forma rápida y sencilla.\r\nPor último agregue un par de cartas que dividen los objetos por series o películas específicas para aligerar la cantidad de productos en el usuario y no abrumarlo con tantas opciones, reduciendo la búsqueda a una franquicia en específico en vez de entrar en el vasto almacenamiento de LiliFy.\r\nAdemás agregue una barra de búsqueda que por ahora se encuentra sin funcionamiento, pero pronto servirá para buscar objetos mediante palabras claves sin mucho esfuerzo.\r\n','2023-07-06'),(6481,273,'revision de carpeta de campo','En el día de la fecha empecé haciendo el código para ingresar a la base de datos información mediante codigos de barras. Para eso, resolví por hacer que se tenga que hacer los inserts mediante la lectura de codigo QR generados por la computadora. De esta forma, sería más ordenado. Luego de eso, empecé a revisar la carpeta de campo para ver qué cosas me faltaban.','2023-07-06'),(6482,291,'06/07/2023','El día de hoy empece organizando la carpeta del grupo la cual estaba desordenada, después de acomodarla y organizarla abrí algunos archivos que estaban sueltos para acomodarlos con otros archivos  o eliminarlos para que no ocupen espacio, después de todo eso abrí la pagina y revise que no funcionaba y como arreglarlo, lo que no funcionaba eran dos modal el de registro y el de login, el error que tenían  era que el botón para registrarse o logearse los cuales estaban mal puestos y programados, al final pude arreglarlos y hacer que funcionen, después revise los php y las conexiones, del php cambie el registro.php  para que el insert que hace no tire error e ingresara los datos en la base de datos, y al final realizamos la daily con mi compañero Alan (El único que vino).','2023-07-06'),(6483,296,'Bitácora 18','Hoy estuve terminado de diseñar la página ingresar producto y también probé creando una mini base de datos para poder ingresar,modificar y eliminar productos y ver cómo sería andando','2023-07-06'),(6484,288,'Clase 21','El dia de la fecha avancé en unas cuantas cosas de la pagina web.\r\nEmpezando por lo primero que realicé, fué crear el Instagram de nuestro proyecto, el mismo ya cuenta con una cantidad de 3 mil seguidores, ya que era una cuenta de uno de los integrantes de nuestro grupo y decidió realizarla, en su cuenta.\r\nY en la parte de contactos de la página agregué el link para que puedan acceder a la misma y mantenerse al día de nuevos modelos 3D.\r\nPronto mejoraremos la interfaz para que se vea más atractiva visualmente.\r\nLuego de eso mismo, he realizado muchas más cosas como, realizar cada botón de nuestros productos y arreglar cada imagen para que quede perfectamente alineada junto con las demás, también agregué lo que sería un “Pasa pagina” que es para cambiar a la página siguiente o para volver a la anterior.\r\nAdemás agregué el nombre y descripción de cada producto, solo queda agregar el precio y los demás productos faltantes, con sus respectivas imágenes y descripciones.\r\nTambién le agregué a cada imagen del carrousel principal un href para que sea directamente dirigida a el producto detalladamente, adjunto imágenes de como queda hasta el momento.\r\nLa misma tiene un efecto de invisibilidad a la hora de pasar a la siguiente imagen, necesitamos acomodarla hacia un lado para hacer que la misma quede pequeña y no estorbe tanto en toda la pagina, tambien agregar los botones de precio, descripción, nombre, medios de pago, entre otras cosas.','2023-07-06'),(6485,276,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión - Diagramas','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- En primer lugar hoy seguimos configurando la pagina web, centrandonos nuevamente en la pestaña de producto, la cual terminamos de configurar. Habiendo agregado un boton para agregar los productos al carrito mediante una funcion que inserta los datos datos en el formulario de la pestaña del carrito, tambien incluyendo sus datos originales de la tabla producto, donde finalmente se estarian mostrando en la pagina del carrito, y al cumplir esto, se muestra un modal el cual notifica de si la agregacion del producto al carrito fue exitosa o no. Solo faltaira configurar bien la pestaña del carrito. Por lo que damos por finalizado la pestaña del producto.\r\n- Tambien se le dio cierto arreglo a la base de datos, pues se tienen en mente que el usuario en si tenga acceso a su propio carrito de compras, pues en un principio los productos se repetian sin importar que se cambie de cuenta, por lo que estaremos implementando eso mas adelante. \r\n\r\nEso fue todo por hoy.','2023-07-06'),(6486,287,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión - Diagramas','\r\nEl día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- En primer lugar hoy seguimos configurando la pagina web, centrandonos nuevamente en la pestaña de producto, la cual terminamos de configurar. Habiendo agregado un boton para agregar los productos al carrito mediante una funcion que inserta los datos datos en el formulario de la pestaña del carrito, tambien incluyendo sus datos originales de la tabla producto, donde finalmente se estarian mostrando en la pagina del carrito, y al cumplir esto, se muestra un modal el cual notifica de si la agregacion del producto al carrito fue exitosa o no. Solo faltaira configurar bien la pestaña del carrito. Por lo que damos por finalizado la pestaña del producto.\r\n- Tambien se le dio cierto arreglo a la base de datos, pues se tienen en mente que el usuario en si tenga acceso a su propio carrito de compras, pues en un principio los productos se repetian sin importar que se cambie de cuenta, por lo que estaremos implementando eso mas adelante. \r\n\r\nEso fue todo por hoy.','2023-07-06'),(6487,294,'Creación de Diagrama de Flujo del robot - Unión de BD con los formularios','En el dia de hoy implementamos con mi compañera un nuevo diagrama de flujo de datos que este se va a relacionar con el robot que tengamos en nuestro proyecto, agregamos todos los niveles correspondientes (0,1 y 2) con la información que cumple cada acción en el diagrama. Además de esto realizamos una conexión de la base de datos con el formulario de la pagina principal. La misma página hecha en PHP y con la oportunidad de conectarla sin problemas.','2023-07-06'),(6488,295,'Diagrama de flujo de datos del robot - conexión a bdd','El día de hoy continuamos con la pagina web, en este caso con la conexión de PHP a la base de datos, la cual hizo una compañera de grupo pero la tuvimos que modificar un poco para poder abrirla ya que la había exportado mal. Y por ultimo hicimos el diagrama  de flujo de datos del robot de nuestro proyecto, ya que solo habíamos hecho el de nuestra pagina web.','2023-07-06'),(6489,289,'06.07','El día de hoy, hemos sido 4 integrantes. Luego de la daily, con mi compañera carolina hemos actualizado el diagrama, además de actualizar el trello. Eso es todo por hoy, muchas gracias.','2023-07-06'),(6490,286,'HTML y CSS de Página Incidentes 2','El día de la fecha comenzó normalmente, abrí todas las aplicaciones que iba a usar, inicié sesión en mis cuentas, descargué los archivos necesarios y me puse a trabajar. El día comenzó tratando de seguir con lo que había dejado el día de ayer, hacer una tabla dentro del botón desplegable, conseguí hacer un avance, hacer que la tabla se vea volviendo todo a color negro, más tarde intenté hacer que los &lt;td&gt; de la tabla (los input) puedan alinearse con los &lt;th&gt;. Luego de varios intentos y varias búsquedas en internet sobre cómo hacer una tabla con inputs adentro, consulté con mi compañero Christian Forte, el cuál intentó darme una mano mediante Google Meet pero para mayor comodidad, decidimos que el intenté solucionar el error a mano. Con su ayuda pudimos ver varios cambios pero nada llevaba a lo que quería, por lo que decidí empezar casi de 0 esta parte para poder hacerla de otra manera. Lo que hice fue borrar la tabla y poner todos los elementos de una dentro del botón desplegable para más tarde, con CSS, escribir el siguiente código: &quot;.offcanvas-body{display: flex; justify-content: space-between; margin-top: 3%; font-size: x-large;}&quot; para que todo quede centrado y las letras se puedan ver más grandes.','2023-07-07'),(6491,274,'Validación de checkbox ','En el día de la fecha lo que hice fue continuar con la validación de los checkbox en el formulario de reporte de incidentes. Ingresé a una página y probé el código, pero el mismo no funcionó. Después probé otro código, el cual tampoco funcionó. Al mismo tiempo ayudé a uno de mis compañeros de equipo a ingresar unos input dentro de una tabla en html, aunque no pudimos lograr eso debido a que los input quedaban muy angostos en relación del tamaño de la tabla. Luego de esto, volví a buscar una solución para la vlaidación de los checkbox, encontré un nuevo código pero el mismo tampoco funcionó.','2023-07-07'),(6492,293,'Base da Datos','hoy día eh eliminado una tabla para que después agregue otra ya que la tabla esta mal echa.','2023-07-07'),(6493,295,'continuación de conexión a bdd - corrección de errores en codigo','El día de hoy junto a mi compañero continuamos lo que empezamos ayer, la conexión de la base de datos a la página de nuestro proyecto, a parte de eso también hicimos algunas correcciones en el código que nos daba error.','2023-07-07'),(6494,294,'Finalización de conexion BD - Corrección de errores php','Con mi compañera el día de hoy estuvimos terminando lo que habiamos dejado en el dia de ayer que era la union de la base de datos, modificamos las tablas y eliminamos tambien una. Además de esto corregimos codigo en lo que sería el php ya que daba muchos errores a la hora de querer agregar usuarios a la tabla de la BD.','2023-07-07'),(6495,289,'Edenor/Reciduca','El día de hoy, además de hacer un desayuno compartido. Hicimos una actividad de tener que describir una palabra sin decir está palabra, y el otro debía adivinarla.\r\nAdemás de hacer una actividad de tirar una pelota, que está contenia preguntas, siendo que quien tiraba la pelota debía decir un número y la otra responder la pregunta \r\nEso fue todo por hoy, muchas gracias.','2023-07-11'),(6496,295,'Edenor / Reciduca','En el dia de hoy tuvimos la última clase antes de las vacaciones de invierno, en la cual empezamos con una actividad que consistía en adivinar una cierta palabra con datos que te decia la\r\notra persona. Después de eso tuvimos un desayuno entre todas y compartimos lo que cada una había llevado. Por ultimo tuvimos una actividad que tirabamos una pelota con preguntas y cada una iba contestando alguna.','2023-07-11'),(6497,271,'11/07/2023','En el día de la fecha, continúe haciendo mi personaje en blender. Pero no pude seguir porque tuve algunas complejidades con la elaboración de la parte de la cabeza de mi personaje ','2023-07-11'),(6498,263,'11/7','Hoy estuve modificando la estructura geometrica del personaje al mejorar su cuerpo torso, cuello y manos','2023-07-11'),(6499,268,'11-07-2023','El dia de hoy nos premaramos para la precetacion de mañana.','2023-07-11'),(6500,251,'Speech y Preparaciones 11/07/2023','El día de hoy preparé el Speech que voy a dar mañana al presentar el proyecto con mis compañeros.','2023-07-11'),(6501,261,'11/07/2023','Mostre la precentacion de nuestro proyecto al profe','2023-07-11'),(6502,262,'11/7/2023','El día de planifique y comencé realizar el slogan y video publicitario del videojuego que presentaremos mañana como proyecto encaminado','2023-07-11'),(6503,257,'11/7/2022','Hoy mis compañeros avanzaron uno con unity, y el otro con el modelo de blender, tenemos que ponernos de acuerdo para hacer 1000 cosas para mañana, en la presentacion, yo personalmente avance un par de hojas en la carpeta de campo y actualice la contraseña de encuentrotecnologico para poder entrar un poco mas rapido, porque me puse una contraseña que personalmente se me mezcla con otras parecidas y con la actualizacion me es mas facil distinguirla','2023-07-11'),(6504,259,'11/7 Nahuel Moreno Practicas Profesionalizantes','El dia de hoy continue en la carpeta de campo que tenia y empeze a preparar el speech para mañana en la entrega del proyecto','2023-07-11'),(6505,253,'Martes 11/07/2023 - Unity','Hoy pudimos hacer que el jugador se teletransporte entre escenarios en Unity.','2023-07-11'),(6506,265,'11-07-2023','Hoy estuve haciendo la carpeta de campo para la entrega de la misma','2023-07-11'),(6507,290,'Vigesimatercera','En el dia de la fecha lo que realice fue basicamente armar un diagrama el cual luego tendre que explicar paso a paso lo que hace este diagrama en un word','2023-07-11'),(6508,282,'Tareas GS1','Durante el día de hoy estuve trabajando principalmente en nuevos archivos Especialmente referidos a Excel, trabajando en recortes de VLA y en un Excel con una cantidad de filas superior a 11.000, siendo que esto me llevará un largo tiempo','2023-07-11'),(6509,282,'Out_Carrefour / Automatizacion de procesos','En el día de hoy trabaje desde la virtualidad en la realización del archivo iniciado en el día de ayer, avanzando exponencialmente y logrando realizar 3433 filas en poco menos de 4 horas, logrando superar la totalidad de las filas con relación directa conmigo (E01) y dejando tan solo 400 para revisar mañana, quedando pendiente las filas NULL y las realizadas por otros integrantes. También le propuse a Lucas Sosa una opción para automatizar este largo y tedioso proceso mediante unas líneas de pseudocódigo las cuales se deben adaptar a MySQL de ser posible, el código propuesto es algo similar al siguiente:\r\nIF (&quot;ECO DE LOS ANDES&quot; == &quot;ECO DE LOS ANDES&quot;){\r\n	RECORTES = &quot;OK&quot;;\r\n}ELSEIF (&quot;ECO DE LOS ANDES&quot; != &quot;ECO DE LOS ANDES&quot;{\r\n	RECORTES = &quot;REVISAR&quot;;\r\n}\r\nEn el caso de que esto funcione, ahorraría cantidades exponenciales de tiempo, pasando de 11.000 filas a menos de 1.000.\r\nA su vez, tras proponer esta modificación, me comunique mediante una llamada de Skype con Tomás para explicarle acerca de como funcionaba el nuevo archivo en el cual estoy trabajando y para explicarle la solución que propongo para automatizar el proceso, quedando en consideración y pendiente de comprobar a futuro si esto es viable.','2023-07-12'),(6510,270,'12/07/23','Esta jornada realizamos la primera entrega junto con la presentación del proyecto, planificando un speach y explicando lo realizado','2023-07-12'),(6511,253,'Míercoles 12/07/2023 - Presentación de proyecto','Hoy tuvimos que presentar todo lo que llevabamos del proyecto.','2023-07-12'),(6512,265,'12-07-2023','Hoy tuvimos la exposición de proyectos ','2023-07-12'),(6513,271,'12-07-2023','En el día de la fecha con mis compañeros hicimos el speech y la presentación del proyecto con mis compañeros Enzo Romaniello, Luis Meza, Valentín Bentos y Emilio Pereira ','2023-07-12'),(6514,303,'12-07-2023','Hoy tuvimos la presentación del proyecto.','2023-07-12'),(6515,285,'Día 23','¿Qué logré hacer hoy?\r\n\r\nHoy tuve la oportunidad de visitar la empresa Eryx durante nuestra excursión. Aprendí sobre el significado de una cooperativa y cómo fomenta la colaboración. También tuve la oportunidad de ver dos proyectos interesantes de la empresa: Aurora, una caja de telgopor enviada al espacio, y un calculador de golpes de papa, ambos proyectos de código abierto.\r\n\r\n¿En qué se me complicó?\r\n\r\nAfortunadamente, no enfrenté ninguna complicación durante la excursión. Pude llegar al lugar sin problemas y disfruté de todas las actividades y presentaciones que nos ofrecieron en la empresa.\r\n\r\n¿Qué estuve investigando?\r\n\r\nDurante la visita, aprendí sobre el concepto de una cooperativa y cómo funciona en el ámbito laboral. También investigué sobre los proyectos Aurora y el calculador de golpes de papa, y comprendí la importancia del código abierto y cómo permite a las personas recrear y contribuir a proyectos existentes. Fue una experiencia enriquecedora que me ayudó a ampliar mis conocimientos en el campo del desarrollo de software y la cooperación en equipo.','2023-07-13'),(6516,274,'Salida a la empresa Eryx','En el día de la fecha tuvimos una salida didáctica en el horario correspondiente a Prácticas Profesionalizantes. Concurrimos a la empresa Eryx, la cual es una cooperativa que se dedica al desarrollo de software. En Eryx, algunos de sus integrantes nos brindaron una charla acerca de cómo es el sistema de trabajo que realizan: una cooperativa la cual tiene como objetivo realizar distintos proyectos a clientes. Al ser una cooperativa, todos sus integrantes (que son aproximadamente treinta) colaboran en el proyecto, realizando sus respectivas tareas, además de no depender de nadie. Tras esta explicación, nos mostraron dos de sus proyectos que habían realizado. El primero era una caja que contenía cámaras, cuyo objetivo era volar lo más alto posible y así poder grabar la tierra a 21 kilómetros de distancia. Nos mostraron un video acerca de como había sido el resultado final de la grabación. El otro era un proyecto relacionado a la agricultura. Tras la explicación, realizamos preguntas acerca de su modalidad de trabajo y de sus distintos proyectos.','2023-07-13'),(6517,286,'Excursión a empresa Eryx','El día de la fecha empezó de una manera distinta a la habitual, tuve una excursión a la empresa desarrollo de software Eryx la cuál fuí en colectivo con dos compañeros del grupo de la materia. Al llegar ya estaban la gran mayoría de los compañeros del curso y profesores de la materia por lo que los empleados de la empresa nos abrieron las puertas, Al entrar, una de las chicas que trabaja ahí me dió un recorrido junto a mis compañeros sobre casi todo el edificio donde se veían casi 10 habitaciones de trabajo con muchas computadoras y gente trabajando para finalizar el recorrido en la sala de &quot;presentaciones&quot; donde recibí una charla introductoria de la empresa. Más tarde, otro de los trabajadores nos presentó un par de proyectos de la empresa: Aurora y la papatrónica o algo parecido, no lo recuerdo bien. Aurora era una caja con una cámara que mandaron 20km arriba para poder observar la curvatura de la tierra desde Villa la Angostura. La papatrónica era una papa electrónica la cuál permitía medir la fuerza con la que se recolectan las papas, para poder recolectarlas con cuidado y que no se desperdicien. Para finalizar, los trabajadores nos dieron cosas ricas para comer y unos sticker de la empresa.','2023-07-13'),(6518,279,'Visita a la empresa eryx','En este día fuimos a una empresa llamada eryx donde trabajan de sistemas de software y parecido y al llegar nos hicieron una visita rápida por el lugar mirando a gente trabajando en ese momento para ver cómo tenían su sala de descanso y sala de reuniones y bueno en mi caso me senté en una de esas almohadas gigantes para ver la presentación contándonos su historia además de como era su forma de empresa siendo una cooperativa donde no hay jefe y trabajan todos en equipo además de enseñarnos algunos proyectos que hicieron uno siendo aurora que trata de mandar una caja con cámaras a 21km de altura y lo hicieron usando helio y después de eso comimos y nos fuimos a cada uno a su casa','2023-07-13'),(6519,276,'Salida didáctica Eryx Compañía de Software ','El día de hoy hemos realizado una salida didáctica con los docentes y hemos visitado la compañía de software Eryx. En esta misma hemos visto una presentación a ciertos aspectos de esta compañía, tanto como a lo que se dedican, a como se conforman en modo de cooperativa, hemos visitado sus instalaciones, nos han presentado diversos proyectos que han estado haciendo, tales como AURORA, proyecto que se basó en enviar una caja con cámaras y diversos sensores al espacio exterior, y otro prototipo de Papa Tecnológica. \r\n\r\nDebido a esto, no hemos realizado avances dentro del proyecto de las prácticas profesionalizantes, por lo que ello se estará llevando a cabo próximamente. Eso fue todo por hoy. ','2023-07-13'),(6520,287,'Salida didáctica a Eryx ','El día de hoy hemos realizado una salida didáctica a Eryx, una compañía de software. En esta misma hemos visto una presentación a ciertos aspectos de esta compañía, tanto como a lo que se dedican, a como se conforman en modo de cooperativa, hemos visitado sus instalaciones, nos han presentado diversos proyectos que han estado haciendo, tales como AURORA, proyecto que se basó en enviar una caja con cámaras y diversos sensores al espacio exterior, y otro prototipo de Papa Tecnológica. \r\n\r\nDebido a esto, no hemos realizado avances dentro del proyecto de las prácticas profesionalizantes, por lo que ello se estará llevando a cabo próximamente. Eso fue todo por hoy. ','2023-07-13'),(6521,273,'13-07-2023','En este día realizamos una excursión donde visitamos una empresa llamada &quot;Eryx&quot;. En esta empresa ocupaban una metodología de trabajo y una jerarquía por igual, donde todos realizaban algo de un trabajo sin importar de qué sección eran, y todos participaban en la toma de decisiones y demás cosas. A su vez, también nos enseñaron varios proyectos que tenían, tales como &quot;Aurora&quot; o &quot;Papatrónica&quot;. ','2023-07-13'),(6522,298,'clase 21','hoy visitamos la empresa eryx, nos contaron la historia de la empresa desde sus inicios y nos contaron el modelo de trabajo que tenían ahí. también nos mostraron algunos de sus proyectos, hubo uno llamado aurora, básicamente mandaron a volar una caja con cámaras con un globo lleno de helio para grabar la curvatura de la tierra, muy copado...también nos dieron alfajorcitos de maicena y conitos de dulce de leche. 10/10. ','2023-07-13'),(6523,292,'empresa Eryx','En el dia de hoy no tuvimos clases de practicas profesionalizantes debido a que teníamos programada una salida a una empres llamada Eryx que es una cooperativa dedicada al desarrollo de software, ni bien llegamos nos dieron un recorrido por las instalaciones hasta que llegamos a una sala donde nos daría una charla de como funciona exactamente la cooperativa la cual tiene muchos clientes y todos sus 30 trabajadores colaboran en el proyecto, nos explicaron también que era una cooperativa, como se formaba, como se había formado Erix y también que todos los miembros decidían por la empresa y no es que estaban divididos por jerarquías como lo haría una empresa normal.\r\nNos mostraron algunos de sus proyectos los cuales eran una caja con cámaras que fue mandada muy alto con el fin de poder grabar la curvatura de la tierra(nos mostraron un video de como había sido el proceso) y el segundo proyecto consistía en hacer una papa falsa y colocarla dentro de una plantación para corroborar el daño que sufría cuando la recolectaban una maquina ya que se pudieran con el daño. luego de esto hubo un espacio para neutras preguntas y después de que las respondieran nos dieron algo para comer mientras completábamos una encuesta de lo que habíamos visto y de que nos parecía, luego de esto nos retiramos.','2023-07-13'),(6524,288,'Clase 22','El día de hoy fuimos de visita a una cooperativa llamada Eryx, la cual se destaca por su desarrollo en software. En la misma nos explicaron como es su método de trabajo, hace cuanto trabajan en la cooperativa, como y cuando se creó, su sistema de cobro, cada sector, los rankings de las personas. Luego del PowerPoint nos contaron y mostraron sobre 2 proyectos, uno de una caja, una go pro, un Arduino, un GPS, un globo y un paracaídas, que fue al espacio y grabaron la curvatura del planeta tierra, luego cayó y fueron a buscarlo. Luego nos mostraron el proyecto de una Papa, para saber cuántos golpes da, luego de su proceso, así de esa manera saber cómo prevenir que la papa no se dañe. Luego nos dieron unos alfajorcitos de maicena y conitos con dulce de leche, y terminó la charla, y cada uno se fue a su casa.','2023-07-13'),(6525,291,'Charla ERYX','El día de hoy fuimos a una empresa a las dos de la tarde llamada ERYX la cual en realidad es una cooperativa de 31 personas, en esta nos hablaron de lo que era una cooperativa, sus ventajas y desventajas, también nos contaron como empezaron siendo solo dos estudiantes de la UBA y terminaron como 31 personas en 12 años, nos hablaron de algunos proyectos como Aurora que trataba en una caja que tenia que subir hasta grabar ña curvatura de la tierra, el último proyecto que mostraron era un prototipo de una papa que con unos sensores mediría la velocidad y con la fuerza que se golpea, esta charla fue interesante.','2023-07-13'),(6526,293,'Bonpland 1953 palermo','Hoy día fuimos a visitar a la empresa Erick dónde nos hablaron sobre la historia de la empresa y después nos mostraron 2 proyectos de la empresa que estaban interesantes y eso.','2023-07-13'),(6527,296,'bitacora 19','Hoy fuimos a la empresa eryx donde nos enseñaron su metodologia de trabajo la cual no conocia y la verdad que me gusto mucho,tambien nos enseñaron algunos de los proyectos en los que estaban trabajando ','2023-07-13'),(6528,282,'Gs1 y Eryx','En la mañana de hoy trabajé con los VLA y los OUT de GS1 hasta las 12:30, donde salí de mi casa para salir a una salida didactica a la empresa Eryx, la cual desarrolla software y fue de mi interes la experienda adquirida, principalmente por el hecho de que trabajaron con un proyecto aeroespacial llamado Aurora, el cual trabajaba con gran parte de los componentes que utilizamos en nuestro proyecto de feria de ciencias, siendo que aprovecharé estos nuevos conocimientos adquiridos para aplicarlos en etapas futuras.','2023-07-13'),(6529,290,'Vigesimacuarta','12/07/23:En el dia de la fecha lo que hice fue seguir con algunos diagramas que me dieron para hacer el dia de ayer, luego de ello tendre que completar una documentacion sobre el diagrama y explicar paso por paso\r\n\r\nHoy: En el dia de la fecha lo que hice fue continuar con los diagramas que deje el dia anterior, luego de terminarlos, fui con mis compañeros hacia palermo, a conocer una empresa llamada eryx, la cual es una cooperativa que funciona aproximadamente hace 10 años y comenzó como 2 amigos juntandose a desarrollar software, la cosa se fue expandiendo hasta llegar a lo que es hoy, una empresa de mas de 30 personas, la cual todos los participes de esta son los dueños de la empresa y toman decisiones votando a favor o en contra de las distintas ideas que se proponen','2023-07-13'),(6530,295,'Salida a la Cooperativa Eryx','En el dia de hoy tuvimos una salida a la cooperativa Eryx, en la cual nos contaron la historia de sta, y de como dos amigos idearon esa idea, de hacer esa cooperativa, que a lo largo del tiempo fue creciendo, asi como tambien nos explicaron lo que serian ellos que son una cooperativa. Despues tambien nos mostraron algunos proyectos que hicieron ahi, los cuales eran una caja que mandaron al espacio, para ver la forma de la tierra y el otro era para una verdura, en este caso la papa, el cual iba a poder medir como es que se golpeaban las papas, para poder evitar el desperdicio de papas que no lleguen en mal estado.','2023-07-13'),(6531,289,'13-07','El día de hoy, no hemos asistido a la escuela como hacemos normalmente. Hoy hemos hecho otra actividad, la cual se trato de ir a la empresa Eryx, o bueno, es una cooperativa.\r\nAl llegar al sitio citado, nos han dado tour por el sitio. Luego nos explicaron como trabajaba su cooperativa, además de mostrarnos algunos de sus proyectos. \r\nEso es todo por hoy, muchas gracias.','2023-07-13'),(6532,294,'Visita a ERYX','En el dia de hoy en este caso tuvimos la oportunidad de conocer la cooperativa llamada ERYX y nos explicaron distintos aspectos referidos a las cooperativas, tambien lo q se necesita y como la armaron ellos. Ademas nos mostraron los dos proyectos que hicieron y uno era grabar el planeta tierra por afuera de la atmosfera gracias a un globo con helio y el otro proyecto era un dispositivo en 3d con forma de papa que se encarga como de disimular una y comprobar a que fuerza se sometian las verduras.','2023-07-13'),(6533,285,'Día 24','Hoy tuve la oportunidad de colaborar con mi compañero, Ciro Lobtrico, en la creación de un detallado y completo documento en formato de presentación utilizando Canva. Nuestro objetivo principal fue introducir y explicar las actividades que hemos llevado a cabo en nuestra página web, resaltando nuestras metas y los proyectos en los que actualmente estamos trabajando.\r\n\r\n¿Qué logré hacer hoy?\r\n\r\nEn colaboración con Ciro, logramos crear un documento de presentación en Canva que abarcaba todos los aspectos importantes de nuestro trabajo en la página web. Nos tomó un tiempo determinar las preguntas clave que debíamos abordar en la presentación, pero finalmente las identificamos y las incluimos en el documento. También nos aseguramos de que el diseño fuera atractivo y profesional, utilizando las herramientas y recursos disponibles en Canva.\r\n\r\n¿En qué se me complicó?\r\n\r\nInicialmente, enfrentamos dificultades al tratar de determinar las preguntas clave que debíamos abordar en nuestra presentación. Nos llevó tiempo autoevaluarnos y cuestionarnos a nosotros mismos para identificar los aspectos más relevantes de nuestro trabajo. Sin embargo, con paciencia y dedicación, superamos este desafío y obtuvimos un resultado satisfactorio.\r\n\r\n¿Qué estuve investigando?\r\n\r\nDurante el proceso, nos enfocamos en investigar cómo utilizar eficazmente la plataforma de diseño Canva para crear una presentación impactante y profesional. Aprendimos sobre las diferentes herramientas y opciones disponibles en Canva para mejorar la apariencia visual de nuestro documento. También investigamos sobre las mejores prácticas para la elaboración de presentaciones persuasivas y cómo estructurar la información de manera clara y concisa.\r\n\r\nAdemás, aprovecharemos el tiempo extra que tenemos debido a la postergación de la entrega para revisar y perfeccionar nuestra presentación. Nos aseguraremos de abordar correctamente todos los aspectos importantes y de transmitir la información de manera clara y convincente. También afinaremos los detalles y agregaremos cualquier información relevante que pueda enriquecer nuestra presentación.\r\n\r\nAunque la espera puede resultar frustrante, consideramos esta oportunidad como un impulso para mejorar aún más nuestro trabajo y garantizar que nuestra presentación sea impactante y efectiva. Estamos decididos a aprovechar este tiempo de manera productiva para elevar la calidad de nuestro proyecto.\r\n\r\nUna vez que finalmente entreguemos nuestro documento en Canva, esperamos que sea bien recibido y refleje de manera precisa y convincente el esfuerzo y la dedicación que hemos invertido en nuestra página web. Estamos ansiosos por compartir nuestras ideas y proyectos con los demás, y confiamos en que esta presentación será un paso importante en nuestra trayectoria hacia el éxito.','2023-07-14'),(6534,273,'14-07-2023','En el día de la fecha me dispuse a realizar la presentación de mi proyecto en Canva, que debería presentar luego del receso escolar de invierno. Dentro de este explico detalladamente cómo se realizó el proyecto, las tecnologías que use y las funciones y la codificación que hice.','2023-07-14'),(6535,298,'Clase 22','Hoy teníamos una exposición para contar cual fue nuestro proyecto y que es lo que hicimos hasta ahora pero no llegamos a darla todavía, también tuvimos la entrega de la carpeta de campo a la cual lamentablemente no llegué a terminar a tiempo.','2023-07-14'),(6536,283,'receso invernal y tdos mis compañeros son unos vagos, menos ala.','Hoy llegue un poco tarde a clases y me sente a comenzar una presentacion sobre la pagina, mi compañero alan hizo un doc donde contenia todo lo que iba a tener la pagina. asi que solo tuve q crear el diseño de la presentacion y pasar su contenido. Creamos una introduccion al mismo donde contenia el nombre como titulo y luego un subtitulo con una frase sobre la pagina. luego creamos mas paginas sobre lo q contenia la pagina, como que es, como funciona, cuanto tardamos y que le podemos agregar a futuro a la pagina. Luego pusimos nuestros nombres (por que solo nosotros dos hicimos la presentacion) y ya la finalizamos. ','2023-07-14'),(6537,289,'14-07','El día de hoy, he continuado con la carpeta de campo, además de continuar con la presentación en canva y por ultimo seguir con los diagramas. Eso ha sido todo por hoy muchas gracias!','2023-07-14'),(6538,282,'entrega carpeta de campo','Durante el día de hoy trabajé muy poco, entregando tan solo la carpeta de campo','2023-07-14'),(6539,275,'&quot;Presentación&quot;','Hoy lo que hice junto con mi grupo era crear una presentación en Canvan en donde me hacíamos la introducción, presentamos el equipo, la web que hicimos, sus vulnerabilidades y la conclusión del &quot;proyecto&quot;: en la introducción decíamos que VicSon Web era una tienda virtual en la cual se puede comprar ropa.\r\nEquipo: VicSon Web es microempredimiento esta conformado por los siguientes integrantes; \'Kevin Bernabe\', \'Maximiliano Ortiz\', \'Jose Sanez\' y \'Alison Gargate\'.\r\nPagina web: es una tienda virtual que tiene  Proteccion ante con 2 CiberAtaques las cuales son &quot;Inyeccion SQL&quot; y &quot;XSS&quot; (Cross-Site Scripting)\r\n\'Versiones De VicSon\':Aqui se habla de como Vicson paso de ser un boceto a una maqueta a una pagina web.\r\n\'Conclusion Final\':En esta presentación queríamos ilustrar acerca de la página web y cómo ha sido su desarrollo durante el transcurso del proyecto, las mejoras que ha obtenido a partir de cada clase que hemos desarrollado, a pesar de las circunstancias que han sucedido en algunos momentos, pero hemos podido continuar.','2023-07-14'),(6540,276,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión - Carpeta de Campo','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Hemos corregido cierto error dentro de la pestaña del producto, pues ocurrió que hubo un error en el guardado del proyecto anterior a esta bitácora que hizo que cierta parte del código usado para configurar la agregación de productos dentro de la tabla del carrito funcione incorrectamente, por lo que tuvimos que realizarla de nuevo. En primer lugar configuramos las pestaña del carrito para que genere una consulta en la base de datos donde pregunta se hay objeto dentro de la tabla del carrito. En caso de no haber nada, el carrito mostrara un breve texto que indicara que el carrito se encuentra vacío y que continúe navegando por la pagina web y así poder seleccionar algún producto. Por otro lado, si se encuentra algún objeto dentro de la tabla, este en vez de indicar que se encuentra vacio, generara una card con el producto en cuestion que se encuentre dentro de la tabla, teniendo ciertos datos como el nombre, su ID, el color, el talle, la cantidad seleccionada y el precio en cuestion en proporciona la cantidad seleccionada. Tambien hemos configurado una pestaña php de modo de proceso mediante la cual  el usuario pueda eliminar productos de su carrito mediante un modal que pregunta respecto a si desea eliminar el producto en cuestion o no, y si asi lo desea, si indica con otro modal que el mismo fue eliminado del carrito, tambien eliminado al producto de la tabla &quot;carrito&quot; en la base de datos. Tambien hemos arreglado la base de datos para que cada usuario pueda tener su propio carrito de compras, independientemente de si se repiten los datos en una misma tabla, siendo restrictivo para aquellos usuarios que quieran agregar nuevamente un mismo producto en su carrito, mientras que los demas usuarios pueden agregar sus productos con tranquilidad, incluso si dicho producto se encuentra ya en la tabla. \r\n- Luego esta la pestaña del producto, a la cual hemos configurado para que los inserts o agregaciones a un carrito en base a un producto sucedan una sola vez por producto, pues al contar con unidades a seleccionar, es mas conveniente que seleccione las unidades necesarias en vez de seleccionar una y otra vez el mismo producto. Tambien se configuro un proceso mediante el cual se ejecute un modal avisando de si se agrego el producto al carrito o no, por lo que las pestañas del producto y del carrito ya son funcionales, solo debemos configurar las diferencias entre los productos tanto en sus colores disponibles o tallas. \r\n- Por otro lado, he estado realizando cierta actualización dentro de la documentación en mi carpeta de campo personal para poder cumplir con el requisito bimestral de tener mas de 100 paginas, habiendo logrado ello con éxito.\r\n\r\nEso fue todo por hoy. ','2023-07-14'),(6541,287,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión - Carpeta de Campo','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Hemos corregido cierto error dentro de la pestaña del producto, pues ocurrió que hubo un error en el guardado del proyecto anterior a esta bitácora que hizo que cierta parte del código usado para configurar la agregación de productos dentro de la tabla del carrito funcione incorrectament