arrito o no, por lo que las pestañas del producto y del carrito ya son funcionales, solo debemos configurar las diferencias entre los productos tanto en sus colores disponibles o tallas.\r\n- Por otro lado, he estado realizando cierta actualización dentro de la documentación en mi carpeta de campo personal para poder cumplir con el requisito bimestral de tener mas de 100 paginas, habiendo logrado ello con éxito.\r\n\r\nEso fue todo por hoy. \r\n','2023-07-14'),(6542,282,'Calidad de datos - VLA Carrefour','En el día de hoy trabajé desde la virtualidad en la realización del archivo correspondiente a los VLA de la cadena de supermercados Carrefour, el cual contaba con 333 campos a realizar, siendo que los terminé pero no estoy conforme con el resultado ya que la gran parte de estos campos no están completos correspondientemente debido a los datos presentes en el archivo base. Además, cerca de las 11:30 AM tuve una llamada con Lucas Sosa, el cual me detallo como será mi proxima tarea y me dio un breve resumen de lo que me espera en los próximos meses dentro de GS1','2023-08-01'),(6543,282,'OutCencoEnero','en el día de hoy trabajé presencialmente en las oficinas de GS1, empezando el archivo referente a el Output de la herramienta utilizada en la empresa, colaborando con Cencosud en un análisis sobre las perdidas de alimentos en sus cadenas de supermercados, en este caso referentes a el mes de Enero de 2023, tengo que revisar y comprobar manualmente 5 columnas de 170 campos, añadiendo los datos faltantes y agregando nuevos recortes','2023-08-02'),(6544,251,'Desarrollo Api 3 - 2/8/2023','El día de hoy creé los controladores faltantes, y, con ayuda del profesor Consorti y mucha, mucha paciencia, resolvimos el problema del login de usuario. \r\nDicho problema se debía a que las contraseñas se hasheaban 2 veces.','2023-08-02'),(6545,260,'','Con dylan empezamos a pensar y desarrollar la logica para la reación de eventos dinamicos ','2023-08-02'),(6546,297,'02/08/23','Hoy finalice la idea de la pág de emprendedores y realice los bocetos para las mismas.','2023-08-02'),(6547,250,'miercoles 2/8/2023','hoy estuve añadiendo contenido a la carpeta de campo.','2023-08-02'),(6548,254,'2/8/23','Hoy realice un proyecto de java web de prueba para utilizar el doPost y el getPost pero sin la bdd, la clase del martes realizare un proyecto web de prueba con una base de datos sencilla para realizar el registrar de nuestra pagina el miercoles ','2023-08-02'),(6549,262,'2/8/2023','El dia de hoy comenzamos con la colocacion de preguntas en los escenarios del videojuego','2023-08-02'),(6550,263,'2/8','Hoy me encargue en hacer la historia y anotarla para que asi quede claro asi como tambien ya pasar de pagina de una vez con este tema.','2023-08-02'),(6551,271,'2-8-2023','En el día de la fecha, seguimos con el escenario de Unity','2023-08-02'),(6552,270,'2-8-23','El dia de hoy investigue como colocar las preguntas y respuestas con texto en el escenario de tematica de Unity','2023-08-02'),(6553,253,'Miércoles 02/08/2023 - Código de Unity','Hoy traté de investigar un poco sobre el código de C# para hacer los bucles.','2023-08-02'),(6554,290,'Vigesimaquinta','En el dia de la fecha lo que realice fue modificar las imagenes que habia capturado antes de comenzar las vacaciones, las ordene numerandolas del 1 al 6 y dentro de ellas, enumere sus respectivas burbujas, para luego ir explicandolas 1 a 1','2023-08-03'),(6555,276,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión ','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Por un lado hemos terminado de configurar la pestaña del carrito de compras, de modo que este pudiese almacenar los productos que se agregan directamente desde la pestaña de producto, pudiendose agregar un producto una unica vez por usuario sin agregarlo mas de lo debido. En este mismo se pueden eliminar los productos del carrito, y junto con los productos que se encuentran dentro de este mismo, se van calculando y sumando los precios y utilizamos un pequeño apartado para mostrar el total de la compra y 2 opciones de seguir comprando y la de finalizar con la compra. De este modo estariamos dando la pestaña del carrito como finalizada. \r\n\r\n- Por otro lado, hemos configurado un poco la base de datos para que el carrito funcione correctamente, aunque seguramente debamos seguir configurandola, pues próximamente estaremos pasando a diseñar las pestañas relacionadas a los pasos de compra. \r\n\r\nEso fue todo lo realizado por hoy','2023-08-03'),(6556,281,'Dia 18','El día de hoy estuvimos realizando bastante tareas en general, empezamos agregando los métodos de pago en la página principal, y además pensamos ponerle una sección de ofertas en la cual varios productos se vean adecuadamente adaptados a los precios de hoy. También hice las faltantes descripciones a los nuevos productos que habíamos agregado la otra vez.Además empezamos a completar la página de contacto en la cual agregamos nuestro Instagram y Tik Tok. Y por último, cambiamos el color del botón y el color del borde al registro y login.','2023-08-03'),(6557,299,'Hoy','Hoy adelantamos el trabajo y probamos nuevas funciones','2023-08-03'),(6558,279,'Dia 20 del Proyecto','En todo este día estuve después de terminar con el daily de hoy ayude un poco a Enzo y a Ledesma en hacer los prototipos de Android ya que habíamos pensado cambiar la parte poner el incidente a darle varias opciones de incidentes y al elegir uno se abra su apartado para reportar y bueno en eso hice el prototipo de Estafa y Manifestación aunque el ultimo creo que le falta algo aunque no se aun.','2023-08-03'),(6559,283,'homerun','Hoy, concretamos el inicio de una nueva etapa en el proyecto donde nos pudimos juntar la mayoría del equipo, faltando solo un integrante (que en paz descanse mi querido amigo thiago arroyo). Cuando llegamos a la computadora, logramos hacer que funcione para luego poder llegar a abrir todos las aplicaciones que íbamos a usar, como por ejemplo: Xampp, Drive, Visual Studio. Luego de ya abiertos todos los programas pasamos a descargar todos los archivos de la carpeta que tenemos en conjunto con los integrantes del grupo. Prendimos el Xampp donde en el mismo esta el servidor Apache y el MySQL. Luego de hacer todo esto pudimos descomprimir todos los archivos para poder pasarlos dentro del Visual Studio Code y dentro de la carpeta Htdocs. \r\nLo que nosotros no nos percatamos es que descargamos una pagina que no estaba actualizada con las ultimas mejoras que le pusimos a la pagina. Lo cual tuvimos que descargar la otra pagina que había hecho nuestro compañero que no viene mas (RIP) y terminamos de actualizar y dar algunos detalles a la pagina. Esto nos Conllevo a un problema por que la misma pagina se encuentra con mucho código entrelazado, y sumando nuestra inexperiencia con algunos tipos de lenguaje crea que nosotros no podamos desenvolvernos mejor con la pagina y poder finalizarla de una vez. Seguiremos con este proyecto pero no sabemos si seguirlo o dejarlo por otro que se nos sea mas fácil. \r\nPasando de todo esto pudimos agregar algunas cosas pero igualmente seguiremos intentando resolver este problema. \r\n','2023-08-03'),(6560,278,'Clase N°25 03/08/023','En el día de hoy tuve problemas con la pagina web , ya que había partes que no tenían responsive , entonces me puse a solucionar ese problema arreglando cada objeto uno por uno. También me llamaron mis compañeros que están comenzando un nuevo proyecto para que documente todo lo que realicen.Por este motivo el proyecto eccefurni queda pausado hasta el 15 de octubre , aunque mis compañeros seguirán trabajando en él.','2023-08-03'),(6561,286,'HTML y CSS de Página Usuarios 4','Luego de unas buenas dos semanas de receso escolar, el día de la fecha comenzó normalmente, abrí todas las aplicaciones que iba a usar, inicié sesión en mis cuentas, descargué los archivos necesarios y me puse a trabajar. Para empezar, tuve una reunión con el Scrum Master del proyecto Enzo Bartoletti la cual me comentaba que habría que cambiar el diseño de la página de usuarios agregando más cantidad de delitos para seleccionar y que cada uno despliegue un formulario aparte para especificar más sobre el suceso. Más tarde me puse a averiguar cómo difuminar el fondo cuando el popup del formulario se desplega, por lo que hice una pequeña búsqueda en YouTube para encontrar el video &quot;Como crear efecto Overlay en CSS&quot; de &quot;Xk Web&quot; el cual me proporcionaba el paso a paso de cómo hacer lo solicitado. Para empezar, en CSS creé una clase &quot;.container::before&quot; para poder hacer uso de dicho pseudo elemento que me proporciona un &quot;acompañamiento&quot; a un selector para poder añadir un aspecto decorativo a un elemento. Dentro de este agregué las siguientes propiedades: &quot;position: absolute;&quot; para que elemento se posicione sobre todo el documento, &quot;content: \'\';&quot; que no sé para qué sirve, después agregué &quot;top: 0; bottom: 0; left: 0; right: 0;&quot; para establecer la distancia del elemento entre los bordes, y para terminar agregué un &quot;backgorund-color: rgba(0, 0, 0, .6);&quot; para que el color sea negro y que tenga una difuminación de 0.6. Todo esto dió resultado pero no el esperado, ya que la difuminación se aplicó al popup y no al fondo de este. Más tarde me dí cuenta de que mi compañero Christian Forte estuvo haciendo lo mismo que yo pero con JS, entonces me mostró su funcionamiento y concluimos en que lo que él había hecho era más funcional, por lo que nos pusimos a trabajar juntos. Al principio lo que él había hecho no funcionaba, por lo que decidimos abrir los archivos de él en la computadora que yo estaba usando, ya que a veces, no sabemos por qué, hay cosas que funcionan en unas computadoras y en otras no, pero nos dimos cuenta que era lo mismo. Después de esto, me puse a revisar los archivos y me dí cuenta que parte de las funciones del mapa no estaban. Más tarde tuve una reunión con los profesores de la materia y otros compañeros además de algunos de los de grupo para hacer un proyecto nuevo en dos meses y medio.','2023-08-03'),(6562,280,'03.08.2023','El dia de hoy ayude a uno de mis compañeros de equipo debido a que su aplicacion no estaba ejecutandose en su computador. En paralelo a eso me encargue de reinstalar los paquetes de python y opencv ya que tampoco funcionaban correctamente en la computadora que estoy utilizando. Aun nos e consiguio terminar la instalacion ya que la libreria de numpy manda error a la hora de instalar el opencv','2023-08-03'),(6563,287,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión ','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Por un lado hemos terminado de configurar la pestaña del carrito de compras, de modo que este pudiese almacenar los productos que se agregan directamente desde la pestaña de producto, pudiendose agregar un producto una unica vez por usuario sin agregarlo mas de lo debido. En este mismo se pueden eliminar los productos del carrito, y junto con los productos que se encuentran dentro de este mismo, se van calculando y sumando los precios y utilizamos un pequeño apartado para mostrar el total de la compra y 2 opciones de seguir comprando y la de finalizar con la compra. De este modo estariamos dando la pestaña del carrito como finalizada. \r\n\r\n- Por otro lado, hemos configurado un poco la base de datos para que el carrito funcione correctamente, aunque seguramente debamos seguir configurandola, pues próximamente estaremos pasando a diseñar las pestañas relacionadas a los pasos de compra. \r\n\r\nEso fue todo lo realizado por hoy','2023-08-03'),(6564,274,'Cambios en el php','En el dia de la fecha lo primero que hice fue añadir un required (el cual es un atributo para que el input deba ser marcado obligatoriamente) a los input de tipo radio, los cuales pertenecen a la sección de requerimiento de ambulancia y bomberos. Hice esto ya que junto a un compañero nos dimos cuenta de que al enviar los datos sin marcar estos radios, los datos eran enviados.\r\nUna vez que hice esto, me dí cuenta que la página de administradores y la de usuarios compartían una base de datos idéntica, pero eran dos. Fue por esto que cambié los links en el PHP para capturar los datos de la misma.\r\n','2023-08-03'),(6565,292,'corrreccion de forms de registro de denuncias ','en el dia de hoy enzo me dijo que continuemos con la interfaz de usuario la cual era el form con unos 15 incidentes y mientras íbamos haciendo el nuevo form que consiste en las opciones al seleccionar un tipo de incidente,hicimos el siguiente cambo el cual era mover el enviar reporte a la pagina emergente \r\nyo trabaje con el incidente incendio el cual tuve que buscar en internet cuales eran los distintas tipos de accidentes, primero pensé en poner uno por uno hasta que vi una pagina la cual me mostraba los distintos grados de incidente, lop habla con enzo y nos pareció lo mejor añadirlo así y no uno por uno como estaba antes\r\ncomo quedaba bastante vacío me fije en el anterior prototipo para agregarle las distintas cosas que faltaban como cantidad de afectados y para agregar una descripción \r\n','2023-08-03'),(6566,293,'Diagrama de entidad Relacional','hoy día estuve agregando, modificando y borrando parte del diagrama que estaba desactualizado\r\n','2023-08-03'),(6567,288,'clase 23','El día de hoy hicimos bastantes tareas en nuestra pagina web, agregamos los métodos de pago que aceptaremos, para cobrar nuestras figuras 3d, además agregamos una sección de ofertas únicas para poder ahorrarse unos pesos al comprar en nuestra pagina web. Aun nos falta pulir la zona de Ofertas ya que recién hoy tuvimos la idea y no la diseñamos completa del todo. También hicimos la descripción general de las cards de cada producto, poniendo tamaños y precios adecuados y acordes a cada personaje. Ademas diseñamos por completo la pagina de contacto, pusimos nuestro Instagram y Facebook, para que puedan ver nuestra queridísima pagina web LiliFy 3D. Y por último, cambiamos el color del botón y el color del borde al registro y login.','2023-08-03'),(6568,282,'Tareas varias','En el día de hoy trabaje durante la mañana en GS1 con los archivos Output de Censcosud, mientras que durante la tarde avanzamos con prototipados de nuevos forms para BaVigila, pero fuimos interrumpidos para un cambio abrupto de proyecto, dedicando los proximos dos meses a Generación T, lo cual consiste en 2 proyectos, una gestion de bitacoras y un gestor de vacaciones.','2023-08-03'),(6569,275,'Vuelta a clase, actualización del diagrama GANTT entre otros.','El día de hoy después del receso invernal nos dedicamos mas que nada a repasar,actualizar y ver que es lo que habíamos hecho hasta ahora, yo empecé a revisar cada diagrama que logramos hacer y terminar hasta ahora, fijándome que cada uno este terminado,bien hecho o si necesita actualizarse,El camino critico ya esta terminado, al igual que el de  caso de uso, colaboración, secuencia, entidad de relaciona y flujo de datos, también estuvimos viendo el tema de la &quot;factura&quot; o la parte de &quot;transacción de dinero&quot; como le digo yo, es la parte en donde el cliente compra un producto y paga por este, esta es la ultima parte del trabajo y tenemos que ver bien como hacer, el resto del día me la pase viendo el funcionamiento de la pagina y actualizando del diagrama GANTT.','2023-08-03'),(6570,277,'Vigésima clase','El día de hoy volvimos de las vacaciones y nos pusimos a trabajar con muchas ganas, lo primero que hicimos fue mejorar la página principal agregándole un espacio para ofertas especiales, además de agregar una imagen que destaca los distintos métodos de pago que aceptamos, estos son Paypal, Visa y Mastercard.\r\nLuego nos pusimos a trabajar en la parte de productos, agregamos una barra al pie de la página para moverse por estas, en total tenemos tres, donde hay nueve productos en cada una. Además estuve acomodando las imágenes de los productos para que todas sean del mismo tamaño y queden simétricamente.\r\nTambién estuvimos mejorando el apartado de contactos, agregando un título más bonito que dice “Instragram Oficial” junto a un hipervínculo del mismo, aún no tenemos ninguna foto subida pero planeamos utilizarlo bastante. También dejamos espacio para un TikTok que aún no hicimos pero nos pondremos a ello lo antes posible.\r\nPor último, le pusimos la descripción a los distintos productos que vendemos en nuestra página, ofreciendo algo de humor e información sobre la figura para atraer ventas.\r\n','2023-08-03'),(6571,296,'Bitacora 20','Hoy estuve siguiendo con la página del iniciar sesión y registrarse que había empezado semanas anteriores,y pude avanzar bastante en el diseño','2023-08-03'),(6572,273,'Clase 03-08-2023','En el día de la fecha llegué a la escuela y me puse a observar cómo iba el avance de mi proyecto. Por mi parte, empecé a realizar la codificación para hacer que el código de barras se pueda guardar como una imagen que luego podría ser mostrada en la página. A su vez, me dieron un proyecto aparte que tengo que realizar.','2023-08-03'),(6573,291,'Fin de vacaciones','El día de hoy fue la primera clase después de las vacaciones, en este día vinimos cuatro de los cincos integrantes , pero eso no nos detuvo trabajar para avanzar con el proyecto, este día pensé usar las siguientes aplicaciones &quot;Visual Studio&quot;, el &quot;Xampp&quot; y el drive de mi cuenta de Google para realizar el trabajo de hoy, usando estas aplicaciones organice, modifique y agregue cosas a la página para que esta más completa, cambie el iniciar sesión y el registrarse para que queden más agradables para la vista y el cliente que quiera tener su cuenta, y con eso concluye mi trabajo de este día.','2023-08-03'),(6574,291,'Fin de vacaciones','El día de hoy fue la primera clase después de las vacaciones, en este día vinimos cuatro de los cincos integrantes , pero eso no nos detuvo trabajar para avanzar con el proyecto, este día pensé usar las siguientes aplicaciones &quot;Visual Studio&quot;, el &quot;Xampp&quot; y el drive de mi cuenta de Google para realizar el trabajo de hoy, usando estas aplicaciones organice, modifique y agregue cosas a la página para que esta más completa, cambie el iniciar sesión y el registrarse para que queden más agradables para la vista y el cliente que quiera tener su cuenta, y con eso concluye mi trabajo de este día.','2023-08-03'),(6575,295,'Pagina Web','El dia de hoy, nos pusimos de acuerdo en grupo para ver como ibamos a continuar esta última parte del año, en la cual decidimos que junto mi compañero íbamos a seguir con la pagina web, finalizamos la parte de la conexión con php a la base de datos y decidimos que el dia de mañana ibamos a empezar con la investigación de como hacer el buscador de los ingredientes.','2023-08-03'),(6576,298,'Clase 23','Volvimos después de las vacaciones por lo que estábamos un poco perdidos, tuvimos problemas para trabajar porque nuestra computadora no tenía python y terminamos rehaciendo los diagramas (de nuevo). Por otro lado, cambiamos unas cositas de la bdd.','2023-08-03'),(6577,283,'Charla de la Uba','El dia de hoy tuvimos una charla de la Universidad de Buenos Aires donde nos hablaron sobre que expectativas tenemos nosotros para el futuro y ah que podemos llegar a alcanzar. Primero las dos chicas q nos dieron la charla se presentaron para luego darnos el link de una pagina que nos redirige a una formulario de google, en este se encontraban preguntas sobre como nosotros nos veiamos despues de terminar el colegio o que tipo de informacion tenemos en el ambito de universidades o etc. Luego de esto todos nos sentamos en un circulo para charlar sobre este tema. Como nos veiamos, que queriamos hacer a futuro o hasta donde podemos encontrar este tipo de informacion. \r\nLuego tuvimos que hacer un ejercicio donde tuvimos que resolver con nuestro equipo que contradicciones y recursos tenemos para poder hacer lo que queremos hacer el dia de mañana como por ejemplo estudiar, irnos del pais o estudiar y trabajar. Luego las expusimos en el pizarron y las chicas de la uba nos dieron su punto de vista en el tipo de recursos o informacion que tenemos nosotros en este tema y a su vez, las contradicciones. Despues ya termino la charla. ','2023-08-04'),(6578,293,'Charla de la UBA','Hoy día vinieron los de la UBA a darnos charlas sobre el tema del estudio que queríamos hacer en un futuro eso.','2023-08-04'),(6579,285,'Día 25 (No pude subirla) y 26','Día 25\r\n\r\n¿Que logre hacer hoy?\r\n\r\nHoy fue un día intenso en el desarrollo de la página de búsqueda. Logré implementar todas las funcionalidades necesarias para que el script funcionara correctamente con PHP. Antes, los productos tenían que ingresarse manualmente, pero ahora, gracias a la conexión con la base de datos, se imprimen automáticamente y se muestran en la página, lo que facilita enormemente la gestión de los productos.\r\n\r\n¿En que se me complico?\r\n\r\nDebo admitir que el proceso no fue para nada sencillo y en ocasiones me sentí frustrado. Cada vez que avanzaba un paso, parecía retroceder mil. En una ocasión, al corregir un error relacionado con la caja de envío gratis, otra funcionalidad, como la de mostrar el precio máximo, se rompía, y lo mismo ocurría con la búsqueda de productos. Afortunadamente, logré solucionar todos estos problemas con la ayuda de más scripts y la implementación de funcionalidades en PHP.\r\n\r\n¿Qué estuve investigando?\r\n\r\nDurante el día, estuve investigando sobre cómo conectar PHP con una base de datos para poder mostrar automáticamente los productos almacenados en ella. También investigué sobre la implementación de diferentes funcionalidades en PHP, como la vista previa de imágenes en los productos y la creación de botones para acciones rápidas, como comprar, añadir a favoritos o agregar al carrito de compras. Busqué ejemplos y documentación en línea para aprender cómo mejorar la experiencia del usuario en la página de búsqueda.\r\n\r\nDía 26\r\n\r\n¿Que logre hacer hoy?\r\n\r\nHoy, en conjunto con mis compañeros, tuvimos una charla con la Dirección de Orientación Educativa (DOE) de la Universidad de Buenos Aires (UBA). Durante esta reunión, nos centramos en temas fundamentales para nuestro futuro. Exploramos nuestras aspiraciones profesionales y las perspectivas laborales que se nos presentan. Además, discutimos los posibles desafíos que podríamos enfrentar en nuestro camino hacia el éxito.\r\n\r\nUna de las actividades destacadas de hoy fue la creación de un cuadro en el que dividimos los recursos disponibles en dos categorías. Por un lado, identificamos los beneficios actuales, es decir, los recursos y oportunidades que nos favorecen en el presente. Por otro lado, reflexionamos sobre los obstáculos o contratiempos que podrían representar situaciones o miedos que debemos superar para alcanzar nuestras metas.\r\n\r\n¿En que se me complico?\r\n\r\nAfortunadamente, no experimentamos complicaciones durante nuestra charla con la Dirección de Orientación Educativa. La reunión transcurrió de manera fluida y pudimos abordar todos los temas de manera eficiente.\r\n\r\n¿Qué estuve investigando?\r\n\r\nPrevio a la reunión, estuvimos investigando sobre la Dirección de Orientación Educativa (DOE) de la Universidad de Buenos Aires (UBA) para conocer mejor sus funciones y cómo podrían ayudarnos en nuestro desarrollo académico y profesional.\r\n\r\nAdemás, dedicamos tiempo a investigar sobre las perspectivas laborales en nuestras áreas de interés, así como las tendencias y oportunidades laborales en el mercado actual. También buscamos información sobre estrategias para superar obstáculos y cómo manejar situaciones que pudieran surgir en el camino hacia nuestras metas profesionales.\r\n','2023-08-04'),(6580,290,'Vigesimasexta','En el dia de la fecha tuvimos una charla con gente de la uba y basicamente nos hicieron hacer una encuesta en la cual nos hacian preguntas sobre nuestro futuro, luego se hizo una actividad en la cual nos preguntaban si nosotros nos haciamos esas preguntas o si alguien nos las hacia, y luego hicimos otra actividad en la cual teniamos que poner nuetros recursos y obstaculos.','2023-08-04'),(6581,278,'Clase N°26 04/08/23','En el dia de hoy recibimos la visita de la UBA, tuvimos un taller en relacion a que queremos hacer en nuestro futuro , despues de la secundaria, si queremos trabajar , estudiar o ambas.El taller estuvo bueno , fue reflexivo con nosotros mismos para conocer que queremos hacer en nuestro futuro.','2023-08-04'),(6582,276,'Charla UBA','El día de hoy no he trabajado en base al proyecto de las PP &quot;Vicson Web&quot; debido a que hoy hemos participado de una charla de dos psicólogas de la UBA, habiendo realizado un par de actividades y haber compartido algunas anécdotas respecto al futuro, nuestros estudios y lo que queremos realizar una vez que terminemos la escuela secundaria. A su vez hemos realizado otro par de mini actividades relacionadas a el lado laboral, realizamos un formulario que pedia algunos datos sobre nosotros y nuestro conocimiento dentro de los ambitos laborales y universitarios, etc.\r\n\r\nEso fue todo lo realizado por hoy.','2023-08-04'),(6583,287,'Charla UBA','El día de hoy no he trabajado en base al proyecto de las PP &quot;Vicson Web&quot; debido a que hoy hemos participado de una charla de dos psicólogas de la UBA, habiendo realizado un par de actividades y haber compartido algunas anécdotas respecto al futuro, nuestros estudios y lo que queremos realizar una vez que terminemos la escuela secundaria. A su vez hemos realizado otro par de mini actividades relacionadas a el lado laboral, realizamos un formulario que pedia algunos datos sobre nosotros y nuestro conocimiento dentro de los ambitos laborales y universitarios, etc.\r\n\r\nEso fue todo lo realizado por hoy.','2023-08-04'),(6584,294,'DOEUBA charla grupal','En el dia de hoy tuvimos una visita de unas chicas en donde charlamos prufandamente en lo que haremos despues de terminar la escuela futuramente. La charla contenia tambien preguntas profundas y algunas mas externas. Como ultimo realizamos en un papel donde lo dividimos en los recursos y oportunidades que nos representan a la hora de poder decidir nuestro futuro ya sea academicamente o laboral.','2023-08-04'),(6585,275,'Charla UBA','resumiendo mucho lo que paso hoy fue que tuvimos una charla con unas psicólogas de la Uba, en una charla llamada &quot;mi futuro luego de la secundaria&quot; que por su mismo nombre dice que vamos a hablar sobre nuestro futuro luego de la secundaria,toda la conversación fue acerca de nuestras dudas, miedos y incertidumbres de lo que vamos a hacer en el futuro, algunos decían que iban a trabajar o seguir estudiando, otros ambas. por poner un ejemplo. ','2023-08-04'),(6586,295,'Charla del DOE de la Uba','En el día de la fecha vinieron de visita unas chicas provenientes del DOE de la UBA en donde nos dieron una charla sobre que íbamos a elegir para nuestro futuro ya que estamos por terminar la escuela secundaria. Nos hacían preguntas profundas que hacían referencia a los años anteriores y también preguntas mas globales para todos que eran del estilo como quien debía materias. Y como último nos brindaron un papel en donde lo dividimos al medio teniendo los recursos y obstáculos que íbamos a tener nosotros para lo que decidamos hacer de nuestro futuro.','2023-08-04'),(6587,289,'04/08','El día de hoy, tuvimos una charla informativa sobre vocación de la UBA. Vinieron dos psicólogas para poder brindarnos el taller.\r\nEso es todo por hoy, muchas gracias!','2023-08-04'),(6588,298,'Clase 24','Hoy tuvimos una charla de vocación por parte de dos chicas de la UBA','2023-08-04'),(6589,288,'Clase 24','El día de hoy tuvimos un taller presencial con 2 coordinadoras de la UBA, las cuales nos hicieron hacer un formulario de google hablando de nosotros y nuestro futuro, de que vamos a estudiar, y que vamos a trabajar, que vamos a hacer de el año que viene en adelante y como nos fué en nuestro proceso de aprendizaje de 1er año a 6to. Luego de eso estuvimos hablando en ronda en general de lo que pensamos del año que viene y de que pensamos de la carrera computación, o si vamos a seguir algo distinto. Después nos dieron un papel y en pequeños grupos escribimos, RECURSOS y OBSTÁCULOS de lo que nos depara al terminar la secundaria. Luego lo escribieron en el pizarrón y estuvimos hablando y pensando de lo que escribimos como grupo.','2023-08-04'),(6590,279,'Charla con la uba','En este día nos visitaron 2 mujeres de la uba que se especializan a ayudar a poder elegir nuestra decisiones de que hacer después de la secundaria primero se presentaron para después darnos un link donde era un formulario donde nos preguntaban cosas que quisiéramos hacer o parecido después de ma secundaria para después tener una charla sobre algunas cosas del cuestionario que nos dieron y también para ver que queríamos hacer después si estudiar o trabajar o parecido para después hacer en grupo un tipo cuadro de ventaja y desventajas que tendríamos al salir de la secundaria y después vimos sobre cómo era cada punto que puso los grupos','2023-08-04'),(6591,281,'Dia 19','El dia de hoy estuvimos toda la clase realizando una encuesta y charlando con el equipo del DOE de la UBA. Charlamos sobre nuestras preocupaciones sobre el futuro y nos plantearon una actividad que constaba en poner los obstaculos y los recursos que tenemos para lograr lo que tenemos pensado para el futuro','2023-08-04'),(6592,277,'Vigésima primer clase','El día de hoy tuvimos una charla con el DOE de la Universidad de Buenos Aires (UBA). Estuvimos hablando de nuestro futuro y de lo que tenemos planeado hacer el próximo año. \r\nPrimero estuvimos llenando un cuestionario de Google donde nos hacían preguntas para saber si pensábamos o no en nuestro futuro y si esto se debía a la presión del exterior o no.\r\nLuego, nos sentamos toda la clase en una ronda para hablar un poco de que vamos a hacer el siguiente año, ya sea estudiar, trabajar, ambas o ninguna, además de compartir un poco nuestros miedos y problemas a la hora de elegir una carrera o de no elegir.\r\nPor último, llenamos un papel con obstáculos y recursos que tenemos disponibles para completar nuestros objetivos del próximo año.\r\n','2023-08-04'),(6593,274,'Charla con personal de la U.B.A.','El día de hoy tuvimos un encuentro en el establecimiento con dos psicólogas de la Universidad de Buenos Aires. El objetivo de dicho encuentro era poder charlar acerca de cuales son nuestros planes a futuro, además de poder resolver las dudas que tengamos. Primero hicimos una presentación en la cual nos preguntaron si lo que íbamos a hacer el año que viene estaba relacionado con el estudio, el trabajo o ambos. Ahí hablamos un poco acerca de la situación de cada uno. También compartimos nuestra experiencia a lo largo del curso de la secundaria, como porque habíamos elegido la especialización, si nos arrepentimos de la decisión, etc. También hablamos acerca de por qué queríamos terminar el secundario y cual era el motivo de seguir una carrera universitaria. Luego de esto, nos dividimos en grupos pequeños en el cual debíamos escribir cuales eran los recursos y los obstáculos con los que contamos a la hora de seguir nuestros estudios o en el ámbito laboral.','2023-08-04'),(6594,286,'Charla sobre nuestro futuro del DOE UBA','El día de la fecha empezó de una forma distinta a la habitual, llegaron dos señoras psicólogas del DOE de la UBA a darnos una charla a mí y a mis compañeros del curso sobre nuestro futuro después de la escuela secundaria, proponiéndonos hacer un Google Form para responder una serie de preguntas para más tarde hacer una reunión entre todo mi curso y yo para hablar sobre las sensaciones que nos generaba el pensar en nuestros futuro.','2023-08-04'),(6595,282,'Out Cencosud Enero - avances','Durante la jornada de hoy trabaje de una manera tranquila mediante la virtualidad en el archivo de los outs de la herramienta, avanzando en finalizar recortes y despejando dudas referentes a envases que me parecían estar mal catalogados. Para estas tareas me reuní mediante Skype con Tomas Sainato para que colabore en los detalles para los cuales no estaba interiorizado.','2023-08-08'),(6596,250,'Martes 8 - 8 - 2023','Hoy avanzamos con el código de la página web de Recetonomicón.','2023-08-08'),(6597,268,'08-08-2023','Ayer con Baqueiro comenzamos con la documentación del proyecto de Strambe y el Foda. Nos unimos al Trello del grupo.\r\nHoy con Baqueiro continuamos y mejoramos la documentación del proyecto de Strambe.\r\n','2023-08-08'),(6598,255,'Martes 8 - 8 - 2023','Hoy avanzamos con el código de la página web de Recetonomicón.','2023-08-08'),(6599,251,'BeCation - Generación T pt1 - 08/08/2023','Dada una bajada del ministerio, nuestro proyectos de PP se encuentran comprometidos y me reasignaron para trabajar en un proyecto para StreamBe.\r\nEstamos trabajando en el proyecto BeCation, el cuál es un gestor de vacaciones.\r\nEl día de hoy hice la conexión a la BDD que hice ayer y también un CRUD genérico y aplicado a las tablas User y Role.','2023-08-08'),(6600,263,'8/8','Hoy estuve trabajando mas que nada en ponerle un nombre al juego que estamos haciendo.','2023-08-08'),(6601,297,'08/08/23','Realice algunas modificaciones en el boceto que cree la clase pasada','2023-08-08'),(6602,265,'08-08-2023','Hoy, junto a mi compañero, estuve armando y viendo la impresión que hizo nuestro profesor ','2023-08-08'),(6603,254,'8/08/23','Hoy termine la parte de prueba con la bdd del proyecto, para poder realizae mañana el registro ','2023-08-08'),(6604,271,'8-8-2023','En el dia de la fecha, investigue un poco mirando videos del lenguaje de c sharp,y un poco de como conectar unity con la base de datos','2023-08-08'),(6605,262,'8-8-2023','El dia de hoy junto a emilio comenzamos a ver videos para introducirnos en el nuevo proyecto de StreamBe, nos toco la parte de frontend y vimos video de React','2023-08-08'),(6606,253,'Martes 08/08/2023 - Nuevo proyecto y React','Ayer nos dieron un nuevo proyecto que debíamos realizar si o si y a mi me toco hacer la parte de FrontEnd con React. Así que comencé a ver videos sobre el tema.','2023-08-08'),(6607,267,'08-08-2023','Hoy continué con la documentación del nuevo projecto de Streambe con mi compañero Javier.','2023-08-08'),(6608,270,'8/8/23','El dia de hoy termine de editar el escenario de tematicas para que se vea la seleccion de cada una y comencé a ver algunos videos sobre la conexion de la base de datos con el juego y el codigo dde editar el texto en el juego para las preguntas y su randomizacion.','2023-08-08'),(6609,260,'','Empezamos con el proyecto de streambe ayer, y hoy me encargué de terminar el componente header con el responsive del mismo','2023-08-08'),(6610,261,'08/08/2023','hoy el diñeso 3d del robot y lo armamos','2023-08-08'),(6611,303,'08-06-2023','Hoy investigamos sobre c sharp y empezamos a conectar la base de datos con unity.','2023-08-08'),(6612,263,'9/8','Hoy estuve trabajando con el personaje tuve problemas con los huesos ya que no se pegan a el cuerpo en si.','2023-08-09'),(6613,271,'9/8/2023','En el dia de la fecha investigue como poner un texto en unity y segui investigando sobre la conexion entre unity y la base de datos.','2023-08-09'),(6614,256,'9/8','Kiara chunga me paso los bocetos que hizo de la página principal, perfil y productos del proyecto.\r\nPuse las fotos en un jamboard y dividí la página en pasos para que sea un proceso más ordenado, a parte de así poder buscar info de como hacer algunas cosas.\r\nCopie y pegue algunos links en un documento para usarlos más adelante.\r\n','2023-08-09'),(6615,270,'09/08/23','El dia de hoy nos organizamos para que algunos integrantes del grupo busquen informacion sobre modificar el texto del escenario con codigo y por mi parte ayude en eso y investigue sobre codigo php para conectar la base de datos con el videojuego en unity en el lenguaje de C#.','2023-08-09'),(6616,250,'miercoles 9 8 2023','hoy estuve programando un dropbox con javascript','2023-08-09'),(6617,259,'8/8 Martes y 9/8 Miercoles Practicas Profesionalizantes Nahuel Moreno','Ambos dias me tome el trabajo de continuar con mi carpeta de campo, colocando principalmente información restante que me quedaba','2023-08-09'),(6618,268,'09-08-2023','El día de hoy después de unos últimos detalles de la documentación con Baqueiro comenzamos con el Gantt donde podrán ver el proceso que tenemos ideados para la creación del proyecto.\r\nDespués con el tiempo que me quedaba continúe con el proyecto del robot sumo donde arregle un detalle del robot que es que compramos un modelo diferente del lector de línea y de estar de forma horizontal ahora estará en forma vertical.\r\n','2023-08-09'),(6619,254,'9/9/23','Hoy realize la vista del iniciar sesion y lo conecte con la bdd, me falto probarlo ','2023-08-09'),(6620,255,'miercoles 9 8 2023','hoy estuve diseñando la pagina de recetas y ayude a programar el index','2023-08-09'),(6621,261,'09/08/2023','hoy trabaje con el código del sensor infrarrojo','2023-08-09'),(6622,267,'09-08-2023','El día de hoy después de unos últimos detalles de la documentación con Javier comenzamos con el Gantt donde podrán ver el proceso que tenemos ideados para la creación del proyecto.','2023-08-09'),(6623,258,'09/08/2023','Hoy termine lo que vendria siendo la casa ademas de ayudar a fenoglio y sebastian en su modelado 3d','2023-08-09'),(6624,251,'BeCation - Generación T pt2 - 09/08/2023','El día de hoy terminé el DAO de la tabla Vacation y tras mergear la rama donde trabajé, empecé a trabajar en el controller de Vacation.\r\nEstá terminado, puede que tengamos que corregir el método editVacation.','2023-08-09'),(6625,282,'Finalizacion de OutCencoEnero','En el día de hoy mi tarea consistió en finalizar los detalles faltantes del archivo OutCencoEnero correspondientes, evidentemente, a el Out que proporciona la herramienta para los registros de la administradora de cadenas de supermercados Cencosud referentes al mes de Enero del año 2023. Ademas, aproximadamente cerca de las 11:30/12:00 Lucas Sosa me invitó a opinar en una reunion junto a una integrante del sector Identificacion, quienes son los encargados de revisar el correcto armado de mis recortes en los archivos. Esta reunion resultó ser muy prolifera, logrando poner en común los dos modelos de trabajo de ambas áreas, mientras nosotros realizamos el trabajo mediante un Excel diseñado en base a la salida de la herramienta, Idenficacion trabaja los recortes mediante un Excel con una gran cantidad de formulas para automatizar varios de los procesos. Tras esta puesta en común expusimos varios puntos donde surgieron dudas y problematicas, siendo que aporté con el caso de un tipo en evase &quot;Horma&quot; el cual no figura en la tabla de envases de GS1, mismo caso con el tipo de envase &quot;Maple&quot; o el tipo de envase &quot;Tableta&quot;, entre varios más. Esto quedo a pronta revisión por parte del jefe del área de Identificacion.\r\nPosiblemente en el día de mañana ya deba arrancar con el archivo Out de la Herramienta de Cencosud referente al mes de febrero de 2023, realizando las mismas tareas en un nuevo mes.','2023-08-09'),(6626,253,'Miércoles 09/08/2023 - Login','Hoy practiqué un poco de React y comencé con el desarrollo del login.','2023-08-09'),(6627,252,'Clase 35 - 09/08/2023','El día de ayer ayudé a mis compañeros con la documentacion de BeCation. Los ayudé a escribir el ante proyecto y hoy terminar de corregir ciertos errores en la documentación. Mientras ellos se encargaron del GANTT y los guié para poner los tiempos de cada tarea a realizar y a poner ciertas tareas en diferente orden.\r\nPor otro lado, yo continué viendo sobre las API REST con Node js y Express. Después me encargué de comenzar con la documentación de la API. Vi un video sobre documentar APIs con Swagger y comprendí el tipo de ecritura.\r\nhttps://www.youtube.com/watch?v=rIWGcxnVIA8\r\nhttps://www.youtube.com/watch?v=RayDPBYou4I&amp;pp=ygUXc3dhZ2dlciBleHByZXNzIG5vZGUganM%3D','2023-08-09'),(6628,266,'trabajo con becation','En el dia de hoy termine las rutas del nuevo proyecto de becation y estuve armando todos los controller, tambien pude avanzar bastante y estuve viendo el tema del encriptado y de la creacion de usuarios y gets de usuarios varios ','2023-08-09'),(6629,282,'GS1 presencial','Durante el día de hoy en GS1 (presencialmente) realmente no hice nada referente a la empresa debido a causas externas a mí, por lo cual pasé la totalidad del día realizando aportes a la carpeta de campo de la materia, añadiendo aproximadamente entre 8 y 12 hojas, 3 imágenes y varias explicaciones referentes a tareas realizadas durante las vacaciones de invierno y todas las posteriores a estas vacaciones, por lo cual mis avances en la carpeta abarcan como fechas desde el dia 17/07/2023 al dia 10/08/2023.\r\nTambién olvide mencionar que en el día de hoy me dediqué a dialogar con mis compañeros de BaVigila acerca del form de denuncias, planteando replantear gran parte del proyecto (si, nuevamente) pero manteniendo las tecnologías actuales, negándole al usuario la posibilidad de visualizar el mapa y haciéndolo una funcionalidad exclusiva para los administradores, mientras que al usuario le ofeceriamos una interfaz plenamente para realizar sus denuncias, manteniendo una app mobile exactamente idéntica al form creado y fabricando una versión web desde cero planteando como principal objetivo, tal como al principio del proyecto, la realización de denuncias priorizando la calidad de dichas denuncias por sobre la velocidad de envío de las dichas.\r\nAdemás plantee en el grupo la necesidad de que el form cuente con un botón para casos de emergencia, donde se envíe un móvil a comprobar la situación que está pasando, igualmente está en una fase temprana y, a pesar de que ya fue aprobado, en prueba e incluso previo a ser desarrollado.\r\nDurante la tarde me presenté a Practicas Profesionalizantes y avanzamos con el proyecto de Generación T, dandoles ya la posibilidad de estudiar React en FreeCodeCamp, creando las Bases de Datos del proyecto e investigando acerca de la fabricación de API\'s','2023-08-10'),(6630,298,'Clase 25','Hoy cambiamos gran parte de lo que teníamos planeado, como Lucho y Geral empezaron con otro proyecto quedaron (hasta que terminen con eso) fuera de este trabajo. Además de que Alan y Ciro se sumaron a nuestro proyecto. Ahora la idea sigue siendo la misma pero vamos a hacer unos cambios como rehacer la página y agregar recetas dulces a la base de datos. También descartamos la idea del robot.','2023-08-10'),(6631,285,'Día 27','¿Qué logré hacer hoy?\r\n\r\nHoy ha sido un día bastante complicado para nuestro equipo. Desafortunadamente, nuestro grupo anterior enfrentó serias dificultades y se disolvió, lo que significó perder todo el progreso que habíamos logrado en la página web anterior. Tuvimos que comenzar desde cero con un nuevo grupo, pero a pesar de esta adversidad, logramos organizarnos.\r\n\r\nMi responsabilidad en este nuevo equipo es realizar modificaciones en la página que estamos desarrollando ahora. Estoy trabajando junto a Victoria Laura, Maximo Escobar y Carolina Cavalitto, quienes también están enfrentando el desafío de reiniciar el proyecto. Es un momento complicado, pero estamos comprometidos a sacar adelante este nuevo enfoque.\r\n\r\n¿En qué se me complicó?\r\n\r\nLa complicación principal que enfrentamos hoy fue la pérdida de todo el progreso que habíamos hecho en la página anterior. Fue realmente frustrante ver que el trabajo arduo que habíamos realizado se desvaneció debido a las circunstancias inesperadas. Empezar desde cero siempre es un desafío y puede ser desmoralizador. Además, adaptarnos al nuevo grupo y asegurarnos de que todos estemos en la misma página también requiere tiempo y esfuerzo.\r\n\r\n¿Qué estuve investigando?\r\n\r\nDada la situación, gran parte de mi tiempo lo dediqué a investigar cómo hacer la transición lo más suave posible hacia este nuevo proyecto. Busqué formas de aprovechar lo aprendido en el proyecto anterior y aplicarlo a esta nueva versión, a pesar de tener que comenzar de nuevo.\r\n\r\nTambién investigué cómo colaborar de manera efectiva con mi nuevo compañero, Ciro Lobotrico, quien es el único sobreviviente del desafortunado suceso de la disolución de nuestro grupo anterior. Es importante establecer una comunicación sólida y asegurarnos de que ambos estemos al tanto de las tareas y objetivos.','2023-08-10'),(6632,292,'como hacer una api- generacion t','En el dia de hoy comenzamos con el proyecto principal de generación t el cual consiste en hacer una página en la que se ingresaron bitácoras, para este proyecto tenemos que dejar pausado e nuestro de bavigila cosa que no me gusta demasiado la idea.\r\n     esperamos unos minutos hasta que arrancamos a hacer algo ya que todos los integrantes no estaban en el aula, cuando llegaron enzo nos dijo que buscaríamos como hacer una api desde 0 ya que la idea del proyecto es hacerlo solo con apis. después de un rato pedro que es otro compañero nos llamó a todos para que hagamos la base de datos de la bitácora \r\nel video que mas me sirvio por lo que me explico fue el de develoteca donde en el video estaba separado por secciones que hacia mas facil mi entendimiento\r\n','2023-08-10'),(6633,274,'Inicio del nuevo proyecto','En el día de la fecha, comenzamos con la investigación necesaria para realizar el proyecto. Lo primero que hicimos fue buscar tutoriales que expliquen que es una API, y que también expliquen como crear una con PHP. En paralelo, junto con el resto de mis compañeros del equipo, pensamos la base de datos que utilizaríamos para la página de la creación de bitácoras. Luego, continuamos con la creación de la API. Utilizando xampp, creé una carpeta dentro de htdocs y dentro de ésta descargué un framework llamado Flight, el cual es un framework que permite simplificar la codificación. Luego hice una base de datos sencilla, la cual puede insertar los alumnos. ','2023-08-10'),(6634,281,'Dia 20','Hoy solo vinimos 2 integrantes del grupo pero igual pienso que avanzamos bastante, realizamos la página de producto colocando las imágenes de cada uno y la descripción.\r\nTambién “terminamos” la página de contacto, ya que solo faltaba colocar la imagen png de tik tok, ahora solo nos falta crear una cuenta de este de nuestro emprendimiento.\r\nY por último hicimos una maqueta de  cómo serían los productos en oferta, ya que nos pareció una gran idea incorporar este tipo de descuentos en la página.\r\n','2023-08-10'),(6635,277,'Vigésima segunda clase','Hoy continué la página web de LiliFy rehaciendo lo que hice la última clase ya que se me freezeo la PC y perdí todo mi progreso, lo único que hice fue agregar dos páginas extras para el apartado de productos, donde se visualizan nueve elementos por página, además logramos imprimir nuestra primera figura y la expusimos como objeto destacado de LiliFy.\r\nLuego de esto, y a partir de hoy, me metieron a un proyecto el cual todavía no se ni el nombre ni lo que tengo que hacer, pero es algo de Generación T, el cuál voy a estar dándole prioridad por encima de LiliFy, aunque planeo seguir su desarrollo. Por otro lado, estuve estudiando React para este nuevo proyecto, al principio iba a ver unos videos preparados por un profesor, pero como pesaban mucho decidimos que iba a utilizar los cursos gratuitos de FreeCodeCamp.\r\nHice los primeros cuatro ejercicios ya que empecé bastante tarde, pero detalle en otro documento todo lo que me enseñaron con mucho cuidado, además de que planeo seguirlo incluso fuera de horario de clase, ya que parece que no tenemos mucho tiempo para terminar este proyecto y creo que me van a explotar.','2023-08-10'),(6636,283,'Espero aprobar o me mato','El dia de hoy llegamos al aula y contemple que mis compañeros estaban sin hacer nada en el aula por lo cual decidi cambiarme con otro compañero de grupo. Comenzamos a pensar que le podíamos decir a nuestro profesor para poder cambiarnos de grupo. tomamos coraje y decidimos decirle nuestra situacion, el profesor entendio nuestra situacion por lo cual nos dejo ver que grupo nos podremos cambiarnos. Luego de ver que grupos se adecuaban a nuestros requisitos, elegimos estar en el grupo que esta conformado por victoria, carolina, lucho, geraldine y maximo. ellos nos contaron q estaban un poco apretados con el tiempo y que no encontraban satisfaccion al seguir con el proyecto este. asi que con nosotros dos recien incorporados pasamos a dar ideas y pensar en que podíamos ayudar en el grupo. lo q hicimos es seguir con la misma idea de la pagina de recetas y cambiar el diseño u otras cosas mas. Seguiremos con el grupo este, esperamos mejorar y ayudar.','2023-08-10'),(6637,293,'diagrama de entidad relación','hoy día avance con el diagrama de entidad relación que anteriormente estaba haciendo por el gran cambio de la base de datos','2023-08-10'),(6638,276,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Primero que nada, hemos tratado de empezar a configurar los forms en la parte de los pasoso de compra para así poder empezar a realizar la transacción de dinero de modo que podamos configurar esto y hacerlo funcional. Hasta el momento hemos configurado el paso 1 y 2, el 3 estaría a medias, pues aun queda implementar el método de pago para que este mismo funcione correctamente, ya sea por tarjeta de crédito, debito o mercado pago. Por el momento, solamente configuramos la recepción de datos, tanto como los datos del comprador, su domicilio y demas, aunque obviamente faltaría configurarla y desarrollarla mucho mas, lo cula veremos mas adelante.\r\n- Por otro lado, hemos realizado un par mas de inserts para comprobar si funcionan las demas pestañas de las secciones, donde se encuentran específicamente los producto relacionados a la sección seleccionada. De este modo realizamos cierto insert con las medias, habiendo implementado mejor ello. Únicamente faltaría hacer mas inserts para tener mas productos y agregarlos en las demás secciones. También seria necesario implementar otra tabla para la compra que se realizara, pero eso lo veremos mas adelante. \r\n\r\nEso fue todo por hoy. \r\n','2023-08-10'),(6639,295,'Cambio de proyecto','En el día de hoy nos informó nuestra scrum que ya no íbamos a formar parte de la elaboración del proyecto que teníamos en PP con mi compañero aparte de los demás ya que ahora formábamos parte de un nuevo proyecto que tiene como duración tres meses. Gracias a este cambio hoy debíamos empezar a investigar que tendríamos que hacer con mi compañero en el área que nos toco. Empezamos con la investigación del lenguaje React.','2023-08-10'),(6640,291,'10-08-2023','Este dia me dedique a realizar varias cosas, lamentablemente la daily no pudo hacerse por la ausencia de los integrantes de mi grupo, durante toda la clase me dedique a investigar desde cero como realizar una pagina de ventas y todo lo que se necesita para llevarla a cabo, investigue cuál es la forma más óptima y viable para que se acomode a todo tipo de dispositivos como seria la PC y el teléfono, investigue y compare distintas páginas de ventas unas con las otras para ver la forma más cómoda y sencilla para estos dispositivos.\r\nTambién busque distintos videos que explicaban el código de las páginas que ellos realizaron para tomarlos como ejemplos y tener una mayor idea de como realizar la pagina que estoy mentalizando.','2023-08-10'),(6641,286,'Comienzo del Nuevo Proyecto de Generación T','En el día de la fecha, comenzamos con la investigación necesaria para realizar el proyecto. Lo primero que hicimos fue buscar tutoriales que expliquen que es una API, y que también expliquen como crear una con PHP. En paralelo, junto con el resto de mis compañeros del equipo, pensamos la base de datos que utilizaríamos para la página de la creación de bitácoras. Luego, continuamos con la creación de la API. Utilizando xampp, creé una carpeta dentro de htdocs y dentro de ésta descargué un framework llamado Flight, el cual es un framework que permite simplificar la codificación. Luego hice una base de datos sencilla, la cual puede insertar los alumnos. ','2023-08-10'),(6642,275,'Mejoras en el diagrama de caso de uso y mas','Hoy de nuevo me encargue de la revisión y documentación de lo que ya llevamos haciendo en el trabajo, hoy tuvimos un pequeño inconveniente, Kevin llego a avanzar el trabajo pero lo hizo en casa y no se lo mando a el mismo así que tuvimos que replicarlo en clase,pero sacando eso hoy también avanzamos mucho en el trabajo de hoy, seguimos teniendo que ver lo del tema de la facturación, hoy revise los diagramas (El GANTT por ahora lo va a dejar como esta hasta que avancemos mas o hagamos algo mas importante) pero también quise mejorar el diagrama de caso de uso, el cual ya lo tenia hecho practicante, con su documentación y todo pero quise mejorarlo y adaptarlo mas a nuestro trabajo actual, por lo general hoy trabajamos todo el día(excepto cuando vino nuestra preceptora a hablarnos de materias que teníamos adeudadas o cuando se nos corto el internet)','2023-08-10'),(6643,284,'27','en el dia de hoy me uni al grupo de la Generacion T , estuve interiorisandome en el tema sobre API´S y Swagger , para poder documentar todo sobre el proyecto , \r\nhoy arranque con el diagrama de  caso de uso  del proyecto , faltan bastantes mas pero tengo otros 2 compañeros con los que estamos en tema de diagramas que me ayudan.','2023-08-10'),(6644,287,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Primero que nada, hemos tratado de empezar a configurar los forms en la parte de los pasoso de compra para así poder empezar a realizar la transacción de dinero de modo que podamos configurar esto y hacerlo funcional. Hasta el momento hemos configurado el paso 1 y 2, el 3 estaría a medias, pues aun queda implementar el método de pago para que este mismo funcione correctamente, ya sea por tarjeta de crédito, debito o mercado pago. Por el momento, solamente configuramos la recepción de datos, tanto como los datos del comprador, su domicilio y demás, aunque obviamente faltaría configurarla y desarrollarla mucho mas, lo cual veremos mas adelante.\r\n- Por otro lado, hemos realizado un par mas de inserts para comprobar si funcionan las demás pestañas de las secciones, donde se encuentran específicamente los producto relacionados a la sección seleccionada. De este modo realizamos cierto insert con las medias, habiendo implementado mejor ello. Únicamente faltaría hacer mas inserts para tener mas productos y agregarlos en las demás secciones. También seria necesario implementar otra tabla para la compra que se realizara, pero eso lo veremos mas adelante. \r\n\r\nEso fue todo por hoy. \r\n','2023-08-10'),(6645,296,'Bitacora 21','Hoy termine de hacer la interfaz de crear cuenta y empecé con la parte de ingresar productos y retirar,pero después un compañero me dijo para realizar los diagramas junto a 2 compañeros más sobre un nuevo proyecto el cual trata sobre bitacoras','2023-08-10'),(6646,289,'Dia 10-08','El día de hoy, hemos dejado un poco de lado el proyecto anterior para darle una remodelación. Ademas que dos de nuestros compañeros se han ido por un tiempo a otro proyecto para que vengan Ciro y Alan. Hicimos un nuevo trello ademas de hablar sobre como seria nuestro proyecto y un nuevo boceto. Eso es todo por hoy, muchas gracias. ','2023-08-10'),(6647,280,'','El dia de hoy hubo cambios en la estructura del equipo. Se nos unieron 2 compañeros al proyecto y 2 de nuestros compañeros iniciales, estaran de baja en el mismo durante 2 meses aproximadamente. Ante todos los contratiempos que presentamos en el proyecto actual, decidimos cambiarlo. La idea ahora es hacer una app de recetas que tambien tenga un apartado nutricional. Lo que en un principio solo mostraria las recetas, te proveerá la informacion sobre la comida en general y puede otorgarte planes para llevar una vida diaria mas saludable en distintos ambitos. Esto teniendo en cuenta tus proporciones corporales. Todo esto se le integrara el uso de php y react para poder agilizar el proceso de diseño de la pagina y la app para movil creando mas rapido las interfaces a usar','2023-08-10'),(6648,278,'Clase N°27 10/08/23','En el día de hoy aprendí a utilizar swagger , para documentar la API que estamos realizando en el nuevo proyecto de Generación T. Comencé a realizar el DER y mis compañero Luca realizo el diagrama de Caso de uso y Amir el de Flujo de datos.\r\n\r\nEstos son los diagramas que tenemos que realizar : \r\ncaso de uso\r\ncaso de uso extendido\r\nGANTT\r\nKANBAN\r\nMANUAL DE USUARIO\r\nMANUAL DEPLOYER\r\nDIAGRAMA DE CLASE (si hay objetos)\r\nDFD\r\nDER\r\nPresentación\r\nDiccionario de datos\r\nSwagger\r\n\r\nYo hoy como ya mencione realice el DER y comencé con una clase del diagrama de clases.\r\nCon respecto a swagger vi un video en YouTube que la verdad lo entendí bastante rápido, espero la próxima clase poder implementarlo.\r\n','2023-08-10'),(6649,279,'Dia 21 del  Proyecto','En todo el día mis compañeros de grupo estuvieron trabajando en otro proyecto que fue asignados a ellos haciendo que quede yo solo para hacer el proyecto nuestro.','2023-08-10'),(6650,273,'Clase 10-08-2023','En el día de la fecha me dediqué a realizar y discutir sobre cómo se harían el proyecto de StreamBe, en especial el que tenemos encargado de una plataforma de bitácoras para una empresa de usuarios. Primero, discutimos sobre cómo sería la base de datos, las tablas que se realizarían y demás. Empecé realizando una tabla de bitacoras, o &quot;logs&quot; en inglés, que después podría estar sujeta a cambios. A su vez, nos pasaron una tabla de sql de usuarios hecha por los alumnos de la otra división, la cual decidimos no tocar. Luego, empecé a realizar la base de datos en sql, que era de logs y contenía distintos campos importantes para la bitacora, y también hice un prototipado de la tabla de usuarios. A su vez, también realice dos stored procedures: addLogs y addUsers. Para añadir usuarios, se pedían distintos campos también, pero para esto también se necesita transformar la contraseña en MD5. A su vez, también tengo que hacer una función en Java que convierta un string a MD5 y sirva para comparar ambos strings de sql y el hecho en java. Luego, empecé a realizar las clases en Java que era Log y contenía distintos atributos de la bitácora. Hice el método constructor que no recibe ningún parámetro y también hice los getters and setters de estos respectivamente. ','2023-08-10'),(6651,294,'Investigacion de proyecto nuevo','En el día de la fecha nuestra Scrum Victoria nos comento a mi y a mi compañera que ahora pertenecíamos a un nuevo proyecto ademas de el que pertenecíamos que tiene como duración dos meses de trabajo. Esto implicaba que hagamos una reforma completa de nuestra forma de estudio y nos dijeron que debíamos investigar junto a mi compañera el lenguaje REACT. Empezamos con eso hoy ademas de que adquirimos un poco de conocimientos de lo que es una API.','2023-08-10'),(6652,285,'Día 28','¿Qué logré hacer hoy?\r\n\r\nHoy me dediqué de lleno a la creación de una página web, y aunque solo pude completar una página, siento que va bastante bien. El proyecto se llama RealCook, y trabajamos en la creación de dos logos utilizando herramientas de inteligencia artificial.\r\n\r\nLa verdad es que esta página ha sido mucho más sencilla de diseñar en comparación con la anterior, la de Ystoriya. El diseño principal (main) es más simple y directo, lo que me da confianza de que la codificación será más fácil y no me tomará tanto tiempo y esfuerzo.\r\n\r\n¿En qué se me complicó?\r\n\r\nAfortunadamente, no tuve mayores complicaciones hoy. Todo fluyó de manera relativamente sencilla, y aunque solo logré completar una página, siento que estoy avanzando bien y que el proceso está siendo más llevadero que en proyectos anteriores.\r\n\r\n¿Qué estuve investigando?\r\n\r\nA lo largo del día, estuve investigando cómo optimizar el diseño web para que sea más sencillo de codificar sin perder calidad en la apariencia visual. Busqué recursos y consejos sobre la creación de logos utilizando inteligencia artificial, lo que resultó en los dos logos para RealCook. También revisé ejemplos de páginas web con diseños simples pero efectivos para inspirarme en el diseño del main de RealCook.\r\n\r\nAdemás, revisé herramientas y recursos que podrían agilizar la fase de codificación, como librerías de CSS y herramientas de desarrollo web. Aunque este proyecto parece menos complicado, siempre es importante mantenerme actualizado y aprender de nuevas técnicas y herramientas que puedan hacer mi trabajo más eficiente y efectivo. En general, el día fue productivo y estoy emocionado por cómo está tomando forma la página web RealCook.','2023-08-11'),(6653,292,'investigación api php','en el día de la fecha ya que Enzo  nos dijo que tenía que esperar a tener el prototipo de la página web, nos dijo que viéramos cómo hacer una pi desde cero otra vez.\r\n     Para esto se le ocurrió fijarse en freecodecamp, que es una página que usamos en otra materia con la que hacemos una certificación de javascript. buscó por la pagina y habia una certificación para el desarrollo de back end y de apis \r\n   Con la ayuda de mi compañero Manuel Filippa tratamos de hacer el primer ejercicio cosa que se nos complicó mucho(enzo me dijo que iba a llegar a hacer toda la certificación y que cualquier cosa lo seguía otro pero no pude ni terminar el primer ejercicio) ya que no lo podíamos hacer lo llamamos a enzo luego del receso para ver si sabía como resolverlo. cosa que no pudo ya que nos fijamos en github algunas posibles soluciones y nada de esto resultó, nos acercamos un poco ya que la pagina donde teníamos que poner el link de la página com el ejercicio resultó no tiraba error de que faltara algo pero tiraba error de tiempo, que era mucho por lo que no sabiamos que mas hacer ni si era de la página o del código\r\n      Esta es la página externa que nos decía en freecode camp en la que debían hacer el ejercicio, al principio no entendíamos nada de cómo se debía hacer y eso se mantuvo por casi toda la clase hasta que llegó enzo y nos explico un poco por encima sobre cómo era su funcionamiento.\r\n','2023-08-11'),(6654,274,'Investigación sobre APIs, modificación Base de Datos','En el día de la fecha lo que hice fue continuar viendo tutoriales acerca de como hacer una API. Continué mirando el tutorial que había mirado el día de ayer pero me dí cuenta de que seguía sin saber cual era la funcionalidad de una API. Me dí cuenta de esto ya que visualicé otro video acerca de como realizar una API y cual era su función, pero eran tratados otros temas que no había visto en el video anterior, ni en ninguna página. Fue por esto que decidí buscar cursos acerca de APIs y encontré uno de Google. Pero el contenido del curso no estaba demasiado relacionado a lo que debía realizar.','2023-08-11'),(6655,283,'gracias wili x habilitar la bitacora','El dia de hoy conformamos un grupo mejorado de alta calidad. llegue, salude a mis compañeros. y luego pase a ayudarlos con su respectivo trabajo a cada uno. por que ese es mi trabajo de scrum . a alan le designe seguir con el prototipo en figma y a carolina le di la tarea de seguir con la base de datos. maxi se la paso averiguando como seguir con la base de datos y como encontrar busquedas aleatorias. ','2023-08-11'),(6656,282,'Proyecto Generacion T','Durante esta jornada realizar varias tareas Relacionadas al proyecto de generación T.\r\nIntente realizar un prototipado el cuál no resultado y dialogue acerca los diagramas con Geronimo Estigarribia y recomendé cursos de FreeCodeCamp respecto a Backend, Api\'s, React y Redux para que consigan obtener los conocimientos necesarios para realizar el proyecto.','2023-08-11'),(6657,279,'Dia 22 del Proyecto','En este día pues la verdad mis compañeros de grupo siguieron con su trabajo con otro que les fue asignado así que quede yo con el proyecto haciendo la daily.','2023-08-11'),(6658,273,'Bitacora N° 27 - Clase 11/08/2023','\r\nHoy llegué y me puse a realizar las distintas funciones que servirían para convertir cosas dentro de Java que posteriormente serían utilizadas en los controladores de la página. Por su parte, un conversor de string a MD5, que este resultaod después se compararía con el MD5 de la base de datos, y también realicé un conversor de horario, donde se mete un horario determinado a Java y este lo convierte a un string que después se introducirá a la base de datos. Luego, empecé a revisar distintos proyectos de Spring que me compartió el profesor y estos tenían algunos errores, así que quedo pendiente a la resolución de estos problemas para empezar a realizar la codificación del proyecto.','2023-08-11'),(6659,291,'11-08-2023','Este dia continúe con mi investigación sobre el desarrollo y todo aquello que una pagina de ventas necesita para funcionar y prosperar correctamente, hoy aprendí como realizar las carts que contienen los productos y el carrito para guardar los productos que deseas, el video que mire como guía explicaba como usar html, css y js para la creación de la página, este video explicaba una basta cantidad de comando y su funcionamiento haciéndolo una guía agradable y entretenida.\r\nEste dia aprendí bastantes cosas para poder hacer mi página de ventas o también si quiero cambiar de idea tengo suficiente conocimiento para poder crear alguna otra página.','2023-08-11'),(6660,276,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Seguimos trabajando en el diseño de la pagina web, esta vez completando la parte de l Paso de Compra 3, agregandole los campos faltantes a la opción de tarjeta de crédito, aunque aun falta configurar las demás opciones de tarjeta de debito y de mercado pago para que muestres los campos determinados a cada opción, pero eso lo trabajaremos mas adelante. Hasta el momento hemos agregado un tipo de seleccionador en el que podrán seleccionar el tipo de tarjeta, ya sea MasterCard, Visa, etc., numero de la tarjeta, las cuotas con las que decidirá pagar, código de seguridad, nombre y apellido de la tarjeta con la que se pagara, la fecha de vencimiento, y por ultimo el DNI del dueño de la tarjeta. Aunque no esta totalmente terminada, por lo que lo veremos mas adelante. \r\n\r\nEso fue todo lo realizado por hoy.','2023-08-11'),(6661,288,'Clase 25','El día de la fecha nuestro compañero Federico Andres Tolivia nos ha abandonado por temas de estudiar otra materia que desconocemos totalmente. Mientras mi compañero Guerrero Joseph y yo terminamos de realizar el diseño de nuestras cards en la pagina principal, las cuales estarán en oferta, tambien pusimos letra verde y faltaria acomodar el espaciado entre las cards.','2023-08-11'),(6662,280,'','En el dia de hoy avanzamos por el lado del frontend y haciendo cambios en la estructura de la base de datos. Esto debido a que el mismo sistema que estamos empleando no nos permitia generar las consultas teniendo en cuenta la cantidad de cada uno de los ingredientes utilizados. Para arreglarlo decidimos utilizar la tabla de las recetas que contienen cada una de las cantidades y luego filtrarlas por el sql utilizando un join y un rand lo cual nos devolveria de manera aleatoria recetas que contengan esa misma cantidad de ingredientes','2023-08-11'),(6663,298,'Clase 26','Hoy empezamos a hacer la bdd de las recetas, incluyendo recetas fáciles, rápidas y con pocos ingredientes. También empezamos con la nueva página.','2023-08-11'),(6664,286,'Investigación sobre APIS','En el día de la fecha ya que Enzo  nos dijo que tenía que esperar a tener el prototipo de la página web, nos dijo que viéramos cómo hacer una pi desde cero otra vez.\r\n     Para esto se le ocurrió fijarse en freeCodeCamp, que es una página que usamos en otra materia con la que hacemos una certificación de JS. Buscó por la página y había una certificación para el desarrollo de backend y de apis \r\n   Con la ayuda de mi compañero Ezequiel Ledesma tratamos de hacer el primer ejercicio cosa que se nos complicó mucho (Enzo me dijo que iba a llegar a hacer toda la certificación y que cualquier cosa lo seguía otro pero no pude ni terminar el primer ejercicio) ya que no lo podíamos hacer lo llamamos a Enzo luego del receso para ver si sabía cómo resolverlo. cosa que no pudo ya que nos fijamos en GitHub algunas posibles soluciones y nada de esto resultó, nos acercamos un poco ya que la pagina donde teníamos que poner el link de la página con el ejercicio resultó no tiraba error de que faltara algo pero tiraba error de tiempo, que era mucho por lo que no sabíamos que más hacer ni si era de la página o del código\r\n      Esta es la página externa que nos decía en freeCodeCamp en la que debían hacer el ejercicio, al principio no entendíamos nada de cómo se debía hacer y eso se mantuvo por casi toda la clase hasta que llegó Enzo y nos explicó un poco por encima sobre cómo era su funcionamiento.\r\n','2023-08-11'),(6665,293,'revisando el diagrama de entidad de relación','hoy estuve revisando y modificando parte de el diagrama aun no esta terminado se sigue con esto\r\n','2023-08-11'),(6666,277,'Vigésima tercer clase','El día de hoy estuve a full con el proyecto de Generación T, mi tarea ahora es aprender React mediante FreeCodeCamp y estuve haciendo bastante progreso, empecé en el ejercicio 4 y ahora mismo me encuentro en el 19.\r\nMe estuvieron enseñando a comentar, a como renderizar con ReactDOM, que es una API parecida a un motor gráfico, algunas diferencias entre JSX y HTML, como que las tags en HTML se abren y cierran con algunas excepciones, como puede ser &lt;br&gt;, mientras que en JSX se cierran todas sin excepciones, &lt;br /&gt;.\r\nTambién estuve viendo funciones y componentes compuestos, además de clases, que son bastante parecidas a las de Java, tienen herencias de otros componentes y usan un método constructor super() para ‘traer’ los props de sus clases parientes. Estos props también se definen dentro de las clases hijas y se puede definir un tipo por defecto con la función .defaultProps.\r\nPor último, para obligar a que un prop sea de un tipo determinado, ya sean números, letras, o arrays, se puede usar .propTypes, se escribe declarando el prop que vamos a usar, .propTypes y luego el tipo que queremos.\r\n','2023-08-11'),(6667,275,'11-08-2023','Pues nuevamente hoy me sentre mas que nada en el tema de los diagramas y si estaban terminados correctamente, ten bien hoye me sentre mas que nada en el tema de la documentacion del caso de uso por ahora quedo masomenos asiCaso de Uso \r\nLu’s shop \r\nActores\r\nCliente, Vendedor \r\nResumen \r\nUn cliente quiere comprar ropa, entre otros artículos en línea, para eso el vendedor crea un página web donde venderlas y registrar las ventas. \r\nPropósito \r\nVender ropa \r\nPrecondiciones \r\nEl cliente tiene que haber iniciado sesión, el cliente no debe haber solicita un producto.\r\n                                                                      Flujo de eventos \r\nAcciones de actores \r\nAcciones de sistema \r\nEl cliente solicita el producto al vendedor \r\n1.El sistema le solicita al vendedor iniciar sesión en el sistema \r\nEl vendedor verifica si el producto está o no disponible. \r\n2. El sistema le da una respuesta al vendedor sobre la disponibilidad del producto solicitado\r\nEl vendedor le informa al cliente sobre la disponibilidad del producto deseado \r\n        \r\nEl cliente pide el producto \r\n       \r\nEl vendedor abre el menú de ventas en el sistema  \r\n      5.El sistema muestra la interfaz gráfica                        para iniciar la venta \r\nEl vendedor ingresa los datos de la venta: Datos del cliente (Nombre, Apellido, DNI). Detalle de la venta y tipo de pago.  \r\n      6.El sistema verifica los datos ingresados por el vendedor para realizar la venta. \r\n\r\n\r\nEl sistema emite un comprobante de pago \r\nEl vendedor entrega el comprobante de pago \r\n\r\ntenia una versión anterior a esta pero se elimino \r\n\r\n\r\n\r\n','2023-08-11'),(6668,287,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Base de Datos - Conexión','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Seguimos trabajando en el diseño de la pagina web, esta vez completando la parte de l Paso de Compra 3, agregandole los campos faltantes a la opción de tarjeta de crédito, aunque aun falta configurar las demás opciones de tarjeta de debito y de mercado pago para que muestres los campos determinados a cada opción, pero eso lo trabajaremos mas adelante. Hasta el momento hemos agregado un tipo de seleccionador en el que podrán seleccionar el tipo de tarjeta, ya sea MasterCard, Visa, etc., numero de la tarjeta, las cuotas con las que decidirá pagar, código de seguridad, nombre y apellido de la tarjeta con la que se pagara, la fecha de vencimiento, y por ultimo el DNI del dueño de la tarjeta. Aunque no esta totalmente terminada, por lo que lo veremos mas adelante. \r\n\r\nEso fue todo lo realizado por hoy.','2023-08-11'),(6669,278,'Clase N°28 11/08/23','Hoy comencé con los diagramas , tuve que editar el diagrama de entidad relacion , ya que , hubo que rehacer la Base de datos. Avance con el diagrama pero no llegue a terminarlo , me faltaron algunas tablas.Las tablas que realice fueron: vacaciones , employer, proyecto, área y bitácora. También ayude a mi compañero Enzo que estaba comenzando a realizar realizar el prototipado rápido.','2023-08-11'),(6670,281,'Dia 21','El día de hoy estuvimos trabajando nuevamente solo 2 personas del grupo, Matias Ruiz y yo, nuestro compañero Federico Tolivia vino pero está realizando otro proyecto actualmente y por eso no pudo estar con nosotros. Igualmente realizamos solo una cosa la cual fue: buscar otro diseño de las tarjetas ya que nos parecía monótono tener el mismo estilo en las dos páginas. También acordamos que habrian solo 3 ofertas de los productos y que irían rotando aleatoriamente cada semana.','2023-08-11'),(6671,294,'Realización de ejercicios','En el dia de hoy estuvimos con el seguimiento de la investigación/ejercicios del lenguaje REACT junto a mi compañera. Hicimos bastantes ejercicios en la página FREECODECAMP referidos al tema y algunos estuvieron faciles y otros no pero se pudo hacer sin proyblemas ya que se encontraba toda la informacion requerida.','2023-08-11'),(6672,296,'Bitacora 22','Hoy continúe con un diagrama de flujo de datos el cual logré terminar y también ayude a un compañero a realizar el diagrama de caso de uso','2023-08-11'),(6673,295,'Ejercicios React','Hoy estuve con mi compañero terminando de investigar un poco lo que seria la parte del lenguaje de REACT. Al final utilizamos como método de estudio de dicho idioma la pagina Freecodecamp que sirve para guiarte en bastantes lenguajes de programación. Entonces en el dia de hoy realizamos unos cuantos ejercicios para ejercitar sobre dicho lenguaje.\r\n','2023-08-11'),(6674,252,'Clase 36 - 15/08/2023','El día de ayer cree la rama backend_swaggerUserRoutes para poder trabajar ahí la documentación de la api sin afectar las ramas de mis compañeros. Ayer cree un archivo .js llamado swagger para instalar swagger y