blado del circuito del robot junto con el código ','2023-08-16'),(6695,270,'16/08/23','El día de hoy comenzamos organizando el grupo para investigar sobre como conectar la base de datos finalmente, lográndolo, ademas de aplicar el funcionamiento que seleccione una pregunta random de la base de datos de una temática en especifico, imprimiendo esta en la pared del escenario &quot;temática&quot; en el entorno de Unity.','2023-08-16'),(6696,269,'16-08-2023','Hoy, día miércoles 16-08-2023 continúe con el curso práctico de react','2023-08-16'),(6697,250,'miercoles 16/8','estuve trabajando en la api de google drive del proyecto de desarrollo de sistemas','2023-08-16'),(6698,271,'16/08/23','En el día de la fecha con el grupo nos encargamos que entre todos investiguemos como conectar la base de datos para poder finalizar esa parte, y luego investigar sobre la función que seleccione una pregunta de manera aleatoria. Finalizando estas 2 tareas','2023-08-16'),(6699,255,'miercoles 16/8','hoy estuve ajustando las flexbox del index optamos por borrar todo el css y hacerlo denuevo','2023-08-16'),(6700,253,'Miércoles 16/07/2023 - API FullCalendar y corrección de vista','Hoy investigué un poco más sobre la API de FullCalendar para ya comenzar con su desarrollo. También estuve viendo la vista del login que había hecho la semana pasada y corregí un par de cosas que no me gustaban.','2023-08-16'),(6701,256,'16/8/23 Side Bar','Estuve haciendo la barra lateral de la pagina principal','2023-08-16'),(6702,254,'16/8/23','seguí con el iniciar sesión de la pagina ','2023-08-16'),(6703,262,'16/8/2023','El dia de hoy realizamos cambios en el login y su responsive. Luego comenzamos con el full calendar ','2023-08-16'),(6704,251,'BeCation - Generación T pt3 - 16/08/2023','El día de hoy reestructuré todos los DAOs de acuerdo a la nueva BDD. También hice lo mismo con el controlador de Vacaciones y finalmente creé un método capaz de conseguir toda la información de un empleado mediante muchos (muchos