ño de mi compañero eran un tanto cambiantes, logramos avanzar. Trabajamos en la creación de dos nuevas páginas para el sitio. Realicé algunos ajustes en el encabezado, moviendo elementos al costado para mejorar su apariencia. Además, agregamos tarjetas interactivas que contendrán recetas y redirigirán a los usuarios a otras páginas para más detalles. Una adición divertida fue la incorporación de una imagen de Maxi disfrutando de una hamburguesa, que le da un toque personal al sitio. ¡Un saludo amistoso cerró nuestra jornada!\r\n\r\n¿En qué se me complicó?\r\n\r\nDurante el día, encontré ciertas complicaciones al tratar de satisfacer las preferencias cambiantes de diseño de mi colega. Aunque esto agregó un nivel de iteración extra, pudimos superarlo y llegar a un diseño que nos satisfizo a ambos.\r\n\r\n¿Qué estuve investigando?\r\n\r\nEn el transcurso del día, estuve investigando cómo implementar efectivamente elementos visuales en la página web. Investigué técnicas para crear tarjetas interactivas y cómo enlazarlas con otras páginas para brindar una experiencia de usuario fluida. También me sumergí en la optimización de imágenes para la web, para asegurarnos de que la foto de Maxi luciera nítida y se cargara rápidamente.\r\n\r\nPor otro lado, comencé a investigar sobre las mejores prácticas para el desarrollo del encabezado en una página web. A medida que mi colega Victoria Laura inicia este proceso, quiero asegurarme de tener un entendimiento sólido para poder contribuir de manera efectiva cuando sea necesario. Estamos emocionados por las próximas etapas del proyecto.','2023-08-17'),(6714,284,'Bitácora 28','hoy empece con el caso de uso especializado para el proyecto  de generacion T sobre las bitácoras , y tambien tuve que modificar el caso de uso , sobre el tema de los recursos humanos , creo que voy a tener que hacer otro aparte o agregarlo al caso de uso que ya tenemos.','2023-08-17'),(6715,295,'Continuacion de react','En el día de la fecha con mi compañero estuvimos haciendo lo que sería lo mismo de la semana pasada que era realizar y poder llegar a finalizar los ejercicios que corresponden al curso de React en la pagina freeCodeCamp, estos mismos nos iban a ayudar porque el proyecto que debemos llevar a cabo íbamos a necesitar tener conocimientos de este lenguaje. Logramos llegar al ejercicio 14 y aprendimos nuevas cosas.','2023-08-17'),(6716,281,'Dia 22','El día de hoy apenas llegué a la clase abrí el proyecto que tenemos en github y me fije en los problemas que teníamos pendientes, entonces vi que en las páginas de los productos no se veía la imagen del perrito(Nuestro logo momentáneo). Entonces me puse mano a la obra para arreglar eso. \r\nDespués termine de hacer la sección de ofertas, puse los otros 2 productos que acordamos que estarían en oferta.\r\nY por último charlamos con Federico Tolivia, el único integrante del grupo que vino hoy, sobre cómo vamos a tener una sección en la página donde organizaremos los productos según 3 secciones: Anime, Series, Juegos.','2023-08-17'),(6717,286,'Carpeta de Campo y ejercicios de freeCodeCamp','El día de la fecha comenzó normalmente, abrí todas las aplicaciones que iba a usar, inicié sesión en mis cuentas, descargué los archivos necesarios y me puse a trabajar.\r\n     Debido a que en el día de hoy, el Scrum Master Enzo Bartoletti y parte del grupo de trabajo para el proyecto de Streambe no se encontraba presente, decidí trabajar en mí mismo, poniéndome al día con la carpeta de campo, revisando las bitácoras hechas los días anteriores en encuentrotecnologico.com.ar y copiándolas en este documento form para más tarde explayar de una forma que se entienda y explique al 100% lo que hice en el día. De 101 hojas pasé a 107 con los únicos dos días que tenía por colocar.\r\n     Más tarde decidí retomar el curso “Back End Development and APIs” de freeCodeCamp que había dejado los anteriores días. Intenté hacer el ejercicio para por lo menos avanzar un poco, empecé desde cero pero el resultado fue el mismo, no pude completar el desafío.\r\n     Probé todas los nombres que se me ocurrían para ponerle a “author” pero no hubo caso, probé el nombre que me daba de ejemplo la página del ejercicio, probé poner mi nombre normal, mi nombre de usuario, de todo, pero no hubo caso, por lo que decidí recurrir a la sección de “Obtén un consejo”. En dicha sección, el mismo freeCodeCamp te da la solución en caso de que no puedas dar con esta, pero aún intentando copiar al pié de la letra la solución, no hubo caso. \r\n      Más tarde intenté ver lo que escribía la gente que intentaba hacer el ejercicio para ver si encontraba a personas que tenían el mismo error que yo, por lo que ví que 8310 personas le habían pasado lo mismo que a mí y a mi compañero Ezequiel Ledesma. Me puse a leer las ayudas que pedían las personas para poder realizar el ejercicio y las respuestas a esas ayudas, pero aunque seguí al pié de la letra las soluciones que algunas personas proponían, el problema seguía persistiendo.\r\n     A pesar de recibir instrucciones de un líder, no pude resolver el ejercicio.\r\n','2023-08-17'),(6718,278,'Clase N°29 17/08/23','En el día de la fecha continúe con el diagrama de entidad relación. Termine de realizar las tablas , solo me tocaba relacionarlas , relacione algunas pero otras no pude, entonces le pedí ayuda al profesor y me envió otra base de datos con las claves primarias y foráneas ya escritas, ya que, la anterior base de datos no las tenia. La intente agregar a PHPMyAdmin pero me daba error en algunas tablas y sus claves foráneas , así que le pedí ayuda a mi compañero Forte. Luego de eso pude relacionar algunas tablas que faltaban , pero tengo que corregir otras así que no pude terminarlo hoy.','2023-08-17'),(6719,277,'Vigésima cuarta clase','El día de hoy estuve siguiendo los ejercicios de React, más concretamente desde el 20 hasta el 29. Estuve aprendiendo el uso del State, uno de los temas más importantes en React, que consiste en cualquier dato que tu aplicación necesite conocer y que pueda cambiar con el tiempo, se puede renderizar, heredarse a clases hijas y puede ser tan complejo o simple como nos convenga. Una vez definido, se puede mostrar visualmente donde nos convenga, a esto se le llama renderizar.\r\nTambién se pueden guardar estos States en funciones, para luego realizar cálculos sobre estas u otras acciones. Usualmente el State se inicializa en el constructor, pero también hay una forma de cambiarlo en el componente, React cuenta con un método para actualizar el State llamado setState. Este método dentro de su clase se llama this.setState(), pasando un objeto con pares clave-valor. Las claves son tus propiedades de estado y los valores son datos de estado actualizados.\r\nAdemás de configurar y actualizar el State, también aprendí a definir métodos para los componentes de una clase. Un método de clase normalmente necesita usar la palabra clave this para que pueda acceder a las propiedades de la clase dentro del ámbito del método. Una forma común es enlazar el this en el constructor para que se vincule a los métodos de clase cuando el componente es inicializado.\r\nOtro punto a tener en cuenta es que React puede procesar múltiples actualizaciones de manera asíncrona, osea, al mismo tiempo. Esto significa que no podes confiar en el valor anterior de this.state o this.props al calcular el siguiente valor, por lo tanto no podes sumarlos ni restarlos. En su lugar, hay que usar una función del setState que te permita acceder al state y a los props, esta función garantiza que estés trabajando con los valores más actuales del state y del props.\r\nCon estos conocimientos logré hacer un contador simple donde hay tres botones, uno que suma uno, otro que resta uno y un último que resetea a cero, debajo de los botones hay un texto con el número en cuestión.\r\n','2023-08-17'),(6720,274,'Creación de APIs, investigación sobre React','En el día de la fecha, lo primero que hice fue buscar videos que expliquen de manera sencilla cómo realizar una API para el registro de usuarios. Encontré un video donde se explicaba como realizar eso en PHP. Pero me dí cuenta de que todavía no habpiamos definido en qué lenguaje ibamos a crear las APIs. Luego busqué en YouTube videos acerca de cómo iniciar con React, que es una librería de JavaScript que permite un desarrollo mucho más sencillo de páginas web.  En el video se mostraba cómo se podían crear variables en JavaScript e imprimirlas con mayor facilidad en un archivo html. Un compañero de mi equipo se estaba encargando de la base de datos del proyecto, pero al exportar la base de datos que ya contenía los tipos de datos correctos y las claves foraneas definidas, aparecía un error. Me consultó cuál podía ser el error que salía, y el mismo era que las claves foráneas de la primera tabla estaban mal definidas. Esto se debía a que las tablas estaban ordenadas de manera errónea, por lo que en la primera tabla habían valores de las claves foráneas que aún no estaban definidos.','2023-08-17'),(6721,293,'Diagrama','hoy día continúe con el diagrama de entidad relacional aun no esta terminada por que falta agregar mas cosas a la base de datos por eso hasta entonces esta incompleto.','2023-08-17'),(6722,276,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Conexión','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- El día de hoy seguimos trabajando un poco en base al Paso de Compra 3, habiendo de cierta forma terminado de configurar la sección de pago con tarjeta de crédito y debito, quedando pendiente la de mercado pago. Por otro lado, hemos realizado una pequeña actualización de algunos elementos de la pagina web.\r\n\r\nEso fue todo por hoy. ','2023-08-17'),(6723,289,'17/08','El día de hoy hemos seguido con el figma(osea el boceto), luego que he realizado la pagina(la parte del menú en el costado). Eso ha sido todo por hoy,gracias. ','2023-08-17'),(6724,294,'React - FreeCodeCamp','En el día de hoy seguimos mas de lo mismo de la semana pasada que fue avanzar con los ejercicios de freeCodeCamp referidos al lenguaje React que vamos a requerir aprenderlo ya que lo necesitaremos para el proyecto aparte que estamos armando. Logramos pasar mas del ejercicio 10 y aprendimos con mi compañera cosas nuevas que no sabíamos para que servían.\r\n\r\n','2023-08-17'),(6725,287,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Conexión','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- El día de hoy seguimos trabajando un poco en base al Paso de Compra 3, habiendo de cierta forma terminado de configurar la sección de pago con tarjeta de crédito y debito, quedando pendiente la de mercado pago. Por otro lado, hemos realizado una pequeña actualización de algunos elementos de la pagina web.\r\n\r\nEso fue todo por hoy. ','2023-08-17'),(6726,292,'completar carpeta de campo','Ya en el dia de hoy me puse a hacer únicamente la carpeta de campo porque tenía ganas de hacerla y porque además quiero llegar a la 150 hojas, casi no llegaba pero para el final de la clase logre llegar, escribí sobre la cuenta de instagram que no había mencionado nunca y me puse a corregir desde la página 120 porque estaban hechas asi nomas y no iban a pasar un control de calidad por lo que me puse a corregirlas, cosa que me llevo varias horas y mucho desgaste mental. no solo tenía que mover hojas sino también completar escribir cosas para que no quede vacío','2023-08-17'),(6727,273,'Bitacora N° 28 - 17/08/23','En el día de la fecha empecé a realizar un proyecto de Spring desde 0, el cual serviría de base para la creación de la aplicación REST-API que debo realizar. También, tuve algunos errores al querer compilar el proyecto, que luego resolví. Finalizando, empecé a realizar el mapeo de las clases JPA.','2023-08-17'),(6728,273,'Clase N° 29 - 18/08/23','Hoy realicé las clases Controller, Service, Repository y Models que sirven para interactúar dentro de Spring. Dentro de cada una tuve que realizar distintos métodos, que ya se encontraban importados desde Spring. De esta forma, podía empezar a interactúar con el código que realicé, pero a la hora de hacer la prueba no me dejaba entrar al directorio donde estaba el controlador.','2023-08-18'),(6729,274,'Reunión, versionado de APIs','El día de hoy nos reunimos todos los integrantes del grupo para que uno de los integrantes nos explique lo que había hablado previamente con uno de los docentes involucrados en el proyecto. Nos explicó acerca de las APIs que teníamos que crear para llevar a cabo el proyecto y que haríamos cada uno. Tras la reunión, lo que hice fue investigar en Google y en YouTube acerca de cómo versionar las APIs. También discutimos acerca de qué lenguaje utilizaríamos para realizarla, aunque nos dimos cuenta de que todos los grupos lo estabamos realizando en lenguajes distintos.','2023-08-18'),(6730,281,'Dia 23','El día de hoy no tuvimos mucho tiempo para realizar demasiado trabajo pero igualmente estuvimos buscando ideas de como hacer la página del producto en sí, encontramos una plantilla muy buena en la que podemos basarnos y de ahí agregarla al proyecto de Lilify.','2023-08-18'),(6731,283,'hola hermo','Hoy como siempre llegamos al colegio con la mayoria de chicos y dividimos lo q tenemos q hacer, terminamos el figma y empezamos la pagina. supuestamente se unio otro integrante mas al equipo pero seguramente no. este dia tuvimos poco tiempo pero vamos cada vez mejor. Ahora solo nos falta termina la base de datos y las paginas para luego unirlo con php. ','2023-08-18'),(6732,278,'Clase N°30 18/08/23','En el día de la fecha la primer tarea que hice fue terminar el diagrama entidad relación , aunque después , me comunicaron que los chicos del turno mañana ya lo tenían hecho así que el mio no lo íbamos a usar.Entonces comencé a realizar el KANBAN y lo termine.Luego tuvimos una reunión con el equipo en la cual se hablo para ver como iba cada parte del proyecto.Por ultimo estuvimos revisando la Base de datos , ya que, nos seguía dando error las claves foráneas, seguimos sin poder solucionarlo.','2023-08-18'),(6733,285,'Día 30','¿Qué logré hacer hoy?\r\n\r\nHoy he estado enfocado en el diseño continuo de las páginas utilizando la herramienta Figma. Avancé en la creación de varias páginas clave para el proyecto. He completado las páginas de inicio de sesión, así como la página de presentación de recetas. En esta última, me aseguré de diseñar una interfaz atractiva que muestre las fotos de las recetas proporcionadas por nuestros usuarios. Además, trabajé en la implementación de carrouseles en diferentes secciones de la página para mejorar la experiencia visual. También diseñé la página individual de receta, donde he dispuesto cuidadosamente la información esencial: nombre, foto, descripción y los pasos detallados a seguir para replicar la receta.\r\n\r\n¿En qué se me complicó?\r\n\r\nEn realidad, no he enfrentado mayores complicaciones durante el día. El proceso de diseño en Figma ha sido bastante fluido y las ideas se han plasmado según lo planeado. No obstante, siempre estoy atento a posibles obstáculos que puedan surgir en el proceso de desarrollo.\r\n\r\n¿Qué estuve investigando?\r\n\r\nDurante el día, no hubo una investigación significativa. Principalmente, he estado aplicando mis habilidades de diseño en Figma para dar vida a las diferentes páginas. Sin embargo, mantuve una comunicación constante con Vicky, quien está a cargo de la programación. Intercambiamos ideas y avances para asegurarnos de que el diseño se adapte sin problemas a la implementación en el desarrollo web. Estoy preparado para la próxima clase, donde me uniré a Vicky en la programación y continuaremos trabajando en equipo para llevar este proyecto a buen término.','2023-08-18'),(6734,289,'18/08','El dia de hoy, seguimos con la pagina. Mientras que mis compañeros seguian con el figma, yo me dedique a continuar con la pagina web con compañia de Caro, eso es todo por hoy,muchas gracias.','2023-08-18'),(6735,288,'Clase 26','El día de hoy nuevamente nos abandonó nuestro compañero Federico Tolivia, este no está participando mucho actualmente pero ya nos ha ayudado mucho anteriormente y en el futuro nos ayudará aún más, es más, tenemos una tarea pendiente para él. \r\nCon mi compañero Joseph Guerrero pudimos buscar ejemplos de pagina para utilizar al tocar el botón “Agregar Al Carrito”, y te lleve al apartado donde puedas ver el producto.','2023-08-18'),(6736,292,'carpeta de campo',' En el dia de la fecha llegue al aula correspondiente de prácticas profesionalizantes (que es otra distinta a la de los jueves)  estuve un rato hablando con mis compañeros Manuel Filippa y Christian Forte sobre el proyecto, esperando a que llegue Enzo ya que él nos diría que es lo que debíamos hacer(esto tomó gran parte de la jornada de hoy, exactamente hasta después del receso) luego del receso enzo me llamo ya que debíamos ir con un profesor para consultar una línea de código que tengo en un proyecto de otra materia(encripta las contraseñas) y debíamos preguntarle al profesor si esta línea de código nos servía para el proyecto que estamos haciendo de streambe/generación t. pero no pudimos preguntarle ya que al buscarlo nos dijeron que se había ido. \r\n\r\n     Luego enzo convocó una reunión para todos los miembros totales de este proyecto ya que somos varios e hizo una puesta en común indicando que debíamos hacer cada uno, manu, chris y yo todavía no tendríamos nada que hacer, tenemos que esperar a que se terminen las demás tareas como hacer una base de datos antes de que sigamos con la creación de las Apis para la página. Se nos dijo que tendríamos que hacer 3 Apis las cuales debían ser de usuario, una de bitácora y otra de proyecto, estas 3 únicamente con Apis (pueden variar hasta ser 4/5).\r\n','2023-08-18'),(6737,276,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Conexión','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas: \r\n\r\n- El dia de hoy seguimos trabajando en base la pagina web. No hemos realizado mucho mas a parte de cambiar algunos diseños de la pagina web, tales como las cards con los productos que se encuentran dentro de la pagina web, algunos toques dentro de la pestaña del producto y demas. Tambien planteamos el cambiar un aspecto dentro de la pestaña del carrito, pues pensamos configurar este mismo para determinar con algun tipo de select si el envio sera a domicilio o retiro al local, y que esto le cobre un monto determinado o sea gratis en algun caso y eso se sume al total a cobrar luego al realizar la transaccion.\r\n\r\nEso fue todo lo realizado el dia de hoy. ','2023-08-18'),(6738,279,'Dia 23 del Proyecto','Mis compañeros siguieron un poco continuando el otro proyecto asignado siendo de la generación T.','2023-08-18'),(6739,293,'revisar diagrama ','hoy día me dedique a revisar algunos diagramas por el tema de las base de datos y aun se sigue trabajando en eso.\r\n','2023-08-18'),(6740,275,'Revision diagrama de camino critico','18/08/2023\r\n\r\nHoy nuevamente me estuve dedicando a los diagramas, aun que Kevin también nos pidió a Sáez y a mi que si pudiéramos hiciéramos una base de datos para la que seria el sistema de pagos en una pagina web.\r\nHoy me dedique mas que nada a lo que seria el diagrama de Camino Critico, resumiendo mucho un diagrama critico es  es una técnica que te permite identificar las tareas necesarias para finalizar un proyecto y determinar cierta flexibilidad en el cronograma. Una ruta crítica en la gestión de proyectos es la secuencia más larga de actividades que deben finalizarse a tiempo para completar todo el proyecto. Cualquier retraso en las tareas críticas provocará el retraso del resto del proyecto.\r\n  ','2023-08-18'),(6741,286,'Charla con el Scrum Master','En el día de la fecha llegue al aula correspondiente de Prácticas Profesionalizantes (que es otra distinta a la de los jueves) estuve un rato hablando con mis compañeros Ezequiel Ledesma y Christian Forte sobre el proyecto, esperando a que llegue Enzo, nuestro Scrum Master ya que él nos diría que es lo que debíamos hacer (esto tomo gran parte de la jornada de hoy, exactamente hasta después del receso). Pero no pudimos preguntarle ya que al buscarlo nos dijeron que se había ido. Luego Enzo convoco una reunión para todos los miembros totales de este proyecto de Streambe ya que somos como 10 integrantes, e hizo una puesta en común indicando que debíamos hacer cada uno, Ezequiel, Christian y yo todavía no tendríamos nada que hacer, tenemos que esperar a que se terminen las demás tareas como hacer una base de datos antes de que sigamos con la creación de las Apis para la página. Se nos dijo que tendríamos que hacer 3 Apis las cuales debían ser de usuario, una de bitácora y otra de proyecto, estas 3 únicamente con Apis (pueden varias hasta ser 4/5). Luego de eso, nos quedamos sin tiempo y terminó la clase.','2023-08-18'),(6742,296,'Bitácora 23','Hoy comencé la especificación de caso su uso pero tuvimos una mini reunion con el equipo y nos dijeron nuevas cosas,asi que fui cambiando un par de cosas del caso de uso y del DFD','2023-08-18'),(6743,277,'Vigésimo quinto clase','Hoy estuve adelantando el trabajo de Generación T, finalmente me explicaron sobre que trata el proyecto, este siendo una página web para el guardado de bitácoras durante un trabajo en equipo. Una página donde se inicia sesión pero no se crea una cuenta, esta la crean los administradores desde adentro, y que solo se puede interactuar si la cuenta es activada por alguien de mayor rango.\r\nPor ahora estuve intentando llevar lo aprendido de React en FreeCodeCamp a algo más práctico, vamos a estar utilizando NextUI que es una librería de React para hacernos la vida más fácil, su funcionamiento es parecido a la librería de Bootstrap de HTML y hará más ameno el trabajo. \r\nEn eso estuve por la página oficial de React intentando crear un archivo, primero estuve viendo que hay dos formas de usar React, una completamente en este lenguaje y otra mediante HTML, no se cuales son las diferencias y no se cual deberia elegir pero por ahora estoy probando ambas, en HTML parece algo complicado ya que el código se extiende e incluso cambia ligeramente, pero no se como utilizar solo React sin dependencias por el momento.\r\n','2023-08-18'),(6744,287,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Conexión','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas: \r\n\r\n- El dia de hoy seguimos trabajando en base la pagina web. No hemos realizado mucho mas a parte de cambiar algunos diseños de la pagina web, tales como las cards con los productos que se encuentran dentro de la pagina web, algunos toques dentro de la pestaña del producto y demas. Tambien planteamos el cambiar un aspecto dentro de la pestaña del carrito, pues pensamos configurar este mismo para determinar con algun tipo de select si el envio sera a domicilio o retiro al local, y que esto le cobre un monto determinado o sea gratis en algun caso y eso se sume al total a cobrar luego al realizar la transaccion.\r\n\r\nEso fue todo lo realizado el dia de hoy. ','2023-08-18'),(6745,295,'Proyecto generacion T','El día de hoy tuvimos una charla en grupo con el que es nuestro nuevo grupo, el cual tenemos para la realización del proyecto de generación T, esta charla fue para que nuestro compañero de grupo nos explique bien como íbamos a desarrollar el proyecto y que íbamos a tener que hacer cada uno. ','2023-08-18'),(6746,294,'Organización de proyecto generación T','En el día de la fecha, nuestro compañero de grupo de generación T, realizo una charla para explicarnos al grupo  como íbamos a empezar con el proyecto, ya que hasta ahora lo único que habíamos hecho, junto con mi compañera, era hacer el curso de React, entonces nos explico de manera mas detallada como iba a ser cada cosa y nos asigno un trabajo a cada integrante del grupo.\r\n ','2023-08-18'),(6747,282,'Reunion con colegas','En el dia de hoy trabajé arduamentre en lograr que mis colegas trabajen de la manera mas correcta posible.\r\nMe focalicé en seguir ultimando detalles para posteriormente contarles a todos los integrantes del grupo respecto a como proseguir en las interfaces y las api\'s','2023-08-18'),(6748,298,'Clase 27','Hoy estuvimos haciendo la página con Vicky mientras los chicos hacían el figma','2023-08-18'),(6749,251,'BeCation - Generación T pt4 - 22/08/2023','El día de hoy revisé el código de la semana pasada y ayude a Dylan con algunos métodos faltantes en employerDAO','2023-08-22'),(6750,260,'','Estuve agregando algunas funcionalidades y haciendo pruebas con la libreria de fullcallendar','2023-08-22'),(6751,267,'22/08/2023','Hoy continuamos con el armado del robot SUMO, agregamos el sensor ultrasonido e hicimos un código para testear las ruedas que según la tecla que toques es la dirección que lleva','2023-08-22'),(6752,262,'22/8/2023','El dia de hoy comence con una vista del calendar de Requisitos de Datos para reservar vacaciones, lamentablmente la pc se congelo dos veces y no llegue a comitear lo realizado','2023-08-22'),(6753,254,'22/8/2023','termine el iniciar sesion y registrarse','2023-08-22'),(6754,270,'22/08/23','el día de hoy edité el código de php para que la base de datos devuelva una pregunta random junto con sus 4 respuestas posibles','2023-08-22'),(6755,269,'22/8','Hoy continúe con el curso de react','2023-08-22'),(6756,265,'22-08-2023','Hoy arme con mis compañeros el circuito y arreglamos algunas partes del código incluyendo el sensor de ultrasonido ','2023-08-22'),(6757,268,'22-08-2023','El dia de hoy conectamos el motor utra sonido con los motores para que avanse cuanto tenga un objetivo serca y ademas en los motores hicimos controles para avanzar retroceder y girar por izquierda y por derecha atravez del teclado.','2023-08-22'),(6758,263,'22/8','Hoy avance mucho, termine de hacer el tema de los huesos y si todo sale bien ahora si por fin le voy a poder hacer una animación o importarle una animación.','2023-08-22'),(6759,261,'22/08/2023','Hoy trabaje con el circuito del robot sumo, hoy pudimos controlar los motores con el teclado.','2023-08-22'),(6760,258,'22-8-2023','Hoy estube esperando a fenoglio que temrine de una vez la escuela\r\n','2023-08-22'),(6761,266,'22 estuve terminando el employer controller add','estuve avansando un monton con este endopoint, costo bastante ya que tenia que correguir muchas cosas, pero finalmente funciona','2023-08-22'),(6762,271,'22/08/23','En el dia de hoy editamos el codigo de php para que devuelva las 4 respuestas','2023-08-22'),(6763,257,'22/08/2023','Hoy hicimos la mayor parte de la entrada del colegio y recupere mí contraseña ','2023-08-22'),(6764,256,'22/8/23 pagina web','Segui con la pagina web','2023-08-22'),(6765,253,'Martes 22/08/2023 - React','Hoy modifiqué el login que había hecho sin bootstrap.','2023-08-22'),(6766,252,'Clase 38 - Documentación Usuarios','El día de hoy resolví el problema de que swagger me pedía un token de autorización para ver la documentación de los usuarios. Al final lo quebhice fue borrar de todas las rutas el authmiddleware y con eso se resolvió todo. Además de mostrar los usuarios, también hice que en la documentación de swagger puedas agregar usuarios y hoy agregué uno como prueba','2023-08-22'),(6767,250,'martes 22/8','hoy no me sentí muy bien y descansé.','2023-08-22'),(6768,255,'Martes 22/8','estuve diseñando la pagina de las recetas.','2023-08-22'),(6769,282,'Tareas GS1','Hoy finalmente. tras mas de cuatro días, me suministraron tareas de la empresa tanto Lucas Sosa como Tomas Sainato, siendo que ahora en tan solo una jornada laboral de cuatro horas me encuentro completamente saturado de tareas para realizar, teniendo tanto (en segundo plano) el Out de Cencosud referente a Febrero y (en primer plano) volver a revisar los recortes hechos en mi primera tarea dada al entrar a la empresa.','2023-08-22'),(6770,303,'22-08-2023','Modificamos el codigo para la funcionalidad del videojuego.','2023-08-22'),(6771,282,'Recortes VLA','Hoy fue un día saturante y caótico, donde las tareas que debía realizar en el archivo respecto a marcas y recortes no quedaban claras y por cada asunto solucionado surgían nuevas problemáticas aún más complejas. No encontrábamos principalmente el modo de hacer coincidir tanto la cantidad de marcas como la cantidad de recortes para lograr que ambas dieran exactamente el mismo número ni así mismo lográbamos descifrar el criterio a utilizar para realizar recortes. Siendo así, decidimos mantener los recortes del mismo modo que la marca, por lo tanto logramos 1751 filas idénticas, multiplicadas por 2 (recortes) y permitiendo así que estas se suban a la herramienta de una manera tal que esta no tire errores al realizar la carga de los datos.','2023-08-23'),(6772,263,'23/8','Hoy lamentablemente no pude avanzar mucho mas, me pare en seco debido a que importar una animacion es mas complicado de lo que yo creia, pero aun asi avance bastante y aprendi bastantes cosas','2023-08-23'),(6773,252,'Clase 39 - Swagger Create new user','El dia de hoy terminé de documentar la parte de &quot;Add User&quot;. Hice una vista con Swagger UI que me muestre los usuarios creados y también permita crear usuarios de prueba. En Swagger UI se muestra cada usuario creado o &quot;posteado&quot; como un JSON.','2023-08-23'),(6774,251,'BeCation - Generación T pt5 - 23/08/2023','El día de hoy creé las rutas y controladores de Rol y Area y luego probamos con Dylan los controladores. Quedan muchas cosas que corregir respectos al middleware y a algunos métodos del controlador de vacaciones','2023-08-23'),(6775,262,'23/8/2023','El dia de hoy implente el full calendar al visual studio para comenzar a trabajar en unas de las vistas del proyecto StreamBe, implente algunos plugins, los cuales son: FullCalendar/Core, FullCalendar/React, FullCalendar/DayGrid','2023-08-23'),(6776,254,'23/08/23','Sigo corrigiendo errores del login','2023-08-23'),(6777,270,'23/08/23','el día de hoy continué con el código tanto de php como de C# del videojuego y logré que la pregunta se imprima en textos separados en relaciona a sus respuestas para acomodar cada una de estas en una puerta en el escenario, ademas de que estas se actualizan a una random cada vez que se ejecuta el videojuego.','2023-08-23'),(6778,260,'','Despues de leer mas la documentacion de fullCalendar pude ver como tratar el responsive, para adaptar mejor el calendario a pantallas tamaño celular, y tambien supe como hacer la customización CSS para cambiar el aspecto de algunos componentes de la UI.','2023-08-23'),(6779,253,'Miércoles 23/08/2023 - React','Hoy terminé por fin con el login del proyecto nuevo que nos dieron.','2023-08-23'),(6780,250,'miercoles 23/8','hoy estuve arreglando la barra superior con ayuda de taro','2023-08-23'),(6781,255,'miercoles 23/8','hoy humille de forma atroz y despiadada a lucio en un codigo de css','2023-08-23'),(6782,257,'23/08/2023','Hoy avanzamos el patio del colegio, la entrada y la conexión para online ','2023-08-23'),(6783,268,'23-08-2023','El dia de hoy mi grupo y yo untamos todos los codigos de los componentes del robot.','2023-08-23'),(6784,258,'23-08','Hoy estuve haciendo un modo ( o mejor dicho testeando para que funcionara el multijugador)','2023-08-23'),(6785,261,'23/08/2023','El dia de hoy mi grupo y yo untamos todos los codigos de los componentes del robot.','2023-08-23'),(6786,266,'Avance y revision del backend de becation','Hoy con nicolas estuvimos avanzando mucho eh incluso ya juntamos las ramas y empezamos a testear todo lo que hicimos, tambien marcamos muchas cosas que jhay que mejorar, pero dentro de todo, fue un dia muy producitivo y falta cada vez menos para terminar','2023-08-23'),(6787,267,'23-08-2023','El dia de hoy mi grupo y yo untamos todos los codigos de los componentes del robot.','2023-08-23'),(6788,265,'23-08-2023','El dia de hoy estuvimos tratando de unir todos los códigos ','2023-08-23'),(6789,282,'nuevamente ninguna tarea por parte de GS1','Esta mañana trabajé remotamente para GS1, aún así debido a situaciones sucedidas en el día anterior me era imperioso esperar a que se me deleguen tareas, ya que antes de irme finalicé nuevamente el archivo de marcas y recortes (este se debía subir a la herramienta) el cual afectaría sustancialmente a mi trabajo en los out de Cencosud, facilitándome gran parte de los registros, ya automatizando parte de mis procesos de búsqueda y conversión de los datos. Por lo tanto, debía esperar a que se carguen mis datos a la herramienta para volver a recibir nuevamente mi archivo de Cencosud en el mes de enero.','2023-08-24'),(6790,281,'Dia 24','El dia de hoy estuve retocando bastante la parte de productos ya que no estaba muy ordenada del todo y además acordamos que sería mejor poner el precio en la página de productos, ya que si a alguien le interesa un producto ya podría ver el precio de este y después entrar a la página del producto en si y ahi ver la descripción y etc. Además trate de incluir el sistema de compra (carrito) pero no pude, pero ya hice un gran avance ya que encontré una gran base donde podemos sacar bastante información de como hacerlo.\r\nEspero que en las próximas clases podramos concretar esto y ya tener gran parte de la página terminada. Ya que a mi punto de vista es bastante importante tener la parte de compra funcional.\r\nY también hice una propuesta más en github que es para el tema del producto, que cuando pongas el cursor en la imagen puedas darle click y te mande a la página del producto en sí.\r\nTambién estuvimos avanzando un poco con la página del producto, acordamos poner 3 imágenes del producto, y que se le pueda hacer zoom a estas.\r\nPor último realizamos la creación de nuestra cuenta de Tik Tok asi logramos tener un mejor alcance.\r\n','2023-08-24'),(6791,281,'Dia 24','El dia de hoy estuve retocando bastante la parte de productos ya que no estaba muy ordenada del todo y además acordamos que sería mejor poner el precio en la página de productos, ya que si a alguien le interesa un producto ya podría ver el precio de este y después entrar a la página del producto en si y ahi ver la descripción y etc. Además trate de incluir el sistema de compra (carrito) pero no pude, pero ya hice un gran avance ya que encontré una gran base donde podemos sacar bastante información de como hacerlo.\r\nEspero que en las próximas clases podramos concretar esto y ya tener gran parte de la página terminada. Ya que a mi punto de vista es bastante importante tener la parte de compra funcional.\r\nY también hice una propuesta más en github que es para el tema del producto, que cuando pongas el cursor en la imagen puedas darle click y te mande a la página del producto en sí.\r\nTambién estuvimos avanzando un poco con la página del producto, acordamos poner 3 imágenes del producto, y que se le pueda hacer zoom a estas.\r\nPor último realizamos la creación de nuestra cuenta de Tik Tok asi logramos tener un mejor alcance.\r\n','2023-08-24'),(6792,288,'Clase 27','El día de la fecha avanzamos bastante nuestro proyecto, cada producto tiene su propio botón que nos redirige a su página respectiva, con sus fotos y lista para comprar. Agregamos fotos las cuales se puede zoomear, también título del producto, una Font especial para cada producto, la cual arreglaremos más tarde porque no funcionan, aunque la idea está. También incluirá la descripción del producto, el botón para agregar al carrito que nos llevará a los métodos de pago, tarjeta, efectivo, entre otras. Además de ese gran avance pudimos crear la cuenta oficial de LiliFy 3D, nos enorgullece mucho contar ya con una cuenta de Instagram y de Tik Tok, esperemos tengan éxito en las próximas semanas. El botón de cada una nos redirige a las páginas oficiales de Instagram y Tik Tok únicas de nuestro gran proyecto. Esperemos que el día de mañana podamos seguir adelante y continuar nuestro proyecto lo más pronto posible y con mucho esfuerzo.','2023-08-24'),(6793,286,'Breve continuación sobre Denuncias de BaVigila','En el día de la fecha ya que el Scrum Master había comentado que no asistiría a clase y tenía incongruencias con el proyecto de Generación T, por lo que ya abordado previamente con Enzo Bartoletti me puse a hacer los prototipos de los distintos casos de incidentes de la nueva interfaz de usuarios con mi compañero Ezequiel Ledesma, la cual contaba con seleccionar previamente un tipo de incidente y en ese caso al seleccionar uno de estos, te llevaría a una interfaz para poder describir con más detalle la situación. Para hacer esto conté con un poco de la ayuda de mi compañero mencionado anteriormente el cual me brindaba una mano mientras investigaba cómo hacer una API, cosa que tenía que hacer desde antes. Pudimos avanzar bastante con las interfaces ya que pudimos progresar/terminar con las siguientes secciones: Accidente Vehicular, Acoso, Disturbios y Accidente Peatonal. Además de las que ya completamos, nos estarían faltando unas cuantas más, hacer estas 4 nos llevó casi todo el día, debido a los distintos debates, discusiones y búsquedas por internet que hicimos con mi compañero.','2023-08-24'),(6794,278,'Clase N°31 24/08/23','En el día de hoy comencé pidiéndole a mi compañero Enzo que me envié el prototipado rápido que realizo sobre las paginas webs del proyecto de las bitácoras , para que yo las pase a digital.En total eran 6 vistas , 3 de Recursos Humanos y 3 del Jefe de Arreas. La parte de recursos humanos tiene la pagina principal , Crear Usuario y Habilitar usuario.Por la parte de Jefe de Área tiene la pagina principal , Crear Proyecto y Asignar Nuevos Usuarios. Realice todas las vistas en figma , aunque quedamos en corregir una parte de RRHH.','2023-08-24'),(6795,292,'prototipado interfaces ','en el dia de la fecha ya que enzo había avisado que no venía y no sabia como hacer el proyecto de generación t, por lo que ya abordado ´previamente con enzo me puse a hacer los prototipos de los distintos casos de incidentes de la nuev interfaz de usuarios, la cual contaba con seleccionar previamente un tipo de incidentes y en ese caso al seleccionar uno de estos, te llevaría a una interfaz más detallada sobre el incidente que se seleccionó. \r\n     para hacer esto conté con un poco de la ayuda de mi compañero Manuel Filippa el cual me brindaba una mano mientras investigaba cómo hacer una api, cosa que tenía que hacer desde antes. pudimos avanzar bastante con las interfaces ya que pudimos terminar con: accidente vehicular,acoso, disturbio, accidente peatonal \r\n      además de las que ya completamos nos estarían faltando unas cuantas mas, hacer estas 4 nos llevó casi todo el dia y lo tendríamos que terminar en otro momento \r\n','2023-08-24'),(6796,274,'Investigación versionado de APIs, prueba de API','En el día de la fecha, lo primero que hice fue seguir investigando acerca de como versionar una API. Tras haber entrado a cuatro páginas distintas y a un par de videos en YouTube, pude saber cómo realizar esto. Para versionar una API, se debía de crear una carpeta con el número de la nueva versión y dentro colocar los los archivos con las modificaciones. También se debe cambiar la dirección URL. Luego seguí investigando que era una API, ya que seguía sin comprender como funcionaban. Tras ver un par de videos, pude comprender como funcionaban. Una vez que entendí esto, me asignaron la tarea de hacer la API del apartado de proyectos. Lo que hice fue mirar un video que ya había visto antes, pero ahora con los conceptos un poco más claros. Intenté hacer lo que se hacía en el video pero utilizando la base de datos del proyecto, pero me dí cuenta de que no tendría sentido ya que todas las tablas estaban relacionadas entre sí, mientras que yo necesitaba usar una sola. Así que lo que hice fue realizar una prueba con una base de datos sencilla, en la cual se almacenan usuarios. Agregué cuatro usuarios y posteriormente hice un código para que los muestre en el archivo index en formato .json. ','2023-08-24'),(6797,285,'Día 31 - Tamaño Obelisco','¿Qué logré hacer hoy?\r\n\r\nHoy me enfoqué en mejorar el diseño de una página utilizando Figma. Pasé tiempo ajustando detalles para hacer el diseño más atractivo y funcional. Además, tuve una sesión de estudio sobre React junto a mi compañera Victoria Laura. Ella compartió una serie de videos conmigo, donde un experto introducía a React y realizaba demostraciones avanzadas de esta tecnología.\r\n\r\n¿En qué se me complicó?\r\n\r\nConfieso que enfrenté ciertas dificultades mientras aprendía React. Aunque Victoria Laura y los videos me ayudaron mucho, algunos conceptos resultaron un poco desafiantes. Sin embargo, sigo adelante con determinación para superar estos obstáculos.\r\n\r\n¿Qué estuve investigando?\r\n\r\nMi enfoque de investigación se centró en React. Me sumergí en los videos proporcionados por Victoria Laura para entender mejor los fundamentos de React y cómo se aplica en el desarrollo web. Investigué sobre las ventajas y desafíos de esta biblioteca JavaScript, y busqué recursos adicionales en línea para ampliar mis conocimientos.','2023-08-24'),(6798,276,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Conexión - CSS','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- El día de hoy hoy hemos considerado arreglar algo en el código de nuestra pagina de modo de que este sea algo mas limpio y dinámico, pues la mayoría de los elementos ingresados dentro de la paina web están definidas con styles en cada elemento lo que lo hace muy largo y algo complicado de entender. Por ende, hemos considerado empezar a pasar dichos estilos a un archivo CSS en el que podamos editarlo de manera mas tranquila y eso reduzca un poco el código que puede llegar a tener una sola pestaña. \r\n- Dado con el tema anterior, hemos considerado implementar la Media Queries dentro de nuestra pagina para que esta pueda adaptar los elementos de la pagina web, sus tamaños y demás en base a los tipos de pantallas en los que se ve, pues podría causar problemas que se vea diferente en otras pantallas a la que acostumbramos en la PC.\r\n\r\nEso fue todo lo realizado el día de hoy. ','2023-08-24'),(6799,289,'Clase 24-08','El dia de hoy, yo comence a trabajar con la pagina web, o bueno eso era la idea. Luego comenzamos con tener que comenzar con el curso de React por el hecho de que debemos utilizarlo en la realización de la pagina web.\r\nProseguimos a instalar React, y luego nos vimos en que debiamos aprender a utilizar React de algun lado, asi que el profesor nos paso unos videos de react().Tuve unos problemas para que me funcionara el codigo pero al final pude arreglarlos.\r\nLuego comenze a seguir los videos, y eso fue todo por hoy muchas gracias.','2023-08-24'),(6800,295,'Pagina Web - Generacion T','El día de hoy el integrante de mi grupo que estaba a cargo del prototipado de la pagina web, nos pasó a mi compañero y a mi el diseño de como lo teníamos que hacer, como tenia que quedar maso menos la pagina y empezamos a intentar hacer algo con la ayuda de Google para saber como instalar React, lo cual era con unas lineas de código en el cmd y después teníamos que crear la carpeta e importar los códigos que necesitábamos de la librería de React que nos recomendó un compañero de grupo la cual se llama &quot;MUI&quot;, pero se nos complicó  un poco que nos funcione los códigos que importábamos, ya que nos daba error y esperamos poder mañana resolverlo.','2023-08-24'),(6801,295,'Pagina Web - Generacion T','El día de hoy el integrante de mi grupo que estaba a cargo del prototipado de la pagina web, nos pasó a mi compañero y a mi el diseño de como lo teníamos que hacer, como tenia que quedar maso menos la pagina y empezamos a intentar hacer algo con la ayuda de Google para saber como instalar React, lo cual era con unas lineas de código en el cmd y después teníamos que crear la carpeta e importar los códigos que necesitábamos de la librería de React que nos recomendó un compañero de grupo la cual se llama &quot;MUI&quot;, pero se nos complicó  un poco que nos funcione los códigos que importábamos, ya que nos daba error y esperamos poder mañana resolverlo.','2023-08-24'),(6802,293,'diagrama','Hoy día estuve revisando y corrigiendo todo los diagramas por razones de que hubo mucho cambios últimamente se sigue trabajando en eso.\r\n ','2023-08-24'),(6803,293,'diagrama','Hoy día estuve revisando y corrigiendo todo los diagramas por razones de que hubo mucho cambios últimamente se sigue trabajando en eso.\r\n ','2023-08-24'),(6804,298,'Clase 28','Hoy continue con la bdd de ingredientes, agregué categorías para cada uno de los ingredientes y tuve algunos problemitas haciendo todo eso, luego voy a continuar con la bdd de recetas y seguramente haga todo de cero. (Miedo)','2023-08-24'),(6805,283,'Gualmayen','Hoy pudimos dividir las tareas e iniciar a hacerlas para luego darlas por finalizadas. Cuando recien llegamos di una tarea a cada uno de mis compañeros de equipo. por ejemplo a maximo le di la tarea de seguir con la base de datos y ayudar a los otros dos integrgrantes del equipo (Victoria y Alan). A estos dos les di la tarea de seguir con la pagina pero el tema es que para codear la pagina necesitamos usar react. ninguno de ellos dos saben usarlo por lo cuall yo con maxi nos pusimos a ayudarlos con esto. Luego de descargarlo los chicos empezaron un curso de react. cuando estos terminen este curso van a poder empezar a codear la pagina. Luego otra integrante qeu se decidio a venir... cof cof carolina. le di la tarea de finalizar la base de datos. Solo que tiene una condicion, si esta no termina la base de datos en tiempo y forma, se la quitaremos y se lo pondremos a otra persona y ella terminara los diagramas que quedan por hacer. Luego de que cada uno este con su tarea y haciendola, Creamos la daily. Este dai fue muy productivo. ','2023-08-24'),(6806,299,'Hoy','Hoy ya terminamos el trabajo y estuvimos recuperando el tiempo perdido','2023-08-24'),(6807,287,'Proyecto PP Lu´s Shop: &quot;VicSon&quot; - Codificación - Conexión - CSS','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- El día de hoy hoy hemos considerado arreglar algo en el código de nuestra pagina de modo de que este sea algo mas limpio y dinámico, pues la mayoría de los elementos ingresados dentro de la paina web están definidas con styles en cada elemento lo que lo hace muy largo y algo complicado de entender. Por ende, hemos considerado empezar a pasar dichos estilos a un archivo CSS en el que podamos editarlo de manera mas tranquila y eso reduzca un poco el código que puede llegar a tener una sola pestaña. \r\n- Dado con el tema anterior, hemos considerado implementar la Media Queries dentro de nuestra pagina para que esta pueda adaptar los elementos de la pagina web, sus tamaños y demás en base a los tipos de pantallas en los que se ve, pues podría causar problemas que se vea diferente en otras pantallas a la que acostumbramos en la PC.\r\n\r\nEso fue todo lo realizado el día de hoy. ','2023-08-24'),(6808,280,'','puse a ayudar a mis compañeros en la siguientes tareas:\r\nRealizando una guia y en paralelo un par de cursos sobre react para aplicarlo al proyecto para poder generar la interfaz interactiva y renderizada que nos puede proveer react. \r\nTambien investigamos sobre las librerias next.iu y mui.iu que las mismas aprendimos como instalarlas y el como funcionan las dependencias de cada una. El proceso de inclusion de codigo, aun esta en proceso.\r\nPor otra parte rediseñamos una parte de nuestra bd para incluir la categoria de los ingredientes para hacer un filtro de busqueda mas unico.\r\nAl margen de todo esto la guia de react aun esta realizandose y se planea terminar en la proxima semana todo el contenido basico para poder tenerlo a mano','2023-08-24'),(6809,279,'Dia 24 del proyecto','estuve haciendo la daily de hoy mirando que hacian mis compañeros ademas de ayudarlos en darles ideas para los prototipados nuevos para cuando haces una denuncia o incidente.','2023-08-24'),(6810,277,'Vigesimo sexta clase','El día de hoy estuve avanzando con el proyecto de Generación T, ya tenemos por suerte un boceto de las interfaces para las páginas. \r\nPrimero tenemos la de derechos humanos, ya sabemos que la página se divide en tres tipos distintos de cuentas que tienen acceso a distintas interfaces, RRHH tiene tres estados, el primero debe tener dos botones, uno para crear un usuario y otro para habilitarlos, la interfaz de crear usuario debe tener cuatro inputs, uno para el nombre, para el apellido, para el DNI y uno para el mail, además de un botón para envíar los datos a la base de datos. Por otro lado, la interfaz de habilitar usuarios debe ser una lista de todos los nombres y apellidos en vertical, acompañados por un botón que habilite o deshabilite las cuentas que se requieran.\r\n Además de derechos humanos, tenemos las interfaces del jefe de área, su página principal debe tener dos botones, uno para crear proyectos y otro para asignar usuarios a dichos proyectos. En la creación de proyectos debe tener cuatro inputs, uno para el nombre, dos para la fecha de inicio y final y una descripción, además de un recuadro para buscar participantes del proyecto. La parte de asignar usuarios sirve para habilitar a los ya asignados y asignar nuevos, tiene que tener un input donde ingresar en nombre del proyecto y debajo un recuadro para buscar usuarios que asignar, además de un botón para confirmar la acción.\r\nPor ahora lo que estuve haciendo es estudiar cómo utilizar React, estuve probando cosas por Visual Studio Code, creé una aplicación de React mediante el comando “npx create-react-app .” que crea toda una carpeta con muchos elementos, y luego usé el comando “npm start” para iniciar la simulación en el puerto local 3000.\r\nDe ahí estuve siguiendo un video tutorial de Youtube que me explicó con mucho detalle cómo utilizar React de forma eficiente y sin problemas, me descargue una extensión llamada ‘Simple React Snippets’ que sirve para facilitar la escritura de código agregando palabras claves que escriben automáticamente líneas de código que se utilizan con frecuencia.\r\nTambién estuve intentando implementar NextUI, una librería de React que sirve para embellecer las páginas de manera rápida y accesible, resulta que de rápida y accesible no tiene mucho ya que instalarlo fue un completo reto, más que no usarlo diría yo, pero mi jefe de área me pidió que lo use y ahora tengo que intentar desasnar su uso. Descargué la librería mediante el comando “npm i @nextui-org/react framer-motion”, pero luego de eso hay que descargar otra librería llamada Tailwind que tiene su propio tutorial de descarga, usando el comando “npm install -D tailwindcss” se descarga lo esencial para luego crear un archivo llamado ‘tailwind.config.js’ donde iría toda la configuración de tailwind.\r\nTailwind, al ser una librería externa que se puede utilizar por su cuenta, tiene una configuración predeterminada para estas situaciones, el problema es que NextUI utiliza su propia configuración y yo no me di cuenta de esto hasta más tarde, así que al principio recibía muchos errores sin entender la razón.\r\nLuego de configurarlo correctamente hay que añadir el ‘NextUIProvider’ al root del programa, por lo que entendí el root es la conexión entre el código y lo visual, es el envío de lo que escribo al body de un archivo HTML para mostrarlo gráficamente, el problema es que no se donde se encuentra este root y la página de NextUI no te dice cual es el nombre, estuve intentando distintas ideas pero ninguna funciono y todas terminaban en un error.\r\nPor eso, luego de un rato me rendí y decidí dejarlo para otro día, me dedique a aprender React normal y a probarlo un poco, tanto que llegue a hacer un contador mediante un botón a tiempo real, donde cada vez que apretabas el botón el contador subía y cuando le dabas al otro el contador bajaba.\r\n','2023-08-24'),(6811,296,'Bitacora 24','Hoy si empecé la especificación de caso de uso y pude terminarla y hice unos pequeños cambios en la DFD','2023-08-24'),(6812,273,'Clase N° 30 - 24/08/23','En el día de la fecha me dispuse a realizar distintos tests en spring, con lo que pude experimentar el cómo usarlo aunque tuve problemas con la implementación de hibernate.','2023-08-24'),(6813,294,'Comienzo de pagina - Generación T','Hoy estuvimos junto a mi compañera principalmente con la parte del comienzo de la pagina web que vamos a utilizar en el protecto. Estuvimos esperando tambien , el prototipado rápido que realizó mi compañero para poder llevar a cabo o tener una idea incial de como hacer la misma. Mientras esperabamos, descargamos React con las librerias en la pestaña del cmd. Lo ultimo que hicimos fue sacar bootstrap de React en una página llamada MUI IU en Google para poder armar alguna interfaz en nuestra página. Cosa que no resulto porque nos daba errores en sentido a las credenciales.','2023-08-24'),(6814,275,'Caso de uso colaboración y Secuencia ','Hoy nuevamente me designaron para hacer/rehacer los diagramas , en este caso hice los ya mencionados Caso de uso, colaboración y Secuencia, el diagrama de caso de uso es el diagrama que nos puede mostrar las interacciones entre el cliente usuario y sistema, el diagrama de colaboración es parecido a un diagrama de secuencia solo que este muestra la información de diferente forma,es el diagrama que como y en que orden todo lo que se hizo en el proyecto funciona en conjunto, lo que hice por el día de hoy fue revisar estos planos y ver cuales estaban hechos y terminados de manera correcta.   ','2023-08-24'),(6815,291,'24-08-2023','El día de hoy empeze la clase abriendo todo lo que tenia ya realizado para ver si tenia algún error y corregirlo, en el transcurso de la clase me la pase arreglando algunos errores que tenia, uno de ellos eran unas cards que servían para sostenes imágenes, el precio y el nombré del producto, el problema era que se estaban superponiendo uno con otro, después de investigar un rato pude arreglarlo, otro de los problemas que arregle fue de para que no se desconfigurara la pagina al hacer zoom y para qué se adapte al teléfono.','2023-08-24'),(6816,281,'Dia 25','El día de hoy realice algunas correcciones a la página de producto tales como incluir nuestra imagen del perrito en la parte de la pestaña y en la esquina de esta. \r\nAdemás arregle el estilo de la letra de la página de los 2 productos que tenemos hechos por ahora, es más que nada para tener un ejemplo de como hacerlo para nuestras siguientes implementaciones.\r\n Y por último le saque un pequeño espacio a la imagen del producto ya que nos parecía bastante tosco.','2023-08-25'),(6817,288,'Clase 28','El día de hoy pudimos solucionar el tema de las Fonts, letras de League of Legends y Genshin Impact que implementamos el día de ayer. También estuve investigando sobre cómo agregar el sistema de carrito, ya tenemos la idea y el archivo JS pero nos falta implementarlo en nuestro trabajo, entenderlo y poder adaptarlo a nuestra página web. También solucionamos el problema que teníamos en el icono de nuestra página web, al tocar “Agregar al Carrito”, la misma no salía, ahora ya sale normalmente. La próxima clase intentaré informarme mas sobre lo que es la implementación del archivo JS y que funcione el Carrito, terminar de diseñar cada “Agregar Al Carrito” que nos redirija a cada producto individualmente. Tenemos un arduo y duro trabajo por delante, y daremos como equipo lo mejor de nosotros para poder tener el trabajo realizado lo antes posible, adjunto imágenes del trabajo realizado hoy.','2023-08-25'),(6818,277,'Vigésima séptima clase','El día de hoy estuve trabajando en React, volví a descargar los archivos requeridos y esta vez los guarde en un pendrive para facilitar el guardado del programa, por ahora no es mucho problema pero cuando empiece con la página real va a ser de gran ayuda.\r\nEstuve probando distintos códigos, aprendí a hacer un input y a que escriba lo que que ingresa como un texto, además de agregar un botón y de importar componentes a un archivo principal.\r\n','2023-08-25'),(6819,284,'Bitácora 29','Terminé el caso de uso con algunas modificaciones nuevas que tuvimos que implementar y también finalizamos el caso de uso especializado,  estamos al tanto por si hay que agregar nuevas cosas por si perjudican los diagramas .','2023-08-25'),(6820,280,'','El dia de hoy continuamos con el aprnedizaje de react cambiando la resolucion inicial que tenia de la misma. En este caso se exploro como funciona la distribucion de las carpetas dentro del proyecto creado anteriormente y como afecta cada archivo a los demas archivos, hasta llegar al esqueleto que conforma la pagina.\r\nPor fuera de esto también exploramos una manera de expresar aproximados de valores nutricionales para cada comida teniendo en cuenta si la persona no incluye esos valores en la receta','2023-08-25'),(6821,296,'Bitácora 25','Hoy hicimos varios cambios en el caso y en la especificación de caso de uso ya que nos dijeron que tenía que haber una nueva entidad llamada responsable de proyecto','2023-08-25'),(6822,292,'interfaz de robo',' En el día de la fecha llegamos al aula de prácticas profesionalizantes, donde esperamos un rato a que Enzo pudiera ver las interfaces que hicimos el día anterior, pero debido a que tardaba mucho (porque estaba viendo cosas del proyecto de generación t) decidimos revisar las interfaces nosotros mismos (con mi compañero Manuel Filippa) de los cuales no hicimos ningún cambio en ninguna de las interfaces porque estábamos conformes.\r\n    Después del primer receso seguíamos esperando a Enzo pero seguía ocupado por lo que nos fijamos que interfaces faltaban para que hagamos. Las que faltaban eran: entradera, estafa, narcotráfico, robo, violencia de género y hurto.\r\n     Debatimos entre Manuel y yo qué debíamos hacer y llegamos a la conclusión de que entradera, estafa y narcotráfico no valían la pena de hacer ya que no tenían mucho sentido. Con la entradera no tiene lógica porque lo último que uno pensaría en esa situación sería enviar un reporte a BaVigila. Estafa tampoco ya que lo pensamos desde el lado de estafa virtual y no nos convencía. Y con narcotráfico  lo pensamos desde el lado de una casa tomada porque si ves a alguien vendiendo puede ser que nunca más lo vuelvas a ver y dudo que alguien tenga una plantación de drogas en el patio de su casa en capital.\r\n\r\n\r\n     Después de decidir no hacer estas interfaces seguimos con la de robo, la cual no la hicimos en serio y la hicimos escribiendo estereotipos de ladrones en modo de chiste, mientras hacíamos esto vino Enzo ya que lo habíamos llamado hace un rato, primero hablo un poco con chirs ya que él estaba haciendo lo de generación t y después siguió con nosotros, le mostramos un poco las interfaces hechas ayer para ver que pensaba y dijo que algunas estaban mal ubicadas o no se veían bien a la vista, cosa que él va a corregir. Le dijimos que habíamos decido no hacer algunas de las interfaces que le propuso y se enojó un poco ya que él creía que si son necesarias pero es algo que debemos debatir entre todos más adelante cuando se desocupen con lo de generación t.\r\n     Después de que se fuera seguimos un poco con la interfaz de robos pero la pudimos completar ya que nos habíamos quedado sin tiempo(voy a seguir con esta interfaz fuera del horario escolar) por lo que me puse a hacer la bitácora lo más rápido que pude mientras seguíamos tirando ideas de que completar en la interfaz de robo, pero estas cosas que íbamos diciendo no las aplicaba en la interfaz que vamos haciendo en la página web de trello, sino que eran ideas en el aire de las cual nos tendríamos que acordar en el momento que sigamos completándola.\r\n','2023-08-25'),(6823,278,'Clase N° 32 25/08/23','En el día de hoy trabajamos con el prototipado rápido que realice el día de ayer , corregimos algunos errores de diseño , el principal cambio fue en la parte de Responsable de área , ya que , agregamos un ítem desplazable el cual permite seleccionar el tipo de empleado(Empleado , RRHH , Responsable de proyecto , Jefe de Área o ninguno). También otro cambio que realizamos fue en la vista de RRHH , cambiamos los botones de Crear Usuario  y Habilitar Usuario.\r\n','2023-08-25'),(6824,286,'Breve continuación sobre Denuncias de BaVigila 2','En el día de la fecha llegamos al aula de Prácticas Profesionalizantes, donde esperamos un rato a que el Scrum Master pudiera ver las interfaces que hice el día anterior, pero debido a que tardaba mucho en llegar, decidí revisar las interfaces con mi compañero Ezequiel Ledesma de los cuales no hicimos ningún cambio en ninguna de las interfaces porque estábamos conformes.\r\nDespués del primer receso seguíamos esperando a Enzo Bartoletti pero seguía ocupado por lo que nos fijamos que interfaces faltaban para que hagamos. Las que faltan eran: Entradera, Estafa, Narcotráfico, Robo, Violencia de Género y Hurto. Debatí con mi compañero de trabajo sobre cuál debíamos hacer y llegamos a la conclusión de que Entradera, Estafa y Narcotráfico no valían la pena de hacer ya que no tenían mucho sentido. \r\n','2023-08-25'),(6825,283,'Feliz Cumple Alan','El dia de hoy llegue tarde al colegio porque tuve un inconveniente para llegar a tiempo al colegio. Pero de igual manera delegue las tareas a los chicos para que puedan comenzar a hacer sus tareas. Les dije q cuando lleguen hagan la daily y luego cada uno seguir con su respectiva tarea.\r\nAl llegar al colegio me fije que tarea iba a realizar cada uno y si la estaban realizando bien. Y ayude a realizar las recetas con cada uno de los ingredientes de la base de datos. Luego complete la carpeta de campo antes de olvidarme','2023-08-25'),(6826,282,'Jornada de avances en Generacion T','Durante el día de hoy trabajé en buscar la mayor cantidad de avances respecto al proyecto de Stramble, Generación T. Avanzando tanto en múltiples diagramas hechos por Amir Gómez y Luca Patiño, en intentar mejorar los prototipados online hechos por Gerónimo Estigarribia, revisando los conocimientos adquiridos por Federico Tolivia y analizando los aportes de Christian Forte respecto al versionado de API\'s','2023-08-25'),(6827,276,'Proyecto PP Lu´s Shop VicSon - Codificación - Conexión - CSS','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Hemos intentando empezar a implementar el Media Queries dentro de nuestra pagina web. Investigando, estas serian algo así como condiciones mediante las cuales, dependiendo del tamaño de la pantalla en donde se encuentre abierta la pagina web, se adaptaría a distintos diseños de modo que esta pueda ser mas dinámica y pueda adaptarse a las distintas pantallas en las que se podrían llegar a usar nuestro sitio web. Por el momento estamos configurando el tamaño en pantallas de 1024px de tamaño y adaptando los tamaños de los elementos a este mismo, aunque aun queda terminar el mismo.\r\n- Por otro lado, hemos considerado realizar cierto cambio en la navbar, únicamente para que esta tenga una funcionalidad que los elementos en esta misma se colapsen en una lista en la que luego se puedan seleccionar las mismas, esto pasando en caso de que la ventana se minimice o se haga mas pequeña y así no se distorsione entre si. \r\n\r\nEso fue todo lo realizado el día de hoy.','2023-08-25'),(6828,274,'API de proyectos','En el día de la fecha, uno de los compañeros de mi equipo me encargó la tarea de continuar realizando la API que se utilizará para el apartado de los proyectos. Volví a realizar el código debido a que me había olvidado de guardarlo la clase pasada. Una vez que hice esto, edité la tabla proyectos de la base de datos, además de no tomar en cuenta las otras tablas. Lo que hice fue eliminar las claves foráneas ya que de otra forma no me funcionaría la base de datos. Tras esto, intenté hacer un insert para que ','2023-08-25'),(6829,287,'Proyecto PP Lu´s Shop VicSon - Codificación - Conexión - CSS','\r\nEl día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Hemos intentando empezar a implementar el Media Queries dentro de nuestra pagina web. Investigando, estas serian algo así como condiciones mediante las cuales, dependiendo del tamaño de la pantalla en donde se encuentre abierta la pagina web, se adaptaría a distintos diseños de modo que esta pueda ser mas dinámica y pueda adaptarse a las distintas pantallas en las que se podrían llegar a usar nuestro sitio web. Por el momento estamos configurando el tamaño en pantallas de 1024px de tamaño y adaptando los tamaños de los elementos a este mismo, aunque aun queda terminar el mismo.\r\n- Por otro lado, hemos considerado realizar cierto cambio en la navbar, únicamente para que esta tenga una funcionalidad que los elementos en esta misma se colapsen en una lista en la que luego se puedan seleccionar las mismas, esto pasando en caso de que la ventana se minimice o se haga mas pequeña y así no se distorsione entre si. \r\n\r\nEso fue todo lo realizado el día de hoy.dia de hoy.','2023-08-25'),(6830,273,'Clase 31 - 25/08/23','En el día de hoy estuve corrigiendo errores que no me permitían hacer que la API pueda comunicarse de forma correcta con la base de datos. De esta forma, pude comprender que también podría usar los fundamentos de los servlets JSP dentro de Spring combinandolo con los componentes de este framework. ','2023-08-25'),(6831,299,'Hoy ','Hoy revisamos el proyecto ','2023-08-25'),(6832,293,'','','2023-08-25'),(6833,289,'Clase 25-08','El dia de hoy, luego de concurrir tarde a la escuela, por razón de que fui a la expoUntref. Luego de eso,al llegar continúe con la página web. Hice las tarjetas las cuales contendran recetas. Eso fue todo por hoy,muchas gracias!','2023-08-25'),(6834,298,'Clase 29','Hoy terminé la base de ingredientes agregando condimentos, luego cree la base de recetas, agregando todas las recetas que pueda de cada ingrediente.','2023-08-25'),(6835,294,'Instalación correcta de React y comienzo de interfaces','En el día de hoy con mi compañera pudimos corregir los errores de React que nos daba la clase pasada. Teníamos problemas con la organización de la carpeta que correspondía a la instalacion de React. Finalmente cuando se terminaba la clase, el profesor se dispuso a ayudarnos para poder resolver el problema que teníamos. Al final pudimos resolverlo y empezar un poco con la interfaz de la pagina aplicando tambien NextUI','2023-08-25'),(6836,295,'Correccion de errores React','En el dia de hoy intente solucionar con mi compañero el problema que tuvimos ayer con la instalacion de React, al usar NextUI, e importar algunos codigos de los componentes que queriamos usar, no lo lograbamos hacer hasta que llego el profesor casi terminando la clase y nos dio un par de aclaraciones y pudimos lograr la instalación correctamente y emepezar a crear una interfaz. ','2023-08-25'),(6837,282,'ninguna tarea por parte de GS1','Como tantas veces durante el mes de Agosto, no recibí prácticamente ningún tipo de tarea o comunicación por parte de la empresa, siendo que tan solo durante la mañana me comuniqué mediante dos mensajes de Skype con Lucas Sosa respecto a una pregunta surgida por algunas filas las cuales venían con un color rojo la cual no sabemos el por qué.','2023-08-29'),(6838,290,'Vigesimaoctava','En el día de la fecha lo que realice fue un PowerPoint en el cual tengo que explicar y mostrar lo que hacen los distintos pasos que se realizan al hacer el alta en la empresa.','2023-08-30'),(6839,282,'finalización out Cencosud febrero','Durante el día de hoy finalicé de manera manual el Out del mes de febrero referente a Cencosud de modo manual, ignorando el hecho de que parte de este trabajo se podría haber simplificado y automatizado mediante la herramienta. Aún así esto no pasó ya que hubo problemas internos que no permitieron el rapido avance de este asunto.','2023-08-30'),(6840,267,'30/08/2023','Estuve viendo que componentes se pueden mejorar del robot, sobre todo los motores.','2023-08-30'),(6841,261,'30/08/2023','Hoy seguimos con el codigo.','2023-08-30'),(6842,263,'30/8','Hoy hice un modelo de pasto en blender para ver si lo podia usar Axel que se encargaba del tema de hacer el mapa, también estuve ayudando a Axel sacandole fotos a los planos para asi poder hacer una copia un poco mas exacta y como referencia.','2023-08-30'),(6843,268,'30/08/2023','El día de hoy mejoramos el orden de los componentes para las peleas.','2023-08-30'),(6844,265,'30-08-2023','Hoy estuve rehaciendo el circuito y cambiando de lugar los pines para seguir testeando cosas ','2023-08-30'),(6845,262,'30/08/2023','El dia de hoy comence el rediseño del logo buscando una forma mas optima para atraer a los usuarios y expresando lo que deseamos compartir de nuestro trabajo con unos tonos azules que segun una inteligencia artificial expresa profesionalismo y confianza','2023-08-30'),(6846,270,'30-8-23','el dia de hoy continué desarrollando el codigo para lograr que se compruebe si la respuesta seleccionada por el jugador es la correcta, luego de algunos intentos no logré concretarlo.','2023-08-30'),(6847,257,'30/08/2023','Hoy avance el modelaje del colegio en unity , se perdió un poco al principio, más que nada la planta baja, queda mucho avance pero es posible si hay ganas ','2023-08-30'),(6848,266,'avance con envio de emails','Hoy conjunto con nicolas nieto pudimso tener funcionaondo el envio de emails desde la rest api, funciona perfectamente eh incluso ya usa tokens, lo probamos el reseteo de emails  y de contraseñas y anda. ','2023-08-30'),(6849,250,'miercoles 30/8','Hoy estuve trabajando en el proyecto de desarrollo de sistemas intentando manejar la api de google drive y estuve cambiando los diseños de flexbox','2023-08-30'),(6850,260,'','Hoy me habia propuesto hacer el enrutamiento y redireccionamiento, ademas de arreglar el responsive del calendar, pude crear el enrutamiento, y faltan un par de validaciones en el acceso de las rutas, y solo dediqué unos 20 minutos al responsive por que se nos acabó el tiempo, pero algo pude avanzar.','2023-08-30'),(6851,251,'BeCation - Generación T pt6 - 30/08/2023','El día de hoy adapté los métodos para enviar mails al cambiar la contraseña o al agregar una vacacion','2023-08-30'),(6852,258,'30-08/','hoy no pude hacer nada por que la compu se me crashea/freshea a cada que le daba a importar desde github','2023-08-30'),(6853,253,'Miércoles 30/08/2023 - React y Nueva Vista','Hoy me dieron un nuevo encargo y era crear una vista para la cresción de un nuevo usuario.','2023-08-30'),(6854,303,'30-08-2023','Codigo en Unity.\r\nFuncionalidad para que se elija una pregunta al azar de una categoría y nivel específico.','2023-08-30'),(6855,271,'30-08-2023','En el día de la fecha, seguí con el código de php.','2023-08-30'),(6856,282,'Mejora de HTML BaVigila','Hoy no se me dieron tareas en GS1 a pesar de haberme presentado de manera presencial, estando completamente solo ya que no vino nadie de mi área y están solo algunos integrantes del grupo de sistemas. Por ende me enfoqué en asuntos personales y, aprovechando la ocasión, verifique los códigos de HTML y CSS hechos por mi compañero Ezequiel Ledesma en los últimos meses, encontrando varias inconsistencias y errores los cuales se debían modificar lo antes posible además del hecho de agregar y mejorar los comentarios del código. Por lo tanto, a lo largo de 3 horas mejore, arregle y le di coherencia a más de 300 líneas de código.\r\nDurante la tarde dentro de practicas profesionalizantes me dediqué a ayudar a mis compañeros en el proyecto de Generación T, colaborando tanto en la realización de prototipados, la visualización de videos y la creación de archivos en React. Además de seguir terminando de mejorar los archivos de BaVigila, terminando de comentarlos y buscando mejorarlos.','2023-08-31'),(6857,283,'3 palabras hoy, nada mas.','El dia hoy delegue las tareas a mis compañeros de grupo. Los mismos se pusieron manos a la obra en base a sus tareas mientras que yo los ayude a cada uno con sus diferentes tareas. ','2023-08-31'),(6858,274,'Nueva API, ayuda a compañeros de equipo','En el día de la fecha lo que hice fue investigar videos para poder realizar la API de la sección de proyectos. Hice esto debido a que previamente había comparado la API que había hecho con la que había creado el otro grupo, la cual parecía estar mucho más desarrollada que la mía. Además, esa API utilizaba muchas más teconologías tales como Node.js, Express, etc. Encontré un video en el cual se explicaban buenas prácticas a la hora de hacer una API. Primero añadí los archivos correspondientes a Node.js, luego los de Nodemon y por último los de Express.js. También creé las carpetas necesarias y un index en el cual se imprime un &quot;Hola Mundo&quot; si las anteriores tecnologías se instalan correctamente. En otro index se imprime en un h1 desde que ruta se imprime dicho mensaje. Luego junto a uno de mis compañeros de equipo estuvimos haciendo algunas pruebas de la página BAVigila ya que tenía problemas a la hora de linkear los archivos js en el html.','2023-08-31'),(6859,285,'Día 32 - netfglixxxxx','¿Qué logré hacer hoy?\r\n\r\nHoy me enfoqué en la programación de la primera página que precederá a todo el contenido desarrollado por Victoria. Fue un proceso interesante pero desafiante. Mi objetivo era establecer el diseño y la estructura adecuada para esta página introductoria. Sin embargo, me encontré con un obstáculo mientras intentaba agregar un fondo a la página. El fondo no se mostraba correctamente: la calidad era baja o incluso a veces no aparecía en absoluto. Después de algunas investigaciones, me di cuenta de que el problema radicaba en un error de nombre en el archivo CSS. Una vez resuelto, logré establecer el fondo, y para mejorar la estética, utilicé inteligencia artificial para extender la imagen de fondo de manera coherente.\r\n\r\n¿En qué se me complicó?\r\n\r\nEl principal obstáculo que enfrenté hoy fue al intentar establecer el fondo de la página inicial. La dificultad radicaba en la calidad de la imagen, que inicialmente era baja y tenía problemas para mostrarse correctamente. Esta complicación resultó de un error en la referencia del archivo CSS, que afectó la forma en que se aplicaban los estilos. Sin embargo, después de identificar el problema y corregir el nombre del archivo, logré resolver este problema.\r\n\r\n¿Qué estuve investigando?\r\n\r\nA lo largo del día, dediqué tiempo a investigar sobre React, ya que todavía estoy en proceso de comprender plenamente su funcionamiento. React es un área en la que siento que necesito un poco más de claridad. Investigué sobre sus conceptos fundamentales y cómo se integra con el desarrollo de páginas web. Busqué recursos en línea, tutoriales y ejemplos para obtener una comprensión más sólida de cómo utilizar React de manera efectiva en mis proyectos futuros. Aunque es un poco desafiante en este momento, estoy seguro de que con más investigación y práctica, podré dominar React y aprovechar sus ventajas en mis proyectos de desarrollo.','2023-08-31'),(6860,298,'30','Hoy segui agregando recetas a la base de datos, ya tengo 30. Tengo hambre.','2023-08-31'),(6861,280,'','El dia de hoy segui haciendo la guia de react, esta vez enfocandome directamente en como se crean componentes y como entender algunos ya creados que te provee el mismo react la primera vez que creas el proyecto.','2023-08-31'),(6862,292,'interfaces de robo/sustancias/robo vehicular ','en el dia de la fecha en la correspondiente jornada de prácticas profesionalizantes comencé con enzo con algo que ya veníamos hablando desde hace unas horas que era sobre el mapa de bavigila el cual él se había predispuesto a organizar el código para que sea mas de entender sin la necesidad de haber sido parte del proyecto o haber trabajado en el código como lo hice yo.\r\n\r\n\r\n     al principio tuvimos unos problemas ya que enzo no podía encontrar el ultimo codigo que habia hecho y yo no se lo podía encontrara ya que no me encontraba con una computadora a mi alcance, todo esto fue antes de practicas cuando estábamos yendo para la escuela, ya en el aula de prácticas me llamó para hacer anotaciones del código para que sea más fácil de entender \r\n(codigo de las anotaciones)\r\n     me llamó varias veces mientras transcurría la jornada para que le vaya sacando las dudas que él tenía en el código ya que no entendía lo que había hecho o lo que hacían algunas funciones. Hubo un cambio que hizo y fue que cambió el style del código(que estaba en la parte de html) y lo movió a otra carpeta de style.css\r\n\r\n     mientras hacía esto continúe con los prototipos de las interfaces de los incidentes con mi compañero Manel Filippa el cual me ayudaba con la cosas que no sabía y no entendía que poner, lo primero que hicimos fue la interfaz de narcotráfico, que ya que sonaba muy “fuerte”según él y enzo, le cambiamos el nombre a sustancias ilícitas. Al principio estuve igual de trabado que la última clase ya que no entendía que debía poner y termine poniendo lo mismo que la última vez hasta que llamamos a enzo y nos dijo que busquemos tipos de narcotráfico(cosa que yo hacía búsquedas parecidas pero no podía encontrar lo que buscaba )\r\n     en esa búsqueda pude encontrara esta imagen\r\n la cual nos decía las cosas que debíamos poner(ya que yo especificaba cada una) asique nos ayudó para darle una mirada más general, una de las ideas de enzo fue poner todos los tipos de drogas e hice 3 como ejemplo pero no le termino convenciendo, ni a él ni a manu y a mi por lo que lo sacamos (la idea era poner un boton que desplegara todos los tipos de drogas pero lo descartamos ya que no encajaba muy bien y no tenía mucho sentido)\r\n      Terminaremos poniendo las cosas como están en la imagen casi exactamente como están puestas, salvo unas cosas ya que en distribucion sacamos transformación y ruta, que no tendrían mucho sentido y sacamos en su totalidad capital circulante. para remplazar este último agregamos compra y venta de drogas a través de aplicaciones y desde el internet, pero no se nos ocurrió mucho mas, por no decir nada\r\n\r\n    No solo hicimos sustancias ilícitas, sino que hoy fue un día bastante productivo en el que hicimos 4 interfaces, entre ellas\r\nsustancias ilícitas\r\nterminamos de una vez robo(que no me acordaba que estaba incompleta)\r\nrobo vehicular \r\n','2023-08-31'),(6863,279,'Dia 25 del Proyecto','En este dia estuve haciendo la daily siendo este un poco mas completa que las anteriores 2 semanas y bueno explique como fueron avanzando cada uno como ledesma y Manu con los prototipados o forte con el codigo.','2023-08-31'),(6864,296,'Bitácora 26','Hoy empecé a hacer el diagrama de gannt y estuve usando proyect libre pero luego de ir avanzando me di cuenta que tenia muchos problemas al momento de organizar los horarios entonces un compañero me dijo que mejor busque en internet otra aplicación,y al final lo termine haciendo en onlinegannt y lo termine','2023-08-31'),(6865,277,'Vigesima octava clase','El día de hoy estuve trabajando con React, logré hacer una página de login donde el usuario ingresa su nombre y contraseña. Primero estuve intentando usar NextUI pero sigo sin saber como instalarlo, así que por ahora tengo un prototipo del inicio de sesión hecho completamente en React.\r\nHice un formulario donde hay dos inputs, uno para el nombre y otro para la contraseña, además de un h1 y un botón que dicen Iniciar Sesión. Al darle al botón se envía el formulario y se comprueba si tanto el usuario como la contraseña tienen algún carácter, si alguno está vacío aparece un mensaje de error que dice “Todos los campos son obligatorios”. Esto es gracias a un setState de error que se cambia de false a true cuando se detecta mediante un if.\r\nSi la contraseña y el usuario son correctos, o válidos al menos, el setState de error se mantiene en falso y se oculta el forms para mostrar el componente home, en este hay un gran título dando la bienvenida y el nombre del usuario. Debajo de todo hay un botón que sirve para volver al inicio de sesión el cual no se si va a estar en el proyecto final.\r\nCuando se da al botón del formulario, para iniciar sesión, los datos se guardan en una constante llamada user, si se detecta que la cantidad de caracteres de user es mayor a cero, entonces se esconde el componente de inicio de sesión y se muestra el de home. Cuando se le da al botón de volver al inicio, en el componente home, lo que hace es declarar la variable user como vacía, entonces el anterior if detecta que user no es mayor a cero y se vuelve a mostrar el componente del formulario.\r\nEsto, si bien funciona para demostrar un poco como sería la página final, no es ni seguro ni la manera correcta de hacer cuentas, pero es un buen comienzo, sobre todo teniendo en cuenta que recién estoy aprendiendo React y que todavía no fui capaz de utilizar NextUI.\r\nMi próximo objetivo es lograr instalar Next UI y mejorar visualmente la página, ya que en parte los datos están bien guardados, otra cosa es que tengo que traer un pendrive desde mi casa ya que por ahora mi forma de guardar el proyecto es comprimiendo en un rar y dejándolo en la nube, pero esto toma bastante tiempo en comprimirse y extraerse, entre ambos facilmente se me van dos horas, así que sería mucho más rápido traerlo directamente de un disco externo o pendrive.\r\n','2023-08-31'),(6866,281,'Dia 26','El día de hoy estuvimos trabajando en varias cosas, primero añadimos un prototipo del carrito, modificamos las imágenes de cada producto, también cambiamos el botón de añadir al carro que nos mandaba a la página del producto, ahora este se registra en el prototipo del carrito, más adelante vamos a querer que este se registre y después cuando entres a la página de carrito.php veas los productos que ingresaste.. Y pusimos el enlace(href) a las páginas de cada producto en su imagen para que sea más elegante y práctico a la hora de usar la página.','2023-08-31'),(6867,278,'Clase N° 33 31/08/23','En el día de hoy hable con mi compañero Enzo Bartoletti y me comunico que tenia que realizar el prototipado rápido de la vista de Inicio de Sesión del proyecto de Generación T. El login que realice como primero opción , no gusto en el equipo, por lo tanto tuve que editarlo.El login consiste de un input de usuario , otro de contraseña , una opción de &quot;Olvide mi contraseña&quot; y un botón de Ingresar, utilice colores violetas ya que fue lo que me indico Enzo. Eso fue todo lo que realice hoy.','2023-08-31'),(6868,288,'clase 29','El día de hoy logramos avanzar en varias etapas de la página web, añadimos un prototipo del carrito, modificamos las imágenes de cada producto, aunque aún faltan por agregar. Agregamos un href a las imágenes de las card para que nos redirija a el producto en más detalle, y pronto pondremos un botón en el apartado carrito para que nos lleve a la página carrito.php y ahí se agreguen los productos que deseemos comprar, aparecerá el método de pago, su envío, o ir a buscarlo, y listo! realizamos gran parte del trabajo de hoy con nuestro mayor esfuerzo y concentración, la próxima clase planeamos terminar todo el diseño de la pagina web, y empezar a esforzarnos mas por el JS y lograr terminarlo de la mejor manera posible.','2023-08-31'),(6869,293,'Avance diagramas','hoy día continúe con los diagramas que se están cambiando diariamente por que no esta bien definidos.','2023-08-31'),(6870,286,'Breve continuación sobre Denuncias de BaVigila 3 y Ayuda con Proyecto de Streambe','En el día de la fecha me senté junto a mi compañero Ezequiel Ledesma para continuar con los prototipos de las interfaces de los incidentes de BaVigila. Con Ezequiel nos ayudábamos mutuamente para hacer la interfaces nuevas o cambiar las anteriores, lo primero que hicimos fue la interfaz de &quot;Narcotráfico&quot;, que ya que sonaba muy “fuerte” según Ezequiel y el Scrum Master Enzo Bartoletti, por lo que decidimos cambiar el nombre a &quot;Sustancias Ilícitas&quot;. Al principio estuve igual de trabado que la última clase ya que no entendía que debía poner y termine poniendo lo mismo que la última vez hasta que llamamos a Enzo y nos dijo que busquemos tipos de narcotráfico (cosa que yo hacía búsquedas parecidas pero no podía encontrar lo que buscaba).\r\nDurante la búsqueda encontramos una imagen que describía perfectamente lo que buscábamos, por lo que nos ayudó para darle una mirada más general, una de las ideas de Enzo fue poner todos los tipos de drogas y coloqué 3 como ejemplo pero no terminamos convencidos por lo que lo sacamos (la idea era poner un botón que desplegara todos los tipos de drogas pero lo descartamos ya que no encajaba muy bien y no tenía mucho sentido).\r\nTerminaremos poniendo las cosas casi como están en la imagen, salvo unas cosas ya que en distribución sacamos transformación y ruta, que no tendrían mucho sentido y sacamos en su totalidad capital circulante. Para remplazar este último agregamos compra y venta de drogas a través de aplicaciones y desde el internet, pero no se nos ocurrió mucho mas, por no decir nada. También ayudé a mi compañero Christian Forte a realizar una tarea del curo de Streambe, debido a que en su computadora no lo podía solucionar.','2023-08-31'),(6871,276,'Proyecto PP Lu´s Shop VicSon - Codificación - Conexión - CSS','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Hemos logrado aplicar el Media Queries a varias de las pestañas de nuestra pagina web. Por un lado le hemos aplicado eso a las pestañas de Inicio y todas las demas pestañas relacionadas a las secciones donde se muestran todos los productos disponibles en nuestra pagina web, ya sea la seccion de lenceria, medias, etc (pues esas pestañas en especial tienen el mismo diseño, por lo que aplica un solo archivo css para todas ellas), de este modo alternamos por estilos y en base a la resolucion de la pantalla en la que se muestre nuestra pagina web, se adapta con estilos que pueden ser interpretados para dicha pantalla y asi evitar el desorden de los elementos. Esto mismo se lo aplicamos a la pestaña de producto con estilos diferentes, y tambien estamos intentando hacer lo mismo con la pestaña del Carrito de compras. \r\n- Por otro lado, hemos realizado algunos rediseños a algunos elementos en nuestra pagina, de modo que tenga un estilo mas agradable, lindo y dinamico en si. \r\n\r\nEso fue todo lo realizado el día de hoy.','2023-08-31'),(6872,275,'documentación y css','Pues en el día de la fecha de hoy me dedique mas que nada a ver como estaban los diagramas, mas que nada la documentación del diagrama de caso de uso y también ver como estaba el estado de la pagina web, cabe recalcar  que desde hace unos días me estoy recuperando de una gripe que tuve, así que no estoy al 100% de mis capacidades, pues bueno el día de hoy revise el estado de la pagina web que estuvimos haciendo, esta prácticamente en un estado optimo, casi terminado puesto que es capaz de hacer las funciones de una pagina de compra y venta de ropa, asi que la mayoría de cosas que hicimos con la pagina son mas que nada cosas estéticas, como cambiar las imágenes de productos que usamos, modificar el tamaño o color de algunas partes de la pagina entre otras cosas, aparte de esto estuve viendo la documentación del diagrama de caso de uso, esta seria maso menos la documentación, esto se hace para especificar la comunicación y el comportamiento de un sistema, todo esto dividiéndolo en acciones del sistema y acciones del actor.','2023-08-31'),(6873,287,'Proyecto PP Lu´s Shop VicSon - Codificación - Conexión - CSS','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Hemos logrado aplicar el Media Queries a varias de las pestañas de nuestra pagina web. Por un lado le hemos aplicado eso a las pestañas de Inicio y todas las demas pestañas relacionadas a las secciones donde se muestran todos los productos disponibles en nuestra pagina web, ya sea la seccion de lenceria, medias, etc (pues esas pestañas en especial tienen el mismo diseño, por lo que aplica un solo archivo css para todas ellas), de este modo alternamos por estilos y en base a la resolucion de la pantalla en la que se muestre nuestra pagina web, se adapta con estilos que pueden ser interpretados para dicha pantalla y asi evitar el desorden de los elementos. Esto mismo se lo aplicamos a la pestaña de producto con estilos diferentes, y tambien estamos intentando hacer lo mismo con la pestaña del Carrito de compras. \r\n- Por otro lado, hemos realizado algunos rediseños a algunos elementos en nuestra pagina, de modo que tenga un estilo mas agradable, lindo y dinamico en si. \r\n\r\nEso fue todo lo realizado el día de hoy.','2023-08-31'),(6874,294,'Avance con pagina web React','En el dia de hoy con mi compañera nos experimentamos un poco mas en el ámbito del lenguaje React y avanzamos colocando un NavBar donde su origen fue en una pagina web de Google y tambien colocamos el fondo de la pagina que respecta a Generación T. Nos costo un poco ya que tuvimos que corregir varios errores pero logramos modificar los valores por defecto que contenia dicho nav. ','2023-08-31'),(6875,289,'Clase 31-08','El dia de hoy, continuamos con la pagina.Comence con hacer algo a la barra de menu, por la razón que ciro el scrum deseaba que el icon de menu al no estar desplegado\r\neste en el centro. En ese instante pedi ayuda a chat gpt(en nada ayudo porque hacia lo que queria), como sea, al final me ayudo el profesor Olaso, gracias.\r\nLuego cambie algunos detalles, y por ultimo empece a hacer una sección de comentarios que mostrara la imagen de quien hizo el comentario, y el respectivo comentario.\r\nEso es todo por hoy,muchas gracias.\r\n','2023-08-31'),(6876,295,'Seguimiento de Pagina Web - React ','Hoy con mi compañero seguimos lo que sería la pagina que venimos trabajando con el lenguaje React. Logramos colocar un fondo de pantalla que corresponde a Generación T. Y tambien pudimos colocar un navbar sacado de una pagina de google, lo modificamos y pusimos lo requerido para la página. Logramos tambien corregir errores del mismo.','2023-08-31'),(6877,273,'Clase 32 - 31/08/23','Hoy llegué a la escuela y tenía que realizar algunas correcciones sobre la API de Spring, que especificamente tenía que tocar en la parte de la entidad de Logs (bitacoras). Lo resolví haciendo una función en userService que busca en la base de datos los registros que tengan el dni que yo quiero. Luego, empecé a realizar el mapeo de las entidades que faltan en la base de datos.','2023-08-31'),(6878,294,'Problema con la localización de los archivos','En el día de la fecha con mi compañera tuvimos un gravísimo problema con los archivos que conformaban nuestra pagina hecha con React que seguimos ayer. Buscamos todo el tiempo la carpeta en el drive y resulta que encontramos una llamada igual pero con las modificaciones del 25/9 que no tenían casi nada de progreso. Con este problema no pudimos avanzar ni realizar nada sobre la pagina. Hoy no fue un día productivo.','2023-09-01'),(6879,295,'Pagina Generación T - Problema','El día de hoy tuvimos un problema con mi compañero, ya que al intentar abrir el trabajo que hicimos ayer en clase, nos dimos cuenta de que no estaba una carpeta que era la fundamental en el proyecto, intentamos buscar esa carpeta en drive, la cual es la plataforma en la que guardamos los trabajos pero no pudimos encontrar esa carpeta. No pudimos solucionar ese problema ni intentar hacerlo otra vez debido a la falta de tiempo.','2023-09-01'),(6880,285,'Día 33 - hibridoo','¿Qué logré hacer hoy?\r\n\r\nHoy me enfoqué en el desarrollo de la página web desde casa. A pesar de las dificultades, logré avanzar en la creación de la página. Inicialmente, trabajé en el diseño, pero no quedé satisfecho con los resultados y tuve que rehacerlo. A pesar de las complicaciones, logré realizar un progreso significativo en el desarrollo.\r\n\r\n¿En qué se me complicó?\r\n\r\nSe me complicó bastante la comunicación con mis compañeros, ya que estamos trabajando desde casa y no pudimos tener interacción directa. Esto dificultó el proceso de desarrollo de la página. Además, tuve problemas técnicos, ya que cada vez que hacía zoom en la página, todo lo que había hecho se movía, lo que resultó frustrante. Además, quiero mencionar que no estoy disfrutando del modelo de escuela híbrida en el que estamos trabajando, ya que preferiría una interacción más directa con mis compañeros y profesores.\r\n\r\n¿Qué estuve investigando?\r\n\r\nDurante el día, investigué principalmente sobre cómo resolver los problemas técnicos que surgieron al hacer zoom en la página web. También investigué algunas soluciones para mejorar la comunicación en un entorno de trabajo remoto. Además, reflexioné sobre mi preferencia por un modelo de educación más tradicional en lugar del actual enfoque híbrido.','2023-09-01'),(6881,273,'Clase 32 - 01/09/23','En el dìa de hoy estuve realizando los modelos que faltan para la creación de la API, y para esto necesité tener a mano la base de datos. Estuve creando las entidades en JPA Employeer, Area y demás. También tuve que crear los servicios y repositorios de cada uno.','2023-09-01'),(6882,279,'Dia 26 del Proyecto (virtualidad)','en este dia estuvimos mayormente en virtualidad por tema de un nuevo tipo proyecto de escuela hibrida que seria como estar en 2020 maso menos y bueno en todo lo que se hizo pues fue hacer las dailys como normalmente hago ademas estar en meet con el profe y el grupo.','2023-09-01'),(6883,284,'Bitacora 30','estuve empezando el diagrama de gantt , y revisando si habria que hacer alguna modificacion en el caso de uso ','2023-09-01'),(6884,296,'Bitácora 27','Hoy termine bien de organizar el diagrama de gannt y empecé el diccionario de datos el cual aún estoy haciendo ','2023-09-01'),(6885,276,'Proyecto PP Lu´s Shop VicSon - Codificación - Conexión - CSS - Base de Datos','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Hemos aplicado mas de las Media Queries, esta vez en la pestaña del carrito de compra para que esta se pueda adaptar mejor a los estilos de pantallas diferentes que se puedan llegar a presentar y evitar que lo elementos que se encuentren dentro se superpongan uno encima del otro, aunque aun queda implementarlo de mejor forma para que se adapte de mejor manera. \r\n- Por otro lado, hoy hemos realizado un par de inserts extras para nuestra pagina web de modo de que ya podamos incluir mas producto dentro de nuestra pagina web y así darle un poco mas de pruebas a la misma, pues hasta el momento únicamente contábamos con 6 productos, por lo que empezar a implementar mas inserts dentro de nuestra base de datos nos sera mejor. \r\n- También por otro lado, hemos investigado un poco sobre como implementar una API para poder realizar transacciones y recibimientos de plata desde la pagina web, habiendo optado por implementar ello con la API de &quot;Cuenta Digital&quot;, pero eso sera implementado mas adelante dentro de nuestro proyecto.\r\n\r\nEso fue todo lo realizado el día de hoy.','2023-09-01'),(6886,298,'Clase 31','Hoy empezamos las clases desde casa, me dedique a continuar con la base de datos de las recetas pero no pude hacer mucho, ya que mis compañeros me pidieron que agregara 15 recetas mas. Cuando terminen con la pagina voy a seguir agregando mas recetas, además de los comentarios de las mismas.','2023-09-01'),(6887,282,'Modelo hibrido practicas profesionalizantes','Durante el día de hoy recurrimos a un nuevo tipo de modalidad para practicas profesionalizantes, la cual consistía en realizar las tareas desde nuestras casas. Por lo cual dividí los puntos del día y los asigné a mis compañeros, dejando a Pedro y Federico en el área del login y a Luciano, Geraldine y Christian en el área de proyectos','2023-09-01'),(6888,287,'Proyecto PP Lu´s Shop VicSon - Codificación - Conexión - CSS - Base de Datos','\r\nEl día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Hemos aplicado mas de las Media Queries, esta vez en la pestaña del carrito de compra para que esta se pueda adaptar mejor a los estilos de pantallas diferentes que se puedan llegar a presentar y evitar que lo elementos que se encuentren dentro se superpongan uno encima del otro, aunque aun queda implementarlo de mejor forma para que se adapte de mejor manera. \r\n- Por otro lado, hoy hemos realizado un par de inserts extras para nuestra pagina web de modo de que ya podamos incluir mas producto dentro de nuestra pagina web y así darle un poco mas de pruebas a la misma, pues hasta el momento únicamente contábamos con 6 productos, por lo que empezar a implementar mas inserts dentro de nuestra base de datos nos sera mejor. \r\n- También por otro lado, hemos investigado un poco sobre como implementar una API para poder realizar transacciones y recibimientos de plata desde la pagina web, habiendo optado por implementar ello con la API de &quot;Cuenta Digital&quot;, pero eso sera implementado mas adelante dentro de nuestro proyecto.\r\n\r\nEso fue todo lo realizado el día de hoy.','2023-09-01'),(6889,277,'Vigesima novena clase','El día de hoy seguí trabajando con React, hoy fue un día especial ya que tuvimos clases virtuales, así que trabajé desde mi casa.\r\nAproveche que me encuentro en un lugar más tranquilo y con el que me encuentro más cómodo para ver tutoriales en línea de cómo utilizar React con NextUI, también estuve intentando descargar los programas necesarios en mi computadora por si en un futuro necesito adelantar algo en mi casa.\r\nLogre descargar React como tal pero no pude hacer funcionar NextJS. De todas formas si que estuve aprendiendo bastante el funcionamiento de este último mediante tutoriales y algo de práctica.\r\n','2023-09-01'),(6890,293,'Diagramas','Hoy día eh continuado con los diagramas para que pronto esten finalizados.','2023-09-01'),(6891,292,'interfaz de hurto y violencia de genero ','en el dia de la fehca era nuestra primera clase con modalidad virtual, por ende desde nuestra cas debíamos unirnos a un determinado meet para practicas profesionalizantes, nos unimos al meet que envió nuestro profesor para dar el presente y luego nos dividimos en otro meet aparte los miembros del proyecto de generación t, enzo nos dijo con que debíamos seguir cada uno por lo que manu y yo hicimos otro meet para seguir con las interfaces. tuvimos varias complicaciones ya que manu tenia problemas y no podia escucharme, asi estuvimos mas de 15 minutos hasta que se pudo solucionar(me explico como era lpo que hizo para solucionarlo pero no me acuerdo) y nos pusimos con la intefaz de hurto la cual no pudimos avanzar ya que no se nos ocurría nada asique llamamos a enzo para que nos ayude lo cual termino haciendo ya que nos dio un enfoque distinto al que teníamos con manu, pudimos hacerla sin problemas y quedamos en hacer la de violencia de genero pero nos colgamos hablando un poco y no teníamos tiempo ya que arrancaba la siguiente clase virtual','2023-09-01'),(6892,289,'1-09','El día de hoy, tuvimos nuestra primera clase de forma online. Hoy he seguido con la pagina web, he agregado la parte de muestra de nuestros comentarios, además que comenzar con la parte de planes alimenticios. Eso ha sido todo por hoy, muchas gracias!!','2023-09-01'),(6893,280,'','El dia de hoy desde casa comenzamos la escuela hibrida. Todos mis compañeros de equipo trabajamos desde casa y pusimos en claro distintos aspectos a trabajar para pdoer seguir trabajando de manera correcta. Por mi parte ayude a los diseñadores de la pagina con parte de sus diseños e incluir algunas animaciones que sean adaptables facilmente al momento de incorporar el codigo de react y despues continue la guia del mismo','2023-09-01'),(6894,283,'tdo online','El dia de hoy es todo clase online asi que estuvimos desde casa interconectados para poder realizar las tareas correspondientes de cada uno. yo designe las tareas que teniamos pendientes para la finalizacion del trabajo. Nos unimos al meet, luego nos creamos un discord para poder hablar sobre le trabajo. hicimos la daily y luego cada uno siguio con su tarea.','2023-09-01'),(6895,274,'Desarrollo de API de proyectos','En el día de la fecha, lo que hice fue continuar con el desarrollo de la API de proyectos desde mi hogar. Inicialicé el proyecto, instalé express y continué con lo que venía haciendo ayer. Creé un archivo js dentro de la carpeta \'routes\' en el cual creé un objeto \'router\' y definí cinco endpoints: uno para obtener todos los proyectos (get), para obtener un proyecto en específico (get), para crear un nuevo proyecto (post), modificar un proyecto (patch) y eliminar un proyecto (delete). Después creé un archivo js en la carpeta \'controllers\', dentro del cual copié las funciones que había escrito previamente en routes para que quede mejor organizado. Estas funciones fueron llamadas desde el archivo js de routes. Por último, pegué la base de datos y escribí las funciones necesarias para capturar sus datos en un nuevo archivo js dentro de la carpeta \'services\'. Además eliminé el archivo index.js en el cual se mostraba un texto.','2023-09-01'),(6896,275,'Clases virtuales','En la jornada de hoy, vivimos una experiencia educativa nueva en nuestro colegio. Nos sumergimos en el mundo de la enseñanza virtual, gracias a la implementación de un novedoso enfoque educativo conocido como &quot;clases híbridas&quot;. Este método me hizo acordar a cierta época que odie/ame: la cuarentena del año 2020, cuando nuestras vidas se trasladaron al ámbito digital.\r\nNuestro encuentro tuvo lugar en un entorno virtual, a través de la plataforma de videoconferencia Google Meet. En este encuentro virtual, nuestro profesor Damian Olaso (y también Nahuel que apareció para saludar) desempeñó un papel esencial, guiándonos en esta aventura educativa que apenas comenzaba. Nos compartió las metas y objetivos de aprendizaje que nos esperaban en esta jornada única.\r\n\r\nLas similitudes con la cuarentena anterior eran notables. Navegamos por las pantallas de nuestros dispositivos, conectándonos de manera remota para adquirir conocimientos. El docente, haciendo uso de herramientas digitales y su habilidad docente, nos introdujo en el contenido del día, marcando el comienzo de una experiencia educativa singular.\r\n\r\nEn mi día, me dediqué a seguir con el proyecto. Me concentré en la elaboración y actualización de diagramas, específicamente, en la revisión y ajuste de fechas en el diagrama Gantt, detallando el inicio y finalización de cada fase del proyecto. Luego, continué donde lo dejé ayer, avanzando en la documentación del diagrama de caso de uso.\r\n','2023-09-01'),(6897,255,'martes 5 / 9','hoy arreglamos la pagina web de pana','2023-09-05'),(6898,261,'05/09/2023','Hoy trabaje con la aplicacion del robot sumo','2023-09-05'),(6899,263,'5/9','Comienza septiembre y tengo que seguir trabajando con el personaje y hacer capaz algunos agregados que me pueden servir para el mapa del colegio.','2023-09-05'),(6900,250,'Martes 5/9','Hoy arregle la barra superior de la pagina con flexbox uwuwuwuuwuwuwuuwwwwwwwwwwwwwwwu no.','2023-09-05'),(6901,267,'05/09/2023','Hoy empezamos a hacer una aplicación para android que puede controlar el robot, contando con los modos de Automatico o Manual.','2023-09-05'),(6902,265,'05-09-2023','Hoy ayude a mi compañero a hacer la aplicación web para controlar al robot ','2023-09-05'),(6903,268,'10/05/2023','Hoy trabaje con la aplicacion del robot sumo','2023-09-05'),(6904,257,'5/9/2023','hoy no pudimos hacer mucho, perdimos mucho tiempo descargando el proyecto en la compu y guardandolo en la memoria de mi telefono','2023-09-05'),(6905,260,'','Organizacion de ramas y carpetas en el repositorio','2023-09-05'),(6906,251,'BeCation - Generación T pt7 - 05/09/2023','El día de hoy corregimos junto a Dylan errores en los endpoints de la API, ya que todas las funcionalidades ya fueron creadas.','2023-09-05'),(6907,262,'05-09-2023','El dia de hoy comencé con el codeo de la vista de configuracion de perfil','2023-09-05'),(6908,266,'Hoy estuvimos testeando','Hoy con nicolas estuvimos testeando toda la api, corriguiendo errores pequeños y probando las posibilidades y requerimiento a ver que nos falta, por ahora funciona todo, pero todavia nos falta probar algunas cosas','2023-09-05'),(6909,252,'Clase 41 - Corrección de Getters y Puts funcionando','El día de ayer terminé de documentar todos los get y los put de la API. Hoy hice unas correcciones en ciertos getters porque me faltaba dar la opción de buscar por ID','2023-09-05'),(6910,282,'Tareas de GS1','Durante hoy, aproximadamente a las 9:20 tuve una reunion de 40 minutos con Tomas Sainato donde me asignó la realización de los VLA de Cencosud referentes a los meses de Marzo, Abril y Mayo. Pero al querer acceder la VPN de GS1 se encontraba caida y no me dejaba entrar al disco G con los archivos de la empresa, por ende tampoco tenía mi Excel. A su vez me comunique con Lucas Sosa que me pidió arreglar unos recortes de envases que salieron mal por la herramienta, realizandolos en 30 minutos para, tras esto, recibir via mail el archivo de Cencosud y trabajando en cambiar las categoriasVLA asignadas como -1 por las categorias correctas','2023-09-05'),(6911,271,'5/9/2023','En el dia de la fecha intente avanzar un poco con el codigo de la conexion con la base de datos pero se me dificulto','2023-09-05'),(6912,262,'06-09-2023','El dia de hoy continue con la vista css de la configuracion de perfil\r\n','2023-09-06'),(6913,261,'06/09/2023','Hoy hice una nueva  aplicacion del robot sumo  en app inventor y la  termine ','2023-09-06'),(6914,251,'BeCation - Generación T pt8 - 06/09/2023','El día de hoy creé los services de Role y Area en el Frontend y luego ayude a solucionar un error en el backend, que consistía en revisar si algunas tablas necesitaban de un registro antes de borrarlo.','2023-09-06'),(6915,271,'6/9/2023','El dia de la fecha con mis compañeros intentamos hacer que el codigo nos devuelva la respuesta correcta, pero aun seguimos sin poder resolver ese problema','2023-09-06'),(6916,270,'6/9/2023','el dia de hoy continuamos con el codigo de comprobar si la respuesta seleccionada por el jugador es la correcta, y despues de probar algunas cosas entendimos mejor el codigo pero no logramos hacer que funcione del todo.','2023-09-06'),(6917,263,'6/9','Hoy ayudando a Axel con el tema del colegio y hice una base de datos para las cuentas de usuario.','2023-09-06'),(6918,257,'06/09/2023','Hoy el profe nos ayudo a reparar el problema del repositorio e hice la planta baja del colegio','2023-09-06'),(6919,268,'06-09-2023','El día de hoy comenzamos otra versión del control por celular del robot ya que el anterior era de una versión antigua.','2023-09-06'),(6920,258,'06/09/2023','hoy empeze a que el juego sea online ademas de modificar todo el github','2023-09-06'),(6921,266,'finalizacion de la api de becation','Durante la clase de hoy estuvimos terminando de revisar todos los endpoints de la api con gonzalo y estuvimos probando un monton de opcuiobes, Resuleto los utlimos errores y funcionadno todo dimos conjunto a gonza dimos por finalizada la api por el momento ','2023-09-06'),(6922,252,'Clase 42 - Deletes incorporados','El día de hoy incorporé todos los deletes al Swagger UI','2023-09-06'),(6923,260,'','eMPECÉ OTRA VISTA PARA CRUD DE ROLES Y ORGANICÉ LAS RAMAS','2023-09-06'),(6924,253,'Míercoles 06/09/2023 - React','Hoy traté de continuar con la vista de Regitro en React.','2023-09-06'),(6925,282,'Presencial en GS1','Hoy debí presentarme 1 hora antes de lo habitual, a las 8:00 am debido a que requería retirarme de las oficinas alrededor del horario de las 11:30 para dirigirme a una salida didactica a Ciudad Universitaria junto a profesores del turno vespertino.\r\nDentro de GS1 seguí avanzando con el archivo compliatorio referente a tres meses del 2023, finalizando la totalidad de los contenidos netos, asignando las categorias, finalizando todo lo referente al mes 4 y haciendo 250 de 300 recortes de marcas ya autocompletadas por la herramienta, quedando pendiente 50 autocompletadas, 300 manuales y los envases de dichos productos','2023-09-06'),(6926,278,'Clase N° 34 07/09/23','En el día de hoy me toco realizar el manual de usuario del proyecto de gestión de bitácoras. Fue la primera vez que realice uno , ya que , nunca había hecho , sinceramente me gusto realizar esta tarea. El manual consta de un titulo , un indice con las 7 vistas que tiene la API. Para explicar cada vista coloque el prototipado rápido y abajo una screenshot de cada botón/campo continuada de una descripción de que realiza cada uno de ellos.','2023-09-07'),(6927,279,'Dia 27 del Proyecto','En este día estuve mayormente ayudando con los otros chicos con el tema de los prototipados aunque al principio pensé que seguirían con la generación t aunque si un poco hicieron pero se pusieron mas las pilas con cambiar y adaptar los prototipados ademas de darle un estilo mas fresco que los que teníamos antes.','2023-09-07'),(6928,283,'wili rompio tdo y x su culpa casi morimos','El dia de hoy delegue tareas y cambie muchas cosas del figma y mañana seguire con lo mismo para poder terminar el figma. ','2023-09-07'),(6929,273,'Clase 33 - 07/09/23','Hoy estuve realizando unas correcciones a la base de datos, borrando algunas tablas que no eran de mucha utilidad. Luego, estuve añadiendo algunos campos, tales como uno de email en string y otro de fecha - hora (creacion de la cuenta) hecho en timestamp. Todo esto lo añadi al controlador de Usuario y agregué más al controlador de bitacora, donde añadí la cantidad de horas que realizó el usuario a la base de datos.','2023-09-07'),(6930,285,'Día 34','¿Qué logré hacer hoy?\r\n\r\nHoy continué con el desarrollo de la página web. Para empezar, decidí desechar la página que había creado previamente en casa, ya que no era adecuada para nuestras necesidades. En su lugar, comencé a trabajar en una nueva página desde cero.\r\n\r\nEn esta nueva página, implementé un sistema de inicio de sesión y registro. Además, añadí una animación que hace que el formulario rote, alternando entre las opciones de registro y inicio de sesión de manera visualmente atractiva.\r\n\r\nAunque tuve algunos problemas al intentar incorporar la barra que Vicky había creado, finalmente logré solucionarlos mediante ajustes en el código CSS.\r\n\r\nUn detalle interesante del día es que las computadoras de mis compañeros fueron reseteadas, lo que resultó en la pérdida de todos sus progresos en el proyecto, ¡pero yo no tuve ningún problema en ese sentido!\r\n\r\n¿En qué se me complicó?\r\n\r\nMi principal complicación surgió al intentar integrar la barra creada por Vicky en la página. Requirió un poco de trabajo extra con el CSS para que encajara perfectamente en el diseño general de la página. Sin embargo, con paciencia y algunos ajustes, pude resolver este problema satisfactoriamente.\r\n\r\n¿Qué estuve investigando?\r\n\r\nDurante el día, mi enfoque estuvo principalmente en el desarrollo práctico de la página web. No hubo necesidad de realizar investigaciones extensas, ya que estaba trabajando en la implementación de funcionalidades concretas. La mayor parte de mi tiempo lo invertí en escribir y depurar código HTML, CSS y JavaScript para lograr el efecto de rotación en el formulario de inicio de sesión y registro, así como para integrar la barra de Vicky de manera adecuada.','2023-09-07'),(6931,298,'Clase 32','Hoy lo mismo, segui agregando recetas a la bdd, voy cuarentaypico en total.','2023-09-07'),(6932,282,'Generacion T, GS1 Y BaVigila','Hoy durante la mañana trabajé en GS1 con el OUT de Cencosud y durante la tarde con los proyectos tanto de Generacion T y BaVigila, realizando prototipados y asignando tareas','2023-09-07'),(6933,293,'Inser en la base de datos','hoy me dedique a continuar con los insert que faltaban hacer pero aun se sigue trabajando en eso.\r\n','2023-09-07'),(6934,296,'Bitácora 28','Termine de hacer el diccionario de datos y me dijeron que tenía que agregar una tareas más al Gantt y modificar más fechas de unas tareas y los integrantes ','2023-09-07'),(6935,289,'07-09','El dia de hoy, seguimos con la pagina. Arregle el inicio, ademas de ponerle estrellas a las parte de comentario. Pero de mada sirvio, porque se apagaron las compus, eso es todo por hoy, muchas gracias.','2023-09-07'),(6936,276,'vProyecto PP Lu´s Shop VicSon - Codificación - Conexión - CSS - BDD','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Hemos configurado la barra de búsqueda para que esta pueda por fin ser funcional, de modo que al ingresar alguna palabra en esta, pueda buscar las coincidencias en base a distintos campos. Básicamente cada barra de búsqueda te dirige a una pagina llamada &quot;busqueda.php&quot;, la cual, al recibir un dato dentro del campo del buscador, se redirige al usuario a esta pestaña en la cual se ejecuta un código el cual utiliza los caracteres dados en el campo del buscador para buscar coincidencias dentro de los ámbitos de &quot;nombre del producto, marca, ID o tipo de producto&quot;, y si las encuentra, genera cards con todas las coincidencias encontradas. En caso de no encontrar coincidencias, se generara una card indicando que no se han encontrado coincidencias para la búsqueda realizada. \r\n- También hemos aplicado los Media Queries a esta pestaña y configurado un par mas de diseños para otras pestañas. \r\n- Por otro lado, hemos realizado mas inserts dentro de la base de datos para asi tener un par mas de productos dentro de nuestra pagina web. \r\n\r\nEso fue todo lo realizado por hoy. ','2023-09-07'),(6937,288,'Clase 30','El día de hoy, agregué cada parte de producto, todos las imagenes con su respectivo titulo, agregué un gif de Pochita, la cual queda perfectamente bien y mejor. Tambien solucione el tema de HREF de las imagenes, cada una te manda a su pagina de su producto, y en agregar al carrito se agrega al carrito, proximamente necesitaremos conectar la base de datos con lo que seria el PHP para que el producto de la base de datos se vea refllejado en el carrito.','2023-09-07'),(6938,287,'Proyecto PP Lu´s Shop VicSon - Codificación - Conexión - CSS - BDD','\r\nEl día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Hemos configurado la barra de búsqueda para que esta pueda por fin ser funcional, de modo que al ingresar alguna palabra en esta, pueda buscar las coincidencias en base a distintos campos. Básicamente cada barra de búsqueda te dirige a una pagina llamada &quot;busqueda.php&quot;, la cual, al recibir un dato dentro del campo del buscador, se redirige al usuario a esta pestaña en la cual se ejecuta un código el cual utiliza los caracteres dados en el campo del buscador para buscar coincidencias dentro de los ámbitos de &quot;nombre del producto, marca, ID o tipo de producto&quot;, y si las encuentra, genera cards con todas las coincidencias encontradas. En caso de no encontrar coincidencias, se generara una card indicando que no se han encontrado coincidencias para la búsqueda realizada. \r\n- También hemos aplicado los Media Queries a esta pestaña y configurado un par mas de diseños para otras pestañas. \r\n- Por otro lado, hemos realizado mas inserts dentro de la base de datos para asi tener un par mas de productos dentro de nuestra pagina web. \r\n\r\nEso fue todo lo realizado por hoy. ','2023-09-07'),(6939,286,'Breve continuación sobre Denuncias de BaVigila 4','El día de la fecha comenzó normalmente, abrí todas las aplicaciones que iba a usar, inicié sesión en mis cuentas, descargué los archivos necesarios y me puse a trabajar. Con mi compañero de trabajo Ezequiel Ledesma nos dimos cuenta que todas las interfaces para las denuncias de BaVigila ya estaban hechas hasta que Enzo Bartoletti (nuestro Scrum Master) nos hizo dudar de si estábamos en lo cierto, por lo que abrí la página &quot;Figma&quot; que es donde estuvimos haciendo todos los diagramas hasta el momento. Al rato revisé, mientras esperaba que Enzo me mandara la interfaz principal, que él había hecho para todos los tipos de incidentes. Después de que nos mandara la interfaz principal notamos que nos faltaba hacer la interfaz de &quot;Violencia de Género&quot;, por lo tanto nos pusimos a trabajar en ella de inmediato. Con mi compañero nos pusimos a buscar en Google los distintos tipos de violencia de género. En la página que encontramos veíamos los distintos tipos de violencia hasta que llegamos a la parte de &quot;Violencia Sexual&quot; entonces se nos ocurrió agregar en otro apartado dentro del mismo formulario la sección de &quot;Violencia Sexual&quot;, por lo que terminamos poniendo solo dos indicaciones debido a que algunas secciones no eran tan relevantes. Además, grabé un video para el perfil de Instagram de BaVigila, en donde se veía a mi grupo de trabajo trabajando. Antes de terminar tuvimos que seguir con el Pop-up del botón de emergencia, el cual permitirá al usuario hacer una llamada de emergencia. Además de dicho botón, estuve debatiendo con mis compañeros sobre cómo mejorar el aspecto de la interfaz general, el cual se le terminó haciendo un cambio estético, el cuál fue agregarle sombras para darle un aspecto más profesional.','2023-09-07'),(6940,275,'facturación , diagrama de colaboración','Para empezar el día de hoy, lo que hicimos fue tener una pequeña conversación para revisar lo que necesitamos completar en el proyecto. Principalmente, nos enfocaremos en la parte de facturación. Con Kevin, estábamos considerando la posibilidad de utilizar una API para la página, aunque el profesor también mencionó que podríamos optar por un sistema de correos electrónicos u otra alternativa. Además, me encargué de continuar trabajando en el diagrama de casos de uso, su documentación y el diagrama de colaboración.','2023-09-07'),(6941,288,'clase 31','Hoy ha sido un día en el que me he centrado en mejorar la experiencia de nuestros usuarios en nuestro sitio web. Uno de los cambios que he implementado con mucho entusiasmo ha sido la actualización de las imágenes para uno de nuestros productos estrella, el producto 1, destacando especialmente a la adorable Pochita.\r\n\r\nA pesar de que pueda parecer una tarea pequeña, esta actualización de imágenes tiene un impacto significativo en la percepción de nuestros productos por parte de los clientes. La elección de imágenes de alta calidad y atractivas puede marcar la diferencia en términos de atractivo visual y atraer la atención de los visitantes del sitio. Además, al dar un toque fresco a nuestro producto 1 con la imagen de Pochita, no solo mantenemos a nuestros clientes actuales interesados, sino que también abrimos la puerta a nuevos clientes que puedan sentirse atraídos por esta adición.\r\n\r\nCada pequeño cambio que hacemos en nuestro sitio web es una oportunidad para mejorar y perfeccionar la experiencia de compra de nuestros usuarios. Aunque hoy solo me he enfocado en este ajuste en particular, este es solo uno de los muchos pasos que estamos tomando para garantizar que nuestro sitio web siga siendo atractivo y funcional. Estoy emocionado por las futuras mejoras que vendrán, y estoy seguro de que nuestros clientes apreciarán la atención al detalle y el esfuerzo constante que ponemos en ofrecerles la mejor experiencia posible.','2023-09-08'),(6942,280,'','El dia de hoy se organizo las estructura de las carpetas en el proyecto, ya que se tenia un orden convencional que no permitia una buena visibilidad.\r\nSe actualizo la guia de react agregando contenidos nuevos de next js.\r\nEl dia de hoy en cuestión de la app en next.js, hubo problemas con la instalación automática ya que muchos de los paquetes no se podian instalar por el proxy de las computadoras de la escuela. El problema se pudo solucionar instalando manualmente los paquetes, algunos a través del comando npm y otros incluyéndolos en el archivo de package.json encontrado en la app de react creada anteriormente','2023-09-08'),(6943,279,'Dia 28 del Trabajo Practico','En este día estuve haciendo la daily como siempre ademas de que se hizo una Reunión de grupo que se hablo de posibles problemas que si se expande habría problemas que no habría en otros países o provincias mas bien ademas de como nos organizaríamos si esto lo haces de verdad y lucramos de este trabajo y no mucho mas.','2023-09-08'),(6944,283,'tdo mal con el login','El dia de hoy continuamos el figma y ayude a lana con su pagina de mierda de login que hizo pero el dice que no la hizo y le re cabe','2023-09-08'),(6945,298,'Clase 33','hoy no pude hacer mucho porque se me estuvo colgando la computadora, la clase que viene empiezo a actualizar los diagramas.','2023-09-08'),(6946,274,'APIs de proyecto','En el dia de la fecha lo que hice fue volver a escribir el código que había perdido el día de ayer debido al repentino reinicio de los ordenadores del establecimiento. Pero antes de esto, nos reunimos los integrantes de BAVigila para definir la manera en la que dividiríamos las ganancias en caso de obtener las mismas. También hablamos acerca de temas relacionados a la publicidad del proyecto. Una vez que terminé de escribir el código como lo había dejado ayer, empecé a programar la parte de la creación de un proyecto desde el archivo projectControllers.JS. Esto lo hice utilizanod un condicional if para comprobar que hayan datos dentro de cada campo del proyecto.','2023-09-08'),(6947,296,'Bitácora 29','Hoy seguí haciendo cambios en el Gantt y también ayude a un compañero con el tema de react para hacer el login de empleados ','2023-09-08'),(6948,278,'Clase N°35 08/09/23','En el día de hoy mi compañero Enzo Bartolleti me propuso cambiar algunos colores de los prototipados rápidos que había realizado la semana pasada , así que me puse con eso. Cambie las vistas de Inicio de Sesión y de Habilitar Usuarios del área de Recursos Humanos. En el prototipado rápido antiguo la paleta de colores era rosa pastel con celeste ( similar al de la pagina oficial de Generación T).En la nueva modificación que realice hoy la paleta de colores es un violeta oscuro en degrade , acompañado de un rosa mas oscuro.Para el equipo queda mas estético , si no hay ningún error , ya seria la forma definitiva.','2023-09-08'),(6949,286,'Discusión sobre el futuro de BaVigila','El día de la fecha comenzó normalmente, abrí todas las aplicaciones que iba a usar, inicié sesión en mis cuentas, descargué los archivos necesarios y me puse a trabajar. Para empezar, decidí junto a mi compañero Ezequiel Ledesma, seguir puliendo las imperfecciones de las interfaces hechas en los días anteriores, ya que debíamos aplicarlas del prototipado a la página real.\r\nAl rato, nos llamó Enzo Bartoletti (nuestro Scrum Master) para discutir unos temas relacionados a BaVigila: El principal era relacionados a los stickers que habíamos pensado en comprar unos meses atrás que por falta de tiempo no hicimos.\r\nOtro de los temas era la idea propuesta por Enzo era comprarnos un porcentaje a cada uno del proyecto para compensar el gasto de los stickers. Mientras discutía este tema con mis compañeros,  me acordé que una conocida hace stickers por lo que quedamos en que le hable y no comprar las de mercado libre.\r\nOtra idea de Enzo era la de vender nuestro proyecto por comunas y adaptarlo a estas.\r\nLa última idea era la de repartir las ganancias en caso de vender el proyecto, hacer un 50% para invertir el proyecto y el otro 50% para los integrantes, sino, 60% para nosotros y 40% para el proyecto. \r\n','2023-09-08'),(6950,299,'Hoy ','Hoy laburamos como nunca','2023-09-08'),(6951,293,'insert','hoy día continúe con el insert pero con otra categoría que el de ayer hice de boxers y se sigue trabajando en eso ya que no esta completa','2023-09-08'),(6952,273,'Clase 34 - 08/09/2023','En el día de hoy tuve que realizar nuevamente las clases que se habían perdido ayer por el reinicio de maquinas. Posteriormente, empecé a hacer uso de modelos y vistas a través de una clase de Spring, y también empecé a usar Thymeleaf para visualizar los datos por archivos html.','2023-09-08'),(6953,285,'Día 35 - el scrum master esd un bobiiiinnnnn','¿Qué logré hacer hoy?\r\n\r\nHoy me dediqué a programar un elemento de verificación (checkmark), aunque debo admitir que me costó un poco. A pesar de los desafíos, logré avanzar en esta tarea, aunque todavía necesito hacer algunos ajustes para que quede perfecto.\r\n\r\n¿En qué se me complicó?\r\n\r\nLa mayor complicación del día fue la dificultad que enfrenté al programar el checkmark. Requería un esfuerzo adicional para que funcione correctamente, y eso me tomó más tiempo del esperado. Además, me encontré con la tarea de modificar la página web para satisfacer las preferencias del Scrum Master, lo cual, aunque no fue un obstáculo importante, sí añadió una carga extra de trabajo.\r\n\r\n¿Qué estuve investigando?\r\n\r\nDurante el día, investigué principalmente sobre cómo programar y mejorar la funcionalidad del checkmark en la página web. También investigué sobre las prácticas recomendadas para ajustar la página web según las preferencias del Scrum Master. Aunque no mencioné explícitamente la investigación, estuve buscando información en línea y recursos que me ayudaran a superar estos desafíos técnicos y de colaboración.','2023-09-08'),(6954,276,'Proyecto PP Lu´s Shop VicSon - Codificación - Conexión - CSS - BDD','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Seguimos configurando algunos aspectos dentro de la Pagina web, tales como los Media Queries que seguimos implementando para así poder adaptar los elementos a las distintas resoluciones.\r\n- Por otro lado, consideramos el poder implementar el envió de Mails o Correos Electrónicos desde nuestra pagina web, pues, em primer lugar, tenemos pensado configurar un apartado para que, de ser necesario, un usuario pueda recuperar su contraseña en caso de haberla olvidado y a este mismo se le envié un mail y demás para que pueda recuperar o cambiar su contraseña, y en segundo lugar, hemos planteado reemplazar los pasos de compra por un envió de mail al administrador de la pagina con los elementos comprados y el monto a pagar de dicha compra, pero eso lo estaremos viendo mas adelante. \r\n- Por otro lado, seguimos realizando mas inserts dentro de la base de datos para tener mas productos. \r\n\r\nEso fue todo lo realizado por hoy.','2023-09-08'),(6955,277,'Trigesima primera clase','El dia de hoy estuve trabajando en React, sigo en la creacion de login para el proyecto de generacion T, estuve creando la aplicacion con nextJS y nextUI, instalando las cosas necesarias para su utilizacion en mi pendrive, asi la proxima vez que tenga que trabajar no tarde tanto en descargar el archivo y ya tenerlo guardado en un disco externo.','2023-09-08'),(6956,292,'charla sobre porcentajes de bavigila ','al llegar a la clase de hoy encendimos las computadoras para seguir puliendo las imperfecciones de las interfaces hechas en los días anteriores realizadas en figma,   ya que debíamos aplicarlas del prototipado a la página real.\r\n    mientras esperábamos a que las computadoras encendieran nos llamo enzo para discutir unos temas relacionados a bavigila, el principal era relacionados a los stickers que habíamos dicho de comprar unos meses atras y por falta de tiempo no lo hicimos, esto representa un gasto que si bien no es muy grande al menos a mi me costaria. por lo que la idea de Enzo era comprarnos un porcentaje a cada uno del proyecto para compensar el gasto de los stickers, cosa que rechace. \r\n     mientras decidiamos esto manuel se acordó que una conocida suya hace sticker por lo que quedamos en que le hable y no comprar las que habías dicho de mercado libre.\r\n      otra idea de enzo era vender nuestro proyecto por comunas y adaptarlo a estas en caso de que las compre alguien que trabaje en ellas.\r\n','2023-09-08'),(6957,287,'Proyecto PP Lu´s Shop VicSon - Codificación - Conexión - CSS - BDD ','\r\nEl día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Seguimos configurando algunos aspectos dentro de la Pagina web, tales como los Media Queries que seguimos implementadno para asi poder adaptar los elementos a las distintas resoluciones.\r\n- Por otro lado, consideramos el poder implementar el envio de Mails o Correos Electronicos desde nuestra pagina web, pues, em primer lugar, tenemos pensado configurar un apartado para que, de ser necesario, un usuario pueda recuperar su contraseña en caso de haberla olvidado y a este mismo se le envie un mail y demas para que pueda recuperar o cambiar su contraseña, y en segundo lugar, hemos pplanteado reemplazar los pasos de compra por un envio de mail al administrador de la pagina con los elementos comprados y el monto a pagar de dicha compra, pero eso lo estaremos viendo mas adelante. \r\n- Por otro lado, seguimos realizando mas inserts dentro de la base de datos para tener mas productos. \r\n\r\nEso fue todo lo realizado por hoy.','2023-09-08'),(6958,282,'','Hoy fue un día complejo en practicas, arribando a las 15:40 a Practicas y juntando a mis compañeros de BaVigila para proponerles realizar una inversión y comprar los stickers propuestos en vacaciones a costo de un porcentaje de sus acciones en el proyecto. Ademas, agregué a Escobar a la realización del frontend ya que me lo pidió y considero que puede ser un aporte a cumplir los tiempos del proyecto.','2023-09-08'),(6959,294,'Vuelta a proyecto principal','En el dia de hoy entramos un poco tarde y nos decidimos con mi compañera volver a nuestro principal donde veniamos realizando  alrededor del año, ya que habiamos perdido el trabajo donde estuvimos avanzando y el contenido se hacia muy denso.','2023-09-08'),(6960,295,'Charla con el grupo ','En el dia de la fecha con mi compañero decidimos dejar de lado el proyecto aparte de generacion T y darnos de baja. era lo mejor para todos ya que habiamos perdido nuestro trabajo y aparte nuestro equipo del proyecto anual nos necesitaba, asi que volvimos al proyecto de las recetas.','2023-09-08'),(6961,290,'Vigesimanovena','Después de mucho tiempo olvidándome de hacer las bitácoras, volvi para hacer la bitacora del dia de hoy, en el dia de la fecha lo que hice fue basicamente terminar un documento que me llevo practicamente 1 semana y media, el cual tenia que hacer un diagrama explicando un largo proceso de altas.','2023-09-12'),(6962,258,'12-09','hoy vi un par de vieos y intente solucionar el problema de lag','2023-09-12'),(6963,271,'12/9/2023','En el día de hoy avance un poco con el código para que me devuelva la respuesta correcta','2023-09-12'),(6964,251,'BeCation - Generación T pt9 - 12/09/2023','El día de hoy creé los métodos GET y el método ADD de VacationService en el Frontend','2023-09-12'),(6965,257,'12/09/2023','Hoy al cargar perdimos algo de progreso, pero avance lo perdido y agregué 2 aulas ','2023-09-12'),(6966,263,'12/9','Hoy pude resolver el problema de los huesos que no se movian de manera independiente pero queda algunos temas sobre la animacion, pero igual es un gran avance.','2023-09-12'),(6967,261,'12/09/2023','Hoy cambie app de app inventor del robot controller y descargue la app para probarla ','2023-09-12'),(6968,260,'','Terminé todo el responsive del calendar, y seguí con el redireccionamiento aunque no lo pude terminar por que tuve conflictos con el hook useNavigate','2023-09-12'),(6969,268,'12-09-2023','El dia de hoy areglamos la app para manejar el robot y vimos como instalarla en el celular.','2023-09-12'),(6970,266,'Jornada de unificacion ','En la jornada de hoy estuve un poqutio por todos los secotres, backend, frontend y documentacion y estuve ayudando a completar las tareas.','2023-09-12'),(6971,250,'martes 12/9/2023','Hoy estuve corrigiendo las flexbox de toda la pagina principal sacando fotos para la carpeta de campo ','2023-09-12'),(6972,265,'12-09-2023','Hoy ayude a mo compañero a cambiar algunas cosas en app inventor y luego trate de descargar e instalar la aplicación','2023-09-12'),(6973,252,'Clase 43 - Documentación Terminado','Documentación de todos los endpoints con Swagger finalmente terminado','2023-09-12'),(6974,262,'12/9/2023','El día de hoy realice el css de lo que seria la configuracion de perfil junto a una funcion handle que guarde los nuevos datos ingresados','2023-09-12'),(6975,282,'Gs1','Durante hoy trabajé virtualmente para GS1, siguiendo con la realización de recortes para Censocud en los meses de Marzo, Mayo y Junio y quedando pendiente a terminar en el día de mañana.','2023-09-12'),(6976,303,'12-09-2023','Hoy seguimos con el codigo para la funcionalidad del juego.','2023-09-12'),(6977,297,'13/09/23','Realizamos salida didáctica al encuentro de ADA 13 por el día del programador. ','2023-09-13'),(6978,254,'13/09/23','realizamos salida didáctica por el día del programador a ADA 13. ','2023-09-13'),(6979,282,'Gs1','En el día de hoy me presenté de manera presencial en las oficinas de GS1, avanzando y finalizando el OUT de Cencosud respectivo a los meses 3,4 y 6. Una vez finalizado, nos juntamos con la totalidad del grupo de trazabilidad para analizar el documento en busca de errores. \r\nMientras tanto, en el tiempo restante, estudié con vistas a un examen previso para la proxima semana y para el cual creo aún no estar capacitado, usando aproximadamente 1 hora y media de mi tiempo de oficina para esto.','2023-09-13'),(6980,266,'Salida didáctica - día del programador','Hoy fuimos al evento ADA13 por el día del programador, tuvimos un montón de charlas y stands muy copadas, también hubo work shops y duelo de codigo, me lleve un par de premios y de nuevas herramientas ','2023-09-13'),(6981,252,'Clase 44 - ADA 13','Hoy fuimos al evento de ADA 13 por el día del programador. Participe en una trivia y me gané una remera de donweb. Tuvimos varias charlas en las que participaron el pelado nerd, mouredev, hola mundo, dalto, etc.','2023-09-13'),(6982,253,'Míercoles 13/09/2023 - ADA 13','Hoy fuimos al evento ADA 13 de Lucas Dalto (Soy Dalto). Estuvimos todo el día.','2023-09-13'),(6983,257,'13/09/2023','Hoy hicimos la excursión y fuimos a ada13, en la usina del arte','2023-09-13'),(6984,258,'13-09-2023','hoy fuimos a la usina del arte por el dia del programador','2023-09-13'),(6985,262,'13/9/2023','El día de hoy fuimos de excursion con todo el salon a la Usina del Arte al evento ADA 13 del gran programador y desarollador conocido Lucas Dalto en conjunto a DonWeb. Vimos varios programadores y desarolles y tambien hubo desafios de solucion de problemas a travez del lenguaje que manejamos','2023-09-13'),(6986,267,'13/09/2023','El día de hoy visitamos la Usina del arte, disfruté mucho las charlas y retos propuestos. Feli día!','2023-09-13'),(6987,256,'ADA 13','Hoy fuimos al evento de ADA 13 en la usina, hubo algunos juegos y competencias en los entre tiempos de cada charla.','2023-09-13'),(6988,255,'miercoles 13 9 2023','hoy fuimos de excursion al evento ADA13, por el día del programador. ','2023-09-13'),(6989,261,'13/09/2023','hoy fui ADA 13 en usina del arte por el día del programador','2023-09-13'),(6990,268,'13/09/2023','El dia de hoy fui a la Usina del arte para el evento delel día del programador llamado ADA 13.','2023-09-13'),(6991,251,'Excursión a ADA 13 - 13/09/2023','El día de hoy asistimos a la Usina del Arte para festejar el día del programador en ADA 13. Feliz día!\r\nTambién gané un duelo de código usando Python desde el celular. Consistía en sumar los números pares e impares del 1 al 30 e imprimir ambas sumas. ','2023-09-13'),(6992,303,'13-09-2023','Hoy tuvimos la salida didáctica al evento ada 13 por el día del programador.En el cual asistieron varios programadores conocidos y también los mismo dieron charlas.A la vez hubo &quot;juegos&quot; o eventos, como por ejemplo &quot;los duelos de codigos&quot;.','2023-09-13'),(6993,263,'13/9','Hoy fui a un evento de programacion en donde se encontraban muchos influencers sobre el tema, ademas hoy era el dia del programador','2023-09-13'),(6994,282,'Gs1','En el día de hoy me suministraron mediante la plataforma de Skype un nuevo documento, referente a la cadena de supermercados COTO, teniendo que hacer tareas exactamente iguales a las realizadas con Cencosud pero en una mayor extensión, abarcando del mes de Enero al mes de Julio todo dentro del mismo archivo','2023-09-14'),(6995,282,'Trabajos varios','Hoy trabajé en aspectos varios, delegando tareas de Generación T a Lescano, Escobar, Forte y Estrigarribia. Posteriormente hablamos sobre las posibilidades de BaVigila y creamos un host remoto para nuestra landing page en NO-IP, una página gratuita.\r\nTambien analizamos las estadisticas de el reel subido a las 15 horas. siendo que cumplió con las expectativas, ya llegando a mas de 150 visualizaciones.','2023-09-15'),(6996,292,'pagina web','En el dia de la fecha en la primera y única jornada de prácticas prefesionalizantes ya que debido a que los profesores tuvieron una capacitación el día de ayer no tuvimos. al llegar a clases no tenía pensado hacer mucho ya que tenía que hacer un resumen para otra materia por lo que arranque con eso, mientras escribía le dije a manu que arrancara a hacer la nueva interfaz principal de la página web. Pero hubo un inconveniente ya que los prototipados que habíamos hecho eran para la versión Mobile y no para la web, por lo que lo llamamos a enzo y mientras esperábamos que viniera para decirle el problema que teníamos hable un poco con manu sobre como podríamos solucionar esto. Le probamos el problema y se mostró un poco desconcertado y lo que nos dijo que hagamos fue hacer un prototipado de la página web y ahí fue cuando me puse a pleno a hacer el resumen de la otra materia. Al rato lo vi a manu mientras trabajaba con la página web e iba quedando bastante bien el problema es que hoy tampoco me acorde de subir la versión final del mapa que esta en la computadora de mi casa y por ende manu trabajó con una versión vieja e incompleta.','2023-09-15'),(6997,278,'Clase N°36 15/09/23','En el día de hoy seguí modificando los prototipados rápidos , primero cambie la vista de Crear Proyecto , lo único que realice en esta fue cambiar el color del fondo a un degrade de violeta a uno mas oscuro. También cambie el header y el footer poniéndole un degrade rosado.En cuanto a la vista de Crear Usuario modifique todo el diseño del formulario ademas del fondo al igual que la vista anterior. Para el formulario coloque un contenedor de color blanco y dentro del mismo puse los campos del formulario acompañado con un botón , degradado igual que el fondo. También agregue en el footer y el header un border de color rosa pastel.','2023-09-15'),(6998,285,'Día 36','¿Qué logré hacer hoy?\r\n\r\nHoy, logré avanzar en dos aspectos clave de nuestro proyecto. En primer lugar, finalicé la página de inicio de sesión y registro. Está completamente funcional y lista para su revisión por parte del Scrum Master. Estará en ese estado hasta que se realicen cambios o ajustes según las necesidades del equipo o hasta que se decida realizar modificaciones estéticas.\r\n\r\nDespués de completar esa tarea, me dediqué a mejorar visualmente la página de recetas. Aunque aún no la he terminado por completo, he realizado importantes mejoras visuales que incluyen la adición de un apartado de estrellas para calificar recetas, la posibilidad de dejar comentarios y una organización más clara de la información.\r\n\r\n¿En qué se me complicó?\r\n\r\nAfortunadamente, hoy no enfrenté complicaciones significativas. El trabajo en la página de inicio de sesión y registro transcurrió sin problemas, y las mejoras en la página de recetas fueron bien recibidas por el Scrum Master.\r\n\r\n¿Qué estuve investigando?\r\n\r\nMi enfoque de investigación hoy estuvo en la mejora visual de la página de recetas. Investigué técnicas de diseño web para hacer que la página sea más atractiva y funcional, como la implementación de sistemas de calificación con estrellas y la incorporación de comentarios. También exploré estrategias para organizar el contenido de manera más efectiva, lo que incluye dividir la información en secciones claras y accesibles.','2023-09-15'),(6999,286,'Continuación de Página Administradores de BaVigila','El día de la fecha comenzó normalmente pero con la diferencia de que el día anterior no tuve clases, por lo que perdí un poco de tiempo, abrí todas las aplicaciones que iba a usar, inicié sesión en mis cuentas, descargué los archivos necesarios y me puse a trabajar. Empecé teniendo una pequeña charla con mi Scrum Master y con mi compañero Ezequiel Ledesma sobre la página de Usuarios de BaVigila, con Ezequiel teníamos la duda sobre cómo aplicar los prototipados que estuvimos haciendo las clases anteriores en el formulario desplegable, con lo que Enzo Bartoletti (el Scrum Master) respondió diciéndome que deje esta tarea para más tarde, ya que tendríamos que plantearlo y diseñarlo bien, entonces propuse la idea de continuar con las ventanas desplegables que usarán los asministradores para insertar, modificar y/o eliminar reportes. También se me ocurrió agregar el mapa debajo de toda la interfaz, ya que con ello los administradores tendrán un acceso fácil y una visión rápida de la ubicación donde se hacen los reportes, por lo que coloqué in &lt;iframe&gt; y apareció el mapa. Más tarde, para hacer que los datos que los administradores ingresen desde el botón &quot;Ingresar&quot; se guarden en la Base de Datos, tuve que poner todos los input que se encuentran dentro del botón desplegable dentro de un form, abajo de todo, poner un botón tipo &quot;submit&quot; y tuve que hacer un nuevo archivo .php donde escribiré mas tarde todas las funciones. Lamentablemente me quedé sin tiempo, por lo que no pude hacer un gran avance, pero seguiré la clase que viene.','2023-09-15'),(7000,293,'insert','hoy día me dedique a continuar con los insert que anteriormente estaba asiendo para que la pagina no este vacía de productos se sigue trabajando en eso','2023-09-15'),(7001,274,'Desarrollo de API de proyectos','En el dia de la fecha continué con el desarrollo de la API. Dentro del archivo &quot;projectController.js&quot; creé una función la cual llama a la ruta que sirve para actualizar un proyecto y se le pasan ciertos argumentos. También envía una respuesta. Luego creé un nuevo archivo llamado &quot;utils.js&quot; dentro de la carpeta &quot;database&quot;. Dentro de este archivo importé el lector de archivos de sistemas y una función que permite modificar el archivo que contiene la base de datos (.JSON).','2023-09-15'),(7002,279,'Dia 29 del Proyecto ','En el dia de hoy segui haciendo las dailys como siempre contando como siguieron trabajando los integrantes del proyecto.','2023-09-15'),(7003,283,'ni compro con hablar con mujeres. como me enseño mi novia B)',' El dia de hoy volvimos a dividir tareas y luego nos pusimos cada uno con sus tareas., igualmente la mayoria estudio para una prueba que tenemos en la siguiente hora que es de jujan “mc lovin”.\r\nPero alan y victoria laura siguieron la pagina. Luego nos falta ponerle el react y ya estaria. \r\n','2023-09-15'),(7004,296,'Bitácora 30','Hoy segui realizando cambios al Gantt aunque tuve muchos inconvenientes con la PC porque se trabó varias veces y tuve que reiniciarla más de una vez','2023-09-15'),(7005,273,'Clase 35 - 15-09-2023','En el día de hoy llegué al establecimiento y mediante el uso de Thymeleaf en html gracias a las dependencias que instalé en java pude hacer un login. Primero, tuve que hacer una página nueva donde se registrarían los usuarios, recibiendo los campos deseados y finalmente en el login indique que se debería logear mediante email y una contraseña. En la función del login, el parámetro password se convierte a un hash y luego se compara con la versión que se encuentra en la base de datos. Si este da true, dveuelve la información del usuario, y si da false no devuelve nada.','2023-09-15'),(7006,277,'Trigesima segunda clase','El día de hoy tuve varias dificultades a la hora de trabajar en el proyecto, sigo avanzando en la página de Generación T y hoy me tocaba comenzar de una vez por todas con el login, utilice el pendrive que conseguí la semana pasada para guardar la página y la abrí con Visual Studio Code. Mientras veía un video para guiarme del uso de NextUI y React, la computadora se congeló y dejó de responder, tanto así que me vi obligado a reiniciarla forzosamente mediante el botón de apagado.\r\nPor suerte no perdí mucho progreso pero si perdi mucho tiempo, esto se repitio varias veces durante el dia, en total cinco veces se me congelo la computadora y lo unico que logre avanzar fue la navbar de la página, esta es de color purpura y tan solo dice iniciar sesion.\r\n','2023-09-15'),(7007,276,'Proyecto PP Lu´s Shop VicSon - Codificación - Conexión - CSS - BDD ','El día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Seguimos realizando inserts dentro de nuestra base de datos para asi poder tener mas productos dentro de nuestra pagina web. Por otro lado, hemos considerado empezar a hashear los campos de contraseña que entran dentro de nuestra base de datos para asi poder tener un poco mas de seguridad en el manejo de las contraseñas y asi evitar filtraciones de contraseñas. \r\n- Por otro lado, estuvimos configurando un poco y practicando el envió de mails desde nuestra pagina web, que aunque aun no la hemos probado pero ya hemos hecho las extensiones con phpMailer de modo que esta pueda ser funcional, solo queda implementarla un poco y asi podremos despues configurar la pestaña de &quot;Recuperar Contraseña&quot; de modo que podamos enviarle un correo a la persona a la que se le olvido la contraseña. Aunque aun deberemos crear una forma de configurar esta pestaña pero lo veremos mas adelante. \r\n\r\nEso fue todo lo realizado por hoy. ','2023-09-15'),(7008,289,'15/09','El día de hoy continúe con la pagina web del proyecto, eso es todo por hoy muchas gracias!','2023-09-15'),(7009,287,'Proyecto PP Lu´s Shop VicSon - Codificación - Conexión - CSS - BDD ','\r\nEl día de hoy seguimos trabajando en base al proyecto, habiendo realizado las siguientes tareas:  \r\n\r\n- Seguimos realizando inserts dentro de nuestra base de datos para asi poder tener mas productos dentro de nuestra pagina web. Por otro lado, hemos considerado empezar a hashear los campos de contraseña que entran dentro de nuestra base de datos para asi poder tener un poco mas de seguridad en el manejo de las contraseñas y asi evitar filtraciones de contraseñas. \r\n- Por otro lado, estuvimos configurando un poco y practicando el envió de mails desde nuestra pagina web, que aunque aun no la hemos probado pero ya hemos hecho las extensiones con phpMailer de modo que esta pueda ser funcional, solo queda implementarla un poco y asi podremos despues configurar la pestaña de &quot;Recuperar Contraseña&quot; de modo que podamos enviarle un correo a la persona a la que se le olvido la contraseña. Aunque aun deberemos crear una forma de configurar esta pestaña pero lo veremos mas adelante. \r\n\r\nEso fue todo lo realizado por hoy. ','2023-09-15'),(7010,294,'Comienzo de React del proyecto del principio','En el día de hoy nuestra compañera del grupo inicial nos envió el prototipado rápido que hizo el grupo para poder realizar la página que respecta a las recetas, siempre necesitando React, lo cual no lo habían hecho todavía. Entonces hoy empezamos la pagina pasando el codigo de html a lenguaje React con mi compañera.','2023-09-15'),(7011,295,'React con proyecto inicial','En el dia de hoy empezamos de nuevo con el proyecto inicial que veniamos recorriendo todo el año. Con mi compañero iniciamos con la pagina web fabricada en React, lo que tuvimos que hacer fue pedirle el prototipado rapido hecho por mis otros compañeros. Pasamos todo lo hecho en html anteriormente y lo pasamos a React.\r\n\r\n\r\n\r\n','2023-09-15'),(7012,282,'Tareas GS1','Hoy trabajé para la empresa GS1 Argentina desde la virtualidad de mi casa, avanzando en la realización del nuevo archivo para COTO correspondiente a los meses 1, 2, 3, 4, 5, 6 y 7 del año 2023. Progresando en parte sustancial del segundo mes, finalizando su conversión de pesos y sus envases. Siendo que en dicho momento descubrí que los envases totales de todos los meses a completar era de tan solo 380, proponiéndome para el día de hoy realizar esos envases para finalizarlos dentro del archivo, teniendo que hacer solo marcas y recortes.\r\nAl finalizar el día me quedaron pendientes alrededor de 50 para realizar en el día de mañana.','2023-09-19'),(7013,258,'19-09','hoy vi video sobre como hacer una cinematica en unity (feno termina la escuela por dios)','2023-09-19'),(7014,262,'19/9/2023','El dia de hoy me encarge de hacer la funcion para que mientras toque el logo se muestre la seccion deseada a realizar cambios y guardarlos y definir detalles de la vista de configuracion de perfil','2023-09-19'),(7015,261,'19/09/2023','El día de hoy instalamos el ultimaker cura para mejorar en los tiempos de impresión de los diseños 3d.','2023-09-19'),(7016,257,'19/09/2023','hoy avance con el colegio, perdi un poco de progreso pero lo recupere y ya empece el diseño del primer piso','2023-09-19'),(7017,263,'19/9','Hoy por tonto no pude hacer mucho porque me olvide de subir la ultima actualizacion que le di a mi personaje en la pc de mi casa, la proxima voy a subirlo a la nube.','2023-09-19'),(7018,270,'19/09/23','el dia de hoy, consultando con chatgpt, probamos algunas opciones de codigo para este problema que estamos teniendo con comprobar la respuesta seleccionada por el jugador, pero sin exito(al final del día se me ocurrieron algunas ideas para intentar el proximo dia).','2023-09-19'),(7019,268,'19-09-2023','El día de hoy instalamos el ultimaker cura para mejorar en los tiempos de impresión de los diseños 3d.','2023-09-19'),(7020,260,'','Terminé la vista del calendario de RRHH para visualizar las vacaciones pedidad y con el fetch a las vacaciones','2023-09-19'),(7021,250,'Martes 19/9/2023','hoy estuve completando la carpeta de campo y explicando sobre la practica en javaScript y como fui diseñando y comprendiendo el codigo escrito en la practica de javaScript','2023-09-19'),(7022,267,'19-09-2023','El día de hoy instalamos el ultimaker cura para mejorar en los tiempos de impresión de los diseños 3d.','2023-09-19'),(7023,265,'19-09-2023','Hoy estuve tratando el programa para saber un tiempo estimado de cuanto tardaría mi impresión ','2023-09-19'),(7024,259,'Martes 12 - Miercoles 13 - Martes 19 Nahuel Moreno Practicas Profesionalizantes','martes 12/9:\r\nEste dia me busque e informe viendo videos acerca de librerías de Interfaz q no sean Tkinter, mientras revisaba un poco el Backend\r\n\r\nMiércoles 13:\r\nTuvimos la excursión a Ada 13 en la Usina del Arte, un evento bastante entretenido\r\n\r\nHoy, Martes 19:\r\nContinúe mi carpeta de campo','2023-09-19'),(7025,251,'BeCation - Generación T pt10 - 19/09/2023','El día de hoy hicimos debugging del código frontend con Dylan y resolvimos un error al agregar las vacaciones. También ayudé a la profesora Belen Tyavelosky con su código que tenia un problema al intentar conseguir campos de una bdd.','2023-09-19'),(7026,255,'Martes 19/9/2023','Hoy estuve retome mi redacción de lo que hice en el año dentro de la carpeta de campo.','2023-09-19'),(7027,266,'Me dedique a terminar la funcionalidad de agregar vacaciones','En el dia de hoy termine las funcionalidades para agregar las vacaciones, anda todo, incluso le puse un modal alerta','2023-09-19'),(7028,253,'Miércoles 19/09/2023 - Register','Hoy continué con la vista de register con React.','2023-09-19'),(7029,252,'Clase 45 - Swagger terminado y funcionando','El día de hoy terminé finalmente con la documentación de Swagger y funciona correctamente desde Swagger Ui. Además, al agregsr una vacacion por ejemplo, si vas a la pestaña del calendario de vacaciones, se puede ver como se creó la nueva vacación, también funciona al editarla y eliminarla','2023-09-19'),(7030,271,'19/9/2023','El dia 13-9-2023, olvide hacer mi bitacora sobre la salida a Usina del arte.\r\nCon respecto al dia de hoy, probamos el codigo que chat gpt me habia propuesto como solucion el dia 12-9-23, pero finalmente no nos funciono, y aun seguimos buscando la solucion a este problema.','2023-09-19'),(7031,282,'Nuevas tareas en GS1','Hoy fue un dia distinto el cual lo disfruté mas de lo habitual. Al llegar, 20 minutos anticipadamente, empecé a realizar las tareas propias del OUT de COTO. Pero al llegar Tomas y Rocio me pidieron hablar y me comentaron acerca de si estaba dispuesto a capacitar e integrar a mis tareas a Tobias, oficiando como algo similar a un jefe para él. Esto se debía a que las tareas de su sector estaban finalizadas y no tenian nada para darle, por lo que vieron coherente que yo le asigne tareas, dandole como primer punto la conversión de 1000 contenidos netos a Kilogramos, lo cual realizó satisfactoriamente en aproximadamente 30 minutos de trabajo bajo mi atenta mirada. Tras esto, a pesar de que no se me fué solicitado, lo capacite en la realización de recortes de marcas y le di los datos del mes de marzo para que realice sus recortes. Al ver que era capaz y podría ayudarme mas, directamente le dí dos meses mas para que realice recortes y marcas manuales, logrando que él haga cerca de 50 recortes útiles para mi trabajo, previa validación por mi parte respecto a los datos ingresados.\r\nUna problematica que surgió durante el día fue que los GTIN al usar CSV delimitado por comas se transformaron a exadecimales y se rompieron, dejando de ser los correctos y debiendo ser reemplazados. Yo plantee integrar un BUSCARV para asignar los GTIN a las descripciones, pero Tomas piensa (correctamente) que la mejor decisión es aplicar un BUSCARV entre los GTIN y la columna idproducto, la cual es única.','2023-09-20'),(7032,282,'Nuevas tareas en GS1','Hoy fue un dia distinto el cual lo disfruté mas de lo habitual. Al llegar, 20 minutos anticipadamente, empecé a realizar las tareas propias del OUT de COTO. Pero al llegar Tomas y Rocio me pidieron hablar y me comentaron acerca de si estaba dispuesto a capacitar e integrar a mis tareas a Tobias, oficiando como algo similar a un jefe para él. Esto se debía a que las tareas de su sector estaban finalizadas y no tenian nada para darle, por lo que vieron coherente que yo le asigne tareas, dandole como primer punto la conversión de 1000 contenidos netos a Kilogramos, lo cual realizó satisfactoriamente en aproximadamente 30 minutos de trabajo bajo mi atenta mirada. Tras esto, a pesar de que no se me fué solicitado, lo capacite en la realización de recortes de marcas y le di los datos del mes de marzo para que realice sus recortes. Al ver que era capaz y podría ayudarme mas, directamente le dí dos meses mas para que realice recortes y marcas manuales, logrando que él haga cerca de 50 recortes útiles para mi trabajo, previa validación por mi parte respecto a los datos ingresados.\r\nUna problematica que surgió durante el día fue que los GTIN al usar CSV delimitado por comas se transformaron a exadecimales y se rompieron, dejando de ser los correctos y debiendo ser reemplazados. Yo plantee integrar un BUSCARV para asignar los GTIN a las descripciones, pero Tomas piensa (correctamente) que la mejor decisión es aplicar un BUSCARV entre los GTIN y la columna idproducto, la cual es única.','2023-09-20'),(7033,270,'20/9/23','el dia de hoy continuamos intentando el codigo de verificacion de respuesta correcta en C# con algunas ideas nuevas e intentando recurrir a chatgpt pero no logramos que funcione.','2023-09-20'),(7034,251,'BeCation - Generación T pt11 - 20/09/2023','El día de hoy nos reunimos todo el grupo de desarrollo de BeCation para definir que vistas teníamos que crear, cómo hacerlas y cómo repartirnos el trabajo. Tras algunos dibujos, nos dividimos las páginas y se me asigno trabajar con la vista VacationManagerCalendar.','2023-09-20'),(7035,261,'20/09/2023','Hoy hice un nuevo diseño 3d en tinkerkat del robot sumo','2023-09-20'),(7036,267,'20/09/2023','El día de hoy trabaje con el modelado 3D, empezando uno nuevo y corrigiendo los errores y añadiendo mejoras del que ya imprimimos','2023-09-20'),(7037,268,'20-09-2023','El dia de hoy despues de descargar el programa de ayer empese con un nuevo diseño 3d para el robot sumo y para el auto.','2023-09-20'),(7038,259,'miercoles 20/9 Nahuel Moreno Practicas Profesionalizantes','Continúe con mi carpeta de campo igual que ayer, y ya planifique lo que hare la clase siguiente EN CASO DE AUN NO HABER LLEGADO A LAS 150 HOJAS de carpeta de campo.\r\n','2023-09-20'),(7039,265,'20-09-2023','Hoy avance con el modelo 3d pero principalmente avance con la carpeta de campo ','2023-09-20'),(7040,257,'20/09/2023','Hoy avance el primer piso y la planta baja, fue una lástima que perdimos mucho de eso porque se freezo la computadora, pero avanzamos lo que perdimos, se puede avanzar mas','2023-09-20'),(7041,260,'','Pasamos la mitad de la jornada debatiendo que nuevas vistas quedaban y como nos ibamos a dividir, mergeamos lo posible asi cada quien empezaba con lo que se le asignó estando todos desde el mismo punto y continué la funcionalidad del vacation manager','2023-09-20'),(7042,263,'20/9','Hoy estuve haciendo unas copias de el personaje ya hecho pero cambiando de color para asi hacer en el futuro skins.','2023-09-20'),(7043,266,'organizacion y delegacion de todas las pantallas ','Hoy como senti que estaba todo muy desproblijo en cuanto a la division de cosas para hacer, le dije a diego que hay que anotar todo. Nos pusimos todos en la pantalla y empezamos a dibujar un diagrama de caso de uso mezclado con un diseño de las pestañas. pensamos todas las posibilidades que tendria el usuario y llegamos a la conclusion que con 8 paginas ya alcanza. entonces las desarrollamos pensandolo bien y las dividimos. ','2023-09-20'),(7044,252,'Clase 46 - Profile Manager View','El día de hoy cree una nueva vista para la aplicacion de BeCation, la vista de la administracion de perfiles. Va a ser una vista que va a tener RRHH para poder deshabilitar, editar. resetear la contraseña o crear un nuevo usuario. Mi idea es tratar de usar NextUI, tengo que importar la libreria de nextui y de tailwind. Trataré de hacer todo lo más rápido posible pero que quede excelente ','2023-09-20'),(7045,254,'20/09/2023','Cambiamos a php el proyecto','2023-09-20'),(7046,250,'Miercoles 20/9','Hoy estuve documentando todo el proceso del curso de flexbox y llegue a las 144 paginas\r\n\r\n','2023-09-20'),(7047,255,'Miercoles 20/9','hoy estuve haciendo la carpeta de campo','2023-09-20'),(7048,328,'Clase 1','Analizando las posibles ideas de proyectos que se pueden realizar a lo largo del año, por lo visto tenemos 3 preparados por ahora, uno sobre cocina, idioma y trabajo.Mejor que sobren ideas antes que falten ya que en cualquier momento pueden pedir un proyecto nuevo','2024-03-08'),(7049,319,'Segunda clase.','En un principio, descargué mi CV en formato PDF y lo subí como tarea, luego me dispuse a crear un repositorio para mi proyecto en Github.\r\nTras eso, me registré en SCRUMstudy para anotarme en la clase de fundamentos de SCRUM. Una vez hecho eso, comencé la tarea del Modulo 2, la cual no llegué a completar.','2024-03-08'),(7050,324,'2da clase de PP','En el dia de la fecha 08/03/2024 creamos las cuentas en encuentrotecnologico, despues me registre en la pagina de SCRUM para poder sacar el certificado obligatorio, me asignaron la fecha del 15/03/2024 y escribo esta bitacora.','2024-03-08'),(7051,323,'Organización ','Hoy estuve hablando con mis compañeros de equipo ya que no tuve una computadora el día de la fecha. hice una breve lectura de los dos primeros módulos del DET pero mi celular esta en muy malas condiciones y esto me deshabilito la habilidad de seguir avanzando.','2024-03-08'),(7052,330,'Clase 1','Analizamos y conversamos sobre las normas APA y PP, ademas de adelantar al hacer el CV y una cuenta de linkedin para hacer las certificaciones obligatorias para poder avanzar a los modulos ','2024-03-08'),(7053,316,'Aprendiendo a utilizar godot','Hoy estuve con mi compañero Mangialavore estuvimos completando cada quien nuestra carpeta de campo, pero sobre todo estuvimos buscando y aprendiendo en base a un curso de YouTube como utilizar el programa godot, el cual sera el motor grafico de nuestro juego.','2024-03-08'),(7054,310,'Aprendiendo a usar Godot','En el día de hoy estuvimos viendo una guía de como usar Godot para comenzar a programar el videojuego. A la ves estuvimos mirando y leyendo desde el modulo 1 al 3 para poder hacerlo.','2024-03-08'),(7055,304,'0.0.1','El dia de hoy debido a la escaces de recursos informaticos decidimos dedicar la tarde a organizar el equipo e idear ideas para el proyecto venidero. Tambien e leido distinta info para luego hacer las tareas','2024-03-08'),(7056,306,'Clase nro. 2','En esta clase termine el formulario del modulo 1, a la vez que me anotaba en el curso de SCRUM fundamentals.','2024-03-08'),(7057,312,'Segunda clase','Hoy explore hay contenidos como dot modulo 0 y 1, carpeta de campo y nomas apa .Por otra parte hice una visualización profunda sobre los certificados obligatorios','2024-03-08');
INSERT INTO `bitacora` VALUES (7058,315,'clase N2','en la clase de hoy realice varias tareas propuestas  de ayer para este mes la tarea n1,n2,n3,n4 aparte de haber creado mi cuenta de linkedin  leer los pdfs de guias de pp,guia de cvs entre otras , tambien un ingreso a la cuenta de scruble y la reserva de uno de sus cursos el dia viernes 15','2024-03-08'),(7059,318,'Segunda Clase','Hoy explore los diferentes certificados que hay que hacer y me cree un cuenta de Linkedin. También empeze con la carpeta de Campo.','2024-03-08'),(7060,320,'Certificación Microsoft Linkedin 1','Comenzé a hacer el linkedin de desarrolla de software.\r\nTambién el test de computrabajo pero nosé como descargar los resultados en PDF','2024-03-08'),(7061,317,'Clase1','analizamos y conversamos sobre las normas pp, creamos el github, el reglamento de practicas profesionalizantes  ','2024-03-08'),(7062,322,'Segunda clase','En la clase del dia de hoy me empece a organizar para saber en que orden debería empezar a hacer las tareas correspondientes a la materia.\r\nPor lo que hoy realice la inscripcion al curso de SCRUM requerido para la empresa.','2024-03-08'),(7063,327,'','en dia de ayer 07/03/24 los comentaron como iba la materia y nos pidieron que plantearamos ideas para nuestro proyecto que fueron de kiosko  y tienda virtual de ropa y un mapa interactivo. en el dia de la fecha 08/03/2024 empeze hacer el curso de analisis de linqued in.','2024-03-08'),(7064,314,'Clase 1 8/3/2024','Estuve Creando mi CV en CompuTrabajo, actualizando mi C.V. y fijándome en los materiales que tengo que realizar y el plan de como funciona la clases. ','2024-03-08'),(7065,305,'2da clase de PP','En el dia de la fecha 08/03/2024 me inscribi para el certificado scrum, un certificado obligatorio. Me asignaron para el dia 15/03/2024 en el horario de 12:00 a 17:00. Despues empece y realice la tarea N°1 de PP y ahora me registre en encuentrotecnologico para crear esta bitacora.','2024-03-08'),(7066,309,'certificación de microsoft-linkdin','dedique el tiempo en leer las guía de documentación y me inscribí al curso de analisis de datos  ','2024-03-08'),(7067,307,'Clase 1','analise las normas apa y pp, se creo el computrabajo en base a mi informacion y experiencia laboral, ademas se agrego lo registrado a la carpeta de campo','2024-03-08'),(7068,321,'clase-2 aprendizage','hoy estube con mi compañera milena monte negro viendo como instalar godot y como se utiliza aprendimos algo de lo basico y vimos que era mas facil de entender que unity','2024-03-08'),(7069,326,'Certificación obligatoria','El día de hoy estuve haciendo el curso de Microsoft-linkedin sobre la IA generativa. De momento completé el capitulo 1 titulado &quot;¿Qué es la IA generativa?&quot; donde aprendí en lineas generales como funciona una IA generativa, en que se diferencia de otros tipos de IA y la importancia de la IA generativa. ','2024-03-08'),(7070,311,'Organización y CompuTrabajo','El día de la fecha 08/03/2024 realize un registro a la plataforma de CompuTrabajo y organice con mis cmpañeros de equipo como vamos a trabajar en el futuro y con quien.','2024-03-08'),(7071,313,'planeo del trabajo y terminando módulos ','hoy empezamos discutiendo de que tratara el juego mas con el apartado de que si este tendrá una historia etc. también todavía no tenemos planeado el estilo de arte de este mismo pero tenesmos la base ya decidida como que sera con una especie de dageon que nuestro personaje recorrerá para conseguir puntos para que este se mejore también continuamos con investigaciones de aplicación que utilizaremos para crear el juego que sera Godot. yo continúe con terminar los diferentes pdf que requerimos como el cv y los test termine un test y el cv así que me falta los certificados que los continuare en mi casa para que en la siguiente semana ya comencemos con la app','2024-03-08'),(7072,325,'Clase 1','lei los pdf que explicaban los articulos de la ley de ed tecnica y todo lo relacionado al marco normativo pp. Adelante el cv en computrabajo y lei lo que habia en la seccion del classrom  llamado modulo 0','2024-03-08'),(7073,308,'Clase 07/05 y 08/05','El dia de ayer se analizo y formaron ideas para el proyecto, teniendo 3 ideas principales y otras 2 mas pero fueron descartadas. Hoy se avanzo con la tarea N°1 leyendo el pdf, luego seguimos con computrabajo y el test de ingles','2024-03-08'),(7074,331,'clase 1','hice una certificación y cree mi carpeta de campo ','2024-03-08'),(7075,329,'2','El dia de hoy 08/03/2024 estuve profundizando mas el tema de la PP a Base de las tareas asignadas que nos dieron. Estuve aprendiento el tema de los formatos, los tipos de formatos, el perfil, lo que hacen en un simulacro de una empresa y ahora por ultimo, nos registramos en encuentrotecnologico para hacer un nuevo registro de bitacora.','2024-03-08'),(7076,337,'Formulario 2, 3, 4','Hicimos junto a Ian Kickbush los formularios numero dos, tres y cuatro','2024-03-13'),(7077,336,'Relleno de formularios.','Hoy realice el formulario N°7, el CV y comencé la tarea N°6.','2024-03-13'),(7078,333,'Avances en la tarea 7 del modulo 5','Hice un avance en la tarea 7 &quot;Introducción a los Proyectos  Institucionales de Prácticas Profesionalizantes&quot;','2024-03-13'),(7079,335,'Modulo 1 y 2','Hoy termine el modulo 1, leí el documento, vi los 2 videos y complete el cuestionario, y el modulo 2. hice el mapa el conceptual del archivo &quot;Introducción a las Prácticas Profesionalizantes&quot;','2024-03-13'),(7080,334,'Modulo 1 y 2','Hoy pude realizar los módulos 1 y 2 junto con sus formularios y otras tareas que pedían. Vi los videos incluidos y leí la teoría. ','2024-03-13'),(7081,341,'Curriculum Vitae','el día de hoy estuve leyendo material sobre como realizar mi currículum y empecé a hacerlo','2024-03-13'),(7082,342,'Tarea Nm°1 &quot;Introduccion a las practicas profesionalizantes&quot; y Tarea Nm°2 &quot;Mapa conceptual&quot;','En el día de la fecha hice la tarea Nm°1 que era un cuestionario de Google con preguntas introductorias a practicas profesionalizantes que teníamos que sacar la información de un pdf que nos mandaron. y hice la tarea Nm°2 que teníamos que hacer un mapa conceptual del pdf que nos habían dado en la Tarea Nm°1','2024-03-13'),(7083,340,'Formularios','Terminé el formulario 3, 4 y el 5 que era muy largo','2024-03-13'),(7084,347,'tareas y modulo 2','hice el módulo dos, estoy empezando el tres ya resolví la primera tarea, me queda pendiente la siguiente tarea','2024-03-13'),(7085,345,'CV y Formulario 5','Estuve toda clase con la compu crasheandose, solo pude terminar el cv y poco menos de la mitad del 5','2024-03-13'),(7086,344,'Formularios','Terminé el mapa conceptual del trabajo n°2, el formulario n°3 y el  currículum. ','2024-03-13'),(7087,339,'Bitácora de PP','Hoy termine el mapa conceptual de la tarea numero 2, y el formulario del modulo 3 (&quot;Habilidades Blandas y Competencias  Profesionales&quot;), empece con el cuestionario de la tarea 5 del modulo 4 (&quot;Guía de Empresa Simulada -\r\nCuestionario&quot;) y con mi Currículum Vitae del modulo 3.','2024-03-13'),(7088,348,'Formulario 2','Hice el mapa conceptual y reinicie la pc como 15 veces, escribo rápido antes de que se me crashee, conclusión la pase medio mal porque siento que me atrase mucho por el tema de la pc\r\n\r\nPD: es la segunda vez que lo escribo pq terminando de escribir lo anterior se me crasheo.','2024-03-13'),(7089,338,'BItacora 13/03/2024','Realice la tarea 2, 3 y 4 de las que me asignaron en la materia.\r\nTuve que hacer diagramas, mapas conceptuales, currículum y cuestionarios. \r\nInvestigué en internet sobre como realizar un buen currículum ya que quería que esta tarea también me sirva para utilizarlo después . \r\n','2024-03-13'),(7090,346,'Formulario 2, 3, 4','El día de hoy realicé los formularios 2, 3 y 4-','2024-03-13'),(7091,348,'formulario 2 ','Hice el mapa conceptual y reinicie la pc como 15 veces, escribo rapido antes de que se me crashee, conclucion la pase medio mal porque siento que me atrase mucho por el tema de la pc','2024-03-13'),(7092,306,'Clase nro. 3','Me creé una cuenta de LinkedIn, con la cual accedí al curso de IA Generativa para conseguir el certificado de Microsoft-LinkedIn. También completé el cuestionario de la tarea número 3.','2024-03-14'),(7093,319,'Tercer clase PP.','En un principio, completé la tarea N°2, realizando el mapa conceptual correspondiente. Luego, leí el material\r\ndel Modulo 3 sobre las Habilidades Blandas, tras eso, realicé el formulario correspondiente, adjunté mi CV y mi\r\nperfil de LinkedIn y completé las tareas N°3 y 4. Al rato largo, finalizé la tarea N°7, que constaba de un formulario\r\nextenso, el cual completé luego de leer el material &quot;5.1 Introducción a los Proyectos Institucionales de Prácticas\r\nProfesionalizantes. ','2024-03-14'),(7094,324,'Tercera clase de pp','En el día de hoy leí las normas APA para poder crear la carpeta de campo, dicha carpeta ya esta creada. Mire el video de la tarea numero 2 y termine la tarea ya mencionada, también me hice un LinkedIn y me metí al curso de ciberseguridad. ','2024-03-14'),(7095,325,'Clase 14/03','Me registre para ingresar al curso de Scrum el día 06/04. También me registre el LinkedIn y realice el test de ingles de 50m de EF SET. Avance con la carpeta de campo y decidiendo ya el grupo para el proyecto hicimos una mini lluvia de ideas para posibles paginas/proyecto.','2024-03-14'),(7096,305,'3er dia de PP','en el día de la fecha 14/03/2024 leí, analice la información dadas por los tutores respecto a las tareas 2, 3 y 4. En la Tarea 2 realice un mapa conceptual de PP. En la tarea 3 hice un cuestionario de habilidades blandas y competencias profesionales. Y por ultimo cree mi CV y mi perfil de linkedin','2024-03-14'),(7097,314,'Curso de Linkedin y anotacion de Scrum','Estuve analizando los cursos y me anote a de cyberseguridad y me anote para rendir el curso de Scrum el dia viernes 22 a las 5 am.','2024-03-14'),(7098,304,'0.1.0',