4-03-14'),(7105,317,'Clase 14/03','En esta clase, saque el turno para la certificación de scrum, termine la primera certificación de LinkedIn, avance con la carpeta de campo, empece a hacer idea con mi compañero sobre el proyecto anual para la pagina','2024-03-14'),(7106,323,'varias tareas','Realice la registración para sacar el certificado de scrum SFC.\r\nLuego mire el video de charla de motivación trabajo nuevas tecnologías BDT Group.\r\nRealice la creación de una cuenta de linkedin y comencé la realización de uno de los cursos de Microsoft- linkedin, este curso es el curso de Fundamentos profesionales del desarrollo de software, por Microsoft y Linkedin.\r\nNo pude continuar porque la batería de mis auriculares murió entonces decidí realizar los módulos de DET.\r\nTermine el primer modulo de DET.\r\nTambién decidimos el cuarto integrante de equipo y pensamos en que va a ser nuestro  proyecto.\r\n','2024-03-14'),(7107,311,'Dia3 campeta de campo, curso scrum y Link','Empece anotándome a un curso de scrum en español para el dia 6/4 a las 7 hasta las 11 luego empece a crear mi carpeta de campo poniendo lo que habia hecho hasta ahora y luego me cree una cuenta en LinkedIn Donde me fije en varios cursos y decidí empezar con el curso de CIRBESEGURIDAD, luego me junte con mi grupo hablamos y unimos al integrante que nos faltaba y luego empezamos hablar sobre el proyectó que haríamos ','2024-03-14'),(7108,321,'conseptos pasicos 14/3/2024','Nos pusimos de acuerdo de como seria el sistema de batalla.\r\nsera un sistema de combates estilo mortal kombat en este estilo podemos hacer versus mas dinamicos','2024-03-14'),(7109,309,'Modulo 1, Modulo 2','Termine de hacer la encuesta del modulo 1 y avance bastante con el modulo 2 hicimos los grupos y se pensaron ideas para el proyecto','2024-03-14'),(7110,349,'14-03','hoy fue mi primer día, así que no hice mucho, primero entre a hacer la certificación de SCRUM, después empece con el modulo 0, lo leí, y luego empece con el modulo 1, y modulo 2 ','2024-03-14'),(7111,320,'Carpeta de campo','comenze a hacer la carpeta de campo registrando todo lo que hice hasta el dia de hoy','2024-03-14'),(7112,310,'Carpeta de Campo y juego','El día de hoy estuvimos hablando sobre el modo de batalla del juego y a la vez estuve haciendo la carpeta de campo. En lo que hablamos sobre el juego surgió hacer un modo batalla combinado entre modo turno y mortal combate','2024-03-14'),(7113,313,'conseptos 14/3/2024','hoy discutimos de manera mas extensa sobre de que tratara el juego final como el modo de combate las ilustraciones y similares  terminamos teniendo un plan de un modo de batalla hibrido entre un modo de turno como los rpg y un combate mas fluido como el de mortal conbat dado una mejor simulación de combate','2024-03-14'),(7114,308,'14/03','Hoy se avanzo mucho con la carpeta de campo, luego realice las tareas numero uno y dos, la segunda quedo a mitad, luego me inscribí en el SCRUM con turno para el 16 de abril, y también continúe sobre el certificado de Microsoft LinkedIn','2024-03-14'),(7115,325,'Clase 15/3','Avance con la carpeta de campo. Se decidió el grupo definitivo para el proyecto y se discutieron distintas posibles ideas para el mismo. Avance con los cursos de linkeding-microsoft','2024-03-15'),(7116,323,'curso de microsoft-linkedin','hoy trabaje en el curso de microsoft-linkedin de desarrollo de software y termine varias secciones','2024-03-15'),(7117,309,'Modulo 2, ideas de proyecto','termine el tp del modulo 2 y estuvimos pensando ideas para el proyecto','2024-03-15'),(7118,321,'pruebas 15/3/2024','hoy estuve probando el lenguaje de godot viendo como crear un control para manejar al personaje','2024-03-15'),(7119,327,'4','en el dia de hoy complete la carpeta de campo y tambien estuvimos hablando de las ideas que teniamos para el proyecto que eran cuatro pero no se pudo concretar ya que se cayo la idea del sistema de gestion kiosko y la pagina web de ropa solo quedaron el mapa interactivo y la palicacion de medicina ','2024-03-15'),(7120,311,'Dia 4 Curso Ciber','DIA 15/3 \r\nseguí viendo el video del curso de LinkedIn que era el de ciberseguridad y ademas estuve pensando sobre el proyecto que haríamos al final de caminar se me vino  a la mente un proyecto de un sistema de incricion y de presentismo mazo menos donde pueda facilitar todo sobre el tema escolar\r\n\r\n\r\n\r\n\r\n\r\n\r\n','2024-03-15'),(7121,330,'Terminando el curso de ciberseguridad','Terminando el curso de ciberseguridad y respondiendo las preguntas. Decidiendo que proyecto hacer\r\n','2024-03-15'),(7122,316,'Modulos','Hoy me centre en hacer módulos mas que nada y tuvimos ligeras discusiones sobre el proyecto con mis compañeros de equipo.','2024-03-15'),(7123,318,'Clase 4','Hoy me inscribí al certificado de SCRUM para el día 19/04. También con mi grupo conformado por Tobias Rojas, Emanuel Aspi y yo (Gabriel Sanabria) empezamos a hablar sobre que proyecto podríamos realizar, entre ellas están una aplicación meteorológica y un blog.','2024-03-15'),(7124,326,'Certificacion IA generativa - Carpeta de campo','En el día de hoy complete el curso de IA generativa, obteniendo así exitosamente la certificación, principalmente para terminarlo me faltaba el capítulo 4 &quot;ética y responsabilidad&quot;, donde se hablo de aptitudes morales y ejecutivas necesarias para trabajar con la IA generativa. También me puse a completar la carpeta de campo, colocando un poco más de contenido a ciertas fechas, la idea es avanzar dos paginas por día. ','2024-03-15'),(7125,351,'clase 1','charlamos sobre proyecto anual.. con Lucia Alvarez y Belen Paz','2024-03-15'),(7126,310,'Terminación de un modulo más','En las clases de hoy me puse a terminar el modulo 4 que tan solo me faltaba la tarea 6, una ves que termine esto seguí con la guía del modulo 5 y estuve observando la actividades me faltan por terminar dos módulos y ya tendría todo. Luego seguí con la carpeta de campo y me di cuenta que desde el primer día me falto agregarles algunas cosas de más.','2024-03-15'),(7127,313,'lo que hice hoy','Hoy comencé a explicar a mi grupo un poco sobre cómo se programa en los scripts de Godot, realizando una prueba de un juego en vista cenital y de plataforma. Después, continué con algunos módulos adicionales.\r\nDurante la explicación, mostré cómo se desarrolla un juego en Godot, desde la creación de escenas y nodos hasta la implementación de la lógica del juego mediante scripts. Realizamos una prueba básica de un juego en vista cenital y de plataforma para demostrar conceptos clave como el manejo de controles de jugador, la detección de colisiones y la interacción con el entorno.\r\npor ultimo seguí con algunos módulos ','2024-03-15'),(7128,314,'Terminando el curso de ciberseguridad','Termine el curso de cibyerseguridad, y pensamos en el proyecto para hacer con el grupo \r\n','2024-03-15'),(7129,312,'Clase 4','Hoy me inscribí en el certificado  Scrum .Leí  el modulo 3 y 4.Por ultimo se decidió por tomar el proyecto de blog entre mi grupo','2024-03-15'),(7130,349,'15-03','Hoy termine el modulo dos y empece el modulo numero tres, luego realice la carpeta de campo, y me puse a pensar ideas para el proyecto grupal y intercambiando ideas con Claudio','2024-03-15'),(7131,350,'Clase 3','Charlamos en equipo sobre el proyecto Anual \r\n\r\nLei y comprendi el modulo 0\r\n\r\nComence el Modulo 1','2024-03-15'),(7132,328,'Terminando el curso de ciberseguridad','termiinamos de decidir las ideas y nombres, de ultimo nos quedo de idea hacer una app de ejercicio y un rappi','2024-03-15'),(7133,336,'Relleno de cuestionarios','Hoy realice las tareas N° 6 y 8, mientras que hice el guion del 9. ','2024-03-20'),(7134,340,'Siguiendo con los formularios','Hoy terminé el formulario 5, además hice el 6 y el 7 con mi compañero Célico ','2024-03-20'),(7135,345,'Completando formularios','Realicé el formulario 5, 6(con Rivarola Guadalupe) y 7 ','2024-03-20'),(7136,353,'Actividades del dia','Realize los cursos de ingles