letar Carpeta de Campo','Hoy estuve finalizando mi carpeta de trabajo, donde recopilé todas las actividades realizadas en Godot 4. Además, añadí el contenido de un curso que había completado, pero había olvidado mencionar anteriormente.','2024-04-26'),(7388,321,'26/04/2024','Hoy estube haciendo mi carpeta de campo\r\n','2024-04-26'),(7389,322,'Clase 12','He realizado el product list, el backlog y los requerimientos del cliente necesarios para el proyecto','2024-04-26'),(7390,314,'26/4/2024','Hoy empenze  con los diagramas y avance un poco mas con la pagina web.','2024-04-26'),(7391,306,'Clase 14','En la clase del día de hoy concreté el diagrama de carta de GANTT','2024-04-26'),(7392,349,'26/04','En el dia de hoy realize la carpeta de campo ','2024-04-26'),(7393,350,'Clase 10','Se realizo el dia de hoy el nivel 0 del diagrama de flujo de datos ','2024-04-26'),(7394,307,'clase n°8 - 26/4/2024','hoy se actualizo el diagrama de gantt y ademas de eso se actualizo el diagrama de camino critico','2024-04-26'),(7395,305,'Clase 12 de PP','En el dia de la fecha 26/04/2024 estuve realizando mi carpeta de campo, y tambien estuve trabajando en el GANNT hecho en proyect libre','2024-04-26'),(7396,316,'Completando carpeta de campo','El día de hoy me dedique a completar mi respectiva carpeta de campo ya que hace varias semanas que no la actualizaba, esto me ayudo a repasar todo lo que había hecho durante este periodo que no tuve tiempo de escribir en la misma.','2024-04-26'),(7397,313,'Expresar emociones o ideas complejas puede ser difícil, pero el lenguaje nos ayuda a capturar la complejidad del mundo.','Hoy ayudé a mis compañeros con sus carpetas de campo, asegurándome de que cumplieran con las normas APA. También perfeccioné la mía, corrigiendo errores de formato. Esta experiencia fortaleció nuestros conocimientos y nuestra unidad como equipo.','2024-04-26'),(7398,317,'26/4','Hoy avance con los bocetos de la pagina y segui completando la carpeta de campo\r\n','2024-04-26'),(7399,318,'Clase N°12','Hoy se finalizo el FODA, y también se empezó con el CPM.','2024-04-26'),(7400,328,'26/4/2024','terminando los demas diagramas y completando la carpeta de campo','2024-04-26'),(7401,320,'Finalizacion del primer versionado del proyecto','Asi es, al menos en la parte del sistema funcional.\r\nAyer tuve que rediseñar practicamente todo el codigo de la pagina del cocinero debido a una idea de cambio de diseño, hoy pude terminarlo.\r\nLuego de terminar oficialmente el proyecto talvez sigamos improvisandolo, o comenzar con otro proyecto.','2024-04-26'),(7402,330,'CLASE','Hoy avanzamos con la pagina y actualizamos el gantt\r\n','2024-04-26'),(7403,331,'clase 8','hoy avance el gantt e hice la investigacion de API y framework y me falto buscar esquemas similares\r\n\r\n','2024-04-26'),(7404,315,'bitacora 26/04/24','El dia de hoy fue un repaso de todo lo visto al momento de esta bitacora e ingresado en la carpeta de cmapo hoy fue un dia de redaccion de esta llegue a la meta de 30 paginas de 50 que hay que realizar,buen avance','2024-04-26'),(7405,323,'Proyecto ','Hable con mis compañeros de equipo sobre un cambio de proyecto y decidimos cambiar de proyecto.','2024-04-26'),(7406,311,'Dia 8 26/4','completé la carpeta de campo y me puse hablar con mis compañeros sobre que hariamos sobre el proyecto','2024-04-26'),(7407,318,'Clase N°13','Hoy se actualizo el CPM, ya que anteriormente se realizo mal, tambien se realizo la v2.0.0 del Diagrama de Gantt.','2024-05-02'),(7408,308,'02/05','Hoy empezamos actualizando el GANTT y el Kanban, teneinedo bastantes problemas en el GANTT, luego continuamos haciendo la pagina de login buscando los mejores colores','2024-05-02'),(7409,305,'Clase 13 de PP ','En el dia de la fecha 2/05/2024(un dia antes que mi cumpleaños) realice el camino critico.','2024-05-02'),(7410,350,'Clase 11','Se hizo nivel 2 del diagrama de flujo de datos','2024-05-02'),(7411,307,'clase n°9 - 2/5/2024','se termino el diagrama de camino critico y se comnezo