no estuve ocupado en el sentido tradicional, me sumergí en un proceso creativo y colaborativo que resultó muy gratificante.','2024-05-02'),(7432,306,'Clase 15','En esta clase se modificó el diagrama de GANTT para agregar tareas faltantes y modificar las ya agregadas en la clase anterior','2024-05-03'),(7433,319,'3/5','En el dia de hoy progresamos agregando tareas en nuestro Tablero Kanban. Luego finalizamos el primer diagrama de GANTT para dar inicio al segundo.\r\nIniciamos el proceso de investigacion sobre los conocimientos que debemos adquirir para varios de los primeros pasos que lograran hacer funcionar el algoritmo\r\nprincipal de nuestra aplicación.','2024-05-03'),(7434,350,'Clase 12','Se hizo el nivel 3 de flujo de datos','2024-05-03'),(7435,321,'3/5/2024','hoy estube prosiguiendo con el inventario en intente implementar las mecanicas de slot y no pude complentarlo luego estubimos hablando de como va a ser en inventario','2024-05-03'),(7436,322,'Clase n14','En la clase de hoy he realizado la respectiva encuesta sobre la reseña de la pagina en la que tenemos que trabajar para que los clientes/usuarios puedan enviarnos feedback sobre la pagina, tambien he realizado el boceto del reproductor que aun tenemos que mejorar pero en el que ya tenemos un diseño claro','2024-05-03'),(7437,307,'clase n°10 -3/5/2024','hoy se codifico la base de datos en código sql, ademas de terminar de verificar el estado de los demás diagramas','2024-05-03'),(7438,318,'Clase N°14','En el día de hoy se finalizo la v2.0 del CPM y la v2.0 del Diagrama de Gantt, también se empezó con el Diagrama de Entidad - Relación.','2024-05-03'),(7439,324,'PP clase numero 15 ','En el dia de la fecha, me dispuse a buscar informacion sobre como crear una base de datos no relacional(mongodb), encontre cursos por 15 usd, asi que antes de comprarlo me dispuse a estudiar por w3schools. Tambien en grupo asignamos ahora si los diagramas que va a hacer cada uno, con eso tambien ya hicimos el tablero kanban, para luego realizar el diagrama gantt.','2024-05-03'),(7440,312,'Clase 15','Hoy lo que hice fue propobner nuevas tareas ,hacer el diagrama de Gantt .','2024-05-03'),(7441,313,'ayuda no se que poner ','Hoy, continué colaborando con mis compañeros en el proyecto, dedicando tiempo a explorar diversas fuentes de inspiración, desde texturas hasta gráficos de otros juegos. Fue un día emocionante lleno de descubrimientos compartidos, fortaleciendo nuestra unión como equipo y alimentando nuestra determinación de crear algo extraordinario juntos.','2024-05-03'),(7442,316,'Continuando Sprites','El día de hoy, continue personalizando y creando los Sprite del personaje principal del juego basándome en diferentes Sprite ya creados para poder luego crear mi plantilla de personajes propia','2024-05-03'),(7443,314,'3 5 2024','hoy   \r\ntermine el foda y el diagrma de secuencida','2024-05-03'),(7444,310,'Charla Grupal','El dia de hoy estuvimos hablando sobre como seriael juego porque hay un integrante del grupo que no pone de su voluntad ni quiere ponerse del lugar del grupo.','2024-05-03'),(7445,328,'clase n°10 -3/5/2024','se terminaron los ultimos 3 diagramas, base de datos y se continua la pagina','2024-05-03'),(7446,317,'Clase 3/5','Hoy estuve avanzo primeramente con la carpeta de campo, empece el diagrama de camino critico, arregle el gantt de mi compañero y complete tareas pendientes','2024-05-03'),(7447,349,'3-5-2024','hoy investigue,y realice el prototipado de la pagina ','2024-05-03'),(7448,323,'03/05/24','Investigación grupal sobre que diagramas se deben realizar y asignación de la realización de los mismos a los integrantes del equipo','2024-05-03'),(7449,330,'clase 10','Hoy terminamos tds los diagramas y iniciamos la pagina\r\n ','2024-05-03'),(7450,311,'3 / 5 investigacion y tara asignadas','investigue sobre donde puedo codificar para hacer la app también dividirnos los diagramas para cada uno','2024-05-03'),(7451,331,'clase 9','hoy avance un cuestionario ','2024-05-03'),(