i cuando se perciban','2024-06-13'),(7726,312,'Clase 25','Hoy actualiza la base de datos y organización de tareas','2024-06-13'),(7727,325,'Clase 16','\r\nHoy segui avanzando con el crso de freecodecamp con la api de musica de javascript. Tambien le consulte al profe para adaptar el php a javascript y me dijo que podia usar json. Me paso un pdf con como usar php y un pagina.\r\ncristian y martin hicieron la pagina de login. -Lucia y luciano iniciaron la pagina principal.','2024-06-13'),(7728,329,'Clase 23 de PP','Hoy me dediqué a hacer importantes modificaciones en la página web principal, abarcando desde los estilos y animaciones hasta la incorporación de código Python en un segundo archivo. Además, investigué acerca de diversos frameworks de Python y tomé notas de aspectos que serán útiles para mí en el futuro.','2024-06-13'),(7729,317,'clase 13/6','Hoy con el grupo del proyecto empezamos realizando partes de la pagina, con mi compañero cris realice el login que nos quedo inconcluso, faltando la conexion php/mysql y php/html :(\r\n','2024-06-13'),(7730,327,'13-06','En el dia de la fecha realize la actualizacion del gantt tambien a su vez complete la carpeta de campo con el material que habia realizar anterior mente tambien empeze a realizar el diagrama de DFD eso es todo amigos ','2024-06-13'),(7731,351,'clase 15','ayude a alvarez en el diseño de la pagina principal','2024-06-13'),(7732,308,'Clase 13/06','Se termino el Diagrama de Caso de Uso (DCU) y se empezó el Diagrama de Flujo de Datos (DFD), también se actualizo el Diagrama GANTT agregando una fecha importante (05/07) para la entrega de todos los diagramas','2024-06-13'),(7733,313,'movimiento naranja ','Hoy, junto con mi colega Milena Montenegro, nos enfocamos en crear y programar el movimiento del enemigo cuando no está detectando al jugador. Luego, tratamos de activar la interacción entre los enemigos cuando se perciban entre sí.','2024-06-13'),(7734,350,'Clase 21','Rediseñe y corregi errores del nav','2024-06-14'),(7735,321,'14/06/24','Hoy dedicamos tiempo a completar la carpeta de campo, ya que me percaté de que había olvidado añadir ciertos elementos durante el último mes. Por lo tanto, pasé un tiempo escribiendo detalladamente todas las actividades y observaciones realizadas en ese período.','2024-06-14'),(7736,310,'Carpeta de campo','Hoy dedicamos tiempo a completar la carpeta de campo, ya que me percaté de que había olvidado añadir ciertos elementos durante el último mes. Por lo tanto, pasé un tiempo escribiendo detalladamente todas las actividades y observaciones realizadas en ese período.','2024-06-14'),(7737,307,'clase n°20 - 14/06/2024','hoy se actualizo la carpeta de campo tomando como referencia diversas fuentes y se avanzo la pagina para poder terminarla en breves','2024-06-14'),(7738,322,'clase 24','termine el login ????','2024-06-14'),(7739,318,'Clase N°25','En el día de hoy se empezó con la vista principal de la pagina.','2024-06-14'),(7740,305,'Clase 24 de PP','En el dia de la fecha 14/06 trabaje poco respecto al proyecto, hicimos cambios respecto al algoritmo, estuve concentrado en una &quot;prueba&quot; importante, para la proxima clase voy a ser mas productivo.  ','2024-06-14'),(7741,320,'Finalizacion del proyecto','Finalizacion del proyecto de dodger\r\nahora a avanzar con el point of sale\r\n','2024-06-14'),(7742,330,'14-06-2024','Se avanzo la pagina de y se inicio con lo de php','2024-06-14'),(7743,351,'clase 16','rediseñe los bocetos de la pagina principal','2024-06-14'),(7744,327,'14-06','en el día de la fecha no pudimos adelantar tanto el proyecto pero si estuvimos realizando el diagrama de flujo de datos pero no llegamos a terminarlo por el tiempo y también porque estuve completando la carpeta de campo eso es todo amigos. ','2024-06-14'),(7745,328,'clase n°20 - 14/06/2024','se actualizo la pagina','2024-06-14'),(7746,309,'carpeta, correción','Se avanzo con la carpeta de campo y corregí algunos diagramas','2024-06-14'),(7747,319,'Clase 24 PP'