24-06-14'),(7754,325,'clase 16','Hoy empece con .la pagina de reproduccion con el html y el css. Continue los ejercicios de freecodecamp de la api de musica. Tambien modifique la base de datos agregando una  variable pra la img y un scr para el link del archivo en &quot;contenido&quot;\r\nLucia y luciano siguieron con la pagina vprincipal. Falto martin.','2024-06-14'),(7755,306,'clase 21','En la clase de hoy segui con el codigo de python que va a ir insertado en la pagina de PassMat','2024-06-14'),(7756,304,'1.3.4','El dia de hoy tuve curso de JS, en este e aprendido sobre los arrays y las funciones que lo rodean, aparte de algunos usos usuales que se le aplican','2024-06-14'),(7757,307,'dia 1 de gs1','hoy se realizo una introduccion respecto a la empresa y ademas de eso nos mostraron la distribucion de cada area para poder facilitar el trabajo segun el sector correspondiente','2024-06-18'),(7758,304,'1.4.0','El día de hoy empecé en GS1 (por fin). Fue un día de introducción por lo que todavía no tenemos PCs, nos dedicamos a conocer las distintas áreas, ver a grandes rasgos que vamos a hacer, a conocer a las otras personas y las distintas áreas. ','2024-06-18'),(7759,343,'Vistas','trabajando en las vistas de la pagina en Visual Studio Code','2024-06-19'),(7760,356,'Mis primeros dias.','Al ser de mis primeros días en PP, me senté con mis compañeros de grupo para que me expliquen sobre el proyecto y saber lo que debo realizar.','2024-06-19'),(7761,353,'Base de datos','arreglamos fallos de la base de datos','2024-06-19'),(7762,340,'19-06','hoy hice codigo','2024-06-19'),(7763,345,'Vistas html+css','Hice las vistas de remeras, pantalones, conjuntos y zapatillas ar','2024-06-19'),(7764,337,'Avance con la vista de Figma','Con mi compañero Enzo estuvimos avanzando en algunas partes de vista de Figma, arreglando algunas cosas y agregando partes que nos faltaban.','2024-06-19'),(7765,348,'19/06','Hoy avance en el codigo hml','2024-06-19'),(7766,354,'estuve realizando las vist