ntaje del mismo ataque normal ','2024-08-02'),(7846,309,'Descripción de inicio','Por petición del Scrum master escribí una descripción de la metodología startup para el inicio','2024-08-02'),(7847,329,'clase 28','sigo escribiendo las cosas en la carpeta de campo aceraca de la estructuracion de la pagina y tuvimos una charla informativa de que al final no vamos a usar django','2024-08-02'),(7848,307,'clase del 02-08-2024|','hoy se actualizo la carpeta de campo','2024-08-02'),(7849,312,'2/8','Hoy se hicieron pruebas para usarlo con la base de datos y hubo cambios en la card .','2024-08-02'),(7850,330,'clase del 02-08-2024','se agrego contenido a la carpeta de campo\r\n','2024-08-02'),(7851,341,'Ethereum arg','fuimos al cmd de barracas con el profe mcloughlin a presenciar la charla, aprendimos de blockchain y mas cosas','2024-08-07'),(7852,340,'Vinimos al encuentro ','','2024-08-07'),(7853,348,'Hoy vinimos a CMD barracas a una charla sobre etherium','','2024-08-07'),(7854,356,'Encuentro Etherium','Estuvimos en la charla sobre etherium, las brockchains y las cryptos','2024-08-07'),(7855,353,'Charla Ether','hoy tuvimos una charla del GOB Y ETHER \r\n','2024-08-07'),(7856,342,'Charla ethereum','Vinimos al cmd y nos dieron una charla de ethereum y sobre todo lo relacionado ','2024-08-07'),(7857,344,'Salida','Charla de Ethereum en el CMD Barracas ','2024-08-07'),(7858,345,'Charla Ethereum','De 9:30 a 1:30','2024-08-07'),(7859,336,'Etherium evento','Fui al evento de etherium donde hablamos de blockchain y demás contenido. ','2024-08-07'),(7860,335,'Correccion de codigo','me puse a corregir el codigo de matias morales, lo que estaba en el repositorio de github','2024-08-07'),(7861,326,'Carpeta de campo','Se avanzó la carpeta de campo explicando las vistas de la pagina web y su relación con la composición de un turno, como podría ser la fecha, la razón que tiene mucho que ver con el área en el que se va a tratar y el número de turno.','2024-08-08'),(7862,310,'Terminacion de tilemaps','El día de hoy estuve trabajando intensamente en la finalización del mapa que nuestro compañero utilizará para su exposición en la charla. Me aseguré de que el mapa estuviera completamente terminado y optimizado para sus necesidades. Una de las características clave que implementé es el sistema de colisión, que es esencial para garantizar que los usuarios no puedan atravesar áreas que no deben. Este sistema no solo mejora la funcionalidad del mapa, sino que también ayuda a mantener la integridad de la presentación al evitar errores o distracciones durante la exposición. Estoy satisfecho con el resultado y confío en que esto contribuirá significativamente al éxito de la charla.','2024-08-08'),(7863,324,'cursillo','en el dia de la fecha estuve realzando el curso de javascript e hice algunos ejercicios propuestos','2024-08-08'),(7864,320,'Avanze','Avanze de la nueva idea, proyecto.\r\nBasicamente unos dibujitos y ya estara.','2024-08-08'),(7865,350,'Clase 26','Se hizo el registrarse del modal','2024-08-08'),(7866,351,'clase 21','hoy casi termino el boceto de la playlist/album','2024-08-08'),(7867,312,'8-8-24','HOY LO QUE SE HIZO FUE LA ESTRUCTURA DE LA PAGINA WEB SE BUSCO IDEAS PARA LAS CARDS YA QUE LAS DE HAORA NO SON BASTANTE SOSTENIBLES A LARGO PLAZO,POR  OTR APARTE SU DETALLO PROBLEMAS CON LAS IMAGENES EN LAS CARDS Y SE TOMO REFERNCIA DE KICKSTARTER DE COMO SERA LA DIVISION DE LOS PROYECTOS, COMO ESTARAN UBICADOS LA INFORMACION, IMAGENES ,ETC\r\n','2024-08-08'),(7868,321,'8/8/2024','el dia de hoy estuve terminando el mapa para que nuestro compañero pueda usarlo para exponer en la charla, el mapa tiene collishion que ayuda a no traspasar las partes q no queremos','2024-08-08'),(7869,306,'Clase 29','En la clase del dia de hoy, al no venir la mitad de mis compañeros, no tuve la posibilidad de ser muy productivo. A pesar de eso, estuve viendo el código de la pagina buscando formas de convertir la misma en una aplicación de escritorio, que es nuestra idea.','2024-08-08'),(7870,307,'clase del 08/08/2024','hoy se realizo la carpetga de campo para adelantar contenidos del mismo y poder llegar al objetivo minimo de 150 hojas para el final del bimestre\r\n','2024-08-08'),(7871,315,'bitacora dia 08/08/2024','En el dia de hoy me dedique a plasamar en hoja las actividades que realice los anteriores dias partiendo de la base del sitema de caja','2024-08-08'),(7872,309,'Carpeta y D3','Estuve llenando la carpeta y también buscando mas fuentes sobre D3','2024-08-08'),(7873,316,'Creando proyectiles y teniendo pasantia','El día de hoy me dedique a arreglar con mis compañeros de pasantía que íbamos a hacer, y paralelamente busque como programar un proyectil en Godot 4','2024-08-08'),(7874,349,'8-8','Hoy realice la carpeta de campo de lo que hice en ford','2024-08-08'),(7875,313,'vida, barra de vida , inventario y mapa','Hoy trabajé en varias mejoras clave para el juego. Implementé un botón que permite al jugador regenerar su vida, junto con una barra de vida simple para visualizar su estado de salud. También corregí errores en el sistema de inventario, mejorando su funcionalidad. Además, añadí un mapa al juego y solucioné los problemas iniciales que surgieron con su integración, asegurando una navegación más fluida para el jugador.','2024-08-08'),(7876,329,'clase 29','LLEGUE A LAS 118 PAGINAS VAMOOOOOOOOOO','2024-08-08'),(7877,326,'Prototipado','La vista de los prototipados de fecha y horario fueron terminados, ambas vistas conforman parte de los pasos necesarios para sacar un turno.','2024-08-09'),(7878,308,'Clase 09/08','Hoy se siguio con la vista trabajada la semana pasada y se empezó la viste nueva de esta semana, a su vez se crearon nuevos prototipados y se aclararon ideas pendientes para otras vistas','2024-08-09'),(7879,310,'árbol de habilidades','Hoy, junto con mi compañero, hemos alcanzado un importante hito en nuestro proyecto: la creación de un árbol de habilidades. Este árbol es una representación visual detallada que organiza y clasifica las distintas competencias y conocimientos necesarios para el desarrollo exitoso del proyecto. Nuestra intención es integrarlo en la presentación final para ilustrar de manera clara y estructurada cómo se distribuyen las habilidades requeridas entre los miembros del equipo y cómo estas habilidades contribuyen al logro de nuestros objetivos.\r\n\r\nDurante el proceso de creación, nos aseguramos de identificar y categorizar cada habilidad relevante, teniendo en cuenta tanto las capacidades técnicas como las habilidades blandas necesarias. El árbol de habilidades no solo facilita una visión general del proyecto, sino que también permite destacar las fortalezas individuales y colectivas de nuestro equipo, así como las áreas que podrían necesitar desarrollo adicional.\r\n\r\nEste recurso visual será fundamental en la presentación, ya que proporcionará una imagen clara y comprensible del enfoque estratégico que hemos adoptado para abordar los desafíos del proyecto. Estamos seguros de que este elemento enriquecerá nuestra exposición, demostrando de manera efectiva la planificación y organización que hemos implementado.','2024-08-09'),(7880,350,'Clase 27','Se hizo el php y la conexion a la base de datos pra el login y regristrar','2024-08-09'),(7881,315,'bitacora dia 09/08/2024','en el dia de hoy me vi en l a tarea de documentar el apartado de php de todas las pagina ','2024-08-09'),(7882,351,'clase 22','termine el boceto de playlist para la pagina','2024-08-09'),(7883,305,'Clase 29 de PP','En el dia de la fecha, junto a luca pieroni, vimos un videotutorial acerca de las funcionalidades del framework electron, para poder crear nuestra propia aplicacion de escritorio usando como cimientos nuestra pagina web ya creada.','2024-08-09'),(7884,307,'clase del 09/08/2024','hoy se actualizo la carpeta de campo para llegar al objetivo de la cantidad de hojas esperadas','2024-08-09'),(7885,321,'09/08/2024','Hoy, junto con mi compañero, logramos completar un árbol de habi