e necesito implementar una mecánica similar en mi enemigo en godot, luego empece a implementarlo pero debido a la falta de tiempo todavía esta muy verde el proyecto.','2024-11-08'),(8438,326,'Carpeta de campo','En el día de la fecha me dedique a completar la carpeta de campo, explique un poco acerca del código CSS del index del proyecto, explicando propiedad por propiedad y su función dentro de una sección en particular de la página. ','2024-11-08'),(8439,320,'nuevo proyecto','nuevo proyecto rahhhh\r\na la idea se le ocurrio a Saddam\r\nespero escribir 50 paginas con esto (no hay manera)','2024-11-08'),(8440,318,'Clase N°52','El día realice cambios en ciertos archivos agregándoles un alert de js donde avise el cambio hecho y te redireccione a la pagina indicada para seguir, y modifique un poco las cards, agregándole un ancho y altura máximos para que nunca se agranden de mas.','2024-11-08'),(8441,311,'error del Registro.php y pagina de presentismo','Hoy segui con el Registro.php haciendo el php me siguio dando error estuve toda la clase consultando con el profesor y chagtp pero al final me seguia dando error asi que decidi pedirle el php a Gabriel Sanabria me lo paso y lo puse en el mio y para hacerla mas rapida le dije a chatpg que me hiciera los campo por mi y me dio error y los estuve modificando hasta que se acabo la hora Tambie puse la pagina del presentismo a esta carpeta que tengo yo','2024-11-08'),(8442,305,'Clase 37 de PP','En el dia de la fecha despues de mucho intentos para resolver un problema grave, junto a mi &quot;colega&quot; facundo gonzales pudimos resolver ese problema que nos agobio durante mucho tiempo(tres semanas), estamos contentos con el desarrollo del proyecto, se acerca el fin :) ','2024-11-08'),(8443,309,'presentación, carpeta de campo','consulte la presentación con el grupo y estuve completando la carpeta de campo','2024-11-08'),(8444,329,'41','El dia de hoy despues de 3 semanas, LOGRAMOS que las constraseñas se muestren junto a mi &quot