nuevas funciones','2024-11-14'),(8475,329,'42','El dia de hoy hice el deiseño de paginas para cambiar la estetica que es lo que faltante y listo, passmat a 95% SE ACERCA EL FINN','2024-11-14'),(8476,309,'Proyecto ','Hoy estuve haciendo el archivo para que los usuarios puedan subir el nombre y descripción de sus proyectos ','2024-11-14'),(8477,313,'ataques especiales 2 ','Hoy estuve trabajando en finalizar los ataques especiales de los enemigos en el juego. Implementé uno que realiza una tacleada poderosa, otro que al morir se multiplica en versiones más pequeñas y rápidas, y finalmente, un ataque a distancia para mantener al jugador alerta. Estos movimientos aportan variedad y complejidad, aumentando el desafío y haciendo el combate más interesante.','2024-11-14'),(8478,325,'Salida EkoParty','Salimos con el curso y los profesores al evento EkoParty desde las 10hs hasta las 17hs.','2024-11-15'),(8479,334,'EkoParty ciberseguridad','hoy fuimos como parte de practicas a la eko party, supongo que habra tematica diferente por dia ya que duraba varios y hoy habra sido sobre ciberseguridad. Nos hacercamos a bastantes stands interesantes, algunos te hablaban sobre como funcionaba su empresa mientras que otros eran solamente juegos. Fue muy divertido. ','2024-11-15'),(8480,353,'Presentación ','hoy se presentó los proyectos de los grupos ','2024-11-20'),(8481,341,'ULTIMA BITACORA','HICIMOS LA PRESENTACION DEL PROYECTO EN EL SUM','2024-11-20'),(8482,343,'','','2024-11-20'),(8483,335,'','Hoy presentamo el proyecto ','2024-11-20'),(8484,355,'exposicion del trabajo','hoy hicimos la exposición del proyecto visual novel y ademas cerramos notas','2024-11-20'),(8485,333,'presentacion','Hoy hicimos la presentacion del proyecto y aprobe como el goat que soy','2024-11-20'),(8486,336,'Entrega de de proyecto y defensa','Nos dedicamos a defender el trabajo realizado en el año','2024-11-20'),(8487,334,'Exposicion y cierre de practicas','Hoy presentamos nuestro proyecto de la visual novel y cada uno de nuestro grupo hablo sobre sus contribuciones. ','2024-11-20'),(8488,344,'Presentación ','Presentación del proyecto','2024-11-20'),(8489,348,'hoy presentamos el ecommerce','','2024-11-20'),(8490,339,'','hoy hice un poco mas de carpeta de campo, y hoy tuvimos la presentacion final del proyecto ','2024-11-20'),(8491,346,'Presentación final del proyecto ','','2024-11-20'),(8492,347,'20/11/2024','exposicion proyecto','2024-11-20'),(8493,340,'Presentación final','Hoy hicimos la presentación del proyecto y la entrega de la carpeta de campo. ','2024-11-20'),(8494,345,'Presentación de la pagina','Presentamos la página y, si la carpeta de campo está bien, doy por cerrada la materia','2024-11-20'),(8495,348,'hoy solo vinimos para dar el presente :)','','2024-11-27'),(8496,344,'Presente','Hoy vine a dar el presente','2024-11-27'),(8497,341,'VINE A HACER CARPETA DE CAMPO','HICE 15 PAGINAS, VOY POR LA 175 Bv','2024-11-27'),(8498,337,'Avance carpeta de campo','En el día de la fecha para practicas profesionalizantes, estaba en 93 páginas y llegue a un total de 104, avancé 11 páginas bastante rápido','2024-11-27'),(8499,343,'','','2024-11-27'),(8500,335,'Nada','No hice nada','2024-11-27'),(8501,378,'Módulo 1','Terminé el módulo 1 de DET y empecé a trabajar en el segundo.','2025-03-12'),(8502,371,'Introduccion','Dia: 12/03/25\r\nTuvimos la charla sobre las Practicas Profesionalizantes con Consorti, sobre como eran, funcionaban y que era lo que ibamos a  hacer si entrabamos a una empresa o algo.\r\nVimos los primeros videos del modulo 1 y hicimos la actividad que venia cone ella. \r\n\r\nPrimer video de instroduccion: Explicacion de los alumnos de universidades y escuelas de su experiencia en las empresas,\r\n el ambiente, como se sentian y sobre todo lo que pensaban sobre el lugar, en como iba a hacer su desarollo en su trabajo.\r\n\r\nSegundo video de instroduccion: Hablan varias personas importantes (Eric Engler, Juliana Bertevello(2), Silvina Brites(2), \r\nAriel Ratti, Diego Guerrero) sobre lo que empiezan a hacer lo/as alumnos de 6° año de las escuelas técnicas en las Practicas Profesionalizantes ','2025-03-12'),(8503,368,'Introducción a Prácticas Profesionalizantes','En el comienzo de la clase escuchamos y discutimos el reglamento y funcionamiento de Prácticas Profesionalizantes y Laboratorio\r\nLuego comencé a realizar los módulos 0, 1 y 2 junto a sus respectivas tareas en el tiempo restante de la clase. ','2025-03-12'),(8504,374,'Introducción a practicas profesionales','En el día de hoy hemos hablado acerca de la materia como se aprueba y como es el funcionamiento del mismo y en los ultmos bloques he trabajado con el material a entregar para este mes, como por ejemplo creación de CV y avancé con el modulo 0,1 y 2 de la DET con el fin de comprender el funcionamiento de la materia. ','2025-03-12'),(8505,366,'Introduccion a las Practicas Profesionalizantes','Hoy fue la primera clase de Practicas Profesionalizantes, el profesor estuvo explicándonos todo como funciona, los módulos, elección de proyectos, practicas externas, etc.\r\nLuego empece a hacer los módulos, hoy pude hacer el modulo 1 y 2.','2025-03-12'),(8506,367,'Introducción a PP','Me dediqué a la elaboración de los módulos 0, 1 y 2 de  la DET con el fin de comprender el funcionamiento de las Prácticas Profesionalizantes. ','2025-03-12'),(8507,373,'Introducción a las Prácticas Profesionalizantes','En el día de hoy, en el horario de contra turno.\r\nTuvimos una introducción a las PP (Practicas Profesionalizantes), en la cuál se nos explicaron conceptos básicos, reglamento y cosas a tener en cuenta, nos comentaron acerca del CCD y nos encomendaron empezar a leer y completar los módulos de PP. ','2025-03-12'),(8508,381,'Introducción a la materia','Escuchamos al profesor dar la introducción a la materia. Y empezamos a realizar los módulos. ','2025-03-12'),(8509,362,'modulo 1, modulo 3, modulo 7, test de ingles para el CV','realize el modulo 1 de el DET (el Cuestionario), realize el modulo 3 del DET (tambien del Cuestionario) y por temas de tiempo deje por la mitad el modulo 7, complete el test de ingles para el CV con la 2da puntuacion mas baja','2025-03-12'),(8510,380,'Introducción a la materia PP','Recibimos del profesor la introducción general y futura sobre PP, después de eso nos registramos en Encuentro Tecnológico y empezamos a realizar los módulos DET','2025-03-12'),(8511,360,'Introducción a PP','Escuchamos el reglamento f funcionamiento de PP por nuestro profesor y consultamos nuestras dudas. Después empecé a hacer el módulo 1, 2 y 3','2025-03-12'),(8512,365,'introducción a PP e Inicio de módulos DET ','El día de la fecha se explico brevemente cual es el propósito de PP y los objetivos para poder aprobar la materia. Posterior a esto se nos dio diferentes tareas, pero el día de hoy se limito a finalizar el modulo 0 y 1  de las tareas DET.','2025-03-12'),(8513,375,'Introduccion a Practicas Profesionalizantes','Hoy fue el primer dia de la Materia de Practicas Profesionalizantes, nos comentaron y enseñaron los conceptos basicos a tener en cuenta para todo el año, ademas de aclarar dudas mientras explicaban como seria el reglamento y la modalidad de la asignatura, nos recomendaron empezar con los Modulos DET.','2025-03-12'),(8514,364,'Inicio de PP','El día de hoy se nos dio una charla previa antes de empezar la clase. Esta charla de basa en como nos vamos a trabajar y desarrollar nuestros proyectos en PP tanto dentro como fuera de la escuela.\r\n\r\nDespumes empezamos a leer la introducción mas bien conocido como módulo 0 para posteriormente hacer el Trabajo Practico número 1 de PP el cual son preguntas básicas sobre PP en general.','2025-03-12'),(8515,363,'Introduccion a PP e inicio de los modulos','el dia de hoy escuchamos la explicacion sobre la materia de parte del profesor, explicando cada parte de lo que vamos a hacer en el año. Luego lei el modulo 0 y empece a resolver el modulo 1','2025-03-12'),(8516,361,'Introducción a PP','Charlamos sobre el reglamento y características de la materia. Luego realicé los módulos 0, 1 y 2 obligatorios de Prácticas profecionalizantes','2025-03-12'),(8517,377,'Introduccion al PP','Hoy nos explicaron de como va a ser el funcionamiento de la materia a lo largo del año. Tambien profundisamos como va a funcionar la eleccion de proyectos, los modulos, la carpeta de campo y varios temas mas. Despues de abarcar los temas se hizo una ronda de preguntas sobre el funcionamiento de la materia. ','2025-03-12'),(8518,369,'Introduccion de las PP','En el dia de hoy nos dieron una charla sobre las practicas profecionalizantes y como se va a llevar durante el año y nos dieron unos modulos con videos y informacion para realizar el cuestinario','2025-03-12'),(8519,382,'Det','Nos hicieron la introducción de lo que íbamos a hacer durante el año y empecé los módulos de DET','2025-03-12'),(8520,370,'Bitácora de PP día 12 de Marzo 2025','Hoy tuvimos una charla de como iban a ser las prácticas profesionalizantes y nos explicaron como y que teníamos que hacer. No tuvimos conflictos.','2025-03-12'),(8521,376,'Primer día P.P','Hoy nos explicaron que vamos a hacer en la materia, los distintos tipos de metodologías para aprobar la materia que son con un proyecto en la escuela o con las prácticas externas, que vamos a tener varias salidas didácticas, que hay una cierta cantidad de horas necesarias para poder aprobar la materia que son 216 horas. Después de esta introducción a la materia nos puse a hacer los primeros módulos que manda la det','2025-03-12'),(8522,387,'13/3','Hoy en el primer dia de la asignatura, los profesores nos explicaron como iba a ser la materia durante todo el año, que debiamos cumplir con ciertos requisitos para aprobar, que ciertos chicos iran a practicas fuera del colegio mientras otros las realizaran aca internamente. Tambien que debemos contar con una carpeta de campo de 200 hojas minimo, que debemos realizar los cursos obligatorios etc.','2025-03-13'),(8523,405,'13/03/25','Hoy me registre en la pagina de encuentro tecnologico, tambien lei el documento PDF de Introduccion a practicas profesionalizantes y realice el formulario correspondiente.','2025-03-13'),(8524,389,'13/03/2025','Hoy el profesor nos explico las cosas, luego empece a hacer el Det modulo 0, leyendo y marcándolo como echo, luego hice el modulo 1 entregándolo el día de hoy.','2025-03-13'),(8525,386,'13/3/25','Oí toda la explicación sobre la materia, y discutimos puntos un tanto confusos sobre todo el plan de la materia, comencé a realizar los módulos de la DET, y le eche un ojo al test de ingles.\r\nTambién, en grupo definimos el proyecto a realizar en el año, lo charlamos con los docentes, y finalmente fue aceptado.\r\n','2025-03-13'),(8526,395,'13/03/2025','hoy tuvimos la charla de lo que significa la materia y de los que vamos hacer en todo el año, nos reguistramos en encuentro tecnologico y el slack de pp y estaba haciendo los formularios del DET.','2025-03-13'),(8527,390,'13/03/25','El día de hoy nos informamos a como seria la materia a lo largo del año, junto con sus etapas, métodos a evaluar, tareas a completar, entre otras cosas. También, armamos grupos en el salón y estuve realizando y finalizando el formulario inicial, el modulo 0 y el modulo 1. ','2025-03-13'),(8528,397,'13-03-25','Los profesores nos hizo una introductorio a la materia explicándonos los que vamos hacer durante el año a su vez nos encargaron las hacer hacer el DET modulo 1','2025-03-13'),(8529,400,'13/3/2025 clase - 1','al inicio de la clase hablamos sobre el funcionamiento de las practicas profesionalizantes, como se organiza esta, sus objetivos y la manera en la que estaremos trabajando todo este año. también fuimos informados acerca de lo importante que es aprobar esta materia. el resto de la clase\r\nleí los PDF y mire algunos videos de los módulos 1 y 2  termine el formulario del modulo 1 y  el mapa conceptual del modulo 2','2025-03-13'),(8530,388,'13-03-25','Hoy iniciamos PP los profesores nos dieron una introducción a la materia, nos explicaron de forma resumida los contenidos que vamos a llevar durante el año, hoy arranque leyendo el modulo cero que fue todo muy teórico y nos asienta pautas y bases para iniciar los proyectos futuros. A continuación proseguí con el modulo siguiente (modulo 1) que incluía como teoría un pdf y dos videos explicativos, una vez leído realice un corto formulario con preguntas relacionadas al tema.','2025-03-13'),(8531,392,'13/3/2025 Introducción.','Primera clase del año:\r\nHoy conocimos un poco de la materia, como se iría desarrollando a lo largo del año, de que manera, que factores tendría para la aprobación de la misma.\r\n\r\nEn el día de la fecha, realice el primer formulario del modulo DET. Siendo esta misma una introducción.\r\nCaracterísticas, formatos posibles, Diseño Curricular, comprensión de dinámicas con otro actores y requisitos para su aprobación.\r\n\r\n\r\n','2025-03-13'),(8532,404,'13/03/2025','Hoy tuve la charla de PP sobre que se va a realizar a lo largo del año en la asignatura, pude resolver algunas consultas que tenia, después me registre en la página de encuentro tecnológico, leí la introducción a Prácticas Profesionalizantes y logré realizar el formulario del módulo 1. ','2025-03-13'),(8533,406,'13/03/25','Estuve haciendo el formulario (Introducción a las Prácticas Profesionalizantes, vi videos que hacían en los encuentros PP.\r\nTambién me registre en Encuentro Tecnológico  y me uní al canal de Slack de PP','2025-03-13'),(8534,394,'13/03/2025','El día de la fecha hablamos con los tutores sobre en qué consiste la materia en sí, y nos explicaron que es DET. Luego de eso empecé a realizar los módulos, leí y vi los videos dados para realizar el módulo 1. También realicé el formulario de laboratorios. ','2025-03-13'),(8535,384,'13/03/2025','Lo que realizamos hoy fue un extenso desarrollo de una introducción de lo que va a hacer prácticas profesionalizantes. Se explicó como va a funcionar los formatos ya sea académicos como el formato en formación en ambientes productivos. Como se a a gestionar los proyectos dentro de la institución y la selección de equipos asignados para todo el transcurso del año. Como primer objetivo del día se nos entregó el classroom y como tarea realizar todos los módulos, del 0 al 6. Para luego aclarar que se debe terminar un curso de ingles de 90 minutos para evaluar nuestro nivel de inglés y presentarlo como un certificado.','2025-03-13'),(8536,398,'13-03-2025','Hoy estuvimos viendo de que se trata la materia Practicas Profesionalizantes y que cosas se están por venir en todo lo que queda del año. Estuve haciendo el Modulo 1 del DET y pude terminarlo y enviarlo.','2025-03-13'),(8537,393,'13/3/25','Hoy fue la primera clase de Prácticas profesionalizantes en la que los docentes nos explicaron y dieron a entender lo que es PP, ademas de todo lo que vamos a ver durante el año, esto implica la Formación en Ambientes Productivos, Proyectos y Empresas, en la que realize el DET - Modulo 1, que nos explica aun mas sobre PP y que en base a eso complete el Cuestionario de este Modulo.','2025-03-13'),(8538,401,'13/02/2025','Escuchamos todas las consignas que vamos a tener que realizar en todo el año entero, esto implica la realización de los dets cursos(test de ingles, CVs, y certificación de SCRAM) proyectos y pasantías.\r\nHoy termine el el det numero 1 con todo y poco mas y avanzando un poco en el numero 2.','2025-03-13'),(8539,399,'13-03-2025 Clase 1','Comenzar con los formularios del DET. Nos explicaron todo de esta materia.','2025-03-13'),(8540,403,'13/3/2025','Este día vimos y escuchamos sobre lo que seria la materia de practicas profesionalizantes o PP para ','2025-03-13'),(8541,385,'Clase de Introducción','En el día de la fecha, los docentes nos explicaron arduamente en que consistirá esta asignatura. Después realizamos la primer actividad del Modulo 1, leímos PDF y vimos vídeos informativos para después poder realizar un cuestionario sobre lo aprendido.','2025-03-13'),(8542,402,'Primera clase','El día de hoy tuvimos una clase introductoria, donde los tutores nos dieron una charla con respecto al reglamento del laboratorio, el como se van a ir desarrollando las cosas a lo largo del año con respecto a las prácticas, hablando sobre los proyectos que posiblemente surjan a futuro y también respecto a la carpeta de campo. \r\nSe planteó el tema de los grupos y en el periodo de tiempo posterior, formé un grupo con Agustina Heck, Máximo Celli y Nicolás Peña. y estuvimos charlando respecto a posibles proyectos que se puedan desarrollar a futuro.','2025-03-13'),(8543,383,'Dia I','En el día de hoy tuvimos la introducción a PP, la cual trata de introducirnos en una simulación del ámbito laboral, escuche sobre todo y ya decidimos nuestro grupo y nuestro proyecto. Arranque con los módulos del DET y termine uno y casi 2.','2025-03-13'),(8544,396,'P.P primera clase','Hoy tuvimos nuestra primera clase, se habló sobre varias cosas, entre esas cosas los proyectos a futuro, la carpeta de campo, los grupos y las condiciones para aprobar. Yo formé un grupo con Anderson Sánchez, Máximo Celli y Nicolás Peña \r\n\r\n','2025-03-13'),(8545,391,'DIA I','Hoy nos explicaron el funcionamiento básico de la materia y nos dijeron que empecemos a completar los diagnósticos del DET cosa que hice hasta el horario de cierre de la materia también ya pensamos con el mi equipo sobre el proyecto a hacer.','2025-03-13'),(8546,395,'14-03-2025','Hoy estuve haciendo los módulos, cree mi página de LinkedIn y también estuve haciendo mi cv para poder entregarlo junto al test de inglés ','2025-03-14'),(8547,389,'14/03/2025','Hoy entre a clase y no había wifi, luego de que hubo, me puse a hacer el modulo 2, es decir el mapa conceptual, termine a tiempo y lo compartí con mis compañeros. Me puse a hacer el modulo 3 y ya lo voy a entregar ya que no tengo todavía algunos elementos.','2025-03-14'),(8548,383,'Dia 2','En el día de hoy, tuvimos que seguir con todo lo del DET, empezamos a hacer un mapa conceptual sobre la introducción a PP (Practicas Profesionalizantes) lo cual nos llevo casi toda la hora.','2025-03-14'),(8549,398,'14-03-2025','Hoy se cortó el internet en el laboratorio de redes y estuvimos como 20 minutos intentando encontrar otra forma de realizar los trabajos hasta que el internet finalmente volvió. Estuve haciendo el modulo 2 del DET y el curriculum vitae.','2025-03-14'),(8550,385,'Clase 2','Al ingresar no había conexión internet, tuvimos que realizar las actividades que nos quedan asignadas mediante archivos brindados por el profesor mediante la red local, hasta que la conexión volvió y pudimos seguir realizándolas con normalidad.','2025-03-14'),(8551,386,'14/03','Leve inconveniente con la conexión a Wifi, resuelta en la misma clase, realicé el mapa conceptual del archivo 1.1 de la DET','2025-03-14'),(8552,384,'11/03/2025','En el día de hoy tuvimos inconvenientes con el servicio de conexión a internet, tuvimos este problema durante aproximadamente 40 Minutos hasta que los profesores pudieron solucionarlo. Una vez que se solucionó el problema, empezamos con la creación del perfil de Linkedin y adaptar mi CV a uno profesional específicamente en el rubro que elegimos. Finalizando esto subimos el trabajo y nos pusimos a realizar los cursos de Microsoft Y linkedin.','2025-03-14'),(8553,405,'14/03/2025','Comencé a realizar la segunda actividad la cual consiste en hacer un mapa conceptual de el documento &quot;Introducción a las practicas profesionalizantes&quot;, no he podido terminarlo debido a problemas con la conectividad de la escuela, aun así he logrado introducir la mayoría de lo que el documento presenta en el mapa conceptual.','2025-03-14'),(8554,397,'Clase 2','Hoy se corto el internet al entrar al aula durante 20 minutos, ante la urgencia el profesor nos dio los archivos ya descargado, después de que volvió el internet me puse hacer los módulos 2 y 3 ','2025-03-14'),(8555,392,'14/3/2025','Hoy avance en las tareas correspondientes a la materia, me mantengo haciendo los módulos 2, 3 y 4.\r\nTambién repasamos el tema de los Diseños Curriculares y los perfiles en Linkedin. \r\nEn general, avanzando las tareas y resolviendo dudas.\r\n\r\n\r\n','2025-03-14'),(8556,387,'14-03','Hoy en la segunda clase, al principio se corto el internet durante 40 minutos, luego estuve avanzando en los modulos del PP, donde mejore mi cv previamente creado, también cree mi perfil de LinkedIn. Avanzamos con los cursos de Microsoft con linkedin. Termine el formulario del modulo 3. Organice bien mi semana para poder hacer todo con tiempo y de buena forma','2025-03-14'),(8557,407,'14/03/25','En el día de hoy el profesor Olaso me hizo una breve explicación sobre la materia y comencé con la serie de escritos sobre la materia con música de minecraft de fondo.','2025-03-14'),(8558,393,'14/3/25','Hoy empece hacer el modulo 3 de DET, que era una cuestionario, respondí todo pero al final me pedía hacer un cv, y hasta el final de la clase me quede haciéndolo, sin poder terminarlo ','2025-03-14'),(8559,394,'14/03/25','Hoy no había wifi cuando llegué, así que el tutor nos dio una IP para poder ingresar a los pdf y así poder ver y realizar las actividades. Al rato ya tuvimos y empecé a realizar el módulo 3, el cual leí y después respondí el formulario dado, el mismo incluía la realización de nuestro cv, así que también estuve trabajando un poco en eso. Luego ayudé a mi compañera Abi con el mapa conceptual. ','2025-03-14'),(8560,388,'14-03','Hoy al principio de las practicas no pudimos avanzar mucho por cuestiones de una falla en la conexión de internet en la escuela. Luego, complete los módulos avanzando bastante, y a su vez complete el test de EF de ingles para saber mi nivel.','2025-03-14'),(8561,401,'14-03-2025','Hoy termine la tarde con el trabajo numero tres la cual hablaba de las habilidades blandas, como sirven, como nos ayudan y cuales tengo.\r\nLuego arranque el CV, y me cree la cuenta de LinkedIn y empecé con los cursos. Todo eso con la temática de que al principio de la clase no había internet','2025-03-14'),(8562,402,'Segunda clase','Completé el formulario del laboratorio y estuve repasando para responder el modelo 1','2025-03-14'),(8563,396,'Clase 2','Repaso para presentar el TP del modulo 1','2025-03-14'),(8564,365,'Modulos DET ','El día de hoy finalice el modulo 2 e inicie el modulo 3 hasta la actividad 2(Hacer el CV).','2025-03-18'),(8565,381,'Primeros dos Módulos','Una vez terminado el Módulo 1, (hoy) empecé y terminé el Módulo 2.','2025-03-18'),(8566,380,'Segunda clase de PP','Continúe haciendo los módulos, terminando el 1 y comenzando el 2','2025-03-18'),(8567,361,'Avance en la realización de los módulos','Completé la tarea 3 del módulo 3 y trabajé en el desarrollo del curriculum vitae.','2025-03-18'),(8568,368,'Realización de Modulos DET','Trabaje y completé los módulos DET 3 y 4 junto a sus respectivas tareas','2025-03-18'),(8569,363,'Continuamos con los modulos DET','Hoy complete el modulo 2 y empece el 3 completando la tarea 3 y casi el CV','2025-03-18'),(8570,367,'Realización de los Modulos DET','Trabaje con los modulos 3, 4 y 5 de la DET buscando mejorar mi horizonte laboral. ','2025-03-18'),(8571,366,'Creacion de perfil profesional','Hoy empece con el modulo 3 y con la creación de mi CV.','2025-03-18'),(8572,370,'Bitácora de PP día 18 de Marzo, 2025','Hoy empezamos a hacer los módulos de las prácticas profesionalizantes. No hubo conflictos. ','2025-03-18'),(8573,364,'Día de hoy modulo 2 y finalizando modulo 3 con cv','En el día de la fecha finalice el módulo 2 y modulo 3 con mi CV y habilidades','2025-03-18'),(8574,374,'Terminar modulos DET y CV','Hoy termine mi CV y ademas termine el DET 4 y 5.','2025-03-18'),(8575,373,'Realización del Módulo N°2','En el día de hoy nos enfocamos con mi compañero de laboratorio Nicolas Andre Lopez a realizar el módulo N°2 de los 10 que se nos mandó a realizar para Prácticas Profesionalizantes. ','2025-03-18'),(8576,369,'dia de modulo 2 ','en el dia de hoy hice el modulo 2 junto a mi compañero de maquina y empezamos el modulo 3 para el  CV','2025-03-18'),(8577,362,'modulo 7 DET, creacion del CV, curso microsoft y linkedin','continue, sin terminar, el modulo 7 del DET, empece el CV, con ya terminado el test de ingles y ideando cual curso empezar de los que hay en la asociacion de microsoft y linkedin.','2025-03-18'),(8578,375,'Trabajo de Modulos DET','Hoy empecé trabajando en el mapa conceptual, con la ayuda de mi compañero Benjamin Castro Madrid, en la tarea del segundo Modulo DET.','2025-03-18'),(8579,360,'18/3/2025','Habiendo terminado el modulo 1 y 2, inicié con el desarrollo de la tarea Nº3 y Nº4 del mòdulo 3','2025-03-18'),(8580,382,'Det','Seguí haciendo los módulos y discutimos sobre el proyecto ya que aun no sabemos que hacer','2025-03-18'),(8581,408,'Bitácora 19/03/25','Actividades Realizadas:\r\n\r\nMódulo 3 - Guía de Habilidades Blandas:\r\nCompleté las tareas 3 y 4.\r\nSubí el CV.\r\n\r\nMódulo 4 - Guía de Empresa Simulada:\r\nCompleté las tareas 5 y 6.\r\nFinalicé el diseño de una Empresa Simulada con un diagrama.\r\n\r\nObservaciones:\r\nLos módulos eran un poco largos, pero a la vez se hicieron fáciles.\r\n\r\nPendientes:\r\nMejorar el desarrollo de respuestas.\r\n\r\nPróximos Pasos:\r\nCompletar las demás guías.\r\nTerminar los módulos 5 y 6.\r\nRealizar la tarea 7 y la tarea 9.\r\n','2025-03-19'),(8582,365,'Finalizacion de modulos DET y curriculum ','Se finalizaron los modulos DET pendientes por excepcion del 9, esto se hizo gracias al material subido en el classroom el cual se tuvo que resumir para el modulo 4. Además se realizo la certificacion de ingles para el curriculum deacuerdo a las instrucciones establecidas por parte de los docentes.','2025-03-19'),(8583,406,'19/03/25','Hoy hice la tarea DET Modulo 0 y la terminé, diciendo que son las Practicas Profesionalizantes, también no llegue a terminar la tarea n°1, en la próxima clase lo termino y empiezo con la carpeta de campo. ','2025-03-19'),(8584,366,'Realizacion de modulos y creacion de perfil 19/03/25','Hoy segui perfeccionando mi curriculum, no lo termine porque quiero tambien crearme un portfolio y mostrar mis trabajos audiovisuales, ya que eso es de lo que quiero trabajar.\r\ncuando termine el portfolio, lo pondre en el curriculum y tal vez cambie el diseño, ya lo vere. Despues continue con el modulo 5 y lo entregue.','2025-03-19'),(8585,369,'continue con los modulos en clase','en el dia de hoy estuve haciendo los modulos de PP modulo 4 con las preguntas y el diagrama de una empresa\r\n','2025-03-19'),(8586,367,'Realización de los modulos DET, comienzo del curso de LinkedIn Learning, y concreción de los grupos para el proyecto. ','El dia de hoy estuve trabajando en el modulo 5 de la DET, ademas de estar completando el curso de gestión de proyectos de LinkedIn Learning.\r\nEstuve observando los diferentes archivos con el animo de poder aprender sobre la gestion de las organizaciones y empresas, completando cuestionarios y viendo los videos correspondientes para completar el curso de LinkedIn.  ','2025-03-19'),(8587,374,'Realización de los modulos DET y eleccion del cursor de LINKEDIN','En el dia de hoy he ternminado toodos los modulos DET y he arrancando a elegir el cursor de linkedin a realizar','2025-03-19'),(8588,360,'19/3/2025','Ajusté algunas cosas sobre el CV de la tarea N°4, trabajé en la tarea N°5 y en la tarea N°6','2025-03-19'),(8589,364,'día 3 PP','Perfeccionamiento de CV y finalización de TP N°4, 5 Y 6','2025-03-19'),(8590,370,'Bitácora de PP día 19 de Marzo 2025','Hoy termina los trabajos prácticos 1, 2 y 3 de los módulos 1, 2 y 3 de Practicas Profesionalizantes. El unico conflicto que tuve fue que no podia entender un punto del primer modulo, pero ya me lo explicaron.','2025-03-19'),(8591,412,'INTRODUCION EN PP','ver los videos , leer los modulos 0 y 1. buscar que curso de linkedin me gustaria, y completar 1 session de ingles. ','2025-03-19'),(8592,361,'Gran avance en los módulos','Terminé las tareas 4, 5 y 6 de los módulos 3 y 4. También terminé mi primer versión del curriculum vitae. Finalmente anavcé en la tarea 7 del módulo 5','2025-03-19'),(8593,363,'Continuamos con los modulos DET 2','hoy complete del modulo 3 al 5\r\ntambien hice y complete bastante del CV','2025-03-19'),(8594,381,'Inicialización de Módulo 3 y 4','Estuve trabajando en los Módulos 3 y 4, con la elaboración del CV (aún sin terminar) y la tarea 5 del Módulo 4. El formulario de la tarea 3 del Módulo 3 lo tenía empezado y sólo me faltan las últimas dos respuestas. ','2025-03-19'),(8595,380,'Tercera clase de PP','Termine el módulo 2 y empecé los módulos 3 y 4','2025-03-19'),(8596,371,'19/03/2025','Finalize el modulo 2 y casi el 3, pero esta en proceso el CV.\r\n(Esta es la segunda bitacora) ya que se me paso (me olvide) en el dia 18/3/2025','2025-03-19'),(8597,409,'modulo 1, 2 y 3','el dia de la fecha estuve realizando los modulos 1, 2 y 3 mas el curriculum en ingles y puliendo el curriculum tambien empece a hacer el modulo 4 pero no pude completarlo por falta de tiempo, estuve con mis compañeros y el profe hablando sobre que posibles proyectos podian hacerce para P.P. y decidiendo un grupo para la materia.','2025-03-19'),(8598,362,'modulo 4 del DET y CV Obligatorio con Test de Ingles de EF SET','Complete el curriculum o CV añadiendo le cada detalle aprovechando para hacer 2 tareas, 1 ya hecha (el CV con el EF SET) y el otro (Modulo 4) incompleta por problemas con Linkedin y intento de empezar los cursos de Microsoft y Linkedin, pero no se logro por problemas con el mismo','2025-03-19'),(8599,368,'Realización de los Modulos DET','Realización de los módulos DET 4 y 5 tanto lectura de los documentos como visualización de los videos explicativos. Culminación de la Guía de Empresa Simulada -\r\nCuestionario y el formulario sobre Introducción a los Proyectos  Institucionales de Prácticas  Profesionalizantes','2025-03-19'),(8600,372,'Bitácora de PP día 19-03-2025','El día de hoy leí y mire los vídeos proporcionados para realizar las tareas, terminando los  módulos 1 y 3, y la mitad del segundo, ','2025-03-19'),(8601,373,'Realización y Finalización de los Módulos N°2, N°3 y  N°4','En el día de hoy me encargué de completar los módulos n°3 y n°4 de la DET, documentos que se encuentran dentro del classroom de Prácticas Profesionalizantes 2025. Con las tareas realizadas n°2, n°3, n°4, n°5 y n°6. En el día de hoy realice mapas conceptuales con Lucidchart cuya función es realizar mapas conceptuales, diagramas, entre otros. Usé Canva para realizar mi Curriculum Vitae el cuál entregué en la tarea n°3 y n°4.\r\n','2025-03-19'),(8602,379,'Bitácora 1','Hoy me dediqué a realizar los módulos 0, 1, 2, 3, leyendo el contenido y viendo los videos proporcionados. También modifiqué mi curriculum vitae con las condiciones que imponen las actividades 3 y 4 del modulo 3 cambiando mis experiencias y conocimientos con un enfoque 100% informatico, agregué el certificado del test &quot;EF SET&quot; y finalicé el dia avanzando con el modulo 4','2025-03-19'),(8603,382,'Cv','Hoy adelante lo más que pude con los módulos ya que estoy haciendo los últimos, pase la mayor parte del tiempo haciendo el cv para que se viera de manera aceptable y sea valido ','2025-03-19'),(8604,375,'Progreso en la Tarea del Modulo 2','Se avanzo en el diagrama y ahora esta encaminado para ser entregado mediante el classroom.','2025-03-19'),(8605,391,'DIA II','Se creo el mapa conceptual donde radica toda la información de las practicas profesionalizantes y se planifico la división de tareas en el proyecto','2025-03-14'),(8606,385,'Clase 3','Seguimos realizando las actividades de los modulos.','2025-03-20'),(8607,384,'20/03/2025','Lo que estuve realizando el día de hoy es ir completando todos los módulos establecidos en el classroom, terminé con la cantidad de 3 tareas, me estaría quedando únicamente la tarea número 6 y la número 9.','2025-03-20'),(8608,389,'20/03/25','El día de hoy me puse a hacer mi curriculum junto con mi perfil de linkedin y termine el tp 5','2025-03-20'),(8609,396,'Clase 3','Estuve trabajando con Anderson Sánchez, progresamos con el módulo 1, módulo 2 y el módulo 4 ','2025-03-20'),(8610,388,'clase 3','En el dia de hoy seguimos realizando las actividades restantes del calssroom','2025-03-20'),(8611,399,'20-03-25 Clase 3','Comenzar y terminar con el Curriculum Vitae. Tambien avanzar con los modulos de tarea','2025-03-20'),(8612,394,'20/03','El día de la fecha estuve leyendo el documento para realizar el armado del cv, lo estuve editando todo según el mismo. Después estuve haciendo la tarea n°5 la cuál solo realicé a la mitad :(. ','2025-03-20'),(8613,391,'DIA III','Se completo un par de Módulos del DET y se elaboro el diagrama de la empresa simulada','2025-03-20'),(8614,402,'Tercera clase','Trabajé en el módulo 1, módulo 2 y módulo 3, hicimos un progreso importante. Esto con la ayuda de Agustina Heck','2025-03-20'),(8615,407,'20-03-2025','En el dia de hoy termine el diagrama para esta materia y averigüe sobre mis problemas con github','2025-03-20'),(8616,390,'20/03/25','Hoy realicé y finalicé el modulo 2 y estuve desarrollando mi cv.','2025-03-20'),(8617,393,'20/3/25','Hoy avanze en el modulo 4 de Practicas Profesionalizantes hasta que logre terminarlo haciendo el cuestionario y el diseño y empece con el modulo 5 de Practicas Profesionalizantes ','2025-03-20'),(8618,405,'20/03/2025','Me cree una cuenta de linkedin y terminé y entregué el diagrama del modulo 2, tambien me he leido el documento del segundo modulo a su totalidad.','2025-03-20'),(8619,387,'20-03','Hoy avance con los módulos de Practicas Profesionalizantes, avance con el formulario de Proyectos y lo termine, tambien hice la empresa simulada donde puse cada uno de los roles y gestiones. Por ultimo realice un diagrama explicativo de que es y para que son las practicas profesionalizantes','2025-03-20'),(8620,404,'20-03-2025','Hoy cree mi cuenta de Linkedin, después estuve trabajando en el diagrama del modulo 2.','2025-03-20'),(8621,401,'20-03-2025','Hoy arranque haciendo otros dets mas el modulo numero 5(tarea numero 7), y el det numero 4 (tarea numero 5), luego escuchamos de una empresa llamada &quot;sinergia&quot; luego seguí haciendo el CV.','2025-03-20'),(8622,400,'clase - 3','hoy creé una cuenta en LinkedIn, termine de hacer mi CV y llegue hasta el puto 11 del modulo 5.\r\nhacer la cuenta de LinkedIn no fue muy difícil solo tuve que ingresar varios datos, sencillos y para este contexto cree una nueva cuenta de Gmail para poder tener todo mas organizado. Esta cuenta también la agregue al CV que por su parte me costo bastante tiempo.','2025-03-20'),(8623,398,'20-03-2025','Hoy terminé el curriculum vitae, me hice la cuenta en linkedin y comencé con el modulo 4 del DET.','2025-03-20'),(8624,403,'20/3/2025','Este día comencé con el formulario del DET-Modulo 2 y con el curriculum vitae al final del día pude terminar ambos y subirlo al classroom, tambien avance un poco con el mapa conceptual de las Practicas Profesionalizantes.','2025-03-20'),(8625,386,'20/3','Le eche un ojo a los cursos de LinkedIn, formulario de proyectos, habilidades blandas, grafico de empresa simulada y trabajo de empresas simuladas incompleto.','2025-03-20'),(8626,383,'Tercer Dia','Este día se seguimos trabajando con los formularios de: Proyectos, Empresa Simulada y habilidades blandas, tambien hicimos el grafico de empresas simulada\r\nCree la cuenta de LinkedIn después estuve viendo los cursos y cuales me gustan para poder hacer. ','2025-03-20'),(8627,387,'21-3','En el dia de hoy segui terminando con los modulos, avance con el formulario de 38 preguntas que ya casi termino. Hoy tambien definimos el proyecto y el cliente que llevaremos acabo con mi grupo. Ya nos dividimos los tiempos y sabemos con exactitud los objetivos que tenemos que alcanzar','2025-03-21'),(8628,385,'Clase 4','El dia de hoy seguimos realizando actividades.','2025-03-21'),(8629,391,'DIA IV','Hoy cree el CV y complete el modulo de la empresa simulada dialogue con mis compañeros sobre el proyecto la división de tareas','2025-03-21'),(8630,386,'21/3','finalicé unos formularios que habia dejado a medias, me quedaria realizar el dv, y completar el form adjunto, y luego el video de el ultimo modulo.','2025-03-21'),(8631,393,'21/3/25','En el día de hoy osea la fecha 21 de abril de año vigente dos mil veinticinco (2025), llegue a horario a la clase de Practicas Profesionalizantes para seguir con el modulo 5 de Practicas Profesionalizantes.','2025-03-21'),(8632,398,'21-03-2025','Hoy estuve continuando un poco con el modulo 4 de los formularios del DET y avancé un poco con el modulo 5 del DET','2025-03-21'),(8633,384,'21/03/2025','Lo que estuve realizando hoy es terminar la tarea número 6 del classroom de prácticas, planificando con los profesores como va a ser el proyecto del día de hoy, tenemos que terminar una entrega ya previa con un cliente real de una página de freelance. Una vez terminemos esa entrega (El mvp) tenemos que adaptar el proyecto a algo mucho mas escalable y eficiente. Durante todo el año.','2025-03-21'),(8634,399,'21-03-25 Clase 4','Este día avance con los DET-módulos. Pensé con mi grupo nombres para 2 proyectos. un proyecto sera de autolavado (OptiWash) y el otro se llamara (RoyalClothes).','2025-03-21'),(8635,390,'21/03/25','El dia de hoy empezando mi cv y la tarea n°3 del modulo 3','2025-03-21'),(8636,392,'21/03/2025','En el día de hoy termine algunos módulos que tenia pendientes y realizamos un avance en cuanto al proyecto correspondiente de las practicas.\r\n\r\n','2025-03-21'),(8637,407,'21-03-2025','Hoy terminé el diagrama del segundo módulo de PP, terminé de configurar mi linkedin y comencé el examen de inglés.','2025-03-21'),(8638,395,'21/03/2025','estuve realizando los modulos de el classrom\r\n','2025-03-21'),(8639,383,'Cuarto Dia','Hoy terminamos de hacer el formulario de proyectos que nos habia quedado sin terminar una pregunta del final.','2025-03-21'),(8640,403,'21/03/2025','Este día avance con los DET-módulos. Pensé con mi grupo nombres para 2 proyectos. un proyecto sera de autolavado (OptiWash) y el otro se llamara (RoyalClothes).','2025-03-21'),(8641,404,'21-03-2025','Hoy le entregué al profesor el documento sobre derechos de imagen, el cual rechacé, después de eso logré hacer la tarea 2, el diagrama.','2025-03-21'),(8642,394,'21/03/2025','El día de la fecha estuve leyendo el módulo 5, en base a eso me puse a realizar un poco la tarea N°7. Aún me falta terminar, al igual que el armado de mi cv :/ el cual estuve editando un poco hoy.\r\n','2025-03-21'),(8643,400,'clase 4','en esta clase termine de hacer le formulario de grupos y el formulario de proyectos, verifique el sistema de gándara, se harán retoques en este sistema. ','2025-03-21'),(8644,401,'21-03-2025','Resolví todo la tarea 5 que habla de empresa simulada, el total era de 38 puntos el cual abarcaba una amplia cantidad de data la cual la gran mayoría me parecía irrelevante pero sin ninguna objeción, amplié la cantidad de ideas que tenes hacia el proyecto.','2025-03-21'),(8645,405,'21/03/2025','Hoy realice el formulario de el modulo 3, empece a crear me curriculum vitae y entregue la autorizacion de derechos de imagen al profesor concediendolos.','2025-03-21'),(8646,374,'Terminar MODULO DET 9 y CV','En el dia de hoy he terminado mi CV y ademas me he grabado para hacer el video del modulo 9 el cual es para hacer una presentacion acerca de mi. ','2025-03-25'),(8647,369,'modulo 4','hoy estuve terminando el modulo 4 y empece a hacer el CV del modulo 3','2025-03-25'),(8648,381,'Módulo 6 y Proyecto','Terminé mi preparación para crear el Módulo 6 una vez terminados todos los anteriores. Tmbién hablé con mis compañeros de grupo para decidir cuál sería nuestro proyecto de Prácticas Profesionalizantes durante el año, considerando nuestro perfil profesional, capacidades actuales, ideas interesantes para nosotros, etc.','2025-03-25'),(8649,380,'Cuarta clase de PP','En esta clase termine el módulo 4 y empecé el cuestionario del módulo 5','2025-03-25'),(8650,370,'Bitácora de PP día 25 de Marzo, 2025','hoy continuamos haciendo los módulos de practicas profesionalizantes, continúe haciendo el trabajo practico numero 7 y empece a hacer mi Curriculum Vitae (CV), también abrí mi perfil de LinkedIn. No hubo conflictos','2025-03-25'),(8651,364,'Dia de la fecha','Finalización de módulo 4 y 5','2025-03-25'),(8652,361,'Finalización de módulos','Terminé de realizar todos los módulos de las prácticas profesionalizantes con excepción de la tarea 9 (video de introducción grupal). A su vez modifiqué el currículum vitae.','2025-03-25'),(8653,373,'Ideando Proyecto de PP','En el día de hoy en conjunto a mis compañeros de grupo nos encargamos de pensar distintas problemáticas que puedan ser resueltas mediante un proyecto.\r\nTambién estuvimos buscando satisfacer a cierto sector de personas, por lo que nos decidimos por realizar un juego. Lo siguiente fue empezar a idear, por lo que estuvimos gran parte de la hora pensando de que tratará este juego, que gráficos tendrá, que estilo, entre otros. ','2025-03-25'),(8654,362,'modulo 4 del DET, modulo 5 del DET, modulo 7 del DET','entregue el modulo 4 del DET que ya había completado (el CV), complete y entregue el modulo 5 del DET (preguntas en PDF) y deje a 1/4 de terminar el modulo 7 (cuestionario)','2025-03-25'),(8655,372,'Bitácora de PP día 25 de marzo 2025','Hoy continuamos con los módulos de prácticas profesionalizantes, continúe hasta el módulo 6, y avanzando un poco del módulo 7','2025-03-25'),(8656,408,'25/3/25','Hoy estube dicutiendo las ideas que podiamos realizar :\r\n\r\n13. Desarrollo de una aplicación móvil básica (consorti?)\r\nDescripción: Crear una aplicación móvil sencilla, como una aplicación de notas o un recordatorio de eventos. Puedes usar herramientas como Flutter o React Native para crear aplicaciones multiplataforma.\r\n\r\n\r\nHerramientas: Flutter, React Native, Android Studio.\r\n7. Desarrollo de un chatbot simple (posible cliente)\r\nDescripción: Crear un chatbot que interactúe con los usuarios de manera básica. Puede ser un chatbot para responder preguntas frecuentes sobre un producto o servicio. Puedes usar herramientas como Dialogflow o escribir tu propio chatbot con Python.\r\n\r\n\r\nHerramientas: Python, NLTK, ChatterBot, Dialogflow.\r\n\r\n\r\n8. Sitio web de portafolio personal (cliente)\r\nDescripción: Desarrollar tu propio sitio web de portafolio para mostrar tus proyectos y habilidades. Este proyecto te permitirá aprender más sobre diseño web, implementación de SEO y optimización de sitios web.\r\n\r\n\r\nHerramientas: HTML, CSS, JavaScript, Bootstrap, GitHub Pages.\r\n10. Juego básico en 2D (consorti?)\r\nDescripción: Desarrollar un juego simple en 2D, como un &quot;Juego de la serpiente&quot; o un &quot;Tic Tac Toe&quot;. Esto te ayudará a practicar tus habilidades de programación orientada a objetos, física básica de juegos y gestión de eventos.\r\n\r\n\r\nHerramientas: Unity (C#), Godot, Pygame (Python).\r\n11. un sistema para registro de citas para una barberia masculina \r\n\r\nPara desarrollar un sistema de registro de citas para una barbería, necesitas varios componentes. Aquí te explico qué necesitas y qué programas o tecnologías puedes usar. \r\n\r\nlo cual aun no decidimos\r\n','2025-03-25'),(8657,365,'Planificación de proyectos ','El día de hoy mis compañeros y yo nos reunimos con el propósito de planificar y plantear los posibles proyectos a realizar. Muchos de ellos estaban relacionados con lógica aplicada a hardware, pero mis compañeros se fueron más por un videojuego.','2025-03-25'),(8658,409,'Modulo 4, 5 y 6','Hoy estuve trabajando en terminar los modulos 4, 5 y 6, los cuales trataron sobre cuestionarios en base al pdf &quot;Guia de empresas simuladas&quot;, con el cual tuve que trabajar, tambien estuve formando el guion para lo que seria el tp 9, enfocandome en mis habilidades sobre ciberseguridad y desarrollo, para poder grabarlo en mi casa y mañana empezar con los cursos de linkedin y empezar a charlar formalmente el proyecto de practicas profesionalizantes con mis compañeros y profesores.','2025-03-25'),(8659,412,'Modulo 2 ','finalice la tarea 2 del mapa conceptual del modulo 2','2025-03-25'),(8660,371,'CV (casi terminado)','El dia de hoy estuve hacinedo mi CV para los trabajos/pasantias y estaba viendo que me falta capacitarme mas en un par de cosas (idioma, lenguages de programacion, algun que otro proyecto personal, etc), ahora cuando vuelva a mi casa termino el modulo 3 y seguire con los demas y vere como seguir jajaj.','2025-03-25'),(8661,363,'Iniciamos con las ideas del proyecto','Hoy con mi grupo estuvimos pensando en las ideas que podriamos hacer para nuestro proyecto de practicas profesionalizantes teniendo en cuenta nuestro perfil técnico. Tuvimos varias ideas: Hacer varios tipos de juegos, principalmente multijugador y estrategia, tambien pensamos en hacer mods de optimizacion para minecraft, mods administrativos para garry´s mod, etc ','2025-03-25'),(8662,367,'Completado de las ultimas dos tareas asignadas a los modulos DET','Me encargué de completar la tarea 7 y empezar a adelantar la tarea 9 de la DET, comencé completando las preguntas que habian en el formulario de Google en la tarea 7. Posteriormente, empezamos a grabar el video que nos pide la tarea 9 en un aula, buscando grabarlo de una manera mas dinamica y divertida. ','2025-03-25'),(8663,375,'Tarea N3 Modulo DET','Hoy hice la tarea n°3 del segundo Modulo DET, el cual consistía en un formulario sobre las habilidades blandas.','2025-03-25'),(8664,360,'25/3/2025','El día de hoy terminé la tarea N°5 y 6 de los módulos de prácticas profesionalizantes.','2025-03-25'),(8665,367,'Realización del vídeo para la tarea 9.','Estuve centrado en la realización de la obra audiovisual para la tarea 9 en la que tengo que hacer una presentación sobre mi persona, relacionado a PP. ','2025-03-26'),(8666,371,' Finalizacion del Modulo 4','Vi una empresa simulada que nos permite involucrarnos activamente en la gestión de un negocio, desarrollando competencias clave para mi futuro profesional\r\nVoy a continuar con estas prácticas para mejorar mi preparación laboral','2025-03-26'),(8667,364,'Día de hoy','Avanzando con el TP N°9 y preparando un mini guión para el video','2025-03-26'),(8668,366,'26-3','Hoy estuvimos preparando el video para el modulo 9, ayude junto a roman a kevin y ya hicimos su video, luego voy a hacer el mio. Voy a tratar de hacerlo afuera y que quede bien piola','2025-03-26'),(8669,375,'Tarea N°5 - Modulo DET','Hoy al ingresar al laboratorio, empece a trabajar en la tarea N°5 del 4to Modulo DET.','2025-03-26'),(8670,412,'Tarea 3','hacer el cuestionario y el curriculum','2025-03-26'),(8671,370,'Bitácora de PP día 26 de Marzo, 2025','hoy dedique todo el día a hacer el trabajo practico numero 7 de practicas profesionalizantes y deje empezado el trabajo practico numero 6. No hubo conflictos','2025-03-26'),(8672,409,'Certificaciones Microsoft-Linkedin','hoy estuve trabajando en la mitad del módulo de LinkedIn sobre Fundamentos Profesionales en Ciberseguridad, en este curso se profundiza en la comprensión de los términos específicos del campo de la seguridad informática y se exploran las principales amenazas cibernéticas actuales. Esto permite al que hace el curso comenzar a integrar el vocabulario técnico esencial y a familiarizarse con los riesgos más comunes que enfrentan las organizaciones, sentando las bases para entender cómo proteger los sistemas y la información','2025-03-26'),(8673,362,'modulo 6 del DET, modulo 2 del DET y modulo 9 del DET aun en proceso','termine el modulo 2 y 6 del DET, y postergue el modulo 9 del DET para cuando tenga los recursos','2025-03-26'),(8674,408,'Creación de la carpeta de campo','Hoy me encargue de hacer la carpeta de campo de nuestro proyecto.\r\n\r\nDesde que discutimos el nombre del proyecto y lo que iba a realizar hasta lo que tachabamos.\r\n\r\nAun no nos ponemos de acuerdo en que va a consistir el proyecto.\r\n\r\nA futuro mejorar esto, comunicación de equipo....','2025-03-26'),(8675,365,'Planificación de diagramas','Empezamos a planificar los diagramas para el desarrollo adecuado del proyecto, lo que implicaba el Diagrama de Gantt y el de Entidad-Relación (base de datos). No avanzamos demasiado, pero dejamos ciertas bases establecidas.\r\n\r\n','2025-03-26'),(8676,361,'Avance tareas futuras','Adelanté el comienzo de ciertas tareas requeridas. Como los cursos de Linkedin. También debatimos la idea de proyecto en grupo buscando puntos de vista, opciones, objetivos, etc.','2025-03-26'),(8677,380,'Quinta clase de PP','Segui trabajando con el módulo 5 y empecé a pensar como hacer el vídeo del último módulo','2025-03-26'),(8678,369,'Curso de Linkedin','comence el curso de linkedin y termine un formulario de un modulo','2025-03-26'),(8679,373,'Planificación de Diagramas ','Empezamos a planificar los diagramas para el desarrollo adecuado del proyecto, lo que implicaba el Diagrama de Gantt y el de Entidad-Relación (base de datos). No avanzamos demasiado, pero dejamos ciertas bases establecidas.','2025-03-26'),(8680,360,'26/3/2025','El día de hoy en la clase de prácticas profesionalizantes continué y terminé la tarea N°7 y estuve modificando mi perfil de LinkedIn y hablé con mi grupo para sentar las bases de nuestro proyecto.','2025-03-26'),(8681,368,'Comienzo del video de presentación','Comienzo el desarrollo del video de presentación de mi persona, para que las empresas me conozcan mejor, sepan sobre mis interés y aptitudes con el fin de que las mismas estén interesadas en contratarme','2025-03-26'),(8682,378,'Modulo 5','Hoy trabajé y terminé los trabajos del modulo 5.','2025-03-26'),(8683,374,'Trabajo','En el dia de hoy una vez terminado los modulos y haber entregado todo los TP he trabajado en mi empresa en donde estoy construyendo el panel admin con retool y ademas he tenido una meet con un cliente para un parnership','2025-03-26'),(8684,363,'Empezamos a diagramar','Hoy en grupo empezamos a planificar los diagramas para el desarrollo adecuado del proyecto, lo que implicaba el Diagrama de Gantt y el de Entidad-Relación (base de datos). No avanzamos demasiado, pero ya tenemos una idea de como van a ser y como nos vamos a distribuir alguna tareas.','2025-03-26'),(8685,406,'26/03/25','Hoy terminé de hacer la tarea n°1 y empezé con la tarea n°2','2025-03-26'),(8686,401,'27-03-2025','Estuve trabajando en los últimos trabajos de la materia, el número 2 y el número 6. Avancé bastante en ambos, pero aún me falta pulir algunos detalles. También empecé a hacer mi CV para tenerlo listo y poder terminar todo. Al final de la hora, se fue el internet y no pude avanzar más, pero espero retomar todo pronto.','2025-03-27'),(8687,386,'27/3','Trabaje en mi cv, aunque existieron muchos problemas a causa del internet, gran parte de la clase se dio sin wifi, y eso dificulto llevar a cabo las tareas.','2025-03-27'),(8688,384,'27/03/2025','Lo que estuve haciendo hoy es terminar partes de los trabajos y empezar a hacer el MVP del proyecto con el cliente, trabajando con la API de payway.','2025-03-27'),(8689,391,'DIA V','Me puse a escribir el guión para la tarea N°9 que es el video informativo sobre pp','2025-03-27'),(8690,402,'Quinta clase','Con Agustina Heck, trabajé en la tarea 5 del módulo 4, y terminamos la tarea 2 del módulo 2','2025-03-27'),(8691,407,'27-03-2025','Comencé a hacer arreglos para contactar mi posible cliente y terminé el módulo 3','2025-03-27'),(8692,387,'27-03','En el día de hoy empece arreglando ciertos errores del código de JS en el proyecto, luego de un rato el internet se corto durante 2 horas y pico, volviendo a las 17:20. También entregue el anteúltimo modulo que me faltaba por completar, el cuestionario de las 38 preguntas','2025-03-27'),(8693,383,'Quinto Dia',