reiniciaron por accidente, de igual manera voy a continuar en mi cada con las vistas \r\n','2025-05-27'),(9136,361,'Avance desarrollo autenticacion','Avancé con el método de autenticación del inicio de sesión de nuestra página web. El día de hoy hice progresos en la parte de front del Login, donde el usuario ingresará su usuario y contraseña para verificar su ingreso','2025-05-27'),(9137,360,'Investigación de APIs','En la clase de hoy de Prácticas profesionalizantes,  estuve añadiendo cosas al backlog del Jira e investigué un poco más de Next.js para nuestro proyecto. ','2025-05-27'),(9138,380,'Vigésima primera clase de PP','En la clase de hoy seguí con mi investigación sobre el lenguaje de programación que vamos a utilizar para el proyecto','2025-05-27'),(9139,410,'bitacora 27/5/2025','hoy ayude a mi compañero a terminar los ultimos puntos de la documentacion.','2025-05-27'),(9140,379,'Bitacora 27/5','Hoy me dediqué a terminar los últimos puntos de la documentación, principalmente las ultimas vistas del figma y a organizar el grupo asumiendo mi rol de scrum master. También estuvimos anticipando la programación del primer sprint para cuando llegue la corrección de nuestra documentación ','2025-05-27'),(9141,362,'investigación de el producto y planeación de la metodología de trabajo a futuro','estuve viendo videos de backend y charlando con mi grupo de una metodología de estudio para implementar e la semana','2025-05-27'),(9142,370,'Bitácora de PP día 27 de Mayo, 2025','Hoy en Prácticas profesionalizantes nos dedicamos junto a mi grupo a rediseñar el boceto de nuestro catálogo web para nuestro cliente','2025-05-27'),(9143,408,'27/05/2025','Actividad realizada:\r\nActualización y ampliación del diseño del sistema en Figma.\r\n\r\nDetalle:\r\nSe retomó el diseño original que incluía las vistas: Inicio de sesión, Inicio, Stock, Ventas, Reportes y Configuración. A partir de un análisis más profundo del funcionamiento requerido y de las nuevas necesidades de las franquicias, se inició la incorporación de nuevas pantallas y funcionalidades que permiten una visión más integral del negocio.\r\n\r\nEntre las principales mejoras aplicadas se encuentran:\r\n\r\nReestructuración de la pantalla de Inicio, incorporando un panel de estado general del negocio.\r\nEste panel incluye:\r\n\r\nInformación resumida de las sucursales.\r\n\r\nEstado actual del stock.\r\n\r\nRegistro de productos vendidos.\r\n\r\nAlertas automáticas de bajo stock y productos vencidos.\r\n\r\nSección de accesos rápidos a funcionalidades clave.\r\n\r\nSe planificó la integración de estas nuevas funciones en la experiencia principal del usuario, priorizando la centralización de información útil y la rapidez en la toma de decisiones operativas.\r\n\r\nObjetivo de la jornada:\r\nOptimizar el diseño de la interfaz para ofrecer una visión global clara y accesible desde el inicio, mejorando la eficiencia y la respuesta ante situaciones críticas del negocio (como quiebres de stock o vencimientos).\r\n\r\nEstado:\r\nProgreso activo. Nuevas pantallas en desarrollo y funciones clave en proceso de integración dentro del archivo Figma actualizado.','2025-05-27'),(9144,411,'28/05/2025','hoy me puse a ver videos del curso de react y de typescript y hice algunas cosas de un curso','2025-05-28'),(9145,406,'28/05','Hoy mi trabajo del informe final','2025-05-28'),(9146,409,'ruta /uploads/','Hoy estuve trabajando en la implementación de un endpoint en NestJS para la carga de imágenes mediante formularios multipart/form-data. Configuré correctamente el módulo upload utilizando @nestjs/platform-express junto con multer, definiendo una lógica de almacenamiento local con diskStorage y validaciones básicas de tipo de archivo. Además, resolví errores relacionados con rutas incorrectas en curl, configuración del entorno de NestJS, y ajusté la estructura del proyecto para que sea modular y escalable. Se realizaron pruebas fallidasde subida de archivos y se verificó el incorrecto funcionamiento del backend desde terminal.','2025-05-28'),(9147,414,'correcion de informe','Hoy estuve haciendo la correcion de los sistemas pre-existentes de el Informe Final y haciendo la correcion de la descripcion del foda en el documento','2025-05-28'),(9148,364,'Día de hoy','Investigación de react','2025-05-28'),(9149,412,'Documentacion del caso de uso completo y actializado','consultado con consorti de como hace un buen caso de eso, que hasta cambie todo y tuve que rehacer . lptm\r\n','2025-05-28'),(9150,380,'Vigésima segunda clase de PP','En la clase de hoy estuve investigando sobre el lenguaje de programación que vamos a utilizar para el proyecto, está vez de forma más leve que la anterior clase','2025-05-28'),(9151,361,'Problemas autenticación','Estoy teniendo complicaciones para la autenticación del login de la página. Estoy probando varias cosas pero no tengo mucha idea de qué es lo que debería hacer. Seguiré probando...','2025-05-28'),(9152,362,'actualización de base de datos y creación de vistas faltantes','actualice la base de datos agregando campos a las tablas y intentando hacerlo expandible (no me salio) y agregue la vista de menú y de pedidos personalizados','2025-05-28'),(9153,365,'Desarrollo Sprint 3','Hoy estuve trabajando en el desarrollo de las vistas de login utilizando Shadcn UI junto con Tailwind CSS. Implementé componentes reutilizables que facilitan la consistencia visual y la accesibilidad. La combinación de ambas herramientas permitió crear una interfaz limpia, moderna y responsiva. También personalicé algunos estilos para adaptar el diseño a los requerimientos específicos del proyecto.\r\n\r\n','2025-05-28'),(9154,375,'Investigacion sobre NextJS y Desarrollo','Hoy estuve investigando para poder desarrollar la vista de pagina principal en nuestro proyecto y empece tambien su desarrollo junto con otra vista, la de inicio de sesion.','2025-05-28'),(9155,375,'Investigacion sobre NextJS y Desarrollo','Hoy estuve investigando para poder desarrollar la vista