s pero para empleados','2025-06-19'),(9379,383,'19-06','En el dia de hoy tuve que ayudar a alan con una modificacion de una tabla intermediaria entre la relacion de stockInv y pedidos para facilitar la relacion de datos ya que es una relacion de M &lt;-&gt; M','2025-06-19'),(9380,400,'Clase 26','Hoy guie a mis compañerons a lanzar el sistema, esto incluye cada paso de instalacion, luego cree las nuevas rutas para las paginas de registro de autos y asistencias, investigue que pasa cuando dos personas modifican un mismo archivo pero no en la misma linea. ayude a mis compañeros con el inventario y home. ordene los prodcutos y se intento conseguir una url mediante drive. no se pudo','2025-06-19'),(9381,406,'24/06','Hoy seguí con lo del Jira porque me equivoqué en algunas cosas ','2025-06-24'),(9382,368,'Introducción al Análisis Comercial','En el día de hoy aprendí sobre el análisis comercial, un proceso que permite identificar las necesidades del negocio y recomendar soluciones adecuadas para cumplir objetivos estratégicos. También revisé el rol del analista comercial como agente de cambio, que facilita la gestión de requisitos y la implementación de soluciones. Además, exploré las habilidades esenciales para esta función, como el pensamiento crítico, la comunicación efectiva y la resolución de problemas, que son clave para aportar valor al negocio.','2025-06-24'),(9383,374,'Avances en la docuu de github y proyecto','He terminado con la docu/organizacion del github y a su vez cree el proyecto para arrancar a programar \r\n','2025-06-24'),(9384,411,'24/06/25','hoy lo que hice fue ver el curso de react y un toque de la docmentacion de next.js ','2025-06-24'),(9385,375,'Tareas de Streambe','Hoy estuve completando las tareas de streambe, hice los trabajos practicos 1, 2  y 3, usando html y css.','2025-06-24'),(9386,382,'24/6','Organice de nuevo el jira y agregué cosas a la carpeta de campo ','2025-06-24'),(9387,369,'linkedin','en el dia de hoy segui con el curso de linkedin