o hoy:\r\nDiseño funcional: 3 h\r\n\r\nOrganización de vistas: 1.5 h\r\n\r\nDefinición de datos para limpieza y horarios: 1 h\r\n\r\nDocumentación y bitácora: 30 min\r\n\r\n','2025-06-24'),(9393,376,'Bitacora 24/6','hoy realice una daily con un compañero sobre la sprint 1 del proyecto y realice los cursos de refuerzo que puso consorti en el classroom','2025-06-24'),(9394,365,'','Durante el día de hoy se estuvo trabajando con Streambe en la mejora de la documentación (carpeta de campo). Se realizaron tareas enfocadas en el uso de Streambe y en la optimización de los contenidos presentes en la carpeta de campo, con el objetivo de mejorar la organización y claridad de la documentación existente.','2025-06-24'),(9395,373,'Completando trabajos de StreamBE','En el día de hoy me encargué de completar las tareas pendientes que tengo de StreamBe. Hoy en particular use las horas para realizar y hacer la entrega del trabajo práctico numero 4 de StreamBe que básicamente consistía en trabajar con window.alert() y javascript para hacer una calculadora de jubilaciones con ciertas condiciones.','2025-06-24'),(9396,372,'bitacora de PP 24 de junio de 2025','el dia de hoy continuamos en jira nuestras tareas correspondientes e iniciamos con el frontend inicio de nuestro proyecto, empezando tambien y backend.','2025-06-24'),(9397,362,'actualización de el diseño estético del producto con creación de nuevas vistas, finalización de los módulos del DET y investigación sobre frontend (next.js)','Realicé una actualización integral del diseño estético del producto digital, orientada a mejorar la experiencia visual del usuario mediante la aplicación de principios de diseño UI/UX contemporáneos, como el uso de layouts responsivos, tipografías jerarquizadas, espacios negativos bien administrados y una paleta cromática coherente con la identidad del producto. Paralelamente, diseñé y desarrollé nuevas vistas que amplían la estructura funcional del sistema, incorporando componentes reutilizables y patrones visuales consistentes. También finalicé los módulos correspondientes al DET (Diseño Estructural de la Tecnología), asegurando su integración estética y funcional con el resto del sistema. Finalmente, llevé a cabo una investigación técnica sobre herramientas y frameworks de desarrollo frontend, con énfasis en Next.js, analizando su sistema de renderizado híbrido (SSR/SSG), enrutamiento dinámico y capacidades de optimización del rendimiento, para fundamentar decisiones futuras en el diseño y construcción del producto.','2025-06-25'),(9398,369,'pagina proveedores','en el dia de hoy empece con la pagina de administrar proveedores, tuve un poco de dificultades al no tener el boceto de figma pero la estuve haciendo de igual manera y haciendo que sea responsive','2025-06-25'),(9399,371,'Inicio de carpeta de campo y vista de stock','Ya empece a hacer la carpeta de campo, le pedí a chatgpt que me haga un prompt para porder organizarme en la carpeta de campo y ahora tengo que empezar en la pagina stock del e-ecommerce','2025-06-25'),(9400,364,'Día de hoy','Continue con TypeScript','2025-06-25'),(9401,411,'25/49','hoy lo que hice fue ver los videos y los voy a seguir en mi casa ','2025-06-25'),(9402,376,'Bitacora 25/6','hoy investigue para el sprint 1 y seguí con la guia que puso el profesor \r\n ','2025-06-25'),(9403,374,'Subida de archivos basicoo para el trabajo','En el dia de hoy he terminado mis tareas del jira del sprint','2025-06-25'),(9404,381,'Reunion + Botón','Nos pusimos en marcha con el Sprint. Primero tuvimos una reunión y después hice un botón tomando de base el ShadCN/UI. También estuve completando carpeta de campo mientras tanto.','2025-06-25'),(9405,366,'react y next','hoy termine el curso de react y arranque otro de next','2025-06-25'),(9406,412,'sprint 3','parte de get y post en next','2025-06-25'),(9407,379,'Bitacora 25/06','Tuvimos una charla gurpal sobre la investigación y colaboré a corregír los errores de la documentacion','2025-06-25'),(9408,36