edin y Vistas en figma','El día de hoy continúe el curso de linkedin en la parte &quot;marcos de trabajo como protección frente a las ciberamenazas&quot; y después me puse a hacer un par de vistas en figma más específicamente &quot;agregar proveedores&quot; y &quot;agregar marcas&quot;. También definimos con el product owner que la vista que había hecho anteriormente (gestionar categoría) no sería necesaria ya que categoría no seria nada mas qe algo que aparece en un menú desplegable de la vista de productos','2025-07-02'),(9470,371,'Seguimiento de la carpeta de campo y documentacion de la vista completada ','ayer llegue hasta las 23 paginas y ahora expandi hasta las 34 paginas pero puede que me puedan dar de baja 2 :,(, todo gracias a la vista pedido.\r\nTodavia no eh podido recuperar la cuenta de likedin, pero mañana voy a penerme con eso, dios mio, quiero  ','2025-07-02'),(9471,374,'Terminar tp steambe','en el dia de hoy termine con streambe y avance con algunas tareas del siguente sprint para avanza ya que estamos un poco atrasados','2025-07-02'),(9472,409,'Redis','Estuve haciendo los primeros pasos para usar redis en el proyecto','2025-07-02'),(9473,406,'02/07','hoy hice la parte de mi CV','2025-07-02'),(9474,364,'Día de hoy','El streambe de mierda Consorti','2025-07-02'),(9475,368,'Streambe y Apis de Turismo','Me dedique a finaliar el TP 5 y comenzar con el TP 6, luego estuve un rato investigando sobre como implementar las APIs de turismo al script que ya habia creado','2025-07-02'),(9476,375,'Desarrollo de Vista Perfil de Administrador','Hoy estuve haciendo la tarjeta de perfil de usuario la cual contiene su foto y un pequeño texto sobre el, agregue unas tarjetas para mostrar sus productos y estuve dandole mas forma usando css.','2025-07-02'),(9477,362,'actualización de base de datos por error de guardado e investigacion de next.js y node.js para la creación de una API','&quot;Realicé una actualización estructural en la base de datos con el objetivo de corregir un error crítico relacionado con el guardado de registros, el cual afectaba la integridad y persistencia de los datos. Este proceso incluyó la revisión del modelo relacional, la normalización de tablas, y la implementación de restricciones y validaciones a nivel de esquema para evitar la repetición de fallos similares en el futuro. Paralelamente, llevé a cabo una investigación técnica centrada en el ecosistema de desarrollo con Next.js y Node.js, enfocándome particularmente en la arquitectura para la creación de una API REST ful. Analicé aspectos como el manejo de rutas dinámicas mediante la carpeta /api de Next.js, la gestión del ciclo de vida de las peticiones HTTP, la serialización y deserialización de datos en formato JSON, y la conexión eficiente con bases de datos mediante middlewares y ORM como Prisma o Sequelize, a fin de estructurar una solución backend escalable, mantenible y alineada con las mejores prácticas del desarrollo web moderno.&quot;','2025-07-02'),(9478,377,'Bitacora 02/07/2025','Entregué la documentación que tenía preparada y también avancé con la parte de investigación. ','2025-07-02'),(9479,380,'Vigésima novena clase de PP','Durante la clase de hoy, continúe la investigación sobre el lenguaje de programación que vamos a utilizar para el proyecto.','2025-07-02'),(9480,381,'Definir sprint','Traté de terminar mis vistas pero hubieron muchos problemas de conexion. Después definimos el nuevo sprint y me quedé viendo cómo ibamos a hacer las vistas con Figma ya que aun no definimos todo.','2025-07-02'),(9481,373,'Reunión de Scrum Master y Product Owner','En el día de hoy se realizó a cabo una reunión en conjunto a Agustina Gonzalez y Alejandro Favereau para definir cuestiones, problemas o incoherencias en el Figma y ideas sueltas y a su vez avancé un poco en el certificado de LinkedIn','2025-07-02'),(9482,378,'Streambe - Linkedin','El día de hoy estuve avanzando con el curso de linkedin, el cual tuve que cambiar porque el que estaba haciendo no l