rjetas del perfil, los botones para hacer que funcione como un slider no funcionaban asi que lo arregle y, ademas, estuve cambiando la estructura general de como se organizan los elementos de la pagina.','2025-07-08'),(9496,362,'Investigación de next.js','estuve haciendo cursos de react.js, HTML, CSS, JavaScript y TypeScript (todo lo que incluye Next.js)','2025-07-08'),(9497,364,'Día de hoy','Continúe con la carpeta de campo y finalice lo de streambe (streambe de mierda, quien te inventó)','2025-07-08'),(9498,378,'Cursos','El día de hoy continué con el lento progreso y arduo labor de avanzar con el curso de fundamentos profesionales en ciberseguridad de linkedin-microsoft.','2025-07-08'),(9499,409,'curso linkedin','hoy estuve agregando el curso de linkedin a la carpeta de campo','2025-07-08'),(9500,363,'TPs streambe y vista proyecto','Hoy estuve trabajando con los TPs 5 (desafio Fizzbuzz) y 6 (Coding challenge 1) de streambe y tambien hice la vista de crear productos del proyecto principal de la materia ','2025-07-08'),(9501,373,'Completando Carpeta de Campo','En el día de hoy me encargue de completar la carpeta de campo agregando fechas anteriores en las que trabaje y documente mis hitos. Por lo que ordene y reconstruí esos textos, a su vez, agregué lo trabajado en el curso de LinkedIn. ','2025-07-08'),(9502,369,'figma','en el dia de hyo termine de hacer todas las vistas de figma nuevas que se me asigno\r\n','2025-07-08'),(9503,406,'08/07','Terminé parte del CV','2025-07-08'),(9504,360,'Curso de LinkedIn-Microsoft','El dia de hoy en la materia de practicas profesionalizantes continué con el curso de Fundamentos Profesionales de la Ciberseguridad e hice un mini test en el modulo 2','2025-07-08'),(9505,379,'Bitacora 08/07','Revisé mi mail, respondí algunos y luego me puse a finalizar las vistas de mobil de la pagina para la entrega completa de la documentacion','2025-07-08'),(9506,370,'Bitácora de PP día 8 de Julio, 2025','hoy en practicas profesionalizantes estuvimos continuando con nuestro proyecto junto a nuestro grupo, empezando a hacer las distintas secciones de los productos','2025-07-08'),(9507,381,'Linkedin+Microsoft y Carpeta de campo','Dadas las pocas horas disponibles en clase decidimos (con Benja) enfocarnos en cada uno lo suyo. A mi me faltaba terminar el curso de Linkedin+Microsoft, así que estuve avanzando con eso y con la carpeta de campo.','2025-07-08'),(9508,402,'Bitácora ','Hoy estudiamos material con relación al proyecto ','2025-07-11'),(9509,396,'Bitácora ','Hoy estudié material del proyecto ','2025-07-11'),(9510,416,'11-07-2025','','2025-07-11'),(9511,390,'11/07/25','El día de hoy estuve trabajando mucho en la carpeta de campo ya que me hace falta agregar mucha información de tareas pasadas','2025-07-11'),(9512,394,'11/07/2025','En el dia de la fecha estuve editando la carpeta de campo ','2025-07-11'),(9513,386,'11/7','Hoy realmente no se avanzo','2025-07-11'),(9514,401,'11-07-2025','Hoy seguimos con las misma funciones q hay, register y terminando de poner los inserts en la pagina para poder manipularla de mejor manera.','2025-07-11'),(9515,391,'DIA XV','estuve investigando sobre las IAs que podria meter en el proyecto que me presento olaso','2025-07-11'),(9516,415,'11-07-2025','Virtual','2025-07-11'),(9517,392,'11/07/2025','En el dia de hoy la clase se realizo virtual. Avances con el proyecto y la carpeta de campo','2025-07-11'),(9518,397,'Tarea 20','Hoy estuve completando la carpeta de campo y arreglando algo del gantt\r\n\r\n','2025-07-11'),(9519,405,'11/07/25','El día de hoy la clase de practicas profesionalizantes fue no prescencial, investigue más sobre el framework que usaremos','2025-07-11'),(9520,388,'11-07-2025 ','Durante el dia estuve revisando de forma local el funcionamiento de a seccion de empleados para comprobar si cada seccion cumplia su objetivo, luego se pidio la modificación de algunos diseños a franco batalla ya que a él le derive el encargarse del diseño de toda la seccion de emplead