stra formación como técnicos. Hoy tuvimos dos salidas. Una a la escuela La Huergo y otra en Ciudad Universitaria. La primera fue una especie de convención donde varías universidades se reunían para entregar folletos e hacerles llegar a los alumnados que materias o especialidades se cursaban en dicha institución. La misma tuvo varías charlas que se daban simultáneamente en diversos horarios\r\nPor otro lado, fuimos a Ciudad Universitaria cerca de Aeroparque. En el lugar nos hicieron visitar diversos stands con &quot;proyectos&quot; que preparaban los alumnos que cursaban ahí para interiorizarnos en los contenidos de las materias que se cursaban en la institución. A su vez, tuvimos el placer de participar en dos actividades relevantes como lo fue el &quot;Escape Room&quot; que consistía en resolver una serie de &quot;puzzles&quot; que nos servirían para poder resolver el caso que se nos encomendó. Luego tuvimos una actividad de Programación musical donde mediante un programa y una breve introducción al mismo nos enseñaron como tocar notas, o incluso con un poco de creatividad y paciencia, una canción mediante el programa.','2025-07-16'),(9531,371,'Excursión ','Hoy fuimos a la escuela técnica llamada Huergo y a la Ciudad Universitaria pabellón 0+??, donde en estos lugares nos dieron capacitación para ver la carrera que íbamos a tomar para nuestro futuro  ','2025-07-16'),(9532,367,'Fuimos a la Ciudad Universitaria y al Huergo','Estuvimos recorriendo el Huergo, y tambien la ciudad universitaria, en eventos que podrian despertar nuestro interes en seguir nuestra formacion profesional en un instituto universitario. ','2025-07-16'),(9533,374,'Salida didactica','En el dia dehoy fuimos al ciudad universitaria al pabellon 0 infinito por la semana de la computaciom y a elegir la carrera para nuestro futuro','2025-07-16'),(9534,369,'salida didactica','en el dia de hoy tuvimos una salida didactica en el huergo(feria de facultades) y la uba(nos mostraron mas o menos que trabajan en algunas materias) ','2025-07-16'),(9535,379,'Bitácora 16/07','Hoy realizamos dos salidas didácticas a la et n9 como a ciudad universitaria, en la et n9 tuvimos varias charlas sobre carreras y universidades y en ciudad universitaria hicimos actividades sobre diferentes carreras guiadas por estudiantes','2025-07-16'),(9536,379,'Bitácora 16/07','Hoy realizamos dos salidas didácticas a la et n9 como a ciudad universitaria, en la et n9 tuvimos varias charlas sobre carreras y universidades y en ciudad universitaria hicimos actividades sobre diferentes carreras guiadas por estudiantes','2025-07-16'),(9537,414,'Salida didáctica ','Hoy fuimos a la salida didáctica.\r\nLa primera fue la de el Huergo dónde tuvimos una charla en el auditorio y después fuimos a la uba donde tuvimos distintas actividades.','2025-07-16'),(9538,365,'Salida didáctica ','El día de hoy nos dirigimos a la Escuela Técnica N.º 9 &quot;Luis Huergo&quot;. El motivo de la visita fue asistir a diferentes charlas vocacionales organizadas con el propósito de brindarnos una visión a futuro sobre las carreras universitarias a las que podríamos aspirar. La jornada estuvo orientada a estudiantes de nivel secundario próximos a egresar, en un momento donde se vuelve fundamental pensar en el camino a seguir una vez finalizada esta etapa.','2025-07-16'),(9539,408,'15 y 16/7/25','hoy no vino el profesor, y no estuvo habilitada la bitacora asi que la registro hoy 16/7...\r\n\r\nCrear una interfaz web que permita registrar productos que ingresan al stock, visualizar el historial de ingresos y contar con una navegación lateral funcional.\r\n\r\n???? Tecnologías Utilizadas\r\nHTML5: estructura semántica.\r\n\r\nCSS3: estilos personalizados y diseño responsivo.\r\n\r\nJavaScript: manipulación DOM, lógica del formulario, control de fecha/hora y menú interactivo.\r\n\r\n???? Etapas de Desarrollo\r\n???? 1. Estructura base HTML\r\nSe creó una estructura dividida en dos partes:\r\n\r\nMenú lateral (sidebar) con accesos a diferentes funciones del sistema.\r\n\r\nSección principal (main-content) con:\r\n\r\nTítulo: &quot;PRODUCTO RECIBIDO&quot;.\r\n\r\nFormulario para cargar productos.\r\n\r\nTabla para el historial de productos ingresados.\r\n\r\n???? 2. Formulario de Registro\r\nCampos incluidos:\r\n\r\nNombre del producto, tipo, descripción.\r\n\r\nCantidad recibida, unidad de medida, estado (nuevo/usado).\r\n\r\nOrigen, trabajador que lo recibió, observaciones.\r\n\r\nAl presionar &quot;Registrar&quot;, los datos se procesan y se agregan a la tabla con fecha y hora en tiempo real.\r\n\r\nSe utilizó new Date().toLocaleString() para obtener la hora local.\r\n\r\n???? 3. Lógica con JavaScript\r\nPrevención del envío automático del formulario.\r\n\r\nCaptura de datos del formulario y creación dinámica de una nueva fila (&lt;tr&gt;) en la tabla.\r\n\r\nReset del formulario después de cada ingreso.\r\n\r\nCorregido un error de sintaxis: la inserción de HTML debía usarse con template literals (``).\r\n\r\n????? 4. Menú Lateral Interactivo\r\nBotón hamburguesa (?) que despliega/oculta el menú lateral.\r\n\r\nFunción toggleMenu() alterna clases CSS (.open, .shift) y oculta el botón cuando el menú está abierto.\r\n\r\nSe reemplazó el antiguo ícono de logo por el botón de &quot;???? Casa&quot;.\r\n\r\nEl botón hamburguesa fue reubicado donde antes estaba el logo.\r\n\r\n???? 5. Mejoras progresivas\r\nSe implementó una tabla que organiza los datos en orden cronológico inverso (los más recientes arriba).\r\n\r\nSe añadió un buscador por nombre de producto, eliminando el filtro por fecha a pedido del usuario.\r\n\r\nSe centró el título &quot;Historial de productos ingresados&quot;.\r\n\r\nSe agregó en la esquina superior derecha un círculo con la palabra “Perfil” como elemento visual representativo del usuario activo.\r\n\r\n???? Diseño Visual (CSS)\r\nPaleta de colores:\r\n\r\nFondo: #F6F2DE (beige claro)\r\n\r\nElementos principales: #5D3A32 y #3E2723 (tonos marrón y chocolate)\r\n\r\nFuentes legibles y modernas.\r\n\r\nBotones estilizados con hover suave.\r\n\r\nFormulario en cuadrícula (grid) para mejor organización.\r\n\r\nTabla con contrastes claros para una visualización óptima.\r\n\r\n???? Resultados\r\n? Funcionalidad completa de registro de producto.\r\n\r\n? Menú responsive y dinámico.\r\n\r\n? Historial visualmente ordenado.\r\n\r\n? Mejora progresiva con filtros y perfil visual.\r\n\r\n? Código optimizado, limpio y funcional.\r\n\r\n???? Pendientes o ideas futuras\r\nConexión a base de datos real (backend).\r\n\r\nAutenticación de usuarios.\r\n\r\nExportación del historial en CSV o PDF.\r\n\r\nDiferenciación por roles (trabajador, supervisor, administrador).\r\n\r\nNotificaciones de productos en bajo stock.\r\n\r\nhoy 16/7/25 tuvimos salida para charlas de facultad\r\n\r\nestuvimos en el huergo con facultades referente a nuestra carrera, la cual me fui por DISEÑO GRAFICO, hable con gente de la UADE y otra facultades referente al diseño, luego a la tarde tuvimos que ir a la ciudad universitaria, la cual nos dieron al principio proyectos para probar o juegos referente a programacion o juegos, gicimos sala de escape a un estilo de programacion y luego fuimos a otra aula donde pudimos hacer musica con codigo etc...\r\n\r\n','2025-07-16'),(9540,360,'Excursión a la escuela técnica Nº9 y a Ciudad Universitaria, UBA','El día de hoy en prácticas profesionalizantes fuimos a la escuela técnica Nº9 y nos dieron una charla de orientación vocacional así como muchos stands donde distintas universidades tales como la UADE, UCA, y la UTN nos ofrecian sus carreras y nos explicaban como funcionaban sus materias curriculares, recibí multiples folletos. Después fuimos a la Facultad de ciencias exactas y naturales UBA en Ciudad universitaria donde ofrecian Licenciatura en Ciencia de datos y licenciatura en ciencias de la computación y estuvimos recorriendo un rato, probando juegos interactivos que tenían.','2025-07-16'),(9541,364,'Día de hoy','Hoy tuvimos dos salidas didacticas a la escuela tecnica N°9 &quot;Huergo&quot; y la ciudad universitaria, las dos salidas se basaban en carreras, linceciaturas, etc.','2025-07-16'),(9542,381,'Excursiones','Fuimos a la expo universitaria en el Huergo, donde daban charlas vocacionales y hablaban de algunas opciones de universidades. Después fuimos a la uba por la semana de las siencias. Hoy específicamente estaba dedicado a la computación y análisis de datos, nos enseñaron alguunos juegos y &quot;trucos&quot; con algoritmos tipicos y algunas otras actividades.','2025-07-16'),(9543,406,'16/07','Hoy fuimos a la huergo y nos dieron varias charlas de cursos y después fuimos a la Ciudad universitaria que ahí hicimos juegos de computación ','2025-07-16'),(9544,378,'salidas','El día de hoy tuvimos el placer de disfrutar de dos salidas didácticas. Una al huergo para charlas universitarias y otra a la ciudad universitaria por las semanas de las ciencias','2025-07-16'),(9545,380,'trigésima clase de PP','En el dia de hoy fuimos a dos excursiones, una a la tecnica N°9 y la otra a la UBA. En la primera excursión estuvimos teniendo algunas charlas sobre algunas carreras, ya sea que tengan que ver con computación o no, y en la UBA estuvimos teniendo algunas series de mini juegos, como trucos de magia o retos, y tambien juegos mas grandes como programar una canción o un escape room. La verdad muy buena ambas excursiones aunque me gusto mucho mas la segunda, debido a que no soy tanto de charlas','2025-07-16'),(9546,376,'Bitacora 16/7','Hoy fuimos a la mañana al colegio Huergo a una exposición de facultades y cursos, donde recorrimos distintos stands informativos y asistimos a varias charlas sobre carreras y opciones educativas. A la tarde visitamos Ciudad Universitaria, donde realizamos dos actividades, la primera consistía en resolver un puzzle grupal con la consigna de “salvar la UBA” y la segunda fue una experiencia con el programa Sonic Pi, que nos permitió crear música mediante programación, combinando creatividad con tecnología.','2025-07-16'),(9547,366,'ciudad universitaria y huergo','Hoy fuimos a la mañana al Huergo donde habían muchos stands de distintas universidades y charlas informativas. Luego fuimos a ciudad universitaria en donde hicimos varias actividades relacionadas con la computación','2025-07-16'),(9548,361,'Excursiones','El día de hoy fuimos, durante el horario de las prácticas profecionalizantes, al edificio de la materia de computación de la facultad de ciencias exactas y naturales de la Universidad de Buenos Aires. Durante esta salida didáctica se nos presentaros temas relacionado a lo que se ve en esta carrera así como ','2025-07-16'),(9549,400,'Clase 31','Hoy hicimos un examen integrador de 70 preguntas de eleccion multiple en wayground','2025-07-18'),(9550,397,'clase 22','Hoy tuvimos un examen integrador ','2025-07-18'),(9551,404,'18/7/2025','Hoy estuve realizando el examen integrador, en el cual saque un 67%','2025-07-18'),(9552,395,'18-07-2025','Hoy tuvimos un examen integral\r\n','2025-07-18'),(9553,407,' 18-07-2025','En el día de hoy realizamos el examen integrador de todas las materias y terminé la carpeta de campo','2025-07-18'),(9554,390,'18/07/25','Hoy tuvimos un examen integrador.','2025-07-18'),(9555,416,'18/07','Hoy hicimos un examen integradores 72 preguntas','2025-07-18'),(9556,398,'18-07-2025','Hicimos el examen integrador y me saqué un 6 ????','2025-07-18'),(9557,401,'Examen integrador','Hoy tuvimos el examen integrador, y solo eso no se pudo avanzar con el proyecto','2025-07-18'),(9558,387,'18-07','En el día de hoy tuvimos el examen integrador de la especialidad ','2025-07-18'),(9559,399,'18-07-25 Clase 32','Hoy tuvimos una evaluacion integradora de todas las materias','2025-07-18'),(9560,386,'18/7','Realizamos prueba integradora del área de computación ','2025-07-18'),(9561,383,'18-07','En el dia de hoy estuve todo la hora haciendo hojas de la carpeta de campo que se entrega hoy','2025-07-18'),(9562,405,'18/07/25','El día de hoy, realizamos el examen integrador en el horario de PP, es un examen para medir los conocimientos de todas las materias de la especialidad','2025-07-18');
